import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as f,q as D}from"./chunks/framework.B1z0IdBH.js";const v={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},C=["src","alt"],z={class:"entry-content"},j={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,c,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,C)]),i("div",z,[i("h2",j,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const M=g(v,[["render",x],["__scopeId","data-v-8e0f04ad"]]),P=JSON.parse(`[{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D1%8E%D1%80%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Rurikname.JPG","page_title":"Рюрик","context_page_description":"Рюрик е варяжки военачалник, вероятно шведски викинг от народността рус, който през 862 установява контрол над Ладога и построява селището Холмгард в Новгород. Според наличните сведения, Рюрик остава на власт до смъртта си през 879. След неговата смърт властта е поета от Олег, който управлява повече от 30 години от името на сина на Рюрик, княз Игор.\\nНачинът, по който Рюрик завладява Ладога и Новгород, е спорен. Единствената информация за него се съдържа в Начална руска летопис от 12 век, където се казва, че той е поканен от местните племена, искащи установяването на ред в страната. Според някои историци самото съществуване на Рюрик е легенда.\\nНаследниците на Рюрик, династията на Рюриковичите, преместват столицата в Киев, създавайки Киевска Рус, оцеляла до монголските нашествия. Няколко днешни княжески рода произлизат по права линия от Рюрик, макар че последният Рюрикович, управлявал Русия, е Василий IV, умрял през 1612."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%8A%D9%83_%D9%81%D9%88%D8%B3%D9%83%D9%88%D9%87%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Jake_Voskuhl.jpg","page_title":"جيك فوسكوهل","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجيك فوسكوهل لاعب كرة سله من امريكا."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_deutschen_Abgeordneten_zum_EU-Parlament_(2004%E2%80%932009)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Werner_Langen.png","page_title":"Liste der deutschen Abgeordneten zum EU-Parlament (2004–2009)","context_page_description":"Die Liste der deutschen Abgeordneten zum EU-Parlament (2004–2009) listet alle deutschen Mitglieder des 6. Europäischen Parlamentes nach der Europawahl in Deutschland 2004."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A7%D8%B1%D9%83%D9%88_%D8%A8%D8%A7%D8%B3%D8%A8%D8%A7%D9%84%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/%C5%BDarko_Paspalj_Vujcic_photo.jpg","page_title":"جاركو باسبالى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجاركو باسبالى لاعب كرة سله من يوجوسلافيا."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%9B%95%E9%BD%92%E7%8D%B8%E4%BA%9E%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Doedicurus_BW.jpg","page_title":"雕齒獸亞科","context_page_description":"雕齿兽亚科是一类大型及重装甲的动物，现今犰狳的近亲。它们首先于中新世的南美洲演化出来，且保留了它们的物种多样性中心。但当巴拿马地峡于三百万年前形成后，几个物种向北扩散，是为南北美洲生物大搬风的一部分。\\n雕齿兽亚科的特征是它们那像龟的甲壳，是由骨板所组成。雕齿兽亚科的每一个物种都有其独特的骨板形状及壳，这个甲壳就像龟的一样，不过它们不能把头缩入壳内，取而代之是在头颅骨顶有一个骨冠。雕齿兽亚科的尾巴有环形骨作为保护。星尾兽甚至有一个像大星尾锤的尾巴，可以抵御其他星尾兽及猎食者。雕齿兽亚科的体型亦可以保护它们，如雕齿兽就有一辆车的大小。重装甲可以预先制衡大型及强壮的猎食者。当雕齿兽亚科演化时，南美洲最高位的猎食者是巨大而不能飞的骇鸟。\\n雕齿兽亚科在最后的冰河时期与其他的大型动物一同灭绝。它们较为轻盈及灵活的亲属在北美洲生存下来及开枝散叶。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%80%9A%E7%94%A8%E6%A9%9F%E6%A7%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/PEO_M240B_Profile.jpg","page_title":"通用機槍","context_page_description":"通用机枪，也叫轻重两用机枪，是一种多用途的机枪，可执行轻机枪及中型机枪的任务，轻型设定时可由单人携带。近代的通用机枪采用气泠设计，发射7.62×51 NATO或7.62×54R中口径全威力弹药，附有两脚架亦可装在三脚架上或车辆上。"},{"page_url":"https://sv.wikipedia.org/wiki/Nicef%C3%B6rdraget","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Signature_of_Jozias_van_Aartsen_%28Nice_Treaty_FA_the_Netherlands%29.png","page_title":"Nicefördraget","context_page_description":"Nicefördraget är ett av Europeiska unionens fördrag och trädde i kraft den 1 februari 2003. Fördraget undertecknades i Nice, Frankrike, av medlemsstaternas stats- och regeringschefer den 26 februari 2001. Fördragets syfte var att reformera Europeiska unionen inför utvidgningen med tio nya medlemsstater, som ägde rum den 1 maj 2004.\\nFördraget innebar bland annat att Europeiska kommissionen skulle minskas ner så fort unionen fick 27 eller fler medlemsstater. Enligt fördraget skulle kommissionen då inte längre bestå av en ledamot från varje medlemsstat. Ett par politikområden, däribland tjänstehandel och viseringsregler, överfördes genom fördraget från mellanstatlig till överstatlig nivå.\\nFör att fördraget skulle träda i kraft var det tvunget att ratificeras av alla medlemsstater i enlighet med deras egna konstitutionella bestämmelser. Irland var det enda landet som höll en folkomröstning om ratificeringen. Utslaget i den första folkomröstningen var ett nej, men valdeltagandet var lågt och en ny folkomröstning hölls ett år senare efter att landet hade erhållit vissa politiska garantier. I den andra folkomröstningen röstade folket ja till fördraget."},{"page_url":"https://tr.wikipedia.org/wiki/%C4%B0van_Kr%C4%B1lov","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Krylov_summer_garden.jpg","page_title":"İvan Krılov","context_page_description":"İvan Andreyeviç Krılov, Rus gazeteci, şair, oyun yazarı, çevirmen.\\nİki yüzden fazla fabl yazmış, “Rus La Fontaine’i” olarak tanınmıştır. Rusça’ya büyük bir atasözü ve deyiş hazinesi kazandırmış olan fablleri elliden fazla dile çevrilmiştir.\\nKrılov’un masalları Türkiye’de \\"Keçi Bir Gün...\\" adıyla Tarık Dursun K. tarafından derlenip yeniden yazılmıştır."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bisch%C3%B6fe_von_Merseburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Merseburg%2C_Schloss%2C_Innenhof%2C_017.jpg","page_title":"Liste der Bischöfe von Merseburg","context_page_description":"Die Liste der Bischöfe von Merseburg stellt die Bischöfe des Bistums Merseburg vor.\\nBoso wurde 968 zum ersten Merseburger Bischof gewählt. Von 981 bis 1004 war das Bistum aufgehoben. Religiöses Zentrum war der Merseburger Dom. Das Wappen des Bistums zeigt ein schwarzes Kreuz auf goldenem Grund. In späten Bischofswappen verschmilzt dieses Wappenmotiv mit dem des Familienwappens des jeweiligen Bischofs zu einer Vierung. Die in der Liste dargestellten Familienwappen sind unter anderem Siebmachers Wappenbuch von 1605 entnommen.\\nAls Folge der Reformation löste sich das Bistum auf, das Stiftsgebiet kam 1565 an Kursachsen und war später Teil des kurzlebigen Herzogtums Sachsen-Merseburg. Sächsische Kurfürsten aus dem Haus der Albertiner und in Sekundogenitur deren Söhne traten ab als Verweser bzw. Administratoren auf. In der Gliederung Kursachsens in Kreise und Ämter lassen sich die ehemaligen Bistumsgebiete erkennen. Die späteren Nachfolger können der Liste der Kurfürsten, Herzöge und Könige von Sachsen entnommen werden."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Cheshire_County,_New_Hampshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/HarrisvilleNH_SmithMasonFarm.jpg","page_title":"National Register of Historic Places listings in Cheshire County, New Hampshire","context_page_description":"This is a list of the National Register of Historic Places listings in Cheshire County, New Hampshire.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Cheshire County, New Hampshire, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 153 properties and districts listed on the National Register in the county, including 1 National Historic Landmark District.\\nThis National Park Service list is complete through NPS recent listings posted July 31, 2020."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%BE%85%E6%9D%B1%E9%8E%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/%E7%BE%85%E6%9D%B1%E6%9E%97%E5%8D%80%E7%AE%A1%E7%90%86%E8%99%95%E8%B2%AF%E6%9C%A8%E6%B1%A0%E5%8D%80.JPG","page_title":"羅東鎮","context_page_description":"羅東鎮は台湾宜蘭県の鎮。また、宜蘭市に次ぐ宜蘭県の第二都市である。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_H%C3%BCckelhoven","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/H%C3%BCckelhoven_Denkmal-Nr._185%2C_Lungstra%C3%9Fplatz_03_%284550%29.jpg","page_title":"Liste der Baudenkmäler in Hückelhoven","context_page_description":"Die Liste der Baudenkmäler in Hückelhoven enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Hückelhoven im Kreis Heinsberg in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Hückelhoven eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ca.wikipedia.org/wiki/Devoluci%C3%B3_en_calent","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Valla_melilla_0001.jpg","page_title":"Devolució en calent","context_page_description":"En dret migratori, una devolució en calent o devolució sumària és la pràctica, generalment per part dels cossos de seguretat de l'estat, d'expulsar del país a un immigrant irregular en el moment en el qual intenta creuar la frontera, sense ser-li aplicada cap de les proteccions i garanties de la legislació d'estrangeria del país. Tant el Tribunal Europeu de Drets Humans com el Subcomitè per a la Prevenció de la Tortura de Nacions Unides han declarat que les devolucions en calent atempten contra els drets humans.\\nAquesta pràctica és comuna al llarg de la frontera entre Espanya i el Marroc, en les tanques limítrofes de les ciutats autònomes de Ceuta i Melilla. Malgrat els múltiples advertiments per part de tribunals internacionals i d'organitzacions no governamentals, la Guàrdia Civil continua aquesta pràctica en l'actualitat. El juliol de 2015, l'entrada en vigor de la Llei de Seguretat Ciutadana va convertir en legal de forma efectiva aquesta pràctica."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B1%D8%A7%D9%85%DA%AF%D8%A7%D9%87%E2%80%8C%D9%87%D8%A7_%D9%88_%D9%85%D8%B9%D8%A7%D8%A8%D8%AF_%D9%86%DB%8C%DA%A9%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Nikko_pagode.jpg","page_title":"آرامگاه‌ها و معابد نیکو","context_page_description":"آرامگاه‌ها و معابد نیکّو که در فهرست میراث جهانی یونسکو قرار دارد شامل ۱۰۳ ساختمان یا بنا و مجموعه‌های طبیعی اطراف آن است و در نیکو، منطقه توچیگی در ژاپن قرار دارد. این ساختمان‌ها وابسته به دو معبد شینتو و یک معبد بودائی هستند.\\nاز میان این ۱۰۳ ساختمان، ۹ تای آنها به عنوان گنجینه‌های ملی ژاپن برگزیده و ۹۴ تای باقی‌مانده به عنوان دارایی‌های مهم فرهنگی این کشور شناخته شدند. در سال ۱۹۹۹ این اماکن به عنوان میراث جهانی یونسکو ثبت شدند."},{"page_url":"https://sv.wikipedia.org/wiki/Saint-M%C3%A9dard,_Pyr%C3%A9n%C3%A9es-Atlantiques","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Ancienne_maison_de_Saint-M%C3%A9dard_%28Pyr%C3%A9n%C3%A9es-Atlantiques%29.jpg","page_title":"Saint-Médard, Pyrénées-Atlantiques","context_page_description":"Saint-Médard är en kommun i departementet Pyrénées-Atlantiques i regionen Nouvelle-Aquitaine i sydvästra Frankrike. Kommunen ligger i kantonen Arthez-de-Béarn som tillhör arrondissementet Pau. År 2009 hade Saint-Médard 209 invånare."},{"page_url":"https://de.wikipedia.org/wiki/25._November","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Jan_P._Syse.JPG","page_title":"25. November","context_page_description":"Der 25. November ist der 329. Tag des gregorianischen Kalenders, somit bleiben noch 36 Tage bis zum Jahresende."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_%C3%9Ast%C3%AD_nad_Labem","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Radej%C4%8D%C3%ADn_1.jpg","page_title":"Seznam kulturních památek v okrese Ústí nad Labem","context_page_description":"Tento seznam nemovitých kulturních památek v okrese Ústí nad Labem vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Ústí nad Labem včetně částí obce Brná, Církvice, Habrovice, Krásné Březno, Mojžíř, Neštěmice, Střekov, Nová Ves, Sebuzín a Svádov\\nSeznam kulturních památek v Zubrnicích včetně části obce Týniště"},{"page_url":"https://it.wikipedia.org/wiki/Wiener_Staatsoper","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Wien_-_Staatsoper_%281%29.JPG","page_title":"Wiener Staatsoper","context_page_description":"La Wiener Staatsoper è il più celebre teatro di Vienna. Inaugurato nel 1869 come Opera di Corte, è anche uno degli edifici principali della città, detto Erste Haus am Ring.\\nNel 1920 con la caduta della Monarchia asburgica e la nascita della Prima repubblica austriaca assunse l'attuale denominazione.\\nTra i membri della sua orchestra vengono scelti gli elementi per la Wiener Philharmoniker."},{"page_url":"https://sv.wikipedia.org/wiki/Ron_Perlman","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Ron_Perlman_Photo_Op_GalaxyCon_Raleigh_2019.jpg","page_title":"Ron Perlman","context_page_description":"Ronald Francis \\"Ron\\" Perlman, född 13 april 1950 i New York, är en amerikansk skådespelare.\\nPerlman är född i en judisk familj.\\nPerlman fick sitt genombrott i rollen som Vincent i tv-serien Skönheten och odjuret, med Linda Hamilton som motspelare. Han är även känd för rollen som seriehjälten Hellboy och medverkade i serien Sons of Anarchy som gängledaren Clay Morrow. Han har också gjort rösten till karaktären Slade i datorspelet Turok, samt berättarrösten i Fallout-serien."},{"page_url":"https://ca.wikipedia.org/wiki/Trisquela","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Selection_of_carvings_from_the_Castro_de_Santa_Trega.jpg","page_title":"Trisquela","context_page_description":"Una trisquela és un motiu iconogràfic format per tres espirals, tres línies corbades o tres cames humanes flexionades, unides en el centre i disposades amb simetria rotacional. Els seus braços poden girar cap a l'esquerra o cap a la dreta. El nom prové del grec \\"τρισκελής\\", \\"de tres cames\\", format pel prefix \\"τρι-\\", \\"tres\\", i \\"σκέλος\\", \\"cama\\". Malgrat que popularment se l’associa majoritàriament amb els celtes, és un símbol molt antic i molt estès al llarg del continent euroasiàtic, des d’Irlanda, Escandinàvia i Malta fins a l’Índia i Sibèria."},{"page_url":"https://en.wikipedia.org/wiki/Time_Out_(magazine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Time_Out_Hong_Kong_Magazine_Launch_Cover.jpg","page_title":"Time Out (magazine)","context_page_description":"Time Out is a global magazine published by Time Out Group. Time Out started as a London-only publication in 1968 and has expanded its editorial recommendations to 328 cities in 58 countries worldwide.\\nIn 2012, the London edition became a free publication, with a weekly readership of over 307,000. Time Out's global market presence includes partnerships with Nokia and mobile apps for iOS and Android operating systems. It was the recipient of the International Consumer Magazine of the Year award in both 2010 and 2011 and the renamed International Consumer Media Brand of the Year in 2013 and 2014."},{"page_url":"https://de.wikipedia.org/wiki/Patrick_Tischler","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/FC_Admira_Wacker_M%C3%B6dling_%282013%29_-_Patrick_Tischler_%2801%29.jpg","page_title":"Patrick Tischler","context_page_description":"Patrick Tischler ist ein österreichischer Fußballtorwart, der beim FC Admira Wacker Mödling in der österreichischen Bundesliga unter Vertrag steht."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%9D%92%E6%A3%AE%E7%B8%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Malus_domestica_Fuji_Apple_Hirosaki_Aomori_Japan_20161016b.jpg","page_title":"青森縣","context_page_description":"青森县是日本本州最北部的一个县，县厅位于青森市。在令制国的时代属于陆奥国。青森县面积约有9645平方公里，约占日本国土面积的约2.5%。人口约有128万，约占日本总人口的1%。青森县内辖有10市、22町、8村，共有40个市町村。青森县历史悠久，发现了三内丸山遗迹等大型绳文时代的遗迹。青森县拥有白神山地，十和田湖、八甲田山、岩木山、佛浦等自然景观。奥羽山脉纵贯青森县中央，山脉西侧的津轻地方和东侧的南部地方各有不同的历史、气候、文化、风土特征。\\n青森县是日本前列的农业县，粮食自给率达117%，苹果、大蒜、牛蒡的产量高居日本第一。八户港是日本前列的渔港，鱿鱼捕捞量位居日本第一。位于青森县东南部的八户临海工业地带是该县主要的工业区，有火力发电厂、造纸厂、电机工厂、造船厂等工厂。下北半岛的陆奥小川原湖地区有众多核能关联设施。此外青森县内还有日本最大规模的风力发电厂。\\n青森县有青森机场和三泽机场两个机场。东北新干线连接了青森和东京两地，北海道新干线则通过青函隧道连接青森和函馆。除新干线外还有青森铁道线、弘南铁道各线路以及JR东日本的奥羽本线等铁道线。县内的主要公路有东北纵贯自动车道、国道4号和国道7号。青森主要的民俗庆典活动则有青森睡魔祭、弘前睡魔祭、五所川原立佞武多、八户三社大祭等。"},{"page_url":"https://de.wikipedia.org/wiki/1761","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/TokugawaIeshige_grave.JPG","page_title":"1761","context_page_description":"Während im Jahr 1761 der Krieg der Großmächte in Nordamerika sowie in Indien praktisch beendet ist, geht der Krieg in Europa mit unverminderter Härte weiter. Es finden jedoch kaum große Schlachten statt, auch weil keine Seite in der Lage ist, zum entscheidenden Schlag auszuholen.\\nIn Indien kommt es mit der Dritten Schlacht von Panipat zur entscheidenden Schlacht, in der das Durrani-Reich unter Ahmad Schah Durrani das Marathenreich besiegt und damit die Macht in der nördlich gelegenen Stadt Delhi übernimmt. Langfristig wird mit der Schlacht jedoch nur der Aufstieg des Britischen Kolonialreichs auf dem Subkontinent begünstigt.\\nDer französische Aufklärer Jean-Jacques Rousseau verfasst mit Julie oder Die neue Heloise einen der größten belletristischen Erfolge des 18. Jahrhunderts, der von der römisch-katholischen Kirche sofort auf den Verbotsindex gesetzt wird. Und der Mediziner Giovanni Battista Morgagni veröffentlicht im Alter von 80 Jahren sein Hauptwerk und begründet damit die moderne Pathologie."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%A1%E1%80%99%E1%80%B1%E1%80%9B%E1%80%AD%E1%80%80%E1%80%94%E1%80%BA%E1%80%95%E1%80%BC%E1%80%8A%E1%80%BA%E1%80%91%E1%80%B1%E1%80%AC%E1%80%84%E1%80%BA%E1%80%85%E1%80%AF%E1%80%94%E1%80%BE%E1%80%84%E1%80%B7%E1%80%BA_%E1%80%A1%E1%80%85%E1%80%AD%E1%80%AF%E1%80%B8%E1%80%9B%E1%80%80%E1%80%A1%E1%80%AC%E1%80%B8%E1%80%95%E1%80%B1%E1%80%B8%E1%80%A1%E1%80%AC%E1%80%B8%E1%80%99%E1%80%BC%E1%80%BE%E1%80%B1%E1%80%AC%E1%80%80%E1%80%BA%E1%80%95%E1%80%BC%E1%80%AF%E1%80%9E%E1%80%B1%E1%80%AC_%E1%80%A1%E1%80%80%E1%80%BC%E1%80%99%E1%80%BA%E1%80%B8%E1%80%96%E1%80%80%E1%80%BA%E1%80%99%E1%80%BE%E1%80%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Frente_Sur_Contras_1987.jpg","page_title":"အမေရိကန်ပြည်ထောင်စုနှင့် အစိုးရကအားပေးအားမြှောက်ပြုသော အကြမ်းဖက်မှု","context_page_description":"အမေရိကန်ပြည်ထောင်စုသည် ကမ္ဘာတဝှမ်းရှိ အကြမ်းဖက်သမားများနှင့် အရန်တပ်ဖွဲ့များအား မဝေးလှသော သမိုင်းကြောင်းတလျောက် မကြာခဏပင် အထောက်အပံ့များပြုခဲ့သည်။ အစိုးရကအားပေးအားမြှောက်ပြုသော အကြမ်းဖက်မှုကို ဖိနှိပ်ရေးနည်းလမ်းအဖြစ် အသုံးပြုခဲ့သော အာဏာရှင်အစိုးရများစွာအတွက်လည်း အထောက်အပံ့များ ပေးခဲ့သည်။\\nအစိုးရကအားပေးအားမြှောက်ပြုခြင်းမဟုတ်သော အကြမ်းဖက်မှုများအား အမေရိကန်ပြည်ထောင်စု၏ ထောက်ပံ့မှုမှာ လက်တင်အမေရိက ၊ အရှေ့အလယ်ပိုင်းနှင့် တောင်အာဖရိကတို့တွင် ထင်ရှားသည်။ အမေရိကန်ပြည်ထောင်စုသည် ၁၉၈၁ မှ ၁၉၉၁ တိုင်အောင် စစ်လက်နက်များ ၊ သင်တန်းများ ၊ ဘဏ္ဍာရေးနှင့်ထောက်ပို့ဆိုင်ရာ ကျယ်ကျယ်ပြန့်ပြန့် ပံ့ပိုးမှုများ ကို နီကရားဂွါ အစိုးရအား ဖက်ပြိုင်တိုက်ခိုက်ရာတွင် အကြမ်းဖက်ဗျူဟာများသုံးသည့် ကွန်ထရာသူပုန်များထံ ပေးခဲ့သည်။ Orlando Bosch နှင့် Luis Posada Carriles ကဲ့သို့ ကျူးဘန်းပြည်ပြေးများအကြားမှ အကြမ်းဖက်သမားများထံ သင်တန်းများ လက်နက်များ နှင့် ရန်ပုံငွေများကို အမေရိကန်ပြည်ထောင်စုက အကြိမ်ကြိမ်ပံ့ပိုးပေးခဲ့သည်။\\nယင်းကဲ့သို့ပံ့ပိုးမှုများအား ရှင်းချက်ထုတ်ရန်အတွက် အကြောင်းပြချက်အမျိုးမျိုးပေးခဲ့သည်။ စစ်အေးကာလအတွင်း ဆိုဗီယက်ပြည်ထောင်စုထံ ဘက်လိုက်နိုင်ဖွယ်ရှိသည့် နိုင်ငံရေးလှုပ်ရှားမှုများ - ရေပန်းစားသော ဒီမိုကရက်တစ် နှင့် ဆိုရှယ်လစ်လှုပ်ရှားမှုများပါမချန် - ပျက်ပြားစေရန် ဟူ၍ ဖြစ်သည်။"},{"page_url":"https://ca.wikipedia.org/wiki/Gas_de_s%C3%ADntesi","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Gazogenerator.jpg","page_title":"Gas de síntesi","context_page_description":"El gas de síntesi és un gas combustible obtingut a partir de substàncies riques en carboni sotmeses a un procés químic a alta temperatura. Conté quantitats variables de monòxid de carboni i hidrogen."},{"page_url":"https://fr.wikipedia.org/wiki/Datarock","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Datarock_jumping_shot_by_Kris_Krug.jpg","page_title":"Datarock","context_page_description":"Datarock est un groupe norvégien de rock électronique. Le groupe s'est créé en 2000 autour de Fredrik Saroea, Ketil Mosnes et Kevin O'Brien, rapidement rejoints par Tom Mæland. Plus tard, O'Brien et Mæland ont quitté le groupe, mais Fredrik Saroea et Ketil Mosnes ont continué en duo."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%A9%E6%B4%A5%E5%B8%82%E5%92%8C%E5%B9%B3%E5%8C%BA%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/%E7%9B%90%E4%B8%9A%E9%93%B6%E8%A1%8C%E5%A4%A7%E6%A5%BC.jpg","page_title":"天津市和平区文物保护单位","context_page_description":"天津市和平區文物保護單位是由中華人民共和國天津市文物局提出，經天津市人民政府批准，上報國務院備案，正式對外公布並豎立標誌的縣級文物保護單位。天津市和平區共有2處國家級文保單位，53處市級文保單位，64處區級文保單位，149處尚未公布為文物保護單位的不可移動文物。共計各級文物建築268處。其中，近代歷史事件發生地6處，近代軍事遺址2處，宗教活動場所3處，歷史風貌建築140處，近代名人舊居111處，革命活動場所6處。"},{"page_url":"https://nl.wikipedia.org/wiki/Antalyaspor","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Antalya_Turkey_Provinces_locator.jpg","page_title":"Antalyaspor","context_page_description":"Antalyaspor, met stamnummer 000051, is een Turkse sportclub uit Antalya.\\nDe clubkleuren zijn rood en wit. Sinds het seizoen 2008-2009 voetballen ze in de Süper Lig. Antalyaspor speelt de thuiswedstrijden in het Antalya Stadion. Antalyaspor houdt zich naast voetbal ook bezig met tafeltennis, atletiek, handbal, judo, waterpolo, zwemmen, triathlon, wielrennen en american football."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_in_Moskau/Zentraler_Verwaltungsbezirk","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Cerkov_znamenia.jpg","page_title":"Liste der Kirchen in Moskau/Zentraler Verwaltungsbezirk","context_page_description":"Dies ist eine Teilliste der Kirchengebäude in Moskau. Gelistet sind alle Kirchen in Moskau, die den Kriterien der Hauptliste entsprechen und sich im Zentralen Verwaltungsbezirk befinden.\\nDie Tabelle ist analog den zehn Tabellen der Hauptliste aufgebaut."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E6%B4%9E%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Namdong-gu_office.JPG","page_title":"南洞区","context_page_description":"南洞区は、大韓民国仁川広域市の区。"},{"page_url":"https://io.wikipedia.org/wiki/Vittorio_Emanuele_la_3ma_di_Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Vittorio_Emanuele_III_%28c._1924-1934%29.jpg","page_title":"Vittorio Emanuele la 3ma di Italia","context_page_description":"Vittorio Emanuele la 3ma esis rejulo di Italia de la 29ma di julio 1900 til la 9ma di mayo 1946. Il anke esis rejulo di Albania de 1939 til 1943 ed imperiestro di Etiopia de 1936 til 1941.\\nNaskinta en Napoli, Rejio Italia, il esis filiulo de Umberto la 1ma e la rejino Margherita de Savoya."},{"page_url":"https://ca.wikipedia.org/wiki/Musulm%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Prayer_in_Cairo_1865.jpg","page_title":"Musulmà","context_page_description":"Un musulmà és qui professa l'islam, una religió abrahàmica monoteista basada en l'Alcorà, que els musulmans consideren la paraula literal de Déu revelada al profeta Mahoma, i, amb menor autoritat que l'Alcorà, els ensenyaments i pràctiques atribuïts tradicionalment a Mahoma. «Musulmà» és una paraula àrab que significa «el que se sotmet a Déu».\\nEls musulmans creuen que no hi ha més que un Déu únic i veritable que es coneix amb el nom d'Al·là. Aquest Déu és etern, transcendent, absolutament un, i incomparable, i és autosuficient, que no engendra ni va ser engendrat. Les creences musulmanes respecte a Déu es resumeixen en el capítol 112 de l'Alcorà, conegut com a al-Ikhlas o «el capítol de la puresa». Els musulmans també creuen que l'Islam és la versió completa i universal d'una fe primordial que es va revelar en molts moments i llocs abans, incloent els profetes Abraham, Moisès i Jesús. Els musulmans sostenen que els missatges anteriors i les revelacions van ser parcialment modificats o danyats amb el temps, però consideren l'Alcorà com a inalterat i la revelació última de Déu."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D8%AA%D8%B1_%D8%AA%D8%A7%D9%8A%D9%84%D9%88%D8%B1_(%D9%83%D8%A7%D8%AA%D8%A8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Robert_Lowell%2C_Jean_Stafford_and_Peter_Taylor_in_1941.jpg","page_title":"بيتر تايلور (كاتب)","context_page_description":"بيتر تايلور ‏‏ روائي، وكاتب، وأستاذ جامعي من الولايات المتحدة."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Osterstein_(Gera)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Schloss_Osterstein_2008.jpg","page_title":"Schloss Osterstein (Gera)","context_page_description":"Schloss Osterstein auf dem Hainberg oberhalb des Geraer Stadtteils Untermhaus war das Residenzschloss des Fürstentums Reuß jüngere Linie.\\nIm Zweiten Weltkrieg wurde das Schloss bei einem Luftangriff am 6. April 1945 zerstört, die Ruinen 1962 gesprengt. Heute sind von der ursprünglichen Bausubstanz nur noch der ehemalige Bergfried aus dem 12. Jahrhundert, die zum Schloss führende Wolfsbrücke von 1857 sowie Reste von Wirtschaftsgebäuden und Schlosshof erhalten."},{"page_url":"https://en.wikipedia.org/wiki/Postal_history","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Cover_Bahamas_1929_front.jpg","page_title":"Postal history","context_page_description":"Postal history is the study of postal systems and how they operate and, or, the study of the use of postage stamps and covers and associated postal artifacts illustrating historical episodes in the development of postal systems. The term is attributed to Robson Lowe, a professional philatelist, stamp dealer and stamp auctioneer, who made the first organised study of the subject in the 1930s and described philatelists as \\"students of science\\", but postal historians as \\"students of humanity\\". More precisely, philatelists describe postal history as the study of rates, routes, markings, and means."},{"page_url":"https://en.wikipedia.org/wiki/KTM","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/KTM_X-BOW_GT4.jpg","page_title":"KTM","context_page_description":"KTM AG is an Austrian motorcycle and sports car manufacturer owned by Pierer Mobility AG and Indian manufacturer Bajaj Auto. It was formed in 1992 but traces its foundation to as early as 1934. Today, KTM AG is the parent company of the KTM Group, consisting of a number of motorcycle brands.\\nKTM is known for its off-road motorcycles. Since the late 1990s, it has expanded into street motorcycle production and developing sports cars – namely the X-Bow. In 2015, KTM sold almost as many street as off-road bikes.\\nSince 2012, KTM has been the largest motorcycle manufacturer in Europe for four consecutive years. Globally, the company is among the leading off-road motorcycle manufacturers. In 2016, KTM sold 203,423 motor vehicles worldwide."},{"page_url":"https://fi.wikipedia.org/wiki/Auburnin_yliopisto","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/AuburnUniversity-SamfordHall.jpg","page_title":"Auburnin yliopisto","context_page_description":"Auburnin yliopisto on julkinen yliopisto Auburnissa, Alabaman osavaltiossa Yhdysvalloissa. Yliopisto on perustettu vuonna 1856, ja syksyllä 2011 siellä opiskeli yli 25 000 opiskelijaa.\\nMaailman viidensadan huippuyliopiston Shanghai-yliopistovertailussa Aberdeenin yliopisto sai vuonna 2014 sijaluvun 401–500.\\nNCAA:n alaisessa yliopistourheilussa yliopistoa edustavat Auburn Tigersin nimellä kulkevat joukkueet, jotka pelaavat SEC-konferenssissa. Auburn on yksi vuonna 1932 perustetun konferenssin perustajajäsenistä."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BB%D5%A6%D5%B8%D5%AD%D5%B8%D6%80_%D5%BA%D6%80%D5%B8%D6%81%D5%A5%D5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Isochoric_process_SVG.svg","page_title":"Իզոխոր պրոցես","context_page_description":"Իզոխոր պրոցես Այս պրոցեսում համակարգի ծավալը չի փոխվում՝ V = const և ΔV = 0, ուստի՝ հակարգի կատարած աշխատանքը՝ A’ = PΔV = 0, ուստի՝ համակարգի կատարած աշխատանքը՝ A’ = PΔV = 0։ Այս դեպքում ջերմադինամիկայի 1-ին օրենքից կստանանք՝\\nΔU = Q\\nԵթե համակարգը ջերմաքանակ ստանում է՝ Q > 0, ապ-ա նրա ներքին էներգիան մեծանում է ստացված ջերմաքանակի չափով, իսկ եթե համակարգը շրջապատին ջերմաքանակ է տալիս Q < 0, ապա նրա ներքին էներգիան տված ջերմաքանակի չափով փոքրանում է։\\nԱյս C = cm և Q = mc = mc Δt բանաձևերից ջերմունակության համար կստանանք՝\\nC = Q/Δt = Q/ΔT,\\nորտեղ t = T-ն համակարգի ջերմաստիճանի փոփոխությունն է ջերմահաղորդման պրոցեսում։ Քանի որ ջերմաքանակը պրոցեսի ֆունկցիա է, ապա պրոցեսի ձևից կախված կլինի նաև ջերմունակությունը։ Մասնավորապես իզոխոր պրոցեսում Q = U, հետևաբար՝\\nCV = ΔU/ ΔT\\nորտեղ CV-ով նշանակված է համակարգի ջերմունակությունը, երբ ծավալը հաստատուն է։\\nԵթե համակարգը միատոմ իդեալական գազ է, ապա, այս U = 1½m/MNAKBT = 1½m/MRT = 1½νRT բանաձևից, ջերմունակության համար կստանանք՝\\nCV 3/2 m/MR = 3/2 νR,\\nորտեղ ν-ն նյութի քանակն է։ Մասնավորապես, մեկ մոլ իդեալական գազի ջերմունակությունն իզոխոր պրոցեսում՝ CV 3R/2։"},{"page_url":"https://it.wikipedia.org/wiki/Jessica_Alba","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Jessica_Alba_at_TechCrunch_Disrupt_San_Francisco_2012_02_%28cropped%29.jpg","page_title":"Jessica Alba","context_page_description":"Jessica Marie Alba è un'attrice e imprenditrice statunitense.\\nAttiva in televisione e al cinema fin da adolescente, ha raggiunto una discreta popolarità nei primi anni duemila, grazie al ruolo di protagonista nella serie televisiva Dark Angel e, sul grande schermo, in pellicole quali Honey, Sin City e Tutte pazze per Charlie.\\nInserita ogni anno nella sezione \\"Hot 100\\" della rivista Maxim dal 2003 al 2007, è stata votata come la donna più sexy del mondo da FHM nel 2007.\\nNel gennaio 2012 fonda, insieme ad altri collaboratori, The Honest Company, azienda specializzata nella commercializzazione di prodotti non tossici per il mercato del consumo consapevole. Nel 2014 la società raggiunge 170 milioni di dollari di vendite e nell'agosto 2015 viene valutata 1,7 miliardi di dollari. L'attrice possiede dal 15% al 20% della start-up."},{"page_url":"https://bs.wikipedia.org/wiki/Spisak_dobitnika_Nobelove_nagrade_za_fiziku","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Kastler.jpg","page_title":"Spisak dobitnika Nobelove nagrade za fiziku","context_page_description":"Nobelova nagrada za fiziku je godišnja nagrada koju dodjeljuje Kraljevska švedska akademija nauka naučnicima iz različitih područja fizike. Predstavlja jednu od pet Nobelovih nagrada koje je osnovao 1895. godine industrijalac i filantrop Alfred Nobel. Dodjeljuje se osobama koje su dale izuzetan doprinos u fizici. Prema Nobelovoj oporuci, procesom izbora kandidata i dodjele nagrade rukovodi Nobelova fondacija i Švedska kraljevska akademija nauka. Nagrada se dodjeljuje u Stockholmu na godišnjoj ceremoniji 10. decembra, na godišnjicu Nobelove smrti. Svaki laureat dobija medalju, diplomu i nagradu sa određenim novčanim iznosom koji se mijenjao tokom perioda dodjele nagrade."},{"page_url":"https://mg.wikipedia.org/wiki/Isma%C3%AFl_Aissati","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Ismail_Aissati.jpg","page_title":"Ismaïl Aissati","context_page_description":"Ismaïl Aissati dia mpilalao baolina kitra mizaka ny zom-pirenen'i Marôka teraka ny 6 Aogositra 1988"},{"page_url":"https://es.wikipedia.org/wiki/Birmingham","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/St_Philips_Cathedral%2C_Birmingham_from_the_east.jpg","page_title":"Birmingham","context_page_description":"Birmingham es una ciudad y un municipio metropolitano perteneciente al Reino Unido, en el condado Midlands Occidentales, de la región Midlands del Oeste. Por su población, está considerada la segunda ciudad más importante del país después de Londres. La reputación de la ciudad se forjó como la locomotora de la Revolución industrial en Reino Unido, siendo conocida como \\"El taller del mundo\\" o la \\"Ciudad de los mil oficios\\".\\nLa Ciudad de Birmingham tiene una población de 1.074.300 habitantes. Forma parte de la gran conurbación de West Midlands, la cual tiene una población de 2.440.986 habitantes e incluye varias ciudades y municipios vecinos, como Coventry, Solihull, Wolverhampton y los pueblos del Black Country. A los nativos de Birmingham se les conoce como Brummies, un término que deriva del sobrenombre de la ciudad.\\nBirmingham es una ciudad diversa étnica y culturalmente. En el censo de 2011, el 57.9% de la población era blanca; el 26,6%, asiática o asiático-británica; el 8,9%, negra o antillana; mientras que el resto es mestiza o de otras etnias."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%83%E3%82%B0%E3%82%B9%E3%83%97%E3%83%BC%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Eggspoons.jpg","page_title":"エッグスプーン","context_page_description":"エッグスプーンは、ゆで卵を食べるための専用のスプーンである。ティースプーンと比べると、柄は短く、先端部は尖っている。これらの特徴は、殻の一端に開けた小さな穴を通して殻から可食部を剥がしやすくすることを意図したものである。この目的のためには、エッグスプーンは通常のティースプーンよりも使いやすくなっている。"},{"page_url":"https://fi.wikipedia.org/wiki/Nenetsia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/N-mar%2C_view_from_Pechora.jpg","page_title":"Nenetsia","context_page_description":"Nenetsia eli Nenetsien autonominen piirikunta on Venäjän federaation autonominen piirikunta Pohjoisen jäämeren rannalla Koillis-Euroopassa.\\nNenetsien autonominen piirikunta on yksi Venäjän 83:sta federaatiosubjektista, vaikka onkin osa Arkangelin aluetta, joka itsekin on federaatiosubjekti. Nenetsian hallintokeskus on Narjan-Marin kaupunki."},{"page_url":"https://en.wikipedia.org/wiki/Danatbank","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Bundesarchiv_Bild_102-12023%2C_Berlin%2C_Bankenkrach%2C_Andrang_bei_der_Sparkasse.jpg","page_title":"Danatbank","context_page_description":"The Darmstädter und Nationalbank was a German bank."},{"page_url":"https://en.wikipedia.org/wiki/Michal_Ajvaz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Michal_Ajvaz_2015.jpg","page_title":"Michal Ajvaz","context_page_description":"Michal Ajvaz is a Czech novelist, poet and translator, an exponent of the literary style known as magic realism."},{"page_url":"https://pl.wikipedia.org/wiki/Wybory_gubernatorskie_w_Stanach_Zjednoczonych_w_2018_roku","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Bill_Walker.jpg","page_title":"Wybory gubernatorskie w Stanach Zjednoczonych w 2018 roku","context_page_description":"Wybory gubernatorskie w Stanach Zjednoczonych w 2018 roku – wybory, które odbyły się 6 listopada 2018 w 36 różnych stanach i 13 listopada 2018 w Marianach Północnych, w wyniku których wyłoniono gubernatorów i zastępców gubernatorów poszczególnych stanów.. Tego dnia odbyły się także wybory burmistrza Waszyngtonu. Wybrano 20 gubernatorów z Partii Demokratycznej i 16 z Partii Republikańskiej."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%AE%E0%A9%88%E0%A8%A5%E0%A8%BF%E0%A8%B2_%E0%A8%A6%E0%A9%87%E0%A8%B5%E0%A8%BF%E0%A8%95%E0%A8%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Methil-Devika.jpg","page_title":"ਮੈਥਿਲ ਦੇਵਿਕਾ","context_page_description":"ਮੈਥਿਲ ਦੇਵਿਕਾ, ਇੱਕ ਭਾਰਤੀ ਨਾਚ ਖੋਜ ਵਿਦਵਾਨ, ਅਧਿਆਪਕ, ਪ੍ਰਫਾਮਰ ਅਤੇ ਕੋਰੀਓਗ੍ਰਾਫਰ ਪਲਕਡ਼."},{"page_url":"https://hu.wikipedia.org/wiki/Ki%E2%80%9343_Hajabusza","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Ki43Thailand.jpg","page_title":"Ki–43 Hajabusza","context_page_description":"A Nakajima Ki–43 Hajabusza a második világháború folyamán a Japán Birodalmi Hadsereg Légiereje számára gyártott szárazföldi bázisú egymotoros vadászrepülőgép volt. A hadseregnél típusjele a hadsereg 1. típusú vadászgépe, a szövetségeseknél kódneve Oscar volt, de gyakran a „hadsereg Zerójának” is hívták az amerikai pilóták, mivel hasonlított az A6M Zero haditengerészeti vadászgépre.\\nAz A6M-hez hasonlóan a csillagmotoros Ki–43 könnyen repülhető, kis tömegű gép volt. Kelet-Ázsiában a háború első éveiben legendássá vált kiváló harci tulajdonságai miatt. Minden ellenfelét túlszárnyalta, de nem volt páncélzattal és öntömítő benzintartállyal felszerelve és az 1944-ben megjelent utolsó változatig fegyverzete is gyenge volt. A szövetséges pilóták szerint a fürge Ki–43 nehéz célpont volt, de néhány találat már képes volt felgyújtani. Hiányosságai ellenére a Ki–43 több szövetséges repülőgépet lőtt le, mint bármely más japán vadászgép és csaknem az összes japán ász pilóta vele érte el a legtöbb légi győzelmet.\\nA repülőgépből összesen 5919 példány épült. Ezekből sokat a háború utolsó hónapjaiban kamikaze bevetésekben használtak az amerikai flotta ellen."},{"page_url":"https://es.wikipedia.org/wiki/Cossoninae","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Cossonus_linearis_above.jpg","page_title":"Cossoninae","context_page_description":"Cossoninae es una subfamilia de insectos coleópteros curculiónidos."},{"page_url":"https://en.wikipedia.org/wiki/Thomas_Trenchard,_2nd_Viscount_Trenchard","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Trenchard_Escutcheon.png","page_title":"Thomas Trenchard, 2nd Viscount Trenchard","context_page_description":"Thomas Trenchard, 2nd Viscount Trenchard MC was a hereditary peer and junior minister in Margaret Thatcher's Conservative government from 1979 to 1983.\\nThomas Trenchard was born in 1923, the son of Katherine and Hugh Trenchard, whom many regard as the father of the Royal Air Force. He was educated at Eton College and served in the King's Royal Rifle Corps in World War II being awarded the MC in 1945.\\nOn 19 June 1948, Thomas Trenchard married Patricia Bailey, the daughter of Admiral Sir Sidney Robert Bailey.\\nThey had three children:\\nHon Hugh Trenchard, later 3rd Viscount Trenchard;\\nHon John Trenchard who married Clare Marsh in 1983, and has issue; and\\nHon Thomas Henry Trenchard who married Sarah Saunders in 1997, and had one daughter.\\nHe was subsequently a Director of Unilever Ltd and Unilever NV from 1967–77 and served as a Minister of State, Department of Industry from 1979–81 and as Minister for Defence Procurement from 1981–83.\\nLord Trenchard died on 29 Apr 1987 and was succeeded by his eldest son Hugh. Lady Trenchard died in 2016 at the age of 90. They are buried together in the churchyard at North Mymms, Hertfordshire."},{"page_url":"https://en.wikipedia.org/wiki/York_Minster","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Statues_york_minster_8404.jpg","page_title":"York Minster","context_page_description":"The Cathedral and Metropolitan Church of Saint Peter in York, commonly known as York Minster, is the cathedral of York, England, and is one of the largest of its kind in Northern Europe. The minster is the seat of the Archbishop of York, the third-highest office of the Church of England, and is the mother church for the Diocese of York and the Province of York. It is run by a dean and chapter, under the Dean of York. The title \\"minster\\" is attributed to churches established in the Anglo-Saxon period as missionary teaching churches, and serves now as an honorific title. Services in the minster are sometimes regarded as on the High Church or Anglo-Catholic end of the Anglican continuum.\\nThe minster was completed in 1472 after several centuries of building. It is devoted to Saint Peter, and has a very wide Decorated Gothic nave and chapter house, a Perpendicular Gothic quire and east end and Early English North and South transepts. The nave contains the West Window, constructed in 1338, and over the Lady Chapel in the east end is the Great East Window, the largest expanse of medieval stained glass in the world."},{"page_url":"https://it.wikipedia.org/wiki/Luca_Parmitano","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Soyuz_TMA-09M_crew.jpg","page_title":"Luca Parmitano","context_page_description":"Luca Parmitano è un militare e astronauta italiano.\\nÈ stato il primo italiano ad effettuare un'attività extraveicolare il 9 luglio 2013, con 6 ore e 7 minuti di passeggiata spaziale. È il primo italiano al comando della Stazione Spaziale Internazionale durante la Expedition 61."},{"page_url":"https://en.wikipedia.org/wiki/Timeline_of_the_2019%E2%80%9320_Hong_Kong_protests_(January_2020)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/DSCF9376_%2849311742881%29.jpg","page_title":"Timeline of the 2019–20 Hong Kong protests (January 2020)","context_page_description":"This is a list of protests in January 2020 that were part of the 2019–20 Hong Kong protests. The protests continued to be buoyed up by the success of the pan-democrats at the November 2019 District Council Elections, but also continued to feel the effects of the mass arrests at the November 2019 siege of the Hong Kong Polytechnic University.\\nWith the notable exceptions of protests on New Year's Day and on 19 January, protests remained smaller-scale but took place almost every day. Towards the end of the month, as the first cases of what would develop into the COVID-19 pandemic were detected in the city, protests began to turn towards the perceived shortcomings in the handling of the situation by the Hong Kong government."},{"page_url":"https://bs.wikipedia.org/wiki/Groblje_P%C3%A8re-Lachaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Paris_Monument_aux_morts_Bartholom%C3%A9_2013.jpg","page_title":"Groblje Père-Lachaise","context_page_description":"Groblje Père-Lachaise nalazi se u Parizu, a još se naziva Istočno groblje. Ime je dobilo po isusovcu François d'Aix de La Chaise, zvanim Père La Chaise, ispovjedniku Luja XIV.\\nNakon donošenja odluke o zabrani postojanja groblja unutar tadašnjeg grada Pariza, dolazi do zatvaranja groblja Cimetière des Innocents koje se je nalazilo u blizini tržnice Les Halles, i koje je predstavljalo zdrastveni rizik za cijelo stanovništvo grada.\\nTako 1804. Napoleon otkupljuje zemljište od Isusovaca, te na tom mjestu osnovao Groblje Père-Lachaise. Uz Groblje Père-Lachaise utemeljena su i druga groblja van tadašnjih granica Pariza koja su zamijenila unutrašnja iz grada. Na sjeveru Groblje Montmartre, na jugu Groblje Montparnasse, a pored Eiffelovog tornja nalazi se Groblje Passy.\\nDanas je Père-Lachaiseu najveće groblje Pariza na kojem je sahranjeno više od 300.000 pokojnika, i još je mnogo kremiranih u kolumbariju, među kojima su mnogih intelektualci i umjetnici. Groblje je jedno od turističkih atrakcija Pariza koje svake godine posjeti oko dva miliona posjetitelja."},{"page_url":"https://it.wikipedia.org/wiki/Canto_di_Natale","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/A_Christmas_Carol_-_Scrooge_Extinguishes_the_First_of_the_Three_Spirits.jpg","page_title":"Canto di Natale","context_page_description":"Il Canto di Natale, noto anche come Cantico di Natale, Ballata di Natale o Racconto di Natale, è un romanzo breve di genere fantastico del 1843 di Charles Dickens, ed è anche una delle sue opere più famose e popolari. È il più importante della serie dei Libri di Natale, una serie di storie che include anche Le campane, Il grillo del focolare, La battaglia della vita e Il patto col fantasma.\\nIl romanzo è uno degli esempi di critica di Dickens alla società ed è anche una delle più famose e commoventi storie sul Natale nel mondo. Narra della conversione del vecchio e tirchio Ebenezer Scrooge, visitato nella notte di Natale da tre spiriti, preceduti da un'ammonizione dello spettro del defunto amico e collega Jacob Marley. Il Canto unisce al gusto del racconto gotico l'impegno nella lotta alla povertà e allo sfruttamento minorile, attaccando l'analfabetismo: problemi esasperati apparentemente proprio dalla Poor Law."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Haute-Amance","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Vall%C3%A9e_de_la_Petite_Amance_depuis_Varennes.jpg","page_title":"Haute-Amance","context_page_description":"Haute-Amance sī ūi-tī Hoat-kok Champagne-Ardenne toā-khu Haute-Marne koān ê chi̍t ê commune."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Bocholt","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Bocholt-schwartzstra%C3%9Fe-197755.jpg","page_title":"Liste der Baudenkmäler in Bocholt","context_page_description":"Die Liste der Baudenkmäler in Bocholt enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Bocholt im Kreis Borken in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Bocholt eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen.\\nBaudenkmäler sind „Denkmäler, die aus baulichen Anlagen oder Teilen baulicher Anlagen bestehen “. Die Denkmalliste der Stadt Bocholt umfasst 144 Baudenkmäler, darunter 104 Wohnhäuser, Villen beziehungsweise Siedlungen, elf Sakralbauten, sieben öffentliche Gebäude, sechs Industrieanlagen, fünf Adelssitze, vier Kleindenkmale, je drei Friedhöfe und landwirtschaftliche Anlagen sowie ein Wohn- und Geschäftshaus. Außerdem sind zwei Baudenkmäler wieder aus der Denkmalliste gestrichen worden.\\nWeiterhin sind sechs Objekte als Bodendenkmäler in Teil B der Denkmalliste der Stadt Bocholt eingetragen."},{"page_url":"https://hu.wikipedia.org/wiki/Nep%C3%A1l_m%C5%B1v%C3%A9szete","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Vishnou_N%C3%A9pal_Guimet_21107.jpg","page_title":"Nepál művészete","context_page_description":"Nepál művészete – a Nepál területén élők művészete."},{"page_url":"https://en.wikipedia.org/wiki/Railroad_plough","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Bundesarchiv_Bild_101I-279-0901-31%2C_Russland%2C_Einsatz_des_%22Schienenwolf%22.jpg","page_title":"Railroad plough","context_page_description":"A railroad plough is a rail vehicle which supports an immensely strong, hook-shaped plough. It is used for destruction of sleepers in warfare, as part of a scorched earth policy, so that the track becomes unusable for the enemy.\\nIn use, the plough is lowered to rip up the middle of the track as it is hauled along by a locomotive. This action breaks the wooden ties which forces the steel rails out of alignment, making the line impassable by later rail vehicles. Bridges and signalling equipment also suffer serious damage."},{"page_url":"https://pt.wikipedia.org/wiki/Seaton_Delaval_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Seaton_Delaval_Hall_-_all_from_N.jpg","page_title":"Seaton Delaval Hall","context_page_description":"Seaton Delaval Hall é um palácio rural inglês situado em Northumberland, entre Seaton Sluice e Seaton Delaval. Foi desenhado segundo o estilo arquitectónico conhecido por Barroco Inglês, pelo arquitecto Sir John Vanbrugh, em 1718, para o Almirante George Delaval."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%84%D9%87%D9%8A_(%D9%84%D9%88%D9%8A%D8%B2%D9%8A%D8%A7%D9%86%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Revised_photo%2C_town_hall_in_Delhi%2C_LA_IMG_7337_1.jpg","page_title":"دلهي (لويزيانا)","context_page_description":"دلهي ‏ هي بلدة أمريكية تقع في الولايات المتحدة في لويزيانا. يقدر عدد سكانها بـ 2,972 نسمة."},{"page_url":"https://gl.wikipedia.org/wiki/Lista_dos_cuadr%C3%A1ngulos_de_Tetis","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Tethys_Ste9_PIA10357_full_10.jpg","page_title":"Lista dos cuadrángulos de Tetis","context_page_description":"Tetis está dividida en 15 cuadrángulos."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9C%B1%E7%84%B6%E5%A2%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Tomb_of_Zhuran_03_2012-05.JPG","page_title":"朱然墓","context_page_description":"朱然墓位于中国安徽省马鞍山市雨山区雨山街道原安民村马沿岗林场、今三国朱然文化园及朱然家族墓地博物馆内。该墓于1984年6月初沪皖纺织联合公司扩建仓库时发现，由安徽省文物考古研究所和马鞍山市文物普查工作队联合清理发掘，并通过墓中出土的木刺和木谒证明墓主为三国东吴将领、官至左大司马右军师的朱然，为至2013年为止发掘的东吴墓葬中墓主身份最高的一座。该墓建于东吴赤乌十二年，采用土坑砖室结构，早年曾遭盗掘，出土文物以漆木器和青瓷器为主。"},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A8%D8%A8%D8%B1_%D8%B4%DB%8C%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/QuestionMark.jpg","page_title":"ببر شیر","context_page_description":"ببر شیر جنس پینتھرا میں موجود پانچ بڑی بلیوں میں شامل خاندان گربہ کا رکن ہے۔ افریقی شیروں کی عام مستعمل اصطلاح سے مراد افریقہ کی ذیلی ببرشیروں کی انواع ہیں۔ بعض شیروں کا وزن ڈھائی سو کلو گرام سے بھی زیادہ ہو سکتا ہے اور اس لحاظ سے یہ شیرکے بعد دوسری بڑی بلی ہے۔ جنگلی ببر شیر افریقا کے نیم صحارا علاقوں اور ایشیا جبکہ ببر شیروں کی دیگر انواع شمالی افریقہ اور جنوب مغربی ایشیا سے بہت پہلے غائب ہوچکی ہیں۔ آج سے دس ہزار سال قبل پیلسٹوسین ادوار کے اواخر میں ببر شیر ہی انسان کے بعد سب سے زیادہ خشکی کے رقبے پر پھیلا ہوا ممالیہ تھا۔ اس زمانے میں یہ تقریباً تمام افریقا، تمام یوریشیا مغربی یورپ سے ہندوستان اور امریکا میں يوكون سے پیرو تک پایا جاتا تھا ۔ببر شیر معدومی کے خطرے سے دوچار جانور ہے، اور افریقی خطے میں بیسویں صدی کے دوسرے حصے میں اس کی آبادی میں 30 سے 50 فیصد کی کمی دیکھنے میں آئی ۔شیروں کی آبادی قومی پارکوں اور غیر محفوظ علاقوں میں غیر مستحکم ثابت ہوتی ہے۔اگرچہ اس کے معدوم ہونے کی وجوہات مکمل طور پرسمجھی نہیں جاسکیں لیکن مسکن سے محروم ہونا اور انسان سے سامنا ہونا جیسے امور عہد حاضر میں خطرے کی اہم وجوہات میں سے ہیں۔ افریقہ میں مغربی افریقی ببر شیروں کی آبادی معدومی کے خطرے سے دوچار ہے۔"},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BB%D0%BE%D0%BF%D0%B5%D0%BD%D1%96%D1%87%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Cha%C5%82opieni%C4%8Dy._%D0%A5%D0%B0%D0%BB%D0%BE%D0%BF%D0%B5%D0%BD%D1%96%D1%87%D1%8B_%28XVIII%29.jpg","page_title":"Халопенічы","context_page_description":"Хало́пенічы — мястэчка ў Беларусі, каля ракі Начы. Цэнтар сельсавету Крупскага раёну Менскай вобласьці. Насельніцтва на 2018 год — 1381 чалавек. Знаходзяцца за 34 км на поўнач ад Крупак, за 28 км ад чыгуначнай станцыі Крупкі; аўтамабільная дарога на Худаўцы.\\nХалопенічы — даўняе места гістарычнай Аршаншчыны, колішняя сталіца графства. Да нашага часу тут захаваўся кляштар дамініканаў у стылі барока, помнік архітэктуры XVIII ст."},{"page_url":"https://fr.wikipedia.org/wiki/Codes_OTAN_des_grades_des_officiers_des_arm%C3%A9es_de_l%27air","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Captain_general_of_the_Air_Force_7ab.png","page_title":"Codes OTAN des grades des officiers des armées de l'air","context_page_description":"Les codes OTAN des grades des officiers des armées de l'air définissent des équivalences de grades entre les rangs d’officiers des armées de l'air nationales membres de l'Organisation du traité de l'Atlantique nord.\\nCes codes OTAN relatifs aux grades d'officiers sont composés de deux lettres en majuscule suivi d’un indice numérique compris entre 1 et 10."},{"page_url":"https://it.wikipedia.org/wiki/Orlando_furioso","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Orlandofuriosocopertina.png","page_title":"Orlando furioso","context_page_description":"L'Orlando furioso è un poema cavalleresco di Ludovico Ariosto pubblicato per la prima volta nel 1516 a Ferrara.\\nIl poema, composto da 46 canti in ottave, ruota attorno al personaggio di Orlando, cui è dedicato il titolo, e a molti altri personaggi. L'opera, riprendendo la tradizione del ciclo carolingio e parzialmente del ciclo bretone, si pone a continuazione dell'incompiuto Orlando innamorato di Matteo Maria Boiardo; in seguito, tuttavia, Ariosto considererà l'Orlando innamorato solo come una fonte a cui attingere, a causa della non attualità dei temi del poema, dovuti alla materia cavalleresca, ma riuscirà a risolvere questo problema apportando delle modificazioni interne all'opera - tra cui l'introduzione di tecniche narrative sconosciute al Boiardo - e soprattutto intervenendo spesso nel corso del poema spiegando al lettore il vero fine degli avvenimenti.\\nCaratteristica fondamentale dell'opera è il continuo intrecciarsi delle vicende dei diversi personaggi, che costituiscono molteplici fili narrativi, tutti armonicamente tessuti insieme."},{"page_url":"https://pt.wikipedia.org/wiki/Charles_M%C3%B6eller","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Charles_M%C3%B6eller%2C_em_2015.jpg","page_title":"Charles Möeller","context_page_description":"Charles Möeller é um ator, diretor, cenógrafo, autor e figurinista brasileiro, atuante no teatro e na televisão. Ao lado de Claudio Botelho, forma a Möeller & Botelho, produtora responsável pelo renascimento do teatro musical no Rio de Janeiro, desde meados de 1990 e que mantém-se ativa até os dias atuais."},{"page_url":"https://vi.wikipedia.org/wiki/%C3%87and%C4%B1r,_Toroslar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/%C3%87and%C4%B1r%2C_Mersin.jpg","page_title":"Çandır, Toroslar","context_page_description":"Çandır là một xã thuộc huyện Toroslar, tỉnh Mersin, Thổ Nhĩ Kỳ. Dân số thời điểm năm 2011 là 305 người."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%89%98%E9%A9%AC%E4%BB%80%C2%B7%E9%A9%AC%E8%80%B6%E5%A4%AB%E6%96%AF%E5%9F%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Tomasz_Majewski_2008.jpg","page_title":"托马什·马耶夫斯基","context_page_description":"托马什·马耶夫斯基是波兰田径运动员。在2008年奥运会上获得男子铅球金牌，成绩为21.51米。2012年伦敦奥运，他成功卫冕该项目冠军，成绩是21.89米。"},{"page_url":"https://de.wikipedia.org/wiki/Wiedenhof_(K%C3%BCrten)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Ehemaliger_Wiedenhof.jpg","page_title":"Wiedenhof (Kürten)","context_page_description":"Wiedenhof ist ein Wohnplatz in der Gemeinde Kürten im Rheinisch-Bergischen Kreis."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%83%81%E3%82%A7%E3%82%B9%E3%82%BF%E3%83%BC_(%E3%83%8B%E3%83%A5%E3%83%BC%E3%83%A8%E3%83%BC%E3%82%AF%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Rochester_aerial_aug_17_2007.jpg","page_title":"ロチェスター (ニューヨーク州)","context_page_description":"ロチェスターは、アメリカ合衆国ニューヨーク州北西部、オンタリオ湖岸に位置する都市。同州モンロー郡の郡庁所在地である。人口は210,565人。ニューヨーク、バッファローに次ぐ州第3の都市である。モンロー郡を中心に5郡にまたがる都市圏は1,054,323人の人口を抱えている。\\n市はかつてFlour Cityと呼ばれた。時代が下ると、同じ発音でFlower Cityとも呼ばれるようになった。このほか、ボシュロムやイーストマン・コダックが本社を置き、ゼロックス創業の地であるロチェスターはThe World's Image Centreという別名も持っている。\\nまた、ロチェスターは学術都市としての要素も持っている。ロチェスター大学はUSニューズ&ワールド・レポート誌の全米大学ランキングで常に上位に入る高評価を受けている。その音楽学校であるイーストマン音楽学校はニューヨークのジュリアード音楽院、フィラデルフィアのカーティス音楽学校と並び称される高水準の音楽学校である。ロチェスター工科大学は工学系の私立大学で、これも高い評価を受けている。これらのほかにも、ロチェスターとその近郊には14の大学がキャンパスを置いている。\\nなお、ニューヨーク州には「ロチェスター」という地名は2ヶ所に存在する。1つはこの項目で述べるモンロー郡のロチェスター市、もう1つはニューヨーク都市圏の北端、アルスター郡にあるロチェスター町である。ただ単に「ニューヨーク州ロチェスター」といった場合、たいていはこのモンロー郡のロチェスターを指す。"},{"page_url":"https://en.wikipedia.org/wiki/Phillip_Gaines","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Phillip_Gaines.JPG","page_title":"Phillip Gaines","context_page_description":"Phillip Gaines is an American football cornerback for the Houston Texans of the National Football League. He was drafted by the Kansas City Chiefs in the third round of the 2014 NFL Draft. He played college football at Rice."},{"page_url":"https://ceb.wikipedia.org/wiki/Shakujii_K%C5%8Den","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Nerima_Syakujii_park_sampoji_pond.jpg","page_title":"Shakujii Kōen","context_page_description":"Parke ang Shakujii Kōen sa Hapon. Nahimutang ni sa prepektura sa Tōkyō-to, sa habagatan-sidlakang bahin sa nasod, sa Tokyo ang ulohan sa nasod. 48 metros ibabaw sa dagat kahaboga ang nahimutangan sa Shakujii Kōen.\\nAng yuta palibot sa Shakujii Kōen kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 61 ka metro ug 1.3 km sa habagatan-kasadpan sa Shakujii Kōen. Dunay mga 10,000 ka tawo kada kilometro kwadrado sa palibot sa Shakujii Kōen may kaayo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Tokyo, 9.7 km sa habagatan-sidlakan sa Shakujii Kōen. Hapit nalukop sa kabalayan ang palibot sa Shakujii Kōen. Sa rehiyon palibot sa Shakujii Kōen, mga kanal talagsaon komon.\\nAng klima umogon ug subtropikal. Ang kasarangang giiniton 18 °C. Ang kinainitan nga bulan Hulyo, sa 28 °C, ug ang kinabugnawan Enero, sa 6 °C. Ang kasarangang pag-ulan 1,861 milimetro matag tuig. Ang kinabasaan nga bulan Oktubre, sa 304 milimetro nga ulan, ug ang kinaugahan Enero, sa 69 milimetro."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%96%D0%B5%D0%BB%D0%B5%D0%B7%D0%BE%D0%BC%D0%B0%D1%80%D0%B3%D0%B0%D0%BD%D1%86%D0%B5%D0%B2%D1%8B%D0%B5_%D0%BA%D0%BE%D0%BD%D0%BA%D1%80%D0%B5%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/%D0%A1%D1%80%D0%B5%D0%B4%D0%BD%D0%B5%D0%B5_%D1%81%D0%BE%D0%B4%D0%B5%D1%80%D0%B6%D0%B0%D0%BD%D0%B8%D0%B5_%D1%85%D0%B8%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D1%85_%D1%8D%D0%BB%D0%B5%D0%BC%D0%B5%D0%BD%D1%82%D0%BE%D0%B2_%D0%B2_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BE%D0%BC%D0%B0%D1%80%D0%B3%D0%B0%D0%BD%D1%86%D0%B5%D0%B2%D1%8B%D1%85_%D0%BA%D0%BE%D0%BD%D0%BA%D1%80%D0%B5%D1%86%D0%B8%D1%8F%D1%85.jpg","page_title":"Железомарганцевые конкреции","context_page_description":"Железомарганцевые конкреции — конкреции с преобладанием в химическом составе железа и марганца, формирующиеся на дне озёр, океанов, а также в почвах. В первых двух случаях представляют практический интерес, в последнем могут являться диагностическим признаком при изучении почвы."},{"page_url":"https://en.wikipedia.org/wiki/Antenna_equivalent_radius","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Flat_thin_conductor_antenna_cross-section.png","page_title":"Antenna equivalent radius","context_page_description":"The equivalent radius of an antenna conductor is defined as:\\nwhere denotes the conductor's circumference, is the length of the circumference, and are vectors locating points along the circumference, and and are differentials segments along it. The equivalent radius allows the use of analytical formulas or computational or experimental data derived for antennas constructed from small conductors with uniform, circular cross-sections to be applied in the analysis of antennas constructed from small conductors with uniform, non-circular cross-sections. Here \\"small\\" means the largest dimension of the cross-section is much less than the wavelength."},{"page_url":"https://en.wikipedia.org/wiki/Docking_(dog)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Globally.svg","page_title":"Docking (dog)","context_page_description":"Docking is the removal of portions of an animal's tail. While docking and bobbing are more commonly used to refer to removal of the tail, the term cropping is used in reference to the ears. Tail docking occurs in one of two ways. The first involves constricting the blood supply to the tail with a rubber ligature for a few days until the tail falls off. The second involves the severance of the tail with surgical scissors or a scalpel. The length to which tails are docked varies by breed, and is often specified in the breed standard.\\nAt least 170 dog breeds have naturally occurring bobtail lines. These appear similar to docked dogs but are a distinct naturally occurring phenotype."},{"page_url":"https://it.wikipedia.org/wiki/Duomo_di_Mantova","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Il_Duomo_di_Mantova_2.JPG","page_title":"Duomo di Mantova","context_page_description":"La cattedrale di San Pietro apostolo è il principale luogo di culto della città di Mantova, chiesa madre della diocesi omonima.\\nLa cattedrale è situata nella centralissima piazza Sordello, non lontano dal Palazzo Ducale e dalla basilica di Sant'Andrea."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Middelburg/Rouaansekaai","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Middelburg%2C_Rouaansekaai_27.jpg","page_title":"Lijst van rijksmonumenten in Middelburg/Rouaansekaai","context_page_description":"De stad Middelburg telt 24 inschrijvingen in het rijksmonumentregister gelegen aan of bij de Rouaansekaai. Hieronder een overzicht."},{"page_url":"https://pt.wikipedia.org/wiki/Apontamentos_de_Rafael_Bordalo_Pinheiro...","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Apontamentos_de_Rafael_Bordalo_Pinheiro%2C_1872%2C_capa.jpg","page_title":"Apontamentos de Rafael Bordalo Pinheiro...","context_page_description":"Apontamentos de Rafael Bordalo Pinheiro sobre a picaresca viagem do Imperador de Raslib pela Europa da autoria de Rafael Bordalo Pinheiro foi publicado em Lisboa, no ano de 1872, com um total de 14 páginas. Pertence à rede de Bibliotecas municipais de Lisboa e é considerado uma \\"raridade bibliográfica\\"."},{"page_url":"https://lb.wikipedia.org/wiki/Mumiy_Troll","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Mumiy_Troll_band_2016.jpg","page_title":"Mumiy Troll","context_page_description":"Mumiy Troll ass eng russesch Museksgrupp vu Wladiwostok, déi 1983 vum Bandleader Ilja Lagutenko als Mumi Troll gegrënnt gouf. De Stil vun der Grupp verbënnt Elementer vum Alternative Rock, Brit-Pop, Pop-Rock an Indie Rock.\\nDe Lagutenko huet sech bei der Sich no engem Bandnumm un de Figuren aus de Bicher vun der finnesch-schweedescher Schrëftstellerin Tove Jansson, de \\"Mumin-Trollen\\", orientéiert.\\nMam Album Morskaja vun 1997 huet hire grousse Succès mat ronn 1 Millioun Kopien ugefaangen. Beléift Hitte waren Utekai, Wladiwostok 2000, grad wéi och Delfiny an Nevesta?\\nMumiy Troll huet Russland um Eurovision Song Contest 2001 zu Kopenhagen vertrueden. Mam Lidd Lady Alpine Blue ass d'Grupp do mat 37 Punkten op déi 12. Plaz komm."},{"page_url":"https://sq.wikipedia.org/wiki/Kisuke_Urahara","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Gen_Con_Indy_2008_-_costumes_294.JPG","page_title":"Kisuke Urahara","context_page_description":"Kisuke Urahara është personazh në anime dhe manga Bleach.\\nKisuke është ish-kapiten i divizionit të 12-të dhe poashtu themelues dhe presidenti i parë Institutit të Zhvillimit dhe Hulumtimit të Shinigamit. Në Botën e Vërtet, ai është pronar i një dyqanit të vogël që shet gjëra të Shinigamit."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D1%82%D0%B8%D1%80%D0%B0_%D0%9C%D0%B0%D0%BB%D0%BB%D0%B5%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/2015_London-Woolwich%2C_Greenhill_Terrace_06.JPG","page_title":"Мортира Маллета","context_page_description":"Мортира Ма́ллета — система сверхтяжёлой мортиры калибра 914 мм, разработанная в Великобритании в 1850-е годы по проекту конструктора Роберта Маллета и предназначавшаяся для обстрела сильно укреплённых фортификационных сооружений. Входит в число наиболее крупнокалиберных орудий за всю мировую историю. Были построены две мортиры этой системы, однако по итогам испытаний они не были приняты на вооружение. Оба орудия сохраняются по настоящее время в качестве музейных экспонатов."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_pr%C3%AAmios_e_indica%C3%A7%C3%B5es_para_The_Simpsons","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/The_Simpsons_star.jpg","page_title":"Lista de prêmios e indicações para The Simpsons","context_page_description":"Esta é uma lista dos prêmios mais notáveis recebidos pelo programa de televisão The Simpsons e pelo filme The Simpsons Movie. The Simpsons, uma sitcom de animação estadunidense, é o programa mais antigo em exibição no horário nobre da televisão dos Estados Unidos. Venceu vários prêmios diferentes, incluindo 34 Emmys, onze dos quais na categoria de melhor programa de animação. Entretanto, The Simpsons nunca foi indicado ao prêmio de Melhor Seriado de Comédia. James L. Brooks, produtor executivo do programa, recebeu onze Emmys por The Simpsons, assim como outros dez por outros programas, detendo o recorde de pessoa mais premiada, com 20 estatuetas. The Simpsons foi o primeiro programa animado a receber um Peabody. Em 2000, a família Simpson recebeu uma estrela na Calçada da Fama de Hollywood. The Simpsons Movie, adaptação para o cinema do programa, foi lançado em 2007 e recebeu indicações para prêmios importantes, como um Globo de Ouro, enquanto The Longest Daycare, lançado em 2013, tornou-se a primeira produção da franquia a ser nomeada para um Óscar. Até 2015, Os Simpsons receberam um total de 85 indicações ao Emmy."},{"page_url":"https://vi.wikipedia.org/wiki/H%E1%BB%87_%C4%91%E1%BB%99ng_v%E1%BA%ADt_Vi%E1%BB%87t_Nam","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Newly_intro_female_being_paired.jpg","page_title":"Hệ động vật Việt Nam","context_page_description":"Hệ động vật ở Việt Nam là tổng thể các quần thể động vật bản địa sinh sống trong lãnh thổ Việt Nam hợp thành hệ động vật của quốc gia này. Việt Nam là đất nước nhiệt đới thuộc vùng Đông Nam Á có sự đa dạng sinh học cao. Sự đa dạng của động vật ở Việt Nam phản ánh sự phong phú của hệ thực vật nơi đây. Do sự khác biệt lớn về khí hậu từ vùng gần xích đạo tới giáp vùng cận nhiệt đới, cùng với sự đa dạng về địa hình đã tạo nên sự đa dạng về thiên nhiên. Một dải rộng các thảm thực vật bao gồm nhiều kiểu rừng phong phú đã được hình thành ở các độ cao khác nhau. Nhiều loại môi trường sống khác nhau tạo ra nhiều cơ hội cho các sinh vật phát triển vì nó cho phép chúng phân tách khỏi những loài khác bằng cách thay đổi nơi ở và thức ăn.\\nTừ đó, hệ động vật Việt Nam hết sức phong phú và đa dạng cả về chủng loài lẫn sinh khối và số lượng. Hệ động vật Việt Nam không những giàu về thành phần loài mà còn có nhiều nét độc đáo, đại diện cho vùng Đông Nam Á và có nhiều loài đặc hữu."},{"page_url":"https://pnb.wikipedia.org/wiki/%D9%84%D8%B3%D9%B9_%D8%A7%D9%85%D8%B1%DB%8C%DA%A9%DB%8C_%D8%B4%DB%81%D8%B1_%D8%A8%D9%84%D8%AD%D8%A7%D8%B8_%D8%A2%D8%A8%D8%A7%D8%AF%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Milwaukee_skyline.jpg","page_title":"لسٹ امریکی شہر بلحاظ آبادی","context_page_description":"مندرجہ ذیل ریاستہائے متحدہ امریکہ وچ سب توں زیادہ آبادی والے شہراں دی اک فہرست اے۔"},{"page_url":"https://eu.wikipedia.org/wiki/Voulpaix","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Eglise_de_Voulpaix.JPG","page_title":"Voulpaix","context_page_description":"Voulpaix Frantziako hiri bat da. Aisne departamentuan dago, Hauts-de-France eskualdean, eta Aisne ibaia bertatik igarotzen da."},{"page_url":"https://hr.wikipedia.org/wiki/Aster_rugulosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Aster_rugulosus_leaves.JPG","page_title":"Aster rugulosus","context_page_description":"Aster rugulosus, listopadna trajnica iz porodice glavočika. Japanski je endem iz roda zvjezdana. Može narasti do 70 cm., u prosjeku izmeđ 30 i 50 cm.\\nRaste uspravno. Listovi su uski i izduženi; cvjetovi bijeli. Cvate od kasnog ljeta do rane jeseni."},{"page_url":"https://hu.wikipedia.org/wiki/Borisz_Andrejevics_Babocskin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Babochkin_Chapayev1.jpg","page_title":"Borisz Andrejevics Babocskin","context_page_description":"Borisz Andrejevics Babocskin orosz, szovjet színész, színházi rendező."},{"page_url":"https://ro.wikipedia.org/wiki/Kaj%C3%A1rp%C3%A9c,_Gy%C5%91r-Moson-Sopron","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Hungary_Gy%C3%B6r-Moson-Sopron_district_Kajarpec_village_IMG_8004.JPG","page_title":"Kajárpéc, Győr-Moson-Sopron","context_page_description":"Kajárpéc este un sat în districtul Győr, județul Győr-Moson-Sopron, Ungaria, având o populație de 1.301 locuitori."},{"page_url":"https://en.wikipedia.org/wiki/Coat_of_arms_of_the_Kingdom_of_Holland","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/De_twee_wapens_van_het_Koninkrijk_Holland.jpg","page_title":"Coat of arms of the Kingdom of Holland","context_page_description":"The coat of arms of the Kingdom of Holland, a client state of Napoleon Bonaparte's French Empire which encompassed most of the modern-day state of the Netherlands, was instituted in 1806.\\nWhen the Emperor Napoleon proposed that his younger brother Louis Napoleon Bonaparte should become the king of a new kingdom, a state that would replace and succeed the age-old Dutch republic, at that time called the \\"Batavian Republic\\". He chose the name \\"Holland\\", after the most important province, as \\"Hollande\\" was much used in France as a name for the Netherlands.\\nThe statute described the royal arms and mentioned a royal crown. On 20 May 1807 a precise drawing of the royal coat of arms was approved by the king. The crown was topped with an orb with a cross.\\nIn practice crowns without a cross became part of the crosses of Louis' Order of Knighthood, the Order of the Union, and the new coins. The second coat of arms, approved on 6 February 1806, showed no cross.\\nAs the country was ruined by the Napoleonic wars and the resulting lack of trade there was no opportunity for a coronation. The crown existed on paper alone until the French annexed the country in 1810."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E3%82%B9%E3%83%9A%E3%83%BC%E3%82%B9%E3%82%B7%E3%83%A3%E3%83%88%E3%83%AB%E5%B1%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Space_Shuttle_Pathfinder_-_panoramio.jpg","page_title":"大スペースシャトル展","context_page_description":"大スペースシャトル展とは、日米協会主催で1983年から1984年にかけて日本で開催された、宇宙開発に関する催し物である。\\n開催時のキャッチコピーは「シャトルがくる、世界初のスペース博」。"},{"page_url":"https://oc.wikipedia.org/wiki/Linha_3_bis_del_m%C3%A8tro_de_Par%C3%ADs","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Metro_de_Paris_-_Ligne_3_bis_-_Interieur_MF_67_-_01.jpg","page_title":"Linha 3 bis del mètro de París","context_page_description":"La linha 3 bis del mètro de París es una linha del malhum de mètro a París. Es la mens frequentada del malhum ambe 1 680 539 viatjaires per ans."},{"page_url":"https://fr.wikipedia.org/wiki/Jean_de_Cambrai","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Bourges-Tombeau_du_duc_Jean_de_Berry_%285%29.jpg","page_title":"Jean de Cambrai","context_page_description":"Jean de Cambrai est un sculpteur gothique d'origine picarde, ymagier au service du duc Jean de Berry de 1386 à 1416.\\nIl passe souvent pour l'élève ou le successeur d'André Beauneveu - même si aucune documentation ne l'étaye, seuls la différence d'âge et le fait qu'ils aient été tous deux imagiers du duc pendant quinze ans. Les deux ateliers travaillent plus vraisemblablement en parallèle,\\nse répartissant les nombreux chantiers du duc, Jean de Cambrai intervenant principalement sur celui de la Sainte-Chapelle de Bourges jusqu'à la mort du son protecteur.\\nLes œuvres de Jean de Cambrai sont paradoxales : au cœur d’une période, le gothique international, caractérisée par la recherche du mouvement, la fantaisie, voire la bizarrerie, elles sont d'une grande sobriété, remarquables par la rigueur de construction géométrique des volumes, une simplicité des formes qui va presque jusqu’à l’abstraction, unies à une grande retenue de l'expression.\\nMais l’œuvre sait aussi se montrer réaliste, notamment dans la facture des visages.\\nS'opposant à la leçon bourguignonne, passionnée, de Champmol, majoritairement suivie au XVᵉ siècle, son œuvre perpétue l'alternative d'un art français,"},{"page_url":"https://azb.wikipedia.org/wiki/%D9%87%D8%A7%DB%8C%D9%84%DB%8C%D9%82%D9%86%E2%80%8C%D9%87%D8%A7%D9%81%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Panorama_Heiligenhafen_Graswarder_Fehmarnsund.jpg","page_title":"هایلیقن‌هافن","context_page_description":"هایلیقن‌هافن آلمانین شلسویق-هولشتاین ایالتینده یئر آلان بیر شهردیر و ۷ متر دنیز سئویه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۹۲۲۷ نفر دیر. بۇ شهرین ۱۸٫۱۲ کیلومتر موربّع ساحه سی وار."},{"page_url":"https://de.wikipedia.org/wiki/Dankelmann_(Kirsche)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Dankelmann_Suesskirsche.jpg","page_title":"Dankelmann (Kirsche)","context_page_description":"‘Dankelmann’ ist eine in der nördlichen Schweiz vorkommende Herzkirschsorte, die in kleinen Mengen in wirtschaftlichem Ertrag steht. Für sie sind keine Synonyme bekannt. Sie wurde erstmals 1937 sortentechnisch von Fritz Kobel bestimmt. In seinem Standardwerk Die Kirschensorten der deutschen Schweiz gab er als ihre Herkunft Herrliberg am Nordufer des Zürichsees an. Ihre Bedeutung bezeichnete er als „qualitativ hervorragende Frucht“, die „in den bessern Lagen der Nordwestschweiz geprüft werden“ sollte."},{"page_url":"https://cs.wikipedia.org/wiki/Milo%C5%88_%C4%8Cepelka","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Milo%C5%88_%C4%8Cepelka_%282017%29.jpg","page_title":"Miloň Čepelka","context_page_description":"Miloň Čepelka je český básník, prozaik, textař, herec, scenárista, moderátor a cimrmanolog."},{"page_url":"https://en.wikipedia.org/wiki/Tank_gun","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f5/Baasjan4.JPG","page_title":"Tank gun","context_page_description":"A tank gun is the main armament of a tank. Modern tank guns are large-caliber high-velocity guns, capable of firing kinetic energy penetrators, high explosive anti-tank rounds, and in some cases guided missiles. Anti-aircraft guns can also be mounted to tanks.\\nAs the tank's primary armament, they are almost always employed in a direct fire mode to defeat a variety of ground targets at all ranges, including dug-in infantry, lightly armored vehicles, and especially other heavily armored tanks. They must provide accuracy, range, penetration, and rapid fire in a package that is as compact and lightweight as possible, to allow mounting in the cramped confines of an armored gun turret. Tank guns generally use self-contained ammunition, allowing rapid loading. They often display a bulge in the barrel, which is a bore evacuator, or a device on the muzzle, which is a muzzle brake."},{"page_url":"https://el.wikipedia.org/wiki/%CE%92%CE%AC%CF%81%CE%B4%CE%B1%CF%82_%CE%A3%CE%BA%CE%BB%CE%B7%CF%81%CF%8C%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/BardasSklerosEmperor.jpg","page_title":"Βάρδας Σκληρός","context_page_description":"Ο Βάρδας Σκληρός ήταν Βυζαντινός στρατηγός που ηγήθηκε μιας ευρείας Ασιατικής επανάστασης κατά του Αυτοκράτορα Βασιλείου Β΄ το 976–979."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%83%D0%BB%D0%B0_%D0%9D%D0%B5%D0%BD%D0%B0%D0%B4%D0%BE%D0%B2%D0%B8%D1%9B%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Kula_na_Kli%C4%8Devcu%2C_rad_Feliksa_Kanica_iz_1868._godine.jpg","page_title":"Кула Ненадовића","context_page_description":"Кула Ненадовића је изграђена 1813. године, налази се у Ваљеву на брду Кличевац, на око пола километра од центра града, а у правцу изласка ка Шапцу. Представља непокретно културно добро као споменик културе од великог значаја."},{"page_url":"https://de.wikipedia.org/wiki/Niamtougou","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Niamtougou4.jpg","page_title":"Niamtougou","context_page_description":"Niamtougou ist eine Stadt in Togo mit 12.444 Einwohnern 1982 und wahrscheinlich 24.000 Einwohnern 2008. Sie liegt in der Region Kara, 25 km nördlich der gleichnamigen Regionshauptstadt Kara. Niamtougou ist Verwaltungssitz der Präfektur Doufelgou."},{"page_url":"https://de.wikipedia.org/wiki/Saffo_(Pacini)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Marble_head_of_the_poetess_Sappho%2C_Roman_period%2C_from_Smyrna_%28Izmir%29%2C_Istanbul_Archaeological_Museum_%2837800876292%29.jpg","page_title":"Saffo (Pacini)","context_page_description":"Saffo ist eine Oper in drei Teilen und fünf Bildern von Giovanni Pacini über ein Libretto von Salvadore Cammarano. Die Uraufführung war am 19. November 1840 im Teatro San Carlo in Neapel. Pacinis Saffo hatte einen sensationellen Erfolg und gilt als seine berühmteste Oper. Sie war bis zum Ende des 20. Jahrhunderts die einzige Oper Pacinis, die gelegentlich aufgeführt wurde."},{"page_url":"https://fr.wikipedia.org/wiki/DVD%2BR_DL","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/DVD%2BRDL.JPG","page_title":"DVD+R DL","context_page_description":"Les DVD+R DL sont des médias de stockage de format DVD enregistrable. Ils ont été présentés pour la première fois en octobre 2003."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%84%D1%82%D0%BE%D0%B3%D0%B0%D0%B7%D0%BE%D0%BF%D1%80%D0%BE%D1%8F%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/uk/b/bc/Nafto.jpg","page_title":"Нафтогазопрояви","context_page_description":"Нафтогазопрояви — сліди нафти і продуктів її перетворення, виходи горючого газу, що спостерігаються на поверхні Землі або при бурінні свердловин. Розрізнюють макро- і мікронафтогазопрояви."},{"page_url":"https://es.wikipedia.org/wiki/Comando_Militar_del_Oeste","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Comando_Militar_do_Oeste_Area.svg","page_title":"Comando Militar del Oeste","context_page_description":"El Comando Militar del Oeste es un comando regional del Ejército Brasileño responsable de los estados de Mato Grosso y Mato Grosso del Sur.​"},{"page_url":"https://nl.wikipedia.org/wiki/NGC_6822","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Barnard%27s_Galaxy.jpg","page_title":"NGC 6822","context_page_description":"NGC 6822, ook wel bekend als het Barnardstelsel, is een onregelmatig sterrenstelsel in het sterrenbeeld Boogschutter. Het ligt 1,6 miljoen lichtjaar van de Aarde verwijderd en werd op 17 augustus 1884 ontdekt door de Amerikaanse astronoom Edward Emerson Barnard."},{"page_url":"https://pl.wikipedia.org/wiki/Kei-car","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/2005_Subaru_R1.jpg","page_title":"Kei-car","context_page_description":"Kei-car/K-car – typowo japoński segment małych pojazdów różnego typu – osobowych, furgonetek, półciężarówek, a nawet małych samochodów sportowych. Samochody te są niezwykle małe i dzięki temu właścicielowi pojazdu przysługują różne ulgi, takie jak niższe stawki podatków i ubezpieczenia.\\nStandard kei-car powstał tuż po drugiej wojnie światowej, kiedy to większość Japończyków nie mogła sobie pozwolić na zakup pełnowymiarowego samochodu, lecz miała wystarczająco dużo pieniędzy na zakup motocykla. Aby spopularyzować małe pojazdy rząd uregulował prawnie wielkość samochodów objętych ulgami.\\nSamochody kei-car można odróżnić po żółto-czarnych tablicach rejestracyjnych. Dodatkowo tablice te różnią się w zależności od tego, czy jest to samochód prywatny, czy firmowy – samochody prywatne mają czarne znaki na żółtym tle, w pojazdach firmowych odwrotnie.\\nZe względu na ograniczenia dotyczące gabarytów pojazdów, oraz pojemności silnika producenci ulepszają swoje samochody poprzez stosowanie zaawansowanych technologicznie rozwiązań."},{"page_url":"https://pl.wikipedia.org/wiki/Babka_g%C3%B3rska","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Plantago_atrata_2017-05-06_9768b.jpg","page_title":"Babka górska","context_page_description":"Babka górska – gatunek rośliny zielnej z rodziny babkowatych."},{"page_url":"https://pl.wikipedia.org/wiki/Masamune_Date","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Masamune_Riding_Statue.jpg","page_title":"Masamune Date","context_page_description":"Masamune Date – japoński feudał żyjący w okresie Azuchi-Momoyama i wczesnym okresie Edo, spadkobierca długiej linii potężnych daimyō z rejonu Tōhoku, założyciel miasta Sendai, zręczny taktyk. Z racji braku jednego oka nazywanym jednookim smokiem."},{"page_url":"https://da.wikipedia.org/wiki/Bambi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Bambi_8.jpg","page_title":"Bambi","context_page_description":"Bambi er en tegnefilm af Walt Disney fra 1942 og den femte i rækken af Disneys klassikere instrueret af David Dodd Hand. Den havde premiere i biograferne i USA den 13. august 1942 og kom i Danmark den 3. marts 1947. Det er 5. film fra Disneys Klassikere og den er baseret på Felix Saltens roman Bambi, ein Leben im Walde fra 1923.\\nDen fortæller om det lille virginiahjortekid Bambi, der fødes som unge af skovens konge og om hans opvækst: Den muntre kanin Stampe lærer ham både det ene og det andet om at klare sig og hvordan han kan klare sig til den dag, han selv bliver skovens konge. Bambi var en af de film, der blev set i Danmark i 1942 under Besættelsen. Musikken er komponeret af Edward Plumb, og teksterne er af Frank Churchill.\\nFilmen blev nomineret til flere Oscars for bedste sang, bedste filmmusik og bedste lyd. Bambi blev genudgivet til visning i biograferne i 1947, 1957, 1966, 1975, 1982 og 1988. Den blev udgivet på VHS video i 1989, 1997 og i en digitalt forbedret udgave på DVD den 1. marts 2005. En direkte-til-video efterfølger Bambi 2 udkom i 2006."},{"page_url":"https://fi.wikipedia.org/wiki/Jerseyn_lippu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Flag_of_Jersey.svg","page_title":"Jerseyn lippu","context_page_description":"Jerseyn lippu on 12. kesäkuuta 1979 lainsäädännöllä vahvistettu itsehallintoalueen symboli. Jerseyn hallitsija Normandian herttua, joka on Englannin kuningatar, vahvisti lipun käyttöön 19. joulukuuta 1980 ja se kohotettiin virallisesti salkoon 1. huhtikuuta 1981.\\nLipussa on kulmiin asti venytetty punainen Pyhän Andreaan risti valkoisella pohjalla. Ylimmässä neljänneksessä on keltainen Plantagent-suvun kruunu sekä sen alla Normandian punainen, kolmen päällekkäin olevan kultaisen leopardin muodostama vaakuna."},{"page_url":"https://hu.wikipedia.org/wiki/N%C5%93ux-les-Mines","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Population_-_Municipality_code_62617.svg","page_title":"Nœux-les-Mines","context_page_description":"Nœux-les-Mines település Franciaországban, Pas-de-Calais megyében. Nœux-les-Mines Verquigneul, Barlin, Drouvin-le-Marais, Hersin-Coupigny, Houchin, Labourse, Mazingarbe, Sains-en-Gohelle és Verquin községekkel határos."},{"page_url":"https://ca.wikipedia.org/wiki/Escut_de_Tremp","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Antic_escut_d%27Espluga_de_Serra.PNG","page_title":"Escut de Tremp","context_page_description":"El nou municipi de Tremp, al Pallars Jussà, té des del 1989 aquest escut heràldic municipal, que substitueix tant el de l'antic municipi de Tremp com els dels sis altres antics ajuntaments afegits a Tremp entre 1970 i 1973."},{"page_url":"https://fr.wikipedia.org/wiki/Mary_Caldwell_Dawson","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/NationalNegroOperaCompanyHouse.jpg","page_title":"Mary Caldwell Dawson","context_page_description":"Mary Cardwell Dawson était une chanteuse et pianiste américaine.\\nElle est principalement connue pour avoir fondé la National Negro Opera Company, ainsi que pour avoir enseigné le piano au jeune Ahmad Jamal."},{"page_url":"https://fr.wikipedia.org/wiki/Cl%C3%A9der","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Cleder-panorama.jpg","page_title":"Cléder","context_page_description":"Cléder [kledεʁ] est une commune française située dans le département du Finistère, en région Bretagne.\\nAu cœur de la Ceinture dorée, la ville dispose à la fois de vastes exploitations agricoles et d'une façade littorale avec de grandes plages de sable fin et une nature préservée."},{"page_url":"https://pl.wikipedia.org/wiki/Ziemia_sieradzka","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/POL_wojew%C3%B3dztwo_sieradzkie_IRP_COA.svg","page_title":"Ziemia sieradzka","context_page_description":"Ziemia sieradzka – jednostka podziału terytorialnego Korony Królestwa Polskiego na początku XIV wieku. W 1339 z jej zrębów powstało województwo sieradzkie.\\nWiązana jest z plemieniem Warcian, co pozwalałoby na nazywanie tej części kraju nazwą „Warcja” lub „Wiercza”.\\nWedług Zygmunta Glogera terminem „ziemia” w początkach Państwa Polskiego określano przestrzeń będącą siedliskiem jakiegoś plemienia bronioną wodami rzek i innymi przeszkodami naturalnymi. Pojęcie „ziemi” pojawia się w nomenklaturze polskich jednostek terytorialnych w XII–XIII w. stanowiąc ważne ogniwo w historii kształtowania się organizmu państwa po rozbiciu dzielnicowym Polski. W latach 1305/1306 Władysław I Łokietek, jeszcze przed śmiercią czeskiego Wacława III, opanował wraz z Małopolską, Kujawami i cząstką Wielkopolski także dzielnice łęczycką i sieradzką, które weszły w skład zasadniczego zrębu odbudowywanego Państwa Polskiego. Od tego czasu dzielnice te zaczęły zmieniać swój charakter, co przejawiało się również w sposobie ich określania. Zaczyna zanikać dotychczasowa nazwa „księstwa”, a w to miejsce zaczyna się używać terminu „ziemia”. Początkowo terminów tych używano wymiennie. S."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D1%80%D0%B5%D0%B2%D0%B5%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%83%D0%BB%D0%B8%D1%86%D0%B0_(%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/1975_CPA_4521_and_label.jpg","page_title":"Деревенская улица (картина)","context_page_description":"«Деревенская улица» — картина русского художника Фёдора Васильева, написанная в 1868 году. Картина является частью собрания Государственной Третьяковской галереи. Размер картины — 52,5 × 44,5 см."},{"page_url":"https://cs.wikipedia.org/wiki/Ko%C5%BAlice_(okres_Zgorzelec)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Ko%C5%BAlice%2C_ulice_v_obci_%286%29.jpg","page_title":"Koźlice (okres Zgorzelec)","context_page_description":"Koźlice je polská vesnice ležící na hranici s Německem jižně od města Zhořelec. Nachází se v Dolnoslezském vojvodství, v okrese Zgorzelec. Zastavěná plocha má tvar písmene L, které je obrácené tak že, kratší část je na severu orientována k východu. Středem vsi vede silnici spojující Koźlice s okolím."},{"page_url":"https://nl.wikipedia.org/wiki/Leminda_millecra","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Frilled_nudibranch_eggs.jpg","page_title":"Leminda millecra","context_page_description":"Leminda millecra is een slakkensoort uit de familie van de Lemindidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1985 door Griffiths."},{"page_url":"https://ro.wikipedia.org/wiki/Castelul_Haller_din_Ogra","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/RO_MS_Castelul_Haller_din_Ogra_%2827%29.JPG","page_title":"Castelul Haller din Ogra","context_page_description":"Castelul Haller din Ogra este un ansamblu arhitectonic construit de familia Haller în localitatea Ogra, județul Mureș. Aproape de drumul european E60, corespunzător DN15, castelul se ridică semeț pe malul râului Mureș. Edificiul construit în secolul al XVII-lea păstrează elementele barocului târziu."},{"page_url":"https://sh.wikipedia.org/wiki/Canapville_(Kalvados)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Canapville14_-_%C3%89glise.jpg","page_title":"Canapville (Kalvados)","context_page_description":"Kanapvil je naselje i opština u severnoj Francuskoj u regionu Donja Normandija, u departmanu Kalvados koja pripada prefekturi Lisje.\\nPo podacima iz 1999. godine u opštini je živelo 222 stanovnika, a gustina naseljenosti je iznosila 88 stanovnika/km². Opština se prostire na površini od 2,5 km². Nalazi se na srednjoj nadmorskoj visini od 11 metar."},{"page_url":"https://mg.wikipedia.org/wiki/August_Euler","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/August_Euler_B%C3%BCste.jpg","page_title":"August Euler","context_page_description":"August Euler dia injeniera mizaka ny zom-pirenen'i Alemaina teraka ny 20 Novambra 1868 ary maty ny 1 Jolay 1957"},{"page_url":"https://en.wikipedia.org/wiki/William_J._Worth","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Gen._David_E._Twiggs_-_NARA_-_528455.jpg","page_title":"William J. Worth","context_page_description":"William Jenkins Worth was a United States officer during the War of 1812, Second Seminole War, and Mexican–American War."},{"page_url":"https://en.wikipedia.org/wiki/Dun_Mountain-Maitai_Terrane","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Dun_mountain_Nelson_New_Zealand.jpg","page_title":"Dun Mountain-Maitai Terrane","context_page_description":"The Dun Mountain-Maitai Terrane comprises the Dun Mountain Ophiolite Belt, Maitai Group and Patuki Mélange. The Dun Mountain Ophiolite is an ophiolite of Permian age located in New Zealand's South Island. Prehistorically this ophiolite was quarried by Māori for both metasomatized argillite and pounamu which was used in the production of tools and jewellery.\\nIn the late 1800s, the Dun Mountain Ophiolite Belt was surveyed for its economic potential. During this time the rock types dunite and rodingite were first named. Discovery of economic deposits of chromite near Nelson lead to the building of New Zealand’s first railway, however, extraction only occurred between 1862 and 1866. In the 20th century, serpentinite was mined for fertiliser and the ophiolite remains one of New Zealand's main sources of pounamu, but all other mineral exploration has failed to find economic deposits."},{"page_url":"https://de.wikipedia.org/wiki/Florida_(Luftraum%C3%BCberwachungssystem)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/FLORIDA_EZ.JPG","page_title":"Florida (Luftraumüberwachungssystem)","context_page_description":"Das Florida war ein Luftraumüberwachungssystem der Schweizer Luftwaffe des Herstellers Hughes Aircraft Company in Fullerton, Kalifornien, USA."},{"page_url":"https://en.wikipedia.org/wiki/Alfeld,_Bavaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Alfeld%28Mittelfranken%29.jpg","page_title":"Alfeld, Bavaria","context_page_description":"Alfeld is a municipality in the district of Nürnberger Land in Bavaria in Germany. Alfeld has around 1100 inhabitants and is famous for their traditional Kermesse which the people celebrate at the end of August every year."},{"page_url":"https://de.wikipedia.org/wiki/Haus_der_Stadtgeschichte_(Heilbronn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Titelkopf_Neckar-Echo_1918.jpg","page_title":"Haus der Stadtgeschichte (Heilbronn)","context_page_description":"Das Haus der Stadtgeschichte in Heilbronn ist Sitz des Stadtarchivs Heilbronn und bietet ein Forschungs-, Dokumentations- und Museumsangebot zur Geschichte der Stadt Heilbronn. In ihrer heutigen Form wurde die Einrichtung im Juli 2012 eröffnet."},{"page_url":"https://en.wikipedia.org/wiki/The_Broadsword_and_the_Beast","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/19821016-44A-IanAndersonWithBeast.jpg","page_title":"The Broadsword and the Beast","context_page_description":"The Broadsword and the Beast is the 14th studio album by rock band Jethro Tull, released on 10 April 1982. The album is a cross between the dominant synthesizer sound of the 1980s and the folk-influenced style that Jethro Tull used in the previous decade. As such, the band's characteristic acoustic instrumentation is augmented by electronic soundscapes, provided by new keyboardist Peter-John Vettese. The electronic aspects of this album would be explored further by the band on their next release Under Wraps.\\nIn the liner notes of the remastered version of the album, Ian Anderson opines that Broadsword contains some of Jethro Tull's best music."},{"page_url":"https://en.wikipedia.org/wiki/Mon_Repos_Conservation_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Turtle_Conservation_Park%2C_Mon_Repos%2C_Queensland%2C_2020%2C_01.jpg","page_title":"Mon Repos Conservation Park","context_page_description":"Mon Repos Conservation Park is a national park containing an important turtle rookery located at Mon Repos, Bundaberg Region, Queensland, Australia, 14 kilometres east of Bundaberg. Mon Repos hosts the largest concentration of nesting marine turtles on the eastern Australian mainland and supports the most significant nesting population of the endangered loggerhead turtle in the South Pacific Ocean. Successful breeding here is critical if the loggerhead species is to survive. In far smaller numbers the flatback and green turtles and, intermittently, the leatherback turtle also nest along the Bundaberg coast.\\nFrom November to March each year, adult turtles come ashore to lay eggs on Mon Repos beach. About eight weeks later young turtles emerge from the eggs and begin their journey to the sea. The best time to see turtles nesting is after dark from mid-November to February. Hatchlings usually leave their nests at night from mid-January until late March.\\nQueensland Parks and Wildlife Service rangers operate guided tours nightly during the breeding season. Mon Repos is a popular tourist attraction, with around 25,000 visitors every season."},{"page_url":"https://fi.wikipedia.org/wiki/S%C3%B8ren_Norby","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/S%C3%B6ren_Norby_1525.jpg","page_title":"Søren Norby","context_page_description":"Søren Norby oli tanskalainen amiraali ja merirosvopäällikkö. Hän toimi Itämerellä kaapparina Tanskan kuningas Kristian II:n nimissä Kalmarin unionin hajoamiseen liittyneiden sotien aikana. Norby hallitsi vuosina 1517–1525 lääninherrana Gotlantia ja käytti sitä kaapparilaivastonsa tukikohtana. Hän piti hallussaan myös Suomea vuosina 1522–1523, mutta joutui perääntymään Kristian II:n menetettyä valtaistuimensa Tanskassa. Myöhemmin Norby yritti nostattaa Ruotsissa kapinoita palauttaakseen Kristianin valtaan."},{"page_url":"https://en.wikipedia.org/wiki/San_Luis_Province","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/San_Luis_province_%28Argentina%29%2C_departments_and_capital.png","page_title":"San Luis Province","context_page_description":"San Luis is a province of Argentina located near the geographical center of the country. Neighboring provinces are, from the north clockwise, La Rioja, Córdoba, La Pampa, Mendoza and San Juan."},{"page_url":"https://pl.wikipedia.org/wiki/Antequera","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/01_Antequera%2C_Andalusia%2C_Spain.jpg","page_title":"Antequera","context_page_description":"Antequera – miasto w południowej Hiszpanii, w regionie Andaluzja, w prowincji Malaga, w Górach Betyckich, nad rzeką Guadalhorce. Jest nazywane \\"el corazón de Andalucía\\" - \\"sercem Andaluzji\\".\\nW tle miasta widać stromą ścianę skalną Peña de los Enamorados, z którą związana jest legenda o kochankach z Antequery. Według niej, ze szczytu skały skoczyli zakochani w sobie młody chrześcijanin i muzułmańska księżniczka, którym nie pozwolono być razem.\\nWspółrzędne geograficzne: 37°01′N 4°34′W. Ludność: 41,2 tys. mieszkańców."},{"page_url":"https://sk.wikipedia.org/wiki/Cabri%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Cabri%C3%A8s_%2813%29.JPG","page_title":"Cabriès","context_page_description":"Cabriès je francúzska obec, ktorá sa nachádza v departemente Bouches-du-Rhône, v regióne Provence-Alpes-Côte d’Azur."},{"page_url":"https://de.wikipedia.org/wiki/Dolomiten","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/AC_Blick_auf_den_D%C3%BCrensee_mit_Cristallo.jpg","page_title":"Dolomiten","context_page_description":"Die Dolomiten, italienisch Dolomiti, ladinisch Dolomites, sind eine Gebirgsgruppe der südlichen Kalkalpen, werden aber auch den Südalpen zugerechnet. Sie verteilen sich auf die Regionen Venetien und Trentino-Südtirol in Italien bzw. – zu etwa gleichen Teilen – auf die Provinzen Belluno, Bozen–Südtirol und Trient. Seit 2009 gehören Teile der Dolomiten zum UNESCO-Weltnaturerbe Dolomiten.\\nHöchster Berg der Dolomiten ist die Marmolata mit 3343 Metern Höhe. Weitere bekannte Gipfel oder Massive sind der Antelao, die Drei Zinnen, die Sella, der Rosengarten, der Schlern, die Geisler und der Langkofel."},{"page_url":"https://sco.wikipedia.org/wiki/Opel_Vivaro","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Opel_Vivaro_front_20080108.jpg","page_title":"Opel Vivaro","context_page_description":"The Opel Vivaro is a medium-sized licht commercial vehicle produced bi the German automaker Opel. It's a medium-sized licht commercial vehicle oreeginally launcht in 2001, an is available in panel van, minibus, combined bus/van an platform crew-cab configurations. Twa different wheelbase styles an twa roof heights options are an aa available, as well as three diesel ingine pouer options an a petrol ingine. The Vivaro is sauld in Great Breetain as Vauxhall. The Vivaro is produced in the Nissan factory in Barcelona, Spain as an Opel an produced in the Vauxhall factory in Luton in Great Breetain as Vauxhall."},{"page_url":"https://gl.wikipedia.org/wiki/Biffy_Clyro","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Biffy_Clyro_Leeds.jpg","page_title":"Biffy Clyro","context_page_description":"Biffy Clyro é unha banda escocesa procedente de Ayrshire, composta por Simon Neil, James Johnston e Ben Johnston. O son da banda caracterízade por unha pesada, aínda que melódica, mestura de guitarras, baixo e batería, cos tres membros do grupo contribuíndo coas voces. Son coñecidos por complexos e interlazados riffs de guitarra, secuencias de acordes e melodías que adoitan cambiar ao longo das cancións.\\nDesde a súa formación no ano 1995, a banda leva editados cinco álbums de estudio e un EP. O seu álbum Puzzle, lanzado no ano 2007, é considerado o máis comercial e aquel que a fixo coñecida en todo o mundo."},{"page_url":"https://de.wikipedia.org/wiki/Canon_FT","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Canon-with-macro.jpg","page_title":"Canon FT","context_page_description":"Die Canon FT QL war eine Kleinbild-Spiegelreflexkamera für das Canon FL-Bajonett, die modifizierte Version Canon FTb für das Canon FD-Bajonett. Von beiden Kameras gab es vereinfachte Versionen, das Pendant zur FT hieß Canon TL, das Pendant zur FTb zunächst Canon TLb, dann Canon TX."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D0%B1%D1%83%D0%BA%D0%B8%D1%81,_%D0%A5%D0%B0%D1%80%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Charis_Pamboukis.jpg","page_title":"Памбукис, Харис","context_page_description":"Харис Памбукис — греческий политик, с 7 октября 2009 до 17 июня 2011 года министр государства."},{"page_url":"https://eo.wikipedia.org/wiki/Alto_Para%C3%ADso_de_Goi%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Bandeira_de_Alto_Para%C3%ADso_de_Goi%C3%A1s.jpg","page_title":"Alto Paraíso de Goiás","context_page_description":"Alto Paraíso de Goiás [altŭ paraizu djgojaz] /'ałtŭ para'izŭ djgoj'az/ estas urbo kaj municipo en ŝtato Gojaso, Brazilo tie estas fondaĵo Bona Espero. Ĝia unua nomo estis \\"Veadeiros\\". Ĝi havis, en 2014, 7.328 loĝantojn kaj areo de 2.593,885 km²."},{"page_url":"https://ru.wikipedia.org/wiki/30-%D1%8F_%D0%B0%D0%B2%D0%B5%D0%BD%D1%8E_(%D0%BB%D0%B8%D0%BD%D0%B8%D1%8F_%D0%90%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F,_%D0%91%D0%B8-%D1%8D%D0%BC-%D1%82%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/30_Avenue_Renovated_BMT_Astoria.jpg","page_title":"30-я авеню (линия Астория, Би-эм-ти)","context_page_description":"«30-я авеню» — станция Нью-Йоркского метрополитена, расположенная на линии Астория, Би-эм-ти. Станция находится в Квинсе, в округе Астория, на пересечении 30-й авеню с 31-й улицей. На станции останавливаются маршруты N и W.\\nСтанция эстакадная, расположена на трёхпутном участке линии. Представлена двумя боковыми платформами, которые обслуживают только внешние пути. Экспресс-путь сейчас не используется для маршрутного движения поездов. Платформы огорожены высоким бежевым забором, в центре платформ расположены навесы и колонны. Название станции расположено на стенах и колоннах в виде чёрной таблички с белой надписью.\\nСтанция имеет единственный выход, расположенный в северной части платформ. С каждой платформы лестницы спускаются в мезонин, где расположен турникетный павильон, переход между платформами и зал ожидания. Оттуда в город ведут лестницы, которые приводят к углам перекрестка 30-й авеню с 31-й улицей.\\nДо 1949 года часть BMT Astoria Line использовалась двумя компаниями — IRT и BMT, равно как и IRT Flushing Line. Некоторое время станция даже была разделена на две части, на одной из которых останавливались поезда IRT, на другой — BMT."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Beaver_County,_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Beaver_Utah_post_office.jpeg","page_title":"National Register of Historic Places listings in Beaver County, Utah","context_page_description":"This is a list of the National Register of Historic Places listings in Beaver County, Utah.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Beaver County, Utah, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 114 properties and districts listed on the National Register in the county. Another 3 sites in the county were once listed, but have since been removed.\\nThis National Park Service list is complete through NPS recent listings posted June 26, 2020."},{"page_url":"https://hu.wikipedia.org/wiki/Belv%C3%A1ros_(Kecskem%C3%A9t)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Cifrapalota_Kecskem%C3%A9t_Zsolnay.JPG","page_title":"Belváros (Kecskemét)","context_page_description":"A kecskeméti Belváros a város történelmi városközpontja a körút által határolt területen."},{"page_url":"https://da.wikipedia.org/wiki/Nationalparker_i_Sverige","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Tresticklan-Langetjarn.jpg","page_title":"Nationalparker i Sverige","context_page_description":"Der er 30 nationalparker i Sverige. Sverige var i 1909 det første land i Europa, som indførte nationalparker.\\nNationalparkerne domineres af bjergområder, der udgør 90 procent af det samlede areal. Det skyldes især de store områder, som de nordlige nationalparker dækker. Sarek Nationalpark og Padjelanta Nationalpark dækker hver 2.000 km². Mange af nationalparkerne ligger i det Laponiske område i Nordsverige, som er på UNESCOs Verdensarvsliste på grund af sit bevarede naturområde og sin status om samernes kulturlandskab. Modsat er der også de små skovdækkede nationalparker i syd, Söderåsen, Dalby og Stenshuvud, der til sammen kun dækker et areal på 20 km².\\nI dag etableres der kun store nationalparker, dækkede komplette landskabsdele. Staten køber området ved beslutning i Sveriges Riksdag, mens det er Naturvårdsverket, der står for selve etableringen og vedligeholdelsen af nationalparkerne.\\nI september 2009 åbnede den 29. nationalpark, Kosterhavet. Den er Sveriges første nationalpark, som primært dækker et havområde."},{"page_url":"https://nn.wikipedia.org/wiki/Australia_i_Junior_Eurovision_Song_Contest","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/JESC_2018_partisipants._Jael_%28Australia%29.jpg","page_title":"Australia i Junior Eurovision Song Contest","context_page_description":"Australia debuterte i Junior Eurovision Song Contest 2015 i Sofia i Bulgaria, med songen «My Girls» som vart framført på engelsk av Bella Paige. Bidraget vart valt ut internt av den australske kringkastaren SBS.\\nI perioden frå 2005 til 2015, fekk alle deltakarlanda i Junior Eurovision Song Contest automatisk tolv poeng då poenggjevinga starta. I 2011 vart det tillaga slik at desse poenga vart delt ut av Australia."},{"page_url":"https://es.wikipedia.org/wiki/Interruptor","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/Disjoncteur_HT-fig5.svg","page_title":"Interruptor","context_page_description":"Un interruptor eléctrico es un dispositivo que permite desviar o interrumpir el curso de una corriente eléctrica. En el mundo moderno sus tipos y aplicaciones son innumerables, desde un simple interruptor que apaga o enciende una bombilla, hasta un complicado selector de transferencia automático de múltiples capas, controlado por computadora.\\nSu expresión más sencilla consiste en dos contactos de metal inoxidable y el actuante. Los contactos, normalmente separados, se unen mediante un actuante para permitir que la corriente circule. El actuante es la parte móvil que en una de sus posiciones hace presión sobre los contactos para mantenerlos unidos."},{"page_url":"https://da.wikipedia.org/wiki/Jasminrevolutionen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Barrikaden.jpg","page_title":"Jasminrevolutionen","context_page_description":"Jasminrevolutionen er de vestlige mediers betegnelse for protesterne i Tunesien i tiden omkring årsskiftet 2010-2011. Protesterne medførte, at Tunesiens anden præsident Zine El Abidine Ben Ali forlod sit præsidentembede den 14. januar 2011 efter 23 år ved magten og flygtede til Saudi Arabien. Revolutionen var desuden startskuddet til en række protester i den arabiske verden, og førte til store demonstrationer i både Egypten, Iran, Jordan, Libyen, Syrien og Bahrain."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%A6%D5%B8%D6%82%D5%AC%D5%A5%D5%AA%D5%B8%D6%82_%D5%A9%D5%A1%D5%B6%D5%A3%D5%A1%D6%80%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/%D4%B1%D5%A6%D5%B8%D6%82%D5%AC%D5%A5%D5%AA%D5%B8%D6%82_4.jpg","page_title":"Ազուլեժու թանգարան","context_page_description":"Ազուլեժու թանգարան, Լիսաբոնի ամենահայտնի ազգային թանգարաններից։ Հիմնադրվել է 1965 թվականին, ազգային թանգարանի կարգավիճակ է ստացել 1980 թվականին։ Տեղակայված է Աստվածածին եկեղեցու ներսում ։\\nԹագարանում ներկայացված է ազուլեժուի և խեցեգործության պատրաստման ու զարգացման պատմությունը Պորտուգալիայում\` սկսած 15-րդ դարից մինչև մինչ օրերը։ Ազուլեժու անվանումն ունի արաբական ծագում: Ազուլեժուները քառակուսի, տարբեր չափսի սալիկներն են, որոնք գունավորված են կամ նկարազարդված։ Պորտուգալական ավանդական ազուլեժուն ունի 14X14 սմ չափսեր։ Նախկինում Լիսաբոնում շատ հարգի է եղել տների կամ հասարակական վայրերի պատերի ծածկումը այդ սալիկներով, օրինակ\` թագավորական պալատները, եկեղեցիները և այլն։ Ներկայումս էլ Պորտուգալիայում շարունակում են ազուլեժուով պատել տարբեր շենքերի ներսի պատերը։\\nԹանգարան կարելի է հասնել հետևյալ համարի ավտոբուսներով. 210, 718, 742, 759 և 794. Հարկավոր է իջնել Igreja Madre Deus կանգառում. Թանգարանը բաց է ամեն օր\` բացի երկուշաբթիից, ժամը 10.00-18.00։ Թանգարանում ներկայացված են տարբեր տարիների խեցեգործության նմուշներ և ազուլեժուներ։"},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_g%C3%B3tica_veneciana","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Hallwylska_Museet.jpg","page_title":"Arquitectura gótica veneciana","context_page_description":"El gótico veneciano es la variante local del estilo arquitectónico del gótico italiano construido en Venecia, en el que confluyen los propios requerimientos para construir en un entorno tan especial con influencias de la arquitectura bizantina y de la arquitectura islámica, lo que refleja la amplia red comercial de la república de Venecia en ese momento. Algo poco usual en la arquitectura medieval, el estilo es más característico en los edificios seculares que en los religiosos, y la gran mayoría de los ejemplos que sobreviven son seculares.\\nLos ejemplos más conocidos son el palacio Ducal y la Ca' d'Oro. Ambos presentan loggias con pequeñas columnas espaciadas, con una tracería pesada con aberturas de cuadrifolio sobre ellas, decoración a lo largo de la línea del techo y algunos patrones coloreados sobre las superficies de los muros lisos. Junto con el arco conopial, coronado con un ornamento en relieve, y cordelería en relieve, estas son las características más icónicas del estilo. La arquitectura gótica eclesiástica tendía a ser más cercana a la del resto de Italia, a ser menos veneciana."},{"page_url":"https://es.wikipedia.org/wiki/Juan_Ruiz_de_Luna","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Ruizluna.jpg","page_title":"Juan Ruiz de Luna","context_page_description":"Juan Ruiz de Luna, Noez, 12 de julio de 1863 - Talavera de la Reina, 25 de septiembre de 1945, fue un ceramista español heredero de la tradición cerámica de Talavera de la Reina, que tanta fama adquirió en la España del Siglo de Oro. Fiel a su estilo supo interpretar su naturaleza elevándola a la máxima expresión del arte en cerámica. Parte de su obra se encuentra en el museo que lleva su nombre.​\\nInfluyó de manera decisiva en la vocación de sus hijos, Juan Ruiz de Luna Arroyo, Rafael Ruiz de Luna Arroyo y Antonio Ruiz de Luna Arroyo, en conjunto primero y luego por separado, alcanzando un puesto destacado como ceramistas. Su otro hijo Salvador Ruiz de Luna Arroyo fue un compositor musical."},{"page_url":"https://ast.wikipedia.org/wiki/Mahmut_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Tugra_Mahmuds_II.gif","page_title":"Mahmut II","context_page_description":"Mahmut II foi sultán del Imperiu otomanu dende 1808 hasta'l so fallecimientu. Ocupó'l tronu tres una rebelión militar que costó la vida del Gran Visir Alemdar Mustafa Pasha a manes de los jenízaros y sobrevivir a la orde d'asesinatu dada pol so predecesor y hermanu, Mustafá IV.\\nEngarráu a Rusia pol control de la marxe derecha del ríu Danubiu dempués d'haber perdíu bona parte del territoriu al otru llau del ríu, mientres les guerres Napoleóniques aprovechó les debilidaes del so enemigu pa llograr nel Tratáu de Bucuresti de 1812 les fronteres sacante Besarabia.\\nMahmut II reformó les instituciones alministratives y el mesmu exércitu, influyíu por un procesu de occidentalización, polo qu'ordenó la disolución de los jenízaros en 1826, según unos pola muerte del so visir y amigu Alemdar Mustafa Pasha, según otros pa desfacer d'un cuerpu militar que nun respondía a les necesidaes militares de los tiempos modernos.\\nTuvo De enfrentase a la sulevación de Grecia que, finalmente, tres la batalla de Navarino llogró la independencia en 1830. Mientres el so mandatu producieron otres insurrecciones en Serbia, Montenegru y Albania."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%9F%D0%BD%D0%BE%D0%BC%D0%BF%D0%B5%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Silverpagoda.jpg","page_title":"Пномпень","context_page_description":"Пномпе́нь — Камбожийн Вант Улсын нийслэл, 1,501,725 сая хүнтэй хот."},{"page_url":"https://de.wikipedia.org/wiki/Martin_Stadelmaier","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Halina_Wawzyniak%2C_Martin_Stadelmaier_2.jpg","page_title":"Martin Stadelmaier","context_page_description":"Martin Stadelmaier ist ein deutscher Politiker. Er war von 2003 bis 2013 Staatssekretär und Chef der Staatskanzlei von Rheinland-Pfalz. Seit 2014 ist er Leiter des Berliner Büros des Deutschen Lotto- und Totoblocks."},{"page_url":"https://en.wikipedia.org/wiki/Nepal","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Shivas_Kinder_-_0219.jpg","page_title":"Nepal","context_page_description":"Nepal, officially the Federal Democratic Republic of Nepal, is a country in South Asia. It is mainly in the Himalayas, but also includes parts of the Indo-Gangetic Plain. It is the 49th largest country by population and 93rd largest country by area. It is landlocked, and borders China in the north and India in the south, east and west, while Bangladesh is located within only 27 km of its southeastern tip and Bhutan is separated from it by the Indian state of Sikkim. Nepal has a diverse geography, including fertile plains, subalpine forested hills, and eight of the world's ten tallest mountains, including Mount Everest, the highest point on Earth. Kathmandu is the capital and the largest city. Nepal is a multiethnic country with Nepali as the official language.\\nThe name \\"Nepal\\" is first recorded in texts from the Vedic period of the Indian subcontinent, the era in ancient India when Hinduism was founded, the predominant religion of the country. In the middle of the first millennium BCE, Gautama Buddha, the founder of Buddhism, was born in Lumbini in southern Nepal. Parts of northern Nepal were intertwined with the culture of Tibet."},{"page_url":"https://cs.wikipedia.org/wiki/1894","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Robert_Michael_Ballantyne.jpg","page_title":"1894","context_page_description":"1894 byl rok, který dle gregoriánského kalendáře započal pondělím."},{"page_url":"https://sv.wikipedia.org/wiki/Luma_(varum%C3%A4rke)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Lumafabriken_1930-tal.jpg","page_title":"Luma (varumärke)","context_page_description":"Luma var ett varumärke för bland annat en glödlampa som ursprungligen tillverkades i den av Kooperativa Förbundet ägda Lumafabriken i Södra Hammarbyhamnen i Stockholm. Varumärket Luma registrerades 1929. Lamptillverkningen startade som en protest mot de dåvarande lamptillverkarnas kartell. Den första Lumalampan tillverkades 1930. År 1947 hade Lumafabriken utökats till 48 000 kvadratmeter och sysselsatte 1 350 anställda. Varje dag tillverkades 50 000 lampor av 4 000 olika modeller. I glastornet högst upp testades firmans prototyper som lyste över hela Stockholm. Vid sidan om många olika lampsorter producerades även radio- och grammofonapparater, lysrör och tv-apparater. År 1977 lade man ner produktionen i Stockholm och fabriksbyggnaderna såldes."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%84%D8%A7%D9%86%D8%AF%DB%8C%D8%B3%D8%8C_%D9%82%D9%88%D8%B2%D8%A6%DB%8C_%DA%A9%D8%A7%D8%B1%D9%88%D9%84%DB%8C%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/NCMap-doton-Landis.PNG","page_title":"لاندیس، قوزئی کارولینا","context_page_description":"لاندیس آمریکانین قوزئی کارولینا ایالتینده یئرلشن بیر شهر. ۲۰۱۸-جی ایلده وئریلن معلوماتا گؤره اهالیسینین سایی ۳۱۲۷ نفر ایدی."},{"page_url":"https://es.wikipedia.org/wiki/Carpio_de_Azaba","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Escudo_de_Carpio_de_Azaba.svg","page_title":"Carpio de Azaba","context_page_description":"Carpio de Azaba es un municipio y localidad española de la provincia de Salamanca, en la comunidad autónoma de Castilla y León. Se integra dentro de la comarca de Ciudad Rodrigo y la subcomarca del Campo de Argañán. Pertenece al partido judicial de Ciudad Rodrigo.​​\\nAdemás del propio Carpio de Azaba, su término municipal está formado por los núcleos de población de Aldeanueva de Azaba, Aldehuela de los Gallegos, Fonseca, Hincapié, Manzano y Palacios, ocupa una superficie total de 70,47 km² y según los datos demográficos recogidos en el padrón municipal elaborado por el INE en el año 2017, cuenta con una población de 105 habitantes.\\nEn el año 1962 obtuvo el premio de honor del II Concurso de Embellecimiento de Pueblos por su «afán de mejora y espíritu de progreso»."},{"page_url":"https://sl.wikipedia.org/wiki/Borkovi%C4%87i,_Banjaluka","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Borkovi%C4%87i.jpeg","page_title":"Borkovići, Banjaluka","context_page_description":"Borkovići so naselje v mestu Banjaluka, Bosna in Hercegovina."},{"page_url":"https://ca.wikipedia.org/wiki/El_Sindicat_(Seriny%C3%A0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/El_Sindicat.jpg","page_title":"El Sindicat (Serinyà)","context_page_description":"El Sindicat és una obra de Serinyà inclosa a l'Inventari del Patrimoni Arquitectònic de Catalunya."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%80%D0%B0%D1%83%D1%82%D0%B4%D0%B5%D0%B9%D0%BB_(%D0%92%D1%96%D1%80%D0%B4%D0%B6%D0%B8%D0%BD%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Troutdale_post_office_24378%2C_and_bank.jpg","page_title":"Траутдейл (Вірджинія)","context_page_description":"Траутдейл — місто в США, в окрузі Грейсон штату Вірджинія. Населення — 178 осіб."},{"page_url":"https://sv.wikipedia.org/wiki/Harry_Bild","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Harry_Bild_1965b.jpg","page_title":"Harry Bild","context_page_description":"Harry Sven-Olof Bild, född 18 december 1936 i Nöbbele, är en svensk före detta fotbollsspelare. Han spelade bland annat för IFK Norrköping."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%88%E3%83%AD%E3%82%A8%E3%83%B3%E3%83%BBH%E3%83%90%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Citroen_HY_3_von_hinten_fcm.jpg","page_title":"シトロエン・Hバン","context_page_description":"Hバンは、フランスの自動車メーカー、シトロエンが1947年から1981年まで製造販売していた貨物自動車である。大部分が標準仕様車であるが、少量の注文生産による多数のバリエーションがある。無蓋車バージョン、荷物室を延長したバージョン、さらには小型バスまでバリエーションは多岐にわたる。モノコックボディーやキャブオーバー型のデザイン、前輪駆動による低床式、車体側面にあるスライディングドアーが特徴的。独創的なデザインは、後のプジョーD-3Aやルノー・エスタフェッテなどに影響を与えた。"},{"page_url":"https://hu.wikipedia.org/wiki/Charlotte","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Flag_of_Charlotte%2C_North_Carolina.png","page_title":"Charlotte","context_page_description":"Charlotte Észak-Karolina legnagyobb városa és 17. az Egyesült Államokban. A népszámlálási hivatal 2006-os becslése szerint a lakosok száma 630 478 fő, amely 46%-os növekedést jelent 1990 óta. 2018-as adatok szerint a lakosság száma 872 498. Charlotte Mecklenburg megye székhelye."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BC%D0%BC%D0%B5%D1%80%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Karte_Gemeinde_Mammern_2007.png","page_title":"Маммерн","context_page_description":"Маммерн — Швейцарияның Тургау кантонында орналасқан коммуна. Штекборн округінің құрамына кіреді.\\n2007 жылғы мәліметтер бойынша тұрғындарының саны 585 адамды құрайды. Алып жатқан жер аумағы 5.5 км² шамасында. Ресми идентификациялық коды — 4826, пошта индексі — 8265."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%8E%AB%E6%8C%AF%E8%8F%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Mok_Chun_Wah.jpg","page_title":"莫振華","context_page_description":"莫振华，是一名已退役的香港足球运动员，外号“莫牛”，司职左翼，曾入选中华民国。1950年代尾与姚卓然、何祥友及黄志强合称“南华四条烟”，又与“牛屎”黄志强合称“双牛阵”。"},{"page_url":"https://en.wikipedia.org/wiki/Gopuram","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Sri_Mahamariamman_temple-Kuala_Lumpur_Malaysia.jpg","page_title":"Gopuram","context_page_description":"A gopuram or gopura is a monumental entrance tower, usually ornate, at the entrance of a Hindu temple, in the Dravidian architecture of the Tamil Nadu, Andhra Pradesh, Kerala, Karnataka, and Telangana states of Southern India.\\nAncient and early medieval temples feature smaller gopuram, while in later temples they are a prominent feature of Hindu temples of the Dravidian style; or in many cases the temple compound was expanded and new larger gopuram built along the new boundary. They are topped by the kalasam, a bulbous stone finial. They function as gateways through the walls that surround the temple complex. Another towering structure located towards the center of the temple is the Vimanam. Both of them are designed and constructed as per rules given in the texts of Vaastu shastra.\\nThe gopuram's origins can be traced back to early structures of the Pallava kings, and relate to the central shikhara towers of North India."},{"page_url":"https://en.wikipedia.org/wiki/Mokala_National_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Roan_Antilopes_with_Buffaloes%2C_Zebras_and_one_Eland_at_water_hole_..._%2830033578573%29.jpg","page_title":"Mokala National Park","context_page_description":"Mokala National Park is a reserve established in the Plooysburg area south-west of Kimberley in the Northern Cape, South Africa on 19 June 2007. The size of the park is 26,485 hectares. Mokala is the Setswana name for the magnificent camel thorn, a tree species typical of the arid western interior and common in the area. There is currently 70 km of accessible roads in the national park."},{"page_url":"https://en.wikipedia.org/wiki/Valentyna_Lutayeva","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Tetyana_Kocherhina%2C_Valentyna_Lutayeva%2C_Zinaida_Turchyna_1980.jpg","page_title":"Valentyna Lutayeva","context_page_description":"Valentyna Ivanivna Lutayeva is a retired Ukrainian handball player. She was part of the Soviet team that won a gold medal at the 1980 Olympics."},{"page_url":"https://it.wikipedia.org/wiki/Bandiera_dell%27Abcasia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Abkhazian_flags_flying_in_Sukhumi.jpg","page_title":"Bandiera dell'Abcasia","context_page_description":"L'attuale bandiera dell'Abcasia è stata creata nel 1991 da V. Gamgia ed è stata adottata come bandiera nazionale dal parlamento abcaso il 23 luglio 1992. Proporzioni 3/5."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1979","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Lusty_looks_KuPS_HJK_03_08.jpg","page_title":"Lijst van personen geboren in 1979","context_page_description":"Dit is een lijst van personen die geboren zijn in 1979.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://fr.wikipedia.org/wiki/Mont_Andromeda","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Canada_Alberta_relief_location_map.jpg","page_title":"Mont Andromeda","context_page_description":"Le mont Andromeda, en anglais : Mount Andromeda, est situé dans le champ de glace Columbia à la frontière entre les parcs nationaux de Banff et de Jasper. La montagne peut être aperçue depuis la Icefields Parkway près du Sunwapta Pass et est située directement au sud-ouest du mont Athabasca.\\nLe mont Andromeda est nommé en 1938 par Rex Gibson, l'ancien président du Club alpin du Canada, d'après Andromeda, la femme de Persée."},{"page_url":"https://fr.wikipedia.org/wiki/Ann%C3%A9es_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Je_suis_Charlie_Strasbourg_7_janvier_2015_02.jpg","page_title":"Années 2010","context_page_description":"Les années 2010 ont commencé le 1ᵉʳ janvier 2010 et se sont achevées le 31 décembre 2019.\\nElles commencent dans une crise financière héritée de la décennie précédente, évoluant dans l'eurogroupe en une crise de la dette qui débouche sur des politiques d'austérité dans toute la zone euro, et particulièrement en Grèce, en Espagne et en Italie.\\nDans le même temps, la géopolitique internationale est bouleversée par le printemps arabe, mouvement de révolte en Afrique du Nord et au Moyen-Orient débouchant sur le départ des dictateurs en Tunisie, en Égypte et au Yémen. En Libye, l'intervention des pays occidentaux aboutit à la chute et à la mort du colonel Kadhafi. En Syrie, la révolte populaire débouche sur une guerre civile majeure, compliquée par l’expansion de l’État islamique, déjà implanté en Irak. De violents conflits affectent également les pays du Sahel, le Nigeria, la bande de Gaza et l'Ukraine.\\nLes organisations jihadistes, et principalement l'État islamique, Al-Qaïda et leurs groupes reliés, perpétuent en parallèle de nombreux attentats dans les pays musulmans d'Afrique et d'Asie mais aussi en Europe et en Amérique du Nord."},{"page_url":"https://pt.wikipedia.org/wiki/Telefone_celular","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/DynaTAC8000X.jpg","page_title":"Telefone celular","context_page_description":"Telefone celular ou telemóvel é um aparelho de comunicação por ondas eletromagnéticas que permite a transmissão bidirecional de voz e dados utilizáveis em uma área geográfica que se encontra dividida em células, cada uma delas servida por um transmissor/receptor. A invenção do telefone celular ocorreu em 1947 pelo laboratório Bell, nos Estados Unidos.\\nHá diferentes tecnologias para a difusão das ondas eletromagnéticas nos telefones móveis, baseadas na compressão das informações ou na sua distribuição: na primeira geração, com os sistemas NMT e AMPS; na segunda geração: GSM, CDMA e TDMA; na segunda geração e meia, presente nas tecnologias GPRS, EDGE, HSCSD e 1xRTT; na terceira geração, como UMTS e EVDO; na terceira geração e meia, como HSDPA, HSPA e HSUPA. Já em desenvolvimento a 4G.\\nAparelhos análogos baseados no rádio já eram utilizados pelos autoridades policiais de Chicago na década de trinta, entre outras tecnologias."},{"page_url":"https://ms.wikipedia.org/wiki/Masjid_Kampung_Seberang_Takir","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Coat_of_arms_of_Terengganu.svg","page_title":"Masjid Kampung Seberang Takir","context_page_description":"Masjid Kampung Seberang Takir merupakan sebuah masjid yang terletak di Kampung Seberang Takir, Kuala Nerus, 21300 Kuala Terengganu, Terengganu Darul Iman."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%B0%D1%84%D0%B5%D0%B4%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D1%85_%D1%81%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Church-oldbelievers-kostroma.jpg","page_title":"Список кафедральных соборов России","context_page_description":"Список кафедральных соборов России включает храмовые здания, находящиеся на территории Российской Федерации и принадлежащие христианским конфессиям. Комментарии по каждой конфессии находятся в соответствующем разделе.\\nРяд крупных храмов известны как «соборы» — из-за их размеров или исторической значимости, но если там никогда не было кафедры епископа, они будут включены в отдельный список."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Den_Haag/Sweelinckplein","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/RM18007_Den_Haag_-_Sweelinckplein_8.jpg","page_title":"Lijst van rijksmonumenten in Den Haag/Sweelinckplein","context_page_description":"Een overzicht van de 65 rijksmonumenten in de stad Den Haag gelegen aan of bij het Sweelinckplein."},{"page_url":"https://en.wikipedia.org/wiki/Thrymsa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Tr%C3%A9missis_de_Dagobert_Ier.jpg","page_title":"Thrymsa","context_page_description":"The thrymsa was a gold coin minted in seventh-century Anglo-Saxon England. It originated as a copy of Merovingian tremisses and earlier Roman coins with a high gold content. Continued debasement between the 630s and the 650s reduced the gold content in newly minted coins such that after c. 655 the percentage of gold in a new coin was less than 35%. The thrymsa ceased to be minted after about 675 and was superseded by the silver sceat."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Sumner_Frost","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Navypierfromsouth.JPG","page_title":"Charles Sumner Frost","context_page_description":"Charles Sumner Frost was an American architect. He is best known as the architect of Navy Pier and for designing over 100 buildings for the Chicago and North Western Railway."},{"page_url":"https://en.wikipedia.org/wiki/Moto_X_(1st_generation)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Moto_X_%2811236439494%29.jpg","page_title":"Moto X (1st generation)","context_page_description":"Moto X is an Android smartphone developed and manufactured by Motorola Mobility, and released in August 2013.\\nThe Moto X was the first smartphone from the company fully developed under Google - which acquired Motorola Mobility in 2012 - introduced with a brand refresh, and a new flagship design language replacing the \\"sharp\\" metallic and Kevlar coating used since the original Droid. It was primarily aimed at \\"mainstream\\" consumers, distinguished by features taking advantage of voice recognition and contextual awareness, the ability for users to custom-order the device in their own choice of color options, and emphasizing the fact that the phone had final assembly completed in the United States. It was backed by a large advertizing campaign. The Moto X was available on all U.S. carriers rather than being a Verizon exclusive.\\nMoto X was met with mostly positive reviews, with particular praise towards its hardware design, Motorola's new approach to customizing Android, along with its suite of contextual features, and the influence of its \\"mainstream\\" targeting on its overall performance, user experience, and battery life."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A0%88%E5%8E%9F%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/JR_Suhara_sta_001.jpg","page_title":"須原駅","context_page_description":"須原駅は、長野県木曽郡大桑村大字須原にある、東海旅客鉄道中央本線の駅である。"},{"page_url":"https://tr.wikipedia.org/wiki/IX._Charles","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Fran%C3%A7ois_Clouet_005.jpg","page_title":"IX. Charles","context_page_description":"IX. Charles –, ağabeyi II. François'in ölümüyle tahta geçmiş, ölene kadar Fransa Krallığı yapmıştır."},{"page_url":"https://fr.wikipedia.org/wiki/Donetsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/%D0%9F%D0%B0%D1%80%D0%BA_%D0%A9%D0%B5%D1%80%D0%B1%D0%B0%D0%BA%D0%BE%D0%B2%D0%B0_103.jpg","page_title":"Donetsk","context_page_description":"Donetsk, anciennement nommée Aleksandrovka, Iouzovka et Stalino, est une ville industrielle d'Ukraine et la capitale administrative de l'oblast de Donetsk. Elle comptait 918 536 habitants en 2017 et 1 623 194 pour son agglomération. Donetsk est de fait la « capitale » du Donbass et la première ville industrielle et économique de l'Ukraine.\\nLe 21 janvier 2015, la ville est entièrement contrôlée par la République populaire de Donetsk, état sécessionniste autoproclamé et non-reconnu qui en fait sa capitale dans le cadre de la guerre du Donbass."},{"page_url":"https://de.wikipedia.org/wiki/Citro%C3%ABn_C4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/C4.JPG","page_title":"Citroën C4","context_page_description":"Der Citroën C4 ist ein seit Herbst 2004 gebauter Pkw von Citroën. Die europäische Version wurde bis 2018 im PSA-Werk Mülhausen gebaut. In China und Argentinien erfolgt die Produktion auch als Limousine.\\nVon 1928 bis 1932 stellte Citroën ebenfalls Pkw mit der Bezeichnung C4 her."},{"page_url":"https://pl.wikipedia.org/wiki/Cerkiew_Pocz%C4%99cia_Bogurodzicy_w_M%C5%82odowicach","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/M%C5%82odowice%2C_cerkiew_Pocz%C4%99cia_Bogurodzicy_%28HB6%29.jpg","page_title":"Cerkiew Poczęcia Bogurodzicy w Młodowicach","context_page_description":"Cerkiew Poczęcia Bogurodzicy – drewniana prawosławna cerkiew filialna w Młodowicach. Należy do parafii Opieki Matki Bożej w Kłokowicach, w dekanacie Przemyśl diecezji przemysko-gorlickiej Polskiego Autokefalicznego Kościoła Prawosławnego.\\nDawna świątynia greckokatolicka. Położona na podkarpackim Szlaku Architektury Drewnianej."},{"page_url":"https://sk.wikipedia.org/wiki/Lokality_Svetov%C3%A9ho_dedi%C4%8Dstva_v_Afrike","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Town_of_Harar_with_Citywall.jpg","page_title":"Lokality Svetového dedičstva v Afrike","context_page_description":"Toto je zoznam lokalít Svetového dedičstva v Afrike. Obsahuje lokality v regióne Afrika.\\nPri každej položke je uvedený slovenský názov, oficiálny anglický názov podľa zoznamu UNESCO, stručná charakteristika a odkaz na základné zdôvodnenie zápisu podľa UNESCO. Číslo v odkaze je súčasne číslo, pod ktorým je lokalita vedená v zozname.\\nPoložky zoznamu pri jednotlivých krajinách sú zoradené podľa roku zápisu do zoznamu."},{"page_url":"https://en.wikipedia.org/wiki/Sunbeam","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Sun_over_Lake_Hawea%2C_New_Zealand.jpg","page_title":"Sunbeam","context_page_description":"A sunbeam, in meteorological optics, is a beam of sunlight that appears to radiate from the Sun's position. Shining through openings in clouds or between other objects such as mountains and buildings, these beams of particle-scattered sunlight are separated by darker shadowed volumes. Despite converging toward the light source, the beams are essentially parallel shafts of directly sunlit particles separated by shadowed ones. Their apparent convergence in the sky is a visual illusion from linear perspective. This illusion also causes the apparent convergence of the otherwise parallel lines of a long straight road or hallway at a distant vanishing point. The scattering particles that make sunlight visible may be air molecules or particulates."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B1%D8%AF%D9%88%D8%A7%D9%86_%D9%BE%D9%86%D8%AC%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/KhvasakArtaban.jpg","page_title":"اردوان پنجم","context_page_description":"اردوان پنجم و در ترتیب جدید شاهنشاهان اشکانی اردوان چهارم سی اُمین و آخرین شاه ایران از خاندان اشکانی است که از سال ۲۱۶ میلادی تا ۲۲۴ یا ۲۲۶ شاهی کرده‌است. با کشته شدن او دولت اشکانی از بین رفت و جای خود را به ساسانیان داد."},{"page_url":"https://en.wikipedia.org/wiki/Vic_Chesnutt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Vic_Chesnutt%2C_b.jpg","page_title":"Vic Chesnutt","context_page_description":"James Victor Chesnutt was an American singer-songwriter from Athens, Georgia. His first album, Little, was released in 1990, but his breakthrough to commercial success did not come until 1996 with the release of Sweet Relief II: Gravity of the Situation, a charity record of alternative artists covering his songs.\\nChesnutt released 17 albums during his career, including two produced by Michael Stipe, and a 1996 release on Capitol Records, About to Choke. His musical style has been described by Bryan Carroll of allmusic.com as a \\"skewed, refracted version of Americana that is haunting, funny, poignant, and occasionally mystical, usually all at once\\".\\nInjuries from a 1983 car accident left him partially paralyzed; he used a wheelchair and had limited use of his hands."},{"page_url":"https://es.wikipedia.org/wiki/Galan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Map_commune_FR_insee_code_65183.png","page_title":"Galan","context_page_description":"Galan es una comuna y población de Francia, en la región de Mediodía-Pirineos, departamento de Altos Pirineos, en el distrito de Tarbes. Es la cabecera y mayor población del cantón de su nombre.\\nEstá integrada en la Communauté de communes des Baïses, de la cual es la mayor población. Todos sus habitantes fuman porros y plantan marihuana"},{"page_url":"https://en.wikipedia.org/wiki/Blood_transfusion","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Charles_R_Drew_portrait.png","page_title":"Blood transfusion","context_page_description":"Blood transfusion is the process of transferring blood or blood products into one's circulation intravenously. Transfusions are used for various medical conditions to replace lost components of the blood. Early transfusions used whole blood, but modern medical practice commonly uses only components of the blood, such as red blood cells, white blood cells, plasma, clotting factors, and platelets.\\nRed blood cells contain hemoglobin, and supply the cells of the body with oxygen. White blood cells are not commonly used during transfusion, but are part of the immune system, and fight infections. Plasma is the \\"yellowish\\" liquid part of blood, which acts as a buffer, and contains proteins and important substances needed for the body's overall health. Platelets are involved in blood clotting, preventing the body from bleeding. Before these components were known, doctors believed that blood was homogenous. Because of this, many patients died because incompatible blood was transferred to them."},{"page_url":"https://fr.wikipedia.org/wiki/F%C3%A9vrier_1801","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Marshall-john-engraving-LOC-1808.jpg","page_title":"Février 1801","context_page_description":"Début de la persécution des catholiques en Corée, sur ordre de la reine douairière Kim. Le catholicisme est interdit par décret. Les luttes de faction paralysent la monarchie coréenne. Le clan Kim monopolise les fonctions administratives. Les reines douairières dominent la cour de Séoul.\\n2 février :\\nFrance : la Congrégation est réunie à Paris par l’ancien père jésuite Jean-Baptiste Bourdier-Delpuits.\\nRussie : destitution et exil de Rostoptchine.\\n4 février : John Marshall est nommé président de la Cour suprême des États-Unis, il a exercé cette fonction du 4 février 1801 jusqu'à sa mort le 6 juillet 1835. Ses trois décennies passées à la Cour suprême marqueront considérablement le système législatif américain.\\n7 février, France : le 18 pluviôse, création de tribunaux spéciaux dans 32 départements troublés. Pendant le vote de ces lois, apparaît une rupture entre les Brumairiens, déçus de se voir écartés du pouvoir, et Bonaparte."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%86%DB%8C%D9%88%D8%A2%D8%B1%DA%A9_%D9%84%D8%A8%D8%B1%D9%B9%DB%8C_%D8%A8%DB%8C%D9%86_%D8%A7%D9%84%D8%A7%D9%82%D9%88%D8%A7%D9%85%DB%8C_%DB%81%D9%88%D8%A7%D8%A6%DB%8C_%D8%A7%DA%88%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Newark_Liberty_International_Airport_from_the_Air.jpg","page_title":"نیوآرک لبرٹی بین الاقوامی ہوائی اڈا","context_page_description":"نیوآرک لبرٹی بین الاقوامی ہوائی اڈا ریاستہائے متحدہ امریکا کا ایک ہوائی اڈا اور بین الاقوامی ہوائی اڈا جو نیوآرک، نیو جرسی میں واقع ہے۔"},{"page_url":"https://it.wikipedia.org/wiki/Governo_Fillon_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Fr%C3%A9d%C3%A9ric_Mitterrand_2008.jpg","page_title":"Governo Fillon III","context_page_description":"Il III Governo Fillon è stato il trentatreesimo governo francese, costituito il 14 novembre 2010 dal Presidente della repubblica Nicolas Sarkozy, che ha nominato François Fillon Primo Ministro e gli ha conferito il mandato di comporre la compagine dei ministri e l'incarico di guidare il nuovo esecutivo."},{"page_url":"https://es.wikipedia.org/wiki/Fotopletismograf%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/PPG.PNG","page_title":"Fotopletismografía","context_page_description":"La fotopletismografía o fotopletismograma es una técnica de pletismografía en la cual se utiliza un haz de luz para determinar el volumen de un órgano."},{"page_url":"https://en.wikipedia.org/wiki/Interior_portrait","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Zimmerbild_83.jpg","page_title":"Interior portrait","context_page_description":"The interior portrait or, in German, Zimmerbild, is a pictorial genre that appeared in Europe near the end of the 17th century and enjoyed a great vogue in the second half of the 19th century. It involves a careful, detailed representation of a living space, without any people. These paintings were generally rendered as watercolors and required great technical mastery, if little creativity. By the mid-20th century, although such scenes were still being created, photography had changed this style of painting into a form of intentional archaism."},{"page_url":"https://da.wikipedia.org/wiki/Obninsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Coat_of_Arms_of_Obninsk_%28Kaluga_oblast%29_proposal_%282003_N2%29.png","page_title":"Obninsk","context_page_description":"Obninsk er en by i det vestlige Rusland, beliggende i Kaluga oblast. Byen har 113.639 indbyggere. Obninsk ligger 110 km sydvest for Moskva og 68 km nordøst for oblastens administrative center Kaluga. Den nærmeste by er Balabánovo, 10 km væk."},{"page_url":"https://hu.wikipedia.org/wiki/Luvi_%C3%ADr%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Luvi_10.jpg","page_title":"Luvi írás","context_page_description":"A luvi írás a luvi nyelv leírására szolgáló hieroglif típusú írásrendszer. Anatóliában alakult ki és a képjelek semmilyen kapcsolatot nem mutatnak más hieroglif írásokkal, sem az óegyiptomival, sem a képszerű ókánaánita ábécével, így endemikusnak tekinthető. Az íráskép felfedezését követően először hettita képírásnak gondolták, amelyet a hettiták a saját ékírásos rendszerük mellett az epigrafikus felirataikon alkalmaztak. Kiderült azonban, hogy a „hettita hieroglifákkal” írt feliratok nem hettita nyelvűek. A hettita íráshoz annyiban hasonlít, hogy szintén szótagírás, de a rendszere gyökeresen különbözik tőle."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%8A-64","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/%D0%94%D0%9F-64_-_%D0%9C%D0%92%D0%9C%D0%A1_2007.jpg","page_title":"ԴՊ-64","context_page_description":"ԴՊ-64 «Նեպրյադվա», սովետական ձեռքի հակադիվեևսիոն երկփող նռնականետ։ Ստեղծված է ծովային օբյեկտները մարտական լողորդների հարձակումից պաշտպանության համար։"},{"page_url":"https://de.wikipedia.org/wiki/Kabinett_Noda_(1._Umbildung)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Naoki_Tanaka-1.jpg","page_title":"Kabinett Noda (1. Umbildung)","context_page_description":"Das zum ersten Mal umgebildete Kabinett Noda regierte Japan unter Führung von Premierminister Yoshihiko Noda vom 13. Januar 2012 bis zu einer erneuten Kabinettsumbildung am 4. Juni 2012. Für die Ende Januar beginnende Sitzungsperiode des nationalen Parlaments, die Haushaltsberatungen für das im April beginnende Fiskaljahr 2012 und für ein Gesetz zur Erhöhung der Mehrwertsteuer ersetzte Noda mehrere Minister, darunter zwei, gegen die das von der Opposition dominierte Sangiin, das Oberhaus, nicht bindende Misstrauensanträge verabschiedet hatte. Außerdem berief er Katsuya Okada zum Vizepremierminister und übertrug ihm mehrere Aufgaben; vor allem sollte er die Reform von Steuersystem und Sozialversicherungen lenken, für die die Regierung mit der Oppositionsmehrheit im Sangiin kooperieren musste. Die meisten Minister wurden aus dem erst seit September 2011 amtierenden Vorgängerkabinett übernommen. Am 10. Februar wurden anlässlich der Einrichtung der neuen Wiederaufbaubehörde einige Ministerposten neu verteilt und Masaharu Nakagawa wurde wieder ins Kabinett berufen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Thai_royal_residences","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/WangDerm1.jpg","page_title":"List of Thai royal residences","context_page_description":"Royal residences of the Chakri Dynasty in Thailand include the Grand Palace, nineteen royal palaces and other palaces used by the king or other members of the royal family. The Bureau of the Royal Household administers and manages several current royal palaces. Historical palaces from earlier periods exist mainly in the ruins of Ayutthaya and Sukhothai. This page lists current and former royal residences, arranged by type of residence."},{"page_url":"https://uk.wikipedia.org/wiki/Blood_on_the_Dance_Floor","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Botdf_2013_hanna_kyri.jpg","page_title":"Blood on the Dance Floor","context_page_description":"Blood on the Dance Floor — американський гурт, що грає в стилях: скримо та кранккор. Гурт був утворений 2007 року у місті Орландо, Флорида, однак зараз базується в місті Фінікс, Аризона. Гурт випустив п'ять студійних альбомів, три з яких були видані без лейбла. Альбом Epic був випущений під лейблом «Candyland Records» у 2010 році, а альбом Evolution вийшов 19 червня 2012 року під лейблом «Dark Fantasy Records»."},{"page_url":"https://fi.wikipedia.org/wiki/Puolalanm%C3%A4en_lukio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Puolalan_yhteislyseo.jpg","page_title":"Puolalanmäen lukio","context_page_description":"Puolalanmäen lukio sijaitsee Turun keskustassa Puolalanmäellä. Lukiossa toimii yksi Suomen kymmenestä musiikkilukiosta, ja 40 % lukion 450 oppilaasta käy musiikkilinjaa. Lukio on hyvin kansainvälinen vaihto-oppilaiden, kansainvälisyyskurssien, musiikkitoiminnan ja monipuolisten kielten opiskelumahdollisuuksiensa vuoksi.\\nPuolalanmäen lukio jatkaa vuonna 1928 perustetun Turun Toisen Suomalaisen Lyseon, sittemmin Puolalan Yhteislyseon perinnettä. Jälkimmäinen näistä entisistä nimistä on edelleen koulurakennuksen Puutarhakadun puoleisessa seinässä. TTSL:n kutsumanimenä käytettiin koulun perustajan ja pitkäaikaisen rehtorin H. W. Halmeen lempinimestä väännettyä ”Hessun koulua”, Puolalan Yhteislyseo puolestaan tunnettiin Pyllinä, jota nimeä koulun myöhemmätkin oppilaat ovat käyttäneet. Puutarhakatu 5:n koulutaloon ”Hessun koulu” muutti sodan jälkeen ruotsinkielisen reaalilyseon toiminnan päätyttyä toimittuaan sitä ennen mm. Kauppatorin laidalla sijainneessa entisessä postitalossa. Muuton jälkeen entisen poikakoulun ovet aukesivat myös tytöille.\\nSamassa rakennuksessa toimii yläaste, joka yhdistyi vuoden 2006 elokuussa Puolalan ala-asteen kanssa yhtenäiseksi oppilaitokseksi."},{"page_url":"https://fr.wikipedia.org/wiki/Pont_de_la_Concorde","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Statue_de_Tourville.JPG","page_title":"Pont de la Concorde","context_page_description":"Le pont de la Concorde est un pont de Paris qui franchit la Seine entre le quai des Tuileries et le quai d'Orsay. Il a porté au cours de son histoire les noms de « pont Louis-XVI », « pont de la Révolution », « pont de la Concorde », à nouveau « pont Louis-XVI » pendant la Restauration, et définitivement « pont de la Concorde » depuis 1830. Il fait l’objet d’une inscription au titre des monuments historiques depuis le 12 juin 1975."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%B8%AF%E4%B9%9D%E8%A1%97%E5%9D%8A%E5%A9%A6%E5%A5%B3%E6%9C%83%E5%AD%AB%E6%96%B9%E4%B8%AD%E5%B0%8F%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/SFC%27s_banner.jpg","page_title":"港九街坊婦女會孫方中小學","context_page_description":"港九街坊妇女会孙方中小学是一所全日制小学，位于大埔富善邨。孙方中于1987年创办，学生可以一条龙直升孙方中书院。"},{"page_url":"https://vi.wikipedia.org/wiki/Pennantia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Pennantiacorymbosa2.jpg","page_title":"Pennantia","context_page_description":"Pennantia là chi duy nhất của họ Pennantiaceae theo phân loại mới nhất của hệ thống APG II năm 2003, căn cứ theo nghiên cứu của Kårehed và được tách ra khỏi họ Icacinaceae nghĩa rộng. Theo APG II và APG III thì chi này có 4 loài cây gỗ cao tới 30 m, sống trong các rừng mưa tại khu vực đông và đông bắc Australia, đảo Norfolk và New Zealand."},{"page_url":"https://hr.wikipedia.org/wiki/Sezamovke","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Pterodiscus_speciosus.jpg","page_title":"Sezamovke","context_page_description":"Sezamovke, porodica u redu medićolike koja obuhvaća dvadesetak rodova od kojih su najvažniji rodovi Sesamum i Pedalium sa vrstom Pedalium murex L., koja raste u Indiji gdje je poznata kao Bada Gokhru gdje se tradicionalno koristi u medicini. Danas se smatra da vrijedan izvor jedinstvenih prirodnih proizvoda za razvoj lijekova protiv raznih bolesti, ali i za razvoj industrijskih proizvoda."},{"page_url":"https://en.wikipedia.org/wiki/Madeira_firecrest","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Mad-Firecrest-B.jpg","page_title":"Madeira firecrest","context_page_description":"The Madeira firecrest, Madeira kinglet, or Madeiracrest is a very small passerine bird endemic to the island of Madeira. It is a member of the kinglet family. Before it was recognised as a separate species in 2003, it was classified as a subspecies of the common firecrest. It differs in appearance and vocalisations from its relative, and genetic analysis has confirmed it as a different species. The Madeiran bird has green upperparts, whitish underparts and two white wingbars, and a distinctive head pattern with a black eye stripe, short white supercilium, and a crest that is mainly orange in the male and yellow in the female.\\nThe female Madeira firecrest builds a spherical nest from cobwebs, moss and small twigs, and she incubates the eggs and broods the chicks on her own. Both parents feed the young. This species forages for insects and other small invertebrates in tree heath, laurisilva and other woodland. It is common within its restricted range, and is not considered to be threatened."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B2%B5%EC%BC%80_%ED%8F%AC%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/66382_Wenche_Foss.jpg","page_title":"벵케 포스","context_page_description":"벵케 포스는 노르웨이의 배우, 가수이다."},{"page_url":"https://en.wikipedia.org/wiki/Shitomi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/G324-HR13-08.jpg","page_title":"Shitomi","context_page_description":"Shitomi, also called hajitomi are square-lattice shutters or doors found on older-style Japanese buildings. They are characteristic of the Shinden style, and the Heian Period. They were used in aristocrats' palaces, and more rarely occur in temple buildings. They were replaced by sliding panels in the Shoin style.\\nThey are usually split and hinged horizontally; when open, the upper shutter was held up at 90 degrees to the wall with hooks, and the lower half could either be lifted out or folded parallel to the upper shutter. This allows the entire wall to be removed, leaving only the pillars. They are occasionally referenced in modern architecture."},{"page_url":"https://nl.wikipedia.org/wiki/Ro%C5%BEnik_(Grosuplje)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Ro%C5%BEnik%2C_Grosuplje_1948.jpg","page_title":"Rožnik (Grosuplje)","context_page_description":"Rožnik is een plaats in Slovenië en maakt deel uit van de Sloveense gemeente Grosuplje in de NUTS-3-regio Osrednjeslovenska. De plaats telt 47 inwoners."},{"page_url":"https://es.wikipedia.org/wiki/Cors%C3%B3dromo_de_Gualeguaych%C3%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Corsodromo_de_gualeguaychu_1997.jpg","page_title":"Corsódromo de Gualeguaychú","context_page_description":"El Corsódromo de Gualeguaychú es un espacio destinado a la realización del llamado Carnaval del País en Gualeguaychú, provincia de Entre Ríos, Argentina.​​ También se lo conoce como sambódromo de Gualeguaychú. Es el primero de su tipo en Argentina, con una extensión de 500 metros de largo y un ancho de pista de 10 metros útiles.​ Tiene una capacidad para aproximadamente 35 mil personas.\\nSe encuentra ubicado en la antigua estación de trenes de la ciudad. En dicho lugar también se ubican el Parque de la Estación y el Centro de Convenciones Gualeguaychú. Desde el 18 de mayo de 2019 alberga también al Museo del Carnaval.​\\nFue planificado en 1995 por los arquitectos Raúl Medrano y Domingo Carraza, durante el último año de gestión del intendente Luis Leissa e inaugurado el 18 de enero de 1997, en la primera gestión de Daniel Irigoyen.\\nEn el corsódromo no solo se realizan las noches del Carnaval del País, sino que también se han desarrollado recitales; como el de Soledad Pastorutti en 1998 y el de la banda de rock La Renga en 2012. Durante algunos años también se realizó la Convención de carnavales del Mercosur, la Fiesta Nacional de Carrozas Estudiantiles y varios encuentros de autos."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Neuk%C3%B6lln","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Stolperstein.Neuk%C3%B6lln.Donaustra%C3%9Fe_115.Regina_L%C3%B6der.1556.jpg","page_title":"Liste der Stolpersteine in Berlin-Neukölln","context_page_description":"Die Liste der Stolpersteine in Berlin-Neukölln enthält die Stolpersteine im Berliner Ortsteil Neukölln im Bezirk Neukölln, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Tabelle erfasst insgesamt 207 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://cs.wikipedia.org/wiki/Topi_Pigula","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Topi_Pigula_Vietnam_2011.jpg","page_title":"Topi Pigula","context_page_description":"Topi Pigula či Topí Pigula, původním jménem Tomáš Pigula je český fotograf, publicista a cestovatel."},{"page_url":"https://nl.wikipedia.org/wiki/Drieblad","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Hrad_K%C3%A1men_%283%29.jpg","page_title":"Drieblad","context_page_description":"Een drieblad is een bepaalde vorm in maaswerk waarbij drie overlappende cirkels met ieder een spitsbogig einde in een driehoek gelegen zijn en open zijn aan de kant waar ze elkaar raken. Iedere cirkel met spitse punt vormt als het ware een blad. Dat spitsbogige einde is nodig vanwege de opname van het drieblad in een bol gebogen driehoek, omdat er anders driehoekjes aan ruimte over blijft. Ze zijn voornamelijk gebruikt in de gotische traceringen van vensters. Ze worden veelvuldig gebruikt in combinatie met andere sierlijke motieven.\\nZe kunnen blind of opengewerkt zijn.\\nDe drie naar binnen wijzende punten worden ieder een toot genoemd.\\nEen drieblad heeft drie cirkels met een naar buiten wijzende punt. Wanneer de cirkels van een motief ieder rond zijn wordt dat een driepas genoemd. Ook bestaan er motieven met vier bladeren, een vierblad, en vier ronde cirkels, een vierpas.\\nDe boogconstructie waarbij de drieblad is toegepast als basisvorm is de driebladboog."},{"page_url":"https://pl.wikipedia.org/wiki/Danziger_Hof","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Gda%C5%84sk%2C_Pawilon_LOT_-_fotopolska.eu_%28215813%29.jpg","page_title":"Danziger Hof","context_page_description":"Danziger Hof – najbardziej luksusowy hotel w Gdańsku, istniejący w latach 1898–1945, zlokalizowany przy ul. Dominikswall 6, obecnie Wały Jagiellońskie 2/4."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_des_C%C3%B4tes-d%27Armor_(P-Z)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Chapelle_Saint-Nicolas_de_Kerhir_%C3%A0_Tr%C3%A9darzec_01.JPG","page_title":"Liste des monuments historiques des Côtes-d'Armor (P-Z)","context_page_description":"Cet article recense une partie des monuments historiques des Côtes-d'Armor, en France."},{"page_url":"https://ru.wikipedia.org/wiki/Boeing_747-400","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/British_Airways_G-BNLU-2008-09-13-YVR.jpg","page_title":"Boeing 747-400","context_page_description":"Boeing 747-400 — одна из модификаций Boeing 747, четырёхдвигательный реактивный двухпалубный широкофюзеляжный пассажирский самолёт, производимый компанией «Boeing Commercial Airplanes». Серия −400 стала самой продаваемой модификацией успешного семейства 747. Основным отличием от других моделей 747 являются законцовки крыла, хотя модификация −400D их лишена. В зависимости от модификации самолёт может перевозить до 624 пассажиров и иметь дальность до 14 200 км.\\n747-400 является предпоследней версией самолёта Boeing 747, на смену которой пришла более экономичная и технологичная модификация Boeing 747-8. Последний произведённый 747-400 был поставлен заказчику в декабре 2009 года."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-Marcellin-l%C3%A8s-Vaison","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Vue_sur_Saint-Marcellin-l%C3%A8s-Vaison_by_JM_Rosier.JPG","page_title":"Saint-Marcellin-lès-Vaison","context_page_description":"Saint-Marcellin-lès-Vaison is een gemeente in het Franse departement Vaucluse en telt 338 inwoners. De plaats maakt deel uit van het arrondissement Carpentras."},{"page_url":"https://de.wikipedia.org/wiki/Humanistische_Kursive","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Bickham-letter.png","page_title":"Humanistische Kursive","context_page_description":"Die humanistische Kursive ist die Urform der lateinischen Schreibschriften. Sie wurde während des Renaissance-Humanismus in Italien entwickelt.\\nDurch den Einfluss der raschen Bewegungsausführung auf die Form der Schrift stellte sie das dynamisch betonte Pendant zur humanistischen Minuskel, der mehr statisch aufgebauten Buchschrift von Poggio Bracciolini, dar. Mit ihrer Erfindung wurden zugleich Voraussetzungen für die Entwicklung der kursiven Drucktype geschaffen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%96%D1%81%D0%BD%D0%B8%D1%87%D0%B0_%D0%92%D1%96%D0%BA%D1%82%D0%BE%D1%80%D1%96%D1%8F_%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%97%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/%D0%92%D1%96%D0%BA%D1%82%D0%BE%D1%80%D1%96%D1%8F_%D0%9B%D1%96%D1%81%D0%BD%D0%B8%D1%87%D0%B0_%D0%BD%D0%B0_%D0%B7%D1%83%D1%81%D1%82%D1%80%D1%96%D1%87%D1%96_%D1%83_%D0%BF%D0%BE%D1%81%D0%BE%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D1%96_%D0%9A%D0%9D%D0%A0.jpg","page_title":"Ліснича Вікторія Миколаївна","context_page_description":"Вікторія Миколаївна Ліснича — український громадський і політичний діяч, президент ГО «Міжнародна дипломатична рада в Україні», співзасновник юридичної компанії «Ти і право», екс-заступник міністра культури України."},{"page_url":"https://nl.wikipedia.org/wiki/Pruszcz_Gda%C5%84ski","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Cukrownia_w_Pruszczu_Gdanskim_2010_ubt-4.JPG","page_title":"Pruszcz Gdański","context_page_description":"Pruszcz Gdański is een stad in het Poolse woiwodschap Pommeren, gelegen in de powiat Gdański. De oppervlakte bedraagt 16,47 km², het inwonertal 23.529.\\nDe stad is de zetel van Powiat Gdański, en ligt op ongeveer 12 km ten zuiden van het centrum van Gdańsk."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%95%E0%B8%B5%E0%B8%99%E0%B8%9A%E0%B8%AD%E0%B8%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Raphicerus_campestris_female_%28Etosha%2C_2012%29.jpg","page_title":"สตีนบอก","context_page_description":"สตีนบอก หรือ สตีนบัก แอนทิโลปชนิดหนึ่ง จำพวกแอนทิโลปขนาดเล็ก หรือแอนทิโลปแคระ\\nสตีนบอก มีน้ำหนักตัวประมาณ 11 กิโลกรัม ความสูง 60 เซนติเมตร ความยาว 95 เซนติเมตร–1.1 เมตร อายุโดยเฉลี่ย 10 ปี พบกระจายพันธุ์ในแอฟริกาใต้ และพบได้ยากในแอฟริกาตะวันออก แต่จะพบได้บ่อยในอุทยานแห่งชาติเซเรนเกตี ในแทนซาเนีย และพบได้ที่อุทยานแห่งชาติอีโตซา ในนามิเบีย รวมถึงอุทยานแห่งชาติครูเกอร์ ในแอฟริกาใต้ โดยจะอาศัยอยู่ตามทุ่งหญ้าที่มีพุ่มไม้หนามแหลมเพื่อป้องกันตัว หรือเขตที่ติดต่อกับทะเลทราย เช่น ทะเลทรายคาลาฮารี รวมถึงอาศัยอยู่ในทุ่งหญ้าเปิดโล่งด้วย\\nสตีนบอก มีเขาเฉพาะตัวผู้ เขายาวเพียง 10–17.5 เซนติเมตร แต่มีความแหลมคม ตัวเมียไม่มีเขา แต่มีขนาดตัวใหญ่กว่าตัวผู้เล็กน้อย กินอาหารได้แก่ ใบไม้แทบทุกชนิด, ผลไม้จำพวกเบอร์รีต่าง ๆ ตลอดจนหญ้าสั้นที่เบ่งบานในช่วงฤดูฝน\\nสตีนบอก ตกเป็นอาหารของสัตว์นักล่าขนาดใหญ่ เช่น เสือดาว, เสือชีตาห์, หมาป่า, แมวป่า, อินทรีหรือเหยี่ยวขนาดใหญ่, ลิงบาบูน และงูเหลือม\\nแบ่งออกได้เป็น 2 ชนิดย่อย ได้แก่:\\nR. c. campestris: พบในแอฟริกาใต้\\nR. c. naumanni: พบในแอฟริกาตะวันออก"},{"page_url":"https://en.wikipedia.org/wiki/Jacket%27s_Field_Long_Barrow","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Jacket%27s_Field_Long_Barrow_I.jpg","page_title":"Jacket's Field Long Barrow","context_page_description":"Jacket's Field Long Barrow is an unchambered long barrow located near to the village of Boughton Aluph in the south-eastern English county of Kent. It was probably constructed in the fourth millennium BCE, during Britain's Early Neolithic period. Built out of earth, the long barrow consists of an sub-trapezoidal tumulus flanked by side ditches.\\nArchaeologists have established that the monument was built by a pastoralist community shortly after the introduction of agriculture to Britain from continental Europe. Although representing part of an architectural tradition of long-barrow building that was widespread across Neolithic Europe, Jacket's Field Long Barrow belongs to a localised regional variant of barrows produced in the vicinity of the River Stour. Of these, it lies on the western side of the river, while Julliberrie's Grave and Shrub's Wood Long Barrow are found on the eastern side. The site was discovered in 1970, at which point it was concealed in dense woodland, although has yet to undergo thorough archaeological investigation."},{"page_url":"https://ca.wikipedia.org/wiki/Kazembe","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Kazembe_Kingdom_433x455.JPG","page_title":"Kazembe","context_page_description":"Kazembe és un regne tradicional en la moderna Zàmbia.\\nPer més de 250 anys Kazembe ha estat un regne influent o domini d'un capitost del Kiluba-Chibemba parlant la llengua swahili, una mescla d'àrab i les llengües africanes tradicionals o Luba-Lunda oriental del l'Àfrica sud-central. La seva posició en les rutes comercials en una àrea relativament ben regada, relativament fèrtil i ben poblada amb boscos, pesca i els recursos agrícoles, va veure passar expedicions de comerciants i exploradors que el van esmentar com Kasembe, Cazembe i Casembe.\\nConegut pel títol de Mwata o Mulopwe, ara equivalent a 'Cap Tradicional', la monarquia amb el seu festival anual Mutomboko a la vall de Luapula i al Llac Mweru a la Zàmbia moderna, encara que la seva història en temps colonials és un exemple de com els europeus van dividir tribus i regnes tradicionals sense considerar les conseqüències."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BC%97%E7%95%99%E5%88%A9-%E5%A8%81%E5%B0%BC%E6%96%AF%E6%9C%B1%E5%88%A9%E4%BA%9A%E5%A4%A7%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Map_of_region_of_Friuli-Venezia_Giulia%2C_Italy%2C_with_provinces-it.svg","page_title":"弗留利-威尼斯朱利亚大区","context_page_description":"佛里烏利-威尼斯朱利亞，面積7856km²，人口118萬，是義大利東北部的一個自治區，毗鄰威尼托政區、奧地利、斯洛維尼亞和亞得里亞海。主要城市是第里雅斯特和烏迪內。\\n除義大利語外，佛里烏利語在整個政區也很流行，被一些語言學家當作義大利語的方言，其他人則認為它是一門完全獨立的語言。還有相當多的一部分是講斯洛維尼亞語的少數民族。"},{"page_url":"https://sco.wikipedia.org/wiki/Valdes_Peninsula","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Argentine_Gray_Fox.jpg","page_title":"Valdes Peninsula","context_page_description":"The Valdes Peninsula is a peninsula on the Atlantic coast in the Viedma Depairtment in the north east o Chubut Province, Argentinae. Aboot 3,625 km² in size, it is an important naitur reserve which wis leetit as a Warld Heritage Steid bi UNESCO in 1999."},{"page_url":"https://vi.wikipedia.org/wiki/Suy_s%E1%BB%A5p_h%E1%BA%A5p_d%E1%BA%ABn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/NGC_6745.jpg","page_title":"Suy sụp hấp dẫn","context_page_description":"Suy sụp hấp dẫn hay suy sập hấp dẫn là hiện tượng co nén cực nhanh của các vật thể có khối lượng lớn dưới tác dụng của lực hấp dẫn.\\nSuy sụp hấp dẫn thường xuất hiện ở giai đoạn kết thúc của quá trình tiến hóa của thiên thể có khối lượng lớn, khoảng 10 lần khối lượng Mặt Trời. Sau khi đốt cạn nguồn nhiên liệu hạt nhân, các sao này sẽ mất cân bằng cơ học dẫn đến quá trình co nén vào tâm với tốc độ tăng dần.\\nCùng với quá trình suy sụp vào trong này là quá trình tăng áp suất bên trong. Có hai khả năng xảy ra:\\nNếu áp suất tại tâm tăng đủ lớn để ngừng quá trình suy sụp hấp dẫn thì thiên thể đó sẽ có khối tâm là một sao neutron đặc. Lớp vỏ lúc đó bắn ra ngoài tạo thành tinh vân, độ sáng của thiên thể tăng lên hàng triệu lần trong một thời gian ngắn hình thành sao siêu mới\\nNếu áp suất bên trong của thiên thể chỉ đủ làm chậm quá trình suy sụp hấp dẫn nhưng không ngăn được sự co nén vật chất vào trong bán kính hấp dẫn, vật chất sẽ tiếp tục suy sụp vào và khối tâm lúc đó trở thành một hố đen."},{"page_url":"https://ia.wikipedia.org/wiki/Virtutes_cardinal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Sapientia_Papstgrab_Bamberg_aus_Gottfried_Henschen_u_Daniel_Papebroch_1747.jpg","page_title":"Virtutes cardinal","context_page_description":"Jam notas al philosophos antique, in particular a Platon, juxta le catholicismo, le virtutes cardinal, nominate anque virtutes human principal, reguarda essentialmente le homine e constitue le pilastros de un vita fundate al ben. Illos reguarda le anima human regulante le conducta conformemente al fide, como etiam al ration."},{"page_url":"https://en.wikipedia.org/wiki/Wirral_South_(UK_Parliament_constituency)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/WirralSouth2007Constituency.svg","page_title":"Wirral South (UK Parliament constituency)","context_page_description":"Wirral South is a constituency in Merseyside represented in the House of Commons of the UK Parliament since 2010 by Alison McGovern of the Labour Party."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Nador_S%C3%A9ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Cala_junto_a_Mina_Rosita.jpg","page_title":"Nador Séng","context_page_description":"Nador Séng sī Morocco Ông-kok Oriental Tē-hng ê chi̍t ê séng."},{"page_url":"https://ca.wikipedia.org/wiki/Microcystis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Microcystis_aeruginosa.jpeg","page_title":"Microcystis","context_page_description":"Microcystis és un gènere de cianobacteris d'aigües dolces que inclou l'espècie damnosa en aigües eutrofitzades Microcystis aeruginosa."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Kiinan_maakunnallisista_moottoriteist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/S0712-CN_%28AH%29_no_name.png","page_title":"Luettelo Kiinan maakunnallisista moottoriteistä","context_page_description":"Tämä luettelo kertoo Kiinan maakunnallisista moottoriteistä."},{"page_url":"https://en.wikipedia.org/wiki/Lovespoon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Lovespoon2.jpg","page_title":"Lovespoon","context_page_description":"A lovespoon is a wooden spoon decoratively carved that was traditionally presented as a gift of romantic intent. The spoon is normally decorated with symbols of love, and was intended to reflect the skill of the carver. Due to the intricate designs, lovespoons are no longer used as functioning spoons and are now decorative craft items."},{"page_url":"https://en.wikipedia.org/wiki/Carleton_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Dunton_Tower_Carleton_University_2014.jpg","page_title":"Carleton University","context_page_description":"Carleton University is a public comprehensive university in Ottawa, Ontario, Canada. Founded in 1942 as Carleton College, a private, non-denominational evening college to serve veterans returning from World War II, it was chartered as a university by the provincial government in 1952 through The Carleton University Act. The legislation was amended in 1957 to give the institution its current name. The university moved to its current campus in 1959, expanding rapidly throughout the 1960s as the Ontario government expanded support for post-secondary institutions and sought to increase access to higher education.\\nThe university is named for the now-dissolved Carleton County, which included the city of Ottawa at the time the university was founded. Carleton County, in turn, was named in honour of Guy Carleton, 1st Baron Dorchester, who served as Governor General of The Canadas from 1786 to 1796.\\nCarleton has more than 159,000 alumni worldwide and is known for its strength in several disciplines including the humanities, international business, aerospace engineering, international affairs, journalism, political science, and public policy."},{"page_url":"https://hu.wikipedia.org/wiki/Dinitrog%C3%A9n-trioxid","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Dinitrogen-trioxide-xtal-3D-vdW.png","page_title":"Dinitrogén-trioxid","context_page_description":"A dinitrogén-trioxid a nitrogén egyik oxidja, folyadékfázisban sötétkék színű vegyület, képlete N₂O₃. Még a forráspontja alatti hőmérsékleten bomlik, barna gáz keletkezik. Ilyen módon nincs gyakorlati jelentősége.\\nElőállítható azonos mennyiségű nitrogén-monoxid és nitrogén-dioxid összekeverésével és a keverék −20 °C-ra hűtésével:\\n2 NO + N₂O₄ → 2 N₂O₃\\nA dinitrogén-trioxid csak alacsony hőmérsékleten, azaz folyadék és szilárd állapotában izolálható. Magasabb hőmérsékleten az egyensúly a kiindulási anyagok irányába tolódik el, Kdiss = 193 kPa."},{"page_url":"https://vec.wikipedia.org/wiki/Condat-sur-Vienne","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Eglise_condat1.jpg","page_title":"Condat-sur-Vienne","context_page_description":"Condat-sur-Vienne el xé on comun de 5 150 abitanti del departemento de Haute-Vienne che el fa parte del rejon Nova Acuitania in Fransa."},{"page_url":"https://en.wikipedia.org/wiki/Puerto_Madero","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Buenos_Aires_1915.jpg","page_title":"Puerto Madero","context_page_description":"Puerto Madero, also known within the urban planning community as the Puerto Madero Waterfront, is a barrio of the Argentine capital at Buenos Aires CBD, occupying a significant portion of the Río de la Plata riverbank and representing the latest architectural trends in the city of Buenos Aires."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%88%D8%B1%D9%88%D9%BE%D8%A7_%DA%A9%D8%A4%DA%86%D8%B1%DB%8C%D9%84%D8%B1_%D8%A8%D8%A4%D8%AD%D8%B1%D8%A7%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Map_of_the_European_Migrant_Crisis_2015.png","page_title":"اوروپا کؤچریلر بؤحرانی","context_page_description":"اوروپا کؤچَری بؤحرانی یا اوروپا قاچقین بؤحرانی، یوز مینلر ساواشدان قاچقین و کؤچَریلرین آرالیق دَنیزی و یا اوروپانین گونئی دوغوسوندان اوروپا بیرلیگینه گیرمک نتیجه سینده یارانمیشدیر."},{"page_url":"https://gl.wikipedia.org/wiki/Toyota","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/2008_Toyota_Vellfire_01.jpg","page_title":"Toyota","context_page_description":"Toyota Motor Corporation ou sinxelamente chamada Toyota, é unha multinacional xaponesa do sector da automoción. En 2010 foi o segundo fabricante mundial de coches. Toyota é a novena compañía máis grande do mundo por facturación. En 2012 a empresa fabricou o seu vehículo número 200 millóns.\\nA corporación Toyota está formada polas seguintes marcas, Lexus, Daihatsu e Hino Motors e por un grupo de máis de 500 empresas de diversos sectores."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B5%D0%B9%D0%BB%D0%BE%D1%80_(%D0%92%D1%96%D1%81%D0%BA%D0%BE%D0%BD%D1%81%D0%B8%D0%BD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Taylor_Wisconsin_Sign_WIS95.jpg","page_title":"Тейлор (Вісконсин)","context_page_description":"Тейлор — селище в США, в окрузі Джексон штату Вісконсин. Населення — 476 осіб."},{"page_url":"https://fr.wikipedia.org/wiki/B%C3%A9zaudun-les-Alpes","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/B%C3%A9zaudun-les-Alpes_-09.JPG","page_title":"Bézaudun-les-Alpes","context_page_description":"Bézaudun-les-Alpes est une commune française située dans le département des Alpes-Maritimes, en région Provence-Alpes-Côte d'Azur."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1967/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/BerendEscher1947.jpg","page_title":"Lijst van personen overleden in 1967/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 1967.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%85%D9%8A%D8%A9_%D9%85%D8%AA%D8%AD%D8%B1%D9%83%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Tillerclowes.jpg","page_title":"دمية متحركة","context_page_description":"الدمى المتحركة أو الماريونيت هي عبارة على مجسمات اصطناعية يتحكم في حركاتها شخص، إما بيده أو بخيوط أو أسلاك أو عصي. وقد تمثل الدمية شخصا أو حيوانا أو نباتا أو شيئا من الأشياء. وتتقمص هذه الدمى أدوارا في مسرحيات تعرف باسم عروض العرائس. ويسمى الشخص الذي يقوم بتحريك الدمى محرك الدمى.\\nيصنع كثير من الأطفال دمى من المواد الرخيصة كالقماش والخشب، أو من أشياء كعلب الألبان الفارغة أو الخرق البالية. ويقومون كذلك بتأليف عروض العرائس ثم يحركونها، ويعملون على تغيير أصواتهم مع تغيير الشخصيات. ويمكن استخدام منضدة أو رف كتب كمنصة لعرض العرائس. كما يمكن أن يعمل محرك الدمى من وراء غطاء أو شرشف، يشده بعرض الجزء السفلي من فتحة باب. ويتوارى خلفه فلا يرى المشاهدون غير الدمى المتحركة التي تظهر بالجزء الأعلى من فتحة الباب."},{"page_url":"https://en.wikipedia.org/wiki/Equator","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Seasons.svg","page_title":"Equator","context_page_description":"The Earth's Equator, spelled with capital E, is a specific case of planetary equator. It is about 40,075 km long, of which 78.8% lies across water and 21.3% over land.\\nIn spatial geometry, as applied in astronomy, the equator of a rotating spheroid is the parallel at which latitude is defined to be 0°. It is the imaginary line on the spheroid, equidistant from its poles, dividing it into northern and southern hemispheres. In other words, it is the intersection of the spheroid with the plane perpendicular to its axis of rotation and midway between its geographical poles."},{"page_url":"https://fr.wikipedia.org/wiki/Mascarets","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Mascaretsmandiargues.jpg","page_title":"Mascarets","context_page_description":"Mascarets est un recueil de huit récits de l'écrivain André Pieyre de Mandiargues, paru en 1971 aux Éditions NRF Gallimard, coll. Le Chemin."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%82%D0%B5%D1%81%D1%82%D0%B8_%D0%B2_%D0%91%D1%96%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%96_2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/RevInBel1.jpg","page_title":"Протести в Білорусі 2011","context_page_description":"Протести в Білорусі 2011 року почалися у червні. Першою вагомою подією такого характеру стала акція «Стоп бензин!» 7 червня, а згодом у соціальних мережах було узгоджено план системних мовчазних протестів або масових гулянь, які проводять із 8 червня щосереди, починаючи з 19:00 на центральних площах найбільших міст країни. Як правило, вони мали такий вигляд: люди збиралися у певному заздалегідь визначеному місці без символіки, ходили туди-сюди та час від часу одночасно аплодували. Через якийсь час люди розходилися. Попередню координацію дій проводили в соціальних мережах, через що й виникла самоназва руху — «Революція через соціальну мережу».\\nВлада використовувала різні способи перешкоджання мовчазним протестам: організовувала на головних площах свої акції, обгороджувала площі турнікетами із забороною руху, обмежувала рух громадського транспорту в центрі міст, оточувала площі міліцією та спецпризначенцями. Безпосередньо на місцях протесту людей, що збиралися групами, розганяли, багатьох затримували. Під час акцій 22 червня та 3 липня з'явилися люди в цивільному, що хапали будь-кого в місцях скупчення людей, без пред'явлення власних документів та оголошення причин своїх дій."},{"page_url":"https://en.wikipedia.org/wiki/Japanese_garden","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Korakuen_26.JPG","page_title":"Japanese garden","context_page_description":"Japanese gardens are traditional gardens whose designs are accompanied by Japanese aesthetics and philosophical ideas, avoid artificial ornamentation, and highlight the natural landscape. Plants and worn, aged materials are generally used by Japanese garden designers to suggest an ancient and faraway natural landscape, and to express the fragility of existence as well as time's unstoppable advance.\\nAncient Japanese art inspired past garden designers. By the Edo period, the Japanese garden had its own distinct appearance."},{"page_url":"https://de.wikipedia.org/wiki/Linkes_Bairin-Banner","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/ChinaChifengBaarinZuoqi.png","page_title":"Linkes Bairin-Banner","context_page_description":"Das Linke Bairin-Banner ist ein Banner der bezirksfreien Stadt Chifeng im Nordosten des Autonomen Gebiets Innere Mongolei der Volksrepublik China. Es hat eine Fläche von 6.713 km² und zählt 350.000 Einwohner. Sein Hauptort ist die Großgemeinde Lindong."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BD%D0%BE%D1%80_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Stamps_of_Uzbekistan%2C_2007-50.jpg","page_title":"Минор (станция метро)","context_page_description":"«Минор» — станция Ташкентского метрополитена. Расположена на Юнусабадской линии между станциями «Бадамзар» и «Абдуллы Кадыри».\\nСтанция двухпролётная колонного типа, имеет наземный и подземный вестибюли. Пуск станции в эксплуатацию состоялся 26 октября 2001 года. Её украшают колонны, выполненные из красного гранита, расположенные по центру платформы. Стены отделаны мрамором тёмных цветов."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_voormalige_moskee%C3%ABn_in_Itali%C3%AB_en_Malta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/SGC_%28Palermo%29_16_07_2019_25.jpg","page_title":"Lijst van voormalige moskeeën in Italië en Malta","context_page_description":"Dit is een lijst van voormalige moskeeën in Italië en Malta. Het geeft een overzicht van voormalige moskeeën in Italië en Malta. Het somt enkele, maar niet alle moskeeën van Italië en Malta op."},{"page_url":"https://nl.wikipedia.org/wiki/Kleine_Jan","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Robin_Hood_and_Little_John%2C_by_Louis_Rhead_1912.png","page_title":"Kleine Jan","context_page_description":"Kleine Jan is een waarschijnlijk fictief personage in de legende van Robin Hood. Hij is juist erg groot en zijn bijnaam is dan ook een grap. Robin Hood kwam Jan tegen toen die hem wilde beletten een smalle brug over te steken. De mannen duelleerden en Robin sloeg Jan de rivier in. Onder de indruk van Robins vechtkunsten sloot Jan zich aan bij Robins bende, de Vrolijke Volgelingen.\\nMeestal wordt Jan gezien als Robins rechterhand of als tweede in de hiërarchie. Hij verschijnt al in de vroegste ballades over de legende zoals A geste of Robyn Hode en Robin Hood's Death."},{"page_url":"https://en.wikipedia.org/wiki/Nazanin_Daneshvar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Nazanin_Daneshvar.jpg","page_title":"Nazanin Daneshvar","context_page_description":"Nazanin Daneshvar is an Iranian Internet entrepreneur who founded and is now running the discount site Takhfifan. She is unusual as a woman establishing a company in Iran and she has attracted some attention. In 2019 she became one of UNCTAD's \\"eTrade for Women Advocates\\" from the developing world."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A7%D8%BA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Sago1.jpg","page_title":"ساغو","context_page_description":"الساغو ‏ أو السّاقو، و الاسم الهندى له \\"سابودانا\\" sabudana. وتعني كلمة ساغو Sagu أو Sago في الموطن الأصلي لها: \\"الخبز\\" وهو نوع من الحبّ يُصنَع من النشويات الموجودة في المركز الإسفنجي أو اللب لأنواع مختلفة من نخيل المناطق المدارية تعرف جميعها باسم موحد هو نخيل الساغو. ويستخلص من نخيل الساغو نوع من الدقيق يسمى دقيق الساغو. ويأتي معظم إنتاج هذا الدقيق من جنوب شرق آسيا، وتبعث كميات كبيرة من الساغو إلى أوروبا وأمريكا لأغراض طبخ تجارية حيث يستخدم الساغو في صنع الحلوى وتركيز المرق. ويعتبر هذا الدقيق مغذيا بالإضافة إلى أنه سهل الهضم، ولهذا يُعد الساغو من أنواع الأغذية الرئيسية لسكان جزر الهند الشرقية. والساغو معروف في دول الخليج العربى ويدخل في الأكلات الشعبية الخليجية كحلوى الساقو الإماراتية والعمانية كذلك.\\nينمو نخيل الساغو بسرعة كبيرة، ما يصل إلى ارتفاع متر ونصف المتر في السنة الواحدة، وهو ينمو في مستنقعات المياه العذبة والأراضي المنخفضة في المناطق المدارية. وتنتج النخلة الواحدة ما بين 150 إلى 300 كيلوجرام من النشاء."},{"page_url":"https://nl.wikipedia.org/wiki/Westwerkaltaar_van_de_Sint-Servaasbasiliek","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/20140525_Maastricht%3B_relief_in_Onze-Lieve-Vrouwebasilica.JPG","page_title":"Westwerkaltaar van de Sint-Servaasbasiliek","context_page_description":"Het westwerkaltaar, ook koninklijk altaar, westwerkretabel of dubbelreliëf, is een romaans altaar uit het midden van de twaalfde eeuw in het westwerk van de Sint-Servaasbasiliek in de Nederlandse stad Maastricht. Het altaar bestaat uit een mensa en een daarop geplaatst gebeeldhouwd altaarretabel met twee reliëfvoorstellingen. Van dit dubbelreliëf is het onderste deel in de 19e eeuw zwaar geschonden; het bovenste deel behoort tot de belangrijkste voorbeelden van Maaslandse beeldhouwkunst."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BD%D5%A1%D6%80%D5%A9%D5%B8%D6%82%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Khartoum_panorama-1_-_by_ScubaBeer.jpg","page_title":"Խարթում","context_page_description":"Խարթումը Սուդանի մայրաքաղաքն է։ Գտնվում է Սպիտակ Նեղոս և Կապույտ Նեղոս գետերի միախառնման տեղում։ Այստեղից հոսում է Նեղոս գետը դեպի հյուսիս Եգիպտոսով մինչև Միջերկրական ծով։\\nՕմդուրմանի, Հյուսիսային Խարթումի և արվարձանների հետ կազմում է միասնական՝ «եռյակ քաղաք», ագլոմերացիա, մոտ 5 345 000 մարդ [։ Սպիտակ և Երկնագույն Նեղոսների միախառնման վայրում գետային նավահանգիստ է, երկաթուղային և ավտոճանապարհների հանգույց։ Երկրի քաղաքական, մշակութային և առևտրական կենտրոնն է։ Կա տեքստիլ, սննդի, տրիկոտաժի արդյունաբերություն։ Ունի օդանավակայան, համալսարան։ Խարթումում գտնվում է Սուդանի թանգարանը։\\nԽարթումը հիմնադրել է Եգիպտոսի թուրք կառավարիչ Մուհամեդ Ալիի որդի Իսմայիլը, 1820-ական թվականներին։ 1830 թվականից՝ Սուդանի մայրաքաղաքը։ XIX դարի կեսից դարձել է Սուդանի և Հյուսիս-Արևելյան Աֆրիկայի առևտրային կարևոր կենտրոն։ 1881 - 1898 թվականների մահդիստների ապստամբության ժամանակ ավերվել է, և մայրաքաղաքը տեղափոխվել է Օմդուրման։ Անգլիացիները՝ ապստամբությունը ճնշելուց հետո Խարթումը դարձրել են Անգլո-Եգիպտական Սուդանի մայրաքաղաքը։ Առաջին և հատկապես երկրորդ համաշխարհային պատերազմներից հետո Խարթումը Սուդանի ազգային-ազատագրական շարժման կարևոր կենտրոններից է եղել։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B4%D1%8B_%D0%B8_%D0%BF%D0%B0%D1%80%D0%BA%D0%B8_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/%D0%A1%D0%B5%D1%81%D1%82%D0%BE%D1%80%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA_%C2%AB%D0%94%D1%83%D0%B1%D0%BA%D0%B8%C2%BB.jpg","page_title":"Сады и парки Санкт-Петербурга","context_page_description":"Сады и парки Санкт-Петербурга составляют часть зелёных насаждений города.\\nЗелёные насаждения Санкт-Петербурга и пригородов вместе с водной поверхностью занимают около 40 % городской территории. К 2000 году на 1 жителя города приходилось около 65 м² насаждений. Общая площадь зелёных насаждений превышает 31 тысячу га, в их числе 68 парков, 166 садов, 730 скверов, 232 бульвара, 750 озеленённых улиц.\\nПарки города расположены в различных ландшафтных условиях: на нижней и верхней террасах побережья Финского залива, моренной равнине, камовых холмах. Основу ряда парков составляют естественные леса, до сих пор сохранившие свой породный состав. Многие парки созданные в послевоенные годы, разбиты на территории, где древесная растительность фактически отсутствовала."},{"page_url":"https://pl.wikipedia.org/wiki/Advanced_Micro_Devices","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Aerial_photograph_of_Globalfoundries_Dresden.jpg","page_title":"Advanced Micro Devices","context_page_description":"Advanced Micro Devices, Inc., AMD – amerykańskie przedsiębiorstwo produkujące elektronikę dla użytkowników domowych i firm. Do głównych produktów AMD należą mikroprocesory, chipsety do płyt głównych, systemy wbudowane oraz procesory graficzne dla serwerów, stacji roboczych i komputerów PC.\\nAMD jest drugim na świecie producentem procesorów opartych na architekturze x86 oraz jednym z największych producentów procesorów graficznych. Ponadto posiada 8,6% akcji spółki Spansion, producenta nieulotnej pamięci flash.\\nAMD jest jedynym znaczącym rywalem firmy Intel w produkcji procesorów dla komputerów osobistych. Obydwa przedsiębiorstwa zajęły 99,1% rynku procesorów w trzecim kwartale 2011 roku. Podobnie AMD i jego konkurent – firma Nvidia – dominują rynek procesorów graficznych, zajmując odpowiednio 33,39% i 43,99% rynku w grudniu 2011 roku."},{"page_url":"https://en.wikipedia.org/wiki/Susan_Kaech","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Susan-Kaech-Headshot-7763.jpg","page_title":"Susan Kaech","context_page_description":"Susan Kaech is an American immunologist. Kaech is a professor and director of the NOMIS Center for Immunobiology and Microbial Pathogenesis at the Salk Institute for Biological Sciences. She holds the NOMIS Foundation Chair. Her research focuses on the formation of memory T cells, T cell metabolism, and cancer immunotherapy."},{"page_url":"https://ast.wikipedia.org/wiki/Arte_esquem%C3%A1tico_ib%C3%A9ricu","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/%C3%8Ddolo_de_Extremadura_%28M.A.N._Inv.20572%29_01.jpg","page_title":"Arte esquemático ibéricu","context_page_description":"Denominar Arte Esquemático a una serie de representaciones prehistóriques qu'apaecen na península ibérica acomuñaes a les primeres cultures metalúrxiques. La cronoloxía ye, entá, tema d'alderique, pero podría tomar dende'l cuartu al primer mileniu antes de Cristu, asolapándose, nos sos entamos, col Arte Levantinu y perviviendo marginalmente en delles zones aisllaes mientres etapes bien tardíes.\\nEl so principal carauterística, y la que-y da nome, ye'l esquematismo, esto ye, un estilu figurativu nel que solo se representen los fragmentos básicos de cada figura; amás, la representación ye tan básica que los elementos gráficos convertir en meros esbozos, pero ensin perder les traces mínimes d'identificación. Ello ye que el fenómenu esquemáticu considérase daqué bien pocu precisu y problemáticu, ya intégrase nun ampliu movimientu qu'afecta a cuasi toa Europa y el Mediterraneu\\nPodría dicise que'l fenómenu esquemáticu tien dimensiones globales, anque cada rexón, incluyida la hispana, tenga aspeutos propios y diferenciadores."},{"page_url":"https://es.wikipedia.org/wiki/Sarny","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Coat_of_arms_of_Sarny.svg","page_title":"Sarny","context_page_description":"Sarny es una ciudad del noroeste de Ucrania, en el óblast de Rivne, y es el centro administrativo del raión de Sarny. Está situada a orillas del río Sluch, a 82 kilómetros al norte de Rivne. Su población es de 29.117 habitantes."},{"page_url":"https://nl.wikipedia.org/wiki/Monolith_Soft","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/NakameguroGT_tower.JPG","page_title":"Monolith Soft","context_page_description":"Monolith Soft is een computerspelontwikkelaar gevestigd in Tokio, Japan. Monolith was van 1999 tot 2007 eigendom van Bandai Namco en werd in 2007 overgenomen door Nintendo."},{"page_url":"https://no.wikipedia.org/wiki/Ole_Myrvoll","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/F%C3%B8rste_statsr%C3%A5d_for_regjeringen_Borten_-_PA-0797_3845_001_002.jpg","page_title":"Ole Myrvoll","context_page_description":"Ole Myrvoll var en norsk økonom og sosialliberal politiker.\\nMyrvoll var professor i teoretisk samfunnsøkonomi ved Norges Handelshøyskole fra 1957, og var gjesteprofessor ved Colgate University New York og Bowdoin College i Maine.\\nSom politiker representerte han først Venstre i Bergen formannskap og som statsråd i John Lyngs regjering og i Per Bortens regjering.\\nMyrvoll gikk inn i Det Nye Folkepartiet 9. desember 1972. Han var da ordfører i Bergen. I 1973 ble han valgt inn på Stortinget for Hordaland DNF, og satt i Stortingets kommunal- og miljøvernkomité og som parlamentarisk leder. Han hadde tidligere vært valgt som 1. vararepresentant til Stortinget 1965–1973."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%88%B4%E6%9C%A8Fronte","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Suzuki_Fronte_LC10_Deluxe_rear.jpg","page_title":"鈴木Fronte","context_page_description":"鈴木Fronte乃日本鈴木汽車工業於1962年至1989年之間開發製造的輕型車。本條目將此車系的轎車型、掀背車型、商用車型等一併記入。\\n關於車名來自英語「frontier」，意為「業界之先驅者」。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%98%E3%83%AB%E3%82%BF%E3%83%BB%E3%83%9F%E3%83%A5%E3%83%A9%E3%83%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Herta_Muller.jpg","page_title":"ヘルタ・ミュラー","context_page_description":"ヘルタ・ミュラーは、ルーマニア出身のドイツ語作家。チャウシェスク政権下のルーマニアにおける困難な生活や、バナート地区のドイツ人の歴史、ソ連占領下ルーマニアのドイツ系民族迫害などを主題にした作品で知られる。2009年ノーベル文学賞受賞。"},{"page_url":"https://cs.wikipedia.org/wiki/Penzion_T%C5%99em%C5%A1%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Penzion_T%C5%99em%C5%A1%C3%ADn_rybn%C3%ADk.jpg","page_title":"Penzion Třemšín","context_page_description":"Penzion Třemším se nachází v areálu bývalých kasáren VÚ 7505 na okraji města Rožmitál pod Třemšínem v okrese Příbram. Stavbu nechal postavit rožmitálský hoteliér Jan Antonín Muchka v roce 1929. Vznikla podle návrhu architekta a stavitele Jana Koláře. V současné době je stavba nevyužitá."},{"page_url":"https://de.wikipedia.org/wiki/Zweistrahliges_Flugzeug","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Delta_AL_B767-300ER_N186DN_FRA.jpg","page_title":"Zweistrahliges Flugzeug","context_page_description":"Zweistrahlige Flugzeuge, sogenannte Twinjets, werden von zwei Strahltriebwerken angetrieben. Sie wurden parallel zu den einstrahligen Typen bereits während des Zweiten Weltkriegs durch Arado, Heinkel, Messerschmitt, Gloster und Bell entwickelt. Nach dem Ende des Weltkriegs nahmen die technische Fortentwicklung und die Gesamtzahl der produzierten Flugzeugtypen sehr stark zu, besonders im militärischen Bereich. Produktionszahlen von mehreren tausend Stück für Militärflugzeuge eines einzelnen Typs waren seit den 1950er-Jahren keine Seltenheit. Mit der Weiterentwicklung leistungsstärkerer Triebwerke und eines stark zunehmenden Bedarfs wurden seit den 1960ern auch vermehrt zivile Modelle konstruiert, beispielsweise von den Herstellern Boeing, Lockheed, Airbus, Iljuschin, Tupolew.\\nModerne Twinjets sind sehr leistungsstark und können für alle Flugstreckenbereiche eingesetzt werden. Es werden sowohl sehr kleine als auch sehr große Typen gebaut."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Gibson_(condado_de_Cameron,_Pensilvania)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Quehanna_Jet_Cell_Road.jpg","page_title":"Municipio de Gibson (condado de Cameron, Pensilvania)","context_page_description":"El municipio de Gibson es un municipio ubicado en el condado de Cameron en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 222 habitantes y una densidad poblacional de 0.9 personas por km².​"},{"page_url":"https://nl.wikipedia.org/wiki/Hoek_van_inwendige_wrijving","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Angleofrepose.png","page_title":"Hoek van inwendige wrijving","context_page_description":"De hoek van inwendige wrijving kan worden bepaald door een triaxiaalproef; een ongeroerd monster wordt in een speciaal toestel geplaatst en belast tot het bezwijkt. De hoek waaronder het monster bezwijkt is de hoek van inwendige wrijving.\\nDe storthoek is de maximum hellingshoek waaronder granulair materiaal nog juist niet verschuift. Wanneer een materiaal los wordt gestort, vormt er zich een kegel. De hoek die daarbij gevormd wordt van basis tot opstaande zijde is de storthoek.\\nDe storthoek is sterk afhankelijk van de inwendige wrijvingscoëfficiënt van het materiaal en dus ook van de korrelgrootte. Het spreekt voor zich dat poeders tegenover grove ladingen een geheel andere kegelvorm zullen hebben bij het storten ervan."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%AC%D5%A1%D5%A4%D5%AB%D5%BE%D5%B8%D5%BD%D5%BF%D5%B8%D5%AF_(%D6%85%D5%A4%D5%A1%D5%B6%D5%A1%D5%BE%D5%A1%D5%AF%D5%A1%D5%B5%D5%A1%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/NewUHWWterminal.jpg","page_title":"Վլադիվոստոկ (օդանավակայան)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Վլադիվոստոկ\\nՎլադիվոստոկ, օդանավակայան Վլադիվոստոկում։ Օդանավակայանը գտնվում է քաղաքի կենտրոնից 38 կմ հեռավորության վրա։ Օդանավակայանը ունի միջազգայինի կարգավիճակ։ Օդանավակայանի հիմնական ավիափոխադրողն է Ավրորա ավիաընկերությունը։"},{"page_url":"https://da.wikipedia.org/wiki/Ahmadiyya","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Nusrat-Jehan-Moschee_Kopenhagen.jpg","page_title":"Ahmadiyya","context_page_description":"Ahmadiyya-bevægelsen er en reformistisk og messiansk muslimsk bevægelse, som blev stiftet i 1889 af Mirza Ghulam Ahmad fra Qadian i den nuværende indiske delstat Punjab. Mirza Ghulam Ahmad proklamerede at han var den lovede Mahdi og Messias, som samtlige verdensreligioner har ventet på."},{"page_url":"https://pl.wikipedia.org/wiki/Penn_Badgley","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Penn_Badgley.jpg","page_title":"Penn Badgley","context_page_description":"Penn Dayton Badgley – amerykański aktor i muzyk. Jest głównym wokalistą zespołu gatunku indie Mother z Brooklynu. Obecnie występuje w roli Joe Goldberga w thrillerze wyemitowanym przez Netflix - You."},{"page_url":"https://eo.wikipedia.org/wiki/Ipatovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Ipatowo1.jpg","page_title":"Ipatovo","context_page_description":"Ipatovo estas urbo en Stavropola regiono en Rusio.\\nKodo de OKATO de la urbo estas 07222501.\\nLa urbo estis fondita en jaro 1860.\\nĜi havas statuson de urbo ekde jaro 1979.\\nLa urbo antaŭe estis nomita kiel:\\nĈemrek;\\nVinodelnoje ĝis 1935.\\nLa interurba telefona kodo estas 86542, la enurbaj telefonnumeroj estas kvinciferaj.\\nLa loka tempo estas la sama kiel moskva tempo.\\nLa urbo estas apud Norda Kaŭkazo, ĉe rivero Kalaus.\\nEn la urbo estas fervoja stacio.\\nEn jaro 2002 la urbo havis 28,6 mil loĝantojn."},{"page_url":"https://no.wikipedia.org/wiki/Antarctichavn","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/In_memory_H_Ingstad.jpg","page_title":"Antarctichavn","context_page_description":"Antarctichavn var en norsk fangststasjon på Øst-Grønland som ble bygd av en ekspedisjon fra Møre i 1930. Antarctichavn var tilholdssted for sysselmannen på Eirik Raudes Land, Helge Ingstad, under hans overvintring vinteren 1932–33.\\nAntarctichavn-stasjonen ble sommeren 2001 restaurert av Østgrønlandske Fangstkompani Nanok, men ble i 2002 knust av et snøras."},{"page_url":"https://es.wikipedia.org/wiki/Geo._F._Trumper","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Crema_para_afeitar_GFT_S%C3%A1ndalo.jpg","page_title":"Geo. F. Trumper","context_page_description":"Geo. F. Trumper, popularmente llamado simplemente Trumper o Trumper's, es una barbería tradicional y perfumista para cabelleros con sede en Londres. Posee la autorización real por parte de la Reina Victoria y otros cinco monarcas británicos.\\nSe le considera la barbería más fina de Londres y se le conoce a nivel mundial por sus productos de calidad inigualable​ entre los que se pueden mencionar sus famosas cremas para afeitar de estilo tradicional para usar con brocha, jabones, aftershaves, maquinillas de afeitar, gemelos, corbatas, sombrillas, etc.\\nEs una marca de larga tradición en Inglaterra, junto con Truefitt & Hill y Taylor of Old Bond Street."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BB%D0%B5%D0%B4%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Rhonegletscher_Furkapass_15092011.JPG","page_title":"Ронский ледник","context_page_description":"Ро́нский ледни́к — ледник на востоке кантона Вале в Швейцарии, является источником реки Рона. Ронский ледник является одним из самых больших ледников Швейцарских Альп и самым большим ледником Урийских Альп."},{"page_url":"https://eo.wikipedia.org/wiki/Alba_Iulia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/ROU_AB_Alba_Iulia_Flag.png","page_title":"Alba Iulia","context_page_description":"Alba Iulia [alba julija] estas urbo en Rumanio en la suda parto de Transilvanio ĉe la kunfluo de la rivero Mureș kaj la rivero Ampoiu. Ĝi estas la ĉefurbo de la Distrikto Alba. Administre apartenas al ĝi: Bărăbanț, Micești, Oarda, Pâclișa."},{"page_url":"https://sq.wikipedia.org/wiki/Baldushku","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Fshati_Mustafako%C3%A7aj.jpg","page_title":"Baldushku","context_page_description":"Baldushku është një fshat në komunën Baldushk në rrethin e Tiranës të Shqipërisë."},{"page_url":"https://nl.wikipedia.org/wiki/Heterothallie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Phytophthora_life_cycle_Dutch_text.png","page_title":"Heterothallie","context_page_description":"Heterothallische organismen komen voor bij schimmels en oömyceten. Deze organismen kunnen zich niet zelfbevruchten, maar zijn aangewezen op een genetisch andere partner. Ook moeten de paringstypen verschillend zijn, waarbij er meer dan twee paringstypen aanwezig kunnen zijn."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%D0%9B%D1%8E%D0%B4%D0%B2%D0%B8%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/GHzgt_Hessen_Wappen_coat_of_arms.jpg","page_title":"Орден Людвига","context_page_description":"Орден Людвига — орден за заслуги, существовавший в великом герцогстве Гессен-Дармштадт в 1807, 1831—1918 годах. Являлся наиболее почётным орденом великого герцогства."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%AD%E3%83%B3%E3%83%93%E3%82%A2%E3%83%BB%E3%82%AD%E3%83%B3%E3%83%87%E3%82%A3%E3%82%AA%E5%9C%B0%E9%9C%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Colombia_relief_location_map.jpg","page_title":"コロンビア・キンディオ地震","context_page_description":"コロンビア・キンディオ地震は1999年1月25日にコロンビアでおきた地震。震央から17km北に位置するキンディオ県アルメニアや、周囲のコーヒー・トライアングルに位置する自治体に大きな被害を与えた。"},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%A1%E0%B1%86%E0%B0%9F%E0%B1%8D%E0%B0%B0%E0%B0%BE%E0%B0%AF%E0%B0%BF%E0%B0%9F%E0%B1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Detroit%2C_USA_Taken_From_Windsor%2C_Canada.jpg","page_title":"డెట్రాయిట్","context_page_description":"డెట్రాయిట్ అమెరికాలోని మిషిగాన్ రాష్ట్రంలోని పెద్ద నగరం. అమెరికాలోని మిడ్‌వెస్ట్ ప్రాంతంలో డెట్రాయిట్ నగరం డెట్రాయిట్ నదిపైన ఉన్న ముఖ్యరేవు పట్టణం. కెనడా దక్షిణప్రాంతంలో ఉన్న అమెరికా నగరాలలో డెట్రాయిట్ ఒక్కటీ గుర్తించ తగినంత పెద్ద నగరం. 1701లో ఫ్రెంచ్‌ దేశస్తుడైన ఫ్రెంచ్‌ మాన్ ఆంటోనీ డీ లా మోత్ కాడిలాక్చే స్థాపించబడింది.\\nడెట్రాయిట్ నగరం అమెరికాలోని సంప్రదాయక ఆటోమోటివ్ కేంద్రం. మోటర్ సిటీ, మోటోటౌన్ డెట్రాయిట్ నగరానికున్న అతి ముఖ్యమైన మారు పేర్లు.\\n2007లో డెట్రాయిట్ నగరం జనసాంద్రతలో 916,952 మంది నివాసితులతో పదకొండవ స్థానంలో ఉంది. 1.8 మిలియన్ల జనాభాతో డెట్రాయిట్ నగరం అమెరికాలో నాల్గవ స్థానంలో ఉండేది ఆతరువాత నగర ప్రధాన జనవాహిని నగర పురాలను దాటి విస్తరించింది.\\nడెట్రాయిట్ అనే పేరు కొన్నిసార్లు డెట్రాయిట్ మహానగరానికి వర్తిస్తుంది. 2007 సెన్సస్ బ్యూరో అంచనాల ప్రకారం తొమ్మిది కౌంటీలతో కలసి 5,405,918 జనసంఖ్య కలిగిన మహానగరం అమెరికాలో పదకొండవ స్థానంలో ఉంది. 57,00,000 జనాభా కలిగిన డెట్రాయిట్-విండ్సర్ ప్రదేశం అమెరికా కెనడా దేశాలమధ్య ఉన్న కీలక వాణిజ్య కేంద్రం."},{"page_url":"https://pt.wikipedia.org/wiki/Crian%C3%A7a","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Jakarta_slumlife32.JPG","page_title":"Criança","context_page_description":"Uma criança é um ser humano no início de seu desenvolvimento. São chamadas recém-nascidas do nascimento até um mês de idade; bebê, entre o segundo e o décimo-oitavo mês, e criança quando têm entre dezoito meses até doze anos de idade. O ramo da medicina que cuida do desenvolvimento físico e das doenças e/ou traumas físicos nas crianças é a pediatria.\\nAntes do século XV, a criança era vista como um adulto em miniatura. Não existia, ainda, uma concepção de infância definida. As crianças eram rapidamente introduzidas no mundo dos adultos, chegando até a serem vestidas como eles. A falta de uma ideia de infância, impossibilitou, por muitos anos, a criação de direitos e deveres próprios para as crianças, considerando suas características e fases de desenvolvimento.\\nOs aspectos psicológicos do desenvolvimento da personalidade, com presença ou não de transtornos do comportamento, de transtornos emocionais e/ou presença de neurose infantil - incluídos toda ordem de carências, negligências, violências e abusos, que não os deixa \\"funcionar\\" saudavelmente, com a alegria e interesses que lhes são natural - recebem a atenção da Psicologia Clínica Infantil, através da Psicoterapia Lúdica."},{"page_url":"https://eo.wikipedia.org/wiki/Paraboloido","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/HyperbolicParaboloid.png","page_title":"Paraboloido","context_page_description":"En matematiko, paraboloido estas kvadriko, tipo de surfaco en tri dimensioj, priskribita per la ekvacio:\\n,\\naŭ\\n."},{"page_url":"https://it.wikipedia.org/wiki/Sistema_di_puntamento_Norden","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Norden_bombsight.jpg","page_title":"Sistema di puntamento Norden","context_page_description":"Il Norden è stato un computer elettro-meccanico stabilizzato giroscopicamente, utilizzato a bordo dei bombardieri dall'United States Army Air Forces nel corso della seconda guerra mondiale e successivamente dall'United States Air Force nelle guerre in Vietnam e Corea per individuare il punto esatto in cui sganciare le bombe.\\nIl meccanismo di funzionamento di questo apparecchio venne tenuto in gran segreto dagli Stati Uniti durante tutto il corso della seconda guerra mondiale. Nonostante ciò Herman Lang, una spia tedesca che lavorava nell'industria in cui il Norden veniva prodotto, riuscì a consegnare alcuni progetti del macchinario all'Abwehr nel 1938. Di conseguenza, a partire dal 1942, l'industria tedesca Carl Zeiss cominciò a consegnare alla Luftwaffe apparecchi simili, denominati Lotfernrohr 7."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Zittau%E2%80%93L%C3%B6bau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Loebau.jpg","page_title":"Bahnstrecke Zittau–Löbau","context_page_description":"Die Bahnstrecke Zittau–Löbau ist eine Eisenbahnverbindung in Sachsen, die ursprünglich durch die Löbau-Zittauer Eisenbahngesellschaft erbaut und betrieben wurde. Die heute nur noch teilweise in Betrieb befindliche Strecke beginnt in Zittau und verläuft über Oderwitz und Herrnhut nach Löbau. Zwischen Zittau und Oberoderwitz ist sie als Hauptbahn, zwischen Oberoderwitz und Löbau als Nebenbahn klassifiziert."},{"page_url":"https://fr.wikipedia.org/wiki/Charles-Alexandre_de_Lorraine","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Anne_Charlotte_of_Lorraine_%28Abbess_of_Remiremont%29_by_an_unknown_artist.jpg","page_title":"Charles-Alexandre de Lorraine","context_page_description":"Charles-Alexandre de Lorraine, né le 12 décembre 1712 à Lunéville et mort le 4 juillet 1780 au château de Tervueren, près de Bruxelles, fils du duc Léopold Ier de Lorraine et frère de l'empereur François Iᵉʳ, est un prince lorrain au service de l'Autriche, qui a été gouverneur général des Pays-Bas autrichiens, grand maître de l'ordre Teutonique et chevalier de l'Ordre de la Toison d'or."},{"page_url":"https://de.wikipedia.org/wiki/Roquetas_de_Mar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Roquetas_de_mar_indaloinfo.jpg","page_title":"Roquetas de Mar","context_page_description":"Roquetas de Mar, auch Roquetas, ist eine Stadt in Spanien an der südöstlichen Spitze der Iberischen Halbinsel an der Costa de Almería in der andalusischen Provinz Almería, ca. 30 km westlich der gleichnamigen Provinzhauptstadt Almería. Aus historischer Sicht unterteilt sich das Stadtgebiet in das eigentliche Roquetas de Mar, einer bereits in der Antike existierenden Ansiedlung, und in die südwestlich davon befindliche, erst in den letzten Jahrzehnten entstandene Urbanización Roquetas de Mar, wo sich bevorzugt die touristische Infrastruktur und Freizeitangebote befinden."},{"page_url":"https://en.wikipedia.org/wiki/SUN_Group","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/SUN_network_office.JPG","page_title":"SUN Group","context_page_description":"SUN Group is an Indian media conglomerate company based in Chennai, Tamil Nadu, India. It was founded by Kalanithi Maran in 1992."},{"page_url":"https://en.wikipedia.org/wiki/Wuppertal_Schwebebahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/12._April_1999_-_Ganz_Wuppertal_steht_unter_Schock.jpg","page_title":"Wuppertal Schwebebahn","context_page_description":"The Wuppertaler Schwebebahn is a suspension railway in Wuppertal, Germany.\\nIts original name is Einschienige Hängebahn System Eugen Langen. It is the oldest electric elevated railway with hanging cars in the world and is a unique system in Germany.\\nDesigned by Eugen Langen and offered first to the cities of Berlin, Breslau and Munich who all turned it down, the installation with elevated stations was built in Barmen, Elberfeld and Vohwinkel between 1897 and 1903; the first track opened in 1901. The railway line is credited with growth of the original cities and their eventual merger into Wuppertal. The Schwebebahn is still in use as a normal means of local public transport, moving 25 million passengers annually, per the 2008 annual report. New rail cars were ordered in 2015, called Generation 15, and the first new car went into service in December 2016.\\nThe Schwebebahn runs along a route of 13.3 kilometres, at a height of about 12 metres above the River Wupper between Oberbarmen and Sonnborner Straße and about 8 metres above the valley road between Sonnborner Straße and Vohwinkel. At one point the railway crosses the A46 motorway. The entire trip takes about 30 minutes."},{"page_url":"https://es.wikipedia.org/wiki/Ir%C3%A9-le-Sec","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Map_commune_FR_insee_code_55252.png","page_title":"Iré-le-Sec","context_page_description":"Iré-le-Sec es una población y comuna francesa, en la región de Lorena, departamento de Mosa, en el distrito de Verdun y cantón de Montmédy."},{"page_url":"https://fr.wikipedia.org/wiki/Lecanorales","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Lecanora_argentata_P._%27n_Ejen_2009-10-18_09.jpg","page_title":"Lecanorales","context_page_description":"Les Lecanorales sont un ordre de champignons lichénisés. Avec près de 5 695 espèces réparties en 269 genres, il s'agit de l'ordre le plus important des Lecanoromycetes, comportant presque exclusivement des lichens."},{"page_url":"https://en.wikipedia.org/wiki/Baptist_Church,_Ipswich","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Baptist_Church_and_Memorial_Gate_%28former%29%2C_Ipswich.jpg","page_title":"Baptist Church, Ipswich","context_page_description":"Baptist Church is a heritage-listed former church and 188 Brisbane Street, Ipswich, City of Ipswich, Queensland, Australia. It began as a simple gabled Gothic Revival building designed by Richard Gailey built in 1877, which was given an Art Deco makeover in 1938, designed by George Brockwell Gill. A memorial gate was added in 1954. In 2007 the site was sold, and the building converted for use as a performing arts space, known as Studio 188. It was added to the Queensland Heritage Register on 4 July 2006."},{"page_url":"https://en.wikipedia.org/wiki/Insect_paleobiota_of_Burmese_amber","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Cladofer_huangi_holotype_Sup_Fig_1_D.jpg","page_title":"Insect paleobiota of Burmese amber","context_page_description":"Burmese amber is fossil resin dating to the early Late Cretaceous Cenomanian age recovered from deposits in the Hukawng Valley of northern Myanmar. It is known for being one of the most diverse Cretaceous age amber paleobiotas, containing rich arthropod fossils, along with uncommon vertebrate fossils and even rare marine inclusions. A mostly complete list of all taxa described up until 2018 can be found in Ross 2018; its supplement Ross 2019b covers most of 2019."},{"page_url":"https://fr.wikipedia.org/wiki/Vitrail_des_saintes_Marguerite_et_Catherine","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Chartres_16_-06.jpg","page_title":"Vitrail des saintes Marguerite et Catherine","context_page_description":"Le vitrail des Sainte Marguerite et Catherine est un vitrail gothique de la cathédrale Notre-Dame de Chartres, situé dans la partie sud du déambulatoire, dans la chapelle des confesseurs.\\nIl consacre deux registres rapides à la vie de sainte Marguerite, l'essentiel du vitrail étant en réalité consacré à sainte Catherine.\\nLe vitrail est inscrit aux monuments historiques dès 1840."},{"page_url":"https://fr.wikipedia.org/wiki/Jean_Liabaud","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Rose%2C_Baronne_de_Prailly%2C_%E3%83%90%E3%83%A9%2C_%E3%83%90%E3%83%AD%E3%83%B3_%E3%83%89%E3%82%A5_%E3%83%97%E3%83%A9%E3%82%A4%E3%83%AA%2C_%2812531900025%29.jpg","page_title":"Jean Liabaud","context_page_description":"Jean Liabaud est un horticulteur et rosiériste lyonnais né à Volesvres, le 18 avril 1814 et mort en 1904. Il habitait 4 montée de la Boucle, à Lyon. Il est inhumé au cimetière de Loyasse à Lyon."},{"page_url":"https://pt.wikipedia.org/wiki/John_Wesley_(filme)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/John_Wesley_by_George_Romney.jpg","page_title":"John Wesley (filme)","context_page_description":"John Wesley é um filme britânico de 1954, do gênero drama biográfico, dirigido por Norman Walker e estrelado por Leonard Sachs, Neil Heayes e Keith Pyott. Retrata a vida do pai do Metodismo, John Wesley, e sua vida."},{"page_url":"https://de.wikipedia.org/wiki/Henri_Emmanuelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Henri_Emmanuelli_%C3%A0_l%27Assembl%C3%A9e_Nationale%2C_2008.jpg","page_title":"Henri Emmanuelli","context_page_description":"Henri Emmanuelli war ein französischer Politiker."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%AF%E3%81%AD%E3%81%9F%E3%81%8D%E6%A9%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Hanetakibridge-underview-nov19-2017.jpg","page_title":"はねたき橋","context_page_description":"はねたき橋は、渡良瀬川の高津戸峡に架かる橋である。群馬県みどり市大間々町の大間々地区と高津戸地区を結ぶ。\\n近隣住民には、【自殺の名所】として知られているためあまり立ち入らない。群馬県の心霊スポットの一つでもある。"},{"page_url":"https://fr.wikipedia.org/wiki/P%C3%A9ter_Esterh%C3%A1zy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Peter_Esterhazy_by_Kubik_02.jpg","page_title":"Péter Esterházy","context_page_description":"Péter Esterházy, né le 14 avril 1950 à Budapest et mort le 14 juillet 2016 dans la même ville, est un écrivain hongrois, descendant de la célèbre famille des comtes Esterházy de Galánta. Son frère, Márton Esterházy, est un ancien footballeur international hongrois."},{"page_url":"https://pt.wikipedia.org/wiki/Hesionura_elongata","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Hesionura_elongata.jpg","page_title":"Hesionura elongata","context_page_description":"Hesionura elongata é uma espécie de anelídeo pertencente à família Phyllodocidae.\\nA autoridade científica da espécie é Southern, tendo sido descrita no ano de 1914.\\nTrata-se de uma espécie presente no território português, incluindo a sua zona económica exclusiva."},{"page_url":"https://es.wikipedia.org/wiki/Maria_Enzersdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Wappen_at_maria-enzersdorf.jpg","page_title":"Maria Enzersdorf","context_page_description":"Maria Enzersdorf es una localidad del distrito de Mödling, en el estado de Baja Austria, Austria, con una población estimada a principio del año 2018 de 8829 habitantes.\\nSe encuentra ubicada al este del estado, a poca distancia al sur de Viena y del río Danubio.​"},{"page_url":"https://ca.wikipedia.org/wiki/Guerres_Seminola","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Seminolevillage.jpg","page_title":"Guerres Seminola","context_page_description":"Les Guerres Seminola també coneguda com la Guerra de la Florida, van ser incidents de fronteres que va provocar tres conflictes a Florida entre els diversos grups d'amerindis, un col·lectiu conegut com a seminola i els naixents Estats Units. La Primera Guerra Seminola es va desenvolupar entre 1817 i 1818; la Segona Guerra Seminola entre 1835 i 1842; i la Tercera Guerra Seminola entre 1855 i 1858. La Segona Guerra Seminola, més coneguda com la Guerra Seminola, ha estat la guerra més llarga d'entre totes en les que s'ha vist involucrat els Estats Units en el període que va des de la Guerra de 1812 i la Guerra Civil dels Estats Units.\\nEl primer conflicte amb els seminoles va sorgir de les tensions relacionades amb l'atac i destrucció de Fort Negro a Florida pel general Andrew Jackson en 1816, Jackson també va atacar els espanyols a Pensacola. Mentre ocupava Pensacola, Andrew Jackson va capturar dos exMarines Reials encarregats d'assistir als seminoles, i els va executar. Els governs de Gran Bretanya i Espanya van expressar la seva indignació per l'incident, encara que aviat tensions van disminuir. En última instància, la Corona espanyola va cedir la colònia a imperi dels Estats Units."},{"page_url":"https://it.wikipedia.org/wiki/Maria_Augusta_di_Anhalt","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Marie_Auguste_von_Anhalt.jpg","page_title":"Maria Augusta di Anhalt","context_page_description":"Maria Augusta di Anhalt fu la figlia del duca Edoardo di Anhalt e di sua moglie, la principessa Luisa Carlotta di Sassonia-Altenburg."},{"page_url":"https://en.wikipedia.org/wiki/BP","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Steven_Koonin_BP_2005-02-22.jpg","page_title":"BP","context_page_description":"BP plc is a British multinational oil and gas company headquartered in London, United Kingdom. It is one of the world's seven oil and gas \\"supermajors\\", whose performance in 2012, made it the world's sixth-largest oil and gas company, the sixth-largest energy company by market capitalization and the company with the world's 12th-largest revenue. It is a vertically integrated company operating in all areas of the oil and gas industry, including exploration and production, refining, distribution and marketing, petrochemicals, power generation and trading. It also has renewable energy interests in biofuels, wind power, smart grid and solar technology.\\nAs of 31 December 2018, BP had operations in nearly 80 countries worldwide, produced around 3.7 million barrels per day of oil equivalent, and had total proven reserves of 19.945 billion barrels of oil equivalent. The company has around 18,700 service stations worldwide. Its largest division is BP America in the United States. In Russia, BP owns a 19.75% stake in Rosneft, the world's largest publicly traded oil and gas company by hydrocarbon reserves and production."},{"page_url":"https://af.wikipedia.org/wiki/Edinburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Edinburgh_Castle_Overview.jpg","page_title":"Edinburg","context_page_description":"Edinburg is die hoofstad en tweede grootste stad van Skotland met 'n bevolking van 482 640 in 2012. Edinburg is die sewende grootste stad in die Verenigde Koninkryk en sy tweede belangrikste toeristebestemming na Londen met sowat 13 miljoen besoekers per jaar.\\nEdinburg lê aan die ooskus van Skotland se sentrale vlakte en aan die suidoewer van die Firth of Forth, net wes van die Noordsee. Die stad vorm saam met die omliggende plattelandse gebiede die City of Edinburgh council area. Edinburg dien sedert 1437 as die hoofstad van Skotland en is die setel van die outonome Skotse regering en parlement. Edinburg was een van die sentrums van die Skotse Verligting, waarby die Universiteit van Edinburg 'n belangrike rol gespeel het.\\nVanweë sy neo-klassieke boustyl het Edinburg reeds in die 19de eeu die bynaam \\"Athene van die Noorde\\" gekry. Die distrikte Old Town – die historiese stadskern – en New Town – 'n nuwe stadswyk wat in die tweede helfte van die 18de eeu ontstaan het om welgestelde burgers te huisves – is deur Unesco in 1995 as wêrelderfenisgebiede gelys."},{"page_url":"https://es.wikipedia.org/wiki/Billie_Holiday","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Billie_Holiday_0001_original.jpg","page_title":"Billie Holiday","context_page_description":"Eleanora Fagan Gough, más conocida como Billie Holiday y apodada Lady Day, fue una cantante estadounidense de jazz, considerada una de las tres voces femeninas más importantes e influyentes de este género musical, junto con Sarah Vaughan y Ella Fitzgerald.\\nEl crítico Robert Christgau consideraba que era «inigualable y posiblemente la mejor cantante del siglo».​ Por otro lado, Frank Sinatra la tomó como «su mayor influencia» e «incuestionablemente la influencia más importante en el canto popular estadounidense de los últimos veinte años».​ Su tema «Strange Fruit» fue considerado como la mejor canción del siglo XX, por la revista Time en 1999.³ El valor artístico de Billie Holiday reside tanto en su capacidad interpretativa, como en su dominio del swing. Asimismo, destacaba por la capacidad de adaptación de sus cualidades vocales al contenido de la canción. Billie Holiday impregnaba sus canciones con una intensidad inigualable que, en numerosos casos, era fruto del traspaso de sus propias vivencias a las letras que cantaba."},{"page_url":"https://cs.wikipedia.org/wiki/Paznehtn%C3%ADkovit%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/HK_Central_Chater_Garden_Flower_in_Yellow_a.jpg","page_title":"Paznehtníkovité","context_page_description":"Paznehtníkovité je velká čeleď vyšších dvouděložných rostlin z řádu hluchavkotvaré. Čeleď zahrnuje byliny i dřeviny se vstřícnými listy a dvoustranně souměrnými květy uspořádanými často v nápadných květenstvích. Paznehtníkovité jsou rozšířeny v tropech celého světa. Některé druhy se pěstují jako pokojové rostliny či letničky. Patří také k nápadným rostlinám ve sklenících botanických zahrad. V jižní Evropě je tato čeleď zastoupena několika druhy paznehtníku."},{"page_url":"https://nl.wikipedia.org/wiki/Niederwiesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Wappen_Niederwiesa.png","page_title":"Niederwiesa","context_page_description":"Niederwiesa is een gemeente en plaats in de Duitse deelstaat Saksen, en maakt deel uit van de Landkreis Mittelsachsen. Niederwiesa telt 4.914 inwoners."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%B5%B7%E4%B9%8B%E6%88%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Ocean_Pride_%28under_construction%2C_June_2017%29%2C_Tsuen_Wan_%28Hong_Kong%29.jpg","page_title":"海之戀","context_page_description":"海之恋位于香港新界荃湾区大河道100号，为荃湾西站湾畔发展项目。按港铁于2011年已获批的规划，可建9幢楼高50至51层住宅楼宇。由长江实业地产及九广铁路公司发展，建筑师为兴业建筑师楼有限公司。项目早于2016年11月申请预售楼花同意书，到2017年5至6月开售，2019年1月24日启用。\\n海之恋的电视广告的背景音乐是C AllStar主唱的《一刻恋上》。\\n再者，海之恋·爱炫美于2019年9月7日启用。"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%99%BB%E5%B9%BD%E5%B7%9E%E5%8F%B0%E6%AD%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Three_Hundred_Tang_Poems_%2833%29.jpg","page_title":"登幽州台歌","context_page_description":"《登幽州台歌》是中国唐代诗人陈子昂所作的著名诗歌，体裁属乐府。"},{"page_url":"https://sq.wikipedia.org/wiki/Femuri_i_njeriut","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Gray245.png","page_title":"Femuri i njeriut","context_page_description":"Femuri është ashti më i madh në skeletin e njeriut. Femuri bën pjesë në grupin e eshtrave të gjymtyrëve të poshtme."},{"page_url":"https://tr.wikipedia.org/wiki/Jos%C3%A9_Maria_Neves","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Jm_neves.jpg","page_title":"José Maria Neves","context_page_description":"José Maria Pereira Neves, Yeşil Burunlu siyasetçi. Neves, Afrika ada ülkesi Yeşil Burun Adaları'nda 2001 ile 2016 yıllar arasında başbakan olarak görev almıştır.\\nNeves Brezilya'da bulunan Fundação Getúlio Vargas enstitüsünde eğitiminin bir kısmını tamamladıktan sonra ülkesine dönerek yönetim alanında faaliyetlerde bulunmuştur. 1975 yılında ülkenin bağımsızlığı ve demokrasiye geçişi sırasında milliyetçi bir gençlik örgütünün lideri olan Neves, ülkenin o dönemki tek partisi olan Yeşil Burun'un Bağımsızlığı için Afrika Partisi'nin gençlik örgütlenmesinde de aktif rol almıştır. 1996 seçimlerinde o dönem için muhalefet partisi konumunda kalan PAICV'den Santa Catarina bölgesi vekili olarak meclise seçilen Neves, partisinin meclis başkan yardımcısı olarak görev yapmıştır. 2000 yılında bölgesi Santa Catarina'nın belediye başkanı olarak seçilen Neves, partisi PAICV'nin aynı yıl kendisini genel başkan olarak seçmesi neticesinde partisinin genel başkanlık görevini de üstlenmiştir. Neves liderliğinde girdikleri ilk seçimler olan Ocak 2001 seçimlerinden galibiyetler ayrılan PAICV, Neves'in 1 Şubat 2001 tarihinden itibaren başbakan olmasını sağlamıştır."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%DB%8C%D9%88_%DA%A9%D9%88%D9%BE%D9%88%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Prof._Mario_Coppola.jpg","page_title":"ماریو کوپولا","context_page_description":"ماریو کوپولا یک فیزیک‌دان اهل ایتالیا بود."},{"page_url":"https://en.wikipedia.org/wiki/Cyclone_Ului","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Cyclone_Ului_at_landfall_2010_-_03_-_21.jpg","page_title":"Cyclone Ului","context_page_description":"Severe Tropical Cyclone Ului was one of the fastest intensifying tropical cyclones on record, strengthening from a tropical storm to a Category 5 equivalent cyclone within a 30-hour span in March 2010. Throughout Queensland, Australia, infrastructural damage from the storm amounted to A$20 million and agricultural losses reached A$60 million."},{"page_url":"https://bs.wikipedia.org/wiki/Tovarnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Tovarnik-%D0%A2%D0%BE%D0%B2%D0%B0%D1%80%D0%BD%D0%B8%D0%BA.jpg","page_title":"Tovarnik","context_page_description":"Tovarnik je naseljeno mjesto i općina u Hrvatskoj, u Vukovarsko-srijemskoj županiji."},{"page_url":"https://sh.wikipedia.org/wiki/Asunci%C3%B3n","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/Gran_Asunci%C3%B3n_by_Felipe_M%C3%A9ndez.jpg","page_title":"Asunción","context_page_description":"Asunción je glavni i najveći grad Paragvaja od 544 309 stanovnika. Metropolitanski grad se zove Gran Asunción, jer su u njemu i gradovi; Capiatá, Luque, San Lorenzo, Limpio, Ñemby, Lambaré, Itauguá, Fernando de la Mora, Villa Elisa, Mariano Roque Alonso i San Antonio. U tom mega gradu živi čak 2 698 401 stanovnika, a to je trećina svih stanovnika Paragvaja."},{"page_url":"https://es.wikipedia.org/wiki/Zanni","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Arlecchino_und_Colombina_-_Giovanni_Domenico_Ferretti.jpg","page_title":"Zanni","context_page_description":"Los zanni, junto con los \\"amos\\" y los \\"enamorados\\", forman los tres grupos o categorías esenciales en el conjunto de personajes tipo de la Commedia dell'arte. Componen el grupo más numeroso y son los conductores de la historia y sus intrigas; su actuación cómico-dramático se acompaña de mimos y acrobacias. Los más populares, con el paso de los siglos, han sido: Arlequín y su novia Colombina, el astuto Brighella, y el filosófico Polichinela.​"},{"page_url":"https://de.wikipedia.org/wiki/Russland","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/5_%D0%B7%D0%B0%D0%BB_%282%29.jpg","page_title":"Russland","context_page_description":"Russland bzw. die Russische Föderation ist ein föderativer Staat im nordöstlichen Eurasien und mit etwa 17 Millionen Quadratkilometern flächenmäßig der größte Staat der Erde. Russland umfasst mehr als ein Achtel der bewohnten Landmasse der Erde und steht mit 144,5 Millionen Einwohnern an 9. Stelle der bevölkerungsreichsten Länder; es ist zugleich eines der am dünnsten besiedelten. Der europäische Teil des Staatsgebiets ist viel dichter besiedelt und verstädtert als der über dreimal so große asiatische Teil: Etwa 77 % der Bevölkerung leben westlich des Urals. Die Hauptstadt Moskau ist eine der größten Städte und Metropolregionen der Welt; als weiteres wichtiges Zentrum gilt Sankt Petersburg, das zwischen 1712 und 1918 Hauptstadt war und eine Brücke für Kunst und Kultur aus Westeuropa bildete.\\nDie nächstgrößten Millionenstädte Russlands sind Nowosibirsk in Sibirien, Jekaterinburg am Ural und Nischni Nowgorod an der Wolga. Weitere Großstadtregionen sind Tscheljabinsk, Ufa und Kasan. Insgesamt gibt es in Russland 15 Millionenstädte und fast 70 Agglomerationen mit mehr als 500.000 Einwohnern."},{"page_url":"https://en.wikipedia.org/wiki/Dicranum_scoparium","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Broom_moss_%28Orphan_Lk%29_2.JPG","page_title":"Dicranum scoparium","context_page_description":"Dicranum scoparium, the broom forkmoss, is a species of dicranid moss, native to North America, including the Great Lakes region. It usually forms tufts or mats on soil in dry to moist forested areas. As with many types of moss Broom moss grows in clumps with Broom mosses as well as other mosses. It can be distinguished by its leaves, which strongly curve to one side."},{"page_url":"https://ro.wikipedia.org/wiki/NGC_274","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/NGC_0274_SDSS.jpg","page_title":"NGC 274","context_page_description":"NGC 274 este o galaxie lenticulară situată în constelația Balena. A fost descoperită în 10 septembrie 1785 de către William Herschel. De asemenea, a fost observată încă o dată în 9 octombrie 1828 de către John Herschel. Împreună cu NGC 275 formează Arp 140."},{"page_url":"https://fr.wikipedia.org/wiki/Sevran","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/FREINVILE-SEVRAN_-_Ouverture_de_la_Peche.jpg","page_title":"Sevran","context_page_description":"Sevran est une commune française située dans le département de Seine-Saint-Denis, en région Île-de-France. Autrefois petit village de la plaine de France, la commune a connu un développement spectaculaire durant les années 1960 et 1970, faisant quadrupler sa population en moins de quarante ans. La ville abrite sur une partie de son territoire le parc forestier de la poudrerie nationale de Sevran-Livry.\\nSes habitants sont appelés les Sevranais."},{"page_url":"https://en.wikipedia.org/wiki/Nanjing_Automobile","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Yuejin_NJ1080.JPG","page_title":"Nanjing Automobile","context_page_description":"Nanjing Automobile is a state-owned enterprise with a history that dates from 1947, making it the oldest of the Chinese automobile manufacturers although the comparatively younger FAW Automotive was the first to make cars.\\nThe group's products have included cars, trucks, and buses.\\nNanjing Auto merged with the much larger SAIC in 2007 becoming a subsidiary of that company."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1950","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Cees_Korvinus.jpg","page_title":"Lijst van personen geboren in 1950","context_page_description":"Dit is een lijst van personen die geboren zijn in 1950.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B4%D8%B1%D9%86%D8%AF%D9%88%D8%B1%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Rathaus_Schorndorf.jpg","page_title":"شرندورف","context_page_description":"شرندورف آلمانین بادن-وورتمبرق ایالتینده یئر آلان بیر شهردیر و ۲۵۶ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۳۹۱۹۶ نفر دیر. بۇ شهرین ۵۶٫۸۶ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://es.wikipedia.org/wiki/Maka","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Achaemenid_Empire_at_its_greatest_extent_according_to_Oxford_Atlas_of_World_History_2002.jpg","page_title":"Maka","context_page_description":"Maka fue un satrapía del imperio aqueménida y, posteriormente, de sus sucesores partos y sasánidas correspondiente al área que los griegos llamaban Gedrosia, en las áreas costeras desérticas de los actuales Pakistán yBaluchistan.​ Alternativamente, podría haber hecho referencia a los actuales Baréin, Catar y Emiratos árabes Unidos, más la mitad norte de Omán.​\\nMaka era ya parte del imperio aqueménida antes del ascenso al trono de Darío el grande en 522 a. C. ya que es listada en la inscripción de Behistún entre sus posesiones al heredar el trono. Es posible que fuera conquistada por Ciro el Grande en 542 a. C. ya que dicho rey realizó campañas en el golfo Pérsico. Siguió siendo una satrapía hasta que las conquistas de Alejandro Magno, cuando pasó a ser independiente. Según Heródoto, los \\"Mykios\\" pertenecían al mismo distrito fiscal que los drangianos, thamanaos, utianos, sagartianos y \\"aquellos deporardos al golfo Pérsico\\".​\\nSegún Fleming, Maka, en el área de Gedrosia, puede ser considerada una de las satrapías indias del imperio aqueménida.​"},{"page_url":"https://ms.wikipedia.org/wiki/Jimmy_Kimmel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/JimmyKimmelHWOFSept2012.jpg","page_title":"Jimmy Kimmel","context_page_description":"James Christian Kimmel yang dikenali sebagai Jimmy Kimmel ialah pengacara televisyen, penerbit, penulis, pelawak dan pelakon suara Amerika. Beliau adalah pengacara dan penerbit eksekutif Jimmy Kimmel Live!, rancangan bual bicara lewat malam itu ditayangkan di ABC pada tahun 2003. Kimmel menjadi pengacara waktu perdana Anugerah Emmy pada tahun 2012 dan 2016. Beliau menjadi pengacara Anugerah Akademi pada bulan Februari 2017.\\nSebelum menjadi pengacara Jimmy Kimmel Live!, beliau terkenal sebagai seorang pengacara bersama untuk Comedy Central's The Man Show dan Win Ben Stein's Money. Kimmel juga telah menghasilkan rancangan seperti Crank Yankers, Sport Show with Norm Macdonald dan The Andy Milonakis Show."},{"page_url":"https://it.wikipedia.org/wiki/Guerra_Messico-Stati_Uniti","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Mexico_1832%2C_Region_Comanche.PNG","page_title":"Guerra Messico-Stati Uniti","context_page_description":"La guerra Messico-Stati Uniti, guerra messicano-statunitense o guerra messico-statunitense vide contrapporsi gli Stati Uniti d'America, durante la presidenza Polk, e la Prima repubblica messicana tra il 1846 ed il 1848. Negli Stati Uniti il conflitto è conosciuto come guerra messicana o guerra di Mr. Polk; in Messico invece è nota come intervento statunitense, invasione statunitense in Messico o guerra degli Stati Uniti contro il Messico.\\nIl conflitto scoppiò come conseguenza degli attriti tra i due paesi in seguito all'annessione statunitense del Texas nel 1845, osteggiata dal Messico che lo considerava ancora parte della sua nazione. La repubblica del Texas era di fatto un Paese indipendente che divenne parte degli Stati Uniti, nonostante diversi politici americani fossero contrari, poiché il Texas riconosceva la schiavitù e la sua annessione avrebbe modificato l'equilibrio tra Stati del Nord antischiavisti e Stati del Sud.\\nAlle Elezioni presidenziali del 1844, vinse il democratico James Knox Polk con la promessa di espandere gli Stati Uniti verso ovest; da qui l'annessione del Texas l'anno seguente."},{"page_url":"https://en.wikipedia.org/wiki/Fotron","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Traid_Fotron_III.jpg","page_title":"Fotron","context_page_description":"The Fotron was a camera produced by the Traid Corporation of Glendale, California between 1962 and 1971 and mainly sold door to door. It had a highly unorthodox design and boasted several firsts for a consumer camera, including a built-in electronic flash, built-in motor drive, and drop-in film loading. Other unusual features included push-button exposure and focus controls and an integrated rechargeable battery. The camera used standard 828 rollfilm packaged in a proprietary snap-in cartridge which had to be returned to the company for processing. It was aimed mainly at women, marketed as a \\"goof-proof\\" alternative to traditional cameras.\\nAlthough innovative, the Fotron was also extremely expensive, unwieldy, and reportedly suffered from poor optical quality. Introduced at a list price of $139.95, by 1971 the camera was selling for $520, plus $3.98 per 10-exposure roll for film and processing. Despite this, Traid claimed the cameras were sold at a loss and only the film processing operation was able to turn a profit."},{"page_url":"https://es.wikipedia.org/wiki/Irlanda_en_el_Festival_de_la_Canci%C3%B3n_de_Eurovisi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/ESC2018_-_Ireland_03.jpg","page_title":"Irlanda en el Festival de la Canción de Eurovisión","context_page_description":"Irlanda participó por primera vez en el Festival de la Canción de Eurovisión en 1965, en Nápoles. Desde entonces, ha participado en cada edición, salvo dos: en 1983, en Múnich; y en 2002, en Tallin. Radio Telefís Éireann es la emisora representante de Irlanda en el Festival, y transmite el mismo anualmente; la semifinal se transmite en RTÉ2 y la final en RTÉ One.​ Todas sus canciones han sido interpretadas en inglés, a excepción del año 1972, cuando el tema en gaélico «Ceol on ghrá», representó al país.\\nIrlanda, junto con España, Suiza, Israel y Luxemburgo, son los únicos países que han ganado siendo anfitriones, siendo este el que más veces ha ganado, siendo unas 3 veces seguidas.\\nIrlanda ganó por primera vez en 1970 con Dana interpretando «All Kinds of Everything». En total, el país ha ganado siete ocasiones, más que cualquier otro. Asimismo, ha organizado el Festival otras tantas veces; todas ellas, salvo una, en Dublín. En 1993 fue organizado en Millstreet, un pueblo de 1500 personas en el oeste del Condado de Cork.​\\nIrlanda ha conseguido estar en el TOP-10 dentro de la gran final un total de 30 veces."},{"page_url":"https://en.wikipedia.org/wiki/Lemvigbanen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/MX_26-Mx_41.jpg","page_title":"Lemvigbanen","context_page_description":"Vemb-Lemvig-Thyborøn Jernbane or Lemvigbanen is a Danish railway line in Northwest Jutland. Established in 1879, the line extends from Vemb via Lemvig to Thyborøn. The single-track line is mostly level, and is operated with a fleet of five double-unit Y-train railcars. VLTJ has its own workshop and servicing facilities on the line.\\nUntil 1 January 2008, the line was operated by the company Vemb-Lemvig-Thyborøn Jernbane A/S, which has been merged with Odderbanen's operating company to form Midtjyske Jernbaner.\\nThe railway was used to test a prototype hydrogen-powered train in 2010."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%91%D1%80%D0%B0%D0%BD%D0%BE%D0%B2%D0%B0_%D0%B4%D0%BE%D0%BB%D0%B6%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Waves_in_Box.svg","page_title":"Бранова должина","context_page_description":"Бранова должина — растојанието за кое формата на еден бран во даден период.\\nОва растојание обуично се определува земајќи ја должината помеѓу две соседни соодветни фази, како на пример испактнините, вдлабнатините, или пак точките кои соодвествуваат на 0, и ова е особина кај подвижните и стојните бранови, како и кај сите останати видови на просторни бранови. Брановата должина се означува со ламбда. Претходно изнесеното важи и за периодични бранови од не-синуидална природа.\\nПоимот бранова должина исто така се корити и кај модулирани бранови, и синусоидата на модулираниот бран е формирана преку [интерференција] на неколку синусоиди. Единицата мерка во SI системот е метар.\\nАко се претпостави дека синусоиден бран се движи со постојана бранова брзина, брановата должина е обратно пропорционална на фреквенцијата на бранот: Брановите со поголеми фреквенции имаат пократки бранови должини, додека пак оние со мали фрквенции имаат долги бранови должини.\\nПримери за појави кои се бранови се: звучни бранови, светлината и водени бранови."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%BE%D1%81%D1%82%D0%B0_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%BE%D0%B2_(%D0%BF%D1%80%D0%BE%D1%81%D0%B2%D0%B5%D1%82%D0%B5%D0%BD_%D0%B4%D0%B5%D0%B5%D1%86)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Kosta_Nikolov_and_his_students.jpg","page_title":"Коста Николов (просветен деец)","context_page_description":"Константин Николов Янков е български просветен деец, общественик и революционер, деец на Вътрешната македоно-одринска революционна организация"},{"page_url":"https://fr.wikipedia.org/wiki/Rudolfinum","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/The_Rudolfinum%2C_Prague_-_7881.jpg","page_title":"Rudolfinum","context_page_description":"Le Rudolfinum est un bâtiment néorenaissance situé place Jan Palach à Prague. Il sert de salle de concert et de salle d'expositions."},{"page_url":"https://de.wikipedia.org/wiki/Russen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Leipzig_Russische_Gedaechtniskirche.jpg","page_title":"Russen","context_page_description":"Die Russen sind ein ostslawisches Volk mit etwa 137 Millionen Angehörigen, davon rund 115 Millionen in Russland, etwa 17 Millionen in den anderen Folgestaaten der Sowjetunion und etwa sechs Millionen in weiteren Staaten. Sie bilden die größte ethnische Gruppe in Europa. Die nationale Sprache der Russen ist Russisch, die vorherrschende und traditionelle Religion ist das russisch-orthodoxe Christentum."},{"page_url":"https://no.wikipedia.org/wiki/FSF_Free_Software_Awards","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Werner_Koch_Portrait_01.2015-2.jpg","page_title":"FSF Free Software Awards","context_page_description":"Free Software Foundation deler ut to årlige priser. Siden 1998 har FSF delt ut Award for Advancement of Free Software og siden 2005 også Free Software Award for Projects of Social Benefit."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%27%D1%8F%D1%81%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2%D0%B8%D1%87_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE_%D0%92%D0%BE%D0%BB%D0%BE%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Myasnikovich.jpg","page_title":"М'ясникович Михайло Володимирович","context_page_description":"Миха́йло Володи́мирович М'яснико́вич — білоруський державний діяч, прем'єр-міністр Білорусі з 28 грудня 2010 по 27 грудня 2014 року; доктор економічних наук."},{"page_url":"https://en.wikipedia.org/wiki/Montreal_Wanderers","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Nlc006599-v5.jpg","page_title":"Montreal Wanderers","context_page_description":"The Montreal Wanderers were an amateur, and later professional, men's ice hockey team based in Montreal, Quebec, Canada. The team played in the Federal Amateur Hockey League, the Eastern Canada Amateur Hockey Association, the National Hockey Association and briefly the National Hockey League. The Wanderers were four-time Stanley Cup winners. Prior to the formation of the NHL, the \\"Redbands\\" were one of the most successful teams in hockey."},{"page_url":"https://vi.wikipedia.org/wiki/Lythrum_alatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Lythrum_alatum.jpg","page_title":"Lythrum alatum","context_page_description":"Lythrum alatum là một loài thực vật có hoa trong họ Lythraceae. Loài này được Pursh mô tả khoa học đầu tiên năm 1814."},{"page_url":"https://it.wikipedia.org/wiki/Gabriella_Papadakis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Gabriella_Papadakis_and_Guillaume_Cizeron_GP_Final_2014.jpg","page_title":"Gabriella Papadakis","context_page_description":"Gabriella Papadakis è una danzatrice su ghiaccio francese medaglia d'argento alle Olimpiadi di Pyeongchang 2018 insieme con Guillaume Cizeron.\\nÈ stata inoltre quattro volte campionessa del mondo e cinque volte campionessa europea, oltre ad essere stata sei volte campionessa nazionale francese e vincitrice di due finali del Grand Prix."},{"page_url":"https://ca.wikipedia.org/wiki/Biocombustible_d%27algues","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Diatoms_through_the_microscope.jpg","page_title":"Biocombustible d'algues","context_page_description":"El biocombustible d'algues o agrocombustible d'algues és un producte usat per a la descontaminació i valorització del diòxid de carboni obtingut a partir de microalgues cultivades. El seu ús com a agrocombustible pur, independent del de reductor d'emissions de diòxid de carboni La idea d'usar les algues només com a combustible tècnicament tampoc té sentit perquè presenta un balanç energètic negatiu, és a dir que hom empra més energia en fabricar el producte que l'energia que es pugui obtenir després amb la seva combustió."},{"page_url":"https://lb.wikipedia.org/wiki/Monaco","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Montecarlo.jpg","page_title":"Monaco","context_page_description":"D'Fürstentum Monaco ass e Staat an Europa, an zwar eng Enklav am franséischen Territoire, um Bord vum Mëttelmier, ëstlech vun Nice, net wäit vun der italieenescher Grenz. Seng Küst laanscht d'Mëttelmier ass ronn 4 km laang. Monaco huet eng Fläch vun 202 ha an 32.020 Awunner. Mat bal 16.000 Awunner pro km² ass Monaco deen am meescht bevëlkerte Staat op der Welt.\\nSäin Numm kënnt vun de griichesche Siidler hier, déi sech am 5. Joerhonnert v. Chr. um haitegen Territoire vu Monaco néiergelooss hunn. Zu Éiere vum Herakles \\"Monoikos\\" hate si nämlech en Tempel gebaut. Doraus ass d'Bezeechnung Monaco entstanen.\\nHaut wunnen zu Monaco net nëmme Monegassen, mä och vill räich Leit vun iwwerall, déi sech aus steierleche Grënn do néiergelooss hunn.\\nMonaco ass praktesch nëmmen eng Stad, déi verwaltungsméisseg aus 6 Deeler besteet. Een dovun, de bekanntsten, ass Monte Carlo.\\nVun der Fläch hier ass Monaco nom Vatikanstad dee klengsten, awer dichtbesidelste Staat vun der Welt."},{"page_url":"https://en.wikipedia.org/wiki/Roman_Catholic_Archdiocese_of_Turin","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Duomo_Torino.jpg","page_title":"Roman Catholic Archdiocese of Turin","context_page_description":"The Roman Catholic Archdiocese of Turin is an ecclesiastical territory or diocese of the Roman Catholic Church in Italy.\\nThe diocese of Turin was founded in the 4th century, and elevated to the dignity of an archdiocese on 21 May 1515 by Pope Leo X. As a metropolitan church, it has as suffragans: Acqui, Alba, Aosta, Asti, Cuneo, Fossano, Ivrea, Mondovì, Pinerolo, Saluzzo and Susa. Its mother church is the Cathedral of Saint John the Baptist.\\nSince 2010 the Archbishop of Turin has been Cesare Nosiglia."},{"page_url":"https://en.wikipedia.org/wiki/Gebel_el-Arak_Knife","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Uruk_King-Priest_3300_BCE_portrait_detail.jpg","page_title":"Gebel el-Arak Knife","context_page_description":"The Gebel el-Arak Knife, also Jebel el-Arak Knife, is an ivory and flint knife dating from the Naqada II period of Egyptian prehistory, showing Mesopotamian influence. The knife was purchased in 1914 in Cairo by Georges Aaron Bénédite for the Louvre, where it is now on display in the Sully wing, room 20. At the time of its purchase, the knife handle was alleged by the seller to have been found at the site of Gebel el-Arak, but it is today believed to come from Abydos."},{"page_url":"https://fr.wikipedia.org/wiki/Abel_Gaborit","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Gaborit%2C_Abel.JPG","page_title":"Abel Gaborit","context_page_description":"Abel Gaborit, né le 6 avril 1934 à Antigny et mort le 21 juillet 2019 à Angers, est un prêtre catholique et un organiste français."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%92%D7%A9%D7%94_%D7%9C%D7%9C%D7%90_%D7%9E%D7%A2%D7%A0%D7%94_(%D7%98%D7%A0%D7%99%D7%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Andy_Roddick_SAP_Open_2005_006.jpg","page_title":"הגשה ללא מענה (טניס)","context_page_description":"בטניס, הגשה ללא מענה או אייס היא הגשה של אחד השחקנים אשר נכנסה לתחום \\"ריבוע ההגשה\\" ללא שהיריב הצליח אפילו לגעת עם המחבט בכדור בתגובה.\\nבטניס המקצועני ההגשות ללא מענה הן דבר שכיח מאוד אשר כמעט תמיד מבוצע במהלך ההגשה הראשונה של השחקן לה הוא יכול להוסיף את עוצמתו המרבית ללא חשש שיאבד את הנקודה במידה שיחטיא. רובן המוחלט של החבטות ללא מענה נחבטות בשתי צורות: הראשונה היא הגשה ישרה בעלת עוצמה חזקה מאוד המכוונת לנקודת האמצע של \\"ריבוע הגשה\\". חבטה זו מאופיינת על ידי שחקנים גבוהים אשר קל להם לחבוט אותה עם עוצמה חזקה וזווית טובה. הצורה השנייה היא הגשה מסובבת אשר \\"דוחפת\\" את היריב מחוץ למגרש ובכך מקשה עליו מאוד להחזיר את הכדור או לגעת בו."},{"page_url":"https://ca.wikipedia.org/wiki/Fl%C3%A9ac-sur-Seugne","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Map_commune_FR_insee_code_17159.png","page_title":"Fléac-sur-Seugne","context_page_description":"Fléac-sur-Seugne és un municipi francès, situat al departament del Charente Marítim i a la regió de la Nova Aquitània. L'any 2007 tenia 342 habitants."},{"page_url":"https://en.wikipedia.org/wiki/Places_of_interest_in_Pandacan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/JC_Thelmo_-_Arch.jpg","page_title":"Places of interest in Pandacan","context_page_description":"Pandacan being established as a community in 1574 is considered as one of the oldest districts in Manila and contains several notable places rich in heritage. It is home to a few well-known historical figures, historical landmarks and hosts a number of ancestral houses."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AE%E0%B2%B8%E0%B3%82%E0%B2%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Fresnel_lentille_MnM.jpg","page_title":"ಮಸೂರ","context_page_description":"ಮಸೂರವು ವಕ್ರೀಭವನದ ಮೂಲಕ ಬೆಳಕಿನ ಕಿರಣವನ್ನು ರವಾನಿಸುವ ಒಂದು ಸಾಧನ ಮಸೂರವನ್ನು ಗಾಜಿನ ನೆಲದ ಮತ್ತು ನಯಗೊಳಿಸಿದ ಪಾರದರ್ಷಕ ವಸ್ತುಗಳಿಂದ ತಯಾರಿಸಲಾಗುತ್ತದೆ. ಮಸೂರವು ತೇಜ ಕೇಂದ್ರವಿಲ್ಲದೆ ಬೆಳಕನ್ನು ವಕ್ರೀಭವಿಸುತ್ತದೆ."},{"page_url":"https://no.wikipedia.org/wiki/John_Lorne_Campbell","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Canna_house.jpg","page_title":"John Lorne Campbell","context_page_description":"John Lorne Campbell var en skotsk historiker og folklorist. Han er særlig kjent for sitt arbeid med skotsk-gæliske sanger og poesi."},{"page_url":"https://es.wikipedia.org/wiki/Josetxu_Obreg%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Josetxu_Obreg%C3%B3n.jpg","page_title":"Josetxu Obregón","context_page_description":"Josetxu Obregón es un violonchelista español."},{"page_url":"https://fi.wikipedia.org/wiki/Ming_Xiaolingin_mausoleumi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Wen_Wu_Fangmen%2C_Ming_Xiaoling.jpg","page_title":"Ming Xiaolingin mausoleumi","context_page_description":"Ming Xiaolingin mausoleumi on Ming-dynastian ensimmäisen keisarin Hongwun hautamuistomerkki. Se sijaitsee Purppuravuoren eteläpuolella Nanjingin vanhan keskustan itäpuolella. Kertomuksen mukaan ryöstäjien harhauttamiseksi ja varsinaisen hautapaikan suojaamiseksi hautajaisten aikaan kaupungin porteilta lähti 13 identtistä kulkuetta.\\nMausoleumin rakentaminen alkoi Hongwu-keisarin eläessä vuonna 1381 ja se valmistui vuonna 1405, jolloin keisariksi oli noussut hänen poikansa Yongle. Töihin osallistui 100 000 työläistä ja kustannukset olivat valtavat. Mausoleumin ympärille pystytettiin yli 22,5 kilometriä pitkä muuri ja töitä valvoi 5 000 sotilasta."},{"page_url":"https://vi.wikipedia.org/wiki/Chi%E1%BA%BFn_tranh_%C4%90%E1%BA%A1i_Ngu%E2%80%93%C4%90%E1%BA%A1i_Minh","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/C%E1%BB%95ng_Nam.jpg","page_title":"Chiến tranh Đại Ngu–Đại Minh","context_page_description":"Chiến tranh Đại Ngu – Đại Minh, hay thường được giới sử học Việt Nam gọi là cuộc xâm lược của nhà Minh 1406 – 1407, là cuộc chiến của nhà Hồ nước Đại Ngu chống cuộc xâm chiếm của nhà Minh dưới triều Minh Thành Tổ từ tháng 4 năm 1406 cho đến tháng 6 năm 1407 khi nhà Minh đánh bại hoàn toàn quân đội nhà Hồ và bắt được Hồ Quý Ly, Hồ Hán Thương.\\nNăm 1400, Hồ Quý Ly bức vua nhà Trần - Đại Việt nhường ngôi cho mình, lập ra nhà Hồ – Đại Ngu. Hồ Quý Ly đã thực hiện những thay đổi về tiền giấy, hành chính, quân đội, chuyển kinh đô từ Thăng Long về Thanh Hóa, ... nhằm phát triển Đại Ngu và có thể chống lại một cuộc xâm lược từ nhà Minh. Ba năm sau, nhà Hồ dùng 20 vạn quân để tấn công quốc gia phía Nam là Chiêm Thành, vây kinh đô Chiêm Thành 9 tháng nhưng sau đó rút quân về do thiếu lương thực. Nhà Minh đã cư xử với Chiêm Thành như một đồng minh bằng cách sai 9 chiến thuyền sang cứu, quân thủy nhà Minh và nhà Hồ khi quay về gặp nhau giữa biển nhưng không có xung đột nào xảy ra.\\nNhà Minh đã gây sức ép lên nhà Hồ bằng các đòi hỏi về người, lương thực, đất đai, của cải, ... nhưng nhà Hồ chỉ đáp ứng cho nhà Minh theo cách mà gây ít thiệt hại nhất cho họ."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%82%D8%B7%D8%B9%E2%80%8C%D9%86%DA%AF%D8%A7%D8%B1%DB%8C_%D8%B1%D8%A7%DB%8C%D8%A7%D9%86%D9%87%E2%80%8C%D8%A7%DB%8C_%D8%AA%DA%A9%E2%80%8C%D9%81%D9%88%D8%AA%D9%88%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Heart_spect_imaging.jpg","page_title":"مقطع‌نگاری رایانه‌ای تک‌فوتونی","context_page_description":"برش‌نگاری یا مقطع نگاری یا توموگرافی رایانه‌ای تک فوتونی یا به اصطلاح اسپکت، روشی است که در علوم تشخیصی در فیزیک پزشکی به ویژه پزشکی هسته‌ای کاربرد تحقیقاتی و روزمرهٔ فراوانی دارد.\\nدر این روش از رادیوایزوتوپهایی استفاده می‌شود که ذرات گاما از خود ساطع می‌کنند.\\nاز نمونه دستگاه‌های متداولی که این روش را جهت تصویر برداری به کار می‌برد دوربین گاما یا دوربین انگر را می‌توان نام برد که امروزه در بیمارستان‌ها و نیز در آنکولوژی کاربرد وسیع دارند.\\nدوربین‌های گاما ۱۸۰ یا ۳۶۰ درجه حول بیمار قابلیت گردش دارند تا بتوانند تصاویر مقطعی تولید کنند.\\nتصاویر اسپکت عموماً در ماتریس‌های ۱۲۸ در ۱۲۸ پیکسل بازسازی می‌شوند.\\nدر ایران بیش از ۶۵ انواع دستگاه اسپکت مشغول به کار می‌باشند.\\nاسپکت اول بار در دههٔ ۱۹۷۰ بتوسط دیوید کوهل اختراع گشت."},{"page_url":"https://no.wikipedia.org/wiki/Torget_(Bergen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/NorwegianConstitutionDay2009TorgetBergen.jpg","page_title":"Torget (Bergen)","context_page_description":"Torget i Bergen, ofte kalt Fisketorget, er et torg innerst i Vågen i Bergen der det er en handelsplass med salgsboder for omsetning av fisk, skalldyr, bær, frukt og blomster i tillegg til suvenirer. Det har en stor tilstrømning av turister, særlig om sommeren."},{"page_url":"https://fr.wikipedia.org/wiki/Langue_d%27Auvergne","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/2019_Co-cath%C3%A9drale_Saint-Jean_Chapelle_Langue_d%27Auvergne_%2821%29.jpg","page_title":"Langue d'Auvergne","context_page_description":"La langue d'Auvergne était l'une des huit provinces ecclésiastiques ou langues des Hospitaliers de l'ordre de Saint-Jean de Jérusalem. En 1462 les sept autres provinces étaient les langues de Provence, de France, d'Italie, d'Angleterre, de Castille, d'Allemagne et d'Aragon."},{"page_url":"https://en.wikipedia.org/wiki/Geography_of_Brazil","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Belezas_da_Chapada_Diamantina_09.JPG","page_title":"Geography of Brazil","context_page_description":"The country of Brazil occupies roughly half of South America, bordering the Atlantic Ocean. Brazil covers a total area of 8,514,215 km² which includes 8,456,510 km² of land and 55,455 km² of water. The highest point in Brazil is Pico da Neblina at 2,994 m. Brazil is bordered by the countries of Argentina, Bolivia, Colombia, Guyana, Paraguay, Peru, Suriname, Uruguay, Venezuela, and France.\\nMuch of the climate is tropical, with the south being relatively temperate. The largest river in Brazil, the second longest in the world, is the Amazon."},{"page_url":"https://ca.wikipedia.org/wiki/Lachy","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Lachy_abbaye_val_dieu_gastebois_bmr_73.jpg","page_title":"Lachy","context_page_description":"Lachy és un municipi francès, situat al departament del Marne i a la regió del Gran Est. L'any 2007 tenia 322 habitants."},{"page_url":"https://es.wikipedia.org/wiki/Boeing_F/A-18_Super_Hornet","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/FA-18F_vapor_over_wings_1.jpg","page_title":"Boeing F/A-18 Super Hornet","context_page_description":"El Boeing F/A-18 Super Hornet es un caza polivalente, bimotor, de cuarta generación++ de origen estadounidense con capacidad todo tiempo, para ser embarcado en portaaviones.\\nFue desarrollado en los años 1990 por la compañía McDonnell Douglas, basándose en los F/A-18C y D Hornet.\\nEl F/A-18E y F Super Hornet es una evolución de mayor tamaño y más avanzada que el F/A-18C y D Hornet respectivamente.\\nComparado con el Hornet original, el Super Hornet es más pesado, con más alcance y dispone de más capacidad para armamento. A pesar de ello ha sido criticado por no tener prestaciones que tenían los aviones a que ha reemplazado.\\nEl Super Hornet dispone de un cañón automático interno de 20 mm y en los puntos de anclaje externos puede cargar misiles aire-aire, armamento aire-superficie y tanques suplementarios de combustible. Además de poder ser reabastecido de combustible en vuelo, también puede ser configurado como avión cisterna añadiéndole tanques suplementarios y el sistema para reabastecer a otros aviones.\\nDiseñado y producido inicialmente por McDonnell Douglas, el Super Hornet realizó su primer vuelo en el año 1995."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%99%BD%E8%8A%A8%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Bletilla_striata_1.jpg","page_title":"白芨屬","context_page_description":"白芨屬是一屬溫帶地生蘭，分布於東亞和東南亞，商業雜誌中縮寫為Ble。"},{"page_url":"https://sv.wikipedia.org/wiki/Ostrya_carpinifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Baden-Baden-Ostrya_carpinifolia-58-Hopfenbuche-Blatt-Bluete-2020-gje.jpg","page_title":"Ostrya carpinifolia","context_page_description":"Ostrya carpinifolia, eller humlebok, är en björkväxtart som beskrevs av Giovanni Antonio Scopoli. Ostrya carpinifolia ingår i släktet Ostrya och familjen björkväxter. Inga underarter finns listade."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BA%D0%B8%D1%80%D0%B0_%D0%AF%D0%BC%D0%B0%D0%BE%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Akira_Yamaoka_-_Game_Developers_Conference_2010_-_Day_3_%283%29.jpg","page_title":"Акира Ямаока","context_page_description":"Акира Ямаока е японски композитор и продуцент, известен с музиката си към поредицата компютърни и видеоигри Silent Hill. Мрачният му и меланхоличен стил е определян често като индъстриъл."},{"page_url":"https://ca.wikipedia.org/wiki/Hurac%C3%A0_de_Miami_de_1948","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/1948_Atlantic_hurricane_8_track.png","page_title":"Huracà de Miami de 1948","context_page_description":"L'Huracà de Miami de 1948 va ser un dels ciclons tropicals més fort de la temporada d'huracans de l'Atlàntic del 1948. L'huracà, el segon més intens de la temporada, generava vents de 213 km/h a L'Havana. Va ser la vuitena tempesta tropical, el cinquè huracà, i el quart gran huracà de la temporada. Es va desenvolupar l'est-nord-est de cap Gracias a Dios, Nicaragua. Posteriorment, s'intensificava sobre el mar del Carib occidental, on assolia vents huracanats, i feia recalada a Cuba occidental. El cicló tropical convertit en una huracà de Categoria 4 en l'Escala d'huracans de Saffir-Simpson, creuava l'illa i colpejava Florida Keys com a gran huracà. L'ull passava sobre Miami, marxava prop de Fort Lauderdal, i creuava l'Oceà Atlàntic pel sud de les Illes Bermudes.\\nCuba va ser la zona que va ser colpejada amb vents més forts pel cicló, deixant danys significatius i onze víctimes mortals a l'illa. A Florida, l'huracà provocava pluges fortes i inundacions a la regió de Miami. Es reportaven també tres tornados a l'estat sense provocar cap víctima mortal."},{"page_url":"https://ceb.wikipedia.org/wiki/Bethpage_State_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Bethpage-golf1.jpg","page_title":"Bethpage State Park","context_page_description":"Parke ang Bethpage State Park sa Tinipong Bansa. Ang Bethpage State Park nahimutang sa kondado sa Nassau County ug estado sa New York, sa sidlakang bahin sa nasod, 400 km sa amihanan-sidlakan sa ulohang dakbayan Washington, D.C. 42 metros ibabaw sa dagat kahaboga ang nahimutangan sa Bethpage State Park.\\nAng yuta palibot sa Bethpage State Park kay patag, ug nga tinakpan sa ubos sa habagatan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 79 ka metro ug 3.6 km sa amihanan sa Bethpage State Park. Ang kinadul-ang mas dakong lungsod mao ang Brentwood, 18.2 km sa sidlakan sa Bethpage State Park. Hapit nalukop sa kabalayan ang palibot sa Bethpage State Park. Sa rehiyon palibot sa Bethpage State Park, kapuloan, mga estretso, mga lawis, mga luuk, mga lapyahan, ug mga kanal talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 12 °C. Ang kinainitan nga bulan Agosto, sa 26 °C, ug ang kinabugnawan Pebrero, sa -8 °C. Ang kasarangang pag-ulan 1,427 milimetro matag tuig. Ang kinabasaan nga bulan Disyembre, sa 208 milimetro nga ulan, ug ang kinaugahan Oktubre, sa 71 milimetro."},{"page_url":"https://fr.wikipedia.org/wiki/Erg_Chebbi","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Dunes_de_Merzouga.jpg","page_title":"Erg Chebbi","context_page_description":"L'erg Chebbi, plus connu sous le nom de dunes de Merzouga, est l'un des deux grands ergs du Sahara au Maroc.\\nLes spectaculaires dunes dorées de l'erg Chebbi figurent parmi les plus remarquables du Sahara. Certaines culminent à 150 m de hauteur. Elles s'étirent à perte de vue entre la célèbre vallée du Ziz et la frontière algérienne. La ville de Rissani, ancien terminus des caravanes transsahariennes, est une oasis charmante de la vallée du Ziz.\\nIl est situé dans le Tafilalet, au sud-est du Maroc, à environ 40 km au sud d'Arfoud, à proximité de l'Algérie. Il est long de 22 km et large de 5 km.\\nLe centre accueillant les touristes est le village de Merzouga, situé au pied des premières dunes. Ce village est accessible par la route et dix heures sont nécessaires pour le relier à Marrakech ou à Fès.\\nIl existe un autre erg Chebbi dans les monts d'Ougarta en Algérie, de dimensions à peu près identiques.\\nL'Erg Chebbi est le meilleur endroit pour de nombreuses activités dans le désert telles que le quad et l'excursion en 4x4. Aussi beaucoup d'hébergements touristiques."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D8%B6%D9%84%D8%A9_%D8%A3%D9%84%D9%88%D9%8A%D8%A9_%D9%88%D8%B3%D8%B7%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Slide2hh.JPG","page_title":"عضلة ألوية وسطى","context_page_description":"عضلة ألوية وسطى ‏ هي واحدة من العضلات الألوية الثلاث، وتتميز بسماكتها وهي واسعة، وتقع على السطح الخارجي للحوض."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Vanderbilt_(Texas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/TXMap-doton-Vanderbilt.PNG","page_title":"Vanderbilt (Texas)","context_page_description":"Vanderbilt sī Bí-kok Texas chiu Jackson kūn ê chi̍t ê chng-thâu.\\nChe sī chi̍t phiⁿ koan-î Bí-kok Texas Chiu tē-lí ê phí-á-kiáⁿ. Chhiáⁿ tàu khok-chhiong."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9D%92%E8%94%B5%E9%89%84%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Lhasatrainstation_shu.jpg","page_title":"青蔵鉄道","context_page_description":"青蔵鉄道は、中華人民共和国西部の青海省西寧とチベット自治区首府ラサを結ぶ高原鉄道。総延長1,956kmで青蔵鉄路公司により運営されている。青蔵線とも呼ばれる。日本のメディアでは、青海チベット鉄道と呼ばれることも多い。青海の青と西蔵の蔵から青蔵鉄道と命名された。\\n西部大開発の代表的なプロジェクトとして、1984年までに一期工事が行われ、2001年からの二期工事を経て2006年7月1日に全通した。建設費は4,500億円と伝えられている。\\n外国人と台湾人がラサまで乗車する場合は、チベット入域許可書が必要であり、旅行代理店の主催するツアーに参加する必要がある。なお、時期によっては形式上ツアーに参加し、実際には個人旅行として乗車することも可能であるが、シーズンによっては乗車券のほとんどは団体向けに確保されているため、この方法での乗車券の入手はかなり困難である。"},{"page_url":"https://it.wikipedia.org/wiki/Virginia_nella_guerra_di_secessione_americana","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Philip_St._George_Cooke.jpg","page_title":"Virginia nella guerra di secessione americana","context_page_description":"La Virginia nella guerra di secessione americana divenne una parte importante degli Stati Confederati d'America a partire dal momento in cui si unì a loro. Nella sua qualità di Stato del Sud che deteneva schiavi tenne una Convention legislativa col compito di affrontare la crisi esplosa definitivamente con le elezioni presidenziali del 1860, che videro vincitore il leader del neonato Partito Repubblicano, Abraham Lincoln.\\nEssa votò a favore della separazione unilaterale dagli Stati Uniti d'America il 4 aprile del 1861. L'Assemblea indetta a tale scopo - assieme ad una gran parte dell'opinione pubblica - si spostò verso questa decisione dopo il giorno 15, quando il legittimo Presidente degli Stati Uniti d'America si mosse chiedendo a tutti gli Stati ancora nell'Unione l'invio di truppe atte a reprimere la ribellione in atto a seguito del bombardamento e relativa battaglia di Fort Sumter il quale vide la caduta di Fort Sumter nelle mani dei secessionisti in armi.\\nI delegati alla Convention a questo punto scelsero di approvare il Decreto di secessione."},{"page_url":"https://vi.wikipedia.org/wiki/Anh_%C4%91%C3%A0o_ch%C3%A2u_Phi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Prunus_sappling.jpg","page_title":"Anh đào châu Phi","context_page_description":"Anh đào châu Phi, tên khoa học Prunus africana, là loài thực vật có hoa trong họ Hoa hồng. Loài này được Kalkman mô tả khoa học đầu tiên năm 1965."},{"page_url":"https://en.wikipedia.org/wiki/Set_screw","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Grub_Screw.svg","page_title":"Set screw","context_page_description":"A set screw, also known as a blind screw or a grub screw, is a type of screw generally used to secure an object within or against another object, usually without using a nut. The most common examples are securing a pulley or gear to a shaft. Set screws are usually headless, meaning that the screw is fully threaded and has no head projecting past the thread's major diameter. If a set screw does have a head, the thread will extend all the way to the head. A set screw is almost always driven with an internal-wrenching drive, such as a hex socket, star, square socket, or a slot. The set screw passes through a threaded hole in the outer object and is tightened against the inner object to prevent it from moving relative to the outer object. It exerts compressional or clamping force through the bottom tip that projects through the hole.\\nAn example application is when a set screw is screwed into a pulley hub so that its end-point bears firmly against the shaft. The fastening action is by friction between the screw and the shaft, often with some amount of elastic or plastic deformation of one or both."},{"page_url":"https://en.wikipedia.org/wiki/Deputy_Governor_of_Jakarta","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Sylviana_Murni.jpg","page_title":"Deputy Governor of Jakarta","context_page_description":"The deputy governor of Jakarta consisted of four officials who is hierarchically under the Governor of Jakarta. The deputy governor of Jakarta is tasked to assist the Governor of Jakarta in specific tasks. Unlike the vice governor of Jakarta, the deputy governor is appointed by the President of Indonesia with the recommendation of the governor."},{"page_url":"https://de.wikipedia.org/wiki/H%C3%BAsav%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/2008-05-20_18_H%C3%BAsavik.jpg","page_title":"Húsavík","context_page_description":"Húsavík ist der größte Ort und Verwaltungssitz der isländischen Gemeinde Norðurþing und hat 2323 Einwohner."},{"page_url":"https://es.wikipedia.org/wiki/Pieks%C3%A4m%C3%A4ki","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Pieks%C3%A4m%C3%A4ki_2014_summer.jpg","page_title":"Pieksämäki","context_page_description":"Pieksämäki es una ciudad en Finlandia."},{"page_url":"https://gl.wikipedia.org/wiki/Micromatriz_de_ADN","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Affymetrix-microarray.jpg","page_title":"Micromatriz de ADN","context_page_description":"Unha micromatriz de ADN, tamén chamada chip de ADN ou biochip de ADN ou microarranxo de ADN, é unha superficie sólida á que se unen un conxunto de \\"puntos\\" microscópicos que levan fragmentos de ADN. Os científicos usan estas micromatrices para medir os niveis de expresión dun gran número de xenes simultaneamente ou para xenotipificar múltiples rexións dun xenoma. Cada unha destas \\"manchas\\" con ADN contén picomoles dunha secuencia de ADN específica, chamada sonda. Estas secuencias poden ser un curto fragmento dun xene ou outro elemento de ADN que se utiliza para hibridalo a unha mostra \\"diana\\" de ADNc ou ARNc. A hibridación entre a sonda e a diana xeralmente detéctase e cuantifícase porque a diana detectada está etiquetada cun fluoróforo ou con prata ou con quimioluminescencia, o que serve para determinar a abundancia relativa da secuencia do ácido nucleico na diana.\\nUnha das súas principais aplicacións é identificar xenes cunha expresión diferencial en condicións distintas. Por exemplo, para detectar xenes que producen certas doenzas comparando os niveis de expresión entre células sas e células que están desenvolvendo certos tipos de doenzas."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B0%D8%A7_%D8%AA%D8%A7%D9%8A%D9%85%D8%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/John_Walter_1818%E2%80%931894.jpg","page_title":"ذا تايمز","context_page_description":"التايمز ‏ صحيفة بريطانية يومية رائدة تأسست في لندن عام 1785، تحت اسم السجل العالمي اليومي، ثم في الأول من يناير عام 1788 أصبحت تُدعى التايمز. كلا من التايمز وصنداي تايمز تنشرهما صُحُفْ التايمز، وهي شركة تابعة لأخبار المملكة المتحدة منذ عام 1981م، ومملوكة بالكامل لمجموعة نيوز كورب التي يرأسها روبرت مردوك. لا تشتاركا التايمز وصنداي تايمز في نفس هيئة التحرير، فكلا منهما تأسست بشكل مستقل، وأشتركا فقط في الملكية منذ عام 1967م.\\nفي عام 1959م، قام مؤرخ الصحافة ألن نيفينز بتحليل أهمية جريدة التايمز في تشكيل إطلالات أحداث النخبة في لندن:\\nلأكثر من قرن من الزمان كانت صحيفة التايمز جزءا لا يتجزأ وذي أهمية بالغة من البنية السياسية لبريطانيا العظمى. كانت أخبارها وتعليقها الافتتاحيته تُنسَّق وبشكل عام بعناية، وجرى التعامل معها في معظم الأحيان بشكل جدي ومسؤول. وفي حين أن الصحيفة قد احتوت على بعض الأمور التافهة في أعمدتها، فقد كان تركيزها كله على الشؤون العامة المهمة التي جرى التعامل معها بعين المصلحة البريطانية. ومن أجل قيادة هذا الوضع التجريبي، كان على المحررين البقاء لفترة طويلة على اتصال ب10 شارع دونينغ"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D9%84%D8%A8%D8%A7%DB%8C%D8%AA%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Castillo_de_Bolbaite.jpg","page_title":"بلبایته","context_page_description":"بلبایته ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و والنسیا اوستانینده یئرلشیب. ۲۵۳ متر دنیز سویه‌سیندن اۇجالیقی وار. بۇ شهرین مساحتی ۴۰٫۴ کیلومتر موربّع دیر. سوْن نۆفوس تخمین‌لرینه گؤره ۱۴۸۷ نفر دیر."},{"page_url":"https://de.wikipedia.org/wiki/Vorwahlergebnisse_der_Pr%C3%A4sidentschaftswahl_in_den_Vereinigten_Staaten_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Rocky_De_La_Fuente1_%282%29_%28cropped%29.jpg","page_title":"Vorwahlergebnisse der Präsidentschaftswahl in den Vereinigten Staaten 2020","context_page_description":"Diese Seite führt die Ergebnisse der Vorwahlen zur Präsidentschaftswahl des Jahres 2020 in den Vereinigten Staaten auf.\\nNeben den beiden großen Parteien, den Demokraten und den Republikanern, führen auch einige kleine Parteien reguläre Vorwahlen durch. Deren letztlich nominierte Kandidaten gelten dabei als chancenlos. Inklusive der Electoral-College-Wahlleute des aus Staaten mit der Möglichkeit für Write-in wäre 2012 zumindest theoretisch eine Wahl des Präsidentschaftskandidaten der Green Party, der Libertarian Party oder der Constitution Party möglich gewesen – ohne Write-in nur des Kandidaten der beiden Ersteren."},{"page_url":"https://pl.wikipedia.org/wiki/Lotnictwo_ludowego_Wojska_Polskiego","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/PL_air_force_flag_55-59.svg","page_title":"Lotnictwo ludowego Wojska Polskiego","context_page_description":"Lotnictwo ludowego Wojska Polskiego – jeden z rodzajów wojsk Wojska Polskiego w latach 1943-1990."},{"page_url":"https://en.wikipedia.org/wiki/Norman_K._Denzin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Denzin_photo.png","page_title":"Norman K. Denzin","context_page_description":"Norman Kent Denzin is an American professor of sociology. He is an emeritus professor in the Department of Sociology at the University of Illinois at Urbana–Champaign, where he was research professor of communications, College of Communications scholar, professor of sociology, professor of cinema studies, professor in the Unit for Criticism and Interpretive Theory. Denzin's academic interests include interpretive theory, performance studies, qualitative research methodology, and the study of media, culture and society."},{"page_url":"https://de.wikipedia.org/wiki/Christian_Gottfried_Heinrich_Gei%C3%9Fler","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Christian_Gottfried_Heinrich_Geissler-oval.jpg","page_title":"Christian Gottfried Heinrich Geißler","context_page_description":"Christian Gottfried Heinrich Geißler war ein deutscher Kupferstecher und Illustrator. Er gilt als bedeutender Leipziger Stadtchronist, vor allem der Kriege zwischen 1806 und 1813."},{"page_url":"https://eo.wikipedia.org/wiki/Schnaudertal","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Wappen_Schnaudertal.png","page_title":"Schnaudertal","context_page_description":"Schnaudertal estas komunumo en Germanio. Ĝi troviĝas en la distrikto Burgenland de la federacia lando Saksio-Anhalto, kaj fondiĝis la 1-an de januaro 2010 el la antaŭe sendependaj komunumoj Bröckau kaj Wittgendorf. Fine de decembro 2015 la urbo havis 972 loĝantojn."},{"page_url":"https://ca.wikipedia.org/wiki/Peireg%C3%B3s","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Map_commune_FR_insee_code_81207.png","page_title":"Peiregós","context_page_description":"Peiregós és un municipi francès, situat al departament del Tarn i a la regió d'Occitània."},{"page_url":"https://nl.wikipedia.org/wiki/Geschiedenis_van_de_wiskunde","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/2064_aryabhata-crp.jpg","page_title":"Geschiedenis van de wiskunde","context_page_description":"De geschiedenis van de wiskunde bestudeert en beschrijft de oorsprong van ontdekkingen in de wiskunde en de ontwikkeling van methoden en notaties. De wiskunde is een formele wetenschap waarvan de gebruikelijke definitie is: het bestuderen van patronen en structuren.\\nDe wiskunde heeft een geschiedenis die teruggaat tot in de prehistorie. Kerfstokken uit de prehistorie wijzen erop dat men toen al telde. Dit is de oorsprong van het begrip van de natuurlijke getallen. De Babyloniërs waren het eerste volk dat zich met wiskunde bezighield door praktische problemen op te lossen in de landbouw, handel, sterrenkunde en scheepvaart. Zij kenden reeds een soort stelling van Pythagoras en waren in staat om vierkantsvergelijkingen op te lossen.\\nIn de loop van de geschiedenis hebben verschillende culturen en volkeren overeenkomstige ontdekkingen gedaan: de bepaling van pi, de wortel van 2, goniometrische functies en allerlei oplossingsmethoden voor wiskundige vergelijkingen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_places_of_interest_in_Essex","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Moyns_Park_2.jpg","page_title":"List of places of interest in Essex","context_page_description":"This is a list of places of interest in the British county of Essex. See List of places in Essex for a list of settlements in Essex."},{"page_url":"https://es.wikipedia.org/wiki/Premios_Globo_de_Oro","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/2013_Golden_Globe_Awards_%288379853660%29.jpg","page_title":"Premios Globo de Oro","context_page_description":"Los Premios Globo de Oro —en inglés: Golden Globe Awards— son galardones concedidos por los 93 miembros de la Asociación de la Prensa Extranjera de Hollywood en reconocimiento a la excelencia de profesionales en cine y televisión, tanto en los Estados Unidos como a nivel mundial. La ceremonia anual, en la cual los ganadores son premiados, forma parte de la temporada de premios cinematográficos, cuyo inicio tiene lugar entre octubre o noviembre del año anterior, para finalizar entre febrero o marzo con la ceremonia de entrega de los Premios Óscar.​\\nLa primera ceremonia de premiación tuvo lugar en enero de 1944 en los estudios de 20th Century-Fox en Los Ángeles. La 77.ª ceremonia —la más reciente— tuvo lugar el 5 de enero de 2020 en el hotel Beverly Hilton en Beverly Hills, sede de la ceremonia desde 1961.​"},{"page_url":"https://de.wikipedia.org/wiki/IPAS","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Industriepark_Am_Silberberg%2C_IPAS%2C_004x.jpg","page_title":"IPAS","context_page_description":"IPAS steht für Industrie-Park Am Silberberg und ist ein Industrie- und Gewerbegebiet in Euskirchen."},{"page_url":"https://en.wikipedia.org/wiki/La_Isleta_Lighthouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/La_Isleta_Lighthouse_general_view-Las_Palmas_de_Gran_Canaria.jpg","page_title":"La Isleta Lighthouse","context_page_description":"La Isleta Lighthouse is an active 19th century lighthouse on the Spanish island of Gran Canaria in the Canary islands. The lighthouse has been constructed on the rocky peninsula of La Isleta, which overlooks the Port of Las Palmas to the north of the city of Las Palmas, the capital of Gran Canaria. Situated at the north-eastern tip of the island, the La Isleta light marks the approaches to the port and lies midway between the Sardina lighthouse to the east and the Punta de Melenara lighthouse of Telde to the south."},{"page_url":"https://de.wikipedia.org/wiki/UEFA_Europa_League_2010/11","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/2010%E2%80%9311_UEFA_Europa_League_-_SK_Rapid_Wien_vs_F.C._Porto_%2806%29.jpg","page_title":"UEFA Europa League 2010/11","context_page_description":"Die UEFA Europa League 2010/11 war die 40. Auflage des zweitwichtigsten Wettbewerbs für europäische Fußballvereine, der bis zur Saison 2008/09 unter der Bezeichnung UEFA-Pokal stattfand. Am Wettbewerb nahmen in dieser Saison 194 Klubs aus allen 53 Landesverbänden der UEFA teil.\\nDie Saison begann mit den Hinspielen der ersten Qualifikationsrunde am 1. Juli 2010 und endete mit dem Finale am 18. Mai 2011 im Aviva Stadium in Dublin, das der FC Porto mit 1:0 durch ein Tor von Falcao gegen Sporting Braga gewann.\\nTorschützenkönig des Wettbewerbs wurde der Kolumbianer Falcao vom Sieger FC Porto mit dem Europapokal-Saisonrekord von 17 Toren.\\nDer FC Porto qualifizierte sich durch diesen Sieg für den UEFA Super Cup 2011."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%B0%D1%80%D1%82%D0%B8%D1%81%D1%82%D0%BE%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/%D0%AE%D1%80%D0%B8%D0%B9_%D0%9B%D0%B0%D0%B7%D0%B0%D1%80%D0%B5%D0%B2%D0%B8%D1%87_%D0%9F%D0%BE%D0%BF%D0%BE%D0%B2.jpg","page_title":"Список народных артистов СССР","context_page_description":"Высшее почётное звание Народный артист СССР присваивалось в СССР с 1936 года наиболее выдающимся деятелям искусства, внёсшим особый вклад в развитие советского театра, музыки, кино, цирка, телевидения и радиовещания в воспитание творческой смены высшим органом власти страны по представлению профильных министерств и ведомств.\\nОбладателями почётного звания «Народный артист СССР» за все годы стали 1006 человек. В статье приводится список народных артистов СССР по годам и датам присвоения звания."},{"page_url":"https://it.wikipedia.org/wiki/Cyrtodactylus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Cyrto_marmo_050408_024_ipb.jpg","page_title":"Cyrtodactylus","context_page_description":"Cyrtodactylus Gray, 1827 è un genere di piccoli sauri della famiglia dei Gekkonidi, diffusi in Asia e Oceania."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%A6%E0%A5%81%E0%A4%B8%E0%A4%B0%E0%A5%87_%E0%A4%AE%E0%A4%B9%E0%A4%BE%E0%A4%AF%E0%A5%81%E0%A4%A6%E0%A5%8D%E0%A4%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Yalta_summit_1945_with_Churchill%2C_Roosevelt%2C_Stalin.jpg","page_title":"दुसरे महायुद्ध","context_page_description":"दुसरे महायुद्ध हे १९३९ ते १९४५ दरम्यान झालेले जागतिक युद्ध होते. हे युद्ध मुख्यतः युरोप व आशियामध्ये दोस्त राष्ट्रे व अक्ष राष्ट्रे यांच्या मध्ये झाले. जर्मनीने पोलंडवर केलेल्या हल्ल्याने हे युद्ध १ सप्टेंबर १९३९ रोजी अधिकृतपणे सुरू झाले. यानंतर फ्रान्स, युनायटेड किंग्डम आणि इतर राष्ट्रांनी जर्मनी विरुद्ध युद्ध पुकारले. जपानने व इटलीने जर्मनीच्या बाजूने युद्धात पदार्पण केले. १९४१च्या डिसेंबरमध्ये जपानने अमेरिकेवर हल्ला केल्यावर अमेरिकेने युद्धात सक्रिय भाग घेतला व तेथून युद्ध जगभर पसरले. दोस्त राष्ट्रांमध्ये चीन, रशिया, इंग्लंड, अमेरिका व इतर राष्ट्रांचा समावेश होता, तर अक्ष राष्ट्रांमध्ये जर्मनी, इटली व जपान हे देश होते. जवळ जवळ ७० देशांचे सैन्य यात सहभागी झाले होते. या युद्धात सहा कोटींच्यावर माणसे मेली. मानवी इतिहासातील ही सर्वांत मोठी जीवितहानी आहे. या युद्धामध्ये दोस्त राष्ट्रांचा विजय झाला."},{"page_url":"https://en.wikipedia.org/wiki/Critical_infrastructure","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Grand_Coulee_Dam_spillway.jpg","page_title":"Critical infrastructure","context_page_description":"Critical infrastructure is a term used by governments to describe assets that are essential for the functioning of a society and economy – the infrastructure. Most commonly associated with the term are facilities for:\\nShelter; Heating;\\nAgriculture, food production and distribution;\\nWater supply;\\nPublic health;\\nTransportation systems;\\nSecurity services.\\nElectricity generation, transmission and distribution;\\nRenewable energy, which are naturally replenished on a human timescale, such as sunlight, wind, rain, tides, waves, and geothermal heat.\\nTelecommunication; coordination for successful operations\\nEconomic sector; Goods and services and financial services;"},{"page_url":"https://fr.wikipedia.org/wiki/Jos%C3%A9_Felipe_Flores","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Jose_Felipe_Flores.jpg","page_title":"José Felipe Flores","context_page_description":"José Felipe Flores était un médecin, anatomiste et professeur guatémaltèque.\\nDiplômé en médecine de la Royale et Pontificale Université Saint-Charles-Borromée de Guatemala, il s’attacha à développer l’enseignement de la médecine dans son pays natal et y instaura le premier protomedicato, dont il devint le premier président. En qualité de professeur ordinaire de l’université Saint-Charles, il renouvela l’enseignement de l’anatomie, en encourageant les dissections et en construisant lui-même des mannequins de cire pour les démonstrations anatomiques. Il fut par ailleurs un pionnier de la vaccination anti-variolique, d’abord en appliquant avec succès la variolisation lors d’une épidémie de variole au Guatemala en 1780, puis, pendant son séjour en Espagne, en aidant à concevoir et définir plus avant la future expédition Balmis, chargée d'apporter la vaccination jennérienne dans tout l’Empire espagnol. Sa thèse que le cancer pouvait se traiter par l’ingestion d’un certain type de lézard eut un certain retentissement dans les milieux médicaux de l’époque, après traduction vers de multiples langues de l’opuscule qui exposait cette thèse."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_munic%C3%ADpios_da_Bahia","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Bras%C3%A3o_Conde%C3%BAba_BA.png","page_title":"Lista de municípios da Bahia","context_page_description":"Esta lista de municípios da Bahia está organizada alfabeticamente. Ao todo, estão listados os 417 municípios da Bahia, o estado brasileiro com o quarto maior número deles. Os municípios baianos representam quase 7,5% dos 5 570 municípios em todo território nacional. Diversos em muitos termos, os municípios são a unidade político-administrativa do país por estarem mais próximos ao cotidiano das pessoas. Dentre eles, o município de Salvador é capital estadual da Bahia, entretanto, a sede do governo estadual é temporariamente transferida todo 25 de junho para o município de Cachoeira, desde 2007. E para além dos símbolos nacionais e estaduais, todos os municípios podem também ter símbolos próprios, o que inclui as bandeiras e brasões de armas.\\nNo Brasil, desde a constituição de 1988, os municípios são um dos entes autônomos da federação brasileira. A Constituição do Estado da Bahia de 1989 os definiu como \\"unidades político-administrativas autônomas\\" em que o estado está dividido e \\"unidades integrantes da República Federativa do Brasil, dotadas de autonomia política, administrativa e financeira\\"."},{"page_url":"https://en.wikipedia.org/wiki/Turks_in_Germany","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/AUT_vs._TUR_2016-03-29_%28232%29.jpg","page_title":"Turks in Germany","context_page_description":"Turks in Germany, also referred to as German Turks and Turkish Germans, are ethnic Turkish people living in Germany. These terms are also used to refer to German-born individuals who are of full or partial Turkish ancestry. Whilst the majority of Turks arrived or originate from Turkey, there are also significant ethnic Turkish communities living in Germany who come from Southeastern Europe, Cyprus, and more recently as refugees from Syria and Iraq. Turkish people form the largest ethnic minority in Germany. They also form the second largest Turkish population in the world, after Turkey.\\nTurks who immigrated to Germany brought cultural elements with them, including the Turkish language and Islam. These cultural values are often passed down to their children and descendants, but German Turks are also increasingly secular. Moreover, greater German society has also been exposed to Turkish culture, particularly in regards to Turkish food and the arts."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D0%BF%D0%B0%D0%BF%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Pope_John_XV.jpg","page_title":"Списак папа","context_page_description":"Титула папе је дата епископу града Рима, поглавару Римокатоличке цркве. Настала је од грчке ријечи папас која значи отац, а користи се из поштовања. У Католичкој цркви папа има највећи ауторитет у свим црквеним питањима. Беатификација је папско признање да је особа живјела смјерно и светитељски, и таквима се додјељује титула „благословен“. То је први корак у процесу канонизације, која води у проглашење за свеца."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%80%D1%81%D0%BE%D0%BD%D0%BE%D1%84%D0%B8%D0%B9_(%D0%A1%D1%82%D0%BE%D0%BB%D1%8F%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/%D0%95%D0%BF%D0%B8%D1%81%D0%BA%D0%BE%D0%BF_%D0%91%D0%BE%D1%80%D0%BE%D0%B4%D1%8F%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%92%D0%B0%D1%80%D1%81%D0%BE%D0%BD%D0%BE%D1%84%D0%B8%D0%B9._%D0%9A%D0%B8%D0%B5%D0%B2%D0%BE-%D0%9F%D0%B5%D1%87%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%9B%D0%B0%D0%B2%D1%80%D0%B0.jpg","page_title":"Варсонофий (Столяр)","context_page_description":"Митрополит Варсоно́фий — епископ Украинской православной церкви, митрополит Винницкий и Барский."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%BB_IX_(%D0%BA%D0%B0%D1%80%D0%BE%D0%BB%D1%8C_%D0%A8%D0%B2%D0%B5%D1%86%D1%8B%D1%96)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Karl_IX_Staty_Karlstad.JPG","page_title":"Карл IX (кароль Швецыі)","context_page_description":"Карл IX — герцаг Сёдэрманландскі, рэгент Швецыі з сярэдзіны 1590-х гадоў, кароль Швецыі з 1604 года з дынастыі Васа."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%97%B5%E6%B5%A6%E4%BA%8C%E6%A1%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Minpu_No.2_Bridge1.jpg","page_title":"闵浦二桥","context_page_description":"閔浦二橋，即滬閔路－滬杭公路越江工程，原名西渡大橋或奉浦二橋，是上海市的一座公路、軌道交通兩用雙層橋樑，為獨塔雙索斜拉橋形式；由上海市城市建設設計研究院所設計，武漢中鐵大橋局集團承建。北接滬閔路，南連滬杭公路，是黃浦江上第九座大橋。上層已於2010年5月21日通車。\\n該橋北岸起自閔行區東川路以北，沿滬杭公路到奉賢區西渡鎮西閘路以南落地，全長約5.8公里，距奉浦大橋約1.7公里。主橋全長436.55米，主跨長251.4米，軌道交通與公路疊合段長度為3.2公里。上層為雙向四車道二級公路，寬度18米；下層為軌道交通5號線南延伸段，為電氣化複線城市軌道交通。主橋設計為按300年一遇防洪標準，最高通航水位4.41米，最大通行3000噸級雜貨船設計。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B6%E0%B5%80%E0%B4%B7%E0%B5%8D_%E0%B4%AE%E0%B4%B9%E0%B5%BD_(%E0%B4%B2%E0%B4%BE%E0%B4%B9%E0%B5%8B%E0%B5%BC_%E0%B4%95%E0%B5%8B%E0%B4%9F%E0%B5%8D%E0%B4%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Seesh_Mahal_360_Panorama.jpg","page_title":"ശീഷ് മഹൽ (ലാഹോർ കോട്ട)","context_page_description":"പാകിസ്താനിലെ ലാഹോർ കോട്ടയുടെ ഭാഗമായി സ്ഥിതിചെയ്യുന്ന ഒരു കൊട്ടാരമാണ് ശീഷ് മഹൽ. കോട്ടയുടെ വടക്കു പടിഞ്ഞാറ് ഭാഗത്തുള്ള ഷാബുർജ് ബ്ലോക്കിലാണ് ഇത് സ്ഥിതിചെയ്യുന്നത്. ചെറുതും വലുതുമായി ആയിരക്കണക്കിനു ദർപ്പണങ്ങൾ പതിപ്പിച്ച മതിലുകളും മേൽക്കൂരയുമാണ് ഈ കൊട്ടാരത്തിലെ പ്രധാന ആകർഷണം. പിയത്ര ദുരെ ശൈലിയിൽ വിലപിടിപ്പേറിയ രത്നക്കല്ലുകളും വെളുത്ത മാർബിളും കൊണ്ട് അലങ്കരിച്ചിരിക്കുന്ന ഈ കൊട്ടാരത്തെ 'സ്ഫടിക കൊട്ടാരം' എന്നും വിളിക്കാറുണ്ട്. മുഗൾ ചക്രവർത്തിയായിരുന്ന ഷാജഹാൻ 1631-32 കാലഘട്ടത്തിൽ പണികഴിപ്പിച്ചതാണ് ഈ കൊട്ടാരം. മുഗൾ ഭരണാധികാരികൾ ലാഹോർ കോട്ടയിൽ നിർമ്മിച്ച 21 നിർമ്മിതികളിൽ ഉൾപ്പെടുന്ന ഈ കൊട്ടാരത്തെ 'ലാഹോർ കോട്ടയുടെ കിരീടത്തിലെ രത്നം' എന്നുവിശേഷിപ്പിക്കാറുണ്ട്. ലാഹോർ കോട്ടയിലെ ശീഷ് മഹൽ ഉൾപ്പെടെയുള്ള കെട്ടിടങ്ങളെ 1981-ൽ യുനെസ്കോ ലോകപൈതൃകപ്പട്ടികയിൽ ഉൾപ്പെടുത്തിയിരുന്നു."},{"page_url":"https://ckb.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%DB%8C_%D8%B3%D9%84%DB%8C%D8%B3%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/George_McCord_-_New_York_Harbor.jpg","page_title":"ماری سلیست","context_page_description":"ماری سیلیست بریجانتینێکی بازرگانی ئەمریکی بوو، لە ٤ کانوونی یەکەمی ١٨٧٢ لە نزیک دورگەکانی ئەزوور لە زەریای ئەتلەسی بە تێکشکاوی دۆزرایەوە. دۆزینەوەکە لە لایەن بریجانتینێکی کەنەدیەوە بوو بە ناوی «دی گراشیا» کە لە بارێکی زۆرخراپدا بوو بەڵام بۆ دەریاوانی دەگونجا، کە بناغەکەی تا ڕادەیەک ڕێک مابوو، بەڵام بەلەمەکانی فریاگوزاری تێدا نەمابوون. دواھەمین ھەمواری تۆمارەکانی دەگەڕایەوە بۆ نۆ ڕۆژ پێش دۆزینەوەی، لە بارەی بەڕێکەوتنی بوو لە نیویۆرکەوە بۆ جەنەوا لە ٧ی تشرینی دووەم، کاتێک کە پشکنینیان بۆ کرد تێبینیان کرد کە بار و کەلوپەلەکانی وەک خۆیان ماون، کە بریتی بوون لە بارێکی ئەلکھول و خواردنەوە مەستییەکان، ھەروەھا کەلوپەلەکانی کاپتنەکە و کارمەندانی سەر کەشتییەکە دەستکاری نەکرابوون و لە جێگای خۆیان بوون. بەڵام کارمەند و کەسانی سەرکەشتییەکە بۆ ھەمیشە کەس نەیبینینەوە و گوێیان لێیان نەبوویەوە.\\nبناغەی ماری سلیست لە دورگەی سپینسەر لە نۆڤاسکۆشیا دارێژرابوو، لە ساڵی ١٨٦١ بەردەست خرابوو لە ژێر خاوەندارییەتی بەریتانی بەناوی «ئەمازۆن». دواتر لە ساڵی ١٨٦٨ گوێزرابوویەوە بۆ خاوەندارییەتی ئەمریکی، کاتێک کە ناوێکی نوێی لێندرا خرایە کاری دەریاوانی بە شێوەیەکی ئاسایی تاوەکو گەشتە ناودارەکەی ساڵی ١٨٧٢."},{"page_url":"https://nl.wikipedia.org/wiki/Zilte_rus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Juncus_gerardii_detail.jpeg","page_title":"Zilte rus","context_page_description":"De zilte rus is een overblijvend kruid dat behoort tot de russenfamilie. De plant komt van nature voor in Europa, in West-Azië en in Noord-Amerika.\\nDe plant wordt 5-50 cm hoog, vormt lange wortelstokken en heeft een meestal ronde stengel. De vlakke wortelbladeren zijn niet dik en stijf en hebben geen glanzende middenstreep. De schutbladen zijn grasachtig.\\nDe zilte rus bloeit van juni tot augustus met donkerbruine bloemen en met een groene middenstreep over de 2,5-3 mm grote bloemdekbladen. De stempel is in tegenstelling tot die van de platte rus rood gekleurd. De stijl is 0,5-0,8 mm lang. De 1,2-1,7 mm grote helmhokjes zijn drie keer zo lang als de stempels.\\nDe donkerbruine, ellipsoïde vrucht is evenlang of iets langer dan de bloemdekbladen. De kleverige, donkerbruine zaden zijn ongeveer 0,6 mm groot.\\nDe plant komt voor op zilte gronden op de hoger gelegen delen van de kwelders en schorren, strandvlaktes, in weiland en rietland en kan na ontzilting nog lang aanwezig blijven.\\nEen bladvlo vormt op de stengels oranjerode gallen."},{"page_url":"https://en.wikipedia.org/wiki/Micha%C5%82%C3%B3w,_Pi%C5%84cz%C3%B3w_County","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Micha%C5%82%C3%B3w_church.JPG","page_title":"Michałów, Pińczów County","context_page_description":"Michałów is a village in Pińczów County, Świętokrzyskie Voivodeship, in south-central Poland. It is the seat of the gmina called Gmina Michałów. It lies approximately 7 kilometres south-west of Pińczów and 45 km south of the regional capital Kielce.\\nMichałów State Stud is the largest Arabian horse farm in Poland."},{"page_url":"https://lv.wikipedia.org/wiki/Rudens_v%C4%93lziede","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Colchicum_autumnale_HRM.JPG","page_title":"Rudens vēlziede","context_page_description":"Rudens vēlziede ir rudenī ziedošs vēlziežu dzimtas augs. Dekoratīvs un ļoti indīgs augs. Latvijā reti sastopama, jo valsts atrodas diezgan tālu uz ziemeļiem no šīs sugas vienlaidus izplatības areāla. Reizēm rudens vēlziede tiek sajaukta ar krokusiem."},{"page_url":"https://en.wikipedia.org/wiki/Dutch_Dotterer","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Dutch_Dotterer_1961.jpg","page_title":"Dutch Dotterer","context_page_description":"Henry John \\"Dutch\\" Dotterer, Jr. was an American professional baseball catcher.\\nA native of Syracuse, New York, he attended Syracuse University and while there was a member of Delta Kappa Epsilon fraternity.\\nHe threw and batted right-handed, stood 6 feet tall and weighed 209 pounds.\\nDotterer played Major League Baseball with the Cincinnati Redlegs from 1957 until 1960 and with the Washington Senators as a member of the expansion Senators' 1961 debut season in the American League.\\nHe batted .247 in 107 career games, with five home runs and 33 runs batted in.\\nIn 1959, he backed up regular Cincinnati catcher Ed Bailey, hitting .267 with two homers and 17 RBI in 161 at-bats.\\nAt the close of the 1960 season, Dutch was traded to the Kansas City Athletics, who then left him unprotected in the 1960 Major League Baseball expansion draft, where he was acquired by Washington with the 12th pick in the player lottery."},{"page_url":"https://fi.wikipedia.org/wiki/Rautavaaran_yhten%C3%A4iskoulu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Rautavaaran_koulukeskus_-_alakoulu_%28Kirkonkyl%C3%A4n_koulu%29_-_Koulutie_5_-_Rautavaaran_kk_-_Rautavaara.jpg","page_title":"Rautavaaran yhtenäiskoulu","context_page_description":"Rautavaaran yhtenäiskoulu, tunnetaan myös nimellä Rautavaaran koulukeskus tai Kirkonkylän koulukeskus, on suomenkielinen yhtenäiskoulu Rautavaaran kunnan kirkonkylässä Pohjois-Savossa.\\nKesällä 2019 Rautavaaran peruskoulut yhdistettiin hallinnollisesti yhtenäiskouluksi. Aiemmin liitetyt koulut tunnettiin nimillä Kirkonkylän koulu, Rautaharjun koulu ja Rautavaaran yläaste.\\nVuonna 2018 koulukeskuksessa opiskeli yhteensä 129 peruskoululaista.\\nPieni Rautavaaran lukio on toiminut samassa kiinteistössä yhtenäiskoulun kanssa. Vuonna 2018 Rautavaaran lukiossa opiskeli yhteensä 18 lukiolaista.\\nRautavaaran koulukeskuksen naapurustosta löytyvät muun muassa Rautavaaran terveysasema ja Rautavaaran kirjasto, eikä monitoimitaloon tai Rautavaaran kirkkoonkaan ole pitkä matka."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%A7%D9%86%D8%AF%D9%88%DB%8C%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Talkessel_von_Pfunders.JPG","page_title":"واندویس","context_page_description":"واندویس یک کومونه در ایتالیا است که در تیرول جنوبی واقع شده‌است. واندویس ۱۱۰٫۶ کیلومتر مربع مساحت و ۳٬۲۶۴ نفر جمعیت دارد."},{"page_url":"https://it.wikipedia.org/wiki/Alessandrina_di_Baden","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Coburg-Alexandrinenbrunnen.jpg","page_title":"Alessandrina di Baden","context_page_description":"Alessandrina di Baden era la figlia maggiore di Leopoldo, Granduca di Baden e di sua moglie la principessa Sofia di Svezia."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%A1%83%E5%9C%92%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Taoyuan_Art_Exhibition_Center_2013.JPG","page_title":"桃園市","context_page_description":"桃园市，通称桃园，简称“桃”，是中华民国的直辖市，台湾六都之一。桃园是位于台湾本岛西北部的双核心都市，属于“首都生活圈”、“桃竹苗生活圈”的一员。在部分商业投资中，也被认为是大台北地区的组成之一。桃园市全市面积1,220平方公里，设籍人口226万人。其西面台湾海峡、东临宜兰县、北接新北市、南与新竹县为界。活动人口约250万人、含外籍居民12万人，是中华民国设籍人口数第五大的直辖市。\\n桃园市的核心区为桃园区与中坜区，并依族群分布及生活圈分为北桃园和南桃园。北桃园属于首都生活圈，南桃园则是属于桃竹苗生活圈\\n。由于毗邻台北都会区及多项重大公共建设、许多投资皆位于桃园，再加上拥有台湾规模最大的国际机场，使得桃园市近年来发展迅速，吸引大量外县市人口移入、形成桃园中坜都会区。桃园呈现为闽、客、外省及原住民族等多族群融合之貌，桃园为台湾工业重镇，也因为工业发达，既是台湾引入来自东南亚外籍劳工人数最多的直辖市，同时也是越南裔新住民最多的城市。\\n依据桃园市国土计划草案，未来桃园市的空间布局将改变为桃园、中坜、航空城三大主要都心，区分为桃园都会区域、中坜都会区域、桃园航空城都会区域、新镇生活区域、乡村发展区域、生态游憩区域等六大空间发展区域。"},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%B1%D8%A8%D9%87_%D8%AF%D9%86%D8%AF%D8%A7%D9%86%E2%80%8C%D8%AE%D9%86%D8%AC%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Machaeroides_eothen.JPG","page_title":"گربه دندان‌خنجری","context_page_description":"گربه دندان‌خنجری که به آن ببر دندان‌خنجری هم گفته شده نامی است برای اشاره به انواعی از پستانداران درنده منقرض‌شده گربه‌سان که دارای دندان‌های نیش بلند و خمیده بودند.\\nاین جانوران متعلق به خانواده‌های شمشیردندان‌نمایان، شمشیردندان‌نما و همچنین زیرخانوداه دندان‌خنجری‌ها از خانواده گربه‌ایان بودند. بنابراین برخلاف نامشان، همه گربه‌های دندان‌خنجری از خانواده گربه‌ها نبودند. گربه‌سانان دندان‌خنجری از میانه ائوسن تا پایان پلیستوسن زندگی می‌کردند و سنگواره‌های آن‌ها در تمام قاره‌ها به جز اقیانوسیه و جنوبگان کشف شده‌است."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9E%E1%83%A3%E1%83%94%E1%83%A0%E1%83%A2%E1%83%9D-%E1%83%90%E1%83%98%E1%83%90%E1%83%99%E1%83%A3%E1%83%A9%E1%83%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/2da_avenida_mas_importante_de_pto.ayacucho_la_23_de_enero-venezuela.jpg","page_title":"პუერტო-აიაკუჩო","context_page_description":"პუერტო-აიაკუჩო — ქალაქი სამხრეთ ვენესუელაში, ამასონასის შტატის დედაქალაქი.\\nმდებარეობს მდინარე ორინოკოს ჭორომიან ნაპირებზე, რის გამოც მდინარეზე შეფერხებულია ნაოსნობა.\\nწარმოადგენს სავაჭრო ცენტრს. უმთავრესად აწარმოებენ რეზინს და ბალატას.\\n2005 წლის აღწერის მონაცემებით ქალაქის მოსახლეობა შეადგენს 80.000 კაცს.\\nქალაქის განაშენიანება დაიწყო 1924 წელს. პუერტო-აიაკუჩო ქვეყნის დანარჩენ ნაწილთან დაკავშირებულია ორი გზით,\\nრომლის მეშვეობით უკავშირდება ორინოკო-კაიკარას და სან-ფერნანდო-დე-აპურეს.\\nსაჰაერო მიმოსვლით უკავშირდება ქალაქ მაიკეტიას.\\n1970 წლამდე პუერტო-აიაკუჩო მიუწვდომელი იყო საავტომობილო გზით, შემდეგ გაშენდა გზა ბოლივარის შტატიდან, რის შემდეგ დაიწყო ქალაქის სწრაფი ზრდა. ჰავა ეკვატორულია. ჰაერის საშუალო წლიური ტემპერატურა შეადგენს 26,8 °C-ს. ნალექების რაოდენობა წელიწადში 2260 მმ. ქალაქში არის მეტეოსადგური.\\nპორტს თანადროულ დროში მნიშვნელობა დაეკარგა. განვითარებულია ტურიზმი."},{"page_url":"https://ca.wikipedia.org/wiki/Aigua_potable_en_els_vaixells","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Alembic_for_distillation.svg","page_title":"Aigua potable en els vaixells","context_page_description":"Les navegacions marítimes llargues fan que sigui imprescindible el transport d'aigua potable a bord d'un vaixell. Depenent de les circumstàncies ambientals i de la qualitat dels aliment sòlids ingerits, una persona necessita una certa quantitat diària d'aigua per a mantenir un nivell de salud òptim. Si es beu menys es produeix la deshidratació del cos en un grau més o menys perjudicial. Una persona pot resistir uns tres dies sense beure abans de morir de set.\\nEl transport de l'aigua potable necessària es pot reduir a dues menes de recipients: els recipients mòbils i els dipòsits integrats en el vaixell.\\nDos altres sistemes foren emprats tradicionalment per a complementar la quantitat d'aigua potable disponible: la recollida d'aigua de pluja i la destil·lació d'aigua de mar en un alambí.\\nModernament, des de fa algunes dècades, hi ha els sistemes de potabilització per osmosi inversa."},{"page_url":"https://en.wikipedia.org/wiki/Ligi_Ndogo_S.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/President_Kibaki_and_Ligi_Ndogo.jpg","page_title":"Ligi Ndogo S.C.","context_page_description":"Ligi Ndogo Soccer Club is a football club and youth academy based in Nairobi, Kenya. The senior team currently competes in the National Super League, the second tier of the Kenyan football league system. The club's name is Swahili for \\"little league\\".\\nThe club's youth academy was founded by current chairman Chris Amimo and Karani Nyamu in February 2002, and in 2005, the first senior team was formed and has played at Ligi Ndogo Grounds along Ngong Road since then. The team briefly used the Nairobi City Stadium in 2012 for its home games while their Ngong Road grounds were undergoing renovations."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B1%D0%B4%D1%83%D0%BB%D0%BB%D0%B0%D1%85%D0%B8,_%D0%A8%D0%B5%D1%85%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Shehu_Abdullahi_Rio_2016b.jpg","page_title":"Абдуллахи, Шеху","context_page_description":"Шеху Абдуллахи — нигерийский футболист, полузащитник клуба «Бурсаспор» и сборной Нигерии."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9A%B8%EC%82%B0_%EB%8F%99%ED%97%8C_%EB%B0%8F_%EB%82%B4%EC%95%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/%EC%9A%B8%EC%82%B0%EB%8F%99%ED%97%8C_%EB%B0%8F_%EB%82%B4%EC%95%84.jpg","page_title":"울산 동헌 및 내아","context_page_description":"울산 동헌 및 내아는 울산광역시 중구 동헌길에 있는 건축물이다. 1997년 10월 9일 울산광역시의 유형문화재 제1호로 지정되었다."},{"page_url":"https://en.wikipedia.org/wiki/Manipur_fulvetta","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Manipur_Fulvetta_Mishmi_Hills_Arunachal_Pradesh_April_2019.jpg","page_title":"Manipur fulvetta","context_page_description":"The Manipur fulvetta or streak-throated fulvetta is a bird species in the family Sylviidae. It is named for the state of Manipur in Northeast India. Like the other typical fulvettas, it was long included in the Timaliidae genus Alcippe. In addition, it was long included in F. cinereiceps as a subspecies, and the common name \\"streak-throated fulvetta\\" was applied to all these birds. The typical F. cinereiceps are now called grey-hooded fulvetta.\\nIt is found in Northeast India, Myanmar and Yunnan.\\nIts natural habitat are temperate forests. Its status was first evaluated for the IUCN Red List in 2008, being listed as a Species of Least Concern."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%80%B6%E6%97%A5%C2%B7%E6%9D%9C%E5%BE%B7%E5%85%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Jerzy_Dudek.jpg","page_title":"耶日·杜德克","context_page_description":"耶日·杜德克，波兰国家足球队一号门将。\\n杜德克曾为利物浦夺得2003年联赛杯及2005年欧洲联赛冠军杯，其中在2005年欧洲联赛冠军杯决赛表现神勇，协助利物浦戏剧性反胜AC米兰，在点球大战中扑出两球，成为头号功臣。\\n自从西班牙人雷纳加盟利物浦以后，杜德克常受伤患困扰，2005-2006年更从未为利物浦上场，结果在2006年世界杯时，这位波兰一号门将并没有入选国家队。在2007年，杜德克自由转会至皇家马德里，作为卡西利亚斯的替补。\\n2010年9月4日，杜德克应卡拉格的邀请，组成利物浦明星队并返回利物浦的主场安菲尔德为慈善纪念赛比赛。"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Martin_de_Lierville","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Lierville_%2860%29%2C_%C3%A9glise_Saint-Martin%2C_chapelle_sud%2C_vue_par_la_1%C3%A8re_grande_arcade.jpg","page_title":"Église Saint-Martin de Lierville","context_page_description":"L'église Saint-Martin est une église catholique paroissiale située à Lierville, dans l'Oise, en France. Sa nef unique non voûtée remonte à la fin du XIᵉ siècle, et reçut un nouveau portail richement décoré au second quart du XIIᵉ siècle. C'est à cette époque aussi que l'on ajouta un clocher au sud du chœur. C'est l'un des cinq clochers romans octogonaux du Vexin français. Pendant la seconde moitié du XIIᵉ siècle, un chœur gothique de deux travées au chevet plat vint remplacer le sanctuaire roman primitif. Muni d'une fenêtre au remplage rayonnant tardif à l'occasion de l'adjonction d'une chapelle au sud, dans l'angle avec le clocher, au cours du XIVᵉ siècle, sa véritable époque n'est plus gère visible depuis l'extérieur, d'autant plus qu'un collatéral le flanque également au nord. Ajouté plus tardivement que son pendant du sud, sans doute au cours de la guerre de Cent Ans, il ne fut pas voûté avant le XVᵉ siècle, et ses voûtes affichent clairement le style gothique flamboyant. C'est également à l'époque flamboyante, au second quart du XVIᵉ siècle, que la nef fut équipée d'un bas-côté de cinq travées au nord, et que l'on projeta le voûtement de la nef, finalement resté lettre morte."},{"page_url":"https://sv.wikipedia.org/wiki/Meridolum","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Snail_shell_Resolute_Track_Casuarina_forest%2C_around_25_mm_long1.JPG","page_title":"Meridolum","context_page_description":"Meridolum är ett släkte av snäckor. Meridolum ingår i familjen Camaenidae.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://fi.wikipedia.org/wiki/Kantatie_67","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Kantatie_67.jpg","page_title":"Kantatie 67","context_page_description":"Kantatie 67 on Kaskisista Seinäjoen Nurmoon johtava kantatie. Tien pituus on 115 kilometriä ja se on pääosin kaksikaistainen Seinäjoen keskustaa lukuun ottamatta, jossa tie on nelikaistainen. Tie on pääosin hyvälaatuinen, paikoitellen jopa valtatietasoinen, ja sen liikennemäärät ovat varsin vaihtelevia.\\nTie alkaa Rannikko-Pohjanmaalta, Kaskisten satamasta suunnaten pohjoiskoilliseen ja kääntyy Närpiön alueelle tultaessa itään. Se kulkee Korsgrundetin ja Karklobbenin kautta, ylittää Närpesfjärdenin Erlandskäretin ja Hundholmenin kautta. Mantereelle tultaessa tie kääntyy itäkoilliseen ja risteää valtatie 8 kanssa Trodmossenissa. Etelä-Pohjanmaalla, Teuvalla noin kolme kilometriä kirkonkylän jälkeen suunta kääntyy itäkaakkoon Kauhajoelle, jossa siitä eroaa kantatie 44 Sastamalan Kiikkaan. Kauhajoen Aronkylässä tie kääntyy n. 90° pohjoiskoilliseen kohti Kurikkaa, jonka pohjoisosassa se kulkee Magneetin risteyksestä runsaat neljä kilometriä yhdessä valtatie 3:n kanssa. Tuiskulan risteyksessä nämä eroavat ja kantatie 67 jatkuu Ilmajoen läpi kääntyen koilliseen, Seinäjoelle tultaessa itään ja jälleen koilliseen."},{"page_url":"https://en.wikipedia.org/wiki/Municipalities_of_Quer%C3%A9taro","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Queretaro_in_Mexico_%28zoom%29.svg","page_title":"Municipalities of Querétaro","context_page_description":"Querétaro is a state in North Central Mexico that is divided into 18 municipalities.\\nMunicipalities in Queretaro are administratively autonomous of the state according to the 115th article of the 1917 Constitution of Mexico. Every three years, citizens elect a municipal president by a plurality voting system who heads a concurrently elected municipal council responsible for providing all the public services for their constituents. The municipal council consists of a variable number of trustees and councillors. Municipalities are responsible for public services, street lighting, public safety, traffic, supervision of slaughterhouses and the maintenance of public parks, gardens and cemeteries. They may also assist the state and federal governments in education, emergency fire and medical services, environmental protection and maintenance of monuments and historical landmarks. Since 1984, they have had the power to collect property taxes and user fees, although more funds are obtained from the state and federal governments than from their own income."},{"page_url":"https://fr.wikipedia.org/wiki/Pierre_bleue_de_Givet","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Dommery_%28Ardennes%29_%C3%A9glise%2C_fonts_baptismaux_PM08000168_class%C3%A9.JPG","page_title":"Pierre bleue de Givet","context_page_description":"La pierre bleue de Givet est un calcaire extrait dans la région de Givet qui est employé à grande échelle depuis le XVIIᵉ siècle. Une carrière à ciel ouvert est encore en exploitation. C'est une variété particulière de la pierre bleue qu'on retrouve dans de nombreux autres gisements en Belgique."},{"page_url":"https://en.wikipedia.org/wiki/Alfa_Romeo_Giulietta_Sprint_Speciale","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Alfa_Romeo_Giulia_SS_Bertone_prototype_%287872538770%29.jpg","page_title":"Alfa Romeo Giulietta Sprint Speciale","context_page_description":"The Alfa Romeo Giulietta Sprint Speciale and Alfa Romeo Giulia Sprint Speciale, also known as Giulietta SS and Giulia SS, are small sports cars manufactured by Alfa Romeo from 1959 to 1966."},{"page_url":"https://ca.wikipedia.org/wiki/.il","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/ISOC-IL_Logo_Heb.png","page_title":".il","context_page_description":".il és l'actual domini de primer nivell territorial d'Israel, administrat per l'Israel Internet Association. Registrat el 24 d'octubre de 1985, el .il va ser el tercer domini de primer nivell territorial del món, després de .us i .uk. Actualment, Israel està en procés de reconeixement del domini de primer nivell territorial internacionalitzat ישראל.‏‎."},{"page_url":"https://en.wikipedia.org/wiki/United_States_Army_Forces_in_the_Far_East","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/26th_Cavalry_PI_Scouts_moving_into_Pozorrubio.jpg","page_title":"United States Army Forces in the Far East","context_page_description":"United States Army Forces in the Far East was a military formation of the United States Army active from 1941 to 1946. The new command's headquarters was created on 26 July 1941, at No. 1, Calle Victoria, Manila, Luzon, the Philippines, with General Douglas MacArthur as commander. The Chief of Staff was Brigadier General Richard K. Sutherland and the Deputy Chief of Staff was Lieutenant Colonel Richard J. Marshall. The core of this command was drawn from the Office of the Military Advisor to the Commonwealth Government.\\nCreation of this command led to the subordination of the headquarters of the Philippine Department of the U.S. Army, as a service command, since planning and tactical control were now under USAFFE control. MacArthur explains, \\"It became an administrative echelon. It was analogous to a corps area\\". MacArthur recommended that Philippine Department commander Major General Grunert be reassigned, as his services were no longer needed. On 23 October, Grunert returned to the United States and MacArthur was temporarily appointed as the Philippine Department's commander."},{"page_url":"https://en.wikipedia.org/wiki/Fran%C3%A7ois_de_Montmorency","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Diane_de_France.jpg","page_title":"François de Montmorency","context_page_description":"François de Montmorency, Duc de Montmorency KG was a French soldier, diplomat and peer who served as governor of Paris. He was Duke of Montmorency, Count of Dammartin, Baron of Châteaubriant and Lord of L'Isle-Adam, Grand Master of France, and Marshal of France."},{"page_url":"https://de.wikipedia.org/wiki/St.-James-Kathedrale_(Toronto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/5482_st_james_1020.jpg","page_title":"St.-James-Kathedrale (Toronto)","context_page_description":"Die anglikanische St.-James-Kathedrale im kanadischen Toronto gehört zur ältesten Kirchengemeinde in der Stadt. Sie wurde 1797 gegründet; der Sakralbau wurde 1844 vollendet und war lange Zeit das höchste Gebäude Torontos. Die Kathedrale steht an der nordöstlichen Ecke der Kreuzung zwischen der Church Street mit der King Street East. Nördlich verläuft die Adelaide Street East, östlich von ihr erstreckt sich der gleichnamige St.-James-Park."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%A1%D5%B5%D5%A1%D5%A9-%D5%86%D5%B8%D5%BE%D5%A1%D5%B5%D5%AB_%D5%BA%D5%B8%D5%B2%D5%B8%D5%BF%D5%A1_(%D4%B5%D6%80%D6%87%D5%A1%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/%D4%B3%D6%80%D5%AB%D5%A3%D5%B8%D6%80_%D5%80%D5%A1%D5%BD%D6%80%D5%A1%D5%A9%D5%B5%D5%A1%D5%B6%D5%AB_%D5%B0%D5%AB%D5%B7%D5%A1%D5%BF%D5%A1%D5%AF%D5%AB_%D5%B0%D5%B8%D6%82%D5%B7%D5%A1%D6%84%D5%A1%D6%804.jpg","page_title":"Սայաթ-Նովայի պողոտա (Երևան)","context_page_description":"Սայաթ-Նովայի պողոտա, պողոտա Երևանի Կենտրոն վարչական շրջանում։ Անվանվել է ի պատիվ հայ բանաստեղծ-աշուղ Սայաթ-Նովայի։"},{"page_url":"https://lv.wikipedia.org/wiki/Heimdals","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Processed_SAM_heimdallr.jpg","page_title":"Heimdals","context_page_description":"Heimdals ir āsu dievs senskandināvu mitoloģijā. Heimdals ir āsu sargs; viņš mitinās Himinbjorgā netālu no Bivresta, tilta, kas savieno Midgardu un Asgardu. Heimdals spēj redzēt 100 jūdžu tālumā gan dienu, gan nakti un dzirdēt zāli un aitu vilnu augam, turklāt viņam nepieciešams mazāk miega kā putnam.\\nTuvojoties Ragnarokam, Heimdals pūtīs ragu Gjallahornu un pamodinās dievus kaujai. Ragnarokā viņš cīnīsies ar Loki, un abi viens otru nogalinās.\\nHeimdals ir deviņu māšu dēls. Snorre Sturlusons Heimdalu nosauc par Odina dēlu. Heimdalam pieder zirgs Gulltops. Saskaņā ar Snorres Sturlusona Jaunāko Edu kenings zobenam ir \\"Heimdala galva\\".\\nUlfa Ugasona skaldiskajā poēmā Húsdrápa, no kuras saglabājušies tikai fragmenti, minēts, ka Heimdals palīdzējis Freijai atrast viņas kaklarotas Brisingamenas zagli Loki un, pārvērties par roni, cīnījies ar Loki pie Singasteina akmens. Heimdals uzvarējis un atdevis kaklarotu Freijai.\\nSkaldiskajās poēmās Völuspá un Húsdrápa Heimdals nosaukts par visas cilvēces tēvu.\\nHaimdalu saista ar romiešu Jānusu, indiešu Djausu vai Agni."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_Narodzenia_Naj%C5%9Bwi%C4%99tszej_Maryi_Panny_w_Stryju","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/St_Maria_Cathedral.JPG","page_title":"Parafia Narodzenia Najświętszej Maryi Panny w Stryju","context_page_description":"Parafia Narodzenia Najświętszej Maryi Panny w Stryju – rzymskokatolicka parafia znajdująca się w Stryju, w archidiecezji lwowskiej w dekanacie Stryj, na Ukrainie."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%8A%E0%B8%B5%E0%B8%99%E0%B8%9A%E0%B8%A2%E0%B8%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Burmese_novitiate-to-be_in_prince_clothes.jpg","page_title":"ชีนบยู","context_page_description":"ชีนบยู เป็นพิธีกรรมของชาวพม่า โดยเฉพาะเด็กชายในช่วงที่ก่อนจะบวชเป็นสามเณร ในศาสนาพุทธ นิกายเถรวาท พิธีชีนบยู หมายถึงการเฉลิมฉลองเครื่องหมายของสามเณร เมื่อเสร็จพิธีแห่ชีนบยูเด็กชายผู้เข้าร่วมพิธีกรรมจะเข้าบวชเป็นสามเณร เป็นการบวชของเด็กชายอายุต่ำกว่า 20 ปี\\nพิธีชีนบยูถือเป็นหน้าที่สำคัญของบิดา มารดาที่ต้องทำให้บุตรชายของตน โดยการปล่อยให้บุตรของตนออกตามรอยคล้ายตอนที่พระพุทธเจ้าเสด็จออกบวช และให้ประพฤติตนอยู่ในคำสอนของพระพุทธเจ้าสำหรับพิธีกรรมชาวพม่าส่วนใหญ่นิยมจัดระยะสั้น หรือบางส่วนนิยมจัดตอนบวชเป็นพระสงฆ์ต่อเมื่ออายุครบ 20 ปี"},{"page_url":"https://de.wikipedia.org/wiki/Flanell","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Wool_flannel.jpg","page_title":"Flanell","context_page_description":"Der Flanell ist ein Gewebe. Flanelle sind vergleichsweise leicht, aber dennoch wärmend und saugfähig, außerdem haben sie einen sehr weichen Griff.\\nMan unterscheidet Wollflanell und Baumwollflanell. Wollflanelle können aus Kammgarn oder Streichgarn bestehen und werden vorwiegend in Köperbindung hergestellt. Sie werden nur leicht gewalkt. Klassisch sind die Wollqualitäten als Melange im typischen Flanellgrau.\\nBaumwollflanelle dagegen werden geraut und sowohl in Leinwandbindung als auch in Köperbindung gewoben. Der Flor wird kurz und gleichmäßig geschmirgelt.\\nAus Flanell werden hauptsächlich baumwollene Flanellhemden und wollene Herren-Anzüge für die kühleren Jahreszeiten hergestellt."},{"page_url":"https://en.wikipedia.org/wiki/Haus_zur_goldenen_Waage","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Frankfurt_Goldene_Waage_Mai_2018.jpg","page_title":"Haus zur goldenen Waage","context_page_description":"The Haus zur Goldenen Waage was a medieval half-timbered house in the old town of Frankfurt am Main, which was destroyed in the air raid on March 22, 1944. Because of its high architectural and historic value, it was one of the most famous sights of the city. It was situated in front of the main entrance of the cathedral on the corner of the narrow Höllgasse, which leads from the cathedral square to the Römerberg and Altstadtgasse.\\nThe detailed Renaissance facade dates from 1619. The remains of the house, which would have allowed reconstruction after the war, were eliminated in 1950. However, the archways remained preserved as part of a private library in Götzenhain. For more than 20 years the land was fallow. Then in 1972/73, during the construction of the subway station Dom / Römer, the Archaeological Garden was created, allowing access to excavations of the Roman settlement on Cathedral hill and the Carolingian Royal Palace Frankfurt.\\nIn 2007, reconstruction of parts of the former old town became part of the Dom-Römer Project, which included the rebuilding of the Goldenen Waage. Work did not start until 2014."},{"page_url":"https://es.wikipedia.org/wiki/Estados_y_territorios_de_Nigeria","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Nigeria_states_1987-1991.png","page_title":"Estados y territorios de Nigeria","context_page_description":"Nigeria se divide en 36 estados, además de el Territorio de la Capital Federal. Los estados, a su vez, están divididos en 774 Áreas de Gobierno Local. Antes y después de que consiguiera su independencia en 1960, Nigeria era una federación de tres regiones: Provincias del Norte, del Este y del Oeste. En 1963, la región Oeste se dividió y se creó la Mid-Western Region. En 1967, las regiones fueron reemplazadas por 12 estados a través de un decreto militar. Entre 1967 y 1970 las regiones Mid-West y Este se intentaron escindir de Nigeria y crear el nuevo estado de Biafra. En 1976 se crearon diecinueve estados nuevos y en 1991 se creó el Territorio de la Capital Federal.​ En 1987 se crearon dos estados nuevos y en 1991, otro nuevo, llegando hasta el número de 30 estados. El 1996 se hizo el último cambio y se conformó la actual división territorial con 36 estados y el Territorio de la Capital Federal."},{"page_url":"https://hu.wikipedia.org/wiki/Amazonas-medence","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Capybara_Bolivie.jpg","page_title":"Amazonas-medence","context_page_description":"Az Amazonas-medence vagy Amazónia Dél-Amerika azon, északi része, amely a Guyanai- és Brazil-masszívum, továbbá az Andok között helyezkedik el. Az Amazonas folyó és mellékfolyói szelik át. Jelentős része még trópusi esőerdővel borított és nevét a fő folyójáról kapta.\\nA hatalmas erdőségek miatt, a Föld tüdejének is nevezik, de ez a kifejezés inkább a médiában és a hírességek által használatos. Tudományosan megcáfolt állítás."},{"page_url":"https://de.wikipedia.org/wiki/Kanontafel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Unchurch.jpg","page_title":"Kanontafel","context_page_description":"Als Kanontafel bezeichnet man einen liturgischen Gegenstand in der römisch-katholischen Kirche, der bis zur Liturgiereform von 1969 zur Ausstattung eines Altars zur Feier der heiligen Messe im römischen Ritus gehörte. Die Kanontafeln enthalten in jeder heiligen Messe vom Zelebranten zu singende oder sprechende Texte. In der außerordentlichen Form des römischen Ritus sind die Tafeln weiterhin in Gebrauch."},{"page_url":"https://it.wikipedia.org/wiki/Louise_Colet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Grasset_Colet_Henriette.png","page_title":"Louise Colet","context_page_description":"Louise Colet, pseudonimo di Louise Révoil, è stata una poetessa francese."},{"page_url":"https://sk.wikipedia.org/wiki/Chy%C5%88ava","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Chynava-sv._Prokop.jpg","page_title":"Chyňava","context_page_description":"Chyňava je obec v Česku v okrese Beroun v Stredočeskom kraji. 1. januára 2012 tu žilo 1 732 obyvateľov, z toho 853 mužov a 879 žien, pričom priemerný vek v obci bol 41,6 roka."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%BE%D1%81%D0%BF%D0%BE%D1%92%D0%B0_%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D0%B0%D1%80%D0%BA%D0%B0_(%D0%BF%D0%BE%D0%B7%D0%BE%D1%80%D0%B8%D1%88%D0%BD%D0%B0_%D0%BF%D1%80%D0%B5%D0%B4%D1%81%D1%82%D0%B0%D0%B2%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Gospo%C4%91a_Ministarka_006.jpg","page_title":"Госпођа министарка (позоришна представа)","context_page_description":"Госпођа министарка је позоришна представа настала према комедији Бранислава Нушића из 1929. године. Представа је први пут изведена у Народном позоришту 25. маја 1929. године, а главни лик тумачила је Жанка Стокић."},{"page_url":"https://en.wikipedia.org/wiki/Tiber_Island","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Roma_-_Fatebenefratelli.JPG","page_title":"Tiber Island","context_page_description":"The Tiber Island is the only island in the part of the Tiber which runs through Rome. Tiber Island is located in the southern bend of the Tiber.\\nThe island is boat-shaped, approximately 270 metres long and 67 metres wide, and has been connected with bridges to both sides of the river since antiquity. Being a seat of the ancient temple of Asclepius and later a hospital, the island is associated with medicine and healing. The Fatebenefratelli Hospital founded in the 16th century, and the Basilica of St. Bartholomew on the Island dating from the 10th century are located on the island."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Sullivan_County,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Valleau_Tavern%2C_Cochecton%2C_NY.JPG","page_title":"National Register of Historic Places listings in Sullivan County, New York","context_page_description":"List of the National Register of Historic Places listings in Sullivan County, New York\\nThis is intended to be a complete list of properties and districts listed on the National Register of Historic Places in Sullivan County, New York. The locations of National Register properties and districts showing latitude and longitude coordinates may be seen in a map by clicking on \\"Map of all coordinates\\". The Delaware and Hudson Canal, which runs through this and other counties, is further designated a U.S. National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted March 27, 2020."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Fr%C3%A4nkisch-Crumbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Fr%C3%A4nkisch-Crumbach%2C_Hof_Schleiersbach_01.jpg","page_title":"Liste der Kulturdenkmäler in Fränkisch-Crumbach","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Gemeinde Fränkisch-Crumbach, Odenwaldkreis, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Ortsteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung, der vom Landesamt für Denkmalpflege vergebenen Nummer oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde."},{"page_url":"https://de.wikipedia.org/wiki/Knospendeckung","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/EB1911_Flower_-_diagram_-_Urtica_male_flower.jpg","page_title":"Knospendeckung","context_page_description":"Die Knospendeckung, auch Ästivation oder Präfloration beschreibt die Stellung der jungen Kron- und Kelchblätter in der Blütenknospe oder die von jungen Blättern in der Blattknospe. Die Knospendeckung kann bei Kelch- und Kronblättern auch unterschiedlich sein. Auch können bei mehr als fünf Kelch-, Kron- bzw. Perigonblättern zwei unterschiedliche Kreise ausgebildet sein und eine zusammengesetzte Deckung entsteht, wie z. B. bei Jeffersonia diphylla mit acht Petalen, hier ist der innere Kreis dreizählig-deckend und der äußere verdreht-deckend.\\nImbricat: Ein Teil der Blätter überdeckt beide Nachbarn, ein Teil nur einen. Es kann hier eine Rechts- oder Linksdrehung vorkommen. Hier gibt es nun mehrere Varianten:\\nWenn der Organkreis nur zweiteilig ist überlappen sich jeweils die beiden Enden beider zweizeilig angeordneten Organe. Ist er dreiteilig steht ein Organ außen und eines innen. Ist es vierteilig dann kann das innerste Organ an das Äußerste proximal anschließen oder das Innerste kann durch andere Organe vom Äußersten getrennt sein, es steht also hier distal. Auch ist eine alternierende Deckung möglich wie bei den Kreuzblütlern."},{"page_url":"https://en.wikipedia.org/wiki/Flood_mitigation","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Maprawcliffe.jpg","page_title":"Flood mitigation","context_page_description":"In environmental engineering, the flood mitigation involves the management and control of flood water movement, such as redirecting flood run-off through the use of floodwalls and flood gates, rather than trying to prevent floods altogether. It also involves the management of people, through measures such as evacuation and dry/wet proofing properties. The prevention and mitigation of flooding can be studied on three levels: on individual properties, small communities, and whole towns or cities. The costs of protection rise as more people and property are protected. The US FEMA, for example, estimates that for every $1.00 spent on mitigation, $4.00 is saved."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%84%D8%A8%D8%B1%D8%B4%D8%AA_%D8%B4%D9%88%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Bundesarchiv_B_145_Bild-F088115-0001%2C_Albrecht_Sch%C3%B6ne.jpg","page_title":"آلبرشت شوون","context_page_description":"آلبرشت شوون استاد دانشگاه اهل آلمان است."},{"page_url":"https://sv.wikipedia.org/wiki/Lars_G%C3%B6sta_H%C3%A4ggl%C3%B6f","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Bishop-Manfred-Bjorqvist-visit-Svea-Air-Wing-in-Barkarby-391752853444.jpg","page_title":"Lars Gösta Hägglöf","context_page_description":"Lars Gösta Hägglöf, född 10 augusti 1897 på Lidingö, död 10 november 1954 i Stockholm, var en svensk militär."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%82_%D8%AB%D8%A4%D9%84%D9%88%D9%84%D9%8A_%D8%A7%D9%84%D8%B1%D8%A3%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Phrictus_quinquepartitus_%28Puerto_Viejo%2C_CR%29.jpg","page_title":"بق ثؤلولي الرأس","context_page_description":"بق ثؤلولي الرأس أو بق ذو رأس التنين، حشرة تنتمي إلى فصيلة ذباب الفانوس.وصفت من قبل عالم الحشرات الإنجليزي وليام لوكاس ديستانت في عام 1883. توجد في كوستاريكا وبنما وكولومبيا وأجزاء من البرازيل.\\nيبلغ متوسط طولها 5.5 سم. وهي حشرة مجنحة ذات خطوط أمامية ملونة بألوان زاهية مع علامات مميزة. قوتها عصارة الأشجار."},{"page_url":"https://es.wikipedia.org/wiki/Edad_de_Hierro_en_Emiratos_%C3%81rabes_Unidos","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Iron_Age_Petroglyph_-_Sharjah.jpg","page_title":"Edad de Hierro en Emiratos Árabes Unidos","context_page_description":"La Edad de Hierro en Emiratos Árabes Unidos albergó tres períodos distintos de la Edad del Hierro. La Edad de Hierro I abarcó del 1.200 al 1.000 a. e. c., la Edad de Hierro II del 1.000 al 600 a. e. c., y la Edad de Hierro III del 600 al 300 a. e. c. A este período de desarrollo humano en la región le siguió la era mleiha o preislámica tardía, desde el año 300 a.C. en adelante hasta la era islámica, que comenzó con la culminación de las guerras Ridda del siglo VII.\\nHasta cierto punto, el término «Edad de Hierro» se aplica incorrectamente, ya que existen pocas pruebas de cualquier trabajo de hierro indígena fuera de los hallazgos en Muwailah, que se cree que son importaciones, ​ e incluso la amplia evidencia de fundición a lo largo de la Edad del Hierro encontrada en Saruq Al Hadid está dominada por la producción de cobre y estaño.​\\nLos hallazgos del importante sitio de Tell Abraq en Umm al-Qaywayn han sido cruciales en la división de los tres períodos de la Edad de Hierro en los Emiratos Árabes Unidos.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%BC%D0%B0%D0%B4%D0%B0,_%D0%98%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Monument_dedicat_%E2%80%9Deroului_de_la_Cire%C8%99oaia%E2%80%9D_Ion_Gr%C4%83mad%C4%83.jpg","page_title":"Грамада, Ион","context_page_description":"Ион Грамада — румынский журналист, прозаик, публицист, историк, педагог, доктор наук."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%A3%E5%8D%A2_(%E6%B1%9D%E6%8B%89%E7%9C%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Map_commune_FR_insee_code_39490.png","page_title":"圣卢 (汝拉省)","context_page_description":"聖盧是法國汝拉省的一個市鎮，位於該省西北部，屬於多勒區。該市鎮總面積9.58平方公里，2009年時的人口為277人。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%9E%D7%99_%D7%A8%D7%95%D7%93%D7%A0%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Hemi-rodner.jpg","page_title":"חמי רודנר","context_page_description":"חיים רוּדנר הוא זמר-יוצר ומוזיקאי ישראלי.\\nרודנר התפרסם לראשונה כסולנה של להקת הרוק המצליחה \\"איפה הילד?\\", ומאוחר יותר פיתח גם קריירת סולו."},{"page_url":"https://oc.wikipedia.org/wiki/Loos-en-Gohelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Loos-en-Gohelle_-_Terrils_n%C2%B0_74%2C_74A_et_74B%2C_11_-_19_de_Lens_Est%2C_Ouest_et_Nouveau_%28047%29.JPG","page_title":"Loos-en-Gohelle","context_page_description":"Loos-en-Gohelle es una comuna francesa, situada dins lo departament del Pas de Calais e la region del Nòrd-Pas de Calais."},{"page_url":"https://ca.wikipedia.org/wiki/Solana_dels_Botants","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Abella_de_la_Conca._Solana_dels_Botants.svg","page_title":"Solana dels Botants","context_page_description":"La Solana dels Botants, és una solana del terme municipal d'Abella de la Conca, a la comarca del Pallars Jussà.\\nÉs a la dreta -nord- de la vall del barranc de Fonguera, al nord-est de l'Obaga de Fonguera, situada davant per davant a l'altra riba del barranc. És al sud-est de la vila d'Abella de la Conca, a prop i al nord-oest del Coll de Faidella. Forma part de la Solana de Fonguera, a la partida rural de Fonguera. Es tracta de la part solana del lloc on es formen diversos botants."},{"page_url":"https://hu.wikipedia.org/wiki/Kromatogr%C3%A1fia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Chromatography_of_chlorophyll_-_Step_7.jpg","page_title":"Kromatográfia","context_page_description":"A kromatográfia, amely a görög χρώμα: khróma, szín és γραφειν: graphein írni szavak összetétele, egy keverékek elválasztására használatos laboratóriumi módszercsalád neve.\\nA technika lényege egy az ún. mozgó fázisban más néven eluensben oldott keveréknek egy álló fázison való áthajtása, melynek során a vizsgálandó anyag elválik az elegyben található további molekuláktól.\\nA módszert két alapvető célra használjuk:\\npreparatív vagy\\nanalitikai.\\nA preparatív kromatográfiában az elválasztott vegyületek további feldolgozása a végső cél, azaz egy tisztítási műveletről beszélhetünk. Az analitikai kromatográfia általában kisebb anyagmennyiségekkel dolgozik és célja az analit relatív arányának meghatározása a keverékben. A két cél nem zárja ki egymást."},{"page_url":"https://en.wikipedia.org/wiki/Printing_plant_of_Ogonyok_magazine","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/EL-LISSITZKY-7.JPG","page_title":"Printing plant of Ogonyok magazine","context_page_description":"The Printing plant of Ogonyok magazine designed by El Lissitzky is likely to be the only extant building based on the blueprints of this master. Located at 55.777277°N 37.610828°E 17, 1st Samotechny Lane, it is Lissitzky's sole tangible work of architecture. It was commissioned in 1932 by Ogonyok magazine to be used as a print shop. In June 2007 the independent Russky Avangard foundation filed a request to list the building on the heritage register. In September 2007 the city commission approved the request and passed it to the city government for a final approval, which happened in August 2008. In October 2008, the abandoned building was badly damaged by fire.\\nNext door, a developer Inteco has started\\npreparations for construction of a new block of flats for the Film-Makers' Union.\\nIn 2012, its statues was upgraded to regional landmark, and it was announced that the building would be restored and become part of a hotel complex. Works since then have involved extensive alteration rather than restoration."},{"page_url":"https://en.wikipedia.org/wiki/Jerkins-Duffy_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Jerkins-Duffy_House.JPG","page_title":"Jerkins-Duffy House","context_page_description":"Jerkins-Duffy House, also known as the Clarence B. Beasley House, is a historic home located at New Bern, Craven County, North Carolina. It was built about 1833, and is a 2 1/2-story, three bay, side-hall plan, transitional Federal / Greek Revival style frame dwelling. It has an engaged, full-width two-story rear gallery and one-story wings. It sits on a high brick foundation.\\nIt was listed on the National Register of Historic Places in 1988."},{"page_url":"https://it.wikipedia.org/wiki/Bad_Leonfelden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Bad_Leonfelden_im_Bezirk_UU.png","page_title":"Bad Leonfelden","context_page_description":"Bad Leonfelden è un comune austriaco di 4 210 abitanti nel distretto di Urfahr-Umgebung, in Alta Austria; ha lo status di città."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%88%D8%AE%D9%88-%DB%B2%DB%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Sukhoi_Su-24_inflight_Mishin.jpg","page_title":"سوخو-۲۴","context_page_description":"سوخو-۲۴ نام‌گذاری ناتو: فنسر یک جنگنده ضربتی مافوق صوت، دو کابینه، بال‌متغیر و دوموتوره ساخت شرکت سوخو است. این هواپیما که نخستین سیستم ناوبری و حمله دیجیتال شوروی را در خود داشت نخستین پرواز خود را در سال ۱۹۷۰ انجام داده و از سال ۱۹۷۴ وارد ارتش شوروی شد و هم‌اکنون نیز در ارتش‌های روسیه، اوکراین، قزاقستان، الجزایر، سودان، سوریه و ایران در حال خدمت است. البته نیروی هوایی روسیه در حال جایگزینی تدریجی این هواپیما با جنگنده بمب‌افکن سوخو-۳۴ است.حدود ۱۴۰۰ فروند از این هواپیما تا سال ۱۹۹۳ تولید شد.\\nسوخو-۲۴ که پاسخ روس‌ها به جنگنده بمب‌افکن اف-۱۱۱ آمریکایی‌ها بود، اختصاصاً برای حملات ارتفاع پایین مافوق صوت به عمق خاک دشمن طراحی شده و طراحی بال متحرک آن باعث شده تا قابلیت فرود و برخاست کوتاه را داشته‌باشد. بارگیری بال بالای این هواپیما نیز باعث شده تا پرواز باثباتی در ارتفاع پایین و مقاومت خوبی در مقابل جریان باد داشته‌باشد. این هواپیما با وزن خالی بیش از ۲۲ تن توانایی حمل ۸ تن مهمات از جمله بمب‌های هسته‌ای تاکتیکی، و دیگر انواع بمب و موشک و راکت و سوخت اضافی را دارد."},{"page_url":"https://de.wikipedia.org/wiki/Northrop_YB-35","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Airshowfan-dot-com--by-Bernardo-Malfitano--Image-of-N9M-at-Chino-Airshow.jpg","page_title":"Northrop YB-35","context_page_description":"Die Northrop YB-35 war ein US-amerikanischer schwerer Bomber in Nurflügel-Bauweise. Das Experimentalflugzeug wurde während und kurz nach dem Zweiten Weltkrieg für die damalige United States Army Air Forces entwickelt. Das Höhenleitwerk ist bei dieser Bauweise in die Tragfläche integriert. Obwohl nur Prototypen und Vorserienmaschinen gebaut wurden, blieb das Interesse an Nurflüglern stark und es wurde noch vor dem Erstflug beschlossen, drei der Flugzeuge zu Strahlflugzeugen Northrop YB-49 umzubauen; eine spätere Bestellung von RB-49-Aufklärungsflugzeugen wurde wegen technischer Bedenken jedoch storniert. Erst Jahrzehnte später verwirklichte die Northrop Corporation mit der Northrop B-2 die Nurflüglertechnologie im Serienbau."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Polk_County_(Iowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/The_Mary_A._and_Caleb_D._Scott_House.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Polk County (Iowa)","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Polk County in Iowa führt die Bauwerke und historischen Stätten im Polk County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://eo.wikipedia.org/wiki/Gascones","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Torre_de_iglesia_en_Gascones.jpg","page_title":"Gascones","context_page_description":"Gascones estas municipio de Hispanio. Ĝi apartenas al la komarko Norda Montaro de la Madrida Regiono kaj etendiĝas sur 20,04 kvadrataj kilometroj. Fine de 2019 en la komunumo vivis 193 loĝantoj."},{"page_url":"https://de.wikipedia.org/wiki/Earthquake_(Lied)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Labrinth1.jpg","page_title":"Earthquake (Lied)","context_page_description":"Earthquake ist ein Lied des britischen R&B- und Hip-Hop-Sängers Labrinth, das er zusammen mit dem Rapper Tinie Tempah in den Syndrome Studios in Los Angeles aufnahm. Die Musik stammt von Labrinth, am Text schrieb Tempah mit. Der Song ist auf dem Album Electronic Earth enthalten. Erstmals erhältlich war Earthquake am 23. Oktober 2011 bei iTunes und gelangte unter anderem in Australien, Belgien und dem Vereinigten Königreich in die Charts. In Neuseeland, Norwegen und Australien erreichte die Single Platin-Status."},{"page_url":"https://nl.wikipedia.org/wiki/Concordia_(Noord-Kaap)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/NCC_Pioneer_0-4-0ST_b.jpg","page_title":"Concordia (Noord-Kaap)","context_page_description":"Concordia is een dorp gelegen in de gemeente Nama Khoi in het Namakwaland in de Zuid-Afrikaanse provincie Noord-Kaap. Het ligt 19 km noordoostelijk van Springbok. De afstand naar Kaapstad bedraagt ongeveer 600 km. Het is gesticht in de vroege 19e eeuw als zendingsnederzetting en heeft zich later, na de ontdekking van kopererts, ontwikkeld tot mijnstadje."},{"page_url":"https://ceb.wikipedia.org/wiki/Malinta_(lungsod_sa_Tinipong_Bansa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/OHMap-doton-Malinta.png","page_title":"Malinta (lungsod sa Tinipong Bansa)","context_page_description":"Lungsod ang Malinta sa Tinipong Bansa. Ang Malinta nahimutang sa kondado sa Henry County ug estado sa Ohio, sa sidlakang bahin sa nasod, 600 km sa kasadpan sa ulohang dakbayan Washington, D.C. 209 metros ibabaw sa dagat kahaboga ang nahimutangan sa Malinta, ug adunay 265 ka molupyo.\\nAng yuta palibot sa Malinta kay daghan kaayong patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 224 ka metro ug 14.1 km sa habagatan sa Malinta. Dunay mga 22 ka tawo kada kilometro kwadrado sa palibot sa Malinta medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Napoleon, 10.6 km sa amihanan-kasadpan sa Malinta. Hapit nalukop sa kaumahan ang palibot sa Malinta. Sa rehiyon palibot sa Malinta, mga kanal talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Enero, sa -7 °C. Ang kasarangang pag-ulan 1,084 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 125 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 48 milimetro."},{"page_url":"https://fr.wikipedia.org/wiki/Maison_de_Lestrade","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Viviers_-_Maison_de_Lestrade_-2.jpg","page_title":"Maison de Lestrade","context_page_description":"L’hôtel de Lestrade ou maison de Lestrade ou encore maison Mompar est une demeure médiévale située à Viviers. Elle se trouve dans la ville basse sur la place de la République, ancienne place du Marché, que bordent deux autres édifices remarquables : la maison Faugergues et la maison Montargues. Cet hôtel a été la mairie de Viviers pendant près de deux siècles, de 1767 à 1947."},{"page_url":"https://pl.wikipedia.org/wiki/Elektronarz%C4%99dzia","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Maxwerx_MX600_%28Nemo5576%29.jpg","page_title":"Elektronarzędzia","context_page_description":"Elektronarzędzia są to narzędzia zasilane prądem elektrycznym, najczęściej o napięciu 230 V. Ułatwiają prace, których wykonywanie narzędziami ręcznymi byłoby uciążliwe, czasochłonne lub niewygodne. Obecnie coraz częściej zasilane są akumulatorowo."},{"page_url":"https://en.wikipedia.org/wiki/Edward_Perowne","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Edward_Perowne_by_Rudolf_Lehmann.jpg","page_title":"Edward Perowne","context_page_description":"Edward Henry Perowne was an English clergyman and college head, Master of Corpus Christi College, Cambridge."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%90%D0%BD%D0%B0_%D0%BC%D0%B5%D1%88%D1%96%D1%82%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Mother_Mosque_of_America_Cedar_Rapids_IA_pic3.JPG","page_title":"Ана мешіті","context_page_description":"Америкадағы Ана мешіті - Құрама Штаттардағы ең ескі, арнайы салынғаң мұсылмандардың құлшылық ететін үйі. АҚШ Бірінші дүниежүзілік соғыс және Ұлы дағдарыстан шыға алмай жатқанда Седар Рапидс қаласындағы мұсылман әулеттері біріге жұмылып, ұйымдасқан түрде құлшылық ететін орын салуға кіріскен. Мешіттің құрылысы 1934 жылы аяқталды.\\nЕң алғаш құрылысы біткенде мешіттің сырт көрінісі екі қабатты мектеп ғимараты немесе ауыл шіркеуі сияқты болды. Оның кіреберісіндегі кішкентай жасыл күмбезінен басқа ислам сәулет өнеріне тән ешқандай белгілері болған жоқ. Тек тақтайшадағы ағылшынша және арабша жазылған сөздер ғана құрылыстың мұсылмандардың құлшылық ету үйі екенін білдіріп тұрды. Бірінші қабат тек қана дұға қылу мақсатында қолданылды, ал екінші қабат әлеуметтік мақсаттарда пайдаланылды.\\nӨзіндік ерекшелігі бар Америкадағы Ана мешіті тек қана мешіт емес, мәдени және тарихи орталық болып қалды. Мешіт 1996 жылы Ұлттық мәдени орындардың тізіміне енді. Америкадағы Ана мешіті - Құрама Штаттарда салынған алғашқы мұсылман мешіті. Ол Айова штатының тарихи ескерткіштер тізіміне және тарихи орындардың ұлттық тізіміне енгізілген."},{"page_url":"https://pt.wikipedia.org/wiki/%C3%93pera_de_S%C3%A3o_Francisco","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/War_Memorial_Opera_House_auditorium_wall.jpg","page_title":"Ópera de São Francisco","context_page_description":"A Ópera de São Francisco também conhecida pela sigla SFO é a segunda maior companhia de ópera da América do Norte, perdendo apenas para o Metropolitan Opera em Nova Iorque. A SFO foi fundada em 1923 por Gaetano Merola. A Noite de Abertura de Gala da SFO é amplamente considerada como o mais memorável evento do ano para os apreciadores de ópera."},{"page_url":"https://az.wikipedia.org/wiki/Ferdinand_Barbedinni","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Ferdinand_Barbedienne_-_Greyhound_-_Walters_27475_-_Profile.jpg","page_title":"Ferdinand Barbedinni","context_page_description":"Ferdinand Barbedinni — fransız karxanaçı və dəmirçi. Bürüncdən hazırladığı əsərləri ilə məşhurdur. Barbedinni Aşil Kolla ilə birlikdə heykəllərin nüsxələrini yaradan firma yaratmışdır. Firma 1200-ə qədər əsərin nüsxəsini yarada bilmişdi."},{"page_url":"https://cs.wikipedia.org/wiki/Vlasteneck%C3%A9_sdru%C5%BEen%C3%AD_%C4%8D%C3%ADnsk%C3%BDch_katol%C3%ADk%C5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/St._Joseph%27s_Cathedral%2C_Beijing.JPG","page_title":"Vlastenecké sdružení čínských katolíků","context_page_description":"Vlastenecké sdružení čínských katolíků je organizace v Čínské lidové republice založená v roce 1957 Státním úřadem pro náboženské záležitosti za účelem vládní kontroly římskokatolické církve na svém území. Svatý stolec se k činnosti sdružení staví odmítavě a nesouhlasí s jeho vměšováním do záležitostí, které považuje za svou výhradní kompetenci, čínská vláda naopak odmítá řízení církve ze zahraničí. Papež Pius XII. ve své encyklice Ad Apostolorum Principis z 29. července 1958 odsoudil spolupráci katolíků ze sdružení s režimem a zejména svévolné „demokratické“ volby a následná svěcení nových biskupů, které mají pro svoji schizmatickou povahu za důsledek exkomunikaci světících i svěcených – přímému označení situace za schizma se ovšem Pius XII. i jeho nástupci vyhýbali.\\nPapež Benedikt XVI. se v dopise čínským katolíkům v roce 2007 zmiňuje, že žádoucím řešením situace je žádost biskupů vysvěcených bez papežského mandátu o dodatečné schválení a nalezení jednoty v rámci římskokatolické církve.\\nSdružení neuznává jako autoritativní žádná rozhodnutí Vatikánu učiněná po roce 1949, tedy například ani Druhý vatikánský koncil nebo katechismus katolické církve z roku 1992."},{"page_url":"https://uz.wikipedia.org/wiki/Levet","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Map_commune_FR_insee_code_18126.png","page_title":"Levet","context_page_description":"Levet Fransiyaning Centre mintaqasida joylashgan kommunadir. Cher departamenti Bourges tumani tarkibiga kiradi."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D1%83%D0%B5%D0%BD%D1%81%D0%BA%D0%B8_%D0%BC%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D0%B8%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/RuenMonasteryGate.jpg","page_title":"Руенски манастир","context_page_description":"Руенският манастир „Свети Йоан Рилски“ е български православен манастир, част от архиерейско наместничество Дупница на Софийска епархия на Българска православна църква. Разположен е в близост до село Скрино, община Бобошево, област Кюстендил."},{"page_url":"https://en.wikipedia.org/wiki/Rouen_Business_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Esc_rouen.jpg","page_title":"Rouen Business School","context_page_description":"The Rouen Business School was a leading French business school.\\nIt was founded in 1871 and on 24 April 2013, Rouen Business School and Reims Management School announced the merger of the two Schools into a single entity - NEOMA Business School.\\nRouen Business School's quality is recognised by its \\"triple-crown\\" accreditations and its Financial Times' ranking 13th position best European Master in Management. The Financial Times also highlights the particular quality of the education it provides in finance, ranking the \\"Grande Ecole\\" program 8th best in Europe and 4th best in France."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%8D%E5%8F%AF%E8%83%BD%E3%81%AA%E8%89%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Cones_SMJ2_E.svg","page_title":"不可能な色","context_page_description":"不可能な色は、通常色覚と定義づけられるような、様々な波長と強度の可視光線の組み合わせからなる光によって知覚されるような色ではないものの、ある条件下で見ることが可能な想定上の色である。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%96%B0%E5%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/ShinjukuEastside01.jpg","page_title":"新宿","context_page_description":"新宿是位于日本东京的地名，指的是以新宿站为中心的地区，与涩谷、池袋并列为东京3大副都心之一。其大部分区域隶属东京都新宿区管辖。其名称来自于此地昔日甲州街道的宿场町“内藤新宿”。\\n新宿原本为东京市郊，至昭和年间才成为东京市中心的一部分，并随着新宿站的转运机能逐渐提升，而与丸之内、日本桥等山手线东侧商圈并列为东京主要的中心商务区之一。时至今日，新宿站西口的西新宿是日本少有的摩天大楼集中区，聚集了大量的企业总部和政府机关，东京都厅舍即位于此；另一方面，位于新宿站东口的新宿二丁目与大阪的堂山町并列为日本最大的同志村，歌舞伎町则是日本少数的大型红灯区之一。"},{"page_url":"https://pl.wikipedia.org/wiki/Kwas_azotowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Nitric-acid-resonance-A.png","page_title":"Kwas azotowy","context_page_description":"Kwas azotowy, HNO\\n3 – nieorganiczny związek chemiczny, jeden z najsilniejszych kwasów tlenowych. Resztą kwasową jest w nim grupa azotanowa zawierająca azot na V stopniu utlenienia."},{"page_url":"https://en.wikipedia.org/wiki/Brecon_and_Radnorshire_(Senedd_Cymru_constituency)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Kirsty_Williams_2011.jpg","page_title":"Brecon and Radnorshire (Senedd Cymru constituency)","context_page_description":"Brecon and Radnorshire is a constituency of the Senedd. It elects one Member of the Senedd by the first past the post method of election. Also, however, it is one of eight constituencies in the Mid and West Wales electoral region, which elects four additional members, in addition to eight constituency members, to produce a degree of proportional representation for the region as a whole. It is currently represented by Kirsty Williams AM, of the Liberal Democrats who has been the AM since 1999. She is also the current Minister for Education and Skills in the Welsh Government."},{"page_url":"https://ro.wikipedia.org/wiki/Istoria_uman%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Fokker_Dr1_replica.JPG","page_title":"Istoria umană","context_page_description":"Istoria lumii reprezintă memoria experienței din trecut a lui Homo sapiens, până în zilele noastre, de pe întreaga planetă, păstrată în vestigii arheologice, documente scrise sau în memoria individuală/colectivă.\\nOriginea omului rămâne încă necunoscută, fiind subiect a numeroase controverse istorice, filozofice sau religioase. Încă din zorii apariției Omului, istoria omului primitiv este marcată de o lungă perioadă de invenții. Una dintre cele mai vechi invenții o constitutie scrisul, care a creat infrastructura menținerii și transmiterii informațiilor, a cunoștințelor umane și comunicarea acestora la mari distanțe. Societatea complexă la care s-a ajuns astăzi nu ar fi fost posibilă fără artă scrisului.\\nIstoria lumii este marcată de o serie de descoperiri și invenții, de mișcări sociale și revoluții, reprezentând salturi calitative ce deschid noi ere și epoci. Un astfel de salt îl constituie Revoluția Agrară. Între anii 8.500 și 7.000 î.Hr., în acel Corn al Abundenței din zona Mesopotamiei, Feniciei și Egiptului Antic, oamenii au început o sistematică îmblânzire a animalelor și cultivare a plantelor: agricultura."},{"page_url":"https://pl.wikipedia.org/wiki/Edo_(miasto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Karte_Tokia_MKL1888.png","page_title":"Edo (miasto)","context_page_description":"Edo – dawna nazwa obecnej stolicy Japonii Tokio, położonej w regionie Kantō na wyspie Honsiu. Ze względu na usytuowanie u ujścia rzeki Sumidy do zatoki zwanej obecnie Zatoką Tokijską, nazwa Edo jest tłumaczona jako „brama” na „zatokę”.\\nEdo było siedzibą siogunów Tokugawa i faktyczną stolicą kraju w okresie 1603–1868. W 1868, gdy siogunat zakończył swoje polityczne istnienie, cesarz Meiji, mający odtąd sprawować faktyczną władzę, przeniósł się z Kioto do Edo i nakazał zmianę nazwy miasta na Tokio, czyli „Wschodnią Stolicę”."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D9%85%D8%A7%D8%B1_%D8%A7%D9%88%D8%AF%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/OdomWizards.jpg","page_title":"لمار اودم","context_page_description":"لامار جوزف اودم زادهٔ ۶ نوامبر ۱۹۷۹ بسکتبالیست مطرح آمریکایی، در پست‌های فروارد قدرتی و فروارد کوچک برای تیم لس آنجلس کلیپرز بازی می‌کند.\\nاین ملی‌پوش تیم ملی بسکتبال مردان آمریکا دوست پسر کلویی کارداشیان بود و حتی صحبت از ازدواج با وی را نیز پیش کشید."},{"page_url":"https://en.wikipedia.org/wiki/Alfred_Cheney_Johnston","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Mary_Pickford-Ziegfeld.jpg","page_title":"Alfred Cheney Johnston","context_page_description":"Alfred Cheney Johnston was a New York City-based photographer known for his portraits of Ziegfeld Follies showgirls as well as of actors and actresses from the worlds of stage and film."},{"page_url":"https://pl.wikipedia.org/wiki/9K33_Osa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Osa-AKM_9M33M3.jpg","page_title":"9K33 Osa","context_page_description":"PRWB OSA – samobieżny przeciwlotniczy zestaw rakietowy „OSA-AK” to pojazd służący do zwalczania celów powietrznych w każdych warunkach atmosferycznych.\\nZestaw jest wyposażony w system REGA 2 umożliwiający dowiązanie topograficzne położenia własnego za pomocą systemu GPS, dokładne zobrazowanie pełnej sytuacji w powietrzu przesyłanej od jednostki nadrzędnej oraz przesyłanie meldunków do dowódcy baterii. Posiada też możliwość automatycznego przydziału celów dla dowódcy PRWB."},{"page_url":"https://pl.wikipedia.org/wiki/Historyczne_pojazdy_Komunikacji_Miejskiej_w_Krakowie","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Konstal_105NT.JPG","page_title":"Historyczne pojazdy Komunikacji Miejskiej w Krakowie","context_page_description":"Historyczne pojazdy komunikacji miejskiej w Krakowie – zbiór zabytkowych tramwajów, autobusów oraz pojazdów zaplecza technicznego, które służyły dawniej w obsłudze komunikacji miejskiej w Krakowie. Obejmuje ona pojazdy posiadane przez MPK S.A. w Krakowie oraz Muzeum Inżynierii Miejskiej."},{"page_url":"https://en.wikipedia.org/wiki/Saint_John_Abbey,_M%C3%BCstair","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Kreuzkapelle.JPG","page_title":"Saint John Abbey, Müstair","context_page_description":"The Abbey of Saint John is an ancient Benedictine monastery in the Swiss municipality of Val Müstair, in the Canton of Graubünden. By reason of its exceptionally well-preserved heritage of Carolingian art, it has been a UNESCO World Heritage Site since 1983."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E5%BA%84%E5%9C%B0%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/2016_0429_Amagasaki_Southern_Police_West.jpg","page_title":"大庄地区","context_page_description":"大庄地区は、兵庫県尼崎市の南西部、旧武庫郡大庄村に属する地区の名称である。西立花町、武庫川町、道意町、崇徳院、蓬川町、浜田町、大庄北、大島、大庄中通、大庄西町、稲葉元町、稲葉荘、中浜町、元浜町などが含まれる。"},{"page_url":"https://fr.wikipedia.org/wiki/Mary_Poppins_(film,_1964)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/New_Amsterdam_Theatre_Mary_Poppins_2007_NYC.jpg","page_title":"Mary Poppins (film, 1964)","context_page_description":"Mary Poppins est un film musical américain de Robert Stevenson adapté du roman éponyme de Pamela L. Travers et sorti en 1964. Mêlant prises de vues réelles et animation, il est considéré comme le 23ᵉ long métrage d'animation des studios Disney.\\nAprès une longue période de tractations entre Walt Disney et Pamela L. Travers pour obtenir les droits d'adaptation, la production du film commence en 1960 pour s'achever en 1964. Cette période fait l'objet d'un long métrage de fiction, Dans l'ombre de Mary réalisé par John Lee Hancock, sorti en 2013 avec Tom Hanks dans le rôle de Walt Disney. Révélant le talent de Julie Andrews et confirmant celui de Dick Van Dyke, Mary Poppins est l'une des productions Disney les plus chaleureusement accueillies par le public et la presse, remportant de nombreux prix, bien que certains spécialistes estiment que sa forme rappelle plus les années 1940 que le milieu des années 1960."},{"page_url":"https://de.wikipedia.org/wiki/Araber","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Arabic_Dispersion.svg","page_title":"Araber","context_page_description":"Die Araber sind eine semitischsprachige Ethnie auf der Arabischen Halbinsel und in Nordafrika, die überwiegend in den arabischen Ländern beheimatet ist. Als nicht-autochthone Gemeinden leben Araber zudem in der Diaspora in vielen Ländern der Welt, überwiegend in Süd- und Nordamerika sowie Europa, vor allem in Brasilien, Argentinien, Frankreich und in den Vereinigten Staaten.\\nNachdem die Definition in unterschiedlichen Kulturen und Zeiten stark voneinander abweicht, ist eine eindeutige Zuweisung nur im entsprechenden Kontext möglich. Für Araber gelten Fremde, die nicht korrekt Arabisch sprechen, als ʿAdscham. Nicht zu den Arabern gezählt werden Ethnien wie Berber, Somali, Kurden, Turkmenen, Suryoye, Habescha sowie andere, die in arabischen Ländern leben. Viele von ihnen beherrschen Arabisch als Zweitsprache."},{"page_url":"https://es.wikipedia.org/wiki/Uniforme_del_Club_Atl%C3%A9tico_Boca_Juniors","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/2005_Xentenario.jpg","page_title":"Uniforme del Club Atlético Boca Juniors","context_page_description":"El uniforme del Club Atlético Boca Juniors se compone de una camiseta y un pantalón de color azul, con una franja horizontal amarilla en el medio de la camiseta. Los colores empleados se inspiraron, supuestamente, en los colores de la bandera de Suecia. A falta de un uniforme definitivo, en 1907, el presidente del club en ese entonces, Juan Brichetto, decidió que se utilizarían los colores de la bandera del primer barco que pasase por el puerto de La Boca, la cual resultó ser de Suecia, aunque la franja horizontal se comenzó a usar a partir de 1912.\\nSin embargo, no todas las camisetas han sido iguales, ya que a lo largo de la historia ha variado el tono de azul o de amarillo usado, como también el recorrido de la franja. De igual forma se le han agregado ciertos detalles a la camiseta, tanto blancos como amarillos."},{"page_url":"https://ca.wikipedia.org/wiki/Patrons_mim%C3%A8tics_de_les_Waffen-SS","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/SS_Platanenmuster_Sommer.jpg","page_title":"Patrons mimètics de les Waffen-SS","context_page_description":"Els patrons mimètics de les Waffen-SS són els creats per aquesta mateixa organització nazi per al seu ús privatiu i usats, efectivament, de forma massiva. Es tracta de patrons clapejats multicolors i molt diversos, però que presenten un marcat aire de família entre si. Per comunitat d'origen i per similitud estilística es poden classificar com a grup Waffen-SS de la família clapejada.\\nNo foren, emperò, els únics patrons mimètics emprats per les Waffen-SS.\\nL'estudi d'aquests patrons és matèria complexa, i molt prolixa; el present article es limita a oferir-hi una introducció general."},{"page_url":"https://en.wikipedia.org/wiki/Presidential_Advisory_Council_on_HIV/AIDS","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Robert_A._Schwartz.jpg","page_title":"Presidential Advisory Council on HIV/AIDS","context_page_description":"The Presidential Advisory Council on HIV/AIDS advises the White House and the Secretary of Health and Human Services on the US government's response to the AIDS epidemic. The commission was formed by President Bill Clinton in 1995 and each president since has renewed the Council's charter.\\nSix members resigned in protest of President Donald Trump's health policies in June 2017, and the remaining ten members were dismissed by Trump on 28 December 2017. While PACHA did not meet in 2018, it was restaffed in 2019 and reconvened in March, June, and October 2019."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%88%D9%8A%D9%86%D8%AA%D8%A7%D9%86%D8%A7_(%D9%85%D8%AD%D8%B7%D8%A9_%D9%85%D8%AA%D8%B1%D9%88_%D8%A3%D9%86%D9%81%D8%A7%D9%82_%D9%85%D8%AF%D8%B1%D9%8A%D8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Metro_Madrid-Quintana.jpg","page_title":"كوينتانا (محطة مترو أنفاق مدريد)","context_page_description":"كوينتانا ‏ هي محطة مترو أنفاق في مدريد في إسبانيا، تقع على الخط رقم 5."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Hoboken","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Antwerpen_Steynstraat_140_-_277319_-_onroerenderfgoed.jpg","page_title":"Lijst van onroerend erfgoed in Hoboken","context_page_description":"Een overzicht van het onroerend erfgoed in het district Hoboken in de gemeente Antwerpen. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%DB%8C%DA%A9%D8%B1%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Vc10.arp.750pix.jpg","page_title":"ویکرز","context_page_description":"ویکرز، شرکت صنایع جنگ‌افزاری و مهندسی مکانیک بریتانیایی بود، که در سال ۱۸۲۸ توسط ادوارد ویکرز راه‌اندازی شد.\\nاین شرکت در حوزه‌هایی چون هوافضا، کشتی‌سازی، فولاد و تولید جنگ‌افزار فعالیت می‌نمود. شرکت ویکرز در سال ۱۹۹۹ توسط کمپانی رولز-رویس پی‌ال‌سی خریداری شد."},{"page_url":"https://en.wikipedia.org/wiki/Beliefs_and_practices_of_The_Church_of_Jesus_Christ_of_Latter-day_Saints","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Phil_and_Marlene.jpg","page_title":"Beliefs and practices of The Church of Jesus Christ of Latter-day Saints","context_page_description":"The Church of Jesus Christ of Latter-day Saints focuses its doctrine and teaching on Jesus Christ; that he was the Son of God, born of Mary, lived a perfect life, performed miracles, bled from every pore in the Garden of Gethsemane, died on the cross, rose on the third day, appeared again to his disciples, and now resides, authoritatively, on the right hand side of God. In brief, some beliefs are in common with Catholics, Orthodox and Protestant traditions. However, teachings of the LDS Church differ significantly in other ways and encompass a broad set of doctrines, so that the above-mentioned denominations usually place the LDS Church outside the bounds of orthodox Christian teaching as summarized in the Nicene Creed.\\nThe church's core beliefs, circa 1842, are summarized in the \\"Articles of Faith\\", and its four primary principles are faith in Jesus Christ, repentance, baptism by immersion for the remission of sin, and the laying on of hands for the Gift of the Holy Ghost."},{"page_url":"https://pl.wikipedia.org/wiki/Shelsley_Beauchamp","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/All_Saints_Church%2C_Shelsley_Beauchamp_-_geograph.org.uk_-_111126.jpg","page_title":"Shelsley Beauchamp","context_page_description":"Shelsley Beauchamp lub Great Shelsley – wieś i civil parish w Anglii, w Worcestershire, w dystrykcie Malvern Hills. W 2011 civil parish liczyła 192 mieszkańców."},{"page_url":"https://pt.wikipedia.org/wiki/Andrey_Harbunow","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Andrey_Gorbunov_%282015%29.jpg","page_title":"Andrey Harbunow","context_page_description":"Andrey Alyaksandrovich Harbunow é um futebolista profissional bielorrusso que atua como goleiro. Atualmente, está sem clube.\\nHarbunow fez sua estreia na seleção nacional do seu país em 30 de março de 2015, no empate de 0 a 0 com o Gabão numa partida amistosa, jogando como titular."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%9B%E0%A4%BF%E0%A4%A8%E0%A5%8D%E0%A4%A6%E0%A4%B5%E0%A4%BF%E0%A4%A8_%E0%A4%A8%E0%A4%A6%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Irrawaddyrivermap.jpg","page_title":"छिन्दविन नदी","context_page_description":"छिंदविन उत्तरी वर्मा के सांगइंग मंडल में बहने वाली नदी है, जो इरावदी की मुख्य सहायक है। यह लगभग 885 किलोमीटर लंबी है। छिंदविन नदी तनाई, ताबान और तारून नदियों के मिलने से बनी है। किंतु इनमें से कौन मुख्य धारा है, यह संदेहास्पद है।\\nइन नदियों के स्रोत हूकांग घाटी के पार्श्ववर्ती पहाड़ों में हैं। मिंजिन नगर के निकट छिंदविन पूर्ववाहिनी हो जाती है, परंतु कुछ ही दूर बाद पुन: दक्षिण-पूर्व की ओर बहने लगती हैं और गानी, अलोन तथा मोनिवा नामक नगरों से होती हुई इरावदी में मिल जाती है। मुहाने से लगभग 322 किलोमीटर दूर किंडार नगर के पास तक नदी वर्ष भर नौपरिवहनीय रहती है ओर बाढ़ की अवस्था में नौकाएँ 209 किलोमीटर ऊपर होमालिन नगर तक चलती हैं।"},{"page_url":"https://eu.wikipedia.org/wiki/Peter_Mullan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/PeterMullan.JPG","page_title":"Peter Mullan","context_page_description":"Peter Mullan eskoziar aktore eta zinema zuzendari bat da. Berak antzeztutako filma ospetsuenen artean honako hauek daude: Riff-Raff, Shallow Grave, Braveheart, Trainspotting, My Name Is Joe eta Harry Potter and the Deathly Hallows – Part 1.\\nBestalde, Donostiako Zinemaldian 2010eko Urrezko Maskorra irabazi zuen Neds filmaren zuzendaria eta gidoigilea ere bada."},{"page_url":"https://es.wikipedia.org/wiki/Hancock_(pueblo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Familyfoundationschool.jpg","page_title":"Hancock (pueblo)","context_page_description":"Hancock es un pueblo ubicado en el condado de Delaware en el estado estadounidense de Nueva York. En el año 2000 tenía una población de 3,449 habitantes y una densidad poblacional de 8.23 personas por km²."},{"page_url":"https://en.wikipedia.org/wiki/David_Stott_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/DavidStottBuilding.jpg","page_title":"David Stott Building","context_page_description":"The David Stott Building is a 38 story high-rise apartment building with office space on floors 2-6 and retail space on the first floor. The \\"Stott\\" was originally built as a class-A office building located at 1150 Griswold Street in Downtown Detroit, Michigan, within the Capitol Park Historic District. It was designed in the Art Deco style by the architectural firm of Donaldson and Meier and completed in 1929. Bedrock Detroit owns and manages the building which began leasing in late 2018 and includes 107 apartment homes and 5 floors of commercial office space."},{"page_url":"https://fr.wikipedia.org/wiki/Louis_Chiron","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Louis_Chiron_vainqueur_du_Grand_Prix_de_l%27ACF_1931%2C_avec_Achille_Varzi_sur_Bugatti_T51.jpg","page_title":"Louis Chiron","context_page_description":"Louis Alexandre Chiron, né le 3 août 1899 à Monaco et mort le 22 juin 1979 dans la même ville, est un pilote automobile monégasque.\\nAux côtés de Tazio Nuvolari, Achille Varzi, Rudolf Caracciola ou Bernd Rosemeyer, Louis Chiron fut l'un des plus glorieux pilotes d'après-guerre. Surnommé le « Vieux Renard », il savait être présent au bon moment pour engranger, une à une, les victoires, et ce durant un quart de siècle. Louis Chiron fut par ailleurs célèbre pour son élégance, liée notamment à son fameux foulard à pois."},{"page_url":"https://de.wikipedia.org/wiki/Nekropole_von_Su_Murrone","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Chiaramonti_-_Necropoli_di_Su_Murrone_%2803%29.JPG","page_title":"Nekropole von Su Murrone","context_page_description":"Die Nekropole von Su Murrone befindet sich am Fuße des Monte Cucullai, etwa acht Kilometer nordöstlich von Chiaramonti in der Region Anglona in der Provinz Sassari auf Sardinien.\\nDie Nekropole liegt in einer Trachytplatte und besteht aus drei mehrzelligen Domus de Janas mit langen Dromoi. Im Vergleich zu vielen anderen Nekropolen der Insel zeigt sie ein abweichendes Aussehen. Es handelt sich nicht um horizontal angelegte Kammern in einer Abrisskante, sondern um eingetiefte Kammern, die über Dromoi erreicht werden. Von der jeweiligen Hauptkammer geht eine Reihe von Seitennischen ab. Am wichtigsten ist Tomba I mit einer kleinen rechteckigen Vorkammer, die in eine Hauptkammer führt, aus der radial sechs Zellen abzweigen. Das Grab zeigt durch rote Farbreste an den Wänden und am Relief der Decke eine Bemalung an. Die Decke imitiert ein Satteldach mit First und 28 Balken.\\nUnter den dekorativen Motiven, bestehend aus Türrahmen und Pilastern, ragen Stierkopfreliefs an den Wänden der Hauptkammer heraus."},{"page_url":"https://la.wikipedia.org/wiki/Lilliana_Sanderson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Lillian_Sanderson%2C_by_Franz_von_Stuck.jpg","page_title":"Lilliana Sanderson","context_page_description":"Lilliana Sanderson fuit cantrix Americana."},{"page_url":"https://fr.wikipedia.org/wiki/Meckhe","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Meckhe_-_Gare.jpg","page_title":"Meckhe","context_page_description":"Meckhe, dite Ngaaÿ, est une ville du nord-ouest du Sénégal, située entre Thiès et Saint-Louis."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D9%86%D8%AE%D8%B3%D8%AA%E2%80%8C%D9%88%D8%B2%DB%8C%D8%B1%D8%A7%D9%86_%D8%AA%D8%B1%DA%A9%DB%8C%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Suat_%C3%9Crg%C3%BCpl%C3%BC.jpg","page_title":"فهرست نخست‌وزیران ترکیه","context_page_description":"فهرست نخست‌وزیران ترکیه"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Kindertofte_(k%C3%A0u-khu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Kindertofte_kirke_20090410-1.jpg","page_title":"Kindertofte (kàu-khu)","context_page_description":"Kindertofte sī Tan-be̍h Slagelse chū-tī-chhī lāi ê chi̍t ê kàu-khu."},{"page_url":"https://is.wikipedia.org/wiki/Subway","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Subway_world_map1edit.png","page_title":"Subway","context_page_description":"Subway er bandarískur skyndibitastaður sem selur kafbáta og salöt. Fyrirtækið er í eigu Doctor's Associates, Inc og notar sérleyfismódel. Staðir Subway eru 35.519 samtals í yfir 98 löndum og fyrirtækið er stærsta skyndibitakeðja í heiminum.\\nHöfuðstöðvar fyrirtækisins eru í Milford í Connecticut-fylki. Subway á líka skrifstofur í Amsterdam, Brisbane og Miami, og í Lebanon, Singapúr og Indlandi. Veitingarstaðir Subway á Íslandi eru 22 en sá fyrsti var opnaður þar árið 1994 í Faxafeni."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_%C3%A0_la_Seconde_Guerre_mondiale_en_Mac%C3%A9doine_du_Nord","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Sveti_Nikole_32.JPG","page_title":"Liste des monuments à la Seconde Guerre mondiale en Macédoine du Nord","context_page_description":"Cet article recense les monuments à la Seconde Guerre mondiale en Macédoine du Nord."},{"page_url":"https://eo.wikipedia.org/wiki/Pleziosa%C5%ADruloj","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Libonectes_BW.jpg","page_title":"Pleziosaŭruloj","context_page_description":"Pleziosaŭruloj estas ordo de mezozoikaj mar-reptilioj. Ili unue aperis dum la meza triaso kaj disvastiĝis aparte multe dum la ĵurasio, vivante bone ĝis la kretacea-tercia formorta evento fine de la kretaceo."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%AB%D1%81%D1%8B%D2%A1-%D0%9A%D2%AF%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Issyk_Kul_at_sundown.jpg","page_title":"Ысыҡ-Күл","context_page_description":"Ысыҡ-Күл — Ҡырғыҙстандағы иң ҙур күл, донъялағы 25 иң ҙур майҙанлы күлдәрҙең береһе, шулай уҡ тәрәнлеге буйынса алтынсы урында тора. Республиканың төньяҡ-көнсығыш өлөшөндә, Төньяҡ Тянь-Шань тауҙарында: Күндәй-Ала-Тоо һәм Терский Ала-Тоо һырты араһында 1609 метр бейеклектә урынлашҡан. Аҡмаған күлгә 80-гә яҡын ҙур булмаған йылға ағып төшә. Уларҙың иң ҙурҙары — көнсығыштан Түп һәм Джергалан. Көнбайыштан Шыу йылғаһы бик яҡында, шуға ла яҙғы ташҡын ваҡытында Кутемалды йылғаһы ҡушылып киткән саҡта һыуының бер өлөшө күлгә ағып төшә. Күлдең һыу кимәле цикллап үҙгәреүсән; цикл тиҫтә йылдар дауам итә. Һыуы тоҙло.\\nҺыу күләме 1738 куб метр, һыу өҫтө майҙаны — 6236 квадрат километр, яр буйы оҙонлоғо — 688 км, уртаса тәрәнлеге — 278 м, иң тәрән урыны 2,5 тапҡырға күберәк һәм 702 метрға етә. Оҙонлоғо көнбайыштан көнсығышҡа — 182 километр, ә көньяҡтан төньяҡҡа — 58 км."},{"page_url":"https://en.wikipedia.org/wiki/Cremyll_Ferry","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/The_Cremyll_Ferry_on_the_Tamar_-_geograph.org.uk_-_1184611.jpg","page_title":"Cremyll Ferry","context_page_description":"The Cremyll ferry is a foot passenger ferry across the Hamoaze from Admirals Hard in Stonehouse, Plymouth, Devon to Cremyll in Cornwall. It is operated by Tamar Cruising, and runs approximately every 30 minutes, with a 10-minute crossing time."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D0%BA%D0%B8%D0%BE_(%D0%9B%D0%B8%D0%B2%D0%BE%D1%80%D0%BD%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Golfo_di_Procchio_%28Elba%29.JPG","page_title":"Прокио (Ливорно)","context_page_description":"Прокио је насеље у Италији у округу Ливорно, региону Тоскана.\\nПрема процени из 2011. у насељу је живело 441 становника. Насеље се налази на надморској висини од 3 м."},{"page_url":"https://it.wikipedia.org/wiki/Jan_Monchablon","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Monchablon4.jpg","page_title":"Jan Monchablon","context_page_description":"Jean Baptiste Ferdinand Monchablon è stato un pittore francese, paesaggista."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_7_mei","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Hyppolite_Vilain_XIIII.jpg","page_title":"Lijst van personen geboren op 7 mei","context_page_description":"Dit is een lijst van personen die geboren zijn op 7 mei.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n427 v.Chr. - Plato, filosoof, dichter en auteur uit het Oude Athene bewerken\\n1397 - Sejong de Grote van Joseon, taalkundige, politicus en monarch uit de Joseondynastie bewerken\\n1426 - Giovanni Pontano, politicus, dichter en schrijver bewerken\\n1530 - Lodewijk I van Bourbon-Condé, Franse graaf, politicus en militair bewerken\\n1553 - Albrecht Frederik van Pruisen, hertog, aristocraat bewerken\\n1586 - Francesco IV Gonzaga, hertog, politicus bewerken\\n1605 - Nikon van Moskou, priester en klerk uit het Tsaardom Rusland bewerken\\n1676 - Jonas Witsen, Nederlandse kunstverzamelaar bewerken\\n1700 - Gerard van Swieten, Nederlandse baron, arts en anatoom bewerken\\n1704 - Carl Heinrich Graun, Duitse kapelmeester, componist, zanger en operazanger bewerken"},{"page_url":"https://nl.wikipedia.org/wiki/Z%C3%B6bern","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Z%C3%B6bern_%281%29.JPG","page_title":"Zöbern","context_page_description":"Zöbern is een gemeente in de Oostenrijkse deelstaat Neder-Oostenrijk, gelegen in het district Neunkirchen. De gemeente heeft ongeveer 1500 inwoners."},{"page_url":"https://pt.wikipedia.org/wiki/Quebra-sol","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/1993_Jeep_Grand_Cherokee_Laredo_-_Blackberry_with_Crimson_interior_12.jpg","page_title":"Quebra-sol","context_page_description":"Quebra-sol é um componente automotivo localizado no interior do carro, logo acima do para-brisa. Eles são projetados com uma aba articulada que é ajustável para ajudar a sombrear os olhos dos motoristas e passageiros do brilho da luz do sol."},{"page_url":"https://ro.wikipedia.org/wiki/21_Lutetia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/21_Lutetia_orbit_on_01_Jan_2009.png","page_title":"21 Lutetia","context_page_description":"21 Lutetia este un asteroid din centura de asteroizi. A fost\\ndescoperit de Hermann M. S. Goldschmidt la 15 noiembrie 1852. Este numit după Lutetia, fortificația antică pe locul căreia s-a construit mai târziul Parisul."},{"page_url":"https://en.wikipedia.org/wiki/Synagogue_architecture","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Synagoga_w_%C5%81a%C5%84cucie_1.jpg","page_title":"Synagogue architecture","context_page_description":"Synagogue architecture often follows styles in vogue at the place and time of construction. There is no set blueprint for synagogues and the architectural shapes and interior designs of synagogues vary greatly. According to tradition, the Divine Presence can be found wherever there is a minyan, a quorum, of ten. A synagogue always contains an ark, called aron ha-kodesh by Ashkenazim and hekhal by Sephardim, where the Torah scrolls are kept."},{"page_url":"https://es.wikipedia.org/wiki/Cine_de_Iquitos","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Camara_usada_por_Antonio_Wong_Rengifo.JPG","page_title":"Cine de Iquitos","context_page_description":"El cine de Iquitos, también conocido como cine amazónico, es un hito importante y uno de los eventos históricos pioneros del cine en el Perú.​ Debido a la fiebre del caucho y la llegada de extranjeros, el interés cinematográfico empezó a inicios del siglo XX, junto a la evolución del cine de los Estados Unidos en Hollywood. El cine en Iquitos no tuvo una fecha de origen establecida, hasta su primer hecho cinematográfico registrado en 1900. Las primeras proyecciones se realizaron en la Casa de Fierro con una máquina marca Edison, el cual reproducía las imágenes mediante una lámpara de carburo y al continuo movimiento del operador. Iquitos es referida como una metonimia del cine en la Amazonía peruana por ser considerada el nacimiento de la cinematografía peruana y el encuentro tecnológico por la interacción con Europa por la industria del caucho.\\nEl pionero más importante del cine en Iquitos y todo Loreto es Antonio Wong Rengifo, pionero también del arte cinematográfico en Perú, con su trabajo más importante Bajo el sol de Loreto.​ Es principalmente reconocido por plasmar sus ideologías, sus aspiraciones y otros pensamientos en sus películas."},{"page_url":"https://en.wikipedia.org/wiki/Secretary_of_State_for_War","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Edward_Stanhope.jpg","page_title":"Secretary of State for War","context_page_description":"The position of Secretary of State for War, commonly called War Secretary, was a British cabinet-level position which existed from 1794 to 1801 and from 1854 to 1964. The Secretary of State for War headed the War Office and was assisted by a Parliamentary Under-Secretary of State for War, a Parliamentary Private Secretary who was also a Member of Parliament, and a Military Secretary, who was a general."},{"page_url":"https://it.wikipedia.org/wiki/Melodifestivalen_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/20171031_Malmo_Arena_0232_%2825463574977%29.jpg","page_title":"Melodifestivalen 2009","context_page_description":"La quarantottesima edizione del Melodifestival si è svolta tra il 7 febbraio e il 14 marzo 2009 e ha selezionato il rappresentante della Svezia all'Eurovision Song Contest 2009 di Mosca.\\nLa vincitrice è stata Malena Ernman con La voix."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8D%94%EB%B8%8C_%ED%85%8C%EC%9D%BC%EB%9F%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Dub_Taylor_in_Bonnie_And_Clyde.jpg","page_title":"더브 테일러","context_page_description":"더브 테일러는 미국의 배우, 텔레비전 배우, 영화배우이다.\\n리치먼드에서 태어났으며 로스앤젤레스에서 사망하였다."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%A2%AB%E7%88%86%E5%BB%BA%E9%80%A0%E7%89%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Hiroshima_Peace_Memorial_2008_01.JPG","page_title":"被爆建造物","context_page_description":"被爆建造物は、爆撃によって被害を受けて、被爆した建造物。戦争遺跡の一種。特に原子爆弾や水素爆弾によるものを指すことが多く、この場合被曝建造物とも表記される。また、被爆樹木、 被爆電車についても一部述べる。"},{"page_url":"https://de.wikipedia.org/wiki/Ketscher_Rheininsel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/20140607Dianthus_carthusianorum5.jpg","page_title":"Ketscher Rheininsel","context_page_description":"Die Ketscher Rheininsel ist ein Naturschutzgebiet bei Ketsch, einer Gemeinde im Rhein-Neckar-Kreis in Baden-Württemberg.\\nDas rechtsrheinisch gegenüber Speyer gelegene Gebiet mit der NSG-Nr. 2.013 ist 490,0 ha groß und liegt westlich des Kernbereichs von Ketsch. Es steht seit dem 11. April 1950 unter Naturschutz. Die Insel entstand durch die Rheinbegradigung durch Tulla und ist Teil des Rheinauenwaldes. Auf ihr befindet sich der größte Bestand von Vitis vinifera subsp. sylvestris in Deutschland. Bemerkenswert ist überdies das Vorkommen von Wiesen-Arzneibaldrian, diverser Orchideen, Einbeere, Gewöhnliche Natternzunge, Kanten-Lauch und Wiesen-Alant.\\nIm Gebiet befindet sich beim Rhein-Kilometer 406,5 eine Vermessungsmarke, ein sogenannter Myriameterstein."},{"page_url":"https://fr.wikipedia.org/wiki/Menallen_Township_(comt%C3%A9_d%27Adams,_Pennsylvanie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Clines_Church_AdamsCo_PA_2.JPG","page_title":"Menallen Township (comté d'Adams, Pennsylvanie)","context_page_description":"Menallen Township est un township, situé dans le comté d'Adams, en Pennsylvanie, aux États-Unis. En 2010, il comptait une population de 3 515 habitants."},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_Freistadt","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Hagenberg_im_M%C3%BChlkreis_im_Bezirk_FR.png","page_title":"Bezirk Freistadt","context_page_description":"Der Bezirk Freistadt ist ein politischer Bezirk des Landes Oberösterreich.\\nEr liegt nordöstlich von Linz und grenzt im Norden an Tschechien sowie im Osten an das Bundesland Niederösterreich. Im Süden grenzt er an den Bezirk Perg und im Westen an den Bezirk Urfahr-Umgebung. Gemäß der Vierteleinteilung Oberösterreichs gehört er mit drei anderen Bezirken zum Mühlviertel. Die Grenze zu Niederösterreich ist ein großes, kaum besiedeltes Waldgebiet, der Weinsberger Wald."},{"page_url":"https://de.wikipedia.org/wiki/Knappensteig","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Knappensteig_Hallein.jpg","page_title":"Knappensteig","context_page_description":"Der Knappensteig ist ein historischer Fußweg der Knappen im Salzbergbau von Hallein auf den Dürrnberg im Bezirk Hallein."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%DB%8C%D8%B1%D8%B2%D8%A8%D9%88%D8%B1%D9%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Meersburg-Marktplatz.jpg","page_title":"میرزبورق","context_page_description":"میرزبورق آلمانین بادن-وورتمبرق ایالتینده یئر آلان بیر شهردیر و ۴۴۴ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۵۵۴۳ نفر دیر. بۇ شهرین ۱۲٫۰۸ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9C%E3%83%AA%E3%83%93%E3%82%A2%E6%96%99%E7%90%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Singani.jpg","page_title":"ボリビア料理","context_page_description":"ボリビア料理は、主として南アメリカ、ボリビアで食される一般的な料理。その食文化は地域ごとに大きく三つに分類され、それぞれの特色を兼ね備えている。"},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AE%E0%B2%A6%E0%B3%81%E0%B2%AE%E0%B2%B2%E0%B3%88_%E0%B2%B0%E0%B2%BE%E0%B2%B7%E0%B3%8D%E0%B2%9F%E0%B3%8D%E0%B2%B0%E0%B3%80%E0%B2%AF_%E0%B2%89%E0%B2%A6%E0%B3%8D%E0%B2%AF%E0%B2%BE%E0%B2%A8%E0%B2%B5%E0%B2%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/MNP_Beware_of_crocodile.JPG","page_title":"ಮದುಮಲೈ ರಾಷ್ಟ್ರೀಯ ಉದ್ಯಾನವನ","context_page_description":"ಮದುಮಲೈ ರಾಷ್ಟ್ರೀಯ ಉದ್ಯಾನವನವು ತಮಿಳು ನಾಡಿನ ಒಂದು ಹುಲಿ ಸಂರಕ್ಷಿತ ಅರಣ್ಯ ಧಾಮ, ಇದು ಕರ್ನಾಟಕದ ಬಂಡೀಪುರ ಕಾಡಿಗೆ ಹೊಂದಿಕೊಂಡಿದೆ."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%90%B4%E4%B8%96%E6%B6%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Stanley_Goh_at_International_Most_Impactful_Awards_Ceremony_2018.jpg","page_title":"吴世涌","context_page_description":"吳世涌，馬來西亞畫家，「世界吳氏卓越獎」得主。生於馬來西亞霹靂州太平縣。2017年獲得「馬來西亞十大傑出青年」的榮譽。2018年獲第5屆國際企業影響力獎頒獎禮評選為「馬來西亞最具影響力藝術家名人獎」。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%80%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Br%C3%A8res_-_img_46705.jpg","page_title":"Брер","context_page_description":"Брер — муніципалітет у Франції, у регіоні Франш-Конте, департамент Ду. Населення — 41 осіб.\\nМуніципалітет розташований на відстані близько 330 км на південний схід від Парижа, 24 км на південний захід від Безансона."},{"page_url":"https://en.wikipedia.org/wiki/General_Staff_Building_(Saint_Petersburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Palace_Square_at_night%2C_Triumphal_arch%2C_Saint_Petersburg%2C_Russia.jpg","page_title":"General Staff Building (Saint Petersburg)","context_page_description":"The General Staff Building is an edifice with a 580 m long bow-shaped facade, situated on Palace Square in Saint Petersburg, Russia, in front of the Winter Palace.\\nThe monumental Neoclassical building was designed by Carlo Rossi in the Empire style and built in 1819–1829. It consists of two wings, which are separated by a tripartite triumphal arch adorned by sculptors Stepan Pimenov and Vasily Demuth-Malinovsky and commemorating the Russian victory over Napoleonic France in the Patriotic War of 1812. The arch links Palace Square through Bolshaya Morskaya Street to Nevsky Prospekt.\\nUntil the capital was transferred to Moscow in 1918, the building served as the headquarters of the General Staff, Foreign Ministry and Finance Ministry.\\nThe western wing now hosts the headquarters of the Western Military District. The eastern wing was given to the Hermitage Museum in 1993 and was extensively remodeled inside."},{"page_url":"https://es.wikipedia.org/wiki/Cl%C3%A1sico_Mundial_de_B%C3%A9isbol_2013","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Fukuoka_dome02.jpg","page_title":"Clásico Mundial de Béisbol 2013","context_page_description":"El Clásico Mundial de Béisbol 2013 fue la tercera edición de la mayor competencia de selecciones a nivel mundial. Para esta ocasión se disputó una ronda de clasificación, por lo que el número de equipos involucrados en el torneo era de veintiocho.​\\nParticiparon dieciséis selecciones nacionales en la competencia, y cuatro países alojaron los partidos del evento cuya ronda final se llevó a cabo en los Estados Unidos.​​​ En el torneo debutaron las selecciones nacionales de España y Brasil. El certamen fue ganado por la selección de República Dominicana de forma invicta y por primera vez en la historia del evento, en una final inédita entre países latinoamericanos ante Puerto Rico."},{"page_url":"https://es.wikipedia.org/wiki/Suillus_lakei","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Boletinus_cavipes.JPG","page_title":"Suillus lakei","context_page_description":"Suillus lakei, comúnmente conocido como el Jack mate, el boleto del lago, o el suillus pintado occidental, es una especie de hongo de la familia Suillaceae. Se caracteriza por las distintivas fibras de mechón marrón rojizo o pequeñas escamas en el capuchón, y la presencia de un velo lanudo en el tallo. Los capuchones pueden alcanzar diámetros de hasta 15 cm, mientras que los tallos tienen entre 6 y 12 cm de largo y generalmente entre 1 y 3 cm de espesor. En la parte inferior del capuchón hay una capa de poros angulares esponjosos de color amarillo a marrón amarillento; estos poros están cubiertos de un velo parcial blanquecino cuando son jóvenes. Un hongo micorrícico, S. lakei crece en asociación con el abeto Douglas y se encuentra en los lugares donde se encuentra este árbol. Es nativo del noroeste de América del Norte, pero se ha introducido en Europa, América del Sur y Nueva Zelanda. El hongo es comestible, pero las opiniones varían considerablemente en cuanto a su calidad."},{"page_url":"https://id.wikipedia.org/wiki/Marvel_Cinematic_Universe:_Fase_Tiga","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/James_Gunn_%2828557194032%29_%28cropped%29.jpg","page_title":"Marvel Cinematic Universe: Fase Tiga","context_page_description":"Fase Tiga dari Marvel Cinematic Universe adalah serangkaian film pahlawan super Amerika Serikat yang diproduksi oleh Marvel Studios berdasarkan karakter yang muncul dalam karya-karya yang dipublikasikan oleh Marvel Comics. Fase ini dimulai pada tahun 2016 dengan perilisan Captain America: Civil War dan diakhiri pada tahun 2019 dengan perilisan film Spider-Man: Far From Home. Fase ini juga berisi film persilangan Avengers: Infinity War, yang dirilis pada tahun 2018, dan sekuelnya Avengers: Endgame, yang dirilis pada tahun 2019. Kevin Feige memproduseri setiap film dalam fase ini, bersama Amy Pascal untuk film Spider-Man: Homecoming dan Spider-Man: Far From Home, serta Stephen Broussard untuk film Ant-Man and the Wasp. Kesebelas film dari fase ini meraup pendapatan total lebih dari $13,5 miliar di box office global bersama dengan tanggapan kritis dan publik yang umumnya positif. Avengers: Endgame merupakan film yang terlaris hingga saat ini.\\nChris Evans dan Tom Holland memiliki jam tampil terbanyak dalam fase ini, di mana mereka masing-masing membintangi atau melakukan penampilan kameo di lima film Tahap Tiga."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_op_11_februari","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/%D0%9F%D0%BE%D1%80%D1%82%D1%80%D0%B5%D1%82_%D0%A1%D0%BF%D0%B5%D1%80%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB%D0%B0_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87%D0%B0.jpg","page_title":"Lijst van personen overleden op 11 februari","context_page_description":"Dit is een lijst van personen die overleden zijn op 11 februari.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n55 - Tiberius Claudius Caesar Britannicus, politicus uit het Oude Rome bewerken\\n244 - Gordianus III, Romeinse keizer en Romeins senator uit het Oude Rome bewerken\\n641 - Herakleios, Byzantijns keizer en Romeins senator uit het Byzantijnse Rijk bewerken\\n731 - Paus Gregorius II, paus en kardinaal, bibliothecaris en rooms-katholiek priester uit het Byzantijnse Rijk bewerken\\n824 - Paus Paschalis I, paus, bisschop en abt, rooms-katholiek priester bewerken\\n966 - Starchand van Eichstätt, Duitse Prins-bisschop bewerken\\n1056 - Herman II van Keulen, Duitse katholieke aartsbisschop en katholiek bisschop, rooms-katholiek priester bewerken\\n1124 - Frederik van Werl-Arnsberg, graaf van Arnsberg bewerken"},{"page_url":"https://hu.wikipedia.org/wiki/TER_Aquitaine","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Douzillac_gare_voies_%281%29.JPG","page_title":"TER Aquitaine","context_page_description":"A TER Aquitaine egy regionális vasúthálózat Franciaországban, az Aquitania régióban."},{"page_url":"https://es.wikipedia.org/wiki/Fairbury_(Illinois)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Fairbury%2C_IL_Downtown6.JPG","page_title":"Fairbury (Illinois)","context_page_description":"Fairbury es una ciudad ubicada en el condado de Livingston en el estado estadounidense de Illinois. En el Censo de 2010 tenía una población de 3757 habitantes y una densidad poblacional de 806,78 personas por km².​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B8%D0%B6%D0%B5%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D1%83%D0%B1%D0%B5%D1%80%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/%D0%9A%D0%B0%D1%80%D1%82%D0%B0_%D0%B2%D0%BE%D0%BB%D0%BE%D1%81%D1%82%D0%B5%D0%B9_%D0%9D%D0%B8%D0%B6%D0%B5%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%BE%D0%B9_%D0%B3%D1%83%D0%B1%D0%B5%D1%80%D0%BD%D0%B8%D0%B8.jpg","page_title":"Нижегородская губерния","context_page_description":"Нижегоро́дская губе́рния — административно-территориальная единица Российской империи, Российской республики, РСФСР и СССР, существовавшая в 1714—1929 годах.\\nГубернский город — Нижний Новгород."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9E%E1%83%90%E1%83%A0%E1%83%90%E1%83%92%E1%83%95%E1%83%90%E1%83%98%E1%83%A1_%E1%83%93%E1%83%94%E1%83%9B%E1%83%9D%E1%83%92%E1%83%A0%E1%83%90%E1%83%A4%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Paraguay-001.jpg","page_title":"პარაგვაის დემოგრაფია","context_page_description":"პარაგვაის მოსახლეობა არათანაბრად არის განაწილებული რესპუბლიკის მთელს ტერიტორიაზე. მათი უმრავლესობა ცხოვრობს ქვეყნის აღმოსავლეთ ნაწილში, უმეტესწილად დედაქალაქ ასუნსიონში, რომელიც პარაგვაის უმსხვილესი ქალაქია და სამხრეთ-დასავლეთით ესაზღვრება არგენტინას, 160 კილომეტრში. გრან-ჩაკოში, რომელზეც ტერიტორიის 60% მოდის, ცხოვრობს მოსახლეობის მხოლოდ 2%.\\nპარაგვაის მოსახლეობა რასობრივად ერთგვაროვანია. XVI საუკუნეში მცირერიცხოვანი ესპანელი კონკისტადორების გუარანის ინდიელების ტერიტორიებთან დასახლებამ ხელი შეუწყო მათ სწრაფ მეტისიზაციას. პარაგვაული ერის ჩამოყალიბება უმთავრესად XIX—XX საუკუნეებში დასრულდა. დღესდღეობით პარაგვაელების 90% არიან მეტისები, რაც ესპანელ კოლონიალისტებსა და ინდიელების შერეული ქორწინებების შედეგია. ინდიელები, რომელთაც ჯერ კიდევ შემორჩათ თავისი კულტურა და ტრადიციები, საერთო მოსახლეობის 2% შეადგენენ. პარაგვაელი ინდიელები ტუპი-გუარანის ლინგვისტურ ჯგუფს მიეკუთვნებიან. პარაგვაელი მეტისების კანის ფერი უფრო ღიაა და განსხვავდება იმ მეტისებისგან, რომლებიც წარმოიშვნენ ესპანელების და ანდური ქვეყნების მოსახლეობის შერეული ქორწინებებიდან.\\nმოსახლეობის 90% ძირითად ენად გუარანულს იყენებს, ამასთან ერთად მათი 75% ასევე ესპანურ ენასაც იყენებს."},{"page_url":"https://sk.wikipedia.org/wiki/Rui_Costa_(cyklista)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/2019_Fleche_Wallonne_176.jpg","page_title":"Rui Costa (cyklista)","context_page_description":"Rui Alberto Faria da Costa je profesionálny cestný cyklista, ktorý jazdí za UAE Emirates. Je známy víťazstvami na Tour de Suisse v rokoch 2012, 2013 a 2014. Tento hetrik dosiahol ako jediný cyklista v histórii. Vyhral aj etapy na Tour de France v roku 2011 a 2013 a tiež aj Grand Prix Cycliste de Montréal 2011. V roku 2013 sa stal majstrom sveta v cestnej cyklistike pred Joaquinom, Puritom\\" Rodríguezom a Alejandrom Valverdem."},{"page_url":"https://es.wikipedia.org/wiki/Thorens-Gli%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Eglise_Thorens-Gli%C3%A8res.jpg","page_title":"Thorens-Glières","context_page_description":"Thorens-Glières, era una comuna francesa situada en el departamento de Alta Saboya, de la región de Auvernia-Ródano-Alpes, que el uno de enero de 2017 pasó a ser una comuna delegada de la comuna nueva de Fillière​ al fusionarse con las comunas de Aviernoz, Évires, Les Ollières y Saint-Martin-Bellevue."},{"page_url":"https://fr.wikipedia.org/wiki/Autoroute_D1_(Slovaquie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/D1_pri_Siladiciach.jpg","page_title":"Autoroute D1 (Slovaquie)","context_page_description":"L'autoroute slovaque D1 est une autoroute qui commence à Bratislava et qui termine à la Frontière entre la Slovaquie et l'Ukraine. Elle est toujours en construction."},{"page_url":"https://gl.wikipedia.org/wiki/Ferrari_212_Inter","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/1952_Ferrari_212_Vignale_Coupe.JPG","page_title":"Ferrari 212 Inter","context_page_description":"O Ferrari 212 Inter substitúe con éxito aos 166 e 195 en 1951. Dado a coñecer durante a Salón do automóbil de Bruxelas dese ano, o 212 é unha evolución do 166, un deportivo para estrada que tamén podería gañar carreiras internacionais."},{"page_url":"https://ro.wikipedia.org/wiki/M%C3%A9ntrida","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Pueblo_de_M%C3%A9ntrida.jpg","page_title":"Méntrida","context_page_description":"Méntrida este un oraș din Spania, situat în provincia Toledo din comunitatea autonomă Castilia-La Mancha. Are o populație de 3.521 de locuitori."},{"page_url":"https://eu.wikipedia.org/wiki/Rade%C5%A1%C3%ADnsk%C3%A1_Svratka","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Kostel_sv._V%C3%A1clava_%28Rade%C5%A1%C3%ADnsk%C3%A1_Svratka%29_2012-09_%287%29.JPG","page_title":"Radešínská Svratka","context_page_description":"Radešínská Svratka Txekiar Errepublikako udalerri bat da. 609 biztanle ditu eta 6,99 kilometro koadroko azalera. Žďár nad Sázavouko barrutian dago."},{"page_url":"https://it.wikipedia.org/wiki/Navi_della_Bundeswehr","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/EISVOGEL_4277.jpg","page_title":"Navi della Bundeswehr","context_page_description":"Questa è una lista delle navi della Bundeswehr, in servizio dal 1956 nella Bundesmarine – dal 1990 Deutsche Marine – e altre armi della Bundeswehr.\\nSono ordinate in classi e con relativi Schiffsnummernverzeichnis.\\nAltre navi militari tedesche sono nella lista delle navi della Nationalen Volksarmee.\\nQuelle in servizio sono su sfondo azzurro."},{"page_url":"https://hu.wikipedia.org/wiki/Az_USA_114._kongresszusa_k%C3%A9pvisel%C5%91h%C3%A1zi_tagjainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/TomReedNewOfficial.jpg","page_title":"Az USA 114. kongresszusa képviselőházi tagjainak listája","context_page_description":"Az Amerikai Egyesült Államok Kongresszusának képviselőháza 435 szavazati joggal rendelkező képviselőből, valamint 6 szavazati joggal nem rendelkező delegáltból áll. Az egyes államok képviselőinek számát a tíz évenként lebonyolított népszámlálás adatai, valamint az állam kiterjedése alapján határozzák meg. Ennek megfelelően a 114. kongresszusban Kaliforniának van a legtöbb, 53 képviselője, és mindössze egy képviselővel rendelkezik Alaszka, Delaware, Montana, Dél-Dakota, Észak-Dakota, Vermont, valamint Wyoming állam. A képviselőház tagjait minden páros év novemberében választják meg, mandátumukat a megválasztott képviselők január 3-án kezdik meg. A 114. kongresszus tagjait 2014. november 4-én választották meg, a következő kongresszus tagjainak megválasztására 2016. november 8-án, az elnökválasztással egy időben került sor.\\nA 114. kongresszus 2015. január 3-a 12:00-tól 2017. január 3-án 12:00-ig ülésezett. A képviselőház többségét ebben az időszakban a republikánusok adták. A képviselőház elnöke a republikánus Paul Ryan, aki John Boehnert 2015. október 29-én váltotta a házelnöki székben."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B0%9C%ED%8B%B0%EC%8A%A4%EC%B9%B4%EC%95%BC_%EC%97%AD_(%EC%83%81%ED%8A%B8%ED%8E%98%ED%85%8C%EB%A5%B4%EB%B6%80%EB%A5%B4%ED%81%AC_%EC%A7%80%ED%95%98%EC%B2%A0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Metro_SPB_Line1_Baltyskaya_Central_Hall.jpg","page_title":"발티스카야 역 (상트페테르부르크 지하철)","context_page_description":"발티스카야 역은 러시아 상트페테르부르크 시에 있는 상트페테르부르크 지하철 키롭스코 비보륵스카야 선의 철도역이다. 이 역은 1955년 11월 15일에 개통되었다. 출입구는 발티스키 철도 터미널과 연결된다. 역 내부는 우랄 대리석의 장식이 사용되어 바다의 은색으로 장식되어 있다."},{"page_url":"https://hu.wikipedia.org/wiki/Brey","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Brey_und_Rhens_am_Rhein.jpg","page_title":"Brey","context_page_description":"Brey település Németországban, Rajna-vidék-Pfalz tartományban. Lakosainak száma 1485 fő. +/- Brey Boppard és Spay községekkel határos."},{"page_url":"https://pl.wikipedia.org/wiki/Leon_VI_Filozof","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Leo_VI_the_Wise.JPG","page_title":"Leon VI Filozof","context_page_description":"Leon VI Filozof – cesarz Bizancjum z dynastii macedońskiej. Swój przydomek zawdzięczał upodobaniom do wygłaszania kazań w kościołach Konstantynopola.\\nWstąpił na tron po swym ojcu Bazylim w 886 roku, rozpoczynając panowanie od usunięcia z patriarchatu Focjusza i mianowania na jego miejsce swego brata Stefana. Jego matką była Eudokia Ingerina.\\nOd 904 roku panował wspólnie z bratem Aleksandrem. Mimo podjęcia prób reorganizacji wojska bizantyjskiego i podniesienia jego sprawności bojowej poniósł szereg klęsk w wojnach z wdzierającymi się w granice państwa Bułgarami, Arabami. Po przegranej wojnie z Rusią Kijowską zawarł traktat gwarantujący Rusinom swobodę handlu z Konstantynopolem. Polecił dokończenie bizantyjskiego kodeksu prawnego Opus Basilicon, który przetrwał do upadku Konstantynopola w 1453 roku. Autor prac z zakresu taktyki wojskowej i teologii."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BA%D0%BE%D1%80%D1%81%D0%B5%D0%B7%D0%B5,_%D0%9C%D0%B0%D1%80%D1%82%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Leo_Scor_Diaz%28GangsofNY%29-.jpg","page_title":"Скорсезе, Мартин","context_page_description":"Ма́ртин Чарльз Скорсе́зе — американский кинорежиссёр, продюсер, сценарист и актёр.\\nФильмам Скорсезе присущи выразительная жестокость и насилие, в кинематографических кругах он известен как мастер гангстерских лент. Огромное влияние на режиссёра оказали картины Кинга Видора, Джона Хьюстона, Майкла Пауэлла, Эмериха Прессбургера, Джона Форда, Элиа Казана, Бернардо Бертолуччи и многих других. Скорсезе предпочитает не менять создателей своих проектов, постоянно работая с Робертом Де Ниро, Леонардо Ди Каприо и монтажёром Тельмой Шунмейкер.\\nНаиболее примечательные картины режиссёра — «Злые улицы», «Таксист», «Бешеный бык», «Последнее искушение Христа», «Славные парни», «Мыс страха», «Казино», «Банды Нью-Йорка», «Авиатор», «Отступники», «Остров проклятых», «Хранитель времени» и «Волк с Уолл-стрит». 28 февраля 2003 года Скорсезе стал обладателем звезды на Голливудской аллее славы. Он является обладателем ряда наград, включая премии «Оскар», «BAFTA», «Золотой глобус», «Эмми», «Грэмми», «Золотой пальмовой ветви», «Золотого медведя», «Сезар», «Серебряного льва» и премии Гильдии режиссёров Америки."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B8%D1%87%D0%BD%D0%B0_%D0%BD%D0%B0%D0%BF%D1%80%D1%83%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/US_Navy_110315-N-0278E-002_High-voltage_electricians_from_Naval_Facilities_Engineering_Command_%28NAVFAC%29_Hawaii_reconfigure_electrical_circuitry_and.jpg","page_title":"Електрична напруга","context_page_description":"Напруга на ділянці електричного кола — це різниця потенціалів між двома точками електричного поля яка чисельно дорівнює відношенню роботи, яку треба виконати для переміщення заряду з однієї точки поля в іншу точку, до величини цього заряду.\\nНапруга в системі SI вимірюється у вольтах.\\nU=Wст/Q, де Wст — робота сторонніх сил по переміщенню заряду, Q- одиниця заряду\\nU=φ₁-φ₂, де φ₁-φ₂- різниця потенціалів.\\nІз закону Ома для неповного кола: U=I·R, де I-струм, R-опір провідника.\\nДля вимірювання напруги, можуть використовуватися прилади, які називаються вольтметрами, мілівольтметрами тощо.\\nНапруга може являти собою або джерело енергії, або втрачену, використану чи збережену енергію."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%91%D0%B5%D0%B9%D1%80%D1%83%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Beirut_Central_District_Collage.jpg","page_title":"Бейрут","context_page_description":"Бейрут — пойтахт ва калонтари шаҳри Лубнон."},{"page_url":"https://nl.wikipedia.org/wiki/Kama_(werktuig)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Kamas.jpg","page_title":"Kama (werktuig)","context_page_description":"Een kama of Japanse sikkel is een Japans landbouwhandwerktuig om grassen, graan of ruigte te maaien of af te snijden, vergelijkbaar in gebruik met een sikkel. Een kama bestaat uit een puntig mes met één scherpe rand, bevestigd aan een korte houten steel. Er bestaan ook kama's met een lange steel. In tegenstelling tot een zeis wordt een kama niet gehanteerd met een zwaaiende beweging, maar neemt de gebruiker een bundel gras of graan in de hand en snijdt hij met de kama in de andere hand, met een trekkende beweging, de halmen af.\\nGelijkaardige werktuigen werden doorheen Azië gebruikt om gewassen te oogsten, voornamelijk rijst.\\nDe kama vond zijn weg naar de vechtkunsten, in het bijzonder kobudo, de vechtkunsten van Okinawa, waar arme boeren het landbouwwerktuig aanwendden als geïmproviseerd wapen. Een aangepaste kama wordt, vaak een in elke hand, gebruikt in de karate, taekwondo en pencak silat. Een kusarigama is een kama aan een metalen ketting met een zware bol aan het uiteinde."},{"page_url":"https://pl.wikipedia.org/wiki/Pioneer_0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Thor-Able_I_Pioner_17-08-1958.png","page_title":"Pioneer 0","context_page_description":"Pioneer 0 – amerykańska sonda kosmiczna. Pierwsza próba wysłania obiektu poza orbitę wokółziemską i pierwsza próba lotu w kierunku Księżyca. Misja nie powiodła się z powodu eksplozji rakiety nośnej podczas startu."},{"page_url":"https://en.wikipedia.org/wiki/Pauline_Hanson%27s_One_Nation","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Pauline_Hanson_%28438351804%29_%28cropped%29.jpg","page_title":"Pauline Hanson's One Nation","context_page_description":"Pauline Hanson's One Nation, also known as One Nation or One Nation Party, is a political party in Australia. One Nation was founded in 1997, by member of parliament Pauline Hanson and her advisors David Ettridge and David Oldfield after Hanson was disendorsed as a federal candidate for the Liberal Party of Australia. The disendorsement came before the 1996 federal election because of comments she made about Indigenous Australians. Hanson sat as an independent for one year before forming Pauline Hanson's One Nation.\\nFederally, no One Nation candidate has ever been elected to the House of Representatives. However, one candidate from the party was elected to the Senate in the 1998 federal election, and four One Nation senators were elected in the 2016 federal election. In state politics, however, One Nation has performed better. At the 1998 Queensland state election the party gained more than 22% of the vote in Queensland's unicameral legislative assembly, winning 11 of the 89 seats. David Oldfield was elected to the New South Wales Legislative Council as a One Nation candidate, but he was expelled from the party and later formed the unsuccessful splinter group, One Nation NSW."},{"page_url":"https://gl.wikipedia.org/wiki/Usedom","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Baltic_Sea_map_Usedom_location.png","page_title":"Usedom","context_page_description":"Usedom é unha illa do Mar Báltico en Pomerania, dividida desde 1945 entre Alemaña e Polonia. É a segunda illa máis grande de Pomerania logo de Rügen.\\nEstá situado ao norte da Lagoa de Szczecin no esteiro do río Oder. Ao redor do 80% da illa pertence ao distrito alemán de Vorpommern-Greifswald no estado de Mecklemburgo-Antepomerania. A parte oriental e a cidade máis grande da illa, Świnoujście, son parte do Voivodato de Pomerania Occidental. A superficie total da illa é 445 km². A súa poboación é de 76.500 habitantes.\\nCunha media anual de 1906 horas de sol, Usedom é a rexión máis asollada de Alemaña e Polonia, e tamén é a illa máis asollada do Mar Báltico, de aí o seu alcumo \\"Illa do Sol\\".\\nA illa foi un destino turístico desde o Gründerzeit no século XIX, e presenta arquitectura de complexo turístico. Balnearios inclúen a Zinnowitz e os Amber Spas no oeste, o Kaiserbad eŚwinoujście no leste."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%BB%D1%8C%D1%82%D0%BE%D0%B2%D1%8B%D0%B5_%D1%81%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D0%B5%D0%BD%D0%B8%D1%8F_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/%D0%A5%D1%80%D0%B0%D0%BC_%D0%94%D0%B8%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D1%8F_%D0%A1%D0%BE%D0%BB%D1%83%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%84%D0%BE%D1%82%D0%BE_4.JPG","page_title":"Культовые сооружения Санкт-Петербурга","context_page_description":"Храмы Санкт-Петербурга — список культовых сооружений Санкт-Петербурга — православных, католических и протестантских соборов и церквей, а также синагог, мечетей и других.\\nВ Санкт-Петербурге 268 конфессий и религиозных объединений: Русской православной церкви — 131 объединение, Старообрядческой церкви, Армянской Апостольской церкви — 2 прихода, Римско-католической церкви — 7 приходов, Евангелическо-Лютеранской церкви — 19 объединений, мусульманских — 3 объединения, буддийских — 5 объединений, иудейских — 9 объединений, Евангельских христиан-баптистов — 13 объединений, Церкви адвентистов седьмого дня — 6 приходов, Пятидесятников — 23 объединения и другие. 229 культовых зданий находятся в собственности или ведении религиозных объединений."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%AC%D5%A5%D5%BD_(%D4%B2%D5%A1%D5%BE%D5%A1%D6%80%D5%AB%D5%A1)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/St._Gordianus_und_Epimach_%28Ple%C3%9F%29h.JPG","page_title":"Պլես (Բավարիա)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Պլես\\nՊլես, կոմունա Գերմանիայում՝ Բավարիա երկրամասում՝ Ներքին Ալգոյ շրջան։ Ենթարկվում է Շվաբիա վարչական օկրուգին։ Բնակչությունը կազմում է 847 մարդ ։ Զբաղեցնում է 15,38 կմ² մակերես։ Պաշտոնական կոդ՝ 09 7 78 188։"},{"page_url":"https://en.wikipedia.org/wiki/Archeological_Sites_at_Kawela","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Kawela%2C_Molokai.jpg","page_title":"Archeological Sites at Kawela","context_page_description":"Archeological Sites at Kawela are a number of archeological sites at or near the settlement of Kawela on the southern coast of Molokaʻi, the northernmost of the islands of Maui County, Hawaii. It was the site of two battles in Hawaiian history."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BB%D1%8C%D0%BA%D0%B0%D0%BD%D1%82%D0%B8%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Chalcanthite_-_streak_color.JPG","page_title":"Халькантит","context_page_description":"Халькантит або мідний купорос — мінерал класу сульфатів, п'ятиводний сульфат міді острівної будови. Другорядна мідна руда.\\nНазва — від грецьк «халькос» — мідь і «антос» — квітка.\\nСиноніми: камінь галіційський синій, мідний купорос, ціанозит."},{"page_url":"https://fr.wikipedia.org/wiki/Lole_y_Manuel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Lole_y_Manuel.jpg","page_title":"Lole y Manuel","context_page_description":"Lole y Manuel est un groupe espagnol de flamenco, formé au milieu des années 1970, et composé de la chanteuse et danseuse Dolores Montoya Rodríguez et du guitariste Manuel Molina Jiménez. Ce groupe est notamment l'un des précurseurs du mouvement du nouveau flamenco.\\nCe groupe a également fait des apparitions dans le film Flamenco de Carlos Saura. Le titre Tu Mirá apparaît dans la bande originale du film Kill Bill.\\nManuel décède d'un cancer le 19 mai 2015 il avait 67 ans."},{"page_url":"https://es.wikipedia.org/wiki/Abad%C3%ADa_de_San_Miguel_de_Cuix%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Cuxa_Cloister_NYC.jpg","page_title":"Abadía de San Miguel de Cuixá","context_page_description":"La abadía de San Miguel de Cuixá; en catalán, abadia de Sant Miquel de Cuixà es una abadía benedictina situada al pie del Canigó en la comuna de Codalet, en los Pirineos Orientales en el sudeste de Francia. Con los abades Garin y Oliva se convirtió en uno de los centros culturales más importantes de la Cataluña feudal."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D1%83%D0%BB%D0%BA%D0%B0%D0%BD%D1%96%D0%B2_%D0%90%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D0%BA%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/MountBerlin.jpg","page_title":"Список вулканів Антарктики","context_page_description":"Список вулканів Антарктики — список діючих і згаслих вулканів Антарктичного материка та островів дільниць Атлантичного, Індійського і Тихого океанів, що межують з Антарктидою."},{"page_url":"https://id.wikipedia.org/wiki/U-Bahn_Wina","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/U-Bahn-Netz_Wien_2019.png","page_title":"U-Bahn Wina","context_page_description":"U-Bahn Wina adalah sebuah sistem angkutan cepat yang terdiri dari lima jalur. Jalur ini menjadi tulang punggung sistem transportasi publik terbaik di seluruh dunia berdasarkan UITP pada bulan Juni 2009. Lebih dari 1,3 juta penumpang menggunakan U-Bahn Wina setiap hari. Jaringan ini sedang melakukan pengembangan dan peremajaan kereta api. Sejak tahun 1969, 200 juta Euro telah diinvestasikan setiap tahun untuk pengembangan U-Bahn Wina.\\nBagian pertama dari U-Bahn modern dibuka pada 8 Mei 1976, tetapi dua jalur merupakan perpanjangan dan kemudian ditetapkan sebagai U-Bahn yang mengacu pada sistem Stadtbahn, yang pertama dbuka pada tahun 1898. Bagian dari U2 dan U6 berawal dari terowongan premetro yang dibangun untk mengakomodir jalur trem sebelumnya. Hanya U1 dan U3 yang dibangun sepenuhnya sebagai jalur bawah tanah baru.\\nJalur dirancang untuk dikenali dengan sebuah angka dan huruf \\"U\\" dan dapat diidentifikasi pada penanda stasiun dan literatur terkait oleh warna. Saat ini terdaat lima jalur; U1, U2, U3, U4 dan U6. Terdapat beberapa permintaan untuk membangun sebuah jalur U5 namun semua proyek tersebut dibatalkan."},{"page_url":"https://da.wikipedia.org/wiki/Navne_i_Rock_and_Roll_Hall_of_Fame","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Gene_Vincent_1957.JPG","page_title":"Navne i Rock and Roll Hall of Fame","context_page_description":"Navne i Rock and Roll Hall of Fame er en oversigt over de navne, der er optaget i Rock and Roll Hall of Fame i USA. Listen er ikke komplet, se den på Rock and Roll Hall of Fames liste over de optagne navne.\\nDe oprindelige kategorier fra starten i 1986 er: Udøvende kunstnere, ikke-udøvende personer, tidlig indflydelse. Dertil kommer undertiden ærespris for livslang indsats. Fra 2000 kom kategorien baggrundsmusikere til. Den klart største gruppe er udøvende kunstnere."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AE%E0%B8%B4%E0%B8%A7%E0%B9%82%E0%B8%81_%E0%B8%A7%E0%B8%B5%E0%B8%9F%E0%B8%A7%E0%B8%B4%E0%B8%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Hugo_Weaving_2014.jpg","page_title":"ฮิวโก วีฟวิง","context_page_description":"ฮิวโก วอลเลซ วีฟวิง เป็นนักแสดง, โปร์ดิวเซอร์, นักเขียนบท และผู้กำกับชาวออสเตรเลีย มีชื่อเสียงจากภาพยนตร์ไตรภาคเดอะ เมทริกซ์ของพี่น้องวาซอสกี ไตรภาคเดอะลอร์ดออฟเดอะริงส์ของปีเตอร์ แจ็คสัน ภาพยนตร์แนวอาชกรรม V for Vendetta และ โยฮัน สมิท / เรดสกัล จากภาพยน์แนวซุปเปอร์ฮีโร่ กัปตันอเมริกา: อเวนเจอร์ที่ 1 และเขามีหลานสาวที่เป็นนักแสดงเช่นเดียวกันชื่อว่า ซามาร่า วิฟวิง อีกด้วย\\nฮิวโก วีฟวิง เกิดที่ไนจีเรีย จากครอบครัวชาวอังกฤษ เติบโดที่แอฟริกาใต้และสหราชอาณาจักร และใช้ชีวิตในออสเตรเลียตั้งแต่อายุ 16 ปี วิฟวิงเริ่มงานแสดงตั้งแต่อายุ 24 ปี โดยรับบทเล็กในภาพยนตร์ซีรีส์ของออสเตรเลีย เริ่มมีชื่อเสียงเป็นที่รู้จักจากบทเกย์นักเต้นคาบาเรต์ ในภาพยนตร์เรื่อง Priscilla, Queen of the Desert ที่เป็นภาพยนตร์ฮิตไปทั่วโลก แสดงร่วมกับเทอร์เรนซ์ สแตมพ์ และกาย เพียร์ซ\\nฮิวโก วีฟวิง มีชื่อเสียงยิ่งขึ้นจากการรับบท เอเจนต์สมิธ ในภาพยนตร์เดอะ เมทริกซ์ เดอะ เมทริกซ์ รีโหลดเดด และเดอะ เมทริกซ์ เรฟโวลูชั่นส์ และบท เอลรอนด์ ในอภินิหารแหวนครองพิภพ, ศึกหอคอยคู่กู้พิภพ และมหาสงครามชิงพิภพ รวมถึงเคยมีผลงานด้านการพากย์เสียง เมกะทรอน ในภาพยนตร์ชุด ทรานส์ฟอร์มเมอร์ส ภาค 1 ถึงภาค 3 อีกด้วย"},{"page_url":"https://es.wikipedia.org/wiki/Winnebago_(Illinois)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Winnebago%2C_IL_Downtown_02.JPG","page_title":"Winnebago (Illinois)","context_page_description":"Winnebago es una villa ubicada en el condado de Winnebago en el estado estadounidense de Illinois. En el Censo de 2010 tenía una población de 3101 habitantes y una densidad poblacional de 614,63 personas por km².​"},{"page_url":"https://fr.wikipedia.org/wiki/Scl%C3%A9rochronologie","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Chamelea_striatula3.jpg","page_title":"Sclérochronologie","context_page_description":"La sclérochronologie est l'étude des parties dures des êtres vivants par comptage des stries d'accroissement.\\nÀ l'instar de la dendrochronologie, les biologistes marins estiment ainsi l'âge, la période et la durée d'évènements marquants de la vie d'un individu.\\nLes structures sont observées par microscopie optique, microscopie électronique à balayage ou en cathodoluminescence. L'approche\\nsclérochronologique peut également être couplée à l'utilisation de techniques de marquages qui permettent d'inscrire un repère temporel dans la\\ncroissance."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BE%B7%E5%9F%83%E9%87%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Map_commune_FR_insee_code_59171.png","page_title":"德埃里","context_page_description":"德埃里是法国上法兰西大区诺尔省的一个市镇，位于该省南部，属于康布雷区。该市镇的总面积为1.87平方公里，2009年时的人口为39人。"},{"page_url":"https://en.wikipedia.org/wiki/Kieran_Mullan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Official_portrait_of_Dr_Kieran_Mullan_MP_crop_2.jpg","page_title":"Kieran Mullan","context_page_description":"Kieran Mullan is a British Conservative Party politician who was elected as the Member of Parliament for Crewe and Nantwich at the 2019 general election."},{"page_url":"https://en.wikipedia.org/wiki/Shopping_mall","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Entrance_of_the_largest_shopping_mall_in_Iran%2C_Isfahan_City_Center.jpg","page_title":"Shopping mall","context_page_description":"A shopping mall is a North American term for a large indoor shopping center, usually anchored by department stores. The term \\"mall\\" originally meant a pedestrian promenade with shops along it, but in the late 1960s, it began to be used as a generic term for the large enclosed shopping centers that were becoming commonplace at the time. In the U.K., such complexes are considered shopping centers, though \\"shopping center\\" covers many more sizes and types of centers than the North American \\"mall\\". Other countries may follow U.S. usage and others follow U.K. usage.\\nMalls are currently in severe decline or have closed. Successful exceptions have added entertainment and experiential features, added big-box stores as anchors, or converted to other specialized shopping center formats: power centers, lifestyle centers, factory outlet centers, and festival marketplaces."},{"page_url":"https://sv.wikipedia.org/wiki/Arena_V%C3%A4nersborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Arena_V%C3%A4nersborg.JPG","page_title":"Arena Vänersborg","context_page_description":"Arena Vänersborg är en inomhushall för bland annat bandy, vid idrottscentrum i Vänersborg. Den väntades stå klar under andra kvartalet 2009 men invigdes först i slutet av september 2009."},{"page_url":"https://de.wikipedia.org/wiki/Royal_Standard","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Royal_Standard_of_Barbados.svg","page_title":"Royal Standard","context_page_description":"Die Royal Standard ist die offizielle Flagge der britischen Königin Elisabeth II. in ihrer Funktion als Staatsoberhaupt des Vereinigten Königreichs und zahlreicher anderer Staaten.\\nDie in Großbritannien verwendete Royal Standard besteht, genau wie das zugehörige Wappen, aus den Wappen von England, Schottland und Nordirland. In den übrigen Commonwealth-Staaten ist sie aus den jeweils dort verwendeten Wappen zusammengesetzt. Im Flaggenprotokoll hat die Royal Standard die höchste Rangordnung. Sie darf nur auf Gebäuden gehisst werden, in denen die Königin gerade weilt. Sie weht über der Union Flag, den Flaggen anderer Mitglieder der königlichen Familien und den Flaggen der Teilstaaten. Die Royal Standard wird niemals auf halbmast gehisst, weil sie das Symbol der Institution Monarchie ist, die ohne Unterbrechung fortlebt."},{"page_url":"https://en.wikipedia.org/wiki/George_Pechell_Mends","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/HMS_Conqueror_wrecked.jpg","page_title":"George Pechell Mends","context_page_description":"George Pechell Mends was an English sailor and amateur artist.\\nHe joined the Royal Navy in 1824, first serving on his father's ship. After ten years, he became an officer and served on several other ships. His first command was HMS Pioneer and his subsequent commands were HMS Nimrod and HMS Edgar. When the latter was paid off in 1866, he retired as a captain on half-pay. Throughout his service on naval stations all over the world, he painted watercolours which typically showed ships and nautical landscapes."},{"page_url":"https://pt.wikipedia.org/wiki/Sauchy-Cauchy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/%C3%89glise-sauchy-cauchy-62.jpeg","page_title":"Sauchy-Cauchy","context_page_description":"Sauchy-Cauchy é uma comuna francesa na região administrativa de Altos da França, no departamento de Pas-de-Calais. Estende-se por uma área de 4,1 km²."},{"page_url":"https://fr.wikipedia.org/wiki/Bertrand_d%27Eschaud","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Bertrand_d%27Echaux.jpg","page_title":"Bertrand d'Eschaud","context_page_description":"Bertrand d'Eschaud, d'Echaux, Etchauz, ou des Chaux, né à Saint-Étienne-de-Baïgorry en 1556 ou 1557 mort le 21 mai 1641, est un prélat français des XVIᵉ et XVIIᵉ siècles. Il est successivement évêque de Bayonne, puis archevêque de Tours. Prélat-commandeur du Saint-Esprit, Bertrand d'Eschaud est premier aumônier du roi Henri IV, dont il est parent, et de Louis XIII, qui lui promet le cardinalat."},{"page_url":"https://sl.wikipedia.org/wiki/Gotska_arhitektura","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Cath%C3%A9drale_Notre-Dame_%28Noyon%29-Abside_et_ch%C5%93ur_adjusted.jpg","page_title":"Gotska arhitektura","context_page_description":"Pod pojmom Gotska arhitektura razumemo srednjeveški slog v gradbeništvu in umetnosti, ki se je začel z izgradnjo kora v opatijski cerkvi sv. Dionizija pri Parizu, pri čemer je opat Suger, ki ga je dal zgraditi, zahteval, da mora biti cerkev najimenitnejša v Franciji in polna svetlobe, torej svetlejša kot dosedanje. Ta druga zahteva je bila ključna za oblikovanje gotske arhitekture. Slog je cvetel v času visokega in poznega srednjega veka.\\nZnačilnosti sloga zašiljen lok, rebrast obok in zunanji oporni loki. Gotska arhitektura je najbolj znana kot arhitektura številnih velikih stolnic, opatij in cerkva v Evropi. Prav tako je arhitektura številnih gradov, palač, mestnih hiš, cehovskih dvoran, univerz in manj vidnem obsegu, v zasebnih stanovanjih.\\nIz tega obdobja je ohranjeno veliko število cerkvenih stavb, pri katerih je pomembna že najmanjša strukturna arhitekturna razlika. Mnoge večje stolnice pa veljajo za neprecenljive umetnine in so navedene na seznamu UNESCO kot svetovna kulturna dediščina. Zaradi tega je študija gotske arhitekture v veliki meri študija stolnic in cerkva."},{"page_url":"https://es.wikipedia.org/wiki/Warnow","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Warnow_durchbruchstal.jpg","page_title":"Warnow","context_page_description":"Warnow es un municipio situado en el distrito de Mecklemburgo Noroccidental, en el estado federado de Mecklemburgo-Pomerania Occidental, a una altura de 39 metros. Su población a finales de 2016 era de 636 habs. y su densidad poblacional, 40 hab/km².​\\nEste municipio da nombre al río Warnow, que desemboca en el mar Báltico."},{"page_url":"https://en.wikipedia.org/wiki/Karsdorf_remains","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Karsdorf_in_BLK.svg","page_title":"Karsdorf remains","context_page_description":"The Karsdorf remains are the bodies of more than 30 Neolithic humans who were buried in the vicinity of Karsdorf, Sachsen-Anhalt, Germany.\\nTwo males, known as KAR6 and KAR16a, have been of great interest to scholars as the subject of successful Y-DNA analysis. Both have been found to belong to subclades of Y-DNA Haplogroup T1, which is rare in modern populations. These ancient specimens' mtDNA haplogroups have been found to be H1* and H46b. Their autosomal ancestral components also consist of around 70% \\"Western European Hunter-Gatherer\\" and 30% \\"Basal Eurasian\\". Both men lived 7500–6800 BP and belonged to the Linienbandkeramische Kultur."},{"page_url":"https://de.wikipedia.org/wiki/Goldene_Acht","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Colias_hyale_qtl1.jpg","page_title":"Goldene Acht","context_page_description":"Die Goldene Acht, auch Posthörnchen, Kleines Posthörnchen, Weißklee-Gelbling, Gemeiner Gelbling, Gelber Heufalter oder Gemeiner Heufalter, ist ein Schmetterling aus der Familie der Weißlinge in der Unterfamilie der Gelblinge. Das Artepitheton leitet sich von einer Waldnymphe aus der griechischen Mythologie ab. Die in Aussehen und Größe sehr variable Art meidet heiße Gebiete und kommt von Westeuropa bis China vor.\\nSie wurde von der Umweltstiftung BUND zum Schmetterling des Jahres 2017 gekürt."},{"page_url":"https://es.wikipedia.org/wiki/Pol%C3%ADtica_econ%C3%B3mica_del_gobierno_de_Hugo_Ch%C3%A1vez","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Venezuela_Black_Market_2010-2014.png","page_title":"Política económica del gobierno de Hugo Chávez","context_page_description":"Desde su elección en 1998 hasta su muerte en marzo de 2013, el gobierno del fallecido presidente venezolano Hugo Chávez propuso y promulgó políticas económicas populistas como parte de su Revolución Bolivariana.\\nA principios de la década de 2000, cuando los precios del petróleo se dispararon y le ofrecieron fondos a Chávez no vistos desde el comienzo del colapso económico de Venezuela en la década de 1980.​​ A nivel nacional, Chávez utilizó esos fondos petroleros para políticas populistas, creando las \\"Misiones Bolivarianas\\", destinadas a brindar servicios públicos para mejorar las condiciones económicas, culturales y sociales.​ Estas políticas incluían la redistribución de la riqueza, la reforma agraria y la democratización de la actividad económica mediante la autogestión del lugar de trabajo y la creación de cooperativas propiedad de los trabajadores A nivel internacional, la administración de Chávez utilizó la producción de petróleo para aumentar la autonomía de los gobiernos de Estados Unidos y Europa y utilizó los fondos petroleros para promover la integración económica y política con otras naciones latinoamericanas."},{"page_url":"https://war.wikipedia.org/wiki/Calidris_himantopus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Calidris_himantopus.jpg","page_title":"Calidris himantopus","context_page_description":"An Calidris himantopus in uska species han Aves nga syahan ginhulagway ni Bonaparte hadton 1826. An Calidris himantopus in nahilalakip ha genus nga Calidris, ngan familia nga Scolopacidae. Ginklasipika han IUCN an species komo diri gud kababarak-an. Waray hini subspecies nga nakalista."},{"page_url":"https://hsb.wikipedia.org/wiki/Chust_(Ukraina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/%D0%84%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D1%81%D1%82%D0%B5%D0%BB_5.jpg","page_title":"Chust (Ukraina)","context_page_description":"Chust je město w Zakarpatskej oblasći na samym juhozapadźe Ukrainy, při hranicy z Madźarskej a Rumunskej. Leži při prawym brjoze rěki Tysa něhdźe 110 kilometrow juhowuchodnje Užhoroda.\\nMa něhdźe 28 tysac wobydlerjow.\\nSydlišćo załoži so po Mongolskich wójnow srjedź 13. lětstotka; prěnje naspomnjenje pochadźa pak hakle z lěta 1329. Hač do lěta 1919 bě město dźěl madźarskeho kralestwa a mjez swětowymaj wójnomaj słušeše do awtonomneje Zakarpatskeje w Čěskosłowakskej. Wot měrca 1939 hač do kónca wójny bě znowa dźěl Madźarskeje."},{"page_url":"https://sv.wikipedia.org/wiki/Waka_Waka_(This_Time_for_Africa)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Shakira-15.JPG","page_title":"Waka Waka (This Time for Africa)","context_page_description":"Waka Waka (This Time for Africa) på engelska eller Waka Waka på spanska är en remix av den kamerunska hitlåten Tsamina eller Zangaléwa av Golden Sounds från 1986. Remixen släpptes 2010 med den colombianska sångerskan Shakira och var den officiella VM-låten för Världsmästerskapet i fotboll 2010. Den finns på Listen Up! The Official 2010 FIFA World Cup Album.\\n\\"Waka Waka\\" fick blandad kritik. Låten gick in på listorna i många länder: etta i Sverige, Italien och Spanien, tvåa i Schweiz och bland de tio främsta i flera europeiska länder.\\nTrots sin starka koppling till fotbolls-VM som slutade i juli 2010 höll låtens popularitet i sig i Sverige under resten av året också. Så sent som i oktober 2010 återfanns \\"Waka Waka\\" på förstaplatsen på Digilistan och på Sverigetopplistan."},{"page_url":"https://tr.wikipedia.org/wiki/%C5%9Ei%C5%9Fe_ba%C4%9F%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/SiseBagi1.JPG","page_title":"Şişe bağı","context_page_description":"Şişe bağı ip ortasında bir bağdır. Kaygan yuvarlak ama üst ucunda az bir genişleme olan eşyaları sıkıca gevşemeden tutabilir."},{"page_url":"https://de.wikipedia.org/wiki/Friedhelm_Zeuner","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Simeonkirche_Hamburg-Hamm_%282%29.JPG","page_title":"Friedhelm Zeuner","context_page_description":"Friedhelm Zeuner ist ein deutscher Architekt."},{"page_url":"https://en.wikipedia.org/wiki/Pulsed_plasma_thruster","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/SchematiclayoutofaPulsedPlasmaThruster.png","page_title":"Pulsed plasma thruster","context_page_description":"A pulsed plasma thruster, also known as a plasma jet engine, is a form of electric spacecraft propulsion. PPTs are generally considered the simplest form of electric spacecraft propulsion and were the first form of electric propulsion to be flown in space, having flown on two Soviet probes starting in 1964. PPTs are generally flown on spacecraft with a surplus of electricity from abundantly available solar energy."},{"page_url":"https://en.wikipedia.org/wiki/Kurapaty","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/KURAPATY5.JPG","page_title":"Kurapaty","context_page_description":"Kurapaty is a wooded area on the outskirts of Minsk, Belarus, in which a vast number of people were executed between 1937 and 1941 during the Great Purge by the Soviet secret police, the NKVD.\\nThe exact count of victims is uncertain, as NKVD archives are classified in Belarus. According to various sources the number of people who perished in Kurapaty is estimated in at least 30,000 people, up to 100,000 people, from 102,000 to 250,000 people, 250,000 people, and more.\\nIn 2004 Kurapaty mass graves were included in the register of the Cultural Properties of Belarus as a first-category cultural heritage."},{"page_url":"https://de.wikipedia.org/wiki/Schonen-Linie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Bunker%2C_Ystad_sandskog.jpg","page_title":"Schonen-Linie","context_page_description":"Die Schonen-Linie war eine 500 km lange Kette von leichten Befestigungen an der Küste der südschwedischen Region Schonen. Zweck dieser Verteidigungslinie war der Schutz der Neutralität Schwedens vor einer möglichen deutschen, alliierten oder sowjetischen Invasion während des Zweiten Weltkrieges. Die Schonen-Linie von Halland über Schonen bis Blekinge bestand aus zwei Verteidigungslinien:\\nErste Verteidigungslinie: Betonbunker am Ufer, bewaffnet mit Maschinengewehren und leichten Kanonen.\\nZweite Verteidigungslinie: 300 Meter landeinwärts bewaffnete Truppen hinter Stacheldraht, einige in Betonbunker"},{"page_url":"https://pt.wikipedia.org/wiki/Maria_Paula_Fidalgo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Boas-vindas_aos_calouros_inspira_solidariedade_na_vida_acad%C3%AAmica_%2835673633583%29.jpg","page_title":"Maria Paula Fidalgo","context_page_description":"Maria Paula Fidalgo é uma apresentadora, psicóloga e atriz brasileira. É embaixadora da Rede Brasileira de Bancos de Leite Humano. Escreve para o Correio Braziliense desde 2005."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%DA%A9%DB%8C%D8%A7%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Acciano_08_%28RaBoe%29.jpg","page_title":"اکیانو","context_page_description":"اکیانو ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر."},{"page_url":"https://de.wikipedia.org/wiki/Radelfingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Radelfingen_Reformierte_Kirche_01.jpg","page_title":"Radelfingen","context_page_description":"Radelfingen ist eine politische Gemeinde im Verwaltungskreis Seeland des Kantons Bern in der Schweiz. Zu Radelfingen gehören auch die Ortschaften Landerswil, Detligen, Jucher, Obermatt, Ostermanigen, Oltigen, Oberruntigen und Matzwil."},{"page_url":"https://hu.wikipedia.org/wiki/Antietami_csata","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Antietam_field.jpg","page_title":"Antietami csata","context_page_description":"Az antietami csatát 1862. szeptember 17-én Sharpsburg közelében vívták, az Antietam-patak mentén. Ez volt a döntő ütközet a konföderációs erők marylandi hadjáratában, és az amerikai polgárháború első nagyobb, északi területen lezajlott összecsapása. 23 000 fős összveszteséggel ez volt az USA addigi legvéresebb, egy napon belül lezajlott ütközete.\\nMiután Robert E. Lee, a Konföderáció tábornagya Marylandbe űzte az Unió hadseregét, George B. McClellan vezérőrnagy támadást indított Lee az Antietam-patak mögött védelmi állásokat elfoglaló hadseregével szemben. Szeptember 17-én hajnalban Joseph Hooker vezérőrnagy hadteste lendületes támadást indított Lee balszárnya ellen. Hullámzó küzdelem folyt a Miller-szántón és a Dunker Church körül. A Sunken Road elleni uniós támadások áttörték a konföderációs centrumot, de a sikert nem aknázták ki. Délután megérkezett Ambrose Burnside vezérőrnagy hadteste és beavatkozott a küzdelembe, miáltal az Unió megkaparintotta az Antietam-patak kőhídját és a konföderációs jobbszárnyat szorongatta. Az ütközet tetőpontján A.P."},{"page_url":"https://vi.wikipedia.org/wiki/Walworth_(th%E1%BB%8B_tr%E1%BA%A5n),_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/WIMap-doton-Walworth.png","page_title":"Walworth (thị trấn), Wisconsin","context_page_description":"Walworth là một thị trấn thuộc quận Walworth, tiểu bang Wisconsin, Hoa Kỳ. Năm 2010, dân số của thị trấn này là 1.653 người."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%83%AB%E3%83%8B%E3%83%8A%E6%80%A5%E8%A1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/MiralagoExpress.jpg","page_title":"ベルニナ急行","context_page_description":"ベルニナ急行は、スイス、グラウビュンデン州を中心に路線網を持つレーティッシュ鉄道が運行する特急列車および特急車両の総称である。ベルニナ特急と訳されることもある。\\n列車によりサン・モリッツ＝ティラーノ間を結ぶベルニナ線のみを走るもの、クールからアルブラ線を経由してベルニナ線へ乗り入れるもの、ダヴォスからアルブラ線に乗り入れ、ベルニナ線へ結んで走るものなどがある。"},{"page_url":"https://en.wikipedia.org/wiki/British_Rail_corporate_liveries","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/416_at_Dalton_Kingsland1.jpg","page_title":"British Rail corporate liveries","context_page_description":"The history of British Rail's corporate liveries is quite complex. Although from the mid-1960s to the 1980s the organisation was associated with \\"Rail Blue\\", a number of other schemes were also used, especially when it was split into operating units or \\"sectors\\" in the mid-1980s."},{"page_url":"https://pt.wikipedia.org/wiki/Bernard_Diom%C3%A8de","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Bernard_Diom%C3%A8de_2006.jpg","page_title":"Bernard Diomède","context_page_description":"Bernard-Thierry Diomède é um ex-futebolista francês. Disputou a Copa de 1998."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_obci_%C4%BDubica","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/%C4%BDubica_%28okres_Ke%C5%BEmarok%29%2C_ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Ducha%2C_widok_ze_strony_zachodniej.jpg","page_title":"Zoznam kultúrnych pamiatok v obci Ľubica","context_page_description":"Toto je zoznam kultúrnych pamiatok v obci Ľubica v okrese Kežmarok.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://la.wikipedia.org/wiki/Albertus_Einstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Niels_Bohr_Albert_Einstein_by_Ehrenfest.jpg","page_title":"Albertus Einstein","context_page_description":"Albertus Einstein fuit philosophus naturae et rerum physicarum investigator anno 1921 praemio Nobeliano physicae laureatus."},{"page_url":"https://tr.wikipedia.org/wiki/Nobel_Kimya_%C3%96d%C3%BCl%C3%BC_sahipleri_listesi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Onsager_1968.jpg","page_title":"Nobel Kimya Ödülü sahipleri listesi","context_page_description":"Nobel Kimya Ödülü sahipleri kimyanın çeşitli dallarından biliminsanlarına İsveç Kraliyet Bilimler Akademisi tarafından her yıl takdim edilir. Nobel Ödülü, Alfred Nobel'in 1895 tarihli vasiyeti üzerine; kimya, fizik, edebiyat, barış, ve fizyoloji veya tıp alanlarında olmak üzere beş dalda seçkin katkılarda bulunanlara verilmeye başlanmıştır. Nobel'in vasiyetinde belirttiği gibi, ödül sahibine İsveç Kraliyet Bilimler Akademisi'nin seçtiği beş üyelik komite tarafından karar verilir ve ödül Nobel Vakfı tarafından karşılanır. Nobel Kimya Ödülü ilk kez 1901 yılında verilmiş, bu ödülü Hollanda'dan Jacobus Henricus van 't Hoff kazanmıştır. Her ödül sahibi, bir madalya, bir diploma ve miktarı yıllara göre değişen nakit para ile ödüllendirilir. 1901 yılında, van 't Hoff 150.782 İsveç kronu almıştır, ki bu Aralık 2007 tarihinde 7.731.004 İsveç kronuna eşdeğerdir. 2008 yılında, bu ödüle Osamu Shimomura, Martin Chalfie ve Roger Y. Tsien nail görülmüş ve 10.000.000 İsveç kronu ile ödüllendirilmişlerdir. Ödül töreni; geleneksel olarak Stokholm'da, Nobel'in ölüm yıldönümü olan 10 Aralık tarihinde yapılmaktadır."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D1%80%D0%B1%D0%B8_%D1%83_%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%98%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Dejan_Stankovi%C4%87_-_Inter_Mailand_%281%29.jpg","page_title":"Срби у Италији","context_page_description":"Срби у Италији су грађани Италије српског порекла или људи рођени у Србији који живе и раде у Италији."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B2%D1%8F%D1%82%D0%B0-%D0%9F%D0%B5%D1%82%D1%80%D0%B0-%D0%9F%D0%B0%D1%9E%D0%BB%D0%B0%D1%9E%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B0%D1%80%D0%BA%D0%B2%D0%B0_(%D0%93%D0%B0%D1%80%D0%BD%D0%B0%D1%81%D1%82%D0%B0%D0%B5%D0%B2%D1%96%D1%87%D1%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/%D0%93%D0%B0%D1%80%D0%BD%D0%B0%D1%81%D1%82%D0%B0%D0%B5%D0%B2%D1%96%D1%87%D1%8B._%D0%A1%D1%8F%D0%B4%D0%B7%D1%96%D0%B1%D0%B0._%D0%A6%D0%B0%D1%80%D0%BA%D0%B2%D0%B0_%28XX%29.jpg","page_title":"Свята-Петра-Паўлаўская царква (Гарнастаевічы)","context_page_description":"Свята-Петра-Паўлаўская царква — праваслаўны храм у вёсцы Гарнастаевічы Свіслацкага раёна Гродзенскай вобласці. З'яўляецца часткай сядзібна-паркавага ансамбля Бутаўт-Андрэйкавічаў. Помнік архітэктуры класіцызму."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E6%B1%9F%E8%8B%8F%E8%B7%AF%E5%9F%BA%E7%9D%A3%E6%95%99%E5%A0%82_(%E5%8D%97%E4%BA%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/%E5%8D%97%E4%BA%AC%E6%B1%9F%E8%8B%8F%E8%B7%AF%E5%9F%BA%E7%9D%A3%E6%95%99%E5%A0%82.jpg","page_title":"江苏路基督教堂 (南京)","context_page_description":"南京江蘇路基督教堂，為位於江蘇省南京市鼓樓區江蘇路60-10號的一座基督教堂，原名靈光堂。"},{"page_url":"https://pl.wikipedia.org/wiki/Herb_Charkowa","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Kupyansk-herb.png","page_title":"Herb Charkowa","context_page_description":"Herb Charkowa – jeden z oficjalnych symboli Charkowa."},{"page_url":"https://ro.wikipedia.org/wiki/Strepsiptera","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/StrepsipteraFem.jpg","page_title":"Strepsiptera","context_page_description":"Strepsiptera este un ordin de insecte endopterigote, care conține mai mult de 600 de specii. Majoritatea vieții lor, aceste insecte trăiesc ca paraziți la alte insecte, cum ar fi albine, viespi și blatodee."},{"page_url":"https://en.wikipedia.org/wiki/Victor_G._Garcia_III","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Victor_G._Garcia_III_%2801119154%29_%28cropped%29.jpg","page_title":"Victor G. Garcia III","context_page_description":"Victor G. Garcia III is the Ambassador Extraordinary and Plenipotentiary of the Republic of the Philippines to the Russian Federation."},{"page_url":"https://en.wikipedia.org/wiki/Hillman_Husky","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Hillman_Husky_Series_II_front.jpg","page_title":"Hillman Husky","context_page_description":"The Hillman Husky was a line of British passenger vehicles manufactured between 1954 and 1970 by Hillman."},{"page_url":"https://fi.wikipedia.org/wiki/Farmarihousut","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Levi%27s_506_front.jpg","page_title":"Farmarihousut","context_page_description":"Farmarihousut eli farkut ovat denim-kankaasta tehdyt, useimmiten siniseksi värjätyt housut.\\nFarmarihousujen kantamuoto, kestävästä kankaasta tehdyt housut kehitettiin alun perin 1500-luvun Genovan kaupunkivaltiossa työhousuiksi laivaston merimiehille. Ranskalaiset kopioivat idean ja kehittivät oman kankaan, jolle antoivat nimeksi denim. Kyseisestä kankaasta tehtyjä housuja ranskalaiset taas alkoivat kutsua kankaan väriin viittaavalla nimellä \\"Bleu de Gênes\\" - genovansininen. Englanninkielinen sana jeans muistuttaa äännettäessä sanaa Gênes. 1700-luvulla farkut päätyivät Amerikkaan, kun brittiläiset kauppiaat myivät niitä työhousuiksi kaivos-, tehdas- ja rautatietyöläisille.\\nFarkkuja kehitettiin edelleen Yhdysvalloissa 1872. Saksalaissyntyisen, San Franciscoon muuttaneen kauppiaan Levi Straussin asiakas, räätäli Jacob Davis Nevadan Renosta sai idean vahvistaa farmarihousuja repeämiselle alttiista kohdista kupariniiteillä. Kestävien housujen suosio oli suuri ja Davis tajusi tehneensä tärkeän keksinnön. Davisilla ei ollut varaa hakea patenttia keksinnölleen yksin, joten hän ehdotti yhteistyötä Levi Straussille, ja he hakivat patentin yhdessä."},{"page_url":"https://eo.wikipedia.org/wiki/Malgranda_reao","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Rhea_pennata_-Patagonia_-Chile-8.jpg","page_title":"Malgranda reao","context_page_description":"La Malgranda reao, ankaŭ Darvina reao aŭ Darvin-nanduo, laŭ hodiaŭa klasado kaj scienca nomo Flugila pteroknemio nome aŭ eĉ pli simple Pteroknemio, estas neotropisa specio el la birdofamilio de la Reaedoj en la ordo de la Strutoformaj. Ĝi estas granda nefluga birdo, sed ja la plej malgranda el la du vivantaj specioj de reaoj. Ĝi troviĝas en Altiplano kaj Patagonio en Sudameriko."},{"page_url":"https://eu.wikipedia.org/wiki/Xalbador","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Urepel_Xalbador1.jpg","page_title":"Xalbador","context_page_description":"Xalbador, jaiotzako izen-deiturez Fernando Aire Etxart bertsolaria eta artzaina izan zen. Bertsolari liriko eta poetikoa, seriostasuna eta malenkonia ordezkatu izan zituen anitzetan; bizitza, familia, baserria, fedea eta natura izan zituen bertsoetako gai. Mattinekin batera, Ipar eta Hego Euskal Herriko bertsozaleak elkartu zituen. Ezin bertzean eta Odolaren mintzoa bertso bildumak eman zituen argitara. Zorigaitzez, 1976ko azaroaren 7an Urepele bere jaioterrian ospatu zitzaion omenaldi-egunean bihotzekoak jota hil zen. Euskaltzain ohorezko izendatu zuten 1977an.\\nBere garaiko bertsolari txapelketa eta sariketa gehien-gehienetan parte hartu zuen. 1946tik 1960ra bitartean, Hego Euskal Herriko bertso saioetako asko irabazi zituen. 1960ko Bertsolari Txapelketa Nagusian hirugarren izan zen; 1962 eta 1965ekoetan, hirugarren; eta 1967koan, bigarren. Azken urte horretan, txapelketa horretako historian izan den gertakari ospetsuenetako baten protagonista izan zen, gainera."},{"page_url":"https://cy.wikipedia.org/wiki/Priordy","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Turner%2C_J._M._W._-_Transept_of_Ewenny_Priory%2C_Glamorganshire.jpg","page_title":"Priordy","context_page_description":"Mynachlog Gristnogol dan reolaeth prior yw priordy. Cymuned fechan o fynachod sy'n byw mewn priordy, sydd fel rheol yn gangen o gymuned fwy sy'n byw mewn abaty dan reolaeth abad. Ystyr lythrennol y gair 'priordy' yw \\"Tŷ'r Prior\\" mewn cyferbyniad â \\"Thŷ'r Abad\\", sef yr abaty.\\nEr bod prioresau i'w cael yn yr eglwys Gristnogol nid yw'n arfer galw eu tai yn briordai."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A9%94%EB%A6%B4%EB%9E%9C%EB%93%9C%EC%A3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Annapolis_Maryland_wide_by_D_Ramey_Logan_with_Grant_Jensen.jpg","page_title":"메릴랜드주","context_page_description":"메릴랜드주는 미국 동부 대서양 연안의 주이다. 남쪽과 서쪽에는 버지니아주, 웨스트버지니아주, 워싱턴 D.C.가 있고 북쪽에는 펜실베이니아주, 동쪽에는 델라웨어주가 있다. 미국 해군사관학교가 메릴랜드 주의 주도인 아나폴리스에 있다. 주 이름은 잉글랜드 왕 찰스 1세의 왕비 헨리에타 마리아에서 유래되었다. 19세기 초에는 노예주에 속했으며 결국 남북 전쟁 당시 적어도 연방 탈퇴는 하지 않은 상태에서 북부 지지자와 남부 지지자가 반반씩 갈렸다."},{"page_url":"https://en.wikipedia.org/wiki/Allan_Mossop","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Sir_Allan_Mossop_and_Clarence_Gauss.png","page_title":"Allan Mossop","context_page_description":"Sir Allan George Mossop was a British judge of South African origin who served in China. He was the Chief Judge of the British Supreme Court for China from 1933 to 1943."},{"page_url":"https://fr.wikipedia.org/wiki/Stade_municipal_de_P%C3%A9ronnas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Stade_municipal_P%C3%A9ronnas_01.jpg","page_title":"Stade municipal de Péronnas","context_page_description":"Le stade municipal de Péronnas est un stade de football, situé à Péronnas dans l'Ain. Le FC Bourg-Péronnas y a évolué jusqu'en 2015. Il peut accueillir 4 800 spectateurs."},{"page_url":"https://sv.wikipedia.org/wiki/N%C3%B6ttja_urskog","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Goodyera_repens_%28habitus%29.jpg","page_title":"Nöttja urskog","context_page_description":"Nöttja urskog är ett naturreservat i Ljungby kommun i Kronobergs län.\\nReservatet är 5 hektar stort och beläget sydost om Torpa. Från början var det ett domänreservat som avsattes 1960. Det omvandlades till naturreservat 1996.\\nOmrådet består av gammal barrblandskog där de äldsta träden är uppemot 300 år. Därför finns det gott om lågor och högstubbar. Reservatet sluttar brant och är rikt på block. Orkidén knärot förekommer i naturreservatet."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%AF%D9%86%DB%8C%D8%A7_%D8%AF%DB%92_%D8%B3%D8%A8%D8%AA%D9%88%DA%BA_%D9%88%DA%88%DB%92_%D8%B4%DB%81%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Mumbai_Skyline_at_Night.jpg","page_title":"دنیا دے سبتوں وڈے شہر","context_page_description":"ایہ لسٹ جگ دے سب توں وڈے شہراں دی اے۔"},{"page_url":"https://en.wikipedia.org/wiki/Graptopetalum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Graptopetalum_amethystinum_3.jpg","page_title":"Graptopetalum","context_page_description":"Graptopetalum is a plant genus of the family Crassulaceae. They are perennial succulent plants and native to Mexico and Arizona. They grow usually in a rosette. There are around 19 species in this genus."},{"page_url":"https://en.wikipedia.org/wiki/IPod","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Ipod_sales_per_quarter.svg","page_title":"IPod","context_page_description":"The iPod is a line of portable media players and multi-purpose pocket computers designed and marketed by Apple Inc. The first version was released on October 23, 2001, about ​8 ¹⁄₂ months after the Macintosh version of iTunes was released. As of May 28, 2019, only the iPod Touch remains in production.\\nLike other digital music players, some versions of the iPod can serve as external data storage devices. Prior to macOS 10.15, Apple's iTunes software could be used to transfer music, photos, videos, games, contact information, e-mail settings, Web bookmarks, and calendars to the devices supporting these features from computers using certain versions of Apple macOS and Microsoft Windows operating systems.\\nBefore the release of iOS 5, the iPod branding was used for the media player included with the iPhone and iPad, a combination of the Music and Videos apps on the iPod Touch. As of iOS 5, separate apps named \\"Music\\" and \\"Videos\\" are standardized across all iOS-powered products. While the iPhone and iPad have essentially the same media player capabilities as the iPod line, they are generally treated as separate products."},{"page_url":"https://et.wikipedia.org/wiki/M%C3%A4nni-koorelutikas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Aradus_cinnamomeus-ZSM.jpg","page_title":"Männi-koorelutikas","context_page_description":"Männi-koorelutikas lutikaliste alamseltsi kuuluv putukaliik.\\nPutukat on ka Eestis."},{"page_url":"https://sk.wikipedia.org/wiki/Pot%C3%A1pa%C4%8D_prostredn%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Rogue_River_Wildlife_%2817581024186%29.jpg","page_title":"Potápač prostredný","context_page_description":"Potápač prostredný je druh z čeľade kačicovité. Obýva Holarktídu, kde hniezdi v dutinách stromov na brehoch veľkých jazier, pri potokoch v lesoch a na brehu západnom pobreží Atlantického oceánu. Na Slovensku je vzácnejší zimný hosť a migrant. Podľa Medzinárodnej únie na ochranu prírody a prírodných zdrojov potápač prostredný patrí medzi najmenej ohrozené druhy, celková populácia je stabilná, európska populácia poklesla o 30% v priebehu troch generácií. V severnej Amerike bol v priebehu 40 rokov zaznamenaný stabilný stav populácie."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%DA%A9%D8%A7%D8%B3%DB%8C%D8%A7%DB%8C_%D9%85%D8%A7%DA%A9%D8%B1%D8%A7%D8%AF%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Acacia_macradenia_foliage_and_flowers_1.jpg","page_title":"آکاسیای ماکرادنیا","context_page_description":"آکاسیا ماکرادنیا نام یک گونه از سرده آکاسیا است."},{"page_url":"https://es.wikipedia.org/wiki/Case_Study_House_N%C2%BA_22._Stahl_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Case_Study_House_22_%285902490232%29.jpg","page_title":"Case Study House Nº 22. Stahl House","context_page_description":"La Stahl House es una casa de estilo moderno diseñada por el arquitecto Pierre Koenig, situada en el 1635 Woods Drive, en las Colinas de Hollywood en Los Ángeles, California. Las fotografías y las evidencias anecdóticas sugiere que el cliente, Buck Stahl, pudo haber proporcionado una fuente de inspiración para el conjunto de la estructura.​ En 2013 fue incluida en el Registro Nacional de Lugares Históricos.​"},{"page_url":"https://ceb.wikipedia.org/wiki/Jardim_(munisipyo_sa_Brasil,_Cear%C3%A1,_lat_-7,64,_long_-39,24)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Munic%C3%ADpio_de_Jardim_%28Cear%C3%A1%29_panorama.jpg","page_title":"Jardim (munisipyo sa Brasil, Ceará, lat -7,64, long -39,24)","context_page_description":"Munisipyo ang Jardim sa Brasil. Nahimutang ni sa estado sa Ceará, sa sidlakang bahin sa nasod, 1,300 km sa amihanan-sidlakan sa Brasília ang ulohan sa nasod. Adunay 26,697 ka molupyo.\\nSa mosunod nga mga natural nga mga bahin makita sa Jardim:\\nSerra do Boqueirão\\nHapit nalukop sa durowan ug kabugangan ang palibot sa Jardim. Dunay mga 36 ka tawo kada kilometro kwadrado sa palibot sa Jardim medyo gamay nga populasyon. Ang klima init nga ugahon. Ang kasarangang giiniton 25 °C. Ang kinainitan nga bulan Oktubre, sa 30 °C, ug ang kinabugnawan Mayo, sa 20 °C. Ang kasarangang pag-ulan 772 milimetro matag tuig. Ang kinabasaan nga bulan Marso, sa 166 milimetro nga ulan, ug ang kinaugahan Agosto, sa 6 milimetro."},{"page_url":"https://it.wikipedia.org/wiki/Geografia_del_Libano","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Lebanon_Topography.png","page_title":"Geografia del Libano","context_page_description":"Il Libano occupa la parte più montuosa di tutta la regione siriaco-palestinese. Il nome stesso di Libano deriva al Paese dall'omonima catena che, allungandosi parallelamente alla costa per 170 km con direzione nord/nord-est–sud/sud-ovest, ne costituisce la spina dorsale.\\nIl territorio ha forma approssimativamente rettangolare, con una lunghezza massima di circa 200 km e una larghezza variante fra i 30 e i 90. Esso risulta così con una superficie di 10.400 km², cioè poco più esteso delle Marche.\\nI suoi confini sono ben delimitati. Il Mar di Levante bagna a occidente il Paese per tutta la sua lunghezza, da Ras en-Nāqūrah, a sud, fino alla foce del Nahr el-Kebir meridionale, a nord; il confine settentrionale segue il corso di questo fiume, quello orientale scavalca le propaggini settentrionali del Libano e, attraversato il Beqaʿa, corre lungo la cresta della catena dell'Antilibano. Questo lungo tratto di confine lo separa dalla Siria. Dove Libano e Antilibano si avvicinano fin quasi a saldarsi con una soglia, ha inizio il confine con Israele, che scende verso sud per una trentina di chilometri, per poi dirigersi a ovest, con andamento quasi rettilineo, fino al mare."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B9%85%E5%B1%B1%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Tensho_Ko_Grand_Shrine_in_Ino-Tensho_Ko_Grand_Shrine_2.jpg","page_title":"久山町","context_page_description":"久山町是位于福冈市东北侧的一个城镇，为福冈都市圈的一部分。\\n辖区东部为山区，因此全境有三分之二的地区为山林地，市区主要集中在辖区的西南部，"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%B5%B7%E5%80%AB%C2%B7%E5%87%B1%E5%8B%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Hellen_Keller_circa_1920.jpg","page_title":"海倫·凱勒","context_page_description":"海伦·凯勒美国作家，社会运动家及讲师。凯勒小时候同时失明与失聪，却凭借老师的耐心教导和自己的勤奋努力，完成了大学教育并成为作家和教育家，成为一个励志的奇迹。\\n她一岁七个月时因急性脑充血引致失明及失聪，也使她无法说话。在1887年，借着她的导师安妮·苏利文对她耐心的教导和关爱，并找到专家使她学会发音，让她学会流畅的表达，才开始与其他人沟通并接受教育。1896年，年仅16岁的海伦·凯勒，面临父亲病逝，安妮·苏利文要她不要过于伤心，反倒要努力读书，考取大学，以告慰父亲的在天之灵。在安妮·苏利文的长期陪伴下，最终海伦·凯勒不但学会阅读和说话，还以惊人的毅力完成了哈佛大学的学业并于1904年毕业，成为有史以来第一个获得文学学士学位的盲聋人士。成年后，她继续广泛阅读刻苦学习，掌握了英语、法语、德语、拉丁语和希腊语，成为盲聋的作家和教育家。1936年，安妮·苏利文老师病逝，享年70岁，她结束陪伴海伦·凯勒的四十七个年头。在那之后，海伦·凯勒更积极参加演讲，希望能把老师对她的爱，继续传讲下去，一直到她过世。她致力于残疾人士事业，四处募捐以改善残疾人的生活环境和受教育水平。她的事迹使她入选美国《时代周刊》“人类十大偶像之一”，被授予“总统自由奖章”。"},{"page_url":"https://vi.wikipedia.org/wiki/Trithemis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Trithemis_festiva_3.jpg","page_title":"Trithemis","context_page_description":"Trithemis là một chi chuồn chuồn ngô thuộc họ Libellulidae. They are thường được biết đến với tên Dropwings.\\nChi này gồm các loài:\\nTrithemis aconita Lieftinck, 1969 – Monkhood Dropwing\\nTrithemis aenea Pinhey, 1961\\nTrithemis aequalis Lieftinck, 1969\\nTrithemis africana - Western Phantom Dropwing\\nTrithemis annulata – Violet Dropwing, Violet-marked Darter\\nTrithemis anomala Pinhey, 1955\\nTrithemis arteriosa – Red-veined Dropwing\\nTrithemis aurora – Crimson Marsh Glider\\nTrithemis basitincta Ris, 1912\\nTrithemis bifida Pinhey, 1970\\nTrithemis bredoi Fraser, 1953\\nTrithemis brydeni Pinhey, 1970\\nTrithemis congolica Pinhey, 1970\\nTrithemis dejouxi Pinhey, 1978\\nTrithemis dichroa Karsch, 1893 - Small Dropwing\\nTrithemis donaldsoni – Denim Dropwing\\nTrithemis dorsalis – Round-hook Dropwing,\\nTrithemis ellenbeckii Förster, 1906\\nTrithemis festiva – Indigo Dropwing, Black Stream Glider\\nTrithemis fumosa Pinhey, 1962\\nTrithemis furva Karsch, 1899 – Navy Dropwing\\nTrithemis grouti Pinhey, 1961 - Black Dropwing\\nTrithemis hartwigi Pinhey, 1970\\nTrithemis hecate Ris, 1912 – Silhouette Dropwing, Hecate Dropwing\\nTrithemis imitata Pinhey, 1961\\nTrithemis integra Dijkstra, 2007\\nTrithemis kalula Kirby, 1900"},{"page_url":"https://es.wikipedia.org/wiki/Segmento","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Image-Golden_ratio_line.png","page_title":"Segmento","context_page_description":"En geometría, el segmento es un fragmento de recta que está comprendido entre dos puntos, llamados puntos extremos o finales.\\nAsí, dado dos puntos A y B, se llama segmento AB a la intersección de la semirrecta de origen A que contiene al punto B con la semirrecta de origen B que contiene al punto A. Los puntos A y B son extremos del segmento y los puntos sobre la recta a la que pertenece el segmento, la «recta sostén», serán interiores o exteriores al segmento según pertenezcan o no a este."},{"page_url":"https://en.wikipedia.org/wiki/Festival_of_Britain","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Festival_of_Britain.JPG","page_title":"Festival of Britain","context_page_description":"The Festival of Britain was a national exhibition and fair that reached millions of visitors throughout the United Kingdom in the summer of 1951. Historian Kenneth O. Morgan says the Festival was a \\"triumphant success\\" during which people:\\nflocked to the South Bank site, to wander around the Dome of Discovery, gaze at the Skylon, and generally enjoy a festival of national celebration. Up and down the land, lesser festivals enlisted much civic and voluntary enthusiasm. A people curbed by years of total war and half-crushed by austerity and gloom, showed that it had not lost the capacity for enjoying itself....Above all, the Festival made a spectacular setting as a showpiece for the inventiveness and genius of British scientists and technologists.\\nLabour cabinet member Herbert Morrison was the prime mover; in 1947 he started with the original plan to celebrate the centennial of the Great Exhibition of 1851. However, it was not to be another World Fair, for international themes were absent, as was the British Commonwealth. Instead the 1951 festival focused entirely on Britain and its achievements; it was funded chiefly by the government, with a budget of £12 million."},{"page_url":"https://ca.wikipedia.org/wiki/Tx%C3%B2loki","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Battle_of_the_Choloki_1854_%28plan%29.jpg","page_title":"Txòloki","context_page_description":"El riu Txòloki és un riu de Geòrgia. Flueix a través de les províncies de Adjària i Gúria, fins als afores de Kobuleti. Durant el segle xix va servir com a frontera entre l'Imperi Otomà i l'Imperi Rus. Dos quilòmetres al nord de la ciutat, es troba un altre riu, el Sharistskali, i deu més enllà, el Rioni. Els tres rius desemboquen al Mar Negre, compartint estuari. En diverses ocasions, el riu s'ha desbocat a causa de les nombroses pluges."},{"page_url":"https://uk.wikipedia.org/wiki/Nectaspida","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Naraoia_spinosa.jpg","page_title":"Nectaspida","context_page_description":"Нектаспіди — вимерлий ряд членистоногих незрозумілого систематичного положення. Автор, Персі Реймонд, відніс групу до трилобітів, деякі ж вчені відносять до окремої власної групи, спорідненої з трилобітами і відноситься до підтипу Трилобітоподібні."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%90%D0%BC%D1%81%D1%8C%D1%86%D1%96%D1%81%D0%BB%D0%B0%D1%9E%D1%81%D0%BA%D0%B0%D0%B5_%D0%B2%D0%B0%D1%8F%D0%B2%D0%BE%D0%B4%D0%B7%D1%82%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Miensk-Am%C5%9Bcis%C5%82a%C5%AD-Po%C5%82acak-Viciebsk._%D0%9C%D0%B5%D0%BD%D1%81%D0%BA-%D0%90%D0%BC%D1%81%D1%8C%D1%86%D1%96%D1%81%D0%BB%D0%B0%D1%9E-%D0%9F%D0%BE%D0%BB%D0%B0%D1%86%D0%B0%D0%BA-%D0%92%D1%96%D1%86%D0%B5%D0%B1%D1%81%D0%BA_%281781%29.jpg","page_title":"Амсьціслаўскае ваяводзтва","context_page_description":"Амсьці́слаўскае ваяво́дзтва — адміністрацыйна-тэрытарыяльная адзінка на ўсходзе Вялікага Княства Літоўскага. Плошча каля 22,6 тыс. км². Сталіца — места Амсьціслаў. Найбольшыя месты і мястэчкі: Дрыбін, Жукава, Крычаў, Радамля, Радзівілаў, Расна, Хаславічы, Шумячы."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9F%A5%E8%80%B6%E8%92%82%E7%B4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Sirogojno_-_panoramio_%282%29.jpg","page_title":"查耶蒂納","context_page_description":"查耶蒂纳，是塞尔维亚的城镇，位于该国西部，由兹拉提波尔州负责管辖，面积647平方公里，海拔高度843米，2011年人口14,745，人口密度每平方公里23人。"},{"page_url":"https://fr.wikipedia.org/wiki/Metasequoia_glyptostroboides","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Dawn_Redwood_-_Autumn.jpg","page_title":"Metasequoia glyptostroboides","context_page_description":"Metasequoia glyptostroboides, aussi appelé « sapin d'eau », est une espèce de grand arbre de la famille des Taxodiaceae, ou des Cupressaceae selon la classification phylogénétique. Il est originaire de Chine où il a été découvert en 1943. C'est l'unique espèce vivante du genre Metasequoia dont l'origine remonte au Pliocène et à ce titre est considéré comme une forme panchronique.\\nLe nom du genre Metasequoia vient du grec meta et de sequoia, un genre de grands arbres de la même famille. L'épithète spécifique glyptostroboides signifie « semblable au Glyptostrobus ». Glyptostrobus pensilis est un cyprès chinois des marais, également originaire de Chine."},{"page_url":"https://io.wikipedia.org/wiki/Independence,_Missouri","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/I_km.jpg","page_title":"Independence, Missouri","context_page_description":"Independence esas urbo e sideyo di la komtio Jackson, Missouri, Usa. Segun la demografiala kontado di 2010, ol havis 116 830 habitanti. Ol esas la 5ma maxim populoza urbo di Missouri."},{"page_url":"https://pl.wikipedia.org/wiki/Synagoga_w_Osjakowie","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Osjak%C3%B3w%2C_synagogue1.jpg","page_title":"Synagoga w Osjakowie","context_page_description":"Synagoga w Osjakowie – synagoga znajdująca się w Osjakowie przy ulicy Częstochowskiej 3.\\nSynagoga została zbudowana na początku XIX wieku. Podczas II wojny światowej hitlerowcy zdewastowali wnętrze synagogi. Po zakończeniu wojny budynek przebudowano na magazyn. W 2003 roku synagoga została zakupiona przez osoby prywatne, które planują w niej urządzić galerię sztuki.\\nMurowany i orientowany budynek synagogi wzniesiono na planie prostokąta. Wewnątrz na ścianie wschodniej zachowało się obramowanie wyznaczające miejsce po Aron ha-kodesz. Częściowo zachował się wystrój zewnętrzny."},{"page_url":"https://en.wikipedia.org/wiki/Madrasa_Asfouria","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/M%C3%A9dersa_Asfouria_photo_5_%D8%A7%D9%84%D9%85%D8%AF%D8%B1%D8%B3%D8%A9_%D8%A7%D9%84%D8%B9%D8%B5%D9%81%D9%88%D8%B1%D9%8A%D8%A9.jpg","page_title":"Madrasa Asfouria","context_page_description":"Madrasa Asfouria is one of the madrasahs of the medina of Tunis, which was constructed during the Hafsid era."},{"page_url":"https://ro.wikipedia.org/wiki/Montana,_Bulgaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Coat_of_Arms_of_Montana_%28Bulgaria%29.png","page_title":"Montana, Bulgaria","context_page_description":"Montana este un oraș în Obștina Montana, Regiunea Montana, Bulgaria."},{"page_url":"https://pt.wikipedia.org/wiki/Nogueira_(Maia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Church_Nogueira_by_Henrique_Matos_02.JPG","page_title":"Nogueira (Maia)","context_page_description":"Nogueira é uma freguesia portuguesa do concelho da Maia, com 4,08 km² de área e 5 473 habitantes. Densidade: 1 341,4 hab/km²."},{"page_url":"https://no.wikipedia.org/wiki/Veggli_stavkirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Veggli_stolpe_C3017_Cf33926_001_C3017.jpg","page_title":"Veggli stavkirke","context_page_description":"Veggli stavkirke var en stavkirke i Veggli i Rollag kommune i Numedal.\\nKirkens alder synes ikke kjent. Våre kunnskaper om den bygger for en stor del på oppmålinger og skisser utarbeidet av Christian Christie før kirken ble revet i 1861, to år etter at dagens Veggli kirke stod klar.\\nDet opprinnelige stavbygget skal ha hatt rektangulært skip og smalere kor, der skipet var ca. 5,70 m langt og ca. 4,60 m bredt og veggene var ca. 3,75 m høye. Bredden på koret anslås til ca. 2 meter. Dette koret ble antageligvis revet i 1684, da kirken fikk et nytt, tømret kor. Kirken var blitt utvidet noen år tidligere og ble utvidet igjen i 1704–08 med tverrskip, slik at det ble en korskirke. Etter midten av 1700-tallet fikk kirken våpenhus.\\nDet foreligger få vitnesbyrd om interiøret, men en korbuestav er å finne i Kulturhistorisk museum i Oslo. Det skal også finnes en rosemalt dør og noen dekorerte bord fra kirken i privat eie.\\nDøpefonten fra stavkirken er overført til den nye kirken. For øvrig synes det gamle inventaret å ha gått tapt.\\nKirkegården ble utvidet i 1828 og var i bruk også etter at kirkegården ved dagens kirke var anlagt. Den er omgitt av et steingjerde med portal ved inngangen."},{"page_url":"https://de.wikipedia.org/wiki/St._Nikolaus_(Liesing)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Pfarrkirche_Liesing_%28Lesachtal%29_-_Nikolauslegende.jpg","page_title":"St. Nikolaus (Liesing)","context_page_description":"Die römisch-katholische Pfarrkirche Liesing in der Gemeinde Lesachtal ist dem heiligen Nikolaus geweiht. Zur Pfarre Liesing gehören auch die Filialkirchen von Klebas, Niedergail, Obergail, Oberring und Tscheltsch."},{"page_url":"https://hr.wikipedia.org/wiki/Pigment","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Titanium%28IV%29_oxide.jpg","page_title":"Pigment","context_page_description":"Pigment je tvar različita kemijska sastava koja je nositelj boje u živih organizama. Nalaze se u stanicama u obliku zrnaca, kapljica i kristala; često su vezani na bjelančevine. Važni su za život biljaka, životinja i čovjeka. Podrijetlo im je dvojako: stvoreni su u protoplazmi specijalnih stanica kao endogeni pigmenti ili dospijevaju u stanice infiltracijom kao egzogeni pigmenti. Najrašireniji su pigmenti: porfirini, karotenoidi, fikobilini, antocijani te njihove bezbojne modifikacije leukoantocijanidini, flavoni i flavonoidi. U vakuolama većine biljaka reda Caryophyllales nalaze se crveni ili žuti betalaini, koji u svojoj molekuli sadrže dušik: betanidin u korijenu cikle, filokaktin u biljkama roda Phyllocactus, žuti pigment u zapadnoindijske opuncije. Takav je i amanitin, crveni pigment u otrovne gljive crvene muhare. U biljnom svijetu rašireni su i kinoni, a dolaze i u unutarnjim organima ježinaca i kukaca. U perju, dlakama i koži životinja i čovjeka nalaze se melanini. Kod patoloških stanja pigmenti mogu biti abnormalno pojačani ili ih nema. Raspodjela pigmenata na površini ljudskoga, životinjskoga ili biljnoga organizma naziva se pigmentacija."},{"page_url":"https://en.wikipedia.org/wiki/Euzopherodes_albistrigella","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/13-Euzopherodes_albistrigella_Hampson%2C_1908.JPG","page_title":"Euzopherodes albistrigella","context_page_description":"Euzopherodes albistrigella is a species of snout moth in the genus Euzopherodes. It was described by George Hampson in 1908. It is found in Sri Lanka and India.\\nThis species has a wingspan of 30 mm."},{"page_url":"https://fr.wikipedia.org/wiki/L%C9%99nk%C9%99ran_(raion)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Tendir_Oven_Lankaran%2C_Azerbaijan.jpg","page_title":"Lənkəran (raion)","context_page_description":"Lənkəran est l'une des 78 subdivisions de l'Azerbaïdjan. Le raion entoure mais n'inclut pas la ville de Lankaran."},{"page_url":"https://en.wikipedia.org/wiki/Giovanni_Boggi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/%CE%91%CE%BD%CE%B4%CF%81%CE%AD%CE%B1%CF%82_%CE%9C%CE%B9%CE%B1%CE%BF%CF%8D%CE%BB%CE%B7%CF%82._%CE%95%CE%B3%CF%87%CF%81%CF%89%CE%BC%CE%B7_%CE%BB%CE%B9%CE%B8%CE%BF%CE%B3%CF%81%CE%B1%CF%86%CE%AF%CE%B1._Giovanni_Boggi..jpg","page_title":"Giovanni Boggi","context_page_description":"Giovanni Boggi was an Italian engraver and painter, in his artistic prime in the 1820s. Several of his works are on display at the Bibliothèque Nationale, Paris. He was especially noted for his portraits of important Greek people, particularly from the War of Greek Independence, including Markos Botsaris, a Souliote captain and Theodoros Kolokotronis. He also made portraits of Francesco Algarotti and Luigi Lanzi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Bundesarchiv_Bild_183-W1027-0020%2C_Berlin%2C_Milit%C3%A4rakademie-_Absolventen%2C_Empfang.jpg","page_title":"Ивановский, Евгений Филиппович","context_page_description":"Евге́ний Фили́ппович Ивано́вский — советский военачальник. Главнокомандующий Сухопутными войсками СССР — заместитель Министра обороны СССР, генерал армии. Герой Советского Союза. Член ЦК КПСС"},{"page_url":"https://ca.wikipedia.org/wiki/Farwell_(Texas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/TXMap-doton-Farwell.PNG","page_title":"Farwell (Texas)","context_page_description":"Farwell és una ciutat a l'estat de Texas. Segons el cens del 2000 tenia una població de 1.364 habitants."},{"page_url":"https://war.wikipedia.org/wiki/Atta_insularis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Acromyrmex_octospinosus_02.jpg","page_title":"Atta insularis","context_page_description":"An Atta insularis in uska species han Formicidae nga ginhulagway ni Guérin-méneville hadton 1844. An Atta insularis in nahilalakip ha genus nga Atta, ngan familia nga formicidae. Waray hini subspecies nga nakalista."},{"page_url":"https://hu.wikipedia.org/wiki/Solaris_Tramino","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Tramino_schemes.png","page_title":"Solaris Tramino","context_page_description":"Solaris Tramino villamoscsalád, amelyet eredetileg a Solaris Bus & Coach gyártott Bolechówban, Lengyelországban. Jelenleg a Stadler Polska, a svájci Stadler Rail leányvállalata állítja elő, miután megvásárolta a Solaris Tramot. Az első prototípust 2009 júliusában építették meg, a sorozatgyártás pedig 2011-ben kezdődött meg."},{"page_url":"https://en.wikipedia.org/wiki/2nd_Parachute_Brigade_in_Southern_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/AWM_SUK12892_Airborne_Southern_France.jpg","page_title":"2nd Parachute Brigade in Southern France","context_page_description":"The British 2nd Parachute Brigade was part of the Operation Rugby airborne landings in August 1944. The operation was carried out by an ad hoc airborne formation called the 1st Airborne Task Force. Operation Rugby was itself part of the Operation Dragoon invasion of Southern France by the American 7th Army. The airborne task force landed in the River Argens valley with the objective of preventing German reinforcements from reaching the landing beaches. The landings were mainly an American operation and the brigade was the only British Army formation involved.\\nThe brigade's pathfinders landed accurately and set up their homing beacons, but the main body of the brigade landed over a large area, some 20 miles away. The following glider force also had problems; weather conditions forced the brigade's anti-tank unit to turn back for Italy and return with the second wave later that day. Eventually the brigade captured their primary objectives, but the lack of manpower meant that their secondary objective of Le Muy was given to the American airborne forces. The seaborne and airborne landings linked up within two days, and the brigade became the reserve formation for the operation."},{"page_url":"https://nl.wikipedia.org/wiki/Santa_Cruzkangoeroegoffer","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Dipodomys_venustus_santiluciae_-_Pacific_Grove_Museum_of_Natural_History_-_DSC06627.JPG","page_title":"Santa Cruzkangoeroegoffer","context_page_description":"De Santa Cruzkangoeroegoffer is een zoogdier uit de familie van de wangzakmuizen. De wetenschappelijke naam van de soort werd voor het eerst geldig gepubliceerd door Merriam in 1904."},{"page_url":"https://it.wikipedia.org/wiki/Vincenzo_Valgrisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Valgrisi_2.jpg","page_title":"Vincenzo Valgrisi","context_page_description":"Vincenzo Valgrisi, o Valgrisio, è stato un tipografo italiano, attivo a Venezia dal 1540 al 1572."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%81%E7%8E%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Ding_Ling.jpg","page_title":"丁玲","context_page_description":"丁玲，原名蒋伟，字冰之，笔名彬芷、从喧等，女，湖南临澧人，中国现代女性主义作家、社会活动家，中国共产党党员。"},{"page_url":"https://en.wikipedia.org/wiki/Trichilia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Trichilia_emetica.JPG","page_title":"Trichilia","context_page_description":"Trichilia is a flowering plant genus in the family Meliaceae. These plants are particularly diverse in sub-Saharan Africa and tropical South America.\\nSeveral species are used in folk medicine and shamanism – e.g. T. rubescens against malaria, T. tocacheana as a hallucinogen, and T. catigua in the aphrodisiac and stimulant catuaba. T. emetica wood, also known as Natal mahogany or Cape mahogany is the traditional material of choice for Mozambique's famous psikhelekedana miniature artists. Trichilia dregeana, or forest mahogany also yields timber and is also used in carvings, traditional African musical instruments, household implements, furniture, bats and canoes.\\nSelected species:\\nTrichilia acuminata\\nTrichilia areolata\\nTrichilia blanchetii\\nTrichilia breviflora\\nTrichilia bullata\\nTrichilia casaretti\\nTrichilia catigua\\nTrichilia chirriactensis\\nTrichilia columata Guardi\\nTrichilia discolor\\nTrichilia dregeana Sond.\\nTrichilia elsae\\nTrichilia emarginata\\nTrichilia emetica Vahl\\nTrichilia fasciculata\\nTrichilia florbranca\\nTrichilia gamopetala\\nTrichilia grandifolia\\nTrichilia hirta\\nTrichilia hispida\\nTrichilia lecointei\\nTrichilia lovettii\\nTrichilia magnifoliola\\nTrichilia micropetala"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_conflitos_envolvendo_a_Turquia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Flag_of_Kuwait_%28%3F-1899%29.png","page_title":"Lista de conflitos envolvendo a Turquia","context_page_description":"Este artigo apresenta uma lista incompleta de guerras envolvendo a Turquia, o povo turco e o exército turco regular durante o período em que havia estados turcos independentes.\\nA lista contém o nome do conflito, a data, as partes em conflito e seu resultado:\\nVitória\\nDerrota\\nOutro resultado\\nConflito inacabado"},{"page_url":"https://ceb.wikipedia.org/wiki/Dacrydium","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Juvenile_rimu.jpg","page_title":"Dacrydium","context_page_description":"Henero sa mga ukab-ukab ang Dacrydium. Ang Dacrydium sakop sa kabanay nga Mytilidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/Abbeys_Amble","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Fountains_Abbey%2C_Yorkshire%2C_UK_-_Diliff.jpg","page_title":"Abbeys Amble","context_page_description":"The Abbeys Amble is a long-distance path in North Yorkshire, England. It is a circular walk of 104 miles, based on Ripon. It links three abbeys - Fountains Abbey, Bolton Abbey and Jervaulx Abbey - and three castles - Ripley Castle, Bolton Castle and Middleham Castle."},{"page_url":"https://nl.wikipedia.org/wiki/Jules_de_Polignac_(1780-1847)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Jules_de_Polignac_%281780-1847%29.jpg","page_title":"Jules de Polignac (1780-1847)","context_page_description":"Jules Auguste Armand Marie vorst de Polignac, 3e hertog van Polignac was een Frans politicus."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D0%BA%D0%BE%D0%B2%D0%BD%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Rank_insignia_of_%D0%9F%D0%BE%D0%BB%D0%BA%D0%BE%D0%B2%D0%BD%D0%B8%D0%BA_of_the_Bulgarian_Air_forces.png","page_title":"Полковник","context_page_description":"Полковник е старше офицерско военно звание във въоръжените сили на редица страни. Полковникът може да бъде член на висшия команден състав, командвайки войскова част, способна да води самостоятелни бойни действия. Съответства на званието colonel в останалите армии по света.\\nСчита се, че званието „полковник“ е въведено за първи път в стрелецката войска от Иван Грозни. Званието са получавали опитни военачалници, като правило от благороден произход. През 16 век терминът „полковник“ се използвал в Русия като звание на лица, командващи полкове. Войнското звание на полковника е въведено в Русия през 30-те години на XVII век за командирите на полкове от „новия строй“. Полковници се наричали също така командирите на полкове в украинската казашка войска и Запорожката сеч.\\nВ Руската империя, според „Табелата за ранговете“, въведена от Петър I Велики през 1722 г., полковникът е чин от VI клас, най-старши от щабните офицери.\\nВ Българската армия това е най-високото звание при старшите офицери. То е разположено между званията подполковник и бригаден генерал. Във ВМС званието полковник за офицерите от корабния състав съответства на капитан I ранг."},{"page_url":"https://it.wikipedia.org/wiki/Mokrousovskij_rajon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Flag_of_Mokrousovsky_rayon_%28Kurganskaya_oblast%29.jpg","page_title":"Mokrousovskij rajon","context_page_description":"Il Mokrousovskij rajon è un rajon dell'Oblast' di Kurgan, nel Bassopiano Siberiano."},{"page_url":"https://pl.wikipedia.org/wiki/Dominique_Rey","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Dominique_Rey_par_Claude_Truong-Ngoc_avril_2013.jpg","page_title":"Dominique Rey","context_page_description":"Dominique Marie Jean Rey – francuski duchowny katolicki, biskup Fréjus-Toulon od 2000."},{"page_url":"https://fy.wikipedia.org/wiki/Aldnederfrankysk","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/OldDutcharea.png","page_title":"Aldnederfrankysk","context_page_description":"It Aldnederfrankysk wie de Westgermaanske taal dy't fan 'e sânde oant de alfde iuw sprutsen waard yn 'e Ryn-, Maas- en Skeldedelta fan it hjoeddeistige súdlik Nederlân, noardwestlik Belgje, westlik Dútslân en noardlik Frankryk. It Aldnederfrankysk ûntjoech him yn 'e sânde iuw út it Aldfrankysk, de taal fan 'e Franken, en bestie út twa haaddialekten: it Aldeastnederfrankysk en it Aldwestnederfrankysk. Ut it Aldnederfrankysk ûntjoegen har neitiid de Nederfrankyske talen."},{"page_url":"https://es.wikipedia.org/wiki/Gimje","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/North_Jeolla-Gimje.svg","page_title":"Gimje","context_page_description":"Gimje es una ciudad en la provincia de Jeolla del Norte, al sureste de la república de Corea del Sur. Está ubicada a unos 160 km al sur de Seúl y a 31 km al noreste de Jeonju. Su área es de 545 06 km² y su población total es de 93 111 habitantes."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%85%E0%A4%9B%E0%A4%BE%E0%A4%AE_%E0%A4%9C%E0%A4%BF%E0%A4%B2%E0%A5%8D%E0%A4%B2%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Mass-Community_Health_Teaching.JPG","page_title":"अछाम जिल्ला","context_page_description":"अछाम नेपालको सुदूरपश्चिमाञ्चल विकास क्षेत्रमा पर्ने सेती अञ्चलमा रहेको एक पहाडी जिल्ला हो। १६८० वर्ग किलोमिटरसम्म फैलिएको अछाम, नेपालका दुर्गम जिल्लाहरू मध्ये एक हो । नयाँ नेपालको पुनसंरचना अनुसार यो जिल्ला नेपालको सुदूरपश्चिम प्रदेशमा पर्दछ । अछाम जिल्लाको सदरमुकाम मंगलसेन हो । हाल सेवामा नरहेको साँफेबगर विमानस्थल, सदरमुकाम मंगलसेनबाट आठ घण्टा पैदल दुरीमा पर्दछ । भौगोलिक हिसाबले विकट रहेको अछाम जिल्ला पर्यटकीय स्थल र प्राकृतिक सम्पदाहरूले भरिपूर्ण छ । रामारोशन क्षेत्र, खप्तड क्षेत्र, बरदा देवि मन्दिर, वैजनाथ मन्दिर, दर्ना दरवार, मंगलसेन दरबार, विनायकका पञ्च देवलहरू, दर्नाका देवलहरू, बान्नीगढी, जैगढ, बयलपाटा आदि यस जिल्लाका धार्मिक तथा पर्यटकीय महत्त्व बोकेका स्थानहरू हुन् । नेपालको संविधान २०७२ अनुसार नेपालको पुनसंरचना गर्ने क्रममा सङ्घीय मामिला तथा स्थानीय विकास मन्त्रालयको निर्णयानुसार यस जिल्लालाई ४ नगरपालिका, ६ वटा गाउँपालिका तथा २ संसदीय निर्वाचन क्षेत्रहरूमा विभाजन गरिएको छ । रत्यौली, भुवा, न्याउले, पुतला, देउडा गीत, हुड्केली आदि यहाँका मुख्य सांस्कृतिक परम्पराहरू हुन् । आफ्नै रितिरिवाज र चालचलनमा रमाउने अछामका जनताहरू अछामी भाषाको प्रयोग गर्दछन् ।"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%98%E1%83%A3%E1%83%AF%E1%83%98%E1%83%9C_%E1%83%93%E1%83%94%E1%83%91%E1%83%A1%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Eugene_V._Debs_signature.png","page_title":"იუჯინ დებსი","context_page_description":"იუჯინ ვიქტორ დებსი — ამერიკელი დემოკრატიული და სოციალისტური პოლიტიკის აქტივისტი და პროფესიული კავშირის წევრი, მსოფლიოს ინდუსტრიული მუშების ერთ-ერთი დამფუძნებელი წევრი. ხუთჯერ იყარა კენჭი ამერიკის შეერთებული შტატების პრეზიდენტობის კანდიდატად სოციალისტური პარტიიდან. პრეზიდენტის კანდიდატობის, ასევე მისი ჩართულობის გამო მუშათა მოძრაობებში, დებსი გახდა ამერიკის შეერთებულ შტატებში მცხოვრები ერთ-ერთი ყველაზე ცნობილი სოციალისტი.\\nმისი პოლიტიკური კარიერის დასაწყისში დებსი იყო დემოკრატიური პარტიის წევრი. 1884 წელს იგი აირჩიეს ინდიანას გენერალური ანსამბლეის დემოკრატად. რამდენიმე პატარა კავშირთან მუშაობის შემდეგ, მათ შორის ლოკომოტივის მეხანძრეების საძმო, დებმა დიდი წვლილი შეიტანა ამერიკული რკინიგზის კავშირის დაარსებაში. ეს კავშირი იყო ერის ერთ-ერთი პირველი ინდუსტრიული კავშირი. მას შემდეგ რაც პულმანის სასახლის მანქანების კომპანიის მუშებმა ორგანიზება გაუწიეს „გარეული კატების“ გაფიცვას 1894 წლის ზაფხულში, ბედსმა ბევრი შეიყვანა ARU-ში. პულმანის მანქანების გაფიცვას ეროვნული მნიშვნელობა მიანიჭა დებმა ARU-სთან ერთად, ისინი ბოიკოტს უცხადებდნენ მათ რკინიგზას. ამ მოძრაობამ დიდი ზეგავლენა მოახდინა დეტროიტის დასავლეთის სარკინიგზო ხაზებზე, მასში ჩართული იყო 27 შტატის დაახლოებით 250 000-მდე მუშა."},{"page_url":"https://fr.wikipedia.org/wiki/Sandrine_Roux","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Sandrine_Roux_Vannes_2018.jpg","page_title":"Sandrine Roux","context_page_description":"Sandrine Roux est une joueuse de football internationale française."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%A8%E0%B2%BF%E0%B2%AF%E0%B2%BE_%E0%B2%B6%E0%B2%B0%E0%B3%8D%E0%B2%AE%E0%B2%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/CPAA-Nia.Sharma-Kushal.Tandon.jpg","page_title":"ನಿಯಾ ಶರ್ಮಾ","context_page_description":"ನಿಯಾ ಶರ್ಮಾ ರವರೊಬ್ಬ ಭಾರತೀಯ ದೂರದರ್ಶನ ನಟಿ. ಇವರು ಸ್ಟಾರ್ ಪ್ಲಸ್‌ನ ಕಾಲಿ - ಏಕ್ ಅಗ್ನಿಪರಿಕ್ಷಾ ಎಂಬ ಧಾರವಾಹಿಯಲ್ಲಿ ಅನು ಎಂಬ ಪಾತ್ರದಲ್ಲಿ, ಏಕ್‌ ಹಜಾರೊ ಮೆ ಮೇರಿ ಬೆಹೆನಾ ಹೆ - ಮಾನ್ವಿ, ಜೀ ಟಿವಿಯ ಜಮಾಯಿ ರಾಜ - ರೋಶ್ನಿ ಪಟೇಲ್‌, ಕಲರ್ಸ್‌ ಟಿವಿ ಯ ಇಷ್ಕ್‌ ಮೆ ಮರ್ಜಾವಾ - ಆರೋಹಿ ಕಶ್ಯಪ್‌ ನಂತಹ ಪಾತ್ರಗಳಲ್ಲಿ ಅಭಿನಯಿಸಿ ಇವರು ಹೆಸರುವಾಸಿಯಾಗಿದ್ದಾರೆ. ಇವರು ಖತ್ರೋನ್ ಕೆ ಖಿಲಾಡಿ ಯಲ್ಲಿ ಸ್ಪರ್ಧಿಯಾಗಿದ್ದು ಟಾಪ್‌ ಫೈನಲಿಸ್ಟ್‌ಗಳಲ್ಲಿ ಒಬ್ಬರಾಗಿದ್ದರು.\\nನಿಯಾ ಶರ್ಮಾ ರವರು ಟ್ವಿಸ್ಟೆಡ್‌ ವೆಬ್‌ ಸೀರೀಸ್‌ನಿಂದಾಗಿ ಜನಪ್ರಿಯತೆಯನ್ನು ಪಡೆದರು. ಬ್ರಿಟಿಷ್ ಮೂಲದ ಈಸ್ಟರ್ನ್ ಐ ಪತ್ರಿಕೆ ಪ್ರಕಟಿಸಿದ ಪ್ರಕಾರ, ಟಾಪ್ ೫೦ ಸೆಕ್ಸಿಯೆಸ್ಟ್ ಏಷ್ಯನ್ ವುಮೆನ್ ೨೦೧೭ ರ ಪಟ್ಟಿಯಲ್ಲಿ ಇವರು ಎರಡನೇ ಸ್ಥಾನವನ್ನುಗಳಿಸಿದ್ದಾರೆ."},{"page_url":"https://cs.wikipedia.org/wiki/B%C4%9Blorusk%C3%BD_rubl","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/%D0%9E%D0%B1%D0%BE%D1%80%D0%BE%D1%82%D0%BD%D0%B0%D0%B0%D1%8F_%D1%81%D1%82%D0%BE%D1%80%D0%BE%D0%BD%D0%B0_5%D1%80.jpg","page_title":"Běloruský rubl","context_page_description":"Běloruský rubl je zákonným platidlem východoevropského státu Bělorusko. Název rubl má běloruská měna společný s ruskou měnou. Jedna setina rublu se nazývá kopějka.\\nPrůměrná hodnota nového běloruského rublu odpovídala v prvním čtvrtletí roku 2017 polovině eura za jeden rubl."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-Claud","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Map_commune_FR_insee_code_16308.png","page_title":"Saint-Claud","context_page_description":"Saint-Claud is een gemeente in het Franse departement Charente en telt 1062 inwoners. De plaats maakt deel uit van het arrondissement Confolens."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B3%A0%EB%8D%95%EB%8F%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Godeok_1%28il%29-dong_Comunity_Service_Center_20140621_153648.jpg","page_title":"고덕동","context_page_description":"고덕동은 대한민국 서울특별시 강동구에 위치한 법정동이다."},{"page_url":"https://fr.wikipedia.org/wiki/Route_nationale_491","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Bus_STAC_%C3%A0_Morraz%2C_Chamb%C3%A9ry_%282014%29.JPG","page_title":"Route nationale 491","context_page_description":"La route nationale 491, ou RN 491, était une route nationale française reliant Mijoux à Chambéry.\\nÀ la suite de la réforme de 1972, elle a été déclassée en RD 991.\\nCette route départementale est très régulièrement soumise à des embouteillages dus aux déplacements pendulaires près des grandes villes d'Aix-les-Bains et Chambéry.\\nElle longe pendant une dizaine de kilomètres le lac du Bourget."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B4%D5%A5%D6%80%D5%AB%D5%AF%D5%A1%D5%B5%D5%AB_%D5%84%D5%AB%D5%A1%D6%81%D5%B5%D5%A1%D5%AC_%D5%86%D5%A1%D5%B0%D5%A1%D5%B6%D5%A3%D5%B6%D5%A5%D6%80%D5%AB_%D5%A1%D5%B7%D5%AD%D5%A1%D6%80%D5%B0%D5%A1%D5%A3%D6%80%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/US_map_-_rivers_and_lakes2.jpg","page_title":"Ամերիկայի Միացյալ Նահանգների աշխարհագրություն","context_page_description":"Ամերիկայի Միացյալ Նահանգներ տերմինը՝ եզրույթը կամ գիտաբառը, երբ օգտագործվում է աշխարհագրական իմաստով, իրենից ներկայացնում է\`\\nբուն կամ մայրցամաքային ԱՄՆ-ն,\\nԱլյասկա նահանգը, որը այսպես կոչված բուն մայրցամաքային ԱՄՆ-ի մեջ չի մտնում,\\nՀավայան կղզիները,\\nԱՄՆ-ին պատկանող հինգ կղզային տարածքները՝ այսպես կոչված ԱՄՆ-ին ենթակա տարածքները, մասնավորապես՝ Պուերտո Ռիկոն, Հյուսիսային Մարիանյան կղզիները, ԱՄՆ-ի Վիրջինյան կղզիները, Գուամ կղզին և Ամերիկյան Սամոան, ինչպես նաև ԱՄՆ-ի կղզային մանր արտաքին տիրույթները։\\nԱՄՆ-ն ցամաքում սահմանակից է Կանադային և Մեքսիկային, իսկ ծովում՝ Ռուսաստանին, Կուբային և Բահամյան կղզիներին, ինչպես նաև դարձյալ նույն Կանադային ու Մեքսիկային:"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D1%82%D0%BE%D1%84%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/%D0%9F%D1%80%D0%B5%D0%B4%D1%82%D1%83%D0%BD%D0%B5%D0%BB%D0%B5%D0%BD_%D1%81%D0%B2%D0%B5%D1%82%D0%BE%D1%84%D0%BE%D1%80-%D0%BE.png","page_title":"Светофор","context_page_description":"Светофор е железопътен термин, който означава светлинен семафор. Първоначално семафорите у нас били изцяло механически, но след появата на електромеханическите централизации в някои от гарите, се появили и светофорите. Те приличат на светофар и служат за организация на движението, подобно на автомобилните, но дават доста повече показания от „червено, жълто и зелено“. След разпространението на релейните централизации у нас, крилните семафори биват почти изцяло заменени със светофори. Към момента цялата железопътна мрежа на Република България, с изключение на теснолинейката Септември – Добринище, се обслужва от светофори. Подобно на семафорите, в България светофорите също биват входни, изходни, маневрени и дистанционни, но съществуват още проходни, прелезни и др.\\nПредимствата на светофорите са, че дават еднозначни и еднакви показания както денем, така и нощем, а освен това за сменянето на показанието не се изисква човешка сила, както при семафорите. Светофорите също се оказват по-лесни за експлоатация през зимата, понеже нямат подвижни части."},{"page_url":"https://it.wikipedia.org/wiki/Gradi_della_polizia_locale_del_Lazio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Commissario_capo_di_polizia_locale.JPG","page_title":"Gradi della polizia locale del Lazio","context_page_description":"Tabella riassuntiva dei gradi della polizia locale del Lazio. I gradi sono rappresentati apposti sulle controspalline della divisa ordinaria invernale. Il colore della divisa è il Blu notte. I distintivi di grado sono regolati dalla L.R. 1/2005 e dalla Delibera G.R. del 29 dicembre 2015, n. 766"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Jean-Baptiste_d%27Aul%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Aquarelle_de_l%27%C3%A9glise_Saint-Jean-Baptiste-d%27Aul%C3%A8s_%C3%A0_Doazit.jpg","page_title":"Église Saint-Jean-Baptiste d'Aulès","context_page_description":"L'église Saint-Jean-Baptiste d'Aulès se situe sur la commune de Doazit, dans le département français des Landes. L'église et le porche du cimetière font l'objet d'un classement au titre des monuments historiques par arrêté du 8 novembre 2004."},{"page_url":"https://ca.wikipedia.org/wiki/Aroffe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Aroffe_02.jpg","page_title":"Aroffe","context_page_description":"Aroffe és un municipi francès, situat al departament dels Vosges i a la regió del Gran Est. L'any 2007 tenia 96 habitants."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B7%8B%E7%90%83%E8%8F%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Neisseria_gonorrhoeae_02.png","page_title":"淋球菌","context_page_description":"淋球菌又稱淋病雙球菌、淋病奈瑟菌，是導致淋病的病原菌，和腦膜炎奈瑟菌同屬於奈瑟菌屬，是革蘭氏陰性菌一個屬種。球菌是需要複雜營養的，在實驗室培養要加入營養補充劑。在巧克力細菌培養基加入二氧化碳可加速其生長。這些球菌在細胞內的典型隨意排列是成一對的 。"},{"page_url":"https://it.wikipedia.org/wiki/Mascioni","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Roma%2C_chiesa_di_Sant%27Achille_-_Organo_a_canne.jpg","page_title":"Mascioni","context_page_description":"La Mascioni, fondata come Fabbrica d'organi Mascioni, è una ditta che produce e restaura organi a canne con sede ad Azzio."},{"page_url":"https://en.wikipedia.org/wiki/Chaplain_of_the_United_States_Marine_Corps","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/EliTakesian.jpg","page_title":"Chaplain of the United States Marine Corps","context_page_description":"The Chaplain of the United States Marine Corps is a position always filled by the officer serving as Deputy Chief of Chaplains of the United States Navy as a \\"dual hatted\\" billet since 2000. The CHMC oversees religious ministry in the Marine Corps which one Commandant of the Marine Corps defined as \\"a vital function which enhances the personal, family, and community readiness of our Marines, sailors, and their families. Chaplaincy supports the foundational principle of free exercise of religion and helps to enrich the spiritual, moral and ethical fabric of the military.\\"\\nThe current CHMC is Rear Admiral Gregory N. Todd. He was sworn in on June 21, 2018."},{"page_url":"https://sv.wikipedia.org/wiki/Sesamum_orientale","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/2005sesame_seed.PNG","page_title":"Sesamum orientale","context_page_description":"Sesamum orientale är en sesamväxtart som beskrevs av Carl von Linné. Sesamum orientale ingår i släktet sesamer, och familjen sesamväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Muir_Woods_National_Monument","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Muir_woods_trail.jpg","page_title":"Muir Woods National Monument","context_page_description":"Muir Woods National Monument is a United States National Monument managed by the National Park Service, named after naturalist John Muir. It is located on Mount Tamalpais near the Pacific coast, in southwestern Marin County, California. It is part of the Golden Gate National Recreation Area, and is 12 miles north of San Francisco. It protects 554 acres, of which 240 acres are old growth coast redwood forests, one of a few such stands remaining in the San Francisco Bay Area."},{"page_url":"https://pl.wikipedia.org/wiki/Pa%C5%82ac_Miramar","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Miramar_jauregia_-_barnealdea_02_Tximinia.jpg","page_title":"Pałac Miramar","context_page_description":"Pałac Miramar – pałac nad zatoką La Concha w San Sebastián w Kraju Basków."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B1%D1%80%D0%B0%D0%B7%D0%B8%D0%B2%D0%BD%D1%8B%D0%B5_%D0%BC%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%B0%D0%BB%D1%8B_%D0%B8_%D0%B0%D0%B1%D1%80%D0%B0%D0%B7%D0%B8%D0%B2%D0%BD%D0%B0%D1%8F_%D0%BE%D0%B1%D1%80%D0%B0%D0%B1%D0%BE%D1%82%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Differences_in_the_size_of_sand.jpg","page_title":"Абразивные материалы и абразивная обработка","context_page_description":"Абразивные материалы — это материалы, обладающие высокой твёрдостью и используемые для обработки поверхности различных материалов: металлов, керамических материалов, горных пород, минералов, стекла, кожи, резины и других. Абразивные материалы используются в процессах шлифования, полирования, хонингования, суперфиниширования, разрезания материалов и широко применяются в заготовительном производстве и окончательной обработке различных металлических и неметаллических материалов.\\nС давних пор использовались естественные абразивные материалы, с конца XIX века применяются искусственные.\\nТвёрдость определяется методом вдавливания алмазной пирамиды в поверхность испытуемого материала. Абразивная способность характеризуется массой снимаемого при шлифовании материала в следующем порядке: алмаз, нитрид бора, карбид кремния, монокорунд, электрокорунд, наждак, кремень. Из абразивных материалов изготавливают жёсткие и гибкие абразивные инструменты, которые широко применяются во всех отраслях машиностроения, особенно при изготовлении подшипников."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AC%E3%83%83%E3%82%AF%E3%82%B9%E3%83%BB%E3%83%96%E3%83%AB%E3%83%BC%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Alex_Bruce.png","page_title":"アレックス・ブルース","context_page_description":"アレックス・スティーヴン・ブルースは、イングランド・ノリッジ出身のサッカー選手。キルマーノックFC所属。元北アイルランド代表。ポジションはDF、MF。"},{"page_url":"https://br.wikipedia.org/wiki/Eva_(Bibl)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Schnorr_von_Carolsfeld_-_Die_Erschaffung_Evas.jpg","page_title":"Eva (Bibl)","context_page_description":"Eva eo anv ar vaouez kentañ hervez ar Bibl hag ar C'horan.\\nHervez Levr ar C'heneliezh e vije bet krouet gant Doue diwar ur gostezenn tennet digant Adam, ar gwaz kentañ, dezhañ da gaout ur gompagnunez bennak er baradoz. Pried dezhañ eo Eva eta. Mamm Kain hag Abel eo ivez. Hi eo a selaouas an naer hag a roas unan eus avaloù difennet gwezenn ar ouiziegezh da dañva d'he fried."},{"page_url":"https://en.wikipedia.org/wiki/Andre_Smith_(offensive_tackle)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Andre_Smith_%28offensive_tackle%29_2013.jpg","page_title":"Andre Smith (offensive tackle)","context_page_description":"Andre Dewayne Smith Jr. is an American football offensive tackle for the Baltimore Ravens of the National Football League. He played college football for the University of Alabama, and was recognized as a unanimous All-American. He was drafted by the Cincinnati Bengals in the first round, sixth overall, of the 2009 NFL Draft. He has also played for the Minnesota Vikings and Arizona Cardinals."},{"page_url":"https://en.wikipedia.org/wiki/Ostkreuz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Berlin_Ostkreuz_Panorama_2013-05-08.jpg","page_title":"Ostkreuz","context_page_description":"Berlin Ostkreuz is a station on the Berlin S-Bahn suburban railway and the busiest interchange station in Berlin. It is in the former East Berlin district of Friedrichshain, now part of the borough of Friedrichshain-Kreuzberg. A smaller part of the station is in Rummelsburg, part of the borough of Lichtenberg. The station is a Turmbahnhof with the Berlin–Frankfurt railway and the Prussian Eastern Railway on the lower level and the Berlin Ringbahn on the upper level. It is used by a total of around 235,000 passengers every day on eight lines, entering or leaving.\\nThe station was completely reconstructed from 2006 to December 2018 while train operations at the station continued. In the past it was exclusively used as a Berlin S-Bahn station, but it is now also a stopping point for regional services."},{"page_url":"https://es.wikipedia.org/wiki/Catalinas_(subte_de_Buenos_Aires)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Catalinas_L%C3%ADnea_E_inauguraci%C3%B3n_04.jpg","page_title":"Catalinas (subte de Buenos Aires)","context_page_description":"Catalinas es una estación del Subte de Buenos Aires perteneciente a la Línea E. Está ubicada debajo de la avenida Leandro N. Alem entre las calles Paraguay y Marcelo T. de Alvear, en el barrio de Retiro. Debe su nombre a los edificios de Catalinas Norte, ubicados sobre la avenida Leandro N. Alem, sede de numerosas oficinas, muchas de ellas dedicadas a los rubros de informática y tecnología.\\nLa estación posee plataforma central.​ En cuanto a la decoración, las paredes combinan rectángulos en distintos tonos de violeta y en color verde.​"},{"page_url":"https://de.wikipedia.org/wiki/Archkogl","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Villa_Castiglioni_Grundlsee.jpg","page_title":"Archkogl","context_page_description":"Archkogl ist ein Ort im Ausseerland des Salzkammerguts in der Steiermark wie auch Ortschaft der Gemeinde Grundlsee im Bezirk Liezen."},{"page_url":"https://en.wikipedia.org/wiki/Benetton_B196","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Jean_Alesi_-_Imola_1996_%285%29.jpg","page_title":"Benetton B196","context_page_description":"The Benetton B196 is a Formula One racing car with which the Benetton team competed in the 1996 Formula One World Championship. It was driven by the experienced pairing of Jean Alesi and Gerhard Berger, who both moved from Ferrari to replace departing 1994 and 1995 champion Michael Schumacher and his number two, Johnny Herbert.\\nIt was Berger's second stint with Benetton having last driven for them back in 1986. Many thought, Benetton and Alesi included, that this could well be the Frenchman's year to seriously challenge for the title - something many had been predicting he would do since he signed for Ferrari in 1991. However, after achieving the double of Drivers' and Constructors' Championships in 1995, the 1996 season saw the team slip slightly from its position of eminence. A direct development of the B195, the new drivers found the B196 difficult to drive, as it had been designed with Schumacher's driving style in mind, but managed to score a series of points and podium finishes."},{"page_url":"https://pl.wikipedia.org/wiki/Toyota_Camry","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Toyota_Camry_1996.jpg","page_title":"Toyota Camry","context_page_description":"Toyota Camry – samochód klasy średniej, produkowany przez koncern Toyota od 1982 roku. Ze względu na niewysoką cenę zdobył dużą popularność w Ameryce Północnej i Australii, gdzie zdecydowano się na jego produkcję. Na obu tych kontynentach jest pozycjonowany w klasie średniej i kosztuje mniej więcej tyle co Avensis w Europie. Toyota Camry powstała wskutek podziału linii modelowej klasy średniej na „europejską” oraz „amerykańską” – model Camry. Ze względu na wysokie ceny paliw masowy rynek europejski preferuje mniejsze samochody mimo oferowania modelu Camry, to nieporównywalnie model Avensis lepiej się sprzedaje niż Camry. W Polsce największą popularnością cieszył się model trzeciej generacji produkowany w latach 1992-1996, ze względu na korzystne regulacje celno-podatkowe z początku lat 90.\\nW 2017 roku zaprezentowano ósmą generację modelu Camry, który w Europie oferowany będzie wyłącznie z napędem hybrydowym o pojemności 2,5 l, a na rynek europejski ma wejść jeszcze w tym samym roku."},{"page_url":"https://nl.wikipedia.org/wiki/Lantenne-Verti%C3%A8re","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Map_commune_FR_insee_code_25326.png","page_title":"Lantenne-Vertière","context_page_description":"Lantenne-Vertière is een gemeente in het Franse departement Doubs en telt 458 inwoners. De plaats maakt deel uit van het arrondissement Besançon."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27avions_militaires_de_la_Premi%C3%A8re_Guerre_mondiale","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Hansa_Brandenburg_C.I.jpg","page_title":"Liste d'avions militaires de la Première Guerre mondiale","context_page_description":"La Première Guerre mondiale voit le plein essor des premiers avions militaires, après de timides tâtonnements et utilisations avant guerre.\\n."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%88%D9%86%D9%83%D8%A7%D9%86_%D8%AC%D8%A7%D9%8A_%D8%AF._%D8%B3%D9%85%D9%8A%D8%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Portrait_duncanjdsmith.jpg","page_title":"دونكان جاي د. سميث","context_page_description":"دونكان جاي د. سميث ‏ هو مصور ومؤرخ بريطاني، ولد في 1 ديسمبر 1960 في شفيلد في المملكة المتحدة."},{"page_url":"https://eu.wikipedia.org/wiki/2020ko_Eusko_Legebiltzarrerako_hauteskundeak","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Miren_Gorrotxategi_2019_%28cropped%29.jpg","page_title":"2020ko Eusko Legebiltzarrerako hauteskundeak","context_page_description":"2020ko Eusko Legebiltzarrerako hauteskundeak 2020ko uztailaren 12an egin ziren. 2020ko apirilaren 5ean egitekoak ziren, XII. legealdiko 75 legebiltzarkideak hautatzeko. 2020ko otsailaren 4an Iñigo Urkullu lehendakariak hauteskunde aurrerapena eztabaidatu zuen gobernu kontseiluan, aurrerapenerako lege eskakizuna betez. Honek hauteskundeen iragarpenari buruzko espekulazioa piztu zuen eta apirilaren 5ean egin zitezkeela eman zuten aditzera zenbait komunikabidek. 2020ko otsailaren 10ean egindako agerraldian data hori baieztatu zuen lehendakariak.\\nAlabaina, martxoaren 11n lehendakariak Jaurlaritza hauteskundeak mantentzea edo ez legalki aztertzen ari zela jakinarazi zuen, koronabirusaren agerraldiak Euskal Herrian izandako hedapena zela eta. Edonola ere, ez dago hauteskundeak atzeratzearen aurrekaririk eta \\"lege hutsune\\" horren ondorioz ez dago argi nola jokatu beharko litzatekeen. Adituek aipatutako aukeren artean lehendakariaren dekretu bat legoke. Eusko Jaurlaritzak osasun larrialdia eta Espainiako Gobernuak alarma egoera ezarri ondoren, martxoaren 16an, alderdi guztiek hauteskundeak atzeratzea erabaki zuten."},{"page_url":"https://ru.wikipedia.org/wiki/Oecophylla","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/AntsStitchingLeave.jpg","page_title":"Oecophylla","context_page_description":"Муравьи-портные, или муравьи-ткачи, или экофилла — род муравьёв из подсемейства формицины, включающий тропические и субтропические виды, приспособленных к обитанию на деревьях."},{"page_url":"https://la.wikipedia.org/wiki/Frugi%C3%A8res-le-Pin","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Map_commune_FR_insee_code_43100.png","page_title":"Frugières-le-Pin","context_page_description":"Frugières-le-Pin est commune Francicum 138 incolarum praefecturae Ligeris Superioris in provincia Arvernia."},{"page_url":"https://eo.wikipedia.org/wiki/For%C4%9Dita_fero","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Eiffel_tower_from_below.jpg","page_title":"Forĝita fero","context_page_description":"Forĝita fero estas alojo el fero kun tre malalta enhavo de karbo en kontrasto al gisfero, kaj havas fibrecajn enfermaĵojn konataj kiel ŝlako ĝis 2% laŭ pezo. Ĝi estas duon-fuziita maso el fero kun ŝlakaj enfermaĵoj kiu havigas al ĝi \\"grenecan\\" aspenton similan al ligno, kiu estas videbla kiam ĝi estas eĝita aŭ faldita ĝis la rompopunkto. Forĝita fero estas rezista, maleebla, duktila, dratigebla, malkorodema kaj facile veldata. Antaŭ la disvolvigo de efektivaj metodoj de ŝtalproduktado kaj de la disponeblo de grandaj kvantoj el ŝtalo, forĝita fero estis la plej ofta formo de maleebla fero. Malgranda kvanto de forĝita fero estis uzata kiel kruda materialo por refajnigi ĝin al ŝtalo, kiu estis uzata ĉefe por produkti glavojn, manĝilojn, ĉizilojn, hakilojn kaj aliajn eĝenhavajn ilojn same kiel risortojn kaj fajlilojn. La mendo de forĝita fero atingis sian pinton en la 1860-aj jaroj kun la adaptado de kirasŝipoj kaj fervojoj. Tamen, kiam pliboniĝis la propraĵojn kiaj fajneco de karboŝtalo, ĝi iĝis malplikosta kaj pli amplekse disponebla ol la forĝita fero, kies uzado tiam malpliiĝis."},{"page_url":"https://ca.wikipedia.org/wiki/Ardez","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Steinsberg_Ostseite.jpg","page_title":"Ardez","context_page_description":"Ardez era un municipi del Cantó dels Grisons, situat a la regió d'Engiadina Bassa/Val Müstair, fins als 31 de desembre del 2014. L'1 de gener del 2015 va fusionar amb Ftan, Guarda, Sent i Tarasp per a formar el municipi nou de Scuol.\\nEl casc històric està reconegut bom a bé cultural suís d'importància nacional hi comprés les ruïnes del castell de Steinsberg."},{"page_url":"https://pl.wikipedia.org/wiki/Enniskerry","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Enniskerry.JPG","page_title":"Enniskerry","context_page_description":"Enniskerry – wieś położona w północnej części hrabstwa Wicklow w Irlandii, ok. 25 km na południe od Dublina."},{"page_url":"https://nl.wikipedia.org/wiki/Cornelis_van_Beveren","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Cornelis_de_Bevere.jpg","page_title":"Cornelis van Beveren","context_page_description":"Cornelis van Beveren was ridder, heer van Strevelshoek, West-IJsselmonde en Kleine Lindt. Hij stamt uit het adellijke patriciërsgeslacht Van Beveren en bekleedde vele verschillende functies, zoals:\\nburgemeester van Dordrecht\\nraad en rentmeester-generaal van Zuid-Holland\\nbaljuw en dijkgraaf van het Land van Strijen\\ncurator van de Academie te Leiden\\ngecommitteerde in het College van de Staten-Generaal, van de Gecommitteerde Raden\\nordinaris gecommitteerde ter dagvaart van de Staten van Holland en West-Friesland\\nbuitengewoon gezant van de Staten der Verenigde Nederlanden bij de koning van Denemarken en Noorwegen en de stad Hamburg en bij Karel I, koning van Engeland, Schotland en Ierland.\\nOp 1 december 1660 werd Van Beveren evenals Cornelis de Graeff en Johan de Witt door de Staten van Holland aangesteld als lid van de commissie ter educatie van prins Willem III van Oranje-Nassau, \\"het kind van staat\\".\\nVan Beveren trouwde met Christina Pijl, dochter van Johan Pijl en Mondena de Jonge. Zijn dochter Christina van Beveren huwde met Govert van Slingelandt."},{"page_url":"https://en.wikipedia.org/wiki/Jean_Cousin_the_Younger","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/The_Last_Judgement._Jean_Cousin..jpg","page_title":"Jean Cousin the Younger","context_page_description":"Jean Cousin the Younger was born in Sens, France around 1522, the son of the famous painter and sculptor Jean Cousin the Elder ca. 1490–ca. 1560 who was often compared to his noted contemporary, Albrecht Dürer. Having trained to become an artist under his father, Jean the Younger showed as much talent as his father, and their work is nearly indistinguishable even to the expert. Just before his death, Jean the Elder published his noted work Livre de Perspective in 1560 in which he noted that his son would soon be publishing a companion entitled, Livre de Pourtraicture.\\nWhile there have been some reports that an edition of Livre de Pourtraicture was first printed in 1571 and again in 1589, no copies appear to exist. Instead, the most likely first printing of the work was 1595 in Paris by David Leclerc, with woodcuts engraved by Jean Leclerc, just after Jean the Younger's death. The book is one of the most famous on the subject of artistic anatomy and was printed again and again into the late 17th century."},{"page_url":"https://de.wikipedia.org/wiki/Campiglia_d%E2%80%99Orcia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/CastiglioneDOrciaCampigliaDOrciaPanaroma1.JPG","page_title":"Campiglia d’Orcia","context_page_description":"Campiglia d’Orcia ist ein Ortsteil von Castiglione d’Orcia in der Provinz Siena, Region Toskana in Italien."},{"page_url":"https://en.wikipedia.org/wiki/Venezuelan_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/TTEEJB-GNB.png","page_title":"Venezuelan Army","context_page_description":"The Venezuelan Army, officially the National Army of the Bolivarian Republic of Venezuela, is one of the six professional branches of the Armed Forces of Venezuela. It has the responsibility for land-based operations against external, or internal threats that may put the sovereignty of the nation at risk.\\nIt is the largest military branch of Venezuela and the second in Latin America, which on 24 June 1821 won a huge military victory against the Empire of Spain, which led to the independence of the nation. It later contributed to the independence of the present-day countries of Colombia, Ecuador, Panama, Peru, and Bolivia."},{"page_url":"https://en.wikipedia.org/wiki/Landmark_Trust","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Collegehill_House_Roslin_05.jpg","page_title":"Landmark Trust","context_page_description":"The Landmark Trust is a British building conservation charity, founded in 1965 by Sir John and Lady Smith, that rescues buildings of historic interest or architectural merit and then makes them available for holiday rental. The Trust's headquarters is at Shottesbrooke in Berkshire.\\nMost Trust properties are in England, Scotland and Wales. Several are on Lundy Island off the coast of north Devon, operated under lease from the National Trust. In continental Europe there are Landmark sites in Belgium, France and Italy. Five properties are in the United States — all in Vermont — one of which, Naulakha, was the home of Rudyard Kipling in the 1890s.\\nThe Trust is a charity registered in England & Wales and in Scotland. The American sites are owned by an independent sister charity, Landmark Trust USA. There is also an Irish Landmark Trust.\\nThose who rent Landmarks provide a source of funds to support restoration costs and building maintenance. The first rentals were in 1967 when six properties were available. The Trust's 200th property, Llwyn Celyn, opened for rental in October 2018."},{"page_url":"https://es.wikipedia.org/wiki/WTA_Finals_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Serena_Williams_Madrid_2014.jpg","page_title":"WTA Finals 2014","context_page_description":"El WTA Finals 2014 es un torneo de tenis en Singapur desde el 17 de octubre al 26 de octubre de 2014. Fue la 44.ª edición de la competición en individuales y de la 39.ª edición de la competición en dobles. El torneo se disputó en el Estadio Cubierto de Singapur, y participaron las 8 mejores jugadoras de la temporada en el cuadro de singles y las 8 mejores parejas en el cuadro de dobles. Fue el mayor de los dos campeonatos de fin de temporada de la WTA Tour 2014."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CE%BF%CF%8D%CF%83%CE%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Rousse-evangelical-church.jpg","page_title":"Ρούσε","context_page_description":"Η Ρούσε είναι η πέμπτη μεγαλύτερη πόλη της Βουλγαρίας. Βρίσκεται στο βορειοανατολικό τμήμα της χώρας, στή δεξιά όχθη του Δούναβη, απέναντι από τη Ρουμανική πόλη Τζιούρτζιου, 300 χλμ. από την πρωτεύουσα Σόφια και 200 χλμ. από τη Βουλγαρική Ακτή της Μαύρης Θάλασσας Είναι το σημαντικότερο ποτάμιο λιμάνι της Βουλγαρίας, λειτουργώντας ως σημαντικός παράγων του διεθνούς εμπορίου της χώρας. Είναι γνωστό για τη Νεομπαρόκ και Νεοροκοκό αρχιτεκτονική του, του 19ου και 20ού αιώνα, που προσελκύει πολλούς τουρίστες. Συχνά ονομάζεται Μικρή Βιέννη. Η Γέφυρα Φιλίας Ρούσε - Τζιούρτζιου, μέχρι τις 14 Ιουνίου 2013 η μόνη στο τμήμα του Δούναβη που μοιράζονται η Βουλγαρία και η Ρουμανία, διασχίζει εδώ τον ποταμό.\\nΤο Ρούσε είναι αδελφοποιημένο με το Περιστέρι."},{"page_url":"https://no.wikipedia.org/wiki/Egeskov_slott","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Egeskov_Slot_-_Den_gule_stue_TRS_060930_075.jpg","page_title":"Egeskov slott","context_page_description":"Egeskov slott ligger i Kværndrup syd for Ringe på Fyn i Danmark og er en borg med vanngrav. Slottet er datert til 1400-tallet, men bygningene som i dag utgjør slottet er datert 1554 og er bygget av Frands Brockenhuus. Slottet står på trestokker av eik i en liten sjø med maksimal dybde på omkring 5 meter. Ifølge en myte skal det ha blitt felt en hel skog for å få nok tømmer til byggingen, men dette er ikke bekreftet. Selve slottet er bygget av teglstein med karakteristiske runde hjørnetårn. Opprinnelig var det kun adgang via en vindelbro. Slottets riddersal ble restaurert i 1975. I alt er det 66 værelser, 200 vinduer, 2 062 enkelte ruter og ca. 60 skyteskår, der noen er murt igjen i dag.\\nEgeskov ble fredet i 1918.\\nTil slottet hører Ladegården, en stråtekt bindingsverkbygning, som i dag huser landbruksmuseet og hestekjøretøyene. Omkring slottet er en gammel park på om lag 20 hektar, med hekker fra 1730 og med fuchsiahaven som er enestående, da mange av plantene er mellom 40 og 60 år. Den opprinnelige bøkelabyrint er i dag lukket og ble i 1990 erstattet av en bambuslabyrint, med et kinesisk tårn i midten. Til slottet hører også tre store moderne haller, som huser veteranmuseet."},{"page_url":"https://ceb.wikipedia.org/wiki/Saujil_(lungsod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/FPSaujil-2008-03-13.jpg","page_title":"Saujil (lungsod)","context_page_description":"Lungsod ang Saujil sa Argentina. Nahimutang ni sa lalawigan sa Provincia de Catamarca, sa amihanang bahin sa nasod, 1,200 km sa amihanan-kasadpan sa Buenos Aires ang ulohan sa nasod. 1,651 metros ibabaw sa dagat kahaboga ang nahimutangan sa Saujil, ug adunay 320 ka molupyo.\\nAng yuta palibot sa Saujil kay lain-lain. Ang kinahabogang dapit sa palibot dunay gihabogon nga 4,080 ka metro ug 19.3 km sa sidlakan sa Saujil. Kunhod pa sa 2 ka tawo kada kilometro kwadrado sa palibot sa Saujil. Ang kinadul-ang mas dakong lungsod mao ang Fiambalá, 14.2 km sa habagatan sa Saujil.\\nHapit nalukop sa desiyerto ug kamingawan ang palibot sa Saujil. Ang klima bugnaw nga ugahon. Ang kasarangang giiniton 20 °C. Ang kinainitan nga bulan Disyembre, sa 28 °C, ug ang kinabugnawan Hulyo, sa 9 °C. Ang kasarangang pag-ulan 172 milimetro matag tuig. Ang kinabasaan nga bulan Pebrero, sa 77 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 1 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/French_ship_Vengeur_du_Peuple","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Vengeur_du_Peuple-Mayer_img_3103.jpg","page_title":"French ship Vengeur du Peuple","context_page_description":"Vengeur du Peuple was a 74-gun ship of the line of the French Navy. Funded by a don des vaisseaux donation from the chamber of commerce of Marseille, she was launched in 1762 as Marseillois.\\nShe took part in the naval operations in the American Revolutionary War in Admiral d'Estaing's squadron, duelling Preston in a single-ship action on 11 August 1778, taking part in the Battle of the Chesapeake where she duelled HMS Intrepid, and supporting the flagship Ville de Paris at the Battle of the Saintes. She also took part in the Battle of Saint Kitts.\\nAfter the French Revolution, she was renamed Vengeur du Peuple and took part in the Glorious First of June. There, she was disabled after a furious duel with HMS Brunswick and surrendered after losing hope of being rescued by a French ship. After a few hours, as British ships were beginning rescue operations, she listed and foundered, taking almost half her crew with her.\\nThe sinking of Vengeur du Peuple was used as propaganda by the National Convention and Bertrand Barère, who gave birth to the legend that the crew had gone down with the ship fighting, rather than surrender."},{"page_url":"https://fr.wikipedia.org/wiki/Thi%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Cases_des_tirailleurs_%C3%A0_Thi%C3%A8s_%28S%C3%A9n%C3%A9gal%29_01.jpg","page_title":"Thiès","context_page_description":"Thiès, chef-lieu de la région éponyme, est l'une des plus grandes villes du Sénégal. Elle est située à 70 km à l'est de Dakar.\\nFondée il y a plus de 100 ans, son développement correspond à l’implantation de l’Escale et à la Création de la ligne de chemin de fer de Dakar-Bamako. La création de comptoirs commerciaux et d’ateliers de réparation de la régie des chemins de fer a été un facteur déterminant dans la croissance de la «capitale du rail»."},{"page_url":"https://en.wikipedia.org/wiki/Bhalubang","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Pulchowk%2C_Bhalubang%2C_Deukhuri%2C_Dang.jpg","page_title":"Bhalubang","context_page_description":"Bhalubang, sometimes bhaluwang is a place located in Rapti Rural Municipality, Dang Deukhuri District, Nepal.\\nBhalubang literally refers bear ground. Before human settlement, that place was a play ground and habitat of bears. Human settlement on bhalubang started mainly in two different stages: before the construction of west rapti bridge and, after the construction of west rapti bridge. Bhalubang, the land of ethnic diversity, is lying on lap of Chure hills along with the West Rapti River. Bhalubang is known for the local trade center where peoples from nearby villages come for shopping.\\nBefore the construction of bridge on rapti, human settlement was there on east part of pulchowk which is now known as upper Bhalubang. Human settlement on next phase was started after construction of this bridge which is known as pulchowk or lower bhalubang. Peoples of Nepal, while returning from India, used to travel through Banghushree before the construction of this bridge. jwalamai gan', armed police camp, is a regional police training center. This camp is located on the west side of Bhalubang where Maoist attack in 2002 caused huge loss of life and property."},{"page_url":"https://de.wikipedia.org/wiki/Garindein","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Garindein_%28Pyr-Atl%2C_Fr%29_%C3%A9cole_communale.JPG","page_title":"Garindein","context_page_description":"Garindein ist eine französische Gemeinde mit 503 Einwohnern im Département Pyrénées-Atlantiques in der Region Nouvelle-Aquitaine. Die Gemeinde gehört zum Arrondissement Oloron-Sainte-Marie und zum Kanton Montagne Basque.\\nDer Name in der baskischen Sprache lautet Garindaine. Die Einwohner werden entsprechend Garindaintar genannt."},{"page_url":"https://bar.wikipedia.org/wiki/Parione","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Rome_-_Muni_1_-_Parione.PNG","page_title":"Parione","context_page_description":"Parione is da VI. Rione vo Rom. Ea umfossd's Oidstodquartia um: Piazza Navona und Campo de’ Fiori."},{"page_url":"https://vi.wikipedia.org/wiki/Coswig_(Anhalt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Coswig_town_hall.jpg","page_title":"Coswig (Anhalt)","context_page_description":"Coswig là một đô thị thuộc huyện Wittenberg, bang Saxony-Anhalt, Đức."},{"page_url":"https://sv.wikipedia.org/wiki/Brun_ofrys","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Ophrys_lupercalis_3.jpg","page_title":"Brun ofrys","context_page_description":"Brun ofrys, ellerOphrys fusca är en orkidéart som beskrevs av Heinrich Friedrich Link. Brun ofrys ingår i ofryssläktet, och familjen orkidéer."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_technischen_Denkmale_im_Landkreis_Leipzig","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Akvoturo_en_Pegau_01.jpg","page_title":"Liste der technischen Denkmale im Landkreis Leipzig","context_page_description":"Die Liste der technischen Denkmale im Landkreis Leipzig enthält die Technischen Denkmale im Landkreis Leipzig.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://sh.wikipedia.org/wiki/Br%C3%A9villers_(Pa_de_Kale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Br%C3%A9villers_%28Pas-de-Calais%29_-_Centre.JPG","page_title":"Brévillers (Pa de Kale)","context_page_description":"Brevijer je naselje i opština u severoistočnoj Francuskoj u regionu Sever-Pa d Kale, u departmanu Pa de Kale koja pripada prefekturi Montreuil.\\nPo podacima iz 1999. godine u opštini je živelo 107 stanovnika, a gustina naseljenosti je iznosila 35 stanovnika/km². Opština se prostire na površini od 3,03 km². Nalazi se na srednjoj nadmorskoj visini od 122 metara."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%8C%D1%82%D0%B5%D0%BD%D0%B3%D0%B0%D1%83%D0%B7%D0%B5%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Altenhausen_Sammlung_Duncker.jpg","page_title":"Альтенгаузен","context_page_description":"Альтенгаузен — громада в Німеччині, розташована в землі Саксонія-Ангальт. Входить до складу району Берде. Складова частина об'єднання громад Флехтінген.\\nПлоща — 43,17 км². Населення становить 1120 ос."},{"page_url":"https://nl.wikipedia.org/wiki/Subreus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Zams_and_tracks.png","page_title":"Subreus","context_page_description":"Een subreus is een ster met een grotere lichtkracht dan sterren op de hoofdreeks van dezelfde spectraalklasse, maar is minder lichtsterk dan een reuzenster. De term 'subreus' wordt toegepast op zowel de sterren\\nvan een bepaalde spectraalklasse, als op een fase in de sterevolutie."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%87%8D%E9%93%AC%E9%85%B8%E9%92%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Dichroman_sodn%C3%BD.JPG","page_title":"重铬酸钠","context_page_description":"重鉻酸鈉是一種無機化合物，俗稱紅礬鈉，化學式為Na₂Cr₂O₇，橘紅色晶體，常以二水合物的形式使用。其化學性質與重鉻酸鉀類似，在水中的溶解度約是後者的20倍，相對分子質量更小，然而其應用卻不及重鉻酸鉀廣泛。"},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AC%D8%B2%DB%8C%D8%B1%DB%81_%D9%86%D9%85%D8%A7_%D8%B4%D8%A7%D9%86%DA%88%D9%88%D9%86%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Location-of-Shandong-Peninsula.png","page_title":"جزیرہ نما شانڈونگ","context_page_description":"جزیرہ نما شانڈونگ مشرقی چین میں صوبہ شانڈونگ میں ایک جزیرہ نما ہے، جو بحیرہ بوہای اور بحیرہ اصفر کے درمیان واقع ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/Morning_Yawn","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/%27Morning_Yawn%27_by_Edvard_Munch%2C_1913%2C_Bergen_Kunstmuseum.JPG","page_title":"Morning Yawn","context_page_description":"Morning Yawn is a 1913 painting by the Norwegian artist Edvard Munch."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bauwerke_von_Gottfried_B%C3%B6hm","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Oldenburg_St-Christophorus_so.JPG","page_title":"Liste der Bauwerke von Gottfried Böhm","context_page_description":"Diese Liste der Bauwerke von Gottfried Böhm enthält Bauten, für die der Architekt in der einschlägigen Literatur als allein oder mit anderen planungsverantwortlich genannt wird. Da Böhm zu Beginn seiner Laufbahn im Büro seines Vaters Dominikus Böhm arbeitete, ergeben sich in Werklisten Überschneidungen. Ähnliches gilt für die jüngeren Bauten, an denen Böhms Söhne Peter, Paul oder Stephan mitverantwortlich waren."},{"page_url":"https://da.wikipedia.org/wiki/Udine","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Udine.png","page_title":"Udine","context_page_description":"Udine er en by i det nordøstlige Italien. Byen er provinshovedstad i Udineprovinsen i Friuli-Venezia Giulia. Udine kommune har 99.341 indbyggere og der bor omkring 175.000 med opland.\\nUdinese er byens fodboldhold og har hjemme på Stadio Friuli."},{"page_url":"https://it.wikipedia.org/wiki/Joshua_Gomez","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Joshua_Gomez_by_Gage_Skidmore.jpg","page_title":"Joshua Gomez","context_page_description":"Joshua Eli Gomez è un attore statunitense."},{"page_url":"https://en.wikipedia.org/wiki/Shed","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Schuppen_7235.jpg","page_title":"Shed","context_page_description":"A shed is typically a simple, single-story roofed structure in a back garden or on an allotment that is used for storage, hobbies, or as a workshop. Sheds vary considerably in their size and complexity of construction, from simple open-sided ones designed to cover bicycles or garden items to large wood-framed structures with shingled roofs, windows, and electrical outlets. Sheds used on farms or in industry can be large structures. The main types of shed construction are metal sheathing over a metal frame, plastic sheathing and frame, all-wood construction, and vinyl-sided sheds built over a wooden frame. Small sheds may include a wooden or plastic floor, while more permanent ones may be built on a concrete pad or foundation. Sheds may be lockable to deter theft or entry by children, domestic animals, wildlife, etc.\\nA culture of shed enthusiasts exists in several countries for people who enjoy building sheds and spending time in them for relaxation. In Australia and New Zealand there are magazines called The Shed, an association for shed hobbyists, and a book entitled Men and Sheds."},{"page_url":"https://en.wikipedia.org/wiki/List_of_roads_in_Metro_Manila","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/NLEX_near_Malinta_tollgate_%28Paso_De_Blas%2C_Valenzuela%29%282017-05-10%29.jpg","page_title":"List of roads in Metro Manila","context_page_description":"This list of roads in Metro Manila summarizes the major thoroughfares and the numbering system currently being implemented in Metro Manila, Philippines. Metro Manila's arterial road network consists of National Roads, the Circumferential Roads, and the Radial Roads, as well as the other major roads connecting the cities of Manila, Quezon, North and South Caloocan, Valenzuela, Malabon, Navotas, Pasay, Parañaque, Las Piñas, Taguig, Muntinlupa, Marikina, Pasig, Mandaluyong, Makati, Pateros, and San Juan as well as the surrounding provinces."},{"page_url":"https://lt.wikipedia.org/wiki/Mikoyan-Gurevich_MiG-21","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/MiG-21_Lancer_C_cropped.jpg","page_title":"Mikoyan-Gurevich MiG-21","context_page_description":"MiG-21 – Tarybų Sąjungos antros kartos naikintuvas, XX a. 6-ame dešimtmetyje sukurtas Mikojano ir Gurevičiaus konstruktorių biure. Tai labiausiai paplitęs viršgarsinis lėktuvas pasaulyje. Serijiniu būdu gamintas TSRS, taip pat Čekoslovakijoje, Indijoje ir Kinijoje."},{"page_url":"https://lv.wikipedia.org/wiki/NEFAZ","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/NefAZ_buses_and_KAMAZ_trucks.jpg","page_title":"NEFAZ","context_page_description":"PAO NEFAZ ir Krievijas autobūves uzņēmums, kas bāzēts Ņeftekamskā. Tas ietilpst uzņēmumu grupā KAMAZ. Uzņēmums dibināts 1993. gadā uz Ņeftekamskas autorūpnīcas bāzes, kas darbu sāka 1977. gadā.\\nNEFAZ ražo pašizgāzējus, autobusus, speciālo tehniku uz KAMAZ un citu autoražotāju šasijas bāzes, kā arī piekabes un lauksaimniecības tehniku.\\nPAO NEFAZ lielākie akcionāri 2018. gadā bija PAO KAMAZ un Bank URALSIB. Pārējās kapitāldaļas tiek kotētas Maskavas biržā."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D0%B5%D0%B9%D0%B4%D1%8F%D0%BD%D0%B5_(%D0%B7%D0%B0%D0%BA%D0%B0%D0%B7%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/%D0%9F%D0%B0%D0%BD%D0%BE%D1%80%D0%B0%D0%BC%D0%B0_%D1%83%D1%80%D0%BE%D1%87%D0%B8%D1%89%D0%B0_%22%D0%9A%D1%80%D0%B5%D0%B9%D0%B4%D1%8F%D0%BD%D0%B5%22.jpg","page_title":"Крейдяне (заказник)","context_page_description":"Кре́йдяне — ботанічний заказник місцевого значення в Україні. Об'єкт розташований на території Слов'янського району Донецької області, біля сел Пискунівка та Стародубівка.\\nПлоща — 102,9 га, статус отриманий у 2006 році."},{"page_url":"https://zh.wikipedia.org/wiki/Production_I.G","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/PRODUCTION_I.G_STUDIO.jpg","page_title":"Production I.G","context_page_description":"Production I.G 為日本的一家動畫製作公司，成立於1987年12月6日。英文字「I.G」分別取自現任社長石川光久和現任副社長兼原畫師後藤隆幸的日文羅馬拼音開頭「I」和「G」作命名。Production I.G便是在他們兩人共同出資之下而創立，創立初期名稱為IG龍之子，是從龍之子製作公司分拆出來的。2007年母公司化並改名為「I.G Port」，由內部另外成立現在的新Production I.G，為I.G Port的旗下子公司。\\n代表作有攻殼機動隊系列、PSYCHO-PASS系列、罪惡王冠、影子籃球員、排球少年！！、進擊的巨人、鑽石王牌等。"},{"page_url":"https://ast.wikipedia.org/wiki/Mercedes-Benz_en_F%C3%B3rmula_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Mercedes_W_196_mit_3-l-Motor_%28Fangio%29_1986-08-16.jpg","page_title":"Mercedes-Benz en Fórmula 1","context_page_description":"Mercedes AMG Petronas Motorsport, enantes conocida como Mercedes AMG Petronas F1 Team ye una escudería de Fórmula 1 dirixida pola empresa automovilística alemana Daimler AG, al traviés de la so marca Mercedes-Benz. Formar nos años 30 y participó na Fórmula 1 en 1954 y 1955.\\nEl día 16 de payares de 2009, col anunciu de la compra del equipu campeón de la temporada 2009 Brawn GP, anunció la so vuelta a la Fórmula 1 per parte de Mercedes a partir de 2010. Con esta adquisición, McLaren ye a cencielles un equipu que recibe los motores alemanes, igualmente Mercedes-Benz va vender el 40% de les aiciones que tien sobre McLaren, que van ser mercaes pol equipu de Woking. Taba previstu que, para 2011, Mercedes desvencéyese totalmente de McLaren no que fai a la propiedá del forno pero esto nun asocedió hasta'l 2014, siendo este l'últimu añu de McLaren con un motor Mercedes.\\nEl xasis y motor son construyíos por Mercedes. Daimler AG ye la empresa propietaria de la escudería. L'equipu cuntó nes sos files con Nico Rosberg y al 7 vegaes campeón del mundu Michael Schumacher, lo que marcó la torna a la categoría del múltiple campeón dende'l so retiru en 2006."},{"page_url":"https://en.wikipedia.org/wiki/Adolphus_Humbles","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Humbles_Building%2C_Fifth_Street_Historic_District%2C_Lynchburg%2C_Virginia%2C_United_States%2C_2011.JPG","page_title":"Adolphus Humbles","context_page_description":"Adolphus Humbles was an American merchant and toll road operator in Richmond, Virginia. He was an early supporter of the Virginia Theological Seminary in Lynchburg, Virginia and Humbles Hall is named for him. He built a commercial and events building and was an influential tennis coach. He was African American."},{"page_url":"https://la.wikipedia.org/wiki/Ars_scaenica","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Japan_Expo_2012_-_Kabuki_-_Troupe_Bugakuza_-_042.jpg","page_title":"Ars scaenica","context_page_description":"Ars scaenica seu ars theatralis est ars activa ubi solus quidam aut plures, in momento et spatio quodam, se ad alium aut alios ostendunt, fabulam agentes.\\nOstentatio vel actio appellatur fabula, ludus scaenicus vel spectaculum; momentum et spatium spectaculi appellantur scaena; et aedificium scaenam spectatorumque sedilia complexum, theatrum.\\nQui artem in scaena agit appellatur actor, histrio, ballator, poeta, aut cantor, secundum genus spectaculi. Post siparium artifices scaenici quoque sunt moderator, productor, musicus, faber scaenicus, effectuum specialium peritus, luminator, artifex sonorum, etc.\\nLudus aut spectaculum saepe musicam et saltationem assectatur, et theatra quoque sunt loci orationibus, acroasibus, concentibus et symphoniis idonei, sed musica, ballatio, oratio, et acroasis sine actione fabulaque narrata non habentur artes scaenicae. Theatrum lyricum vel opera est genus spectaculi ubi histriones cantant; si loquuntur, spectaculum dicitur theatrum prosae."},{"page_url":"https://fr.wikipedia.org/wiki/Mont_Ulia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Monpas_donostia_001.jpg","page_title":"Mont Ulia","context_page_description":"Le mont Ulia, aussi nommé Uliamendi, est une crête mineure située à l'est de Saint-Sébastien dans la Communauté autonome basque en Espagne, atteignant 243 mètres d'altitude à son point culminant. Le mont domine une chaîne qui s'étend le long de la côte et s'enfonce dans le détroit menant à la baie de Pasaia avec Saint-Sébastien à l'ouest et la plage de Zurriola et le quartier de Gros situés juste en dessous. Cette situation privilégiée fait de l'endroit une zone de loisirs importante et romantique dès le début du XXᵉ siècle.\\nEn 1530, le mont Ulia, appelé à cette époque selon son nom gascon de mont Mirall, avait à son sommet un point d'observation des baleines migratrices passant au large de la côte basque alors qu'elles s'approchaient de l'entrée de la plage de Zurriola. Les observateurs prévenaient alors les baleiniers de Saint-Sébastien de leur présence au moyen d'un feu de joie."},{"page_url":"https://en.wikipedia.org/wiki/Arthur_E._Drumm","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/United_Rotary_Brush_Marysville.jpg","page_title":"Arthur E. Drumm","context_page_description":"Arthur E. Drumm was an American inventor, environmentalist, military subcontractor, and industrialist of the modern street sweeping broom industry, as well as a publisher."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%BCchsenmacher","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Gunsmith.jpg","page_title":"Büchsenmacher","context_page_description":"Ein Büchsenmacher stellt Schusswaffen her, repariert diese und treibt oft auch Handel damit."},{"page_url":"https://de.wikipedia.org/wiki/Independencia_(Ayopaya)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Independencia_Klimadiagramm.png","page_title":"Independencia (Ayopaya)","context_page_description":"Independencia ist eine Landstadt im Departamento Cochabamba im südamerikanischen Andenstaat Bolivien."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Nobitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/ALWO_Kotteritz_1.jpg","page_title":"Liste der Kulturdenkmale in Nobitz","context_page_description":"In der Liste der Kulturdenkmale in Nobitz sind die Kulturdenkmale der ostthüringischen Gemeinde Nobitz im Landkreis Altenburger Land und ihrer Ortsteile aufgelistet. Diese Liste basiert auf der Denkmalliste der Unteren Denkmalschutzbehörde des Landkreises mit Stand vom 10. August 2015. Die hier veröffentlichte Liste besitzt informativen Charakter und ist nicht rechtsverbindlich. Insbesondere können in Einzelfällen auch Objekte Kulturdenkmal sein, die nicht in der Liste enthalten sind. Ergänzt wird diese Darstellung in einem separaten Abschnitt um ehemalige Denkmale."},{"page_url":"https://de.wikipedia.org/wiki/NGC_5929","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/NGC5929_-_SDSS_DR14.jpg","page_title":"NGC 5929","context_page_description":"NGC 5929 ist eine 13,3 mag helle Spiralgalaxie mit aktivem Galaxienkern vom Hubble-Typ Sab/pec im Sternbild Bärenhüter und etwa 117 Mio. Lj von der Milchstraße entfernt. Sie bildet zusammen mit der deutlich größeren Galaxie NGC 5930 die wechselwirkende Konstellation Arp 90. Halton Arp gliederte seinen Katalog ungewöhnlicher Galaxien nach rein morphologischen Kriterien in Gruppen. Diese Galaxie gehört zu der Klasse Spiralgalaxien mit einem großen Begleiter hoher Flächenhelligkeit auf einem Arm.\\nDie Galaxie wurde am 13. Mai 1828 von John Herschel entdeckt."},{"page_url":"https://it.wikipedia.org/wiki/Proclama_reale_del_1763","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Map_of_territorial_growth_1775.svg","page_title":"Proclama reale del 1763","context_page_description":"Il proclama reale del 1763 venne emanato il 7 ottobre 1763 da re Giorgio III d'Inghilterra a seguito dell'acquisizione da parte della Regno di Gran Bretagna dei territori francesi in Nord America al termine della guerra franco-indiana e della guerra dei sette anni.\\nLo scopo del proclama era di riorganizzare i possedimenti britannici in Nord America e normalizzare le relazioni con i nativi americani regolamentando il commercio, l'acquisto delle terre e la politica degli insediamenti sulla frontiera occidentale."},{"page_url":"https://eo.wikipedia.org/wiki/John_Travolta","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/John_Travolta.jpg","page_title":"John Travolta","context_page_description":"John Joseph TRAVOLTA naskiĝis la 18-an de februaro 1954 en Englewood, Nov-Ĵerzejo, Usono estas usona aktoro, kiu famiĝis en la filmo \\"Grease\\" farita laŭ la samtitola muzikalo Grease.\\nEkde la jaro 1975 oni anoncis lian aliĝon al scientologia eklezio. Komence de la jaro 2009 oni anoncis la morton de lia 16-jara filo en akcidento en banujo dum ferioj."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Auer_(S%C3%BCdtirol)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/BahnhofAuerFleimstalbahn.jpg","page_title":"Liste der Baudenkmäler in Auer (Südtirol)","context_page_description":"Die Liste der Baudenkmäler in Auer enthält die 25 als Baudenkmäler ausgewiesenen Objekte auf dem Gebiet der Gemeinde Auer (Südtirol).\\nBasis ist das im Internet einsehbare offizielle Verzeichnis der Baudenkmäler in Südtirol. Dabei kann es sich beispielsweise um Sakralbauten, Wohnhäuser, Bauernhöfe und Adelsansitze handeln. Die Reihenfolge in dieser Liste orientiert sich an der Bezeichnung, alternativ ist sie auch nach der Adresse oder dem Datum der Unterschutzstellung sortierbar."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AB%E3%83%BB%E3%83%B4%E3%82%A7%E3%83%AB%E3%83%8D%E5%8F%8E%E5%AE%B9%E6%89%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Camp_de_vernet.jpg","page_title":"ル・ヴェルネ収容所","context_page_description":"ル・ヴェルネ収容所は、南仏アリエージュ県ル・ヴェルネに存在した強制収容所であり、1939年から44年までの間に世界58か国の出身者約4万人が収監された。抑留者は主にスペインからの難民、フランス政府が敵性外国人としたドイツ人、オーストリア人ら、反ナチズム、反ファシズム、レジスタンスの運動家およびユダヤ人であった。2019年に歴史的記念物に指定された。"},{"page_url":"https://en.wikipedia.org/wiki/Dismorphia_zaela","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Dismorphia_zaela_abilene_female.JPG","page_title":"Dismorphia zaela","context_page_description":"Dismorphia zaela, the zaela mimic white, is a butterfly in the family Pieridae. It is found from Costa Rica to Ecuador.\\nThe wingspan is about 54 mm.\\nThe larvae feed on Inga species, including Inga pittieri."},{"page_url":"https://es.wikipedia.org/wiki/Loch_Awe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Hotel_and_Ben_Lui%2C_Loch_Awe%2C_Scotland_LOC_3449513817.jpg","page_title":"Loch Awe","context_page_description":"El loch Awe es un gran loch de agua dulce escocés localizado en el concejo de Argyll y Bute, en las Tierras Altas de Escocia. También ha dado su nombre a una aldea en sus orillas, conocida como Loch Awe, o Lochawe. Hay islas dentro del lago, siendo las mayores Innis Chonnell e Inishail."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Detmold-Kernstadt","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/Detmold_-_167_-_Wall_5.jpg","page_title":"Liste der Baudenkmäler in Detmold-Kernstadt","context_page_description":"Die Liste der Baudenkmäler in Detmold-Kernstadt enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Detmold-Kernstadt in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Detmold eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://nl.wikipedia.org/wiki/Dithiocarbamaat","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Dithiocarbamate.svg","page_title":"Dithiocarbamaat","context_page_description":"Een dithiocarbamaat is een functionele groep afgeleid van een carbamaatgroep, waarbij beide zuurstofatomen zijn vervangen door een zwavelatoom. Het is verwant met de thiocarbamaten. Organische dithiocarbamaten hebben een organische groep gebonden aan een van de twee zwavels. Dithiocarbamaat komt als eenwaardig anion voor in zouten van onder andere natrium en kalium. In metaalcomplexen komt het voor als meestal bidentaat ligand met formele lading -1. De zouten en metaalcomplexen worden ook aangeduid met de naam dithiocarbamaat."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%8A%D9%84%D9%8A%D8%A7%D9%85_%D8%A5%D9%8A._%D9%84%D9%8A%D9%81%D9%8A%D9%86%D8%BA%D8%B3%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/William_E._Livingston_%28Massachusetts%29.png","page_title":"ويليام إي. ليفينغستون","context_page_description":"ويليام إي. ليفينغستون هو سياسي أمريكي، ولد في 25 يونيو 1832 في لوويل في الولايات المتحدة."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A4%D1%83%D0%B4%D0%B1%D0%B0%D0%BB%D1%81%D0%BA%D0%B0_%D1%80%D0%B5%D0%BF%D1%80%D0%B5%D0%B7%D0%B5%D0%BD%D1%82%D0%B0%D1%86%D0%B8%D1%98%D0%B0_%D0%BD%D0%B0_%D0%92%D0%B5%D0%BB%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/600px_Rosso_bordato_di_Nero_con_spada_bianca.png","page_title":"Фудбалска репрезентација на Велс","context_page_description":"Фудбалската репрезентација на Велс го претставува Велс на меѓународните фудбалски натпреварувања и е под контрола на Фудбалската Асоцијација на Велс, третата најстара национална фудбалска асоцијација во светот.\\nИако територијално е дел од Обединетото Кралство, Велс отсекогаш имал своја репрезентација во фудбал која играла на големи меѓународни турнири, освен на Олимписките игри, бидејќи Меѓународниот олимписки комитет отсекогаш ја признавал само Велика Британија.\\nВо досегашната историја на репрезентацијата, Велс се квалификувал на два големи меѓународни турнири. Тие стигнале до четвртфиналето на Светското првенство 1958 што до денес е единствениот нивен настап на завршницата на некое Светско првенство. Покрај тоа, Велс исто така само еднаш досега се квалификувал и за Европското првенство, стигајќи до полуфиналето на првенството во 2016 година.\\nВо сите репрезентативни нивоа, вклучително и младинските репрезентации, репрезентацијата на Велс влече играчи пред се од клубови од англискиот лигашки фудбалски систем. Главните професионални велшки клубови исто така играат во англиските лиги, а некои професионални клубови играат и во велшкиот лигашки фудбалски систем."},{"page_url":"https://cs.wikipedia.org/wiki/Antonio_da_Sangallo_star%C5%A1%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/126_le_vite%2C_antonio_da_sangallo.jpg","page_title":"Antonio da Sangallo starší","context_page_description":"Antonio da Sangallo starší, byl italský renesanční architekt působící převážně ve Florencii. Jeho otec Francesco Giamberti byl řezbář a architekt, který pracoval pro Cosima Medicejského, starší bratr Giuliano da Sangallo a synovec Antonio da Sangallo mladší byli stejně jako on architekti.\\nAntonio budoval především různá opevnění, například v Arezzu, v Montefiascone a v Římě, ale stavěl i kostely a paláce, například v toskánském San Savinu a v již zmíněném Arezzu.\\nK nejkrásnějším dílům, jež jsou mu připisována, patří kostel Madonna di San Biagio v Montepulcianu, který zbudoval na místě staršího farního kostela v letech 1518–1537. Jde o typickou toskánskou stavbu ze 16. století s půdorysem řeckého kříže, s centrální kupolí nad čtvercovým tamburem a se dvěma zvonicemi z bílého travertinu."},{"page_url":"https://tr.wikipedia.org/wiki/Katalonya_h%C3%BCk%C3%BBmet_ba%C5%9Fkanlar%C4%B1_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Niceto_Alcal%C3%A1_Zamora%2C_presidente_de_la_II_Rep%C3%BAblica_Espa%C3%B1ola.jpg","page_title":"Katalonya hükûmet başkanları listesi","context_page_description":"Berenguer de Cruïlles, Bishop of Girona\\nRomeu Sescomes, Bishop of Lleida\\nRamon Gener\\nBernat Vallès, canon of Barcelona\\nRomeu Sescomes, Bishop of Lleida\\nJoan I d'Empúries\\nGuillem de Guimerà i d'Abella, Grand Prior of the Hospitaller Order of St. John of Jerusalem\\nGalceren de Besora i de Cartellà, almoner of Ripoll\\nRamon Gener\\nFelip d'Anglesola, canon of Tarragona\\nPere de Santamans, canon of Tortosa\\nArnau Descolomer, cleric from Girona\\nMiquel de Santjoan, canon of Girona\\nAlfons de Tous, canon of Barcelona"},{"page_url":"https://bs.wikipedia.org/wiki/Kukurijeci","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Double_pink_hellebore_with_dark_blotching.JPG","page_title":"Kukurijeci","context_page_description":"Helleborus je rod kukurijeka, cvjetnica iz porodice Ranunculaceae, red Ranunculales.\\nPrema Katalogu života, najpoznatiji taksoni su iz slijedećeg kladograma:\\nUobičajeni naziv taksona ovog roda je heleboridi ili kukurijeci. Ovaj evroazijski rod ima oko 20 vrsta zeljastih ili zimzelenih trajnica.\\nMnoge vrste kukurijeka su otrovne."},{"page_url":"https://cs.wikipedia.org/wiki/Ml%C3%A9%C4%8Divec_alpsk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Mulgedium_alpinum_a2.jpg","page_title":"Mléčivec alpský","context_page_description":"Mléčivec alpský je planě rostoucí rostlina dorůstající až do výše okolo 2 m která při poranění vydatně mléčí, v letním období vykvétá modrofialově."},{"page_url":"https://it.wikipedia.org/wiki/Glossopteris","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Glossopteris.jpg","page_title":"Glossopteris","context_page_description":"La glossopteride è una pianta estinta, appartenente alle pteridospermatofite. Visse tra il Permiano inferiore e il Triassico inferiore e i suoi resti, rinvenuti in India, Australia, Africa meridionale, Madagascar, Sudamerica e Antartide, sono stati fondamentali come prova per la teoria della deriva dei continenti."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B0%D0%B4%D0%B0%D1%82%D0%B8-%D0%91%D0%B5%D0%BD%D0%B8%D0%BE%D1%84_%D0%B7%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Kuril_Benioff_zone.JPG","page_title":"Вадати-Бениоф зона","context_page_description":"Вадати-Беониоф зона је дубоко, сеизмички активно подручје у субдукционој зони. Диференцијални покрети у овој зони производе дубоке земљотресе, чији хипоцентри могу бити на дубинама и до 700 километара. Ове зоне развијају се испод вулканских острвских лукова и континенталних маргина испод активних субдукционих зона. Могу настати као резултат кретања дуж реверсних раседа везаних за субдукцију или кретања на раседима који се налазе на субдукујућој плочи, као резултат екстензије током силажења плоче у мантл. Дубоки земљотреси у овој зони омогућавају тродимензионално картирање површи субдукције. Падни угао ове зоне исти је као падни угао субдукујуће плоче.\\nОва зона названа је по два сеизмолога, који су је независно открили. То су били Хуго Бениоф и Кијо Вадати."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%99%D7%A1%D7%95%D7%99_%D7%94%D7%A2%D7%92%D7%91%D7%AA_%D7%91%D7%98%D7%A1%D7%A7%D7%99%D7%92%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Tuskegee_study.jpg","page_title":"ניסוי העגבת בטסקיגי","context_page_description":"ניסוי העגבת בטסקיגי, שהתקיים בין השנים 1932 ל-1972, הוא אירוע ידוע לשמצה בהיסטוריה של האתיקה הרפואית. מדובר בניסוי קליני שנערך בטסקיגי שבמדינת אלבמה, באוכלוסייה של 399 עובדי כפיים שחורים, עניים וברובם בלתי משכילים, ובקבוצת ביקורת בת 200 איש נוספים מאוכלוסייה זו, שנבחנו לבדיקת הטיפול והמהלך הטבעי של מחלת העגבת. ניסוי זה נודע לשמצה והפך לאבן דרך בהתייחסות לחולה המשתתף בניסוי הקליני ובהגנת זכויותיו הבסיסיות, בשל העובדה שהוא נערך ללא כל התחשבות בבריאות ובכבוד האדם של המשתתפים בו. המשתתפים בניסוי לא נתנו הסכמה מדעת לניסוי ולתוצאותיו, ולא הודיעו להם כי אובחנו כנגועים בעגבת. נאמר להם כי בעייתם היא \\"דם רע\\", וכי יוכלו לקבל טיפול בחינם, נסיעות בחינם אל המרפאה, ארוחה חמה אחת ליום, ואם ימותו, תקבל משפחתם אלף דולר להוצאות הקבורה.\\nבשנות ה-40 הוכנס לשימוש נרחב הפניצילין, שסיפק מרפא למחלת העגבת. לפני תגלית זו, המחלה גרמה לעיתים קרובות לפגיעות כרוניות הקרויות השלב השלישי של מחלת העגבת. בשלב זה, המתחיל מספר שנים לאחר ההדבקה, עלולים להיפגע אבי העורקים, המוח, חוט השדרה, העצמות, העור ועוד. כל אלה גורמים לייסורים, ולעיתים אף למוות. במקום לטפל בכל החולים במסגרת הניסוי בפניצילין, ולסיים את הניסוי, החליטו המדענים בטסקיגי להעלים את המידע על קיומה של התרופה ולהמשיך בחקר התפתחות המחלה בחוליהם."},{"page_url":"https://it.wikipedia.org/wiki/Universit%C3%A0_Johannes_Gutenberg_di_Magonza","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Uni-Mainz-Forum-Januar_2006.jpg","page_title":"Università Johannes Gutenberg di Magonza","context_page_description":"L'Università Johannes Gutenberg di Magonza è un'università tedesca situata a Magonza, nel Land della Renania-Palatinato. Con 35.785 studenti e circa 150 fra istituti e ospedali, è una delle dieci più grandi università in Germania. In una riforma strutturale il 1º gennaio 2005 l'Università è stata strutturata in undici aree tematiche. Il suo nome è un omaggio all'inventore della stampa a caratteri mobili, Johannes Gutenberg, che viveva ed operava a Magonza."},{"page_url":"https://en.wikipedia.org/wiki/Artemis_program","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Starship_Human_Landing_System.png","page_title":"Artemis program","context_page_description":"The Artemis program is a US government-funded crewed spaceflight program that has the goal of landing \\"the first woman and the next man\\" on the Moon, specifically at the lunar south pole region by 2024. The program is carried out predominantly by NASA, U.S. commercial spaceflight companies contracted by NASA, and international partners such as the European Space Agency, the Japan Aerospace Exploration Agency, Canadian Space Agency and the Australian Space Agency. NASA is leading the program, but expects international partnerships to play a key role in advancing Artemis as the next step towards the long-term goal of establishing a sustainable presence on the Moon, laying the foundation for private companies to build a lunar economy, and eventually sending humans to Mars.\\nIn December 2017, President Donald Trump signed Space Policy Directive 1, authorizing the lunar campaign. Artemis draws upon ongoing spacecraft programs including Orion, the Lunar Gateway, and Commercial Lunar Payload Services, and adds an undeveloped crewed lander."},{"page_url":"https://en.wikipedia.org/wiki/Nijmegen_Helmet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Het_Valkhof_-_Gesichtshelm_eines_Reiters.jpg","page_title":"Nijmegen Helmet","context_page_description":"The Nijmegen Helmet is a Roman cavalry sports helmet from the first or second century AD. It was found around 1915 in a gravel bed on the left bank of the Waal river, near the Dutch city of Nijmegen. The helmet would have been worn by the élite Roman cavalry. The head portion of the helmet is made of iron, while the mask and diadem are of bronze or brass. The helmet has a neck-protecting projecting rim, overlaid with a thin bronze covering plated with silver. The diadem features two male and three female figures.\\nThe helmet sustained oxidisation. Several other Roman sports helmets have also been found in or near Nijmegen."},{"page_url":"https://en.wikipedia.org/wiki/Ann_Carr_(evangelist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Ann_Carr.jpg","page_title":"Ann Carr (evangelist)","context_page_description":"Ann Carr was a British evangelist who founded the Female Revivalist Society. An offshoot of the Primitive Methodists, the Society used female and male preachers."},{"page_url":"https://es.wikipedia.org/wiki/Giovanni_Antonio_Farina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Giovanni-Antonio-Farina-photo.jpg","page_title":"Giovanni Antonio Farina","context_page_description":"Giovanni Antonio Farina, algunas veces castellanizado por Juan Antonio Farina, ​ fue un sacerdote católico italiano, obispo de Trevis y luego de Vicenza, fundador de las Hermanas Maestras de Santa Dorotea de Vicenza. Es venerado como santo en la Iglesia católica, cuya fiesta celebra el 4 de marzo.​"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D9%8A%D8%B3%D8%A7_%D8%A5%D8%B1%D9%86%D8%B3%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Kajsa_Ernst.jpg","page_title":"كايسا إرنست","context_page_description":"كايسا إرنست ‏ هي ممثلة سويدية، ولدت في 4 أغسطس 1962 في Kortedala في السويد."},{"page_url":"https://fr.wikipedia.org/wiki/Palais_byzantin_d%27%C3%89ph%C3%A8se","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Ephesos_Byzantine_palace_plan.png","page_title":"Palais byzantin d'Éphèse","context_page_description":"Le Palais byzantin d'Éphèse, aussi connu sous le nom turc Sarhoç Hamam, en référence à sa partie balnéaire, est un grand édifice public de la ville romaine tardive d'Éphèse. Situé à environ 70 m au Sud-Est de l’épiskopéion, ce vaste complexe a longtemps été identifié à un établissement de bains byzantins. Il comporte en effet une importante partie thermale au Nord, une grande salle de réception octogonale au Sud, précédée d’une longue salle à deux absides à l’Ouest."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B4%D9%8A%D8%B1_%D8%B4%D8%A7%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Qila-i-Kohna.jpg","page_title":"شير شاه","context_page_description":"شير شاه صوري، ويـُعرف أيضاً باسم فريد خان أو شير خان، كان امبراطوراً هندياً قوياً في العصور الوسطى من ساسارام، بيهار، الهند. وكان شير شاه من أصل بشتوني وقد أسس أسرة حاكمة عـُرفت باسم أسرة صور عام 1540 في شمال الهند. وقد طرد الأسرة المغولية في أغرة وقد كان حكمه بداية أسرة صوري التي عمـَّرت لفترة وجيزة في الهند."},{"page_url":"https://de.wikipedia.org/wiki/Southern_Leyte","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Blue-Spotted_Stingray.png","page_title":"Southern Leyte","context_page_description":"Southern Leyte ist eine Provinz der Philippinen in der Region Eastern Visayas. Southern Leyte war eine Unterprovinz der ehemaligen großen Provinz Leyte, ehe diese in zwei Provinzen aufgeteilt wurde.\\nHauptstadt von Southern Leyte ist Maasin City; der Gouverneur heißt Roger Mercado.\\nLimasawa, eine Inselgemeinde im südlichen Teil der Provinz, ist historischen Quellen zufolge der Ort, an dem Ferdinand Magellan die erste christliche Messe auf den Philippinen hielt, weshalb er als Geburtsort des Christentums auf dem Inselstaat gilt."},{"page_url":"https://en.wikipedia.org/wiki/Botiz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Botiz_jud_Satu_Mare.png","page_title":"Botiz","context_page_description":"Botiz is a commune of 4,698 inhabitants situated in Satu Mare County, Romania. It is composed of a single village, Botiz. Until 2004, it also included Agriș and Ciuperceni villages, but these were split off that year to form Agriș Commune.\\nEast of Botiz, there is a medium-wave broadcasting station with two 139-metre-tall guyed masts."},{"page_url":"https://hu.wikipedia.org/wiki/F%C3%B6ckelberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Foeckelberg.jpg","page_title":"Föckelberg","context_page_description":"Föckelberg település Németországban, Rajna-vidék-Pfalz tartományban. Lakosainak száma 385 fő. +/-"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%88%D8%B1%D8%A7%D8%AE%E2%80%8C%DA%A9%D8%A7%D8%B1%DB%8C_%D8%A8%D8%AF%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Oblongata.jpg","page_title":"سوراخ‌کاری بدن","context_page_description":"سوراخ کاری بدن، پرسینگ یا آژین‌کاری شامل سوراخ کردن یا بریدن قسمتی از اعضای بدن است که برای استفاده جواهرات ایجاد می‌شود.\\nآژین کردن نوعی تغییرات بدن است. معیارهای فرهنگی بازتاب سوراخ کاری بدن بسیار گوناگون است.نوعی ازپرسینگ را روی الت تناسلی مردانه یا زنانه جهت زیبایی انجام می دهند."},{"page_url":"https://en.wikipedia.org/wiki/Kaiser-class_battleship","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Bundesarchiv_DVM_10_Bild-23-61-53%2C_Gro%C3%9Flinienschiff_%22SMS_Prinzregent_Luitpold%22.jpg","page_title":"Kaiser-class battleship","context_page_description":"The Kaiser class was a class of five battleships that were built in Germany prior to World War I and served in the Imperial German Navy during the war. They were the third class of German dreadnoughts, and the first to feature turbine engines and superfiring turrets. The five ships were Kaiser, Friedrich der Grosse, Kaiserin, Prinzregent Luitpold, and König Albert. As was usual for German battleships of the period, the Kaiser class mounted main guns that were smaller than those of their British rivals: 30.5 cm, compared to the 34.3 cm guns of the British Orion class.\\nAll five ships saw action in the North Sea during the war; they served together as VI Division of III Battle Squadron. Four were present during the Battle of Jutland; König Albert was in dock at the time. Of the four ships that took part in the battle, only Kaiser was damaged, being struck by two heavy-caliber shells. The ships also took part in Operation Albion in the Baltic Sea; during the operation they were reorganized as IV Battle Squadron, under the command of Vice Admiral Wilhelm Souchon.\\nAt the end of the war, all five ships were interned at the British naval base in Scapa Flow."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%B0%D0%BB-%D0%9B%D0%B5%D0%B9%D0%BA_(%D0%90%D0%B9%D0%BE%D0%B2%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Bullhead.jpg","page_title":"Кристал-Лейк (Айова)","context_page_description":"Кристал-Лейк — місто в США, в окрузі Генкок штату Айова. Населення — 250 осіб."},{"page_url":"https://id.wikipedia.org/wiki/Akasia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Acacia_dealbata1.jpg","page_title":"Akasia","context_page_description":"Akasia adalah genus dari semak-semak dan pohon yang termasuk dalam subfamili Mimosoideae dari familia Fabaceae, pertama kali diidentifikasi di Afrika oleh ahli botani Swedia Carl Linnaeus tahun 1773. Banyak spesies Akasia non-Australia yang cenderung berduri, sedangkan mayoritas Akasia Australia tidak. Akasia adalah tumbuhan polong, dengan getah dan daunnya biasanya mempunyai bantalan tannin dalam jumlah besar. Nama umum ini berasal dari ακακία, nama yang diberikan oleh dokter-ahli botani Yunani awal Pedanius Dioscorides untuk pohon obat A. nilotica dalam bukunya Materia Medica. Nama ini berasal dari kata bahasa Yunani karena karakteristik tanaman Akasia yang berduri, ακις. Nama spesies nilotica diberikan oleh Linnaeus dari jajaran pohon Akasia yang paling terkenal di sepanjang sungai Nil.\\nAkasia juga dikenal sebagai pohon duri, dalam bahasa Inggris disebut whistling thorns atau Wattles, atau yellow-fever acacia dan umbrella acacias."},{"page_url":"https://sv.wikipedia.org/wiki/Lufttryck","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Low_pressure_system_over_Iceland.jpg","page_title":"Lufttryck","context_page_description":"Lufttrycket är trycket i den sammansatta gas som utgör jordens atmosfär. Trycket uppstår genom jordens dragningskraft på gasmassan och minskar med höjden över jordytan. Atmosfärens densitet minskar med höjden och blir i dagligt tal \\"tunnare\\" med ökande höjd. Detta förhållande utnyttjas av den kommersiella flygtrafiken genom att luftmotståndet minskar med flyghöjden. Samtidigt minskar syrgasens densitet varför man för vanliga jetmotorer funnit att en höjd på cirka 10 000 m utgör den optimala höjden med avseende på luftmotstånd och nödvändigt syreinnehåll för att få tillräcklig dragkraft från motorerna.\\nFör mätningar av aktuellt lufttryck används en barometer. SI-enheten för lufttryck är Pa men enheterna millibar och mmHg förekommer i olika sammanhang.\\nFörsök att bestämma ett medelvärde för lufttrycket i olika standarder har gjorts - STP och NTP är exempel på sådana standarder. I dessa två standarder anges det normala lufttrycket som 1 atm, det vill säga 101 325 Pa."},{"page_url":"https://en.wikipedia.org/wiki/USS_Concord_(CL-10)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/USS_Concord.jpg","page_title":"USS Concord (CL-10)","context_page_description":"USS Concord (CL-10) was an Omaha-class light cruiser, originally classified as a scout cruiser, of the United States Navy. She was the fourth Navy ship named for the town of Concord, Massachusetts, the site of the first battle of the American Revolution. She spent the first nine years of her career in the Atlantic as part of the Scouting Force. Concord transferred to the Pacific in 1932 and spent the rest of her career, except for the winter of 1938–1939, stationed there. Her home port moved to Pearl Harbor in April 1940, but escaped the attack on Pearl Harbor because she was in San Diego for an overhaul."},{"page_url":"https://fi.wikipedia.org/wiki/Aarne_Lepp%C3%A4nen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Aarne_Leppanen.jpg","page_title":"Aarne Leppänen","context_page_description":"Aarne Johannes Leppänen oli suomalainen näyttelijä.\\nLeppäsen vanhemmat olivat talonomistaja Johan Viktor Leppänen ja Vilhelmiina Johansson-Marttila. Hän kävi viisi luokkaa reaalilyseota ja työskenteli sitten konttoriapulaisena, esiintyen samalla Turussa teatterinäytännöissä.\\nLeppänen toimi näyttelijänä ensin Kansan Näyttämöllä 1915–1916 ja myöhemmin Kansallisteatterissa 1916–1937, kunnes sairaus pakotti hänet jättämään näyttämöt. Näyttämökoulutuksensa Leppänen oli saanut Kaarola Avellanilta, Adolf Lindforsilta ja Axel Ahlbergilta. Vuodesta 1924 hän täydensi opintojaan ulkomaanmatkoilla. Leppänen esitti erityisesti sankari- ja rakastajaosia, hänen huomattavimpia roolejaan olivat Daniel Hjort Josef Julius Wecksellin saman nimisessä näytelmässä, Pohjalaisten Antti, Lauri Haarlan Synti-näytelmän Ismael, samoin kuin Romeo näytelmässä Romeo ja Julia, Caliban, Unelma-elämä -näytelmän Rustan, Elävä ruumis -näytelmän Fedja sekä Matkan pää -näytelmän Stanhope. Hän näytteli myös mykkäelokuvissa Erämaan turvissa ja Kajastus.\\nAarne Leppänen oli naimisissa vuodesta 1924 näyttelijä Glory Renvallin kanssa."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Dauphin_County,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Harrisburg_19th_Street_Armory.jpg","page_title":"National Register of Historic Places listings in Dauphin County, Pennsylvania","context_page_description":"This is a list of the National Register of Historic Places listings in Dauphin County, Pennsylvania.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Dauphin County, Pennsylvania, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 72 properties and districts listed on the National Register in the county. Four sites are further designated as National Historic Landmarks. Three properties were once listed, but have since been removed.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E9%8E%AE%E9%BE%8D%E8%A5%BF%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Zhenlongxi_Station_Platform_2.jpg","page_title":"鎮龍西站","context_page_description":"鎮龍西站（粵拼：zan³ lung⁴ sai¹ zaam⁶；英文：Zhenlongxi Station），規劃同施工期間叫做鎮龍南站（zan³ lung⁴ naam⁴ zaam⁶；Zhenlongnan Station），係廣州地鐵21號綫嘅車站，2018年12月28號開通，喺黃埔區新龍鎮，鎮龍大道近鎮龍下鏡大道同鎮龍下新路路口之間（鎮龍舊車站附近），324國道嘅K945+720標記位。\\n呢個站曾經喺2018年12月28號到2019年12月19號間做過21號綫西邊嘅尾站。"},{"page_url":"https://en.wikipedia.org/wiki/Nash_Ambassador","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/1953_Nash_Ambassador_hardtop_Hershey_2015_-_2of6.jpg","page_title":"Nash Ambassador","context_page_description":"Ambassador was the model name applied to the senior line of Nash automobiles from 1932 until 1957. From 1958 until the end of the 1965 model year, the Rambler Ambassador, then 1966-1972 as the American Motors Ambassador, then 1973-1974 as AMC Ambassador, were the products of American Motors Corporation, which continued to use the Ambassador model name on its top-of-the-line models, making it \\"one of the longest-lived automobile nameplates in automotive history.\\"\\nFrom 1927 through the mid-1932 model year, the Ambassador name was applied to a high trim club sedan body style, one of Nash's most prestigious senior models. The Ambassador series was the \\"flagship\\" in the Nash line."},{"page_url":"https://en.wikipedia.org/wiki/Myricetin_3-O-rutinoside","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Myricetin_3-O-rutinoside.PNG","page_title":"Myricetin 3-O-rutinoside","context_page_description":"Myricetin 3-O-rutinoside is a chemical compound. It can be isolated in Chrysobalanus icaco and in fruits."},{"page_url":"https://ca.wikipedia.org/wiki/Geeste","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Geeste_Mundung_uf.JPG","page_title":"Geeste","context_page_description":"El Geeste és un afluent del Weser a l'estat de Baixa Saxònia.\\nEl riu neix al geest de la confluència d'uns petits rierols fonts prop de Hipstedt. El primer tram des de la font als pujols d'un altitud de màximum 25 metres del geest és caracteritzat per un curs meandrós en una vall estreta. El curs intermedi al maresme va ser rectificat i moltes rescloses impedeixen l'acció de la marea i una reducció considerable de les zones inundables. Abans de la construcció de la resclosa de Schiffdorf al quilòmetre 12, la influència de la marea es feia sentir fins a 30 km terra endins. Després de la construcció de la resclosa antimarejada a la desembocadura, l'efecte de la marea els limita als darrere 8,5 km. Des de l'inici del segle xxi, al marc de la directiva europea de l'aigua van començar obres per a renaturar el riu, tornar a crear zones inundables i augmentar l'accessibilitat als peixos migratoris.\\nEls darreres 28 km fins a la desembocadura van ser canalitzades. En connectar amb el canal Bederkasa-Geeste forma una via navegable que connecta el Weser amb l'Elba."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%B1%CE%BD%CE%B1%CE%B8%CE%B7%CE%BD%CE%B1%CF%8A%CE%BA%CF%8C%CF%82_(%CF%80%CE%BF%CE%B4%CF%8C%CF%83%CF%86%CE%B1%CE%B9%CF%81%CE%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Oscar_%C3%81lvarez_1969_Banfield.jpg","page_title":"Παναθηναϊκός (ποδόσφαιρο)","context_page_description":"Η Π.Α.Ε. Παναθηναϊκός Α.Ο. είναι ελληνικός επαγγελματικός σύλλογος ποδοσφαίρου, με έτος ίδρυσης το 1908. Παρ' ότι αποτελεί πλέον τμήμα του Παναθηναϊκού Αθλητικού Ομίλου, πρόκειται για ένα από τα αρχαιότερα εν ενεργεία αμιγώς ποδοσφαιρικά σωματεία της χώρας, δηλαδή από όσα ιδρύθηκαν με αποκλειστικό αντικείμενο το συγκεκριμένο άθλημα.\\nΈδρα του Παναθηναϊκού είναι το γήπεδο «Απόστολος Νικολαΐδης», γνωστό και ως γήπεδο της «Λεωφόρου», χωρητικότητας 16.003 καθήμενων θεατών, ενώ η ονομασία του έχει δοθεί προς τιμήν του ιστορικού του προέδρου. Ο σύλλογος αποτελεί έναν από τους δημοφιλέστερους συλλόγους της Ελλάδας και τον λαοφιλέστερο στην ευρύτερη περιοχή της πρωτεύουσας. Αγωνίζεται στη Σούπερ Λιγκ και πρόκειται για έναν από τους παλαιότερους και πιο επιτυχημένους συλλόγους από πλευράς διακρίσεων στην ιστορία του ελληνικού ποδοσφαίρου. Έχει κατακτήσει 20 πρωταθλήματα Ελλάδας, πρωταθλήματα ΣΕΓΑΣ και ΕΠΣΑΠ, 18 κύπελλα Ελλάδας, πετυχαίνοντας 8 φορές νταμπλ τίτλων, και 5 Σούπερ Καπ."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%84%D8%A7%D9%87%E2%80%8C%D9%BE%D8%A7%D8%B1%DA%86%D9%87%E2%80%8C%D8%A7%DB%8C%E2%80%8C%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Mycena_polygramma_-_Lindsey.jpg","page_title":"کلاه‌پارچه‌ای‌ها","context_page_description":"کلاه‌پارچه‌ای‌ها یا مایسنا نام یک سرده از راسته قارچ‌های تیغک‌دار است. این قارچ‌ها به ندرت بیش از چند سانتی‌متر عرض دارند بایک چتر مخروطی شکل دارای حاشیه کوچک. برخی گونه‌های آن مانند لاتکس هنگامیکه ساقه‌اش می‌شکند بسیاری از آنها بویی مشابه کلر دارند."},{"page_url":"https://la.wikipedia.org/wiki/Estarvielle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Blason_ville_fr_Estarvielle_%2865%29.svg","page_title":"Estarvielle","context_page_description":"Estarvielle est parvum commune Francicum 32 incolarum praefecturae Pyrenaei Superioris in regione australi Meridiano et Pyrenaeis."},{"page_url":"https://en.wikipedia.org/wiki/Protos_(train)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Connexxion_5031.jpg","page_title":"Protos (train)","context_page_description":"The Protos is an Electric Multiple Unit built by the German company Fahrzeugtechnik Dessau."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%D9%89_%D9%84%D9%88_%D9%85%D9%83%D8%AF%D9%88%D9%86%D8%A7%D9%84%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Mary_Lou_McDonald_2009.jpg","page_title":"مارى لو مكدونالد","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nمارى لو مكدونالد سياسيه من جمهورية ايرلاندا و المملكه المتحده."},{"page_url":"https://cs.wikipedia.org/wiki/Vladim%C3%ADr_Kabe%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Aero_%282556664052%29.jpg","page_title":"Vladimír Kabeš","context_page_description":"Vladimír Maria Kabeš starší byl český strojírenský podnikatel, vystudovaný právník, zakladatel a majitel továrny na výrobu letadel a později i automobilů Aero v pražské Bubenči. Značka, která vznikla roku 1919, funguje pod stejným názvem přes 100 let."},{"page_url":"https://ca.wikipedia.org/wiki/Alkonost","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Bilibin_Alkonost.JPG","page_title":"Alkonost","context_page_description":"Alkonost és, segons el folklore rus, una criatura mítica amb cos d'ocell i el cap i braços d'una bella donzella. Emet sons d'una bellesa extraordinària i aquells que els senten obliden tot el que saben i no desitgen mai res més. Sovint va acompanyat de Sirin, una altra au del paradís.\\nAlkonost pon els seus ous a la platja per després fer-los rodar fins al mar. Quan els ous es trenquen una tempesta es congria i fa el mar intransitable."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Baumaschinen_und_Bauger%C3%A4ten","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Schreitbagger_MM_A61.jpg","page_title":"Liste von Baumaschinen und Baugeräten","context_page_description":"Baumaschinen, auch als Baugeräte bezeichnet, sind stationäre, semimobile oder mobile Maschinen, die mit Verbrennungsmotoren oder Elektromotoren angetrieben werden und mit denen Baustoffe be- und verarbeitet, Bauhilfsstoffe transportiert und Bauaufgaben ausgeführt werden. Sie werden sowohl im Bauhaupt- als auch im Baunebengewerbe eingesetzt. Die in der Bauwirtschaft für die Kalkulation von Bauleistungen gebräuchliche Baugeräteliste enthält ein umfassendes Verzeichnis der Baumaschinen und -geräte. Viele Baumaschinen lassen sich nicht nur dem Bauwesen zuordnen, weil sie neben ihrem Einsatz in der Bauwirtschaft auch in der Gewinnungsindustrie, in der Landwirtschaft, im Deponiebetrieb sowie in weiteren Industriezweigen verwendet werden.\\nDiese Liste von Baumaschinen und Baugeräten eröffnet einen Überblick über die Vielfalt von Baumaschinen und Baugeräten der Gegenwart und nennt deren typische Einsatzgebiete. Die Entwicklungsgeschichte einzelner Baumaschinen wird im jeweiligen Artikel erläutert. Kleingeräte, Bauhilfsstoffe oder Werkzeuge sowie Gleisbaugeräte und Wasserbaufahrzeuge sind nicht Teil dieser Liste."},{"page_url":"https://hu.wikipedia.org/wiki/Ol%C3%A1hn%C3%A9meti","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/RO_BN_Mintiu_%283%29.jpg","page_title":"Oláhnémeti","context_page_description":"Oláhnémeti település Romániában, Beszterce-Naszód megyében."},{"page_url":"https://en.wikipedia.org/wiki/Annique_Theron","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Troudag_1950.jpg","page_title":"Annique Theron","context_page_description":"Dr. Annique Theron was a South African businesswoman best known for her line of cosmetics and health care products featuring rooibos as a main ingredient."},{"page_url":"https://nl.wikipedia.org/wiki/Basilica_van_Constantijn","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/2018_Trier%2C_Konstantinbasilika_06.jpg","page_title":"Basilica van Constantijn","context_page_description":"De Basilica van Constantijn is een Romeinse basilica in de Duitse stad Trier. Het uit baksteen opgetrokken bouwwerk kwam waarschijnlijk omstreeks 310 tot stand, tijdens de regeringsperiode van keizer Constantijn de Grote. Aanvankelijk deed het dienst als ontvangstzaal van het keizerlijk paleis; later werd het een versterkte Frankische burcht, daarna werd het onderdeel van het paleis van de aartsbisschoppen van Trier. In de 19e eeuw werd het gehavende gebouw hersteld en in gebruik genomen als kerkgebouw van de Evangelisch-Lutherse gemeente. Na de Tweede Wereldoorlog werd de bij een bombardement zwaar beschadigde basilica gerestaureerd.\\nDe Basilica van Constantijn geldt als de grootste, intact gebleven overdekte ruimte uit heel de Romeinse oudheid, groter dan het Pantheon in Rome. Het is tevens het oudste, nog bestaande kerkgebouw van Duitsland. Naast het liturgisch gebruik is het gebouw een toeristisch trekpleister. Sinds 1986 is de basilica onderdeel van het UNESCO werelderfgoedensemble 'Romeinse bouwwerken, Dom en Onze-Lieve-Vrouwekerk in Trier'."},{"page_url":"https://lv.wikipedia.org/wiki/Parmen%C4%ABds","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Parmenides.jpg","page_title":"Parmenīds","context_page_description":"Parmenids bija sengrieķu filozofs. Dzimis senās Grieķijas pilsētā Elejā.. Daudz ceļojis. Filozofs bijis savas tautas patriots. Parmenida loģika balstījās uz pretrunu un pretstatu iznīcināšanu. Viņš ir pazīstams ar darbu \\"Par Dabu\\".\\nViens no Parmenīda izcilākajiem un zināmākajiem skolniekiem, bija Zēnons."},{"page_url":"https://en.wikipedia.org/wiki/Alexander%27s_Balkan_campaign","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/ThracianTribes.jpg","page_title":"Alexander's Balkan campaign","context_page_description":"The Balkan campaign of Alexander the Great took place in 335 BC, against a number of rebellious vassals of the Macedonian kingdom. Alexander successfully pacified each in turn, leaving him free to begin the long planned invasion of Persia.\\nIn 336 BC, while attending the wedding of his daughter by Olympias, Cleopatra and Olympias' brother, Alexander I of Epirus at Aegae, Philip II was assassinated by the captain of his bodyguard, Pausanias. Philip's son, and previously designated heir, Alexander was proclaimed king by the Macedonian noblemen and army.\\nNews of Philip's death roused many states into revolt including Thebes, Athens, Thessaly and the Thracian tribes to the north of Macedon. When news of the revolt reached Alexander he responded quickly. Though his advisors advised him to use diplomacy, Alexander mustered the Macedonian cavalry of 3,000 men and rode south towards Thessaly, Macedon's immediate neighbor to the south. When he found the Thessalian army occupying the pass between Mount Olympus and Mount Ossa, he had the men ride through Mount Ossa and, when the Thessalians awoke, they found Alexander at their rear."},{"page_url":"https://de.wikipedia.org/wiki/Trier","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Trier_St._Paulin_BW_2018-04-07_15-09-21.jpg","page_title":"Trier","context_page_description":"Trier ist eine kreisfreie Stadt im Westen des Landes Rheinland-Pfalz. Mit etwa 110.000 Einwohnern ist sie nach Mainz, Ludwigshafen am Rhein und Koblenz dessen viertgrößte Stadt.\\nDie Stadt wurde vor mehr als 2000 Jahren unter dem Namen Augusta Treverorum gegründet und beansprucht den Titel der ältesten Stadt Deutschlands für sich. Trier beruft sich hierbei auf die längste Geschichte als bereits von den Römern anerkannte Stadt, im Gegensatz zu einer Siedlung oder einem Heerlager.\\nDie Römischen Baudenkmäler in Trier zählen seit 1986 zum UNESCO-Welterbe. Hierzu gehören Amphitheater, Barbarathermen, Kaiserthermen, Konstantinbasilika, Porta Nigra, Römerbrücke sowie die Igeler Säule in Igel. Ebenfalls zum Trierer Weltkulturerbe zählt der im Kern romanische Dom und die frühgotische Liebfrauenkirche. Darüber hinaus gibt es in Trier Kulturdenkmäler aus nahezu allen Epochen von der Frühgeschichte bis zum 21. Jahrhundert."},{"page_url":"https://de.wikipedia.org/wiki/Hilbersdorf_(Bobritzsch-Hilbersdorf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/20171201350DR.JPG_Hilbersdorf_%28Bobritzsch-H%29_Gemeindeamt.jpg","page_title":"Hilbersdorf (Bobritzsch-Hilbersdorf)","context_page_description":"Hilbersdorf ist ein Ortsteil der sächsischen Gemeinde Bobritzsch-Hilbersdorf im Landkreis Mittelsachsen. Die Gemeinde Hilbersdorf fusionierte am 1. Januar 2012 mit der Gemeinde Bobritzsch zur Gemeinde Bobritzsch-Hilbersdorf."},{"page_url":"https://pt.wikipedia.org/wiki/The_Cricket_on_the_Hearth","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Cricketonthehearth_front.jpg","page_title":"The Cricket on the Hearth","context_page_description":"The Cricket on the Hearth: A Fairy Tale of Home é um romance de Charles Dickens, publicado pela editora Bradbury and Evans e lançado a 20 de dezembro de 1845 com ilustrações de Daneil Maclise, John Leech, Richard Doyle, Clarkson Stanfeild e Edwin Landseer. Dickens começou a escrever o livro por volta do dia 17 de outubro de 1845 e terminou-o a 1 de dezembro do mesmo ano. Como é o caso de todos os livros de Natal de Charles Dickens, este foi publicado diretamente em formato de livro e não foi lançado em série. Dickens descreveu o romance como \\"calmo e doméstico [...] inocente e bonito\\". É o terceiro de cinco livros de Natal de Dickens, os restantes são: A Christmas Carol, The Chimes, The Battle of Life e The Haunted Man and the Ghost's Bargain."},{"page_url":"https://cy.wikipedia.org/wiki/Saint-Pierre,_R%C3%A9union","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/StPierreTerre-port.jpg","page_title":"Saint-Pierre, Réunion","context_page_description":"Tref a commune yn département Réunion, sy'n un o Diriogaethau tramor Ffrainc yw Saint-Pierre. Saif ger yr arfordir, yn ne-orllewin yr ynys. Roedd y boblogaeth yn 2004 yn 74,000. Mae poblogaeth yr ardal ddinesig, sy'n cynnwys Le Tampon, yn 140,700, yr ail-fwyaf ar yr ynys."},{"page_url":"https://en.wikipedia.org/wiki/Dunnington","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/St_Nicholas_church%2C_Dunnington_-_geograph.org.uk_-_1347686.jpg","page_title":"Dunnington","context_page_description":"Dunnington is a village and civil parish in the City of York and ceremonial county of North Yorkshire, England. The population of the civil parish was 3,230 at the 2011 Census. The village is approximately 4 miles east from York city centre."},{"page_url":"https://sv.wikipedia.org/wiki/Villasalto","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Villasalto01.JPG","page_title":"Villasalto","context_page_description":"Villasalto är en ort och kommun i provinsen Sydsardinien i regionen Sardinien i sydvästra Italien. Kommunen hade 1 046 invånare."},{"page_url":"https://nl.wikipedia.org/wiki/Slowakije_op_de_Olympische_Zomerspelen_2012","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Katarina_Beresova.jpg","page_title":"Slowakije op de Olympische Zomerspelen 2012","context_page_description":"Slowakije nam deel aan de Olympische Zomerspelen 2012 in Londen, Verenigd Koninkrijk."},{"page_url":"https://ro.wikipedia.org/wiki/Boicot","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Olympic_boycotts_1976_1980_1984.PNG","page_title":"Boicot","context_page_description":"Boicotul este o interdicție declarată împotriva unui individ, a unui grup social, a unui stat prin care se stabilește refuzul de a cumpăra, a vinde sau a întreține orice fel de relații cu cei supuși acestui procedeu.\\nBoicotul mai este și o metodă de luptă politică sau economică, constând în sistarea organizată a relațiilor cu o persoană în semn de represalii.\\nDin cuvântul boicot a derivat verbul a boicota, cu sensul de a priva o persoană sau o entitate de orice relație socială și/sau comercială, în scopul de a o prejudicia și de a o forța astfel să cedeze și să facă ceea ce i se cere.\\nÎn relațiile internaționale, în temeiul Cărții ONU, este una dintre măsurile coercitive de a menține pacea. Aceasta constă în refuzul statului de a menține relații cu orice stat sau grup de state. Orice încetare a relațiilor cu cineva care protestă împotriva ceva poate fi numit boicot. Acesta a fost numit astfel de numele conducătorului englez Charles Boycott, împotriva căruia în 1880 măsura a fost aplicată de chiriașii irlandezi."},{"page_url":"https://vi.wikipedia.org/wiki/Actaea_pachypoda","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Actaea-pachypoda.jpg","page_title":"Actaea pachypoda","context_page_description":"Actaea pachypoda là một loài thực vật có hoa trong họ Mao lương. Loài này được Elliott mô tả khoa học đầu tiên năm 1821."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%B8%D1%85%D0%B5%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Picher_in_LWL.PNG","page_title":"Пихер","context_page_description":"Пихер општина је у њемачкој савезној држави Мекленбург-Западна Померанија. Једно је од 89 општинских средишта округа Лудвигслуст. Према процјени из 2010. у општини је живјело 700 становника. Посједује регионалну шифру 13054087."},{"page_url":"https://lmo.wikipedia.org/wiki/Olten","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Karte_Gemeinde_Olten.png","page_title":"Olten","context_page_description":"Olten a l'è un cumün svizzer del distret de Olten. in del Canton Suleta. Al gh’ha pressapoch 17133 abitant e una süperfiss de 11.50 km², e al se tröva a una altitüden de 396 meter sura al livel del mar.\\nEl cumün de Olten a l'è tacaa ai cumün de Aarburg, Boningen, Dulliken, Kappel, Rothrist, Starrkirch-Wil, Trimbach, Wangen bei Olten, Winznau."},{"page_url":"https://nds.wikipedia.org/wiki/Olympisch_Winterspelen_2006/Biathlon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Torino2006_Biathlon_Massenstart.jpg","page_title":"Olympisch Winterspelen 2006/Biathlon","context_page_description":"Bi de XX. Olympisch Winterspielen 2006 wurrn 10 Wettbewarfen in' Biathlon utdragen. Nee in dat Programm upnommen wurrn Rennen mit Massenstart.\\nUtdragensoort weer San Sicario up dat Rebeet vun de Gemeend Cesana Torinese, 97 Kilometer westlich von Turin. Dat Gelände liggt up en Hööcht vun 1620 bit 1680 Metern, de Tokiekerkapazität bedroog 4628."},{"page_url":"https://nn.wikipedia.org/wiki/Waraoar","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/A_Warao_family_in_their_canoe.jpg","page_title":"Waraoar","context_page_description":"Waraoar er eit urfolk med territorium i austre Venezuela og vestre Guyana. Waroa, guarauno, guarao og warrau er andre stavemåtar for warao. Dei sentrale busetnadene for waraoane ligg i Orinocodeltaet med eit mindretal i naboområda i Guyana og Surinam. Etter ei folketeljing i 2001 finst det 36 000 waraoar, fleirtalet av dei nyttar eit agglutinativt språk, også det kalla warao."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%AD%E0%B9%87%E0%B8%94%E0%B9%80%E0%B8%A7%E0%B8%B4%E0%B8%A3%E0%B9%8C%E0%B8%94_%E0%B9%80%E0%B8%88%E0%B9%89%E0%B8%B2%E0%B8%8A%E0%B8%B2%E0%B8%A2%E0%B8%94%E0%B8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Plantagenet%2C_Edward%2C_The_Black_Prince%2C_Iconic_Image.JPG","page_title":"เอ็ดเวิร์ด เจ้าชายดำ","context_page_description":"เอ็ดเวิร์ด เจ้าชายดำ หรือ เอ็ดเวิร์ด เจ้าชายแห่งเวลส์ หรือที่รู้จักกันในพระนาม เอ็ดเวิร์ดแห่งวูดสต็อค เอ็ดเวิร์ด เจ้าชายดำเป็นพระราชวงศ์อังกฤษผู้มีบทบาทในการต่อสู้กับราชอาณาจักรฝรั่งเศสในสงครามร้อยปี\\nเอ็ดเวิร์ดประสูติเมื่อวันที่ 15 มิถุนายน ค.ศ. 1330 เป็นพระราชโอรสองค์โตในสมเด็จพระเจ้าเอ็ดเวิร์ดที่ 3 แห่งอังกฤษ และพระราชินีฟิลลิปปา และเป็นพระบิดาของสมเด็จพระเจ้าริชาร์ดที่ 2 แห่งอังกฤษ เอ็ดเวิร์ดทรงเป็นผู้นำทางการทหารผู้มีความสามารถและทรงเป็นผู้ที่เป็นที่นิยมขณะที่ยังทรงมีชีวิตอยู่ เอ็ดเวิร์ดสิ้นพระชนม์เพียงปีเดียวก่อนที่พระราชบิดาจะเสด็จสวรรคต ทรงเป็นเจ้าชายแห่งเวลส์องค์แรกที่ไม่ได้ขึ้นครองราชสมบัติ ราชบัลลังก์จึงตกไปเป็นของริชาร์ด พระโอรสองค์โตของพระองค์เมื่อพระเจ้าเอ็ดเวิร์ดที่ 3 เสด็จสวรรคต"},{"page_url":"https://it.wikipedia.org/wiki/Ferrovia_Terni-Sulmona","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Viadotto_ferroviario_gole_di_San_Venanzio_2008_by_RaBoe001.jpg","page_title":"Ferrovia Terni-Sulmona","context_page_description":"La ferrovia Terni-Sulmona è una linea ferroviaria italiana che, per unica, collega il reatino e l'aquilano alla rete ferroviaria nazionale. La linea mette in comunicazione le due trasversali Roma-Ancona e Roma-Sulmona-Pescara, e insieme alla Sulmona-Isernia costituisce una dorsale nord-sud dell'appennino centrale.\\nConcepita come linea di collegamento dell'Abruzzo interno con Roma e con la costa Adriatica, fu progettata e appaltata con il percorso Pescara-L'Aquila-Rieti-Roma. Solo a lavori iniziati, a causa di ingerenze politiche, una variante in corso d'opera modificò il suo percorso in Terni-Sulmona, riducendo notevolmente la sua importanza. Il suo percorso finale non è stato dettato da uno studio sistematico, ma dal compromesso tra la fazione sulmonese e la fazione reatino-aquilana, nonché tra interesse pubblico e interesse affaristico privato della società concessionaria, ed è costituito da un tronco del progetto iniziale Pescara-L'Aquila-Roma unito ad un tronco dell'incompiuta Terni-Avezzano-Ceprano."},{"page_url":"https://sv.wikipedia.org/wiki/Modellvillan_21","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Modellvillan_21%2C_Gamla_Tyres%C3%B6v%C3%A4gen_310%2C_2017a.jpg","page_title":"Modellvillan 21","context_page_description":"Modellvillan 21 är en fastighet i kvarteret Modellvillan vid Gamla Tyresövägen 310 i stadsdelen Enskededalen i södra Stockholm. Byggnaden uppfördes år 2016 och utnämndes till Årets Stockholmsbyggnad 2017."},{"page_url":"https://fr.wikipedia.org/wiki/Virenque","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Beaver_pho34.jpg","page_title":"Virenque","context_page_description":"La Virenque est une rivière française coulant dans les départements de l'Aveyron, de l'Hérault et du Gard en région Occitanie. La Virenque est l'affluent principal de la Vis, donc un sous-affluent de l'Hérault."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%83%94%E3%83%89KL","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/SBK_Line_Pasar_Seni_Bench_4.jpg","page_title":"ラピドKL","context_page_description":"ラピドKLは、マレーシアのクアラルンプールおよび隣接都市で運行されている公共交通システム。鉄道とバスの路線で構成される。\\nマレーシア財務省傘下の交通インフラ事業会社プラサラナ・マレーシアによって運行されている。"},{"page_url":"https://hu.wikipedia.org/wiki/Theresianum_(B%C3%A9cs)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Georg_Matthaeus_Vischer_a_b%C3%A9csi_Favorita.jpg","page_title":"Theresianum (Bécs)","context_page_description":"A Theresianum egy, Mária Terézia főhercegnő, császárné nevét viselő nevelőintézet, akadémia volt Bécsben, eredetileg nemes származású ifjak nevelésére, amely 1938-ig állt fenn. 1767-ben Vácott is létrehoztak egy Theresianum nevű intézetet, amely a bécsi mintát követte. Ma egy magániskola működik Bécsben az épületben."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_nejvy%C5%A1%C5%A1%C3%ADch_budov_podle_st%C3%A1t%C5%AF_USA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/First_Hawaiian_Center_Tower_in_Honolulu%2C_Hawaii_USA.jpg","page_title":"Seznam nejvyšších budov podle států USA","context_page_description":"Toto je seznam nejvyšších budov v jednotlivých státech USA, včetně Kolumbijského distriktu."},{"page_url":"https://it.wikipedia.org/wiki/Styrbj%C3%B6rn_Starke","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/DR_279_Sj%C3%B6rup.jpg","page_title":"Styrbjörn Starke","context_page_description":"Styrbjörn Olàfrsson detto Starke, fu un pretendente al trono svedese, sconfitto durante la battaglia del Fýrisvellir.\\nUnico figlio del semi-leggendario re Olof Björnsson, co-regnante della Svezia, non riuscì ad imporsi su suo zio Erik il Vittorioso, che divenne l'unico regnante.\\nDivenuto in seguito un potente capo vichingo, riunì una grande armata e cercò di prendere il trono della Svezia con la forza, ma fu sconfitto."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%B1%CF%8C%CF%82_%CE%91%CE%B3%CE%AF%CF%89%CE%BD_%CE%91%CF%80%CE%BF%CF%83%CF%84%CF%8C%CE%BB%CF%89%CE%BD_%CE%A3%CE%BF%CE%BB%CE%AC%CE%BA%CE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Agii_Apostoli_church_back_agora_athens.jpg","page_title":"Ναός Αγίων Αποστόλων Σολάκη","context_page_description":"Ο Ναός των Αγίων Αποστόλων του Σολάκη είναι μεσοβυζαντινή εκκλησία στη νοτιοανατολική γωνία της Αρχαίας Αγοράς της Αθήνας και νότια της Στοάς του Αττάλου. Κτίστηκε στα τέλη του 10ου αιώνα και σώζεται ακέραια από τον μεσαίωνα. Η αρχιτεκτονική της σηματοδοτεί την αρχή του Αθηναϊκού Βυζαντινού ρυθμού. Είναι κτισμένη επάνω σε τμήμα των θεμελίων του Νυμφαίου. Ανακαινίστηκε το 1954-57.\\nΗ βάση του ναού είναι σχήματος σταυροειδούς με αψίδες στις τέσσερεις πλευρές και νάρθηκα στη δυτική πλευρά, ενώ τέσσερεις κίονες στηρίζουν τον θόλο. Το ιερό και το πάτωμα ήταν αρχικά από μάρμαρο. Σώζονται μερικές αγιογραφίες από τον 17ο αιώνα."},{"page_url":"https://en.wikipedia.org/wiki/Didsbury","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Didsbury_1905.jpg","page_title":"Didsbury","context_page_description":"Didsbury is a suburban area of Manchester, England, on the north bank of the River Mersey, 4.5 miles south of Manchester city centre. The population at the 2011 census was 26,788.\\nHistorically a part of Lancashire, there are records of Didsbury existing as a small hamlet as early as the 13th century. Its early history was dominated by being part of the Manor of Withington, a feudal estate that covered a large part of what is now the south of Manchester. Didsbury was described during the 18th century as a township separate from outside influence. In 1745 Charles Edward Stuart crossed the Mersey at Didsbury in the Jacobite march south from Manchester to Derby, and again in the subsequent retreat.\\nDidsbury was largely rural until the mid-19th century, when it underwent development and urbanisation during the Industrial Revolution. It became part of Manchester in 1904.\\nThe Royal Society for the Protection of Birds was formed in Didsbury in 1889."},{"page_url":"https://fr.wikipedia.org/wiki/Georges_Lallemant","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/BusinckEnee.jpg","page_title":"Georges Lallemant","context_page_description":"Georges Lallemant, ou Lallemand, est un peintre français d'origine lorraine, actif à Paris dans le premier tiers du XVIIᵉ siècle. À la tête de l'un des plus importants ateliers de la capitale, il a mis notamment son talent au service des communautés religieuses de Paris. Son œuvre avait presque entièrement disparu avant les multiples découvertes survenues au XXᵉ siècle, qui ont permis de redécouvrir un peintre encore peu connu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%B9%D0%B4%D0%B5%D0%BD%D1%84%D0%BB%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Beidenfleth-Wappe.png","page_title":"Байденфлет","context_page_description":"Байденфлет — коммуна в Германии, в земле Шлезвиг-Гольштейн.\\nВходит в состав района Штайнбург. Подчиняется управлению Вильстермарш. Население составляет 883 человека. Занимает площадь 13,57 км². Официальный код — 01 0 61 007."},{"page_url":"https://eu.wikipedia.org/wiki/Duzetio","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Ducetius.jpg","page_title":"Duzetio","context_page_description":"Duzetio sikuloen buruzagia zen baita sikuloen estatu batuen sortzailea eta hiri askoren fundatzailea ere. Uste da Mineo hiriaren ondoan jaio zela. Haren historia Diodoro Sikulok azaldu zuen, Timeoren lanetan oinarrituz.\\nDuzetiok, jatorriz siziliarra bazen ere, grezieraz hitz egiten zuen, Siziliako greziar zibilizazioak harengan eragin handia izan zuelako. Noizean behin Douketios helenizatutako izenarekin ezaguna da ere."},{"page_url":"https://fr.wikipedia.org/wiki/Archie_Carr","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Archie_Carr_National_Wildlife_Refuge_002.jpg","page_title":"Archie Carr","context_page_description":"Archie Carr est un herpétologiste américain, né le 16 juin 1909 à Mobile et mort le 21 mai 1987 à Micanopy."},{"page_url":"https://it.wikipedia.org/wiki/Sharp_Corporation","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Sharp_PC-1251_Tietokonemuseo.jpg","page_title":"Sharp Corporation","context_page_description":"Sharp Corporation è una società giapponese che produce dispositivi elettronici."},{"page_url":"https://en.wikipedia.org/wiki/Alfa_Romeo_in_motorsport","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Alfa_P3_B.jpg","page_title":"Alfa Romeo in motorsport","context_page_description":"During its history, Alfa Romeo has competed successfully in many different categories of motorsport, including Grand Prix motor racing, Formula One, sportscar racing, touring car racing and rallies. They have competed both as a constructor and an engine supplier, via works entries and private entries. The first racing car was made in 1913, three years after the foundation of A.L.F.A., the 40-60HP had 6 liter straight-4 engine. Alfa Romeo quickly gained a good name in motorsport and gave a sporty image to the whole marque."},{"page_url":"https://no.wikipedia.org/wiki/Indias_herrelandslag_i_cricket","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/VIRAT_KOHLI_JAN_2015_%28cropped%29.jpg","page_title":"Indias herrelandslag i cricket","context_page_description":"Indias herrelandslag i cricket representerer India i internasjonal cricket og blir drevet av Board of Control for Cricket in India. India har vært medlemmer av det internasjonale cricketforbundet ICC siden 1926, først som britisk koloni og siden 1947 som selvstendig stat. India vant VM i cricket i 1983 og 2011, og VM i Twenty20-cricket i 2007. I Test-cricket har India tradisjonelt vært et sterkt hjemmelag; de vant åtte av ti Testserier mot Australia mellom 1979 og 2017 og fem av ni serier mot England i samme periode. Cricket er den mest populære idretten i India, og spilles over hele landet."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%BB%91%E8%89%B2%E8%9D%87%E8%99%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Plexippus.paykulli.female.-.tanikawa.jpg","page_title":"黑色蝇虎","context_page_description":"黑色蝇虎为跳蛛科蝇虎属的动物。分布于世界各地，常见于住屋窗棂上、农田。"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%84%E0%B8%A5%E0%B8%AD%E0%B8%87%E0%B8%97%E0%B8%A7%E0%B8%B5%E0%B8%A7%E0%B8%B1%E0%B8%92%E0%B8%99%E0%B8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/%E0%B8%84%E0%B8%A5%E0%B8%AD%E0%B8%87%E0%B8%97%E0%B8%A7%E0%B8%B5%E0%B8%A7%E0%B8%B1%E0%B8%92%E0%B8%99%E0%B8%B2_Khlong_Thawi_Watthana.jpg","page_title":"คลองทวีวัฒนา","context_page_description":"คลองทวีวัฒนา เป็นคลองที่ขุดในรัชสมัยพระบาทสมเด็จพระจุลจอมเกล้าเจ้าอยู่หัว รัชกาลที่ 5 ต่อจากคลองเปรมประชากร เริ่มขุดในปี พ.ศ. 2421 และมีพิธีเปิดคลองเมื่อวันศุกร์ เดือน 6 แรม 1 คำ ปีขาล พ.ศ. 2421 พระราชทานนามว่า คลองทวีวัฒนา\\nด้วยทรงเห็นว่าคลองที่ใช้เชื่อมแม่น้ำเจ้าพระยากับแม่น้ำท่าจีน ทั้งคลองภาษีเจริญและคลองมหาสวัสดิ์เริ่มตื้นเขิน จึงให้ขุดคลองนี้ขึ้นในแนวทิศตะวันออกเฉียงใต้-ตะวันตกเฉียงเหนือ เพื่อชักน้ำจากแม่น้ำท่าจีนให้ไหลลงทิศใต้ แก้ปัญหาลำคลองตื้นเขิน ดังพระราชดำรัสว่า\\nคลองทวีวัฒนาเริ่มต้นจากคลองภาษีเจริญในรอยต่อเขตบางแคและเขตหนองแขม ขุดเป็นเส้นตรงไปในแนวทิศตะวันตกเฉียงเหนือ ผ่านเขตทวีวัฒนา ออกจากกรุงเทพมหานคร เป็นเส้นแบ่งเขตการปกครองระหว่างอำเภอบางกรวย อำเภอบางใหญ่ และอำเภอไทรน้อยของจังหวัดนนทบุรี กับอำเภอพุทธมณฑลและอำเภอบางเลนของจังหวัดนครปฐม ไปสิ้นสุดที่แม่น้ำท่าจีนในเขตอำเภอบางเลน มีความยาว 35.2 กิโลเมตร คลองทวีวัฒนามีทิศทางขวางคลองอื่นๆ จำนวนมาก เนื่องมาจากลำคลองในละแวกนั้นล้วนแต่ขุดอยู่ในแนวตะวันออกสู่ตะวันตก ชาวบ้านจึงเรียกว่า \\"คลองขวาง\\" เช่น ตำบลคลองขวาง และแขวงคลองขวาง ส่วนช่วงจังหวัดนนทบุรีและนครปฐม นิยมเรียกว่า \\"คลองนราภิรมย์\\" ตามชื่อวัดนราภิรมย์ ซึ่งตั้งอยู่ริมคลองในจังหวัดนครปฐม"},{"page_url":"https://en.wikipedia.org/wiki/Vicentico","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Vicentico2.jpg","page_title":"Vicentico","context_page_description":"Gabriel Julio Fernández Capello is a musician and composer better known by his stage name Vicentico. Co-founder and vocalist of the band Los Fabulosos Cadillacs along with Flavio Cianciarulo. He was part of the group since its creation in 1984 to the year 2001, when he began a solo career as a singer.\\nHe lives with his wife, actress Valeria Bertuccelli, and their sons Florián and Vicente."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BA%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%BE%D0%B2%D1%8B_%D1%80%D1%83%D0%B8%D0%BD%D1%8B_%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Xochicalco_Serpiente_Emplumada_GR.jpg","page_title":"Доколумбовы руины Мексики","context_page_description":"Список руин доколумбовой эпохи в Мексике не включает многочисленные руины цивилизации майя, приведенные в отдельном списке. Поскольку количество археологических памятников доколумбовой эпохи в Мексике составляет несколько тысяч, каждый год открываются новые, данный список содержит наиболее изученные и крупные из памятников. К большинству из них разрешён доступ туристам. Более подробный обзор можно увидеть в приведенном ниже списке литературы.\\nСписок можно сортировать по названиям памятников, названиям штатов и хронологическим периодам.\\nРуины находятся под управлением Национального института антропологии и истории Мексики."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B1%D9%88%D9%84%DB%8C%D9%86_%D8%B3%DA%A9%D9%88%DB%8C%D8%B1%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Squires_HD96.jpg","page_title":"کارولین سکویرز","context_page_description":"کارولین سکویرز آمریکالی سیاستچی قادین، دموکرات حزبینین عوضوو و مونتانا ایالتین سناتور ایدی. مونتانا بیلیم یوردا تحصیل ائله‌ییب. ۱۹۴۰ ایلینده دۆنیایا گؤز آچیب و ۲۰۱۶ میلادی ایلینده حیاتین دَییشدی."},{"page_url":"https://pl.wikipedia.org/wiki/P%C5%82azy_Japonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Tokyo_Salamander_%28Hynobius_tokyoensis%29_-_GRB.JPG","page_title":"Płazy Japonii","context_page_description":"Płazy Japonii – przedstawiciele gromady płazów występujący w Japonii. Żyją tam zarówno płazy bezogonowe jak i płazy ogoniaste.\\nW Japonii żyje 93 opisanych gatunków płazów, w tym 74 gatunki endemiczne, co czyni Japonię krajem z jedną z najbogatszych batrachofaun w Azji Wschodniej. Japońskim gatunkom płazów zagraża głównie konkurencja ze strony gatunków introdukowanych takich jak ropucha aga czy żaba rycząca. Natomiast chytridiomikoza – grzybicza choroba skóry dziesiątkująca płazie populacje na całym świecie – nie wywiera negatywnego wpływu na japońską batrachofaunę."},{"page_url":"https://pt.wikipedia.org/wiki/Centro_de_Estudos_de_Pessoal","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Formatura01.jpg","page_title":"Centro de Estudos de Pessoal","context_page_description":"O Centro de Estudos de Pessoal e Forte Duque de Caxias é um estabelecimento de ensino do Exército Brasileiro, que, desde 1965, busca melhor compreender, estudar e preparar o homem. A Organização Militar foi criada com o objetivo de ser um centro de estudos do comportamento humano, formando militares para desempenhar funções no campo das ciências sociais e humanas dentro das Forças Armadas e Auxiliares. O desenvolvimento de pesquisas e a prática do ensino norteiam as atividades deste estabelecimento de ensino.\\nLocalizado no bairro do Leme, Rio de Janeiro, o Centro trabalha pela melhoria dos processos e do ensino na Força Terrestre, com a reformulação de práticas, políticas e diretrizes dos Sistemas de Educação, Comunicação Social e Operações Psicológicas."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%8A%D8%A7%D9%8A%D8%AB%D8%A7_(%D9%84%D8%A7%D8%B3_%D8%A8%D8%A7%D9%84%D9%85%D8%A7%D8%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Bandera_de_Yaiza.jpg","page_title":"يايثا (لاس بالماس)","context_page_description":"بلدية يايثا هي بلدية تقع في مقاطعة لاس بالماس التابعة لمنطقة جزر الكناري جنوب غرب إسبانيا."},{"page_url":"https://de.wikipedia.org/wiki/Ludwig_Linzinger","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Schwanenstadt_-_Kirche%2C_Hochaltar.JPG","page_title":"Ludwig Linzinger","context_page_description":"Ludwig Max Linzinger war Bildhauer und Altarbauer.\\nSein Atelier in Linz lieferte Ende des 19. und Anfang des 20. Jahrhunderts zahlreiche Kirchenausstattungen in Österreich-Ungarn bzw. war an vielen Restaurierungen beteiligt."},{"page_url":"https://sv.wikipedia.org/wiki/Baisaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Vaisakhi_2012_London_-_22.jpg","page_title":"Baisaki","context_page_description":"Baisaki, även stavat Baisakhi och Vaisakhi, är en högtid som firas den 13 april i den indisk-pakistanska regionen Punjab vid skördesäsongens början. Det punjabiska nyåret infaller samma datum. Det är också den dag som Khalsa grundades, år 1699."},{"page_url":"https://en.wikipedia.org/wiki/Aviezer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Moshav_Aviezer%2C_Jewish_village_in_Elah_Valley.jpg","page_title":"Aviezer","context_page_description":"Aviezer is a small religious moshav in central Israel. Located nine kilometres south-west of Beit Shemesh, at the east end of the Elah valley, it falls under the jurisdiction of Mateh Yehuda Regional Council. In 2018 it had a population of 865."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Personenbahnh%C3%B6fe_in_Brandenburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Bahnhof_Bad_Wilsnack.jpg","page_title":"Liste der Personenbahnhöfe in Brandenburg","context_page_description":"Diese Liste führt sämtliche Personenbahnhöfe und -haltepunkte in Brandenburg auf, die im Regelverkehr bedient werden. Darüber hinaus werden die Art der Betriebsstelle, die Anzahl der Bahnsteiggleise, die zugehörige Kommune, der Eröffnungszeitpunkt, die Bedienung durch Fern-, Regional- oder S-Bahn-Verkehr als auch die anliegenden Strecken genannt. Alle Stationen liegen im Gebiet des Verkehrsverbundes Berlin-Brandenburg."},{"page_url":"https://si.wikipedia.org/wiki/%E0%B7%80%E0%B6%BB%E0%B7%8A%E0%B6%AB_%E0%B6%8B%E0%B7%82%E0%B7%8A%E0%B6%AB%E0%B6%AD%E0%B7%8A%E0%B7%80%E0%B6%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/PlanckianLocus.png","page_title":"වර්ණ උෂ්ණත්වය","context_page_description":"වර්ණ උෂ්ණත්වය යනු දෘශ්‍ය ආලෝකයේ ගුණාංගයක් වන අතර ඡායාරූපකරණය, වීඩියෝ ශිල්පය, ප්‍රකාශන පළ කිරීම සහ තවත් ක්ෂේත්‍ර කිහිපයක් සඳහා මෙම ගුණාංගයෙහි වැදගත් භාවිත පවතී. ආලෝක ප්‍රභවයක වර්ණ උෂ්ණත්වය නිර්ණය කෙරෙනුයේ එය සෛද්ධාන්තික තාපනය කරන ලද කෘෂ්ණ වස්තු විකිරකයක වර්ණවත් භාවීතාවය සමඟ සන්සන්දනය කිරීමෙනි. ආලෝක ප්‍රභවයෙන් නිකුත් වන ආලෝකයට සමාන ආලෝකයක් කෘෂ්ණ වස්තු විකිරකය මඟින් නිකුත් වනවිට එහි උෂ්ණත්වය අදාළ ප්‍රභවයේ වර්ණ උෂ්ණත්වය ලෙස සැලකේ. කෘෂ්ණ වස්තු ප්‍රභවයක් නම් එය සෘජුව ප්ලාන්ක් නියතය සමඟ සම්බන්ධ වේ."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mountains_of_Bangladesh","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Keokradong.jpg","page_title":"List of mountains of Bangladesh","context_page_description":"Bangladesh is a low-lying country. The only exceptions are the Chittagong Hills in the south-east, the Low Hills of Sylhet in the northeast and highlands in the north and northwest. Kala pahar 1,098 feet is the highest point of greater Sylhet and also the northern part of Bangladesh. The Chittagong Hills, which constitute the only significant hill system in the country, rise steeply to narrow ridge lines, with altitudes from 600 to 1,000 m above sea level. At 1,063 feet altitude, the highest elevation in Bangladesh is Saka Haphong at Mowdok range, in the southeastern part of the hills. Highly elevated peaks of this area can also be called mountains as hills above 2,000 feet with a distinct peak are referred as mountains. Seventy-five such mountains have been identified and mapped in the Hill Tracts. Fertile valleys lie between the hill lines, which generally run north–south. West of the Chittagong Hills is a broad plain, cut by rivers draining into the Bay of Bengal, that rises to a final chain of low coastal hills, mostly below 200 m, that attain a maximum elevation of 350 m."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%94%D0%B8%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D1%98%E2%80%9C_-_%D0%9F%D0%BE%D0%B1%D0%BE%D0%B6%D1%98%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%D0%A1%D0%B2._%D0%94%D0%B8%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D1%98%D0%B0_-_%D0%9F%D0%BE%D0%B1%D0%BE%D0%B6%D1%98%D0%B5_02.jpg","page_title":"Црква „Св. Димитриј“ - Побожје","context_page_description":"Свети Димитриј — гробјанска црква во скопското село Побожје."},{"page_url":"https://pl.wikipedia.org/wiki/Jan_D%C5%82ugosz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Jan_D%C5%82ugosz.JPG","page_title":"Jan Długosz","context_page_description":"Jan Długosz herbu Wieniawa – polski historyk, kronikarz, twórca dzieła Historia, duchowny, geograf, pierwszy heraldyk polski, dyplomata; wychowawca synów Kazimierza Jagiellończyka, posiadał przywilej kreacji notarialnej."},{"page_url":"https://ceb.wikipedia.org/wiki/La_Morra_(munisipyo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/La_morra.jpg","page_title":"La Morra (munisipyo)","context_page_description":"Munisipyo ang La Morra sa Italya. Nahimutang ni sa lalawigan sa Provincia di Cuneo ug rehiyon sa Piemonte, sa amihanan-kasadpang bahin sa nasod, 500 km sa amihanan-kasadpan sa Rome ang ulohan sa nasod. Adunay 2,718 ka molupyo. Naglangkob kin og 24.0 ka kilometro kwadrado. La Morra mopakigbahin sa usa ka utlanan sa Alba, Barolo, Castiglione Falletto, Cherasco, Narzole, Roddi, Verduno, ug Bra.\\nAng yuta sa La Morra kay kabungtoran sa habagatang-kasadpan, apan sa amihang-sidlakan nga kini mao ang patag.\\nAng klima umogon ug subtropikal. Ang kasarangang giiniton 12 °C. Ang kinainitan nga bulan Hulyo, sa 24 °C, ug ang kinabugnawan Disyembre, sa 0 °C. Ang kasarangang pag-ulan 1,410 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 259 milimetro nga ulan, ug ang kinaugahan Hunyo, sa 63 milimetro."},{"page_url":"https://it.wikipedia.org/wiki/Fiorenzuola_d%27Arda","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Collegiata_San_Fiorenzo_05.JPG","page_title":"Fiorenzuola d'Arda","context_page_description":"Fiorenzuola d'Arda è un comune italiano di 15 324 abitanti della provincia di Piacenza in Emilia-Romagna."},{"page_url":"https://en.wikipedia.org/wiki/Islamic_garden","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Sadi_in_a_Rose_garden.jpg","page_title":"Islamic garden","context_page_description":"An Islamic garden is generally an expressive estate of land that includes themes of water and shade. Their most identifiable architectural design reflects the Charbagh quadrilateral layout with four smaller gardens divided by walkways or flowing water. Unlike English gardens, which are often designed for walking, Islamic gardens are intended for rest, reflection, and contemplation. A major focus of the Islamic gardens was to provide a sensory experience, which was accomplished through the use of water and aromatic plants.\\nBefore Islam had expanded to other climates, these gardens were historically used to provide respite from a hot and arid environment. They encompassed a wide variety of forms and purposes which no longer exist. The Qur'an has many references to gardens and states that gardens are used as an earthly analogue for the life in paradise which is promised to believers:\\nAllah has promised to the believing men and the believing women gardens, beneath which rivers flow, to abide in them, and goodly dwellings in gardens of perpetual abode; and best of all is Allah's goodly pleasure; that is the grand achievement. – Qur'an 9.72"},{"page_url":"https://fr.wikipedia.org/wiki/Tom_Crean_(rugby_%C3%A0_XV)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Thomas_Crean_VC_IWM_Q_79773.jpg","page_title":"Tom Crean (rugby à XV)","context_page_description":"Thomas Joseph Patrick Crean, né le 19 avril 1873 au Morrison's Hotel, 1 Dawson Street, à Dublin et mort le 25 mars 1923, est un joueur de rugby à XV sélectionné en équipe d'Irlande au poste d'avant."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Russian_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Miklukho-Maklai.jpg","page_title":"List of Russian people","context_page_description":"This is a list of people associated with the modern Russian Federation, the Soviet Union, Imperial Russia, Russian Tsardom, the Grand Duchy of Moscow, Kievan Rus', and other predecessor states of Russia.\\nRegardless of ethnicity or emigration, the list includes famous natives of Russia and its predecessor states, as well as people who were born elsewhere but spent most of their active life in Russia."},{"page_url":"https://la.wikipedia.org/wiki/Camblain-Ch%C3%A2telain","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Blason_Camblain-Ch%C3%A2telain.svg","page_title":"Camblain-Châtelain","context_page_description":"Camblain-Châtelain est commune Francicum 1'653 incolarum praefecturae Freti Calisii in provincia Septentrioni et Freto."},{"page_url":"https://en.wikipedia.org/wiki/Comparative_army_enlisted_ranks_of_Asia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Praka_pdh_ad.png","page_title":"Comparative army enlisted ranks of Asia","context_page_description":"Rank comparison chart of armies/ land forces of Asian states."},{"page_url":"https://id.wikipedia.org/wiki/Proton_Prev%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/2014_Proton_Prev%C3%A9_Executive_-_Nameplate_Badge.jpg","page_title":"Proton Prevé","context_page_description":"Proton Prevé merupakan mobil jenis sedan padat empat pintu yang dibuat oleh produsen mobil Malaysia, Proton. Mobil ini diluncurkan pada tanggal 16 April 2012 sebagai pengganti Proton Persona dan Proton Gen-2. Prevé dibuat berdasarkan platform generasi baru Proton P3-21A dan merupakan mobil sedan Proton pertama yang dilengkapi mesin turbo charger.\\nPrevé disebut sebagai mobil global Proton pertama, dibuktikan melalui nama Prevé itu sendiri, yang diartikan \\"untuk membuktikan\\" atau \\"bukti\\"."},{"page_url":"https://ru.wikipedia.org/wiki/C64_Direct-to-TV","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Commodore64_DTV_mugshot-x600.jpg","page_title":"C64 Direct-to-TV","context_page_description":"C64 Direct-to-TV — однокристальная реализация бытового компьютера Commodore 64, выполненная в корпусе джойстика, и имеющая 30 встроенных игр. Такая конструкция имеет сходство с Atari Classics 10-in-1 TV Game.\\nКомпания Tulip Computers, с 1997 года владеющая торговой маркой «Commodore», лицензировала права для компании Ironstone Partners, которая совместно с компаниями DC Studios, Mammoth Toys, и The Toy:Lobster Company разработала и выпустила устройство в продажу. Компания QVC приобрела первую партию устройств, имеющую объём в 250 000 устройств, и продала 70 000 из них в первый день продаж. Интересным совпадением является то, что штаб-квартира QVC, находящаяся в Studio Park, ранее являлась офисом Commodore.\\nЭлектрическая схема C64DTV была разработана Джери Эллсуорт, любительницей-самоучкой, увлекающейся разработкой микросхем. До C64DTV она разработала компьютер C-One."},{"page_url":"https://pl.wikipedia.org/wiki/Kot_Morski_(herb_szlachecki)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Kot_morski_piekosi%C5%84ski.JPG","page_title":"Kot Morski (herb szlachecki)","context_page_description":"Kot Morski – polski herb szlachecki, używany przez kilkanaście rodzin, głównie na terenie Litwy. Jeden z 47 polskich herbów przeniesionych na Litwę w ramach Unii w Horodle, choć np. Władysław Semkowicz twierdzi, że pieczęcie adoptowanego wówczas bojara przedstawiają nie Kota Morskiego, ale Lewarta."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B2%96%E7%B8%84%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Awase_Mudflat_Okinawa.jpg","page_title":"沖縄市","context_page_description":"沖縄市は、沖縄本島中部に位置する沖縄県第2の都市。\\n栃木市、山梨市、岩手町、茨城町と並び、県と同一名称でありながら県庁所在地ではない市町村である。"},{"page_url":"https://en.wikipedia.org/wiki/International_Museum_of_Surgical_Science","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/International_Museum_of_Surgical_Science.jpg","page_title":"International Museum of Surgical Science","context_page_description":"The International Museum of Surgical Science is a museum located in the Gold Coast neighborhood of Chicago, Illinois. It is operated by The International College of Surgeons and features exhibits dealing with various aspects of Eastern and Western medicine. It was founded by Dr. Max Thorek in 1954. The museum's exhibits are displayed by theme or surgical discipline. Displays include photographs, paintings and drawings, sculpture, medical equipment, skeletons, medical specimens and historic artifacts. The library contains more than 5,000 rare medical texts.\\nHoused in a 1917 mansion designed by Howard Van Doren Shaw as a replica of a building at Versailles, the museum was originally built for Chicago socialite Eleanor Robinson Countiss Whiting who died in 1931. The International College of Surgeons acquired the building in 1950. In addition to displaying medical artifacts the museum has, since 1998, hosted a number of contemporary art exhibitions in an effort to broaden its appeal to visitors. In 2010 visitor numbers were at 20,000 a year, by 2013 this had increased to between 25,000 and 30,000."},{"page_url":"https://es.wikipedia.org/wiki/Das_Dreim%C3%A4derlhaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Franz_Schubert_by_Wilhelm_August_Rieder.jpeg","page_title":"Das Dreimäderlhaus","context_page_description":"Das Dreimäderlhaus es una opereta pastiche con música de Franz Schubert, arreglada por el húngaro Heinrich Berté y libreto en alemán de Alfred Maria Willner y Heinz Reichert, basado a su vez en la novela del año 1912 Schwammerl escrita por Rudolf Hans Bartsch. Se estrenó en el Raimundtheater de Viena el 15 de enero de 1916.\\nLa obra ofrece un relato de ficción sobre la vida romántica de Schubert. Originalmente, la partitura era en su mayor parte de Berté, con sólo una pieza de Schubert, \\"Ungeduld\\" de La bella molinera, pero los productores exigieron a Berté que apartara su partitura y creara un pastiche de la música de Schubert.​\\nLa producción original se estrenó en el Raimundtheater de Viena el 15 de enero de 1916 y alcanzó más de 650 representaciones en su primera temporada en Austria y unos cientos más en Alemania, seguida por muchas reposiciones exitosas. Protagonizada por Fritz Schrödter como Schubert y Anny Rainer como Hannerl. Schrödter ya tenía 60 años en 1916. En 1886 había cantado el papel del \\"Príncipe del Canto\\", esto es, Schubert, en la opereta de Franz von Suppé Franz Schubert.​"},{"page_url":"https://nl.wikipedia.org/wiki/Phytometra","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Phytometra_viridaria.jpg","page_title":"Phytometra","context_page_description":"Phytometra is een geslacht van nachtvlinders uit de familie spinneruilen."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A2%D2%AF%D0%BD%D0%B3%D1%96_%D0%BA%D3%A9%D0%B1%D0%B5%D0%BB%D0%B5%D0%BA%D1%82%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Pergesa_acteus_%28Cramer%2C_1779%29%2C_Kerala.jpg","page_title":"Түнгі көбелектер","context_page_description":"Түнгі көбелектер немесе Моль — қауырсынмұртты қабыршық қанаттылар тобы. Поляр кеңістігінен басқа жердің барлығына тараған.\\nКіші денелі, түнгі қауырсын, антенді күндізгі көбелектермен салыстырғанда кішігірім ашық емес қанаттары бар. Демалғанда қанаттарын жаяды, денесінің айналасына бұрып немесе басқа жаққа оңғарады. Қанатының көлемі 30 мм-ге дейін. Өмірі төрт кезеңнен тұрады: жұмыртқа, көбелекқұрт, қуыршақ және үлкен жәндіктер.\\nКөптеген түрлері, личинкалары өсімдікпен қоректенеді және ормандарды, ауыл шаруашылық өнімдері мен маталарды бүлдіре алады."},{"page_url":"https://pl.wikipedia.org/wiki/Klasyfikacja_j%C4%99zyk%C3%B3w_indoeuropejskich","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Idiomas_y_dialectos_romances.png","page_title":"Klasyfikacja języków indoeuropejskich","context_page_description":"Klasyfikacja języków indoeuropejskich – filogenetyczny podział indoeuropejskiej rodziny językowej na grupy, podgrupy, zespoły językowe i poszczególne języki. W artykule zostały przedstawione dwie odrębne klasyfikacje:\\njęzykoznawcy Merritta Ruhlena – według A Guide to the World’s Languages. Volume I: Classification;\\norganizacji SIL International – według 23. edycji Ethnologue: Languages of the World.\\nPierwsza z nich, bardziej zwięzła i podręcznikowa, zawiera 180 języków. Druga natomiast, współczesna, zawiera ich 445, klasyfikując wiele dotychczasowych dialektów jako odrębne języki."},{"page_url":"https://da.wikipedia.org/wiki/Indlandssalteng","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Puccinellia_distans.jpeg","page_title":"Indlandssalteng","context_page_description":"Indlandssalteng er en prioriteret naturtype i Natura 2000-netværket, dvs. en naturtype, der vurderes som særligt truet i Europa. Den har nummer 1340 i den fælleseuropæiske Natura 2000-registrering. Naturtypen findes kun på enkelte små lokaliteter i Nordjylland og på Sjælland.\\nIndlandssaltenge er naturlige saltafhængige plantesamfund på strandenge hvor saltpåvirkningen ikke skyldes havet. Der er flere undertyper, f.eks. salte kildevæld og brakvands-rørsumpe og engagtige samfund.\\nNaturtypen findes på steder, hvor der er saltholdigt grundvand pga. salt i undergrunden.\\nVegetationen består af salttålende græsser og urter, der også findes på strandenge.\\nIndlandssalteng har ifølge DCEs rapport fra 2019 en stærkt ugunstig bevaringsstatus som følge af næringsstofpåvirkning og tilgroning."},{"page_url":"https://en.wikipedia.org/wiki/Marie_Sall%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Maurice-Quentin_de_La_Tour%2C_Retrato_de_Mademoiselle_Sall%C3%A9_%281741%29.jpg","page_title":"Marie Sallé","context_page_description":"Marie Sallé was a French dancer and choreographer in the 18th century known for her expressive, dramatic performances rather than a series of \\"leaps and frolics\\" typical of ballet of her time."},{"page_url":"https://no.wikipedia.org/wiki/Marat_Safin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Marat_Safin%2C_2006.jpg","page_title":"Marat Safin","context_page_description":"Marat Mikhajlovitsj Safin er en russisk politiker og tidligere profesjonell tennisspiller. Safin er tidligere verdensener på ATP-rankingen.\\nHan har en søster som også har vært verdensener på ATP-rankingen. Safin vant US Open i 2000. Han har spilt profesjonelt siden 1997.\\nI Wimbledon 2008 klarte han å beseire en av favorittene Novak Djokovic i andre runde, han kom helt til semifinalen dette året hvor han tapte for daværende verdensener Roger Federer.\\nHan la opp i 2009.\\nI desember 2011 ble han valgt inn i Russlands Duma som representant for partiet Forent Russland i Nizjnij Novgorod. Han stillte ikke til gjenvalg seks år senere.\\nHan er medlem av Russlands olympiske komité, og er aktiv inne Russland tennisforbund.\\nI 2016 ble han innlemmet i International Tennis Hall of Fame."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1996","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Oudenaarde_-_Ronde_van_Vlaanderen_Beloften%2C_9_april_2016_%28B069%29.JPG","page_title":"Lijst van personen geboren in 1996","context_page_description":"Dit is een lijst van personen die geboren zijn in 1996.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Elkhorn,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Monterey_County_California_Incorporated_and_Unincorporated_areas_Elkhorn_Highlighted.svg","page_title":"Elkhorn, California","context_page_description":"Elkhorn is an unincorporated community and census-designated place in Monterey County, California, United States.\\nElkhorn was a stop on the Southern Pacific Railroad 13 miles northwest of Prunedale, at an elevation of 10 feet. The population of Elkhorn was 1,565 at the 2010 census, down from 1,591 at the 2000 census. Elkhorn was named after the elk in the area that have since gone extinct. Because Elkhorn is not incorporated, not all residents call the place they live Elkhorn. Some residents refer to Elkhorn as Castroville, Prunedale, Watsonville, or Salinas on mailed documents because Elkhorn shares ZIP codes with them. Other residents refer to Elkhorn as north Monterey County of which Elkhorn is a part. The Elkhorn Slough National Estuarine Research Reserve, located in the area, promotes education about and preservation of the largest tidal salt marsh outside of San Francisco Bay, Elkhorn Slough."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%93%D0%B0%D0%B8%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Riot_PetionVille.jpg","page_title":"Гаити","context_page_description":"Гаити Респу́блики - Гаитин анăç пайĕнчи тата юнашар утравсенче вырнаçнă патшалăх. Утравă н тухăç енне Доминикан Республики йышăнать. Гаитин тĕп хули - Порт-о-Пренс. Халăх йышĕ 8,1 млн çын.\\nÇĕршыв хăйĕн ятне авалхи индей чĕлхинчен илнĕ: «Туллă çĕр»."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%96%D5%AC%D5%B5%D5%B8%D5%B5%D5%A5%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Fl%C3%B8ien.jpg","page_title":"Ֆլյոյեն","context_page_description":"Ֆլյոյեն, լեռ Նորվեգիայի Հոռլան կոմսության Բերգեն քաղաքում: Ունի 425 մետր բարձրություն:\\nՖլյոյեն լեռը Բերգենում գտնվող 15 լեռներից ամենագրավիչն է և քաղաք այցելած հյուրերի մեծ մասը պարտադիր կերպով բարձրանում է այն: Գագաթից երևում է Բերգենի գեղեցիկ համայնապատկերը:\\nԼեռան լանջին կառուցված է ֆունիկուլյոր, որը ուղևորներին քաղաքի կենտրոնից 6 րոպեում տեղափոխում է դիտակետ, որը գտնվում է լեռան լանջին՝ 320 մ բարձրության վրա։ Դիտակետը գտնվում էգագաթից 1 կմ հյուսիս-արևելք: Ֆունիկլյորը աշխատում է տարվա մեջ 12 ամիս:"},{"page_url":"https://en.wikipedia.org/wiki/Nina_Koshetz","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Nina_Koshetz_-_Dec_1922_Shadowland.jpg","page_title":"Nina Koshetz","context_page_description":"Nina Koshetz was a Russian-Ukrainian, later American opera soprano, recital singer and actress. The niece of Oleksandr Koshytsa."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89lection_pr%C3%A9sidentielle_surinamaise_de_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/President_Bouterse.JPG","page_title":"Élection présidentielle surinamaise de 2020","context_page_description":"L’élection présidentielle surinamaise de 2020 a lieu le 13 juillet 2020 afin d'élire au scrutin indirect le président de la République du Suriname. Ce scrutin suit de quelques mois les élections législatives de mai qui ont produit une alternance, le Parti national démocratique du président Bouterse essuyant un fort recul au profit de plusieurs partis d'opposition dont le Parti progressiste de la réforme, arrivé en tête. Le dirigeant de ce dernier Chan Santokhi, jugé favori, accède à la présidence par acclamation, en l'absence d'autres candidatures."},{"page_url":"https://es.wikipedia.org/wiki/Descarozador_de_aceitunas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Descarozador03.jpg","page_title":"Descarozador de aceitunas","context_page_description":"El descarozador de aceitunas es un elemento de suma utilidad en la cocina,\\nque tiene por objeto extraer el carozo de las aceitunas a fin de rellenarlas o bien aplicarlas o otros platos con la comodidad de no contar con el carozo en su interior. Es, en general, más utilizada por los cocineros y chefs y no tanto para el uso doméstico, ya que hoy en día es práctico adquirir las aceitunas ya rellenas o descarozadas, pues están al alcance de los compradores, en frascos, sueltas, y otros tipos de envase."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%95%D7%96%D7%99%D7%90%D7%95%D7%9F_%D7%94%D7%99%D7%A9%D7%9F_(%D7%91%D7%A8%D7%9C%D7%99%D7%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Bundesarchiv_Bild_183-M1204-0307%2C_Berlin%2C_Altes_Museum%2C_Gest%C3%BCrztes_Denkmal.jpg","page_title":"המוזיאון הישן (ברלין)","context_page_description":"המוזיאון הישן הוא מוזיאון באי המוזיאונים בברלין אשר נבנה במקורו עבור משפחת המלוכה הפרוסית כמקום הצגה ואחסון של אוסף האמנות המשפחתי."},{"page_url":"https://en.wikipedia.org/wiki/Blue_Room_(White_House)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/White-house-floor1-blue-room.jpg","page_title":"Blue Room (White House)","context_page_description":"The Blue Room is one of three state parlors on the first floor in the White House, the residence of the President of the United States. It is distinct for its oval shape. The room is used for receptions and receiving lines and is occasionally set for small dinners. President Grover Cleveland married Frances Folsom in the room on June 2, 1886, the only wedding of a President and First Lady in the White House. The room is traditionally decorated in shades of blue. With the Yellow Oval Room above it and the Diplomatic Reception Room below it, the Blue Room is one of three oval rooms in James Hoban's original design for the White House."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%BE%D0%BD_%D0%9F%D0%BE%D0%BF%D1%81%D1%82%D0%BE%D0%B8%D0%BB%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Report_by_Anton_Popstoilov_about_the_Bulgarian_Primary_School_in_Thessaloniki_14_February_1901_-_7.jpg","page_title":"Антон Попстоилов","context_page_description":"Антон Попстоилов Ников е български историк, фолклорист и етнограф, академик на Българската академия на науките от 1906 година."},{"page_url":"https://en.wikipedia.org/wiki/Cabrespine","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Cabrespine_village_%28998839500%29.jpg","page_title":"Cabrespine","context_page_description":"Cabrespine is a commune in the Aude department in southern France."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%B5%D5%B8%D6%82%D5%B6%D5%AB%D6%84%D5%AB_%D5%B4%D5%A1%D6%80%D5%A6%D5%AB_%D5%B4%D5%A1%D5%BF%D5%B8%D6%82%D5%BC%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/%D5%84%D4%B1%D5%8F%D5%88%D5%92%D5%8C_%D5%8D%D4%B2._%D4%B1%D5%8D%D5%8F%D5%8E%D4%B1%D4%BE%D4%B1%D4%BE%D4%BB%D5%86_%28%D5%8D%D4%B1%D5%90%D4%B3%D5%8D%D4%BB_%D4%BD%D4%B1%D5%89%D4%B5%D5%90%C2%BB%29_1.jpg","page_title":"Սյունիքի մարզի մատուռների ցանկ","context_page_description":"Ստորև ներկայացվում է Հայաստանի Հանրապետության Սյունիքի մարզի մատուռների ցանկը"},{"page_url":"https://fr.wikipedia.org/wiki/Fosse_De_Sessevalle","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Somain_-_Fosse_De_Sessevalle%2C_puits_n%C2%B0_2_en_fin_de_construction.jpg","page_title":"Fosse De Sessevalle","context_page_description":"La fosse De Sessevalle ou Anatole de Sessevalle de la Compagnie des mines d'Aniche est un ancien charbonnage du Bassin minier du Nord-Pas-de-Calais, situé à Somain, près de Rieulay. Le premier puits, foncé à partir de 1901 permet de produire en 1904. Un second puits est creusé 70 mètres plus au nord à partir de 1905. À partir de 1908, la fosse peut extraire avec deux puits. Des cités sont bâties à proximité, ainsi que des écoles, une salle des fêtes, un presbytère et une église. Quatre terrils sont édifiés aux alentours de la fosse, dont deux terrils cavaliers et un terril annexe. Détruits pendant la Première Guerre mondiale, les bâtiments de la fosse sont reconstruits à l'identique.\\nCette reconstruction permet à la fosse d'augmenter sa production et d'être un des sièges les plus performants de la Compagnie. Durant la Seconde Guerre mondiale, la fosse est occupée par les Allemands mais ne subit aucune destruction. Le charbon extrait est destiné à l'Allemagne. À la suite de la nationalisation des houillères en 1946, la fosse fait partie du Groupe de Douai. Son gisement s'épuisant, elle ferme en 1970, les puits sont remblayés la même année."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D9%88%DB%8C%DA%A9%D8%8C_%DA%A9%D8%A7%D8%B1%D9%88%D9%84%DB%8C%D9%86%D8%A7%DB%8C_%D8%B4%D9%85%D8%A7%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Wake_County_Courthouse_-_Raleigh%2C_NC_-_DSC05816.JPG","page_title":"شهرستان ویک، کارولینای شمالی","context_page_description":"شهرستان ویک، کارولینای شمالی یک سکونتگاه مسکونی در ایالات متحده آمریکا است که در کارولینای شمالی واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Tretioscincus_oriximinensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Tretioscincus_oriximinensis.jpg","page_title":"Tretioscincus oriximinensis","context_page_description":"Tretioscincus oriximinensis, the Oriximina lizard, is a species of lizard in the family Gymnophthalmidae. It is found in Brazil, Venezuela, and Colombia."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%DB%8C%D8%AE_%D8%AE%D8%A7%D9%88%D8%B1%D9%85%DB%8C%D8%A7%D9%86%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/The_Middle_East_in_1920.png","page_title":"تاریخ خاورمیانه","context_page_description":"این نوشتار مروری کلی بر تاریخ خاور میانه است. برای فراگیری بهتر موضوع، تعریف منطقه را در نوشتار خاور میانه ببینید."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AB%E0%A5%8D%E0%A4%B0%E0%A5%87%E0%A4%82%E0%A4%9A_%E0%A4%B8%E0%A4%BE%E0%A4%B9%E0%A4%BF%E0%A4%A4%E0%A5%8D%E0%A4%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Gao_Xingjian_Galerie_Simoncini_Luxembourg.jpg","page_title":"फ्रेंच साहित्य","context_page_description":"फ्रेंच साहित्य से तात्पर्य फ्रेंच भाषा में लिखे साहित्य से है। फ्रांस, बेल्जियम, स्विट्जरलैण्ड, कनाडा, सेनेगल, अल्जीरिया तथा मोरोक्को आदि के नागरिकों द्वारा रचित साहित्य 'फ्रेंचभाषी साहित्य' कहलाता है। वर्ष २००६ तक फ्रांसीसी भाषा के सहित्यकारों को अन्य किसी भाषा के साहित्यकारों से अधिक नोबेल पुरस्कार प्राप्त हैं।"},{"page_url":"https://en.wikipedia.org/wiki/Johannes_Dieckmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Bundesarchiv_Bild_183-F0711-0037-001%2C_Johannes_Dieckmann_%28cropped%29.jpg","page_title":"Johannes Dieckmann","context_page_description":"Johannes Dieckmann was a German journalist and politician. He served as president of the People's Chamber, the parliament of East Germany, from 1949 to 1969. As such he was acting acting head of state after the death of President Wilhelm Pieck in 1960."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Beaucaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Beaucaire%2Cplace_de_la_R%C3%A9publique_N%C2%B01.jpg","page_title":"Liste des monuments historiques de Beaucaire","context_page_description":"Ce tableau présente la liste de tous les monuments historiques classés ou inscrits dans la ville de Beaucaire, Gard, en France."},{"page_url":"https://de.wikipedia.org/wiki/Karibikkarakara","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Karakara_im_Flug.jpg","page_title":"Karibikkarakara","context_page_description":"Der Karibikkarakara ist ein falkenartiger Vogel aus dem südlichen Nordamerika, Mittelamerika und dem nördlichen Südamerika. Die Art wird in zwei Unterarten geteilt, im Norden Caracara cheriway auduboni, im Süden Caracara cheriway cheriway."},{"page_url":"https://it.wikipedia.org/wiki/Rete_tranviaria_di_Buenos_Aires","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Tranway2.jpg","page_title":"Rete tranviaria di Buenos Aires","context_page_description":"La rete tranviaria di Buenos Aires cominciò ad operare nel 1863 espandendosi rapidamente, in quella che venne soprannominata la \\"Città dei tram\\" per avere il più alto rapporto tranvie per popolazione del mondo. Negli anni 1920, Buenos Aires aveva 875 km di tranvie e 99 linee di tram, che usavano 3.000 vetture che correvano per tutta la città. Entro il 1963, la vasta maggioranza della rete cominciò ad essere smantellata, benché alcuni servizi tranviari di minore importanza continuino ancora oggi nella città."},{"page_url":"https://it.wikipedia.org/wiki/Nobilt%C3%A0_piemontese","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Coa_fam_ITA_appiani_d%27aragona.jpg","page_title":"Nobiltà piemontese","context_page_description":"La nobiltà piemontese fu una classe sociale privilegiata dei possedimenti del Ducato di Savoia e del Regno di Sardegna poi. La nobiltà venne ufficialmente integrata in quella nazionale nel 1861 con l'istituzione del Regno d'Italia."},{"page_url":"https://fr.wikipedia.org/wiki/Disjoncteur_%C3%A0_courant_continu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/2_level_converter_short_circuit.png","page_title":"Disjoncteur à courant continu","context_page_description":"Un disjoncteur à courant continu est destiné à établir, supporter et interrompre des courants continus sous sa tension assignée, que ce soit en condition normale ou anormale par exemple un court-circuit, selon la définition donnée par la Commission électrotechnique internationale. L'interruption d'un courant continu est à la fois différente et plus difficile que celle d'un courant alternatif. Les disjoncteurs à courant continu sont donc très différents de leurs équivalents pour courant alternatif. Des modèles en moyenne tension et haute tension existent actuellement dans le domaine ferroviaire et dans les stations HVDC, cependant jusqu'à présent aucune solution acceptable n'a été trouvée pour réaliser un disjoncteur à courant continu très haute tension : soit le système est trop lent, soit dégage trop de pertes. En 2012, ABB a présenté un concept semblant surmonter les problèmes rencontrés jusqu'à présent. Alstom a démontré une capacité de coupure encore plus rapide en 2013."},{"page_url":"https://cs.wikipedia.org/wiki/Chana_Sene%C5%A1ov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/PikiWiki_Israel_7704_Hannah_Senesh.jpg","page_title":"Chana Senešová","context_page_description":"Chana Senešová byla židovská básnířka, sionistka a účastnice protinacistického odboje. V Izraeli je považována za národní hrdinku.\\nPocházela ze známé maďarské židovské rodiny z Budapešti. Pro své sionistické nadšení a také kvůli stále sílícímu antisemitismu odešla v září 1939 ve svých osmnácti letech do britské mandátní Palestiny. Po studiu v dívčí zemědělské škole v Nahalalu se usadila v kibucu Sdot Jam. Druhá světová válka, zprávy o osudu evropského židovstva, ale hlavně strach o matku, která zůstala v Budapešti, ji přiměly k rozhodnutí vrátit se zpět do Maďarska a pomoci tamním Židům. Vstoupila do řad židovské vojenské organizace Hagana, konkrétně do jejích jednotek Palmach, a přihlásila se jako dobrovolnice do tajné výsadkářské mise v Evropě. Podstoupila výcvik vedený britskou armádou a zpravodajskou službou Special Operations Executive a získala hodnost v britském královském letectvu. Mise, které se zúčastnilo 37 židovských dobrovolníků, měla za cíl jednak pomoci Britům v jejich válečném úsilí, ale rovněž tak pomoci místnímu židovskému odboji, židovským komunitám a sionistickým hnutím."},{"page_url":"https://fr.wikipedia.org/wiki/Varanopidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Varanodon1DB.jpg","page_title":"Varanopidae","context_page_description":"Les Varanopidae constituent une famille éteinte de synapsides eupélycosauriens qui ressemblaient aux varans actuels et auraient eu le même style de vie, d'où leur nom. Ils ont vécu au cours du Permien inférieur et moyen aux Amériques, en Russie et en Afrique du Sud."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%83%8D%E3%83%9E%E6%97%AC%E5%A0%B120%E4%B8%96%E7%B4%80%E3%81%AE%E6%98%A0%E7%94%BB%E3%82%B9%E3%82%BF%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Tom_Cruise_avp_2014_4.jpg","page_title":"キネマ旬報20世紀の映画スター","context_page_description":"キネマ旬報20世紀の映画スターは、2000年にキネマ旬報が著名人からのアンケートをもとに、20世紀を代表する俳優を選出したリストである。\\n2000年5月下旬号に男優編、2000年6月上旬号に女優編が、それぞれ発表された。\\n14年後の2014年10月にオールタイム・ベスト 外国映画男優・女優を、12月にはオールタイム・ベスト 日本映画男優・女優も発表した。"},{"page_url":"https://de.wikipedia.org/wiki/Hank_Aaron","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Hank_aaron_jersey.jpg","page_title":"Hank Aaron","context_page_description":"Henry Louis „Hank“ Aaron, auch Hammerin’ Hank genannt, ist ein ehemaliger Spitzenspieler des US-Profibaseballs. Sein Ruhm beruht vor allem darauf, dass es ihm 1974 gelang, den Rekord des legendären Babe Ruth von 714 Home-Runs zu übertreffen. Insgesamt brachte Aaron es bis zum Ende seiner Karriere auf 755 Home-Runs. 1957 gewann er mit den Milwaukee Braves die World Series und wurde im selben Jahr zum „Wertvollsten Spieler“ der National League gewählt. In seiner Karriere wurde er dreimal mit dem „Gold Glove Award“ ausgezeichnet und 21-mal in das All-Star-Team berufen. Aarons Baseballkarriere in der Major League dauerte von 1954 bis 1976."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B3%D0%BB%D0%B8%D1%81%D0%B2%D0%B8%D0%BB%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Roggliswil_092.jpg","page_title":"Роглисвиль","context_page_description":"Роглисвиль — Швейцарияның Люцерн кантонында орналасқан коммуна. Виллизау округінің құрамына кіреді.\\n2006 жылғы мәліметтер бойынша тұрғындарының саны 634 адамды құрайды. Алып жатқан жер аумағы 6.22 км² шамасында. Ресми идентификациялық коды — 1142, пошта индексі — 6265."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%88%D0%BE%D0%B2%D0%B0%D0%BD_%D0%9A%D1%80%D1%81%D1%82%D0%B8%D1%82%D0%B5%D0%BB%E2%80%9C_-_%D0%A1%D0%BB%D0%B0%D1%82%D0%B8%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/%D0%92%D0%B8%D0%BA%D0%B8%D0%B5%D0%BA%D1%81%D0%BF%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D1%98%D0%B0_%D0%94%D0%B5%D0%B1%D0%B0%D1%80%D1%86%D0%B0_212.jpg","page_title":"Црква „Св. Јован Крстител“ - Слатино","context_page_description":"Свети Јован Крстител — манастирска црква во селото Слатино, сместена во близина на некогашното Слатинско Езеро.\\nМанастирската црква била осветена на 26 мај 2002 година од страна на митрополитот дебарско-кичевски г. Тимотеј. Фреските се изработени од уметникот Драган Ристески од Охрид."},{"page_url":"https://ca.wikipedia.org/wiki/R%C3%B3bert_Rojd%C3%A9stvenski","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/RIAN_archive_681907_Poet_Robert_Rozhdestvennsky_at_3rd_All-Union_Celebration_of_Pushkin_Poetry_%28cropped%29.jpg","page_title":"Róbert Rojdéstvenski","context_page_description":"Róbert Ivànovitx Rojdéstvenski, en rus: Ро́берт Ива́нович Рожде́ственский, nascut Róbert Stanislàvovitx Petkévitx, en rus: Ро́берт Станисла́вович Петке́вич, 20 de juny de 1932, Kossikha, Territori Siberià Occidental, actualment Territori de l'Altai - 19 d'agost de 1994, Moscou) - fou un poeta, lletrista i traductor soviètic i rus, i un dels representants més brillants de l'era dels Xestidessiátniki. Fou guardonat amb el Premi Lenin Komsomol i el Premi Estatal de l'URSS. Era pare de la fotògrafa Iekaterina Rojdéstvenskaia."},{"page_url":"https://en.wikipedia.org/wiki/Caltoris_kumara","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Blank_Swift_Caltoris_kumara_%285225841923%29.jpg","page_title":"Caltoris kumara","context_page_description":"Caltoris kumara, the blank swift, is a butterfly belonging to the family Hesperiidae."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_pr%C3%ADncipes_de_Saxe-Coburgo-Gota","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Eduard_VII.jpg","page_title":"Lista de príncipes de Saxe-Coburgo-Gota","context_page_description":"Esta é uma lista dos Príncipes de Saxe-Coburgo-Gota desde a ascensão de Ernesto I ao trono do Ducado de Saxe-Coburgo-Gota, em 1826. Os indivíduos portadores do título de príncipe, assim como suas consortes, tinham direito ao tratamento de \\"Alteza Real\\".\\nO título Príncipe de Saxe-Coburgo-Gota e Duque de Saxe e o estilo de \\"Alteza Real\\" eram normalmente restritos aos filhos legítimos dos soberanos saxões e aos seus descendentes pela linha masculina."},{"page_url":"https://fr.wikipedia.org/wiki/John_Wayne","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/John_Wayne_-_still_portrait.jpg","page_title":"John Wayne","context_page_description":"John Wayne [ d͡ʒɑn weɪn], pseudonyme de Marion Mitchell Morrison, est un acteur, réalisateur et producteur américain né le 26 mai 1907 à Winterset et mort le 11 juin 1979 à Los Angeles.\\nAu cours de ses cinquante ans de carrière, il a joué dans près de 180 films, notamment des films policiers, des films de guerre et quelques comédies romantiques ; mais c'est dans ses nombreux westerns que John Wayne s'est réellement imposé, particulièrement sous la direction de deux réalisateurs : John Ford et Howard Hawks. Il a tourné également plusieurs films sous la direction d'Henry Hathaway, dont Cent dollars pour un shérif en 1969, qui lui valut en 1970 l'Oscar du meilleur acteur.\\nEn 1960, il passe derrière la caméra pour réaliser une fresque historique d'envergure, Alamo, relatant les derniers jours de Davy Crockett et ses compagnons lors de la guerre d'indépendance du Texas. Huit ans plus tard, il a co-réalise Les Bérets verts, film engagé justifiant l'intervention américaine au Viêt Nam. Ses deux réalisations ont reflété l'engagement personnel de John Wayne, républicain et ardent patriote."},{"page_url":"https://vi.wikipedia.org/wiki/V%C6%B0%E1%BB%9Dn_Nh%E1%BA%ADt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Ritsurin.JPG","page_title":"Vườn Nhật","context_page_description":"Vườn Nhật là kiểu vườn cảnh truyền thống của Nhật Bản. Vườn Nhật mang đặc trưng nổi bật đó là tập hợp ngăn nắp của các vật thể thiên nhiên thu nhỏ qua bàn tay của con người xung quanh một hồ nước nhân tạo có những hòn đảo giả. Nhiều vườn Nhật có cách bài trí với những hàm ý sâu xa của Thiền tông."},{"page_url":"https://ca.wikipedia.org/wiki/Salix_laevigata","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Salix_laevigata_range_map_2.png","page_title":"Salix laevigata","context_page_description":"Salix laevigata és una espècie de planta de la família de les salicàcies. És nativa d'Amèrica del Nord, de la costa de Califòrnia i nord de Baixa Califòrnia."},{"page_url":"https://en.wikipedia.org/wiki/Colombian_cuisine","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Arepas_de_huevo.jpg","page_title":"Colombian cuisine","context_page_description":"Colombian cuisine is a compound of the culinary traditions of the six main regions within the country. Colombian cuisine varies regionally and is particularly influenced by Indigenous Colombian, Spanish, and African cuisines, with slight Arab influence in some regions. Furthermore, being one of the most biodiverse countries in the world, Colombia has one of the widest variety of available ingredients depending on the region."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%82%D8%B7%D8%B9%D9%86%D8%A7%D9%85%D9%87_%DB%B1%DB%B2%DB%B2%DB%B3_%D8%B4%D9%88%D8%B1%D8%A7%DB%8C_%D8%A7%D9%85%D9%86%DB%8C%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Camp_Grotle.jpg","page_title":"قطعنامه ۱۲۲۳ شورای امنیت","context_page_description":"قطعنامه ۱۲۲۳ شورای امنیت سازمان ملل متحد که در تاریخ ۲۸ ژانویه ۱۹۹۹ تصویب شد، سندی بین‌المللی دربارهٔ بررسی وضعیت خاورمیانه است. این قطعنامه طی نشست ۳۹۷۰ام با ۱۵ رای موافق، ۰ مخالف و ۰ ممتنع تصویب شد."},{"page_url":"https://en.wikipedia.org/wiki/List_of_theaters_in_Omaha,_Nebraska","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Chief_Theater%2C_Omaha%2C_Nebraska.jpg","page_title":"List of theaters in Omaha, Nebraska","context_page_description":"This is a list of theaters in Omaha, Nebraska. The entries include theaters used to present films and professional live performances, including vaudeville acts, plays and musical performances."},{"page_url":"https://sh.wikipedia.org/wiki/Svrdlo","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/CenterDrills123456.jpg","page_title":"Svrdlo","context_page_description":"Svrdlo ili bušni alat je alat koje koristimo kod bušenja. Svrdla se dijele na: spiralna svrdla, svrdla s pločicama od tvrdog metala, ravna svrdla, zabušivala, specijalne izvedbe spiralnih svrdala, noževe i motke za bušenje."},{"page_url":"https://id.wikipedia.org/wiki/Rwanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/RwandaParliament.jpg","page_title":"Rwanda","context_page_description":"Republik Rwanda, dahulu disebut Ruanda, adalah sebuah negara di Afrika Tengah. Negara ini terletak beberapa derajat di bawah garis khatulistiwa dan berbatasan dengan Uganda, Tanzania, Burundi, serta Republik Demokratik Kongo. Semua wilayah Rwanda berada pada elevasi tinggi, dengan didominasi oleh pegunungan di bagian barat, sabana di bagian timur, dan berbagai danau tersebar di seluruh negeri. Iklimnya hangat hingga subtropis, dengan dua musim hujan dan musim kemarau per tahun.\\nPenduduk Rwanda relatif muda dan masih didominasi pedesaan, sementara kepadatan penduduknya merupakan salah satu yang tertinggi di Afrika. Di Rwanda terdapat tiga kelompok: Hutu, Tutsi, dan Twa. Twa adalah pigmi yang tinggal di hutan dan merupakan keturunan dari penduduk paling pertama Rwanda, tetapi para ahli masih belum sepakat mengenai asal usul dan perbedaan antara Hutu dan Tutsi; beberapa meyakini bahwa keduanya merupakan kasta sosial, sementara yang lain memandangnya sebagai ras atau suku. Kekristenan adalah agama mayoritas di Rwanda, dan bahasa utamanya adalah Bahasa Kinyarwanda, yang dituturkan oleh sebagian besar penduduk Rwanda. Sistem pemerintahan di Rwanda adalah sistem presidensial."},{"page_url":"https://en.wikipedia.org/wiki/Kurkihar_hoard","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Buddhas_Descent_from_Trayastrimsa_Heaven_Inscribed_-_Basalt_-_ca_10th_Century_CE_-_Pala_Period_-_Kurkihar_-_ACCN_Kr_13-A24119_-_Indian_Museum_-_Kolkata_2016-03-06_1534.JPG","page_title":"Kurkihar hoard","context_page_description":"The Kurkihar hoard represents a rare set of 226 bronzes, mostly Buddhist, dating to between the 9th and 12th centuries CE, which were found in Kurkihar near Gaya in the Indian state of Bihar. The village of Kurkihar is situated about 5 km. north-east of Wazirgunj, and 27 km east from Gaya. The inscriptions found suggest that Kurkihar was once a well known international pilgrimage center.\\nThese include a gilded Avalokiteshvara image from 12th century, referred to as being resplendent.\\nThe monastery where the bronzes were found was named Apanakain in an Ashtasahasrika Prajnaparamita manuscript now in LACM."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D8%B2%DB%8C%D8%B1%DB%8C%D8%B3%D8%AA%D8%A7%D9%86_%D8%B3%D8%A7%D9%88%D8%A7%D8%B4%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Map_of_FATA_in_Pakistan.PNG","page_title":"وزیریستان ساواشی","context_page_description":"</ref>\\n~1,000 TNSM militia\\n300–3,000 al-Qaeda militants\\nشام و عیراق ایسلامی دؤولتی\\nJundallah: 12,000–20,000\\nIMU: 500\\n| casualties1 = Pakistan:\\n4,302+\\nUnited States':\\n15 soldiers killed\\n| casualties2 = 28,809+ militants - 31,000 killed\\n| notes = SATP:\\n43,175+ killed overall\\n10,049+ civilians killed\\n6,800+ LEAs killed\\nCosts of War:\\n61,500+ killed overall\\n22,100 civilians killed\\n8,200+ LEAs killed\\n67,000+ total injured\\nOver 3.44 million civilians displaced\\n}}\\nوزیریستان ساواشی فدرال ایداره اولونان قبیله منطقه‌لری و خیبر پختونخوا یئرینده اوز وئرمیش‌دیر"},{"page_url":"https://en.wikipedia.org/wiki/Berri,_South_Australia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/BerriFromScenicLookout.JPG","page_title":"Berri, South Australia","context_page_description":"Berri is a town in the Riverland region of South Australia. It is 238 kilometres north-east of Adelaide, the capital of the state of South Australia. It is primarily an agricultural and viticultural town on the north bank of the Murray River. It is the original home of a juice company, Berri Ltd."},{"page_url":"https://fr.wikipedia.org/wiki/Adriano_Passuello","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Adriano_Passuello_1970.jpg","page_title":"Adriano Passuello","context_page_description":"Adriano Passuello est un coureur cycliste italien."},{"page_url":"https://simple.wikipedia.org/wiki/Lignereuil","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Blason_Lignereuil.svg","page_title":"Lignereuil","context_page_description":"Lignereuil is a commune. It is found in the region Nord-Pas-de-Calais in the Pas-de-Calais department in the north of France."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A6%BF%E0%A6%B2%E0%A6%BF%E0%A6%95%E0%A6%A8_%E0%A6%A1%E0%A6%BE%E0%A6%87_%E0%A6%85%E0%A6%95%E0%A7%8D%E0%A6%B8%E0%A6%BE%E0%A6%87%E0%A6%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/DuneBlanche.jpg","page_title":"সিলিকন ডাই অক্সাইড","context_page_description":"সিলিকন ডাই-অক্সাইড একটি রাসায়নিক যৌগ যা সিলিকনের অক্সাইড। এটি সিলিকা নামেও পরিচিত। এর রাসায়নিক সংকেত SiO₂। প্রকৃতিতে এটি বালু, কিংবা অর্ধ-মূল্যবান, দানাদার কোয়র্ট্‌স্‌ আকারে পাওয়া যায়। এছাড়া ডাইঅ্যাটম নামের এক ধরনের শৈবালের কোষপ্রাচীরেও এর দেখা মেলে। সিলিকা ভূ-পৃষ্ঠের সবচেয়ে সহজলভ্য খনিজ পদার্থ।\\nসিলিকা বিভিন্ন ধরনের কাচ এবং কংক্রিট প্রস্তুতে ব্যবহার করা হয়।"},{"page_url":"https://de.wikipedia.org/wiki/R%C3%B6merhalle_(Bad_Kreuznach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Roemerhalle_Kreuznach_Soldatengrabstein.jpg","page_title":"Römerhalle (Bad Kreuznach)","context_page_description":"Das Museum Römerhalle in der Stadt Bad Kreuznach in Rheinland-Pfalz zeigt Funde aus einer römischen Palastvilla aus dem späten 2. Jahrhundert n. Chr. sowie weitere Funde der Römerzeit aus dem Landkreis Bad Kreuznach. Darunter befinden sich zwei großflächig erhaltene Mosaikböden, die zu den bedeutendsten Funden nördlich der Alpen gerechnet werden, sowie zahlreiche Steindenkmäler."},{"page_url":"https://ca.wikipedia.org/wiki/Investigaci%C3%B3_m%C3%A8dica","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Monoclonal_antibodies4.jpg","page_title":"Investigació mèdica","context_page_description":"La investigació mèdica és aquella que cerca nous béns i serveis encaminats a preservar i protegir la salut de les persones. La investigació mèdica se sol diferenciar en recerca bàsica i recerca clínica:\\nLa investigació mèdica bàsica té com a objectiu conèixer el cos humà i els seus malalties.\\nLa investigació mèdica clínica es basa en els resultats de la investigació bàsica per inventar i demostrar l'eficàcia de nous tractaments i tècniques.\\nEn no ser la medicina una ciència exacta, com si ho són les matemàtiques, és molt experimental, ja que un remei pot servir per al 90% de la població però no per això ha de servir al 10% restant. Tots els avenços en les investigacions són utilitzades diàriament pels professionals de la medicina, ja que cada nou medicament o cada nova operació són aplicacions directes de la investigació mèdica.\\nEn molts països en estudiar la carrera de medicina es ressalta la importància de la investigació constant, ja sigui teòricament o mitjançant treballs i exposicións, existint en moltes universitats un títol de postgrau en investigació mèdica."},{"page_url":"https://ca.wikipedia.org/wiki/Bas%C3%ADlica_de_Son_Bou","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Basilica_Paleocristiana_de_Son_Bou.JPG","page_title":"Basílica de Son Bou","context_page_description":"La basílica de Son Bou és un jaciment arqueològic corresponent a un edifici paleocristià destinat al culte; es troba a la platja de Son Bou, en un indret denominat ses Canessies, paraula de suposada etimologia àrab amb el significat de 'temple' o 'església'. La presència d'una església paleocristiana a l'indret era coneguda d'antic a causa de la visibilitat de la pica baptismal monolítica. La seva excavació s'inicià el 1951 i posà al descobert un edifici de 25,20 metres de llargària per 12,40 d'amplària, de tres naus separades per pilars, les quals, contràriament a la major part de les esglésies balears d'aquesta època, no conté mosaics, sinó que el seu paviment és de test; això ha duit als investigadors a discrepar sobre si cal fixar una cronologia anterior o posterior a la resta d'esglésies primitives de Menorca."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8C%80%ED%95%9C%EB%AF%BC%EA%B5%AD%EC%9D%98_%ED%8F%AC%ED%9A%8D_%EC%B1%84%EC%B7%A8_%EB%93%B1%EC%9D%98_%EA%B8%88%EC%A7%80_%EC%95%BC%EC%83%9D%EC%83%9D%EB%AC%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Monticola_gularis_male_non-breeding_-_Khao_Yai.jpg","page_title":"대한민국의 포획 채취 등의 금지 야생생물","context_page_description":"대한민국의 포획·채취 등의 금지 야생생물은 「야생생물 보호 및 관리에 관한 법률」 제19조제1항 각 호 외의 부분 본문에서 \\"환경부령으로 정하는 종\\"으로, 동법 시행규칙 별표 6에 따른 종을 말한다.\\n공통 적용기준: 살아 있는 생물체와 그 알을 포함한다."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%BE%D0%B1%D0%BE%D1%80%D1%96%D0%B2_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Svyato-Preobrajenskiy-Sobor_Zhytomyr_2008.jpg","page_title":"Список соборів України","context_page_description":"Це список соборів України — кафедральних храмів.\\nУ православ'ї також собором називається церква, де ця кафедра коли-небудь була, а також головна церква монастиря.\\n№\\nНайменування\\nСвітлина\\nДатування\\nРозташування\\nКороткі відомості"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B6%D0%BE%D0%BF%D0%BB%D0%B8%D0%BD,_%D0%94%D0%B6%D0%B5%D0%BD%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Janis_Joplin_1970.JPG","page_title":"Джоплин, Дженис","context_page_description":"Дже́нис Лин Джо́плин — американская рок-певица, выступавшая сначала в составе Big Brother and the Holding Company, затем в Kozmic Blues Band и Full Tilt Boogie Band. Джоплин, выпустившая лишь четыре студийных альбома, считается лучшей белой исполнительницей блюза и одной из величайших вокалисток в истории рок-музыки.\\nВ 1995 году Дженис Джоплин была посмертно введена в Зал славы рок-н-ролла; в 2005 году — удостоена «Grammy Lifetime Achievement Award» за выдающиеся достижения; в 2013 году — получила звезду на Голливудской «Аллее славы». Джоплин занимает 46-е место в списке «50 величайших исполнителей всех времён» журнала Rolling Stone и 28-е в списке «100 величайших певцов и певиц всех времён»."},{"page_url":"https://de.wikipedia.org/wiki/Flagge_der_Erde","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/1worldflag-transparent.png","page_title":"Flagge der Erde","context_page_description":"Die Flagge der Erde ist eine Flagge, die dazu dienen soll, die gesamte Erde zu repräsentieren. Konzepte zu diesem Thema beinhalten politische, spirituelle und umweltthematische Aspekte des Planeten. Auch wenn keine international anerkannte Flagge für den gesamten Planeten existiert, haben Einzelpersonen und Organisationen verschiedene Entwürfe vorgestellt.\\nBis heute hat keine Flagge eine offizielle Bestätigung durch eine staatliche Stelle erhalten. Die bekanntesten, mit der Erde verbundenen, Flaggen sind die „Earth Day Flag“ und die Flagge der Vereinten Nationen. Hier aufgelistet sind die inoffiziellen Bewerber für eine mögliche Flagge der Erde."},{"page_url":"https://vi.wikipedia.org/wiki/N%E1%BA%A5m_th%C3%B4ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Boletus_edulis_444.jpg","page_title":"Nấm thông","context_page_description":"Nấm thông là một loại nấm ăn được trong chi Nấm thông, họ Nấm thông. Phân bố rộng rãi ở bán cầu Bắc trên khắp châu Âu, châu Á và Bắc Mỹ, nó không hiện diện một cách tự nhiên ở Nam bán cầu, mặc dù nó đã được du nhập tới miền nam châu Phi, Australia và New Zealand. Một vài loại nấm châu Âu có quan hệ họ hàng gần trước đây từng được cho là các thứ hoặc dạng của nấm thông đã được chứng minh bằng cách sử dụng phân tích phát sinh chủng loài phân tử cho thấy chúng là các loài riêng biệt, và những loại khác trong phân loại trước đây là các loài riêng biệt thì hiện nay lại là cùng loài với nấm thông. Loài ở miền tây Bắc Mỹ thường được gọi là nấm thông vua California là một biến thể lớn, sẫm màu hơn, lần đầu tiên chính thức được xác định trong năm 2007."},{"page_url":"https://pl.wikipedia.org/wiki/Pche%C5%82ki_ziemne","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/SystenaBlanda_0757.JPG","page_title":"Pchełki ziemne","context_page_description":"Pchełki ziemne, pchełkowate, płeszki – podrodzina lub plemię chrząszczy z podrzędu wielożernych i rodziny stonkowatych. Obejmuje około 8 tysięcy gatunków. Charakteryzują się obecnością w tylnych, zwykle powiększonych udach aparatu Maulika, który umożliwia im skakanie. Większość to fitofagi. Należy tu wiele szkodników roślin uprawnych."},{"page_url":"https://it.wikipedia.org/wiki/Karin_Balzer","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Bundesarchiv_Bild_183-B1002-0014-001%2C_Karin_Balzer.jpg","page_title":"Karin Balzer","context_page_description":"Karin Richert-Balzer è stata un'ostacolista tedesca, campionessa olimpica degli 80 metri ostacoli a Tokyo 1964."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Seine-sur-Vingeanne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/2012-aout-10269-Chateau-a-Sainte-Seine-sur-Vingeanne.jpg","page_title":"Saint-Seine-sur-Vingeanne","context_page_description":"Saint-Seine-sur-Vingeanne est une commune française située dans le département de la Côte-d'Or en région Bourgogne-Franche-Comté."},{"page_url":"https://es.wikipedia.org/wiki/Horas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Kersting_-_Apoll_mit_den_Stunden.jpg","page_title":"Horas","context_page_description":"En la mitología griega, las Horas eran originalmente las personificaciones o diosas del orden de la naturaleza y de las estaciones, si bien posteriormente fueron consideradas como diosas del orden en general y de la justicia.\\nSuelen, pues, distinguirse dos «generaciones» principales."},{"page_url":"https://en.wikipedia.org/wiki/Henrik_Larsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Henrik_Larsson_in_Jan_2014.jpg","page_title":"Henrik Larsson","context_page_description":"Henrik Edward Larsson is a Swedish professional football manager and former player, who currently serves as an assistant manager of Barcelona. Playing as a striker, Larsson began his career with Högaborgs BK. In 1992, he moved to Helsingborg IF where in his first season his partnership up front with Mats Magnusson helped the club win promotion to Allsvenskan after 24 seasons in the lower tiers. He moved to Feyenoord in November 1993, staying for four years before leaving in 1997. During his time in the Dutch Eredivisie, he won two KNVB Cups with Feyenoord. He also broke into the Swedish national football team, and helped them finish in third place at the 1994 World Cup.\\nWim Jansen signed Larsson for Scottish club Celtic in July 1997 for a fee of £650,000. In his first season at the club, he played a crucial role in stopping Rangers winning a 10th league title in a row. However, he suffered a broken leg in a UEFA Cup tie against Lyon in 1999. Despite this setback, Larsson came back stronger, netting 53 goals in a 2000–01 season that saw him claim the European Golden Shoe. Larsson went on to win four league titles in his seven years at Celtic."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%90%D1%81%D1%84%D0%B0%D0%BB%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Bitumen.jpg","page_title":"Асфалт","context_page_description":"Асфалт, познат и како битумен — леплива, црна и високо вискозна течност или полуцврста форма на нафта. Може да се пронајде во природни депозити или може да биде рафиниран производ; тоа е супстанца класифицирана како пек. Сè до 20 век се користел и зборот асфалтум. Зборот доаѓа од старогрчкиот збор „асфалтос“.\\nПримарната употреба на асфалт / битумен е во изградба на патишта, каде што се користи како лепак или врзивно средство и се меша со агрегат да се создаде асфалт бетон. Други нејзини главни цели се за битуменски ленти, вклучувајќи производство на кровови и за запечатување на рамни покриви.\\nТермините асфалт и битумен често се користат наизменично за да значат и природни и произведени форми на супстанцијата. Во американскиот англиски, асфалт е внимателно рафиниранираните остатоци од процесот на дестилација на одбрана сурова нафта. Надвор од САД, производот често се нарекува битумен. Геолозите често го преферираат терминот битумен. Честа употреба се однесува на различни форми на асфалт / битумен како \\"катран\\", како што во катран јамите во Ла Бреа. Друг архаичен израз за асфалт / битумен е \\"пек\\".\\nПриродниот асфалт / битумен понекогаш е наведен со терминот \\"суров битумен\\"."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E5%AE%81%E8%BD%A8%E9%81%93%E4%BA%A4%E9%80%9A1%E5%8F%B7%E7%BA%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/%E5%8D%97%E5%AE%81%E5%9C%B0%E9%93%81%E5%8D%97%E8%81%8C%E9%99%A2%E7%AB%99.jpg","page_title":"南宁轨道交通1号线","context_page_description":"南宁轨道交通1号线，又称南宁地铁1号线，标志色为青秀绿。该线西起石埠站，东至火车东站，大致呈东西走向，全长32.1公里，全线设于地下，总共有25座站台，是南宁轨道交通第一条建设的线路。"},{"page_url":"https://pt.wikipedia.org/wiki/Porsche","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Porsche_Traktor_Diesel_Super.jpg","page_title":"Porsche","context_page_description":"Dr. Ing. h.c. F. Porsche AG, geralmente abreviado para Porsche AG, ou somente Porsche, é uma das principais marcas de automóveis esportivos do mundo, criada na Áustria e, hoje, sediada em Stuttgart, Alemanha."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9D%AD%E5%B7%9E%E4%B8%9C%E7%AB%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Old_Hangzhou_East_Railway_Station_in_2008.jpg","page_title":"杭州东站","context_page_description":"杭州東站位於中國浙江省杭州市江干區天城路，為上海局集團杭州站管轄的車站。經過鐵路有滬昆鐵路、滬昆客運專線、杭甬客運專線、寧杭客運專線，以及規劃中的滬杭磁懸浮。該站始建於1992年，2010年開始改造重建，新站房於2013年7月1日開通啟用，成為亞洲最大鐵路車站之一。"},{"page_url":"https://de.wikipedia.org/wiki/Christuskirche_(Ibbenb%C3%BCren)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Christuskirche_Ibbenb%C3%BCren_Kirchhof.JPG","page_title":"Christuskirche (Ibbenbüren)","context_page_description":"Die Christuskirche Ibbenbüren ist eine evangelische Kirche in der Innenstadt von Ibbenbüren. Sie wurde 1523 bis 1533 im spätgotischen Stil errichtet. Die Christusgemeinde ist eine der größten evangelischen Gemeinden im Tecklenburger Land."},{"page_url":"https://cs.wikipedia.org/wiki/Velk%C3%A1_Fatra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Pinus_sylvestris_Beskid_%C5%BBywiecki.JPG","page_title":"Velká Fatra","context_page_description":"Velká Fatra je pohoří na středním Slovensku. V pohoří byl roku 2002 vyhlášen národní park."},{"page_url":"https://ms.wikipedia.org/wiki/Kucing_bulu_pendek_Amerika","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/14_years_old_american_shorthair.jpg","page_title":"Kucing bulu pendek Amerika","context_page_description":"Kucing bulu pendek Amerika ialah satu baka kucing bela jinak yang dipercayai diturunkan daripada kucing-kucing Eropah yang dibawa ke Amerika Utara oleh peneroka awal untuk melindungi kargo berharga daripada mencit dan tikus. Menurut Cat Fancier's Association, pada 2012, ia baka kucing ke-7 paling popular di Amerika Syarikat."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%A4%D7%99%D7%A0%D7%95%D7%AA_%D7%A1%D7%A2%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/FelixMaryChristinAmiot.jpg","page_title":"ספינות סער","context_page_description":"ספינות סער הן שם כולל לתוכנית בניין הכוח הימי של חיל הים הישראלי שראשיתה בשנות ה-60 של המאה ה-20. תוכנית זו הביאה לניצחונו של החיל במלחמת יום הכיפורים ולחיזוק עוצמתו. מטרת התוכנית הייתה יצירת כוח ימי שיאפשר יוזמה התקפית בזירה הימית, ולא יסתפק בהגנת החוף. מעבר לכך, את התוכנית ייחדה שבירת מוסכמות בלחימה בתחום הימי, על ידי יצירת עדיפות טכנולוגית של יחידת הלחימה ועדיפות כמותית ביחידות לחימה בתקציב מועט.\\nהתוכנית נבנתה על ידי אנשי חיל הים והתעשייה הביטחונית הישראלית בשיתוף פעולה להביא מענה לצורכי הביטחון של ישראל בים תוך שימוש בטכנולוגיה מתקדמת. נכונות התפיסה הוכחה מבצעית במלחמת יום הכיפורים."},{"page_url":"https://de.wikipedia.org/wiki/St_Kilda_Football_Club","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Etihad_Stadium_crop.jpg","page_title":"St Kilda Football Club","context_page_description":"Der St. Kilda Football Club ist ein Australian Football Team aus Melbourne. Der Klub spielt in der Australian Football League, der höchsten Liga dieser Sportart in Australien. Die Saints spielen seit dem Jahr 2000 im Etihad Stadium welches 56.000 Zuschauer fasst. Die Vereinsfarben sind rot, schwarz und weiß."},{"page_url":"https://nl.wikipedia.org/wiki/Zdzieszowice","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Zdzieszowice_koksownia.jpg","page_title":"Zdzieszowice","context_page_description":"Zdzieszowice is een stad in het Poolse woiwodschap Opole, gelegen in de powiat Krapkowicki. De oppervlakte bedraagt 12,35 km², het inwonertal 13.467."},{"page_url":"https://it.wikipedia.org/wiki/Hrvatska_kopnena_vojska","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Antitank_missile_system_Metis-M1.jpg","page_title":"Hrvatska kopnena vojska","context_page_description":"Lo Hrvatska kopnena vojska, è l'attuale esercito della Croazia e parte integrante delle Forze armate della Repubblica di Croazia.\\nIl ruolo fondamentale e lo scopo della dell'esercito è quello di proteggere gli interessi nazionali vitali della Repubblica di Croazia e difendere la sovranità e l'integrità territoriale dello Stato.\\nI compiti fondamentali dell'esercito croato sono i seguenti:\\nmantenere un livello di prontezza ottimale al combattimento\\ncombattere le forze principali di un possibile aggressore sul piano strategico-operativo e difendersi da possibili assalti terrestri, aerei e anfibi\\nevitare che, in collaborazione con gli altri rami delle Forze Armate, un aggressore svolga operazioni militari all'interno del territorio croato\\nacquisire e sviluppare le capacità di rispondere alle richieste di attività necessarie non tradizionali dell'esercito\\nassistere i suoi alleati e paesi amici nel momento del bisogno."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B0%D0%BD_%D0%9C%D0%B0%D0%BA%D0%BB%D0%B0%D1%85%D0%BB%D0%B0%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Maclachlan_tartan_%28T._Smibert%29.png","page_title":"Клан Маклахлан","context_page_description":"Клан Маклахлан — він же: клан Лахлан — один з кланів гірської Шотландії. Володів землями Страхлахлан біля озера Лох-Файн, в Аргайлі, на західному узбережжі Шотландії. Історичні переказна клану стверджують, що клан походить від Лахлана Мора, що жив на берегах озера Лох-Файн у ХІІІ столітті і саме від місцевість де він проживав отримала назву Страхлахлан. На його честь називається замок Лахлан та затока Лахлан. Згідно історичних переказів Лахлан Мор походить з ірландської королівської династії О'Ніл — від Антрохана О'Нейлла — сина Флайхбертаха О'Нейлла — короля Айлеха, що належав до клану Кенел н-Еогайн. Флайхбертах помер у 1036 році. Клан Маклахлан пов'язаний родинними зв'язками з кланами Ламонт, Івен Оттер, МакНіл Барра, МакСвін — всі ці клани походять від Антрохана О'Ніла, що залишив Ірландію і переселився до Шотландії в ХІ столітті. Предком королівської династії О'Нілів був верховний король Ірландії Ніл Дев'яти Заручників 368—395 роки правління.\\nКлан брав участь у повстаннях якобітів у XVIII столітті, був прихильником Стюартів у їх боротьбі за трон королів Шотландії і незалежність Шотландії. XVII вождь клану Маклахлан загинув у битві під Куллоден у 1746 році."},{"page_url":"https://sv.wikipedia.org/wiki/Yngve_Larsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Constructing_the_Stockholm_Metro_in_1957.jpg","page_title":"Yngve Larsson","context_page_description":"Gustaf Richard Yngve Larsson, född 13 december 1881 i Sundsvall, död 16 december 1977 i Stockholm, var en svensk statsvetare, politiker, borgarråd, riksdagsledamot och ordförande för Stockholms stadskollegium.\\nYngve Larsson avlade filosofie kandidatexamen i Uppsala och fortsatte statsvetenskapliga studier utomlands med inriktning mot kommunalpolitik. Från 1908 var Larsson en ledande kraft bakom Svenska stadsförbundets tidiga utveckling, och 1913 disputerade han för filosofie doktorsgrad på Inkorporeringsproblemet. Han var ursprungligen aktiv socialdemokrat, men uteslöts ur partiet av Hjalmar Branting på grund av sitt deltagande i Aktivistboken 1915. Larsson involverades som expert i Stockholms författningsreform och utsågs 1920 till stadssekreterare i Stockholms stad.\\nLarsson valdes till borgarråd i Stockholm 1924 och kvarstod i 22 år till 1946, från 1935 på det nya Folkpartiets mandat."},{"page_url":"https://gl.wikipedia.org/wiki/Ep%C3%ADfito","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Tillandsia_cyanea1.jpg","page_title":"Epífito","context_page_description":"Epífito refírese ao vexetal que sen ser parasito vive sobre a superficie doutros vexetais, coma os fentos, mofos, liques, etc. Logo, non extraen do vexetal hóspede o seu nutrimento, senón que só se apoian nelas. O epifitismo é común nas forestas tropicais, onde a competencia por luz e espazo non permite que plantas herbáceas prosperen sobre o chan. Deste xeito, certas especies que conseguían xerminar sobre a casca das árbores, por riba do chan, foron seleccionadas, e hoxe encóntranse milleiros de especies con hábito epífito.\\nPor extensión, tamén se denomina epífito ao parasito vexetal que se localiza en superficies animais."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Germans_in_Poland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/POL_Kaczyce_Ko%C5%9Bci%C3%B3%C5%82_Podwy%C5%BCszenia_Krzy%C5%BCa_%C5%9Awi%C4%99tego_2.JPG","page_title":"History of Germans in Poland","context_page_description":"The history of Germans in Poland dates back almost a millennium.\\nPoland was at one point the largest kingdom in Europe; it was also Europe's most multiethnic state during the medieval period.\\nIt covered an immense plain with no natural boundaries, with a thinly scattered population of many ethnic groups, including the Poles themselves, Germans in the cities of West Prussia, and Ruthenians in Lithuania. 5-10% of immigrants were German settlers.\\nThe Polish princes granted the Germans in the cities complete autonomy according to the \\"Teutonic right\\", modeled on the laws of the cities of ancient Rome. In this way, cities emerged of the German-Western European medieval type. Before the 13th century ended, around one hundred Polish towns had been transformed into Magdeburg-style municipal institutions. The governing classes in these towns were increasingly German and German-speaking. At the synod of Łęczyca in 1285, Archbishop Jakub Świnka of Gniezno warned that Poland might become a \\"new Saxony\\" if German negligence for Polish language, customs, clergy and ordinary people went unchecked."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%8A%D9%85%D8%B3_%DA%A4%D9%89._%D8%B3%D9%8A%D9%84%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/James_V._Selna_District_Judge.jpg","page_title":"چيمس ڤى. سيلنا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nچيمس ڤى. سيلنا محامى من امريكا."},{"page_url":"https://en.wikipedia.org/wiki/Coordination_(linguistics)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Layered_analysis_of_coordinate_structures.jpg","page_title":"Coordination (linguistics)","context_page_description":"In linguistics, coordination is a complex syntactic structure that links together two or more elements; these elements are called conjuncts or conjoins. The presence of coordination is often signaled by the appearance of a coordinator, e.g. and, or, but. The totality of coordinator and conjuncts forming an instance of coordination is called a coordinate structure. The unique properties of coordinate structures have motivated theoretical syntax to draw a broad distinction between coordination and subordination. It is also one of the many constituency tests in Linguistics. Coordination is one of the most studied fields in theoretical syntax, but despite decades of intensive examination, theoretical accounts differ significantly and there is no consensus on the best analysis."},{"page_url":"https://nl.wikipedia.org/wiki/Stilleven_met_kazen,_amandelen_en_krakelingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Clara_Peeters_-_Still_Life_with_Cheeses%2C_Almonds_and_Pretzels_-_detail_with_portrait_of_the_painter.jpg","page_title":"Stilleven met kazen, amandelen en krakelingen","context_page_description":"Stilleven met kazen, amandelen en krakelingen is een schilderij van de Zuid-Nederlandse Clara Peeters. Het werd waarschijnlijk circa 1615 geschilderd. Het schilderij is een stilleven, geschilderd met olieverf op een paneel, 34,5 cm hoog en 49,5 cm breed. Peeters heeft haar werk gesigneerd in het heft van het mes. Het behoort sinds 2012 tot de collectie van het Mauritshuis in Den Haag."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%84%D8%A8%D8%AA%D9%88%D9%86_(%D9%83%D8%A7%D9%85%D8%A8%D8%B1%D9%8A%D8%AF%D8%AC%D8%B4%D9%8A%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Clopton_1847.jpg","page_title":"كلبتون (كامبريدجشير)","context_page_description":"كلبتون ‏ هي قرية تقع في المملكة المتحدة في كامبريدجشير."},{"page_url":"https://fi.wikipedia.org/wiki/PubMed","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/US-NLM-PubMed-Logo.svg","page_title":"PubMed","context_page_description":"PubMed on hakukone ja viitetietokanta, jota ylläpitää Yhdysvaltain terveysviraston ja Yhdysvaltain kansallisen lääketieteellisen kirjaston alaisuudessa toimiva National Center for Biotechnology Information. Tietokanta koostuu yli 25 miljoonasta viitteestä kattaen biolääketieteelliseen MEDLINE-viitetietokannan ja noin 7 000 biotieteellistä julkaisua sekä elektronisia teoksia. PubMed-tietokannassa ei ole kokonaisia artikkeleita, mutta viitetiedot saattavat sisältää linkin esimerkiksi julkaisijan verkkosivuilla luettavissa olevaan tekstiin.\\nPubMed julkaistiin vuonna 1996 Entrez-hakuohjelman yhteydessä. Vuonna 2020 PubMedillä oli noin kaksi miljoonaa päivittäistä käyttäjää.\\nPubMediä ei pidä sekoittaa NCBI:n PubMed Central -tietokantaan, joka sisältää pelkkien viitetietojen sijaan kokonaisia biotieteellisiä artikkeleita."},{"page_url":"https://fr.wikipedia.org/wiki/Leonie_van_Bladel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Leonie_van_Bladel_%281979%29.jpg","page_title":"Leonie van Bladel","context_page_description":"Leonie Godefrieda Louisa van Bladel, née le 22 juin 1939 à Utrecht, est une femme politique et journaliste néerlandaise.\\nMembre du Parti travailliste, elle siège au Parlement européen de 1994 à 1999."},{"page_url":"https://en.wikipedia.org/wiki/Warren_Davidson","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Warren_Davidson_Congressional_Portrait_ca2017.jpg","page_title":"Warren Davidson","context_page_description":"Warren Earl Davidson is an American politician and former military officer serving as U.S. Representative for Ohio’s 8th Congressional District since 2016. Prior to political office he was an officer in United States Army Special Operations and led his family’s manufacturing business. Davidson is a member of the Republican Party."},{"page_url":"https://en.wikipedia.org/wiki/Huitzilopochtli","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Huitzilopochtli_V.png","page_title":"Huitzilopochtli","context_page_description":"In the Aztec religion, Huitzilopochtli is a deity of war, sun, human sacrifice, and the patron of the city of Tenochtitlan. He was also the national god of the Mexicas, also known as Aztecs, of Tenochtitlan. Many in the pantheon of deities of the Aztecs were inclined to have a fondness for a particular aspect of warfare. However, Huitzilopochtli was known as the primary god of war in ancient Mexico. Since he was the patron god of the Mexica, he was credited with both the victories and defeats that the Mexica people had on the battlefield. The people had to make sacrifices to him to protect the Aztec from infinite night. He wielded Xiuhcoatl as a weapon, associating him with fire.\\nAs noted by the Spaniards during their discovery and conquest of Mexico, human sacrifice was common in worship ceremonies, which took place frequently and in numerous temples throughout the region, and when performed they typically sacrificed multiple victims per day at a given temple."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%82%BF%E3%83%91%E3%83%AB%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/USS_Missouri_recovers_its_Vought_OS2U_Kingfisher_aircraft.jpg","page_title":"カタパルト","context_page_description":"カタパルト は、艦艇などから航空機を射出するための機械である。また宇宙船やロボットなどを射出する装置もカタパルトと呼ばれる。射出機とも呼ばれる。また、地上から滑走路を使わずに離陸する場合に使われる、動力つきの発射台もカタパルトと呼ばれ、世界初の動力有人機ライトフライヤー号も、杭打ちやぐらとカウンターウエイトの組み合わせで機体を撃ち出すカタパルトを用いて飛行に成功している。"},{"page_url":"https://la.wikipedia.org/wiki/Moscus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Moscow_05-2017_img13_Krymsky_Bridge.jpg","page_title":"Moscus","context_page_description":"Moscus seu Moscha vel Moscua, vulgo Moskva seu Moskva-reka, fluvius est in medio partis Europaeae Russiae, per regionem Moscuensem, urbem dignitatis foederalis Moscuam atque regionem Smolenscensem Foederationis Russicae fluens et in Occam influens. Circiter 502 chiliometra patet. Ad Moscum sunt urbes Mosaiscum, Moscua, Columna, etc. In Moscua urbe aqua Volgana per canalem Moscuae acta suppletur et plenior fit, quam naturaliter erat."},{"page_url":"https://cs.wikipedia.org/wiki/Karolinka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Karolinka%2C_p%C5%99ehrada_-_panoramio.jpg","page_title":"Karolinka","context_page_description":"Karolinka je město v okrese Vsetín ve Zlínském kraji, 18 km východně od Vsetína v údolí Vsetínské Bečvy. Žije zde přibližně 2 500 obyvatel."},{"page_url":"https://en.wikipedia.org/wiki/Mount_San_Antonio","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Mount_San_Antonio_%28Mount_Baldy%29%2C_California.jpg","page_title":"Mount San Antonio","context_page_description":"Mount San Antonio, colloquially referred to as Mount Baldy or Old Baldy, is a 10,066 ft peak in the San Gabriel Mountains in Los Angeles County, California. Lying within the San Gabriel Mountains National Monument and Angeles National Forest, it is the high point of the range, the county, and the Los Angeles metropolitan area. Mount San Antonio's sometimes snow-capped peaks are visible on clear days and dominate the view of the Los Angeles Basin skyline. The peak is pyramid shaped, with a steep south face and a shallower north face. The summit is accessible via a number of connecting ridges along hiking trails from the north, east, south and southwest."},{"page_url":"https://tr.wikipedia.org/wiki/A_Coru%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Coru%C3%B1a_GDFL2005_10.JPG","page_title":"A Coruña","context_page_description":"A Coruña İspanya'nın özerk bölgelerinden biri olan Galiçya'nın kuzeybatısında bulunan A Coruña ili'ne bağlı belediye ve ilin başkenti. A Coruña 16.-19. yüzyıllar döneminde Galiçya Krallığı siyasi merkezi olmuş ve 1833 ile 1982'de de Galiçya bölgesel merkezi olmuştu. 1982'de Galiçya Özerk Topluluğu kurulduğu zaman başkentlik için Santiago de Compostela seçilmiştir.\\nA Coruña'da bulunan Herkül Kulesi adı verilen deniz feneri UNESCO Dünya Mirasları İspanya listesine 2009'dan itibaren dahil edilmiştir."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B8%E0%A4%BF%E0%A4%B0%E0%A4%AA%E0%A5%81%E0%A4%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Sirpur8.JPG","page_title":"सिरपुर","context_page_description":"सिरपुर छत्तीसगढ़ में महानदी के तट स्थित एक पुरातात्विक स्थल है। इस स्थान का प्राचीन नाम श्रीपुर है यह एक विशाल नगर हुआ करता था तथा यह दक्षिण कोशल की राजधानी थी। सोमवंशी नरेशों ने यहाँ पर राम मंदिर और लक्ष्मण मंदिर का निर्माण करवाया था। ईंटों से बना हुआ प्राचीन लक्ष्मण मंदिर आज भी यहाँ का दर्शनीय स्थान है। उत्खनन में यहाँ पर प्राचीन बौद्ध मठ भी पाये गये हैं। सिरपुर पर सर्वाधिक लेेख छ ग के ही पुरातात्विक यात्री रमेश कुमार वर्मा ने लिखे हैं जिसमें इस जगह के मन्दिर का विशेष वर्णन है ।"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Burgen_(Mosel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Burgen%2C_Marktstra%C3%9Fe_6.jpg","page_title":"Liste der Kulturdenkmäler in Burgen (Mosel)","context_page_description":"In der Liste der Kulturdenkmäler in Burgen sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Burgen aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://it.wikipedia.org/wiki/FIFA_Confederations_Cup_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Est%C3%A1dio_Nacional_de_Bras%C3%ADlia.JPG","page_title":"FIFA Confederations Cup 2013","context_page_description":"La FIFA Confederations Cup 2013 è stata la 9ª edizione della Coppa delle confederazioni organizzata dalla FIFA. Si è svolta in Brasile dal 15 al 30 giugno 2013 ed è stata un'anticipazione del campionato mondiale di calcio 2014. La mascotte, usata anche per il mondiale 2014, è stata Fuleco, un armadillo brasiliano che, quando è in pericolo, si richiude a forma di palla.\\nÈ stata la prima competizione per Nazionali maggiori a sperimentare l'uso della goal-line technology per gli episodi di gol fantasma, dopo che la FIFA ha approvato il sistema sviluppato dall'azienda tedesca GoalControl.\\nLa coppa è stata vinta dal Brasile, che ha sconfitto in finale la Spagna per 3-0 ed ha centrato così la sua quarta affermazione nella competizione, la terza consecutiva dopo quelle del 2005 e del 2009."},{"page_url":"https://de.wikipedia.org/wiki/Matra","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Renault_Avantime_registered_February_2003_1998cc.JPG","page_title":"Matra","context_page_description":"Mécanique Avion TRAction, kurz Matra, war ein im Jahr 1941, während der deutschen Besatzungszeit, gegründetes französisches Unternehmen mit einem weitreichenden Tätigkeitsbereich, zunächst in den Bereichen Flugzeug- und Rüstungsbau sowie der Kunststoffverarbeitung."},{"page_url":"https://sk.wikipedia.org/wiki/%C5%BDebr%C3%A1k","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/%C5%BDebr%C3%A1k_znak.png","page_title":"Žebrák","context_page_description":"Žebrák je mesto v Česku v okrese Beroun v Stredočeskom kraji. 1. januára 2012 tu žilo 2 139 obyvateľov, z toho 1 048 mužov a 1 091 žien, pričom priemerný vek v meste bol 40,9 roka."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Landsberg_am_Lech","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Hinterer_Anger_316_Landsberg-1.jpg","page_title":"Liste der Baudenkmäler in Landsberg am Lech","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Großen Kreisstadt Landsberg am Lech zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://en.wikipedia.org/wiki/Fritz_Steinhoff","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Bundesarchiv_Fritz_Steinhoff.jpg","page_title":"Fritz Steinhoff","context_page_description":"Fritz Steinhoff was a German politician of the SPD. He was the third Minister President of the state of North Rhine-Westphalia from 1956 until 1958."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D0%B0%D0%B1%D0%B8%D0%BE_%D0%A1%D0%B8%D0%BC%D0%BF%D0%BB%D0%B8%D1%81%D0%B8%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Fabio_Simplicio.jpg","page_title":"Фабио Симплисио","context_page_description":"Фабио Симплисио бивши је бразилски фудбалер."},{"page_url":"https://en.wikipedia.org/wiki/Clarence_C._Caldwell","image_url":"https://upload.wikimedia.org/wikipedia/en/b/b5/Clarence_Caldwell%2C_9th_Attorney_General_of_South_Dakota.jpg","page_title":"Clarence C. Caldwell","context_page_description":"Clarence C. Caldwell was an American attorney and the 9th Attorney General of South Dakota."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%96%E7%95%8C%E6%9C%80%E5%A4%A7%E3%81%AE%E3%82%B7%E3%83%A7%E3%83%83%E3%83%94%E3%83%B3%E3%82%B0%E3%83%A2%E3%83%BC%E3%83%AB%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/West_eMall.jpg","page_title":"世界最大のショッピングモール一覧","context_page_description":"本項では総賃貸面積に基づく世界最大級のショッピングモールを列挙する。"},{"page_url":"https://pl.wikipedia.org/wiki/Ubuntu","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Ubuntu_5.10.JPG","page_title":"Ubuntu","context_page_description":"Ubuntu – kompletna dystrybucja systemu operacyjnego GNU/Linux, przeznaczona głównie do zastosowań biurowych i domowych. Powstała również wersja serwerowa oraz na netbooki. Rozwój tej ostatniej zakończył się w 2011 roku, gdyż zdecydowano o połączeniu wydań dla komputerów biurowych i domowych z wersją dla netbooków, jednocześnie dodając nową powłokę graficzną – Unity – będącą nakładką na popularnego GNOME.\\nUbuntu opiera się na dystrybucji Debian i jest rozwijane na serwisie Launchpad. Projekt sponsorowany jest przez przedsiębiorstwo Marka Shuttlewortha Canonical Ltd. oraz Ubuntu Foundation. Według sondaży online w 2012 Ubuntu był najpopularniejszą dystrybucją GNU/Linuksa na komputerach osobistych. Jednak Ubuntu jest również popularne na serwerach i w chmurze. Ubuntu wydawane jest w regularnych, sześciomiesięcznych odstępach czasowych.\\nSłowo ubuntu pochodzi z języków plemion Zulu i Xhosa zamieszkujących południową Afrykę i oznacza „człowieczeństwo wobec innych”. Głównym celem dystrybucji jest dostarczenie użytkownikom domowym kompletnego, otwartego systemu, który będzie łatwy w obsłudze oraz jednocześnie stabilny, niezawodny i nowoczesny."},{"page_url":"https://eo.wikipedia.org/wiki/Funebra_arto","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Sejong_tomb_1.jpg","page_title":"Funebra arto","context_page_description":"Funebra arto estas ajna artaĵo formanta, aŭ lokita en, ripozejo por la restoj de mortinto, ĉefa grava. La termino ankaŭ enhavas cenotafojn, tombecajn monumentojn kiuj ne enhavas homajn restojn; kaj komunajn memormonumentojn al mortintoj, kiuj povas enhavi aŭ ne homajn restojn."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%AB%D5%B6%D5%B9%D6%87_1000_%D5%A9%D5%BE%D5%A1%D5%AF%D5%A1%D5%B6%D5%A8_%D5%BF%D5%A5%D5%B2%D5%AB_%D5%B8%D6%82%D5%B6%D5%A5%D6%81%D5%A1%D5%AE_%D5%BA%D5%A1%D5%BF%D5%A5%D6%80%D5%A1%D5%A6%D5%B4%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Neo-Babylonian_Empire.png","page_title":"Մինչև 1000 թվականը տեղի ունեցած պատերազմների ցանկ","context_page_description":"Մինչև 1000 թվականը տեղի ունեցած պատերազմների ցանկ:"},{"page_url":"https://de.wikipedia.org/wiki/Delta_Amacuro","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Curiapolandschaft.jpg","page_title":"Delta Amacuro","context_page_description":"Delta Amacuro ist ein Bundesstaat Venezuelas; er liegt im Nordosten des Landes. Seine Hauptstadt ist Tucupita. Hier mündet der Orinoco in den Atlantik. Vor seiner Küste liegt die Insel Trinidad. Die Durchschnittstemperatur beträgt 26,7 °C. Die Niederschlagsmenge liegt zwischen 900 und 2.500 mm pro Jahr. Gouverneurin des Bundesstaates ist seit 2008 Lizeta Hernández. Ihre Amtszeit beträgt vier Jahre."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_des_Lyonnais","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/%C3%89cole_rue_des_Lyonnais.JPG","page_title":"Rue des Lyonnais","context_page_description":"La rue des Lyonnais est une voie située dans le 5ᵉ arrondissement de Paris dans le quartier du Val-de-Grâce."},{"page_url":"https://es.wikipedia.org/wiki/Chlorocichla_laetissima","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Joyful_Greenbul_-_Kakamega_Kenya_06_1593_%2816844634377%29.jpg","page_title":"Chlorocichla laetissima","context_page_description":"El bulbul alegre ​ es una especie de ave paseriforme de la familia Pycnonotidae endémica de las montañas de la región de los Grandes Lagos de África.​"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B1%D8%B4%D8%AF%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Princess_Mary%2C_Girl_Guides%2C_1922.jpg","page_title":"مرشدات","context_page_description":"مرشدات وفتيات الكشافة حركات مشابهة للكشافة في الأصل، والتي لا تزال إلى حد كبير، بالنسبة للفتيات والنساء فقط. تطورت في عام 1909 من الفتيات الذين يرغبون في المشاركة في الحركة الكشفية لأماكن الصبيان الوحيد مختلفة في جميع أنحاء العالم، والحركة تطورت بطرق متنوعة. في بعض الأماكن، وحاولت الفتيات للانضمام إلى المنظمات الكشفية وتقرر أن المنظمات أحد الجنسين هي من أفضل الكشافة أماكن أخرى، \\"وبدأت جماعات، وبعض منهم في وقت لاحق إلى الانفتاح على الأولاد أو الاندماج مع البنين المنظمات. وفي حالات أخرى، تشكلت مجموعات مختلطة، وأحيانا إلى انقسام في وقت لاحق. وبنفس الطريقة، تم استخدام اسم المرشدات أو فتيات الكشافة من قبل الجماعات في أوقات مختلفة وفي أماكن مختلفة، مع بعض الجماعات تغير من واحد إلى آخر."},{"page_url":"https://de.wikipedia.org/wiki/1944","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/G%C3%BCnter_Netzer.jpg","page_title":"1944","context_page_description":"Das Jahr 1944 ist von der Eröffnung der „Zweiten Front“ in Westeuropa im Zweiten Weltkrieg gegen das Deutsche Reich und schweren Niederlagen der Wehrmacht an der Ostfront geprägt. Der Luftkrieg über Europa intensiviert sich weiter, wobei die Alliierten endgültig die Luftherrschaft erringen. Im Pazifikkrieg bereiten die Alliierten die Rückeroberung der Philippinen vor und drängen die Japaner im Zentralpazifik zurück. Sie erobern unter anderem die Marianen, von denen aus sie eine strategische Bomberoffensive gegen die japanischen Hauptinseln eröffnen. Auf alliierten Konferenzen in London, Bretton Woods, Dumbarton Oaks und Moskau wird bereits über die Nachkriegsordnung und die Aufteilung Deutschlands in Besatzungszonen verhandelt."},{"page_url":"https://en.wikipedia.org/wiki/Fat_face","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Austin_Foundry_1838_14_Lines_Ornamented%2C_No._1.jpg","page_title":"Fat face","context_page_description":"In typography, a fat face letterform is a serif typeface or piece of lettering in the Didone or modern style with an extremely bold design. Fat face typefaces appeared in London around 1805-10 and became widely popular; John Lewis describes the fat face as \\"the first real display typeface.\\" While decorated typefaces and lettering styles existed in the past, for instance inline and shadowed forms, the fat faces' extreme design and their issue in very large poster sizes had an immediate impact on display typography in the early nineteenth century. Historian James Mosley describes a fat face as \\"designed like a naval broadside to sock its commercial message by poster to the unconsenting reader at a distance of ten or twenty yards by sheer aggressive weight of heavy metal.\\"\\nThe same style of letters was also widely used executed as custom lettering rather than as a typeface in the nineteenth century, in architecture, on tombstones and on signage. Versions were executed as roman or upright, italics and with designs inside the main bold strokes of the letter, such as a white line, patterns or decorations such as flowers or harvest scenes."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D9%84%D8%A7%D8%B1%D9%86%D8%B3_%D8%A7%D9%89._%D9%85%D9%8A%D9%84%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Clarence_E._Miller_102nd_Congress_1991.jpg","page_title":"كلارنس اى. ميلر","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nكلارنس اى. ميلر كان سياسى من امريكا."},{"page_url":"https://sv.wikipedia.org/wiki/Pierre-Joseph_Thoulier_d%27Olivet","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/L%27abb%C3%A9_d%27Olivet_after_Carle_van_Loo.jpg","page_title":"Pierre-Joseph Thoulier d'Olivet","context_page_description":"Pierre-Joseph Thoulier d'Olivet, född 1 april 1682, död 8 oktober 1768, var en fransk filolog.\\nOlivet vann som berömmelse som intresserad ledamot av Franska akademien vars Dictionnaire de l'Académie française ha redigerade 3:e upplagan av och vars historia 1653-1729 han skrev. Bland Olivets övriga arbeten märks Essais de grammaire och Traité des participes."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Neustadt-Glewe","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Breitscheidstra%C3%9Fe_33_Neustadt-Glewe.jpg","page_title":"Liste der Baudenkmale in Neustadt-Glewe","context_page_description":"In der Liste der Baudenkmale in Neustadt-Glewe sind alle Baudenkmale der Stadt Neustadt-Glewe und ihrer Ortsteile aufgelistet."},{"page_url":"https://fi.wikipedia.org/wiki/Salak","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Gunung_Salak.jpg","page_title":"Salak","context_page_description":"Salak on 2 211 metriä korkea kerrostulivuori Indonesian Jaavan saaren länsiosissa sijaitsevan Länsi-Jaavan maakunnan länsiosassa. Se on luoteinen osa useiden rapautuneiden tulivuorten ketjua. Vuori purkautui viimeksi vuonna 1938. Vuori sijaitsee noin 65 kilometriä Jakartan Soekarno-Hattan kansainvälinen lentoaseman eteläpuolella.\\nVuori on saanut nimensä salaki-hedelmän mukaan. Salakin ja läheisten vuorien rinteet ovat osa Jaavan suurimpiin kuuluvaa, melko ehjää trooppista sademetsäaluetta, joka 24 kilometriä lounaassa sijaitsevan runsas 1 700 metriä korkean Halimunvuoren kanssa muodostaa 1 133,57 km² laajuisen, osin vaikeapääsyisen Halimun-Salakin kansallispuiston. Alueella sataa runsaasti, keskimäärin 4 000–6 000 mm vuodessa."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B2%94_%EC%A0%84%EA%B8%B0_%EC%98%81%EB%8F%99%EB%B2%95","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Gel_Electro_003.jpg","page_title":"겔 전기 영동법","context_page_description":"겔 전기 영동법은 겔 메트릭스에 전류를 흘려보내 DNA, RNA, 단백질 등을 분리하는 실험 방법이다."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_munic%C3%ADpios_de_Pernambuco","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Ch%C3%A3_de_Alegria.png","page_title":"Lista de municípios de Pernambuco","context_page_description":"Esta é uma lista dos 184 municípios do estado de Pernambuco. O arquipélago Fernando de Noronha não se constitui um município, mas um Distrito Estadual de Pernambuco.\\nPernambuco é uma das 27 unidades federativas do Brasil. Está localizado no centro-leste da região Nordeste e tem como limites os estados da Paraíba, do Ceará, de Alagoas, da Bahia e do Piauí, além de ser banhado pelo oceano Atlântico. Ocupa uma área de 98 311 km². Também faz parte do seu território o arquipélago de Fernando de Noronha. Sua capital é a cidade do Recife.\\nO município mais populoso é o Recife, sede da Região Metropolitana do Recife, seguido em população por Jaboatão dos Guararapes, Olinda e Paulista, que também se encontram na RMR. Outros municípios importantes são Vitória de Santo Antão, na Zona da Mata; Caruaru e Garanhuns, no Agreste; Petrolina, na Região do São Francisco; e Serra Talhada e Arcoverde, no Sertão."},{"page_url":"https://sh.wikipedia.org/wiki/Faulenrost","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Faulenrost_in_DM.png","page_title":"Faulenrost","context_page_description":"Faulenrost je opština u njemačkoj saveznoj državi Meklenburg-Zapadna Pomeranija. Jedno je od 69 opštinskih središta okruga Demin. Prema procjeni iz 2010. u opštini je živjelo 740 stanovnika. Posjeduje regionalnu šifru 13052021."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%94%90%E5%B1%B1%E5%8C%97%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Tangshanbei_Railway_Station_%2820160525092535%29.jpg","page_title":"唐山北站","context_page_description":"唐山北站前称丰润站，位于中国河北省唐山市丰润区，为北京铁路局唐山车务段管辖站，经过铁路有京哈铁路，并有分别通往张唐铁路丰润西站和津山铁路唐山站的联络线。"},{"page_url":"https://simple.wikipedia.org/wiki/Punctuation","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Semicolon.png","page_title":"Punctuation","context_page_description":"Punctuation is the name for marks used in writing text. They are to help understanding and the correct reading. These are some common punctuation marks used in English:\\n. is a period or full stop\\n, is a comma\\n? is a question mark\\n! is an exclamation mark\\n' is an apostrophe or single quote mark\\n\\" is a quotation mark/inverted comma\\n: is a colon\\n; is a semicolon\\n... is an ellipsis mark\\n- is a hyphen\\n– is an en dash\\n— is an em dash\\nare parentheses or curved brackets\\nare brackets or square brackets.\\nThere are other punctuation marks but used less often. Other languages have other marks, such as French using guillemets, « » as quotation marks."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AC%E0%A5%81%E0%A4%A8%E0%A5%8D%E0%A4%B8%E0%A5%87%E0%A4%A8_%E0%A4%AC%E0%A4%B0%E0%A5%8D%E0%A4%A8%E0%A4%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Bunsen_burner.jpg","page_title":"बुन्सेन बर्नर","context_page_description":"बुन्सेन ज्वालक या बुन्सेन बर्नर एक विशेष प्रकार का गैस ज्वालक है। गैस को जलाने से पूर्व इसमें हवा की एक निश्चित मात्रा मिलाने की युक्ति होती है। ऐसा करने के लिए इसमें एक नली रहती हैं, जिसके आधार के पास पार्श्व में हवा आने के लिए छिद्र होते हैं। गैस नीचे की ओर से आती है। यदि गैस और हवा का ठीक अनुपात में मिश्रण हो, तो यह मिश्रण जलने पर तप्त, किंतु ज्योतिहीन तथा निर्धूम ज्वाला देता है। बुंसेन ज्वाला प्राप्त करने के लिए गैस और हवा का, आयतन के अनुसार, लगभग 3: 1 का अनुपात होना चाहिए। इस प्रकार की ज्वाला के भीतरी निचले क्षेत्र में जलवाष्प, कार्बन मॉनोक्साइड, नाइट्रोजन, कार्बन डाइऑक्साइड तथा हाइड्रोजन का मिश्रण रहता है। ज्वाला के वाह्य दहन क्षेत्र में गैस और नाइट्रोजन पहुँचती है। गैस हवा की अधिक मात्रा के आने पर जल उठती है। ज्वाला और धौंकनी की सहायता से संगलन, अवकरण और ऑक्सीकरण की क्रियाएँ संभव हैं। कुछ धात्विक लवण इस रंगहीन ज्वाला को विशिष्ट रंग देते हैं।\\nइस प्रकार के ज्वालक के आविष्कार का श्रेय बुन्सेन को दिया जाता है, परंतु बाद की खोजों से पता चला है कि इसका वास्तविक डिज़ाइन पीटर डेसगा ने बनाया था और इनसे भी बहुत पूर्व इसी सिद्धांत पर माइकेल फैराडे ने एक समंजनीय गैस ज्वालक बनाया था। बुन्सेन ज्वाला उत्पन्न करने के इस सिद्धांत पर बने आज करोड़ों ज्वालक प्रयोगशालाओं में काम में आ रहे हैं।"},{"page_url":"https://eu.wikipedia.org/wiki/Chinatown_(Manhattan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Chinatown%2C_NYC_%282014%29_-_11.JPG","page_title":"Chinatown (Manhattan)","context_page_description":"Chinatown AEBetako New York hiriko Manhattan barrutian dagoen auzo bat da. Lower Manhattan ermuan dago, Lower East Side ekialdean, Little Italy iparraldean, Civic Center gunea eta Tribeca auzoa mendebaldean dituela.\\nAEBetako txinatar etorkin antzinakoenetakoa eta handienetakoena den komunitatearen bizilekua da, auzoak denera 100.000-90.000 arteko biztanleria du."},{"page_url":"https://fr.wikipedia.org/wiki/%C5%A0olta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/%C5%A0olta_Maslinica_Hrvatska_Hafen_2012_a.jpg","page_title":"Šolta","context_page_description":"Šolta est une île de l'Adriatique et une municipalité de Croatie située en Dalmatie, dans le Comitat de Split-Dalmatie. Au recensement de 2001, la municipalité comptait 1 479 habitants, dont 94,59 % de Croates. L'île est située sur la côte dalmate en face de la ville de Split et fait partie d'un archipel qui comprend notamment à l'est les îles de Brač et de Hvar et à l'Ouest Drvenik. Son nom original vient du grec olyntha, mais il est aussi parfois rapproché du latin Solenta qui signifie l’« Île du Soleil ». L'ancienneté de son peuplement est attestée et l'île accueillit des pêcheries de l'empereur romain Dioclétien alors installé à Split.\\nL'administration de la municipalité siège à Grohote."},{"page_url":"https://hu.wikipedia.org/wiki/Tanit","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Vas_de_Tanit%2C_detall_de_la_deessa%2C_l%27Alc%C3%BAdia%2C_museu_Arqueol%C3%B2gic_i_d%27Hist%C3%B2ria_d%27Elx.jpg","page_title":"Tanit","context_page_description":"Tanit a föníciai-kánaáni Anat istennő nevének egy mellékalakja. Tanit istennőt a régi írók a görög Artemisszel azonosítják."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%AB%E3%82%AF%E3%82%B9%E3%83%BB%E3%83%AA%E3%82%AD%E3%83%8B%E3%82%A6%E3%82%B9%E3%83%BB%E3%82%AF%E3%83%A9%E3%83%83%E3%82%B9%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Maccari-Cicero.jpg","page_title":"マルクス・リキニウス・クラッスス","context_page_description":"マルクス・リキニウス・クラッススは、共和政ローマ時代の政治家、軍人である。第三次奴隷戦争でスパルタクスを討ち取り、グナエウス・ポンペイウス及びガイウス・ユリウス・カエサルと共に第一回三頭政治を行った。"},{"page_url":"https://nn.wikipedia.org/wiki/Rottne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Rottne_station.JPG","page_title":"Rottne","context_page_description":"Rottne er ein svensk tettstad i Växjö kommun i Kronobergs län i Småland. I 2010 hadde tettstaden 2 354 innbyggjarar."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%B4%DB%8C%D9%84%DB%8C_%DA%86%DA%91%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Passer_shelleyi.jpg","page_title":"شیلی چڑی","context_page_description":"شیلی چڑی چڑی ٹبر دی اک چڑی اے۔"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D9%8A%D9%83_%D9%81%D9%88%D8%B3%D8%AA%D8%B1_(%D8%B3%D9%8A%D8%A7%D8%B3%D9%8A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Michael_Foster%2C_September_2009_rotated_and_cropped.jpg","page_title":"مايك فوستر (سياسي)","context_page_description":"مايك فوستر ‏ هو محاضر ومحلل مالي وسياسي بريطاني، ولد في 14 مارس 1963 في برمنغهام في المملكة المتحدة. حزبياً، نشط في حزب العمال. في الانتخابات العامة في المملكة المتحدة 1997، انتخب عضو البرلمان الثاني والخمسون للمملكة المتحدة عن دائرة وستر وقد انضم خلال فترته النيابية للكتلة البرلمانية حزب العمال وفي الانتخابات العامة في المملكة المتحدة 2001، انتخب عضو برلمان المملكة المتحدة الـ53 عن دائرة وستر وقد انضم خلال فترته النيابية للكتلة البرلمانية حزب العمال وفي الانتخابات العامة في المملكة المتحدة 2005، انتخب عضو برلمان المملكة المتحدة الـ54 عن دائرة وستر وقد انضم خلال فترته النيابية للكتلة البرلمانية حزب العمال."},{"page_url":"https://et.wikipedia.org/wiki/Kullavere_j%C3%B5gi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Vaiatu_paisj%C3%A4rv_%28Kullavere_j%C3%B5gi%29.jpg","page_title":"Kullavere jõgi","context_page_description":"Kullavere jõgi on jõgi Jõgeva maakonnas.\\nKullavere jõgi saab alguse Jõgevamaal Sadala küla lähedalt. Alamjooksul, alatest kohast, kus kuus kilomeetrit enne suubumist Peipsisse suubub Kääpa jõgi, nimetatakse Kullavere jõge Omedu jõeks.\\nJõe pikkus on 53 km ja valgala 627 km²."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AE%D9%88%D8%A7%DA%A9%DB%8C%D9%86_%D8%B3%D9%88%D8%B1%D9%88%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Joaquin_Sorolla_by_Gertrude_K%C3%A4sebier%2C_1908.jpg","page_title":"خواکین سورولا","context_page_description":"خواکین سورولا ؛ نقاش اسپانیایی بود. سورویا در نقاشی پرتره، منظره و آثاری با مضامین اجتماعی و تاریخی تبحر داشت."},{"page_url":"https://en.wikipedia.org/wiki/2006_Pacific-10_Conference_Men%27s_Basketball_Tournament","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Jordan_Farmar_UCLA.jpg","page_title":"2006 Pacific-10 Conference Men's Basketball Tournament","context_page_description":"The 2006 Pacific Life Pacific-10 Conference Men's Basketball Tournament was played between March 8 and March 11, 2006 at Staples Center in Los Angeles, California. The champion of the tournament was UCLA, which received the Pac-10's automatic bid to the NCAA Tournament. The Most Outstanding Player was Leon Powe of California."},{"page_url":"https://sv.wikipedia.org/wiki/Linn%C3%A9universitetet","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/H%C3%A4lsomottagningen.jpg","page_title":"Linnéuniversitetet","context_page_description":"Linnéuniversitetet är ett svenskt statligt universitet med sex fakulteter, 34 000 studenter, varav ca 15 000 helårsstudenter, och 2000 anställda. Linnéuniversitetet bildades den 1 januari 2010 genom sammanslagning av Växjö universitet och Högskolan i Kalmar. Dessa två lärosäten upphörde att existera som separata lärosäten samma dag som Linnéuniversitetet startade. Namnet avser att hedra forskaren Carl von Linné, som var född på komministergården Råshult i Stenbrohult, Småland. Universitetet har verksamhet på huvudorterna Kalmar och Växjö men har även viss utbildning i Hultsfred och Ljungby. Universitetsrektor från oktober 2017 är Peter Aronsson. Universitetsdirektör är Therése Iveby Gardell.\\n2016 påbörjades byggnationen av ett nytt samlat universitetsområde i Kalmar: Universitetskajen. Byggnaderna färdigställs i tre etapper och inflyttning i de nya lokalerna sker 2018, 2019 respektive 2020."},{"page_url":"https://hu.wikipedia.org/wiki/Ern%C5%91_J%C3%A1nos_kurf%C3%B6ldi_herceg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Rundale_Pilsrundale_Treppenhaus.jpg","page_title":"Ernő János kurföldi herceg","context_page_description":"Ernő János von Biron Kúrföld, Zemgale hercege volt, valamint Orosz birodalom régense."},{"page_url":"https://nn.wikipedia.org/wiki/Erraid","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Erraid.jpg","page_title":"Erraid","context_page_description":"Erraid er ei tidvassøy i Indre Hebridane i Skottland. Ho ligg vest for Mull og søraust for Iona.\\nØya får om lag 1000 mm nedbør i året og 1350 soltimar årleg, noko som gjer ho til ein av dei tørraste og mest solrike stadane på vestkysten av Skottland. Det ligg fleire mindre øyar rundt Erraid, som Eilean Dubh, Eilean nam Muc, Eilean Chalmain, Eilean Ghomain og Eilean na Seamair.\\nDet står ein ubrukt signalstasjon for fyra på Dubh Artach og Skerryvore på øya, og fleire hytter som vart bygd for fyrvaktarane.\\nDet ligg ein velkjend ankringsplass på vestsida av øya kalla Tinker's Hole. Han er djup, men smal og ligg mellom Erraid og den vestlegaste av øyane rundt, kalla Eilean Dubh."},{"page_url":"https://it.wikipedia.org/wiki/Inseguimento","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Franz%C3%B6sischer_Vierer.jpg","page_title":"Inseguimento","context_page_description":"L'inseguimento è una specialità del ciclismo su pista. Due ciclisti o due team si sfidano su una distanza prefissata partendo da due punti diametralmente opposti sui due rettilinei della pista: vince chi per primo raggiunge l'avversario o, caso molto più frequente, chi copre la distanza nel minor tempo.\\nNella versione a squadre competono, sia in campo maschile che femminile, formazioni formate ciascuna da quattro ciclisti."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%90%D7%A0%D7%92_%D7%95%D7%99%D7%99%D7%A0%D7%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Vang_Vieng%2C_Laos._III.jpg","page_title":"ואנג ויינג","context_page_description":"ואנג ויינג או מואנג וואנגוויאנג היא עיירה במחוז ויינג צ'אן בלאוס לגדות נהר נאם סונג. אוכלוסיית הקבע של העיירה נאמדת ב-25,000 נפש ובנוסף עליהם יש מספר משתנה של תיירים, טיילים מקומיים ועובדים זמניים.\\nהעיירה נמצאת כ-160 ק\\"מ צפונית לויינג צ'אן על דרך מס' 13, וממוקמת בין שרשרת הרים קרסטיים. בסמוך אליה נמצאות מערות רבות. לצד העיירה נמצא מנחת מטוסים שהיה בשימוש בתקופת מלחמת וייטנאם על ידי מטוסי אייר אמריקה.\\nהעיירה הפכה במהלך השנים לאבן שואבת לתיירי תרמילאות, הנמשכים לנוף ההררי והנהר הזורם בה, האקלים הנח והמחירים הזולים, לשם שהייה ארוכה במקום. רחובה הראשי של העיירה והרחובות המסתעפים ממנו משובצים בבתי הארחה ובתי מלון, פאבים, מסעדות, בתי קפה ואינטרנט קפה, סוכנויות נסיעות ותיירות וכדומה.\\nהאטרקציות התיירותיות במקום כוללות שיט אבובים, שיט בקיאקים ורפטינג על נהר הנאם סונג, טיפוס הרים וסלעים, טיולי אופניים ואופנועים וביקור במערות הרבות ותצורות הגיר הקיימות בהרי הקרסט הסובבים את העיירה. רבים מהמטיילים ממשיכים מואנג ויינג צפונה, לעיר לואנג פרבאנג."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Sommerspiele_2008/Teilnehmer_(Australien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/2008_Olympic_field_hockey_team_Australia.JPG","page_title":"Olympische Sommerspiele 2008/Teilnehmer (Australien)","context_page_description":"Australien nahm an den Olympischen Sommerspielen 2008 in der chinesischen Hauptstadt Peking mit 432 Sportlern, 199 Frauen und 233 Männern, teil.\\nSeit 1896 war es die 26. Teilnahme Australiens bei Olympischen Sommerspielen. Damit war Australien neben Griechenland, Frankreich, der Schweiz und dem Vereinigten Königreich eine der fünf Nationen, die bis dahin bei allen Olympischen Sommerspielen teilgenommen hatten.\\nJüngste Teilnehmerin Australiens war mit 16 Jahren und 67 Tagen die Schwimmerin Emily Seebohm, ältester Teilnehmer der Reiter Laurie Lever."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Kellinghusen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Schleswig-Holstein%2C_Kellinghusen%2C_Ehrenmal_NIK_2869.jpg","page_title":"Liste der Kulturdenkmale in Kellinghusen","context_page_description":"In der Liste der Kulturdenkmale in Kellinghusen sind alle Kulturdenkmale der schleswig-holsteinischen Stadt Kellinghusen aufgelistet."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Jean-Baptiste_de_Saint-Jean-du-Doigt","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Saint-Jean-du-Doigt_%2829%29_%C3%89glise_10.jpg","page_title":"Église Saint-Jean-Baptiste de Saint-Jean-du-Doigt","context_page_description":"L'église Saint-Jean-Baptiste est une église consacrée à saint Jean-Baptiste située à Saint-Jean-du-Doigt dans le Finistère. Elle est située au sein d'un enclos paroissial ayant toujours son cimetière, ouvrant sur la ville par une porte, et incluant une fontaine sacrée et une chapelle funéraire dédiée à saint Mélar. L'église, ancienne trève de Plougasnou, renferme également un trésor d'orfèvrerie remarquable."},{"page_url":"https://pl.wikipedia.org/wiki/Hrabstwo_Pictou","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/NewGlasgow_EastRiverBridge.jpg","page_title":"Hrabstwo Pictou","context_page_description":"Hrabstwo Pictou – jednostka administracyjna kanadyjskiej prowincji Nowa Szkocja ze stolicą w mieście Pictou.\\nHrabstwo ma 45 643 mieszkańców. Język angielski jest językiem ojczystym dla 97,3%, francuski dla 1,0% mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/Ostia_Antica","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/OstianInsula.JPG","page_title":"Ostia Antica","context_page_description":"Ostia Antica is a large archaeological site, close to the modern town of Ostia, that is the location of the harbour city of ancient Rome, 15 miles southwest of Rome. \\"Ostia\\" is a derivation of \\"os\\", the Latin word for \\"mouth\\". At the mouth of the River Tiber, Ostia was Rome's seaport, but due to silting the site now lies 3 kilometres from the sea. The site is noted for the excellent preservation of its ancient buildings, magnificent frescoes and impressive mosaics."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Florida","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/NRHP_Florida_Map.svg","page_title":"National Register of Historic Places listings in Florida","context_page_description":"There are more than 1,800 properties and districts listed on the National Register of Historic Places in Florida. They are distributed through 66 of the state's 67 counties. Of these, 42 are National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://en.wikipedia.org/wiki/Super_Ball","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Glitter_Super_Ball.jpg","page_title":"Super Ball","context_page_description":"A Super Ball is a toy bouncy ball based on a type of synthetic rubber invented in 1964 by chemist Norman Stingley. It is an extremely elastic ball made of Zectron which contains the synthetic polymer polybutadiene as well as hydrated silica, zinc oxide, stearic acid, and other ingredients. This compound is vulcanized with sulfur at a temperature of 165 °C and formed at a pressure of 3,500 psi. The resulting Super Ball has a very high coefficient of restitution, and if dropped from shoulder level on a hard surface, a Super Ball bounces nearly all the way back; thrown down by an average adult, it can fly over a three-story building.\\nToys similar to Super Balls are more generally known as bouncy balls, a term that covers other balls by different manufacturers with different formulations."},{"page_url":"https://no.wikipedia.org/wiki/Frances_E._Allen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Allen_mg_2528-3750K-b.jpg","page_title":"Frances E. Allen","context_page_description":"Frances Elizabeth Allen var en amerikansk vitenskapskvinne og mottaker av Turing-prisen for 2006. Hun er kjent for banebrytende arbeid innen kompilatorer, kodeoptimalisering og parallellisering.\\nAllen var opprinnelig matematikklærer på high school, og skulle jobbe i IBM bare en tid for å betale ned studielånet sitt. Tidlig på 1980-tallet startet hun Parallel TRANslation-gruppen for å studere problemstillinger innenfor kompilering for parallelle datamaskiner. Hennes gruppe ble regnet som blant de fremste i verden i dette fagfeltet. Hennes arbeid med algoritmer og teknologier la grunnlaget for dagens arbeid med kommersielle kompilatorer.\\nAllens innflytelse i IBM, hvor hun jobbet, gjorde at hun ble valgt til IBM Fellow i 1989. Dette var første gang en kvinne fikk denne utmerkelsen. Hun var også formann for IBMs Academy of Technology, en ledende organisasjon innen for datavitenskapen.\\nI 1997 ble Allen hedret ved å bli innlemmet i WITI Hall of Fame. Hun pensjonerte seg fra IBM i 2002. Da hun mottok Turing-prisen i 2007 var det som første kvinne."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_schilderijen_van_Rembrandt_van_Rijn","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Rembrandt_Self-Portrait_%28Royal_Collection%29.jpg","page_title":"Lijst van schilderijen van Rembrandt van Rijn","context_page_description":"Hieronder volgt een zo volledig mogelijke lijst van de schilderijen van Rembrandt van Rijn."},{"page_url":"https://it.wikipedia.org/wiki/Neofelis_diardi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Neofelis_nebulosa.jpg","page_title":"Neofelis diardi","context_page_description":"Il leopardo nebuloso del Borneo, Neofelis diardi, o leopardo nebuloso della Sonda, è un felino selvatico di medie dimensioni diffuso nel Borneo, a Sumatra e sulle Isole Batu, nell'arcipelago malese; è stato indicato per la prima volta con il suo attuale nome comune dagli scienziati del World Wide Fund for Nature il 14 marzo 2007. Ha il manto ricoperto da chiazze ovali di forma irregolare e dai margini più scuri, che si dice ricordino delle nuvole, a cui deve il nome. Sebbene gli studiosi fossero a conoscenza della sua esistenza già dagli inizi del XIX secolo, è stato identificato come specie a sé stante solo nel 2006; prima era ritenuto una semplice sottospecie del leopardo nebuloso continentale. Come riferisce il WWF, il Dr. Stephen O'Brien del National Cancer Institute degli Stati Uniti d'America sostiene che «i risultati delle ricerche genetiche indicano chiaramente che il leopardo nebuloso del Borneo deve essere considerato una specie separata»."},{"page_url":"https://lb.wikipedia.org/wiki/Eisebunnsstreck_Beetebuerg-Wuelmereng","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/CFLCargo_4011_CFL_012_CFL_2007_Gare-Usines.jpg","page_title":"Eisebunnsstreck Beetebuerg-Wuelmereng","context_page_description":"D'Eisebunnsstreck Beetebuerg-Wuelmereng ass eng Eisebunnsstreck zu Lëtzebuerg. Se féiert vun Beetebuerg op Wuelmereng.\\nD'Trasse fir d'Eisebunnsstreck Beetebuerg-Wuelmereng gëtt vun der Administration des chemins de fer verdeelt. D'CFL bedreift a geréiert d'Infrastruktur vun der Streck, déi am Besëtz vum Lëtzebuerger Staat ass."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D8%A7%D9%86_%D8%AA%D9%8A%D8%AA%D8%B4%D9%85%D8%A7%D8%B1%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Alan_Titchmarsh_cropped.jpg","page_title":"الان تيتشمارش","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nالان تيتشمارش صحفى من المملكه المتحده."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D9%8A%D9%84%D8%B3%D8%A7_%D9%83%D8%A7%D8%B1%D8%AF%D9%8A%D9%86%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Andress-Presley-Cardenas.jpg","page_title":"إيلسا كارديناس","context_page_description":"}}\\nإيلسا كارديناس ‏ هي ممثلة مكسيكية ولدت في يوم 3 أغسطس 1935 في مدينة تيخوانا في المكسيك، مثلت في فلم Happiness في سنة 1956، دخلت في مهرجان برلين السينمائي الدولي في عدة أفلام، حيث مثلت مع ألفيس بريسلي و أورسولا أندريس في فلم Fun in Acapulco في سنة 1963 وفي فلم ضخم في سنة 1956."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%BE%D0%BD%D0%B3%D0%B8%D0%BD_%D0%9F%D0%B5%D1%87%D0%B5%D1%80%D1%81%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/%D0%9B%D0%BE%D0%B3%D0%B3%D0%B8%D0%BD_%28%D0%9B%D0%BE%D0%BD%D0%B3%D0%B8%D0%BD%29_%D0%9F%D0%B5%D1%87%D0%B5%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%E2%80%94_%D0%BF%D1%80%D0%B5%D0%BF%D0%BE%D0%B4%D0%BE%D0%B1%D0%BD%D1%8B%D0%B9_%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%BE%D0%B9_%D0%BF%D1%80%D0%B0%D0%B2%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%BD%D0%BE%D0%B9_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B8%3B_%D0%B2%D1%80%D0%B0%D1%82%D0%B0%D1%80%D1%8C_%D0%9A%D0%B8%D0%B5%D0%B2%D0%BE-%D0%9F%D0%B5%D1%87%D1%91%D1%80%D1%81%D0%BA%D0%BE%D0%B9_%D0%BB%D0%B0%D0%B2%D1%80%D1%8B.jpg","page_title":"Лонгин Печерский","context_page_description":"Лонгин Печерский — преподобный Украинская православная церковь Русской православной церкви, вра́тарь Киево-Печерской лавры.\\nО его мирской жизни сведений практически не сохранилось, известно лишь, что под­ви­зал­ся в Ки­е­во-Пе­чер­ском мо­на­сты­ре во второй половине XIII века, где нес обязанности привратника и другие послушания и был известен смиренностью и святостью жизни. Усердие и трудолюбие Лонгина были вознаграждены и он сподобился дара прозорливости: он помогал людям приходившим в обитель с богоугодными намерениями, иных же жёстко обличал и старался привести к покаянию перед Богом.\\nПосле смерти Лонгина он был погребён в Дальних пещерах Киево-Печерской лавры. На пе­щер­ной дос­ке сохранилась надпись: «…свя­то и пра­вед­но про­хо­дя мо­на­стыр­ское по­слу­ша­ние, си­це­ва­го от Все­вед­ца Бо­га спо­до­бил­ся да­ра чу­до­тво­ре­ния, яко ве­дал при­хо­дя­щих в мо­на­стырь и ис­хо­дя­щих мыс­ли со­кро­вен­ныя…».\\nПамять преподобного совершается 16 октября и 28 августа вместе с празднованием Собора преподобных отцов Киево-Печерских, в Дальних пещерах почивающих."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%AB%E3%83%8A%E3%83%B4%E3%82%A1%E3%83%B3%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/TGV_%C3%A0_Gen%C3%A8ve-Cornavin_%282%29.JPG","page_title":"コルナヴァン駅","context_page_description":"コルナヴァン駅 は、スイス・ジュネーヴにある鉄道駅である。駅名標、乗車券並びにスイス連邦鉄道、レマンエクスプレス及びTGVリリアの時刻表では単に「Genève」又は「GENÈVE」と表記され、フランス国鉄の時刻表では「GENÈVE-CORNAVIN」と表記される。1日当たり約40,000人の旅客数があり、スイス国内の主要駅の一つである。コルナヴァン駅はサン＝ジェルヴェ地区、ル＝グロッテ地区、ル＝パキ地区の境界に位置している。ジュネーヴ公共交通の拠点として路線バスや路面電車の交通結節点にもなっており、広場の地下は公共駐車場になっている。\\nまた、コルナヴァン駅にはスイス連邦鉄道やフランス国鉄の機関区や車両修繕工場が隣接しており運用の拠点にもなっている。"},{"page_url":"https://fr.wikipedia.org/wiki/Rue_de_Bretonvilliers","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Pavillon_de_Bretonvilliers.jpg","page_title":"Rue de Bretonvilliers","context_page_description":"La rue de Bretonvilliers est une voie située sur l'île Saint-Louis, dans le 4ᵉ arrondissement de Paris, en France."},{"page_url":"https://en.wikipedia.org/wiki/Gerlach,_Nevada","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Washoe_County_Nevada_Incorporated_and_Unincorporated_areas_Gerlach-Empire_Highlighted.svg","page_title":"Gerlach, Nevada","context_page_description":"Gerlach, Nevada is a census-designated place in Washoe County, Nevada, United States. The population was 107 at the 2018 American Community Survey. It is part of the Reno–Sparks Metropolitan Statistical Area. Prior to 2010, Gerlach was part of the Gerlach–Empire census-designated place. The town of Empire is now a separate CDP. The next nearest town, Nixon, is 60 miles to the south on a reservation owned by the Pyramid Lake Paiute Tribe. The Fly Geyser is located near Gerlach."},{"page_url":"https://nl.wikipedia.org/wiki/Alevitisme","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Alevisme.jpg","page_title":"Alevitisme","context_page_description":"Het alevitisme of alevisme, niet te verwarren met de Syrische alawieten, is een mystieke stroming in de islam. Het is in Turkije op het soennisme na de grootste religieuze stroming."},{"page_url":"https://de.wikipedia.org/wiki/Beta-Amyloid-assoziierte_Angiitis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/ABRA_HE_40x.jpg","page_title":"Beta-Amyloid-assoziierte Angiitis","context_page_description":"Als Beta-Amyloid-assoziierte Angiitis wird eine Entzündung von das Gehirn versorgenden Blutgefäßen mit Ablagerung von Beta-Amyloid bezeichnet. Im Gegensatz zur häufigen zerebralen Amyloidangiopathie handelt es sich um eine sehr seltene Erkrankung: Bisher wurden weniger als 100 Fälle beschrieben.\\nDas mittlere Alter bei Diagnosestellung beträgt etwa 67 Jahre. Die Erkrankung kann sich mit Wesensänderungen, Kopfschmerzen, Anfallsereignissen oder auch Halluzinationen bemerkbar machen. Während sich in der Kernspintomographie des Schädels lediglich unspezifische Veränderungen im Bereich des Marklagers nachweisen lassen und die Lumbalpunktion allenfalls eine moderate Erhöhung der Zellzahl ergibt, sind in der feingeweblichen Untersuchung von bei einer Biopsie gewonnenen Hirngewebsprobe granulomatöse entzündliche Veränderungen sowie Amyloidablagerungen im Bereich kleiner Blutgefäße nachweisbar. Die Lumina der Blutgefäße sind häufig thrombosiert oder weisen Zeichen einer Rekanalisation auf. Im umgebenden Hirngewebe finden sich ausgeprägte reaktive Veränderungen.\\nKlinischer Verlauf und Ansprechen auf eine Behandlung mit Immunsuppressiva sind variabel."},{"page_url":"https://sk.wikipedia.org/wiki/Kad%C3%A1ver","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Human_body_in_medicine.jpg","page_title":"Kadáver","context_page_description":"Kadáver je v medicíne označenie mŕtveho ľudského tela a vo veterinárnej medicíne a poľovníctve označenie tela mŕtveho zvieraťa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_L%C3%BCbecker_Kinos","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/HL_Kino_-_Hansa.jpg","page_title":"Liste der Lübecker Kinos","context_page_description":"Die Liste der Lübecker Kinos enthält sämtliche ortsfesten Lichtspieltheater Lübecks, geordnet nach dem Jahr der Eröffnung. Kinos, die im Verlaufe ihrer Existenz mehrere Namen trugen, sind mit dem letzten verwendeten Namen aufgezählt.\\nAls Innenstadtkinos gelten sämtliche Lichtspielhäuser, die sich in der Lübecker Altstadt befanden oder befinden. Einige Kinos, die außerhalb der Altstadtinsel lagen, werden wegen ihrer Größe dennoch zu den Innenstadtkinos gezählt. Die Stadtteilkinos waren zumeist kleinere, weniger bedeutende Häuser, deren Einzugsgebiet sich auf den jeweiligen Stadtteil beschränkte."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D1%82%D1%80%D0%B5%D1%82%D1%8C%D0%B5%D0%B9_%D0%BA%D0%BE%D0%B0%D0%BB%D0%B8%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Inspecting_the_Troops_at_Boulogne%2C_15_August_1804.png","page_title":"Война третьей коалиции","context_page_description":"Война Третьей коалиции — война между Францией, Испанией, Баварией и Италией, с одной стороны и Третьей антифранцузской коалицией, в которую входили Австрийская империя, Россия, Великобритания, Швеция и Неаполитанское королевство — с другой."},{"page_url":"https://sv.wikipedia.org/wiki/H%C3%B4tel_Tassel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Tassel_House_stairway.JPG","page_title":"Hôtel Tassel","context_page_description":"Hôtel Tassel är ett privathus i Bryssel, ritat av Victor Horta för den belgiske forskaren professor Emile Tassel 1893–1894. Den anses vara den första riktiga jugendbyggnaden med hänsyn till dess innovativa plan och banbrytande användning av material och dekorationer. Tillsammans med tre andra privathus av Horta, däribland hans eget hus och ateljé ingår Hotel Tassel i världsarvet Betydande verk av arkitekten Victor Horta i Bryssel. Hotel Tassel ligger på Rue Paul-Emile Jansonstraat 6 i Bryssel."},{"page_url":"https://es.wikipedia.org/wiki/Heideland_(Brandeburgo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Heideland_in_EE.png","page_title":"Heideland (Brandeburgo)","context_page_description":"Heideland es un municipio del distrito de Elbe-Elster, en Brandeburgo. Pertenece al Amt de Elsterland.\\nDatos: Q582769\\nMultimedia: Heideland"},{"page_url":"https://fy.wikipedia.org/wiki/Kurt_Tank","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/HAL-HF-24-Marut.jpg","page_title":"Kurt Tank","context_page_description":"Kurt Waldemar Tank wie in Dútsk loftfeart-yngenieur en testpiloat, dy't haad fan de ûntwerpôfdieling by Focke-Wulf wie fan 1931 oant 1945. Hy wie ferantwurdlik foar de ûntwerpen fan ferskate wichtige fleanmasines foar de Luftwaffe yn de Twadde Wrâldkriich, ûnder mear it jachtfleantúch Fw 190, de Ta 152 ûnderskeppingsjager en it pazzajiersfleantúch Fw 200 Condor. Nei de oarloch arbeide Tank sa'n tweintich jier as ûntwerper yn it bûtenlân, earst yn Argentynje en dêrnei yn Yndia. Ein jierren sechtich kaam er werom yn Dútslân en waard er adviseur foar Messerschmitt-Bölkow-Blohm."},{"page_url":"https://ca.wikipedia.org/wiki/Falla_de_les_Highlands","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Scotland.central.geological.jpg","page_title":"Falla de les Highlands","context_page_description":"La falla de les Highlands, o línia de falla de les Highlands, en anglès: Highland Boundary Fault, és una falla geològica que travessa Escòcia diagonalment des d'Arran i Helensburgh a la costa oest fins a Stonehaven a l'est. Separa dues regions diferents: les Highlands de les Lowlands.\\nEls dos esdeveniments geològics principals que han afectat Escòcia va ser primer la formació del supercontinent Pangea i després el trencament de Pangea per formar els continents actuals.\\nAquesta falla és la del mig de tres grans falles que discorren del sud-est al nord-oest a través d'Escòcia. Al nord, hi ha la falla Great Glen Fault, i al sud la Southern Uplands Fault. Més cap al sud, just a la frontera amb Anglaterra, hi ha la Iapetus Suture, on es va tancar el paleoocea Iapetus.\\nLa línia de falles de les Highland va estar activa durant l'orogènesi caledoniana."},{"page_url":"https://en.wikipedia.org/wiki/List_of_buildings_and_structures_in_Florence","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Palazzo_orlandini_del_beccuto%2C_lato.JPG","page_title":"List of buildings and structures in Florence","context_page_description":"This is a list of the main architectural works in Florence, Italy by period. It also includes buildings in surrounding cities, such as Fiesole. Some structures appear two or more times, since they were built in various styles."},{"page_url":"https://en.wikipedia.org/wiki/Geodesic_polyhedron","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Conway_dwrwD.png","page_title":"Geodesic polyhedron","context_page_description":"A geodesic polyhedron is a convex polyhedron made from triangles. They usually have icosahedral symmetry, such that they have 6 triangles at a vertex, except 12 vertices which have 5 triangles. They are the dual of corresponding Goldberg polyhedra with mostly hexagonal faces.\\nGeodesic polyhedra are a good approximation to a sphere for many purposes, and appear in many different contexts. The most well-known may be the geodesic domes designed by Buckminster Fuller, which geodesic polyhedra are named after. Geodesic grids used in geodesy also have the geometry of geodesic polyhedra. The capsids of some viruses have the shape of geodesic polyhedra, and fullerene molecules have the shape of Goldberg polyhedra. Geodesic polyhedra are available as geometric primitives in the Blender 3D modeling software package, which calls them icospheres: they are an alternative to the UV sphere, having a more regular distribution of vertices than the UV sphere. The Goldberg–Coxeter construction is an expansion of the concepts underlying geodesic polyhedra."},{"page_url":"https://uk.wikipedia.org/wiki/Bmw_650","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/BMW_650i_convertible_--_2011_DC.jpg","page_title":"Bmw 650","context_page_description":"BMW 650 - це автомобілі 6 серії, які належать до преміум-класу. Спочатку були лише в кузові купе, згодом з’явилась версія кабріолет. Існують такі версії моделі:\\nBMW E63;\\nBMW E64;\\nBMW F12;\\nBMW F13;\\nBMW F06."},{"page_url":"https://it.wikipedia.org/wiki/Jean_Meslier","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Meslier.jpg","page_title":"Jean Meslier","context_page_description":"Jean Meslier è stato un filosofo e presbitero francese, curato in un piccolo paese di campagna, ma precursore dell'illuminismo radicale, materialista e ateo ed anche anticipatore di alcune tematiche socialiste.\\nLa vita di Meslier fu priva di eventi particolari, ma egli divenne improvvisamente noto dopo la morte, avvenuta nel 1729, per l'apertura del suo testamento intellettuale in cui «si dimostrano in modo chiaro ed evidente le vanità e le falsità di tutte le divinità e di tutte le religioni del mondo».\\nInoltre, nel suo testamento spirituale, il sacerdote chiedeva scusa ai propri fedeli per quanto di falso aveva predicato in tutta la vita, per aver mentito, per eccessiva prudenza, nell'esercizio di una professione di prete non consona alle sue convinzioni filosofiche.\\nIl suo nome fu inciso tra quelli degli ispiratori e fondatori del socialismo, su una lapide fuori dalle mura del Cremlino e su un obelisco nei giardini di Alessandro di Mosca. Egli è stato infatti considerato tra i primi pensatori a porre le basi del comunismo sociologico, della comunione dei beni e della distribuzione del reddito in base ai bisogni."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A8_%D7%A1%D7%98%D7%A0%D7%9C%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/MtStanley_2.JPG","page_title":"הר סטנלי","context_page_description":"הר סטנלי, ההר הגבוה ביותר ברכס רוונזורי של קונגו והשלישי בגובהו באפריקה, אחרי הקילימנג'רו והר קניה.\\nהר סטנלי מורכב משתי פסגות תאומות ומכמה פסגות נמוכות יותר:"},{"page_url":"https://no.wikipedia.org/wiki/Vest-Tysklands_og_%C3%98st-Tysklands_permanente_representasjoner","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Bundesarchiv_Bild_183-1990-1002-018%2C_Berlin%2C_Abh%C3%A4ngen_des_Schilds_der_St%C3%A4ndigen_Vertretung.jpg","page_title":"Vest-Tysklands og Øst-Tysklands permanente representasjoner","context_page_description":"Vest-Tysklands og Øst-Tysklands permanente representasjoner ble opprettet i 1972 som et resultat av grunnavtalen mellom Forbundsrepublikken Tyskland og Den tyske demokratiske republikk. Legasjonene virket på regjeringsnivå og hadde ikke full diplomatisk anerkjennelse."},{"page_url":"https://en.wikipedia.org/wiki/Fluidized_bed_scrubber","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Fluid_Bed_Section.png","page_title":"Fluidized bed scrubber","context_page_description":"A Fluidized Bed Scrubber system uses carefully selected hollow plastic elements of varying shapes, according to the process requirements, to generate a three phase fluidized bed in which increased Reynolds numbers in the gaseous phase, and the liquid phase, provoke an intense enhancement of turbulent action. This is claimed to lead to substantial increases in overall mass and heat transfer coefficients, and interphase surface renewal rates, as compared to classical packings and other scrubbing technologies."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%80%D0%B8%D0%BD%D0%B0_(%D0%B2%D0%B8%D0%B7%D0%B0%D0%BD%D1%82%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D1%80%D0%B8%D1%86%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Pope_Adrian_I.jpg","page_title":"Ирина (византийская императрица)","context_page_description":"Ирина — византийская императрица из Исаврийской династии в 797—802 годах. Стала первой женщиной в истории Византии, правившей самостоятельно.\\nСтала женой императора Льва IV Хазара в 768 году, после его смерти в 780 году начала править как регент при своём малолетнем сыне Константине VI. Когда сын повзрослел и стал претендовать на самостоятельное правление, Ирина ослепила его, захватив самодержавную власть в империи. Тем не менее за восстановление иконопочитания на Втором Никейском соборе канонизирована православной церковью в лике святых."},{"page_url":"https://de.wikipedia.org/wiki/Julienne_(Charente)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Julienne1.JPG","page_title":"Julienne (Charente)","context_page_description":"Julienne ist eine französische Gemeinde mit 508 Einwohnern im Département Charente in der Region Nouvelle-Aquitaine; sie gehört zum Arrondissement Cognac und zum Kanton Jarnac. Die Einwohner werden Juliennois genannt."},{"page_url":"https://sl.wikipedia.org/wiki/Geografija_Evrope","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Physical_Map_of_Europe.jpg","page_title":"Geografija Evrope","context_page_description":"Evropa skupaj z Azijo sestavlja eno samo celino, ki po površini prekaša vse druge in jo označujemo kot Evrazijo. Delitev te ogromne celine na Evropo in Azijo se je uveljavila v preteklosti predvsem zaradi drugačnega kulturnega, gospodarskega, socialnega in političnega razvoja obeh delov. Evropa je kontinent, ki ga na severu omejuje Arktični ocean, na zahodu Atlantski ocean in na jugu Sredozemsko in Črno morje. Na vzhodu preide v Azijo. Dogovorjena meja poteka od juga proti severu prek Kavkaza, Kaspijskega morja, reke Ural in gorovja Ural. Otoki in polotoki segajo globoko v morja, morje pa se s svojimi zalivi globoko zajeda v kontinent. Več kot polovica evropskega ozemlja je manj kot 300 km daleč od najbližjega morja."},{"page_url":"https://sv.wikipedia.org/wiki/Holothuria_poli","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Holothuria_poli_Rab2011_c_4152.JPG","page_title":"Holothuria poli","context_page_description":"Holothuria poli är en sjögurkeart som beskrevs av Delle Chiaje. Holothuria poli ingår i släktet Holothuria och familjen Holothuriidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/Gustave_Van_de_Woestijne","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Gaston_en_zijn_zuster%2C_Gustave_Van_de_Woestyne%2C_1923%2C_Koninklijk_Museum_voor_Schone_Kunsten_Antwerpen.jpg","page_title":"Gustave Van de Woestijne","context_page_description":"Gustave van de Woestijne, también escrito Woestyne fue un pintor y grabador belga."},{"page_url":"https://es.wikipedia.org/wiki/Consejo_de_Ministros_de_Panam%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Aristides_Royo_%286713987733%29_%28cropped%29.jpg","page_title":"Consejo de Ministros de Panamá","context_page_description":"El Consejo de Ministros de Panamá, también conocido como el gabinete, es el órgano ejecutivo del país formado por el Presidente de la República, los ministros y los directores de las principales instituciones gubernamentales. Las funciones del consejo son emitir decretos, aprobación de decisiones del presidente y de los proyectos ministeriales. La sede del consejo es el Palacio de las Garzas."},{"page_url":"https://en.wikipedia.org/wiki/Santa_Tecla_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/DamesIVells.SantaTecla2007.jpg","page_title":"Santa Tecla Festival","context_page_description":"The Santa Tecla Festival is a festival held in Tarragona, Catalonia, Spain.\\nPlunging into the festivities of Santa Tecla of Tarragona unavoidably involves becoming impregnated with fragrances that link the present times with history, with heritage legacy. This is precisely the route, maintained through the centuries, that defines the personality of the festivities are rock music, jazz, drama plays, music-hall, movies, parties, sport activities and so on. However, the essence of it still is the collection of dances, the bestiary, the entremesos, the \\"spoken dances\\" and the \\"human castles\\", all of which shape the \\"Popular Retinue\\" of the city, as a genuine corpus, particular of the celebration.\\nIt has been named as a Traditional Festival of national interest, by the Government of Catalonia, and also as a Touristic Festival of national interest by the Spanish Government. It is one of the two unique festivals in Catalonia that have got both declarations."},{"page_url":"https://de.wikipedia.org/wiki/Gro%C3%9Fsteingrab_Westenesch-Noord","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Hunebed_in_Drenthe_06_v2.jpg","page_title":"Großsteingrab Westenesch-Noord","context_page_description":"Das Großsteingrab Westenesch-Noord ist eine megalithische Grabanlage der jungsteinzeitlichen Westgruppe der Trichterbecherkultur bei Westenesch, einer Bauerschaft der Gemeinde Emmen in der niederländischen Provinz Drenthe. Es trägt die Van-Giffen-Nummer D42."},{"page_url":"https://de.wikipedia.org/wiki/Hurrikan_Bertha_(2008)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Bertha_14_july_2008_1505Z.jpg","page_title":"Hurrikan Bertha (2008)","context_page_description":"Hurrikan Bertha war ein selten früher kapverdischer Hurrikan und der am weitesten östlich entstandene tropische Sturm in einem Juli seit Beginn der Wetteraufzeichnungen im atlantischen Ozean. Bertha war auch der langlebigste tropische Wirbelsturm, der sich im Atlantik in einem Monat vor August gebildet hat und mit einer Dauer von 17 Tagen der am längsten dauernde Wirbelsturm im Atlantik seit Hurrikan Ivan während der atlantischen Hurrikansaison 2004.\\nDer zweite benannte tropische Wirbelsturm der Atlantischen Hurrikansaison 2008 entwickelte sich am 1. Juli aus einer tropischen Welle, die sich von der Küste Westafrikas löste. Das Tiefdruckgebiet bildete sich etwa 400 km südlich der Kapverden und erreichte am 3. Juli die Stärke eines tropischen Sturms. Bertha wanderte die nächsten Tage als ein schwacher tropischer Sturm westwärts über den Atlantik. Noch ein gutes Stück östlich der Inseln über dem Winde begann Bertha am späten 6. Juli mit der Intensivierung und wurde am 7. Juli der erste Hurrikan des Jahres im Atlantik. Noch im Tagesverlauf hatte sich Bertha dann zu einem schweren Hurrikan verstärkt."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_parochies_van_het_vicariaat_Brussel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Bxl%2C_Eglise_Sainte-Catherine.JPG","page_title":"Lijst van parochies van het vicariaat Brussel","context_page_description":"Het vicariaat Brussel binnen het aartsbisdom Mechelen-Brussel in het Brussels Hoofdstedelijk Gewest telt 111 parochies, gegroepeerd in 28 federaties, en enkele federaties samen vormen een van de vier decanaten.\\nDe onderstaande lijst geeft een overzicht van de parochies. Per parochie wordt de naam gegeven; de administratieve gemeente waarin de parochie ligt en een foto van de kerk."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1878","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Lilian_Bland.jpg","page_title":"Lijst van personen geboren in 1878","context_page_description":"Dit is een lijst van personen die geboren zijn in 1878.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://es.wikipedia.org/wiki/SEAT_Le%C3%B3n_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/SEAT_Leon_1P_Cockpit_2.jpg","page_title":"SEAT León II","context_page_description":"El SEAT León es un automóvil de turismo del segmento C producido por el fabricante español SEAT esta segunda generación desde el año 2005 hasta 2012.\\nEl prototipo del SEAT León II ​ fue presentado en el Salón del Automóvil de Ginebra en junio de 2005 con el nombre de Leon Prototype. Este prototipo fue diseñado por Walter da Silva basándose en los diseños mostrados en el prototipo SEAT Salsa, y era muy similar a la posterior generación del León. El concepto del compacto simulaba ser un 3 puertas ya que las traseras venían con las manetas ocultas en las ventanilla, también se estaba preparando bajo proyecto una nueva carrocería en formato Cabriolet pero finalmente esta se suspendió.​\\nEl prototipo era de color granate y medía 4343 milímetros de longitud y 1434 mm de alto, y usaba unas llantas de aleación de 19 pulgadas con neumáticos de medida 265/30.\\nEn el interior del León Prototype el habitáculo fue configurado como 2+2 y era bastante espacioso, teniendo en cuenta la reducida altura del vehículo."},{"page_url":"https://en.wikipedia.org/wiki/Njivice,_Croatia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Boats_in_Njivice.jpg","page_title":"Njivice, Croatia","context_page_description":"Njivice is a village that is located in West Croatia on the island of Krk and has a population of 1,115 inhabitants as of 2011. It is part of the municipal administration of Omišalj that is located approximately six kilometres away northward along the coast."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A4%E3%83%9E%E3%83%8F%E3%83%BBDT","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Yamaha_DT-1_250.jpg","page_title":"ヤマハ・DT","context_page_description":"DTとは、ヤマハ発動機が製造販売しているデュアルパーパスタイプのオートバイである。シリーズ車種として数車種が生産されているが、現在日本国内での販売は行われていない。\\nDTの名の由来は、ヤマハの公式発表では、D、Dualpurposeデュアルパーパス、T、Trailトレール小道、が名前の由来となっている。"},{"page_url":"https://en.wikipedia.org/wiki/Banksia_oblongifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Banksia_oblongfolia_habit.JPG","page_title":"Banksia oblongifolia","context_page_description":"Banksia oblongifolia, commonly known as the fern-leaved, dwarf or rusty banksia, is a species in the plant genus Banksia. Found along the eastern coast of Australia from Wollongong, New South Wales in the south to Rockhampton, Queensland in the north, it generally grows in sandy soils in heath, open forest or swamp margins and wet areas. A many-stemmed shrub up to 3 m high, it has leathery serrated leaves and rusty-coloured new growth. The yellow flower spikes, known as inflorescences, most commonly appear in autumn and early winter. Up to 80 follicles, or seed pods, develop on the spikes after flowering. Banksia oblongifolia resprouts from its woody lignotuber after bushfires, and the seed pods open and release seed when burnt, the seed germinating and growing on burnt ground. Some plants grow between fires from seed shed spontaneously.\\nSpanish botanist Antonio José Cavanilles described B. oblongifolia in 1800, though it was known as Banksia aspleniifolia in New South Wales for many years. However, the latter name, originally coined by Richard Anthony Salisbury, proved invalid, and Banksia oblongifolia has been universally adopted as the correct scientific name since 1981."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_hejtman%C5%AF_Kr%C3%A1lov%C3%A9hradeck%C3%A9ho_kraje","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Lubomir_Franc_in_2012.JPG","page_title":"Seznam hejtmanů Královéhradeckého kraje","context_page_description":"Hejtman Královéhradeckého kraje je člen zastupitelstva Královéhradeckého kraje, kterého si tento orgán zvolil do svého čela."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%89%9B%E9%A0%AD%E8%A7%92%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Ngau_Tau_Kok_Road.jpg","page_title":"牛頭角道","context_page_description":"牛头角道位于香港九龙东部观塘区，是该区早期发展时的交通要道，现时大部分路段均是4线双程行车，另有两座行车天桥连接九龙湾。"},{"page_url":"https://it.wikipedia.org/wiki/12._Panzer-Division_(Wehrmacht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Bundesarchiv_Bild_101I-265-0003-14A%2C_Russland%2C_Panzer_II_in_Ortschaft.jpg","page_title":"12. Panzer-Division (Wehrmacht)","context_page_description":"La 12. Panzer-Division fu una formazione corazzata tedesca della seconda guerra mondiale creata a partire dalla 2. Infanterie-Division. Partecipò all'operazione Barbarossa nel 1941 e continuò a combattere contro l'Armata Rossa sino alla fine del conflitto.\\nTra i soldati appartenuti a questa divisione si ricorda Herbert-Ernst Vahl, membro del 29. Panzer-Regiment e futuro comandante della divisione corazzata delle SS Das Reich."},{"page_url":"https://en.wikipedia.org/wiki/Elementary_cellular_automaton","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Rule1rand.png","page_title":"Elementary cellular automaton","context_page_description":"In mathematics and computability theory, an elementary cellular automaton is a one-dimensional cellular automaton where there are two possible states and the rule to determine the state of a cell in the next generation depends only on the current state of the cell and its two immediate neighbors. There is an elementary cellular automaton which is capable of universal computation, and as such it is one of the simplest possible models of computation."},{"page_url":"https://en.wikipedia.org/wiki/Defoe_Shipbuilding_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Defoe_Shipbuilding_abandoned_buildings_1981.jpg","page_title":"Defoe Shipbuilding Company","context_page_description":"The Defoe Shipbuilding Company was a small ship builder established in 1905 in Bay City, Michigan, United States. It ceased to operate in 1976 after failing to renew its contracts with the United States Navy. The site of the former company is now being developed for business and housing on the bank of the Saginaw River."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Dob%C5%99%C3%AD%C5%A1i","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Kop%C3%A1%C4%8Dk%C5%AFv_d%C5%AFm%2C_M%C3%ADrov%C3%A9_n%C3%A1m._103%2C_Dob%C5%99%C3%AD%C5%A1.JPG","page_title":"Seznam kulturních památek v Dobříši","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Dobříš v okrese Příbram vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D1%82%D0%BE%D0%BC%D0%B0%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Katyn_massacre_2.jpg","page_title":"Птомаини","context_page_description":"Птомаини су супстанце које настају распадањем протеина и других једињења азота, као последица труљења леша. Открио их је италијански хемичар Селми 1873. године, током супервештачења на суђењу за убиство за које се претпостављало да је извршено алкалоидом делфинином. Познати птомаини који се срећу у лешевима су неуридин, кадаверин и путресцин који нису токсични. Мускарин и неурин, који настају распадањем холина спадју у токсичне птомаине.\\nПтомаини дају исте опште реакције као алкалоиди, чиме ометају њихово доказивање. Алкалног су карактера, могу бити у течном или чврстом стању на собној температури, и боље се растварају у води него у органским растварачима.\\nУ зависности од полазног једињења и услова труљења настају различити птомаини. У недостатку кисеоника настаје мање птомаина али су они токсичнији.\\nЗа разликовање алкалоида и птомаина се користе биолошки тестови, пре свега отровни ефекат алкалоида на сасвим мале рибице, који изостаје код птомаина."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%9F%D0%B8%D1%81%D0%B0%D0%BD%D0%B8%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/SP_AKUR6.jpg","page_title":"Северская Писаница","context_page_description":"Се́верская пи́саница — скальный массив в Уральских горах в центральной части Свердловской области России к западу от Екатеринбурга, в окрестностях посёлка Северка. Скала известна изображениями эпохи неолита. Геоморфологический и археологический памятник природы, популярное место туризма."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%8A%B1%E5%9C%B0%E7%91%AA%E8%81%96%E6%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Newspaper_fatima_353.jpg","page_title":"花地瑪聖母","context_page_description":"法蒂瑪聖母是天主教徒給1917年在葡萄牙法蒂瑪連續六個月於當月的13日顯現給三個牧童而後被天主教會所認為是「聖母瑪利亞」者的稱號。由於該三名牧童稱她自稱為「玫瑰瑪利亞」，因此這個稱號也有使用，往往這兩個稱號也被合用，比如「玫瑰法蒂瑪聖母」。"},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%A8%D0%B0%D0%BF%D0%B5%D0%BB%D1%8C-%D0%B4%D1%8E-%D0%91%D0%B0%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/La_Chapelle-du-Bard_-_2009.jpg","page_title":"Ла-Шапель-дю-Бар","context_page_description":"Ла-Шапель-дю-Бар — Франциянең Изер департаментына караган коммуна, О-Грезиводан кантонына карый."},{"page_url":"https://en.wikipedia.org/wiki/Hansen%27s_Annex","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/SandwichNH_CenterSandwich_HansensAnnex.jpg","page_title":"Hansen's Annex","context_page_description":"Hansen's Annex is a historic house on Main Street in Center Sandwich, New Hampshire. Built about 1839, it is one of a small number of Greek Revival buildings to survive, out of many that once graced the town. It has seen use as a single-family residence, tavern, and boarding house. It was listed on the National Register of Historic Places, and included in the Center Sandwich Historic District, in 1983."},{"page_url":"https://cs.wikipedia.org/wiki/Franti%C5%A1ek_I._Rakousk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Josef_Kreutzinger_-_Kaiserliche_Familie.jpg","page_title":"František I. Rakouský","context_page_description":"František I. byl v letech 1792–1835 král uherský a český a markrabě moravský, v letech 1804–1835 císař rakouský a jako František II. v letech 1792–1806 poslední císař Svaté říše římské národa německého.\\nCelá jeho vláda byla poznamenána dvěma muži – Klemensem Václavem Lotharem Metternichem a Napoleonem Bonapartem."},{"page_url":"https://pt.wikipedia.org/wiki/Gl%C3%B3ria_(1999)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Gloriacartaz.jpg","page_title":"Glória (1999)","context_page_description":"Glória é um filme português de longa-metragem de ficção realizado por Manuela Viegas, e produzido na produtora independente Rosa Filmes, em 1999.\\nO cartaz do filme foi concebido pelo artista português Julião Sarmento."},{"page_url":"https://fr.wikipedia.org/wiki/Port_de_Conakry","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Abandoned_tracks.jpg","page_title":"Port de Conakry","context_page_description":"Le port de Conakry est un port d'exportation de bauxite et un port à conteneur, situé à Conakry en Guinée."},{"page_url":"https://es.wikipedia.org/wiki/Tintenpalast","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Tintenpalast-Windhoek.jpg","page_title":"Tintenpalast","context_page_description":"El Tintenpalast es la sede de una de las dos cámaras del poder legislativo de Namibia, la Asamblea Nacional. Se halla en la capital del país, Windhoek. Otro edificio al este alberga la otra cámara, el Consejo Nacional.\\nEl Tintenpalast, al norte de la Avenida Robert Mugabe, fue diseñado por el arquitecto alemán Gottlieb Redecker y construido por la empresa Sander & Kock entre 1912 y 1913 con materiales regionales. Originalmente fue un edificio administrativo del gobierno alemán, porque Namibia era una colonia alemana en esta época. Fue denominado \\"Tintenpalast\\" o Palacio de la Tinta en alusión a la gran cantidad de tinta empleada por la burocracia en el edificio. Está rodeado por los Jardines del Parlamento, muy populares entre los habitantes de Windhoek.​"},{"page_url":"https://en.wikipedia.org/wiki/The_Headlands","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/The_Headlands_International_Dark_Sky_Park_-_Entrance_Sign.jpg","page_title":"The Headlands","context_page_description":"The Headlands International Dark Sky Park is a 550-acre county park in the U.S. state of Michigan. The park preserves over two miles of undeveloped Lake Michigan shoreline south and west of McGulpin Point Light in the Straits of Mackinac.\\nIt is located in, and is operated by, Emmet County in Northern Michigan. The nearest town is Mackinaw City, Michigan. The park contains woodlands and many species of rare and endangered plant life. Park fauna include the black bear, whitetail deer, coyotes, bald eagles, osprey, and the wild turkey.\\nMarked trails are provided for hiking, photography, bicycling and cross-country skiing. In May 2011, Headlands Park was awarded International Dark Sky Park designation by the International Dark-Sky Association. It was the 6th such park in the United States, and the 9th such park worldwide, to be awarded this designation. Park signage celebrates astronomy and the heritage of the Native Americans of Northern Michigan."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%B9%D9%88%D8%B3%D8%A7%D9%86%D8%8C_%D8%A7%DB%8C%D8%B1%DB%8C%D8%B2%D9%88%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/TucsonDerivative.png","page_title":"ٹوسان، ایریزونا","context_page_description":null},{"page_url":"https://en.wikipedia.org/wiki/Sharpsburg,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Sharpsburg_Community_Library_%287%29.jpg","page_title":"Sharpsburg, Pennsylvania","context_page_description":"Sharpsburg is a borough in Allegheny County, Pennsylvania, 5 miles northeast of downtown Pittsburgh, along the Allegheny River. In the past, it had a rolling mill, foundries, machine shops, and manufacturers of varnish, brick, glass, lumber products, wire, hair, felt, and lubricating oil. In 1900, 6,842 people lived here; by 1940, 8,202 people lived in Sharpsburg. The population was 3,446 at the 2010 census.\\nThe H. J. Heinz Company originated in Sharpsburg."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%88%E0%B8%B2%E0%B8%87%E0%B9%80%E0%B8%88%E0%B8%B5%E0%B8%A2%E0%B9%80%E0%B8%88%E0%B8%B5%E0%B8%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Wulingyuan_3.jpg","page_title":"จางเจียเจีย","context_page_description":"จางเจียเจีย เป็นเมืองระดับจังหวัดในมณฑลหูหนาน ประเทศสาธารณรัฐประชาชนจีน ประกอบไปด้วยเขตปกครองยองดิงและเทศมณฑลซิลี และ ซางจี ในเมืองนี้มีอู่หลิงยฺเหวียนซึ่งถูกจัดเป็นหนึ่งในมรดกโลกโดยยูเนสโก รวมไปถึงทิวทัศน์ระดับ AAAAA ซึ่งจัดโดย การท่องเที่ยวแห่งชาติจีน"},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E5%9B%BD%E4%BA%BA%E6%B0%91%E6%94%BF%E6%B2%BB%E5%8D%8F%E5%95%86%E4%BC%9A%E8%AE%AE%E7%AC%AC%E4%B8%80%E5%B1%8A%E5%85%A8%E4%BD%93%E4%BC%9A%E8%AE%AE%E4%BB%A3%E8%A1%A8%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/%E8%8C%83%E5%AD%90%E6%96%87.jpg","page_title":"中国人民政治协商会议第一届全体会议代表列表","context_page_description":"中國人民政治協商會議第一屆全體會議代表名單。附各委員會名單。\\n本次全會共有來自46個單位的代表662人，正式代表510人，候補代表77人，特別邀請人士代表75人。"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E8%AE%A9%E7%89%B9%E4%BC%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Argenteuil_-_Pont_chemin_fer_%281%29.jpg","page_title":"阿让特伊","context_page_description":"阿让特伊，法国中北部城市，法兰西岛大区瓦兹河谷省的一个市镇，同时也是该省的一个副省会，下辖阿让特伊区。其市镇面积为17.22平方公里，2017年1月1日时人口数量为110,210人，是该省人口最多的市镇，也是整个法兰西岛大区的第四大城市，仅次于巴黎、布洛涅比扬古和圣但尼，在所有法国城市中排名第36位。\\n阿让特伊位于瓦兹河谷省东南部，塞纳河右岸，与伊夫林省、上塞纳省及塞纳-圣但尼省接壤，距离法国首都巴黎市中心约11公里，自20世纪初起快速城市化，并形成了大片的居民区，现已成为巴黎的一个重要近郊卫星城，通过区域列车相连。"},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Weltmeisterschaften_2017/800_m_der_M%C3%A4nner","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Andreas_Kramer.jpg","page_title":"Leichtathletik-Weltmeisterschaften 2017/800 m der Männer","context_page_description":"Der 800-Meter-Lauf der Männer bei den Leichtathletik-Weltmeisterschaften 2017 fand zwischen dem 5. und 8. August 2017 in London, Großbritannien, statt.\\nWeltmeister wurde der Franzose Pierre-Ambroise Bosse. Der Pole Adam Kszczot gewann die Silbermedaille. Bronze ging an den Kenianer Kipyegon Bett."},{"page_url":"https://fr.wikipedia.org/wiki/F%C3%AAte_de_la_Saint-Jean","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/LesFeuxdelaSaintJeanMons2.jpg","page_title":"Fête de la Saint-Jean","context_page_description":"La fête de la Saint-Jean d'été, traditionnellement accompagnée de grands feux de joie, est la fête de Jean le Baptiste, le 24 juin.\\nElle est proche du solstice d'été dans l'hémisphère nord, qui a lieu le plus fréquemment le 21 juin, exceptionnellement le 19 juin, rarement le 20 juin et le 22 juin.\\nLe solstice d'été est fêté depuis longtemps. L'origine de cet événement est liée au culte du soleil. Les feux de solstices étaient à l'origine des fêtes païennes. L'église catholique a ensuite christianisé la pratique païenne."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%8F%88%E5%BC%8F%E9%98%B2%E5%AE%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Catenaccio1.png","page_title":"鏈式防守","context_page_description":"鏈式防守或譯十字聯防，是一種重視防守的足球戰術體系。這種戰術體系擁有一條高效而有組織的防線。\\n鏈式防守濫觴於1930年代奧地利人卡爾·拉潘在瑞士國家足球隊奉行的清道夫防守體系。一般認為真正的鏈式防守是在1947年，由內里奧·羅科在特里斯蒂納足球俱樂部首次使用，當年，特里斯蒂納令人驚奇地獲得了義大利足球甲級聯賽亞軍。\\n1960年代，國際米蘭隊的阿根廷教練埃倫尼奧·埃雷拉採用這種打法在聯賽中經常以1-0的比分戰勝對手，也使鏈式防守戰術得以成名。在義大利，鏈式防守體系較為盛行。不過，也有人批評鏈式防守導致足球比賽場面難看，過於消極。現在完全的鏈式防守戰術在比賽中已經較少使用。"},{"page_url":"https://en.wikipedia.org/wiki/Dutch_East_Indies","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/COLLECTIE_TROPENMUSEUM_Vorstelijk_echtpaar_Kangdjeng_Pangeran_Angabei_Sakalijan_met_echtgenote._TMnr_60002322.jpg","page_title":"Dutch East Indies","context_page_description":"The Dutch East Indies was a Dutch colony consisting of what is now Indonesia. It was formed from the nationalised colonies of the Dutch East India Company, which came under the administration of the Dutch government in 1800.\\nDuring the 19th century, the Dutch possessions and hegemony were expanded, reaching their greatest territorial extent in the early 20th century. This colony was one of the most valuable colonies under the Dutch Empire's rule, and contributed to Dutch global prominence in spice and cash crop trade in the 19th to early 20th century. The colonial social order was based on rigid racial and social structures with a Dutch elite living separate from but linked to their native subjects. The term Indonesia came into use for the geographical location after 1880. In the early 20th century, local intellectuals began developing the concept of Indonesia as a nation state, and set the stage for an independence movement.\\nJapan's World War II occupation dismantled much of the Dutch colonial state and economy."},{"page_url":"https://fr.wikipedia.org/wiki/David_Oakes","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/ROMY2011_b07_David_Oakes.jpg","page_title":"David Oakes","context_page_description":"David Oakes, né le 14 octobre 1983, est un acteur anglais."},{"page_url":"https://eu.wikipedia.org/wiki/Biskra","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Biskra_1.JPG","page_title":"Biskra","context_page_description":"Biskra Aljeriako hiria da, izen bereko probintziako hiriburua dena. Vescera erromatar hirian kokaturik, bere biztanle asko Banu Hilal eta Chaoui leinuko berbereak dira."},{"page_url":"https://it.wikipedia.org/wiki/Vy%C5%A1n%C3%BD_Hrabovec","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Vysny_Hrabovec.jpg","page_title":"Vyšný Hrabovec","context_page_description":"Vyšný Hrabovec è un comune della Slovacchia facente parte del distretto di Stropkov, nella regione di Prešov."},{"page_url":"https://et.wikipedia.org/wiki/Madagaskar","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Madagascar_Ariari_coins.jpg","page_title":"Madagaskar","context_page_description":"Madagaskar on riik Aafrika idarannikul India ookeanis. Ta asetseb 12. ja 25. lõunalaiuse ning 43. ja 50. idapikkuse vahel.\\nSuurem osa riigist paikneb Madagaskari saarel, mis on Aafrika mandrist eraldatud 400 km laiuse Mosambiigi väinaga. Madagaskarile kuulub arvukalt väikesi saari Madagaskari saare lähedal, sealhulgas Nosi Be, Nosi Mitsio, Nosy Vau, Sainte-Marie saar ehk Nosy Boraha, Mangabe saar ehk Nosy Mangabe, Nosy Lava, Radama ja Nosy Barren.\\nRiigi pindala on 587 041 km² või 587 051 km². Madagaskar on pindalalt Indoneesia järel suuruselt teine saareriik maailmas. Rannajoone pikkus on 4828 km.\\nKuigi madagaskarlased ei pea end aafriklasteks, on Madagaskaril tihedad sidemed Lääne-Aafrika frankofoonsete riikidega."},{"page_url":"https://fr.wikipedia.org/wiki/Art_koushite","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Anlamani-Statue_MuseumOfFineArtsBoston.png","page_title":"Art koushite","context_page_description":"L'art du royaume de Koush, de même que l'ensemble de la culture de cet État africain dans l'actuel Soudan, est considérablement influencé par l'Égypte antique.\\nParallèlement à l'histoire koushite, l'art de ce royaume se divise en deux périodes successives : à l'époque napatéenne, l'influence de l'art égyptien reste très forte. Avec peu d'inscriptions et d'informations de localisation, il est parfois difficile d'attribuer certaines œuvres d'art à l'un ou l'autre des groupes culturels de la région. Une fusion d'éléments égyptiens, hellénistiques et africains peut être observée dans la période méroïtique. Malgré l'influence manifestement égyptienne, l'art koushite développe son propre caractère."},{"page_url":"https://eo.wikipedia.org/wiki/Matarrubia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Vista_de_Matarrubia.JPG","page_title":"Matarrubia","context_page_description":"Matarrubia estas municipo de Hispanio, en la Provinco Gvadalaĥaro, regiono de Kastilio-Manĉo."},{"page_url":"https://simple.wikipedia.org/wiki/Dendrochronology","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Tree.ring.arp.jpg","page_title":"Dendrochronology","context_page_description":"Dendrochronology is tree-ring dating. It is a method of dating which uses the patterns of growth rings in trees. In many types of wood, the time rings were formed can be dated to the exact calendar year.\\nDendrochronology has three main uses:\\nradiocarbon dating, where it is used to calibrate radiocarbon ages.\\narchaeology, where it is used to date old buildings, etc.\\npalaeoecology, where it is used to determine certain aspects of past climates\\nIn some parts of the world, it is possible to date wood back a few thousand years, or even many thousands. The maximum for \\"fully anchored chronologies\\" is a little over 11,000 years from present. The term \\"fully anchored chronology\\" means the dates are absolutely certain."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_la_Catalunya_Central","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Solsona%2C_Palau_Episcopal-PM_23653.jpg","page_title":"Llista de monuments de la Catalunya Central","context_page_description":"Llista de monuments de la Catalunya Central inclosos en l'Inventari del Patrimoni Arquitectònic Català per l'àmbit territorial de les Comarques Centrals, o Catalunya Central. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb una classificació arquitectònica, els Béns Culturals d'Interès Local immobles i la resta de béns arquitectònics integrants del patrimoni cultural català.\\nL'any 2009, les Comarques Centrals tenia 325 béns culturals d'interès nacional, entre ells 311 monuments històrics i 9 conjunts històrics a més de les zones arqueològiques i paleontològiques.\\nLes llistes estan dividides per comarques, desglossades en llistes municipals en els casos més estesos. S'inclou la comarca de l'Anoia que per llei del 14 de juliol del 2010 passarà en part al nou àmbit territorial del Penedès, pendent de constituir i delimitar.\\nLlista de monuments de l'Anoia\\nLlista de monuments del Bages\\nLlista de monuments del Berguedà\\nLlista de monuments d'Osona\\nLlista de monuments del Solsonès"},{"page_url":"https://fr.wikipedia.org/wiki/Madone_Trivulzio","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Filippo_lippi%2C_madonna_trivulzio_03.JPG","page_title":"Madone Trivulzio","context_page_description":"La Madone Trivulzio est une peinture à tempera et fond or sur bois réalisée par Fra Filippo Lippi entre 1429 et 1432. Elle fut ensuite transférée sur toile et elle est aujourd'hui conservée à la pinacothèque du château des Sforza à Milan."},{"page_url":"https://no.wikipedia.org/wiki/Anton_Sjunin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Anton_Shunin.jpg","page_title":"Anton Sjunin","context_page_description":"Anton Vladimirovitsj Sjunin er en russisk fotballspiller som spiller for FK Dinamo Moskva."},{"page_url":"https://simple.wikipedia.org/wiki/Mario_Abramovich","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Abramovich_el_dia_de_su_casamiento.jpg","page_title":"Mario Abramovich","context_page_description":"Mario Abramovich was an Argentine violinist and composer of Jewish descent. He was a member of the group Sexteto Mayor since its founding in 1973, until his death in 2014. He was known for performing in the Argentine album Bête Noire.\\nAbramovich died in Buenos Aires, Argentina, aged 88."},{"page_url":"https://ca.wikipedia.org/wiki/Futbol_a_Su%C3%AFssa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Soccer_Switzerland.png","page_title":"Futbol a Suïssa","context_page_description":"El futbol és l'esport més popular a Suïssa."},{"page_url":"https://es.wikipedia.org/wiki/Literatura_de_Venezuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Historia_de_la_conquista_de_Venezuela.jpg","page_title":"Literatura de Venezuela","context_page_description":"Literatura de Venezuela se refiere a la obra literaria realizada en este país desde el período de la conquista y colonización hasta el presente."},{"page_url":"https://de.wikipedia.org/wiki/Silvio_Santos","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Silvio_Santos_em_maio_de_2019.jpg","page_title":"Silvio Santos","context_page_description":"Silvio Santos ist ein brasilianischer Moderator und Medienunternehmer und Eigentümer des Sendernetzwerkes SBT."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%A8%E3%82%A2%E3%82%A4%E3%82%B9%E3%83%A9%E3%83%B3%E3%83%89%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E5%A4%A7%E4%BD%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/U.S._Department_of_State_official_seal.svg","page_title":"在アイスランドアメリカ合衆国大使","context_page_description":"1874年までのアイスランドは、独立国というよりはデンマークの保護領であった。1874年、デンマークはアイスランドに自治を認め、1904年に拡大した。1918年の連邦法により、アイスランドは共通の国王のもとでデンマークと連合する主権国家として承認された。アイスランドは独自の国旗を制定し、外交及び防衛はデンマークに委任した。その結果、在デンマーク米国大使が米国とアイスランドとの外交関係を担当した。\\n1940年4月9日のドイツによるデンマーク占領は、アイスランドとデンマークとの関係を断ち切った。その結果、アイスランド議会は4月10日、外交を自国で担うことを決議した。米国は1941年8月8日、リンカン・マクヴェーグを初代在アイスランド大使に任命した。マクヴェーグは1941年9月30日、アイスランド外相に信任状を奉呈した。彼の職名は、特命使節及び全権公使であった。以後、米国はアイスランドとの外交関係を維持してきた。\\n国民投票の結果、アイスランドは1944年6月17日、正式に独立の共和国となった。"},{"page_url":"https://de.wikipedia.org/wiki/Sepultura","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Sepultura-18.jpg","page_title":"Sepultura","context_page_description":"Sepultura ist eine 1984 gegründete Metal-Band aus Belo Horizonte. Auf ihren Bandnamen stießen die Mitglieder beim Übersetzen des Motörhead-Titels Dancing on Your Grave."},{"page_url":"https://cs.wikipedia.org/wiki/Chytov%C3%A1_kli%C4%8Dka","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Henkel_02.jpg","page_title":"Chytová klička","context_page_description":"Chytová klička je vazební prvek pletenin."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%B2%BE%E7%B4%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Male_anatomy_zh.svg","page_title":"精索","context_page_description":"精索是男性自腹股溝環到睪丸的索狀結構；由輸精管、睪丸動脈、蔓狀靜脈叢、神經及其他小管道組成，表面為被膜包繞。\\n精索易受扭曲。扭曲會使得睪丸血供受阻，在數小時內可對睪丸造成無可恢復的損傷。"},{"page_url":"https://ast.wikipedia.org/wiki/Rep%C3%BAblica_de_Ragusa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Mercante_Raguseo.jpg","page_title":"República de Ragusa","context_page_description":"La República de Ragusa foi una república marítima originariamente neollatina, dafechu soberana, allugada na mariña adriática de la Dalmacia, qu'esistió dende'l sieglu XIV hasta 1808, no que güei ye l'estremu sur de Croacia y una parte pequeña de Montenegru. El so lema yera la llibertá nun se viende nin por tol oru del mundu."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%98%E3%83%B3%E3%83%AA%E3%83%BC%E3%83%BB%E3%82%A8%E3%83%9E%E3%83%BC%E3%82%BD%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Emerson1975.jpg","page_title":"ヘンリー・エマーソン","context_page_description":"ヘンリー・エヴェレット・\\"ハンク\\"・エマーソンは、アメリカの軍人。1970年代、第2歩兵師団長を務めたことで知られる。当時、第2師団にはコリン・パウエルが大隊長として勤務していた。"},{"page_url":"https://pt.wikipedia.org/wiki/Osh","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Osh_03-2016_img31_view_from_Sulayman_Mountain_pano.jpg","page_title":"Osh","context_page_description":"Osh é a segunda maior cidade do Quirguistão, e a capital da província de Osh. Localizada no sudoeste do país, Osh se encontra na fronteira com o Uzbequistão. A cidade tem cerca de 255,800 habitantes e possui forte tradição como centro industrial. Osh abriga o maior mercado a céu aberto da Ásia Central.\\nEm 1990, fortes combates em Osh, entre as populações étnicas de uzbeques e quirguizes, resultaram em milhares de mortes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%9F%D0%B5%D1%80%D0%B2%D0%BE%D0%B7%D0%B2%D0%B0%D0%BD%D0%BD%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Chersonesos_-_Apostol_Andrey.jpg","page_title":"Андрей Первозванный","context_page_description":"Апо́стол Андре́й, больше известный как апостол Андре́й Первозва́нный — один из двенадцати апостолов, учеников Иисуса Христа; первым, согласно Евангелию от Иоанна, был призван Иисусом Христом, поэтому назван Первозванным. В списках апостолов, приводимых в Евангелиях от Матфея и Луки, занимает второе место после своего брата, апостола Петра, но в Евангелии от Марка — четвёртое место. Персонаж книг Нового Завета.\\nПо преданию, был распят в Патрах около 67 года. Считается, что X-образный или косой, так называемый «андреевский» крест, впервые появился в юго-западной Франции в X веке и с XIV века стал традиционным, хотя первоисточник такой формы креста неизвестен. В итальянское искусство косой крест привнесён уже после периода Возрождения.\\nИконографически апостол Андрей изображается в красном и зелёном одеянии с недлинной бородой, держащий крест или с косым крестом, символом его мученической казни, а также свитком в руке или книгой."},{"page_url":"https://es.wikipedia.org/wiki/Vanessa_Colaiutta","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Vanessa_colaiutta.jpg","page_title":"Vanessa Colaiutta","context_page_description":"Roxana Vanesa Méndez, conocida con el nombre artístico de Vanessa Méndez y/o Vanessa Colaiutta, es una cantante, escritora y compositora argentina de estilo melódico, pop & rock. Argentina de nacimiento, actualmente se encuentra radicada en México. En su carrera profesional como interprete ha editado a la fecha 7 discos como solista.​\\nHa participado en colaboración con otros artistas como Andrés Calamaro, y ha integrado junto con su hermano Rodrigo Méndez el Dúo Makana 8 ½​.Como compositora, diversos cantantes han grabado canciones de su autoría como Paulina Rubio, Sentidos Opuestos, José Luis “el puma” Rodríguez, Nydia Rojas, Cuisillos, Ana Bárbara, Lupita Dalessio, Kudai, entre otros.​"},{"page_url":"https://nl.wikipedia.org/wiki/BSA_A7-serie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/1948_BSA_A7_500cc-motorcycle_right_side.jpg","page_title":"BSA A7-serie","context_page_description":"De BSA A7-serie is een serie 500cc-motorfietsen die het Britse merk BSA uit Birmingham produceerde van 1947 tot 1962."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D1%8B%D0%B1%D0%BE%D0%B2%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/%D0%94%D0%BE%D1%80%D0%B0_%D0%93%D0%B0%D0%B1%D0%B5.JPG","page_title":"Дыбовик","context_page_description":"Дыбовик — село в Болгарии. Находится в Добричской области, входит в общину Генерал-Тошево. Население составляет 175 человек."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%90%B3%E8%82%87%E8%BB%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Siuhinng_%40_elements.jpeg","page_title":"吳肇軒","context_page_description":"吳肇軒（英文：Ng Siu Hin，1993年7月9號—），係香港男演員，香港演藝學院戲劇學院畢業，參演2015年電影《哪一天我們會飛》出道，之後拍過唔少電影同電視劇。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E4%BA%AC%E5%B8%82%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Former_Military_Police_Command_in_Nanjing_01_2012-10.JPG","page_title":"南京市文物保护单位","context_page_description":"南京市文物保护单位至2012年3月已公布四批。\\n第一批：1982年8月13日公布。\\n第二批：1992年3月17日公布：\\n古文化遗迹\\n古墓葬\\n石刻\\n古建筑及历史纪念物\\n近现代历史遗迹及革命纪念物\\n现代优秀建筑\\n第三批：2006年6月10日公布\\n古遗址\\n古墓葬\\n古建筑\\n石窟寺及石刻\\n近现代重要史迹及代表性建筑\\n其它\\n第四批：2012年3月20日\\n古遗址\\n古墓葬\\n古建筑\\n石窟寺及石刻\\n近现代重要史迹及代表性建筑\\n扩展项目"},{"page_url":"https://it.wikipedia.org/wiki/Montalto_Uffugo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Chiesa_Matrice_Montalto.jpg","page_title":"Montalto Uffugo","context_page_description":"Montalto Uffugo è un comune italiano di 20 220 abitanti della provincia di Cosenza in Calabria.\\nÈ parte integrante dell'area urbana cosentina. Sorge probabilmente sull'antica Aufugum."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%92%D0%B8%D0%BB%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Kaunas_kunfluejo_de_Nemunas_kaj_Neris.jpg","page_title":"Вилија","context_page_description":"Вилија или Нерис — река во Белорусија и Литванија, десна притока на Неман. Долга е вкупно 510 км.\\nИзвира во Белорусија и тече низ земјата 276 км и се нарекува Вилија, па продолжува во Литванија 235 км под името Нерис.\\nНерис ја поврзува старата престолнина Кернаве со денешниот главен град Вилнус. Долж бреговите се наоѓаат гробници од стариот век. Кај селото Кармазинај, 25 км од Вилнус се расположени погребни могили со камења од митолошко значење и свет даб."},{"page_url":"https://it.wikipedia.org/wiki/Andrew_Feustel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Andrew_Feustel_performs_work_on_the_Hubble_Space_Telescope.jpg","page_title":"Andrew Feustel","context_page_description":"Andrew Jay \\"Drew\\" Feustel è un astronauta e geofisico statunitense.\\nVenne selezionato dalla NASA come astronauta nel 2000. Partecipò a due missioni Shuttle, STS-125 e STS-134, e a una missione di lunga durata Expedition 55/56, a bordo della Stazione Spaziale Internazionale"},{"page_url":"https://fr.wikipedia.org/wiki/Chanoz-Ch%C3%A2tenay","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Panneau_entr%C3%A9e_Chanoz_Ch%C3%A2tenay_9.jpg","page_title":"Chanoz-Châtenay","context_page_description":"Chanoz-Châtenay est une commune française, située dans le département de l'Ain en région Auvergne-Rhône-Alpes.\\nAppartenant depuis 2015 au canton de Vonnas, la commune est née de la fusion entre l'ancienne paroisse de Chanoz et le fief de Châtenay."},{"page_url":"https://ro.wikipedia.org/wiki/Acon","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Map_commune_FR_insee_code_27002.png","page_title":"Acon","context_page_description":"Acon este o comună în departamentul Eure, Franța. În 2009 avea o populație de 474 de locuitori."},{"page_url":"https://en.wikipedia.org/wiki/Edward_Haycock_Sr.","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/7_Portland_Place_%28geograph_3670784%29.jpg","page_title":"Edward Haycock Sr.","context_page_description":"Edward Haycock Sr. was an architect working in the West Midlands and in central and southern Wales in the late Georgian and early Victorian periods."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D1%85%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F,_%D0%AE%D0%BB%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Julia_Michalska%2C_2010.jpg","page_title":"Михальская, Юля","context_page_description":"Юля Лудвика Михальская-Плотковяк — польская гребчиха, выступавшая за сборную Польши по академической гребле в период 2002—2015 годов. Бронзовая призёрка летних Олимпийских игр в Лондоне, чемпионка мира, обладательница серебряной медали чемпионата Европы, победительница и призёрка многих регат национального значения."},{"page_url":"https://es.wikipedia.org/wiki/Hyperoartia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Lampera_illustration_side_es.png","page_title":"Hyperoartia","context_page_description":"Los hiperoartios son una clase de agnatos, conocidos popularmente con el nombre de lampreas. Son semejantes externamente a las anguilas, aunque no están emparentados con ellas; tienen el cuerpo gelatinoso, cilíndrico, sin escamas y muy resbaladizo. A pesar de compartir muchas características con los peces, taxonómicamente no se incluyen en este grupo sino que forman un grupo independiente y muy antiguo, situándose en la base del origen de los vertebrados. Son marinas o de agua dulce. Son ovovivíparas.\\nJunto a los mixinos y varios grupos de peces sin mandíbula extintos formaban el grupo parafilético de los agnatos. Sin embargo nuevos estudios genéticos han encontrado que las lampreas están más emparentadas con los mixinos que con los gnatostomados formando el clado Cyclostomata.​​​ Esta agrupación exige excluir a las lampreas del clado Cephalaspidomorphi los cuales serían peces sin mandíbula más cercanos a los gnatostomados."},{"page_url":"https://de.wikipedia.org/wiki/Seemine","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Die_Gefahr_der_treibenden_Minen.jpg","page_title":"Seemine","context_page_description":"Seeminen sind Sprengladungen, die im Wasser gegen Schiffe und U-Boote eingesetzt werden. Der Oberbegriff für das im Minenkrieg verwendete Material ist „Sperrwaffen“."},{"page_url":"https://pt.wikipedia.org/wiki/Aldina","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Aldina_latifolia_Taub100.png","page_title":"Aldina","context_page_description":"Aldina é um género botânico pertencente à família Fabaceae.\\nPlantas nativas da região Amazônica da Venezuela."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%80%D0%BC%D0%B5_(%D1%81%D0%B5%D0%BB%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/V%C4%81rmes_pagastnams_2002-07-10_-_panoramio.jpg","page_title":"Варме (село)","context_page_description":"Варме — населённый пункт в Кулдигском крае Латвии. Административный центр Вармской волости. Расстояние до города Кулдига составляет около 25 км. По данным на 2005 год, в населённом пункте проживало 500 человек. Есть волостная администрация, начальная школа, детский сад, библиотека, молодёжный центр, спортивный зал, почтовое отделение, аптека, поместье и школьный музей."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D9%86%D8%AA%DB%8C%D9%85%DB%8C%D9%82%D9%84%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Ventimiglia-panorama.JPG","page_title":"ونتیمیقلیا","context_page_description":"ونتیمیقلیا ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. دنیز سوُلاری سَویه‌سیندن ۹ متر یۇکسک‏لیکده یئر آلیب. سوْن نۆفوس ساییمی اساسيندا 25763 نفر ایمیش."},{"page_url":"https://eu.wikipedia.org/wiki/Cheiromeles_parvidens","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Distribution_of_Cheiromeles_parvidens.png","page_title":"Cheiromeles parvidens","context_page_description":"Cheiromeles parvidens Cheiromeles generoko animalia da. Chiropteraren barruko Molossinae azpifamilia eta Molossidae familian sailkatuta dago"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D9%88%D8%B1%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/M_410_combine.jpg","page_title":"لوردا","context_page_description":"لَوِردا تولیدکننده کمباین و تجهیزات علوفه است که در برگانتزه، ایتالیا مستقر است. این در سال ۱۸۷۳ توسط پیترو لوردا برای تولید ابزار کشاورزی در استان ویچنزا تأسیس شد."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%8D%E5%BE%B7%C2%B7%E5%93%88%E7%91%9E%E6%96%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Wood_harris_air_force1.jpg","page_title":"伍德·哈瑞斯","context_page_description":"伍德·哈瑞斯，美国演员。他最出名的角色或许就是在HBO电视剧《火线》中饰演的伊旺·巴克斯戴尔以及在体育电影《冲锋陷阵》中饰演的朱利斯·坎贝尔。"},{"page_url":"https://en.wikipedia.org/wiki/St_Nicholas%27_Church,_Berden","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Berden_St_Nicholas_interior_-_08_pulpit.jpg","page_title":"St Nicholas' Church, Berden","context_page_description":"St Nicholas' Church is a Grade I listed parish church in the village of Berden, Essex, England.\\nOf the Early English Gothic style, the church has a Norman nave with 13th-century transepts and a tower dated to the 15th century. It underwent major restoration in 1868.\\nThe church held a 20th-century 38-year revival of a \\"Boy Bishop\\" miracle play. It contains memorials to significant families of the local Berden Hall and Berden Priory, and to a murdered Berden parish constable.\\nSt Nicholas’ is part of a joint benefice—sharing a common priest— in the Deanery of Saffron Walden of the Diocese of Chelmsford. Other churches in the group are St Mary the Virgin at Manuden; St Simon and St Jude at Quendon; and All Saints at Rickling."},{"page_url":"https://it.wikipedia.org/wiki/Jos%C3%A9_Pereira_de_Lacerda","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Cardeal_Lacerda.jpg","page_title":"José Pereira de Lacerda","context_page_description":"José Pereira de Lacerda è stato un cardinale e vescovo cattolico portoghese."},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8Ceskolipsk%C3%BD_vikari%C3%A1t","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Mimo%C5%88_kaple_Bo%C5%BE%C3%ADho_hrobu_4.jpg","page_title":"Českolipský vikariát","context_page_description":"Českolipský vikariát je jedním z 10 vikariátů litoměřické diecéze. Vikariát má 47 farností."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%B5%CF%84%CF%81%CF%8C_%CE%91%CE%B8%CE%AE%CE%BD%CE%B1%CF%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/20140622-Anthoupoli-62D304_%287872%29.jpg","page_title":"Μετρό Αθήνας","context_page_description":"Το Μετρό της Αθήνας είναι ένα δίκτυο υπογείων, επιγείων και υπέργειων αστικών σιδηροδρόμων της Αττικής και συγκεκριμένα των περιοχών της Μητροπολιτικής περιοχής της Αθήνας. Παραμένει μέχρι να ολοκληρωθούν οι εργασίες του Μετρό Θεσσαλονίκης, το μοναδικό δίκτυο μετρό στην Ελλάδα. Εξυπηρετεί την Μητροπολιτική περιοχή της Αθήνας, η οποία έχει πληθυσμό σχεδόν 4 εκατομμυρίων κατοίκων, σύμφωνα με την απογραφή του 2011, ενώ παράλληλα συνδέεται με τον Προαστιακό Σιδηρόδρομο καθώς και το δίκτυο του τραμ σχηματίζοντας έτσι ένα ενιαίο δίκτυο το οποίο εξυπηρετεί το μεγαλύτερο μέρος της Αττικής. Το μετρό της Αθήνας προσφέρει, εκτός άλλων, πρόσβαση στο Διεθνές Αεροδρόμιο Αθηνών «Ελευθέριος Βενιζέλος» που βρίσκεται στην πεδιάδα των Μεσογείων, στην Ανατολική Αττική, καθώς και στο Λιμάνι του Πειραιά.\\nΤο δίκτυο μετρό της Αθήνας αποτελείται από 3 γραμμές, με 64 συνολικά σταθμούς. Σε καθημερινή βάση, με το μετρό μετακινούνται κατά μέσον όρο 614.000 επιβάτες στην μητροπολιτική περιοχή της πρωτεύουσας. Σε πανευρωπαϊκό επίπεδο, το μετρό Αθήνας βρίσκεται στην 17η θέση και σε βαλκανικό επίπεδο στην 2η θέση μετά την Κωνσταντινούπολη."},{"page_url":"https://en.wikipedia.org/wiki/De%C3%A1k_Ferenc_Bilingual_High_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/De%C3%A1k_Ferenc_Ellinger.jpg","page_title":"Deák Ferenc Bilingual High School","context_page_description":"The Deák Ferenc Bilingual High School is a public, co-educational secondary school in Szeged, Hungary established in 1988. It is the youngest secondary educational institution in the city of Szeged. It is named after Ferenc Deák, a famous 19th-century Hungarian politician who is also known as the Sage of the Nation. From the beginning, language education served as the main focus of the school in addition to its mission to provide a multifunctional place amidst its surroundings of panel housing estates, hence it leases out the Theater Hall—which can be opened together with the Atrium—for various cultural programs. The school has been participating in the debate forum called European Classes since 1997, it is the member of the initiative PUSCH, and that of the DSD program since 2008. The rate of acceptance to higher education is 89-90%.\\nStudents within the Hungarian-English bilingual program have a higher number of classes in English. Furthermore, for them, the language of education concerning mathematics, biology, geography and history is English."},{"page_url":"https://sv.wikipedia.org/wiki/Gahnia_setifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Gahnia_setifolia_11.JPG","page_title":"Gahnia setifolia","context_page_description":"Gahnia setifolia är en halvgräsart som beskrevs av Joseph Dalton Hooker. Gahnia setifolia ingår i släktet Gahnia och familjen halvgräs. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BB%81%E5%A3%81%E7%A5%9E%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Nikabe-jinja%2C_haiden.jpg","page_title":"仁壁神社","context_page_description":"仁壁神社は、山口県山口市三の宮にある神社。式内社、周防国三宮で、旧社格は県社。"},{"page_url":"https://de.wikipedia.org/wiki/Vire_Normandie","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/FranceNormandieCouloncesEglise.jpg","page_title":"Vire Normandie","context_page_description":"Vire Normandie ist eine französische Gemeinde mit 17.178 Einwohnern im Département Calvados in der Region Normandie. Sie ist dem Arrondissement Vire und dem Kanton Vire zugehörig.\\nVire Normandie ist die südlichste Gemeinde des Départements Calvados. Sie entstand als Commune nouvelle im Zuge einer Gebietsreform zum 1. Januar 2016 durch die Fusion von acht ehemaligen Gemeinden, die nun Ortsteile von Vire Normandie darstellen. Vire fungiert dabei als „übergeordneter Ortsteil“ als Verwaltungssitz."},{"page_url":"https://it.wikipedia.org/wiki/Grant_Park_Music_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Frederick_Stock.png","page_title":"Grant Park Music Festival","context_page_description":"Il Grant Park Music Festival è una serie di concerti di musica classica di dieci settimane che si tengono a Chicago, Illinois, United States. Presenta la Grant Park Symphony Orchestra e il Grant Park Chorus, insieme ad esecutori e direttori ospiti. Il Festival ha guadagnato lo status di organizzazione non a scopo di lucro. Sostiene di essere l'unica serie di musica classica all'aperto libera della nazione. Il Grant Park Music Festival è una tradizione di Chicago dal 1931, quando il sindaco di Chicago Anton Cermak suggerì concerti gratuiti per sollevare gli spiriti di Chicago durante la grande depressione. La tradizione sinfonica dei concerti del Grant Park Music Festival iniziò nel 1935.\\nIl Festival è ospitato nel Jay Pritzker Pavilion nella sezione Millennium Park del Grant Park, nel Chicago Loop. La stagione 2004, durante la quale il Festival si è trasferito al Pritzker Pavilion, è stata la settantesima stagione del Festival. Occasionalmente il Festival si è tenuto presso l'Harris Theatre anziché al Pritzker Pavilion. Precedentemente il Grant Park Music Festival si era tenuto presso la Petrillo Music Shell del Grant Park."},{"page_url":"https://vi.wikipedia.org/wiki/X%C3%A3_Summerhill,_Qu%E1%BA%ADn_Crawford,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Summerhill_Township_barn_on_PA18.jpg","page_title":"Xã Summerhill, Quận Crawford, Pennsylvania","context_page_description":"Xã Summerhill là một xã thuộc quận Crawford, tiểu bang Pennsylvania, Hoa Kỳ. Năm 2010, dân số của xã này là 1.236 người."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%94%D5%A1%D6%80%D5%A1%D5%B5%D5%AE%D5%B6%D5%A5%D6%80%D5%AB_%D5%AF%D5%AB%D6%80%D5%B3%D5%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Lower_antelope_stairs_md.jpg","page_title":"Քարայծների կիրճը","context_page_description":null},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%83%BC%E3%83%89%E3%82%A2%E3%82%A4%E3%83%A9%E3%83%B3%E3%83%89%E5%B7%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Verrazzano_monument.jpg","page_title":"ロードアイランド州","context_page_description":"ロードアイランド州は、アメリカ合衆国東北部、ニューイングランド地方にある州である。州都および人口最大都市は州北部、ナラガンセット湾の湾奥に位置する港湾都市・学術都市プロビデンスである。州全土がプロビデンス大都市圏に含まれている。\\n独立時の13州の1つである。全米50州の中で面積最小の州であり、日本における滋賀県と同程度の面積である。Little Rhodyという愛称を持つ。より一般的な愛称は、地形的な理由、すなわち、州内の陸地の奥深くまでナラガンセット湾が入り込んでいることから、観光用パンフレットでよく使われる The Ocean State であり、これは自動車のナンバープレートにも記されている。人口は50州の中で第43位だが、人口密度はニュージャージー州に次いで第2位である。西はコネチカット州に、北と東はマサチューセッツ州に接しており、南西のニューヨーク州ロングアイランドとは海上の州境がある。マサチューセッツ州とともに繁殖力の強い鶏の原産地でもある。"},{"page_url":"https://de.wikipedia.org/wiki/Zwerg-Dattelpalme","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Starr_031108-0139_Phoenix_roebelenii.jpg","page_title":"Zwerg-Dattelpalme","context_page_description":"Die Zwerg-Dattelpalme ist eine in Südostasien heimische Palmenart, die häufig als Zierpflanze Verwendung findet."},{"page_url":"https://en.wikipedia.org/wiki/Ottonian_architecture","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Ottonischer_Bau.jpg","page_title":"Ottonian architecture","context_page_description":"Ottonian architecture is an architectural style which evolved during the reign of Emperor Otto the Great. The style was found in Germany and lasted from the mid 10th century until the mid 11th century.\\nOttonian architecture draws its inspiration from Carolingian and Byzantine architecture. Apart from some examples influenced by the octagonal Palatine Chapel at Aachen such as Ottmarsheim and the apse of the abbey of the Holy Trinity at Essen, religious architecture tends to diverge from the centralised plan. Inspiration though from the Roman basilica remains concurrent, and Ottonian architecture preserves the Carolingian double ended feature with apses at either end of the church."},{"page_url":"https://ru.wikipedia.org/wiki/Tupanvirus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Tupanvirus.jpeg","page_title":"Tupanvirus","context_page_description":"Tupanvirus — род ДНК-содержащих вирусов из семейства Mimiviridae. Представители рода являются одними из крупнейших известных вирусов. Род описан в феврале 2018 года бразильско-французской группой микробиологов. Включает два вида. По состоянию на март 2020 года род не зарегистрирован в Международном комитете по таксономии вирусов."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%99%D0%BE%D1%81%D0%B8%D1%84_%D0%93%D1%83%D1%80%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Gurko_IV.jpg","page_title":"Йосиф Гурко","context_page_description":"Йосиф Владимирович Ромейко-Гурко е руски граф, офицер, генерал-фелдмаршал. Участник в Руско-турската война от 1877 – 1878. Отличава като суров, но способен, решителен и енергичен пълководец, служещ за пример на своите войници, делейки всички трудности наравно с тях. За своя голям принос в Освобождението на България е особено почитан в страната, където редица населени места и улици носят неговото име. Генерал-губернатор на Варшава от 1883 до 1894 г. – период, запомнен в полското общество с бруталността и фанатизма при налагане на политиката на насилствена русификаци."},{"page_url":"https://tr.wikipedia.org/wiki/Toltekler","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Telamones_Tula.jpg","page_title":"Toltekler","context_page_description":"Toltekler, Kolomb öncesi Amerika uygarlıklarından birini oluşturan halk olup, Meksika'daki Aztek-öncesi üç kültürden biri olarak kabul edilirler. Meksika topraklarında ilk insan topluluklarına ait izler, tarihçilere göre, yaklaşık 20.000 yıl öncesine dayanır.\\n\\"Toltekler\\" sözcüğü Nahuatl dilinde \\"inşaatçı üstatlar\\" anlamına gelir. Hakkında fazla bilgi sahibi olunmayan kadim Amerika uygarlıklarından biri olan Toltekler'in kökeni ve yaşadıkları dönem hakkında çeşitli varsayımlar bulunmaktadır. Şimdilik en kabul gören varsayım, nereden geldikleri bilinmeyen bu halkın günümüzden 3300 yıl önce mevcut olduğudur. İleri bir uygarlık oluşturdukları sanılmaktadır. Başkentleri arkeologlara göre, Mexico'dan yaklaşık 80 km uzaklıkta bulunan, Teotihuacan yakınlarındaki, Tula olarak belirtilen bir kenttir. Bir Toltek efsanesine göre Tula adı, aslında anavatanlarındaki, \\"ak dağ\\"ın bulunduğu bir adaydı.\\nAztekler, terkedilmiş mükemmel Toltek yapıları ya da kalıntılarıyla karşılaştıklarında bu yapılara çeşitli yönlerden hayran kalmış ve onları ulu bir toplum olarak nitelendirmişlerdir."},{"page_url":"https://pl.wikipedia.org/wiki/Gda%C5%84sk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/GdanskSopot_ErgoArena_20110603.jpg","page_title":"Gdańsk","context_page_description":"Gdańsk – miasto na prawach powiatu w północnej Polsce w województwie pomorskim, położone nad Morzem Bałtyckim u ujścia Motławy do Wisły nad Zatoką Gdańską. Centrum kulturalne, naukowe i gospodarcze oraz węzeł komunikacyjny północnej Polski, stolica województwa pomorskiego. Ośrodek gospodarki morskiej z dużym portem handlowym.\\nGdańsk z 470 907 mieszkańcami zajmuje szóste miejsce w Polsce pod względem liczby ludności, a siódme miejsce pod względem powierzchni – 261,96 km². Ośrodek aglomeracji trójmiejskiej, nazywaną też gdańską, wraz z Gdynią i Sopotem tworzą Trójmiasto.\\nJest to miasto o ponadtysiącletniej historii, którego tożsamość na przestrzeni wieków kształtowała się pod wpływem różnych kultur. Gdańsk był również największym miastem Rzeczypospolitej Obojga Narodów, miastem królewskim i hanzeatyckim, posiadał prawo do czynnego uczestnictwa w akcie wyboru króla, w XVI w. był najbogatszym w Rzeczypospolitej. Miasto było też ważnym ośrodkiem kulturalnym. Gdańsk uznawany jest za symboliczne miejsce wybuchu II wojny światowej oraz początku upadku komunizmu w Europie Środkowej."},{"page_url":"https://no.wikipedia.org/wiki/Politikk%C3%A5ret_1903","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Bourguiba_photo_officielle.jpg","page_title":"Politikkåret 1903","context_page_description":"Politikkåret 1903 er en oversikt over hendelser, valg, fødte og avdøde personer med tilknytning til politikk i 1903."},{"page_url":"https://da.wikipedia.org/wiki/Walter_Sickert","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Walter_Sickert_photo_by_George_Charles_Beresford_1911_%281%29.jpg","page_title":"Walter Sickert","context_page_description":"Walter Richard Sickert var en engelsk impressionistisk kunstmaler af dansk afstamning. Sickert var kosmopolit og excentriker og foretrak almindelige mennesker og urbane scener som motiver. Hans berømteste morbide billeder er undtagelser.\\nBlandt andet i bogen Portræt af en morder søger kriminalforfatteren Patricia Cornwell at føre bevis for, at Walter Sickert var Jack the Ripper, som i november 1888 begik fem bestialske kvindemord i London."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%A1%D5%A9%D5%B6%D5%A1%D5%B2%D5%A2%D5%B5%D5%B8%D6%82%D6%80_(%D5%B0%D5%B8%D6%82%D5%B7%D5%A1%D5%B2%D5%A2%D5%B5%D5%B8%D6%82%D6%80,_%D5%8E%D5%A1%D5%B2%D5%A1%D6%80%D5%B7%D5%A1%D5%BA%D5%A1%D5%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Katnaghbyour_Spring%2C_ArmAg_%284%29.JPG","page_title":"Կաթնաղբյուր (հուշաղբյուր, Վաղարշապատ)","context_page_description":"Կաթնաղբյուր, հուշաղբյուր Էջմիածնի մայր տաճարի տարածքում՝ տաճարի գլխավոր մուտքից ձախ։ Ընդգրկված է Վաղարշապատի պատմության և մշակույթի անշարժ հուշարձանների ցանկում։"},{"page_url":"https://uk.wikipedia.org/wiki/Tomiyamichthys_russus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Tomiyamichthys_russus.jpg","page_title":"Tomiyamichthys russus","context_page_description":"Tomiyamichthys russus — вид риб з родини бичкових. Демерсальна, морська тропічна риба.\\nПоширені в західній Пацифіці, а саме у Південно-Китайському морі і вздовж берегів південно-східної Азії і біля островів Малайського архіпелагу Папуа Нової Гвінеї, Авcтралії."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%83%B3%E3%83%91%E3%82%A6%E3%83%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Ibirapuera%2C_Pavilh%C3%A3o_Ciccillo_Matarazzo_%28biennale%29_07.JPG","page_title":"サンパウロ","context_page_description":"サンパウロは、ブラジル南東部に位置する都市。サンパウロ州の州都。\\n人口約1,200万人。ブラジルのみならず、南半球最大のメガシティである。2016年の都市圏人口は2,060万人で、世界第10位、南半球では第1位である。アメリカのシンクタンクが2016年に発表した世界都市ランキングでは、世界34位と評価された。ブラジルの都市としては、リオデジャネイロを凌ぎ首位であった。\\n略称として SP や S.Paulo と表記される。住人の呼称は「パウリスターノ 」、女性形は「パウリスターナ 」。"},{"page_url":"https://ca.wikipedia.org/wiki/Balaz%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Balaz%C3%A9_%2835%29_Mairie.jpg","page_title":"Balazé","context_page_description":"Balazé és un municipi francès, situat a la regió de Bretanya, al departament d'Ille i Vilaine. L'any 2006 tenia 2.062 habitants. Limita al nord-oest amb Taillis, al nord amb Châtillon-en-Vendelais, al nord-est amb Montautour, a l'est amb Saint-M'Hervé, al sud-oest amb Montreuil-sous-Pérouse i al sud amb Vitré."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%85%D9%84%D8%A7%D8%B9%D8%A8_%D9%83%D8%A3%D8%B3_%D8%A7%D9%84%D8%B9%D8%A7%D9%84%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Estadio_Ol%C3%ADmpico_Universitario_2.jpeg","page_title":"قائمة ملاعب كأس العالم","context_page_description":"هذه قائمة ملاعب كأس العالم، ولدى الاتحاد الدولي لكرة القدم متطلبات توجيهية صارمة على الملعب منذ عام 2001. يجب أن تبلغ سعة الملاعب ما لا يقل عن 40000، ويجب ألا يقل عدد الملاعب التي تستضيف دور الثمانية عن 60000، ويجب أن يكون لدى الملعب الذي يستضف حفل الافتتاح والمباراة النهائية أن يكون ما لا يقل عن 80000. بالإضافة إلى ذلك، يجب أن يكون لدى الملاعب أقل عدد ممكن من حوامل كاميرات التلفزيون ومناطق الوسائط وأن تكون خالية من الإعلانات طوال كأس العالم. ويشمل ذلك أسماء الملاعب - على سبيل المثال، خلال كأس العالم 2006 تم تغيير الملاعب الألمانية مثل أليانز أرينا \\"استاد كأس العالم لكرة القدم - ميونيخ\\" لأسباب الترخيص."},{"page_url":"https://br.wikipedia.org/wiki/Olol%C3%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Olole_113-1-11-43.jpg","page_title":"Ololê","context_page_description":"Ololê a oa ur gazetenn gristen ha broadelour evit ar vugale, e galleg hag e brezhoneg, bet embannet e-kerzh an Eil Brezel-bed gant an ti Éditions du Léon e Landerne. Un eil kazetenn damheñvel, anvet L'appel d'Ololê, a voe embannet en Asnières-sur-Seine etre 1970 ha 1974. Un ti-embann e voe Ololê ivez."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%93%9C%E7%BA%B3%E5%B7%B4%E6%8B%89%E5%AE%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Jardim_sim%C3%A9trico_do_Pal%C3%A1cio_Guanabara.jpg","page_title":"瓜纳巴拉宫","context_page_description":"瓜纳巴拉宫是巴西里约热内卢州的州政府驻地，位于里约热内卢南区的拉兰热拉斯社区。"},{"page_url":"https://nl.wikipedia.org/wiki/7_september","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Songfestival_19%2C_20_Ritha_Hovink_%2C_21%2C_22_Air_Bubble%2C_Bestanddeelnr_929-0095.jpg","page_title":"7 september","context_page_description":"7 september is de 250ste dag van het jaar in de gregoriaanse kalender. Hierna volgen nog 115 dagen tot het einde van het jaar."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%83%D0%BB%D0%B8%D1%86%D1%8F_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Kherson-church-27082010%28012%29.jpg","page_title":"Вулиця Богородицька","context_page_description":"Богородицька вулиця — вулиця в Херсоні, розташована в Суворовському та Корабельному районах, з'єднує проспект Ушакова з Корабельною площею. Формує єдину лінію вулиць із Портовою, що спрямована від проспекту Ушакова в протилежний бік — на схід\\nЛише у другій половині XIX ст. формування сучасної вулиці Богородицької завершилося, але її східна і західна частини ще довгий час носили окремі назви."},{"page_url":"https://da.wikipedia.org/wiki/Tour_of_Utah","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Lachlan_Morton.jpg","page_title":"Tour of Utah","context_page_description":"Tour of Utah er et amerikansk etapeløb i landevejscykling for professionelle cykelryttere. Løbet foregår i delstaten Utah i USA. Løbet er kategoriseret som 2.Pro og er en del af UCI ProSeries. Det har det været en del af siden 2011."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9B%D1%8C%D0%B5%D0%B2%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Li%C3%A9vin_-_Fosse_n%C2%B0_1_-_1_bis_-_1_ter_des_mines_de_Li%C3%A9vin%2C_puits_n%C2%B0_1_bis_%28H%29.JPG","page_title":"Льевен","context_page_description":"Льевен — Францин гӀала-коммуна, лаьтта О-де-Франс регионехь. Коммунан департамент — Па-де-Кале. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://pl.wikipedia.org/wiki/Die_Br%C3%BCcke","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Ernst_Ludwig_Kirchner_-_Artistin_%28Marzella%29.jpg","page_title":"Die Brücke","context_page_description":"Die Brücke – ugrupowanie niemieckich artystów ekspresjonistów, które powstało w Dreźnie w 1905 roku. Założone zostało przez czterech studentów architektury: Fritza Bleyla, Ericha Heckela, Ernsta Ludwiga Kirchnera i Karla Schmidt-Rottluffa. Później dołączyli do nich: Emil Nolde i Max Pechstein oraz Otto Mueller.\\nCzłonkowie grupy poszukiwali nowych form artystycznej ekspresji, stojących w opozycji do tradycji akademickiej tamtego czasu. Ponadto pragnęli nawiązać kontakty z artystami wyznającymi podobne poglądy. Prezentowali swoją sztukę organizując zbiorowe wystawy. Ich działalność miała znaczący wpływ na kształtowanie się europejskiej sztuki XX wieku i doprowadziła do powstania nurtu nazywanego ekspresjonizmem."},{"page_url":"https://eo.wikipedia.org/wiki/Ozalj","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Ozalj-Kirche-_Sv-Vid-Heiligen_Veits.JPG","page_title":"Ozalj","context_page_description":"Ozalj, hungare Ozaly estas urbo en Kroatio, en departemento de Karlovac. Ankoraŭ 97 komunumoj apartenas al la municipo."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%AF%E6%9F%AF%E8%BE%BE706","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/16._IFA_Oldtimertreffen_Werdau_2013%2C_Germany_%288717883225%29.jpg","page_title":"斯柯达706","context_page_description":"斯柯达706系列是捷克斯洛伐克制造的一系列重型载货汽车型号，最初版本于20世纪30年代由位于姆拉达-博莱斯拉夫的ASAP公司制造，此后衍生出多个技术改进型号，产地也遍及捷克斯洛伐克境内多地，直至1988年最后一辆斯柯达706MT在利亚兹亚布洛内茨工厂出厂后才完全停产。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE,_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/%D0%90.%D0%90._%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE._%D0%9D%D0%B0_%D1%81%D1%82%D0%B0%D0%BF%D0%B5%D0%BB%D1%8F%D1%85.jpg","page_title":"Шевченко, Адольф Александрович","context_page_description":"Адо́льф Алекса́ндрович Шевче́нко — советский и российский художник-график, мастер линогравюры. Член Союза художников СССР, член Союза художников России, заслуженный художник Российской Федерации."},{"page_url":"https://id.wikipedia.org/wiki/Molly_Holly","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Molly_Holly_WWE_Hall_of_Fame_April_2018.jpg","page_title":"Molly Holly","context_page_description":"Nora Kristina Benshoof atau yang lebih dikenal sebagai Molly Holly adalah seorang pegulat profesional yang dilatih oleh Dean Malenko. Dia terkenal karena penampilannya pada World Wrestling Federation / World Wrestling Entertainment dari 2000 hingga 2005 dengan nama panggung Molly Holly. Dia juga dikenal karena penampilannya pada World Championship Wrestling sebagai Miss Madness dan Mona pada 1999 hingga 2000.\\nHolly memulai karier profesionalnya di WCW, di mana dia juga bekerja sebagai pelatih. Selama waktunya dengan WWF / WWE, Holly menjuarai WWF Hardcore Championship satu kali dan WWE Women's Championship dua kali.\\nDia sekarang bekerja sebagai pelatih di Sekolah Akademi Gulat Profesional di Minneapolis, Minnesota. Ia masih tampil secara sporadis di WWE TV."},{"page_url":"https://fr.wikipedia.org/wiki/Les_Essarts-le-Vicomte","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Eglise_St-Michel_de_Les_Essarts_le_Vicomte.JPG","page_title":"Les Essarts-le-Vicomte","context_page_description":"Les Essarts-le-Vicomte est une commune française située dans le département de la Marne, en région Grand Est.\\nLe nom des habitants est Essartois."},{"page_url":"https://uk.wikipedia.org/wiki/Equisetum_scirpoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Equisetum_scirpoides_001.JPG","page_title":"Equisetum scirpoides","context_page_description":"Equisetum scirpoides — багаторічна трав'яниста рослина родини Хвощові."},{"page_url":"https://vec.wikipedia.org/wiki/Castellaro","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Castellaro-P1010043.JPG","page_title":"Castellaro","context_page_description":"Castellaro el xe on comun n'te la provincia de Inperia chel fa parte de la rejon Liguria"},{"page_url":"https://en.wikipedia.org/wiki/Loray_Mill_Historic_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Loray_Mill%2C_Gastonia%2C_NC.jpg","page_title":"Loray Mill Historic District","context_page_description":"Loray Mill Historic District is a national historic district located at Gastonia, Gaston County, North Carolina. It encompasses 649 contributing buildings, 2 contributing sites, and 1 contributing structure in a predominantly residential section of Gastonia. The district includes the five-story brick Loray Mill and all or parts of some thirty blocks of frame mill houses constructed primarily between the early 1900s and the 1920s. They include notable examples of Colonial Revival, Gothic Revival, and Bungalow / American Craftsman architecture. Other notable buildings include the Loray Baptist Church.\\nIt was listed on the National Register of Historic Places in 2001, with a boundary increase in 2006.|\\nThe district will soon be linked to the Main Avenue section of downtown Gastonia via the FUSE District that will include a new stadium. This stadium will have artificial turf and can be configured for baseball, soccer, football, rugby, and concerts to spur economic growth and investment in the area near the Loray Mill Historic District."},{"page_url":"https://en.wikipedia.org/wiki/Log_house","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Rimetea_Torocko_house_8.JPG","page_title":"Log house","context_page_description":"A log house, or log building, is a structure built with horizontal logs interlocked at the corners by notching. Logs may be round, squared or hewn to other shapes, either handcrafted or milled. The term \\"log cabin\\" generally refers to a smaller, more rustic log house, such as a hunting cabin in the woods, that may or may not have electricity or plumbing.\\nLog construction was the most common building technique in large regions of Sweden, Finland, Norway, the Baltic states and Russia, where straight and tall coniferous trees, such as pine and spruce, are readily available. It was also widely used for vernacular buildings in Eastern Central Europe, the Alps, the Balkans and parts of Asia, where similar climatic conditions prevail. In warmer and more westerly regions of Europe, where deciduous trees predominate, timber framing was favoured instead.\\nSawn logs, logs sawn to a standard width, but with their original heights\\nMilled, made with a log house moulder: Constructed of logs that have run through a manufacturing process which convert them into timbers which are consistent in size and appearance"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B4%85%E8%8C%B6%E9%A4%A8%E9%85%92%E5%BA%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Bridal_Tea_House_Hotel_Yau_Ma_Tei.jpg","page_title":"紅茶館酒店","context_page_description":"红茶馆酒店集团于2003年在香港成立，是业主自营的集团式精品酒店。 红茶馆在香港拥有逾10幢酒店，提供逾500间客房。为了满足不断增长的住宿需求，将会有逾2500间客房于香港陆续落成。 集团正全力开拓大陆酒店市场，在2015年两幢连锁酒店于山东烟台开业，分别位于烟台莱山区和烟台芝罘区。而2016年广东广州的另一幢集团式酒店亦会落成，从而迈向香港以外的发展足迹。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D9%85%D8%B9%D8%A9_%D9%88%D9%88%D9%87%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/WHU-ZI.gif","page_title":"جامعة ووهان","context_page_description":"جامعة ووهان هي جامعة بحثية وطنية تقع في ووهان، هوبي. إنها واحدة من أكثر الجامعات المرموقة والانتقائية في الصين، وقد تم الاعترافُ بها من قِبل وزارة التعليم الصينية باعتبارها جامعةً من الدرجة الأولى. كانت واحدةً من أربعِ جامعات تُعتبرُ النخبةَ. في أوائل فترة الجمهورية وهي -أيضًا- واحدةٌ من أقدم الجامعات في الصين. تقع جامعةُ ووهان في Luojia Hill، مع المباني الفخمة التي تَمزج بين الأنماط الصينية والغربية؛ حيث يعتبرها الكثيرون واحدةً من أجمل الجامعات في الصين.\\nتم تصنيفُ جامعةِ بشكلٍ دائمٍ بين أفضل الجامعات في الصين. على الصعيد الوطني، احتلت المرتبةَ الرابعة في عام 2016 والثالثة في عام 2017 بسبب تفوقها الأكاديمي. تشتهر الجامعةُ بالبحث في مجالاتٍ مثلِ:\\nالعلومِ الاجتماعيةِ والاستشعار عن بُعدٍ وهندسةِ المسحِ والهندسةِ الهيدروليكية. تُدار من قِبلِ وزارة التعليم في الصين وتم اختيارها من قِبل كلٍّ من المشروع 985 والمشروع 211 كمتلقٍ رئيسٍ لتمويل الدولة."},{"page_url":"https://de.wikipedia.org/wiki/Tschechischsprachige_Wikipedia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Graf_poctu_clanku.png","page_title":"Tschechischsprachige Wikipedia","context_page_description":"Die tschechischsprachige Wikipedia ist die tschechische Variante des internationalen Wikipedia-Projektes. Sie hatte im November 2018 neben 31 Administratoren über 357.000 registrierte Benutzer und verfügte über 416.000 Artikel."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%AC%A7%E6%B4%B2E19%E5%85%AC%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Rotterdam_Overschie_A13.jpg","page_title":"欧洲E19公路","context_page_description":"欧洲E19公路是欧洲的一条国际公路，起点为荷兰阿姆斯特丹，经过比利时，终点为法国巴黎，全长约551公里。"},{"page_url":"https://de.wikipedia.org/wiki/Auferstehungskirche_(Abu_Gosch)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Abou_Gosh_Cathedral1_1941.jpg","page_title":"Auferstehungskirche (Abu Gosch)","context_page_description":"Die Auferstehungskirche ist eine Kirche aus der Zeit der Kreuzfahrer in Abu Gosch, einem großteils arabisch besiedelten Dorf in Israel. Sie ist heute römisch-katholische Klosterkirche."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Benton_County,_Oregon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Monroe_State_Bank_Building_-_Monroe_Oregon.jpg","page_title":"National Register of Historic Places listings in Benton County, Oregon","context_page_description":"This list presents the full set of buildings, structures, objects, sites, or districts designated on the National Register of Historic Places in Benton County, Oregon, and offers brief descriptive information about each of them. The National Register recognizes places of national, state, or local historic significance across the United States. Out of over 90,000 National Register sites nationwide, Oregon is home to over 2,000, and 57 of those are found in Benton County.\\nThis National Park Service list is complete through NPS recent listings posted March 20, 2020."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B0%D0%B3%D1%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Beef_plate_with_rice.jpg","page_title":"Вагю","context_page_description":"Вагю — загальна назва м'ясних порід корів, що відрізняються генетичною схильністю до інтенсивної мармуровості і високого вмісту ненасичених жирів. М'ясо таких корів відрізняється високою якістю і коштує дуже дорого. Породи вагю виведені в Японії, звідси походить і автентична яловичина вагю. У різних країнах світу розводять чистопородних вагю і нащадків від їх схрещування з іншими м'ясними породами."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%A2%8B%E7%8D%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Devil-eating-roadkill.jpg","page_title":"袋獾","context_page_description":"袋獾，亦被称作塔斯马尼亚恶魔，是一种有袋类的食肉动物，现今只分布于澳大利亚的塔斯马尼亚州。\\n袋獾是袋獾属中唯一未灭绝的成员，身形与一只小狗差不多，但肌肉发达，十分壮硕。其特征包括：黑色的皮毛、遭遇攻击时发出的臭味、刺耳的叫声，以及进食时的神态。除狩猎外，袋獾也进食腐肉。它们通常单独行动，但有时也与其他袋獾一起进食。\\n在袋狼于1936年灭绝后，袋獾成为现存最大的食肉有袋动物。由于袋獾曾对塔斯马尼亚岛居民饲养的家畜造成威胁，因此当地政府也曾允许居民猎取袋獾。直至1941年袋獾被正式公告为保育类动物，对它们的狩猎行为才停止。\\n1990年代末，袋獾面部肿瘤病严重影响了袋獾的数量，故袋獾已于2008年被列入濒危物种名单。现时塔斯马尼亚州政府正进行一系列的工作，以减少这疾病对袋獾的影响。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D1%8B%D0%B1%D0%BE%D1%80%D1%8B_%D0%B2_%D0%A2%D0%B0%D0%B4%D0%B6%D0%B8%D0%BA%D0%B8%D1%81%D1%82%D0%B0%D0%BD%D0%B5_(2010)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Election_2010_Tajikistan_01.jpg","page_title":"Парламентские выборы в Таджикистане (2010)","context_page_description":"Парламентские выборы в Таджикистане — выборы в нижнюю палату Парламента Таджикистана, прошли 28 февраля 2010 года. Они стали четвертыми парламентскими выборами в истории независимого Таджикистана."},{"page_url":"https://nl.wikipedia.org/wiki/Max_Meyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Meyer_Schalke_2015.jpg","page_title":"Max Meyer","context_page_description":"Maximilian Meyer is een Duits voetballer die doorgaans als offensieve middenvelder speelt. Hij tekende in augustus 2018 een contract tot medio 2021 bij Crystal Palace, dat hem transfervrij overnam van Schalke 04. Meyer debuteerde in 2014 in het Duits voetbalelftal."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BC%8A%E8%8B%8F%E7%93%A6%E5%B0%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Town_hall_of_Issoire.jpg","page_title":"伊苏瓦尔","context_page_description":"伊蘇瓦爾，法國中南部城市，奧弗涅-隆河-阿爾卑斯大區多姆山省的一個市鎮，同時也是該省的一個副省會，下轄伊蘇瓦爾區，其市鎮面積為19.69平方公里，2017年1月1日時人口數量為14822人，在法國城市中排名第647位。\\n伊蘇瓦爾位於多姆山省南部，阿列河左岸，是一個區域性的中心城市和交通樞紐。"},{"page_url":"https://it.wikipedia.org/wiki/Khaganato_turco_occidentale","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/AD_659KangarUnion.png","page_title":"Khaganato turco occidentale","context_page_description":"Il Khaganato turco occidentale o Khaganato onoq si costituì al termine di un cruento conflitto all'inizio del VII secolo dopo che il Khaganato göktürk si frantumò in due parti: una orientale e una occidentale.\\nI Turchi occidentali intrattennero relazioni amichevoli con l'Impero bizantino al fine di espandere il loro territorio a spese del loro comune nemico, l'Impero sasanide. Nel 619 i Turchi occidentali invasero la Battriana ma furono respinti nel corso della Seconda guerra persiano-turca. Durante la Terza guerra persiano-turca, il khagan Tung Yabghu e suo nipote Buri-sad unirono le loro forze con quelle dell'imperatore Eraclio I e invasero con successo la Transcaucasia.\\nLe capitali del khaganato furono Navekat e Suyab, entrambe situate nella valle del fiume Ču, a est di Biškek. Il khaganato fu sopraffatto da forze cinesi al comando di Su Dingfang nel 658-659, venendo così sottomessi dall'Impero Tang."},{"page_url":"https://de.wikipedia.org/wiki/Bildtafel_der_Verkehrszeichen_in_Tschechien","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/IJ04ecr.jpg","page_title":"Bildtafel der Verkehrszeichen in Tschechien","context_page_description":"Die Bildtafel der Verkehrszeichen in Tschechien zeigt die gegenwärtig gültigen Verkehrszeichen in Tschechien. In Form und Gestaltung orientieren sich die Verkehrszeichen an den Richtlinien und Vorlagen des Wiener Übereinkommens über Straßenverkehrszeichen. Aus Gründen der Verständlichkeit bestehen die Verkehrszeichen überwiegend aus allgemein bekannten Piktogrammen, nur in wenigen Fällen werden Begriffe in tschechischer Sprache verwendet."},{"page_url":"https://de.wikipedia.org/wiki/Peter_Schro","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Schoenermark_Magdalena.jpg","page_title":"Peter Schro","context_page_description":"Peter Schro, auch Schrör, Schror und Schrot geschrieben, war ein deutscher Bildhauer zwischen Spätgotik und Frührenaissance. Er wurde zwischen 1522 und 1542/44 in Mainz urkundlich nachgewiesen."},{"page_url":"https://en.wikipedia.org/wiki/Elizabeth_Eisenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Cfb_3.jpg","page_title":"Elizabeth Eisenstein","context_page_description":"Elizabeth Lewisohn Eisenstein was an American historian of the French Revolution and early 19th-century France. She is well known for her work on the history of early printing, writing on the transition in media between the era of 'manuscript culture' and that of 'print culture', as well as the role of the printing press in effecting broad cultural change in Western civilization."},{"page_url":"https://gl.wikipedia.org/wiki/Sugababes","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Sugababes_GWR_Bristol.jpg","page_title":"Sugababes","context_page_description":"Sugababes é un grupo musical británico de R&B, Pop e Dance. As compoñentes son Keisha Buchanan, Heidi Range e Amelle Berrabah."},{"page_url":"https://fr.wikipedia.org/wiki/Cobourg","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Coburg-Ehrenburg1.jpg","page_title":"Cobourg","context_page_description":"Cobourg est une ville d'Allemagne, située dans le Land de Bavière, dans l'arrondissement de la Haute-Franconie. La ville ne fait pas partie de la Bavière historique.\\nCobourg est le chef-lieu du district de Cobourg, à 90 km au nord de Nuremberg et à 85 km au sud-ouest de Weimar."},{"page_url":"https://pt.wikipedia.org/wiki/Hydrocharitaceae","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Egeria_flower.jpg","page_title":"Hydrocharitaceae","context_page_description":"Hydrocharitaceae é uma pequena família de monocotiledôneas da classe Alismatales composta por ervas aquáticas presentes em água doce, salobra ou salgada. Podem ser hermafroditas, monóicas ou dióicas. As planta presentes neste grupo possuem hábitos diversos como foliares submersos, parcialmente submersos e flutuantes, além de foliares lineares. A família é cosmopolita e composta por cerca de 17 gêneros e 127 espécies sendo que, no Brasil, ocorrem cerca de 6 gêneros e 15 espécies. As espécies pertencentes à esta família são amplamente distribuídas, embora sejam mais comuns em zonas tropicais e subtropicais, em água doce ou habitats marinhos. Algumas espécies têm grande importância econômica devido à venda e utilização como plantas ornamentais. Como exemplo de espécie bastante conhecida e utilizada em experimentos de aulas práticas pode-se citar a Egeria densa, planta nativa da região Sudeste do Brasil."},{"page_url":"https://vi.wikipedia.org/wiki/Carex_annectens","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Carex_annectens_drawing_1.png","page_title":"Carex annectens","context_page_description":"Carex annectens là một loài thực vật có hoa trong họ Cói. Loài này được E.P.Bicknell mô tả khoa học đầu tiên năm 1908."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%91%A8%E5%8D%97%E5%B8%82%E4%B8%AD%E5%BF%83%E5%B8%82%E8%A1%97%E5%9C%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/%E5%BE%B3%E5%B1%B1%E9%8A%80%E5%BA%A7%E9%80%9A%E3%82%8A%E5%95%86%E5%BA%97%E8%A1%97.JPG","page_title":"周南市中心市街地","context_page_description":"周南市中心市街地は、山口県周南市の中心市街地。旧市名や立地する駅の名前から、「徳山」とも呼ばれる。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%DB%8C%D8%AE_%DA%A9%D8%AA%D8%A7%D8%A8%D8%AE%D8%A7%D9%86%D9%87_%D8%AF%D8%B1_%D8%A7%DB%8C%D8%B1%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Tarbiyat_library.jpg","page_title":"تاریخ کتابخانه در ایران","context_page_description":"کتابخانه سلطنتی آشوربانی‌پال کتابخانه‌ای دارای هزاران لوح رسی و تکه‌های حاوی متون مختلف مربوط به قرن هفتم پیش از میلاد می‌باشد، در میان این گنجینه می‌توان به لوح مشهور حماسه گیلگمش اشاره داشت."},{"page_url":"https://war.wikipedia.org/wiki/Grevillea_sessilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Grevillea_sessilis_%282218714726%29.jpg","page_title":"Grevillea sessilis","context_page_description":"An Grevillea sessilis in uska species han Magnoliopsida nga ginhulagway ni C. T. White & Francis. An Grevillea sessilis in nahilalakip ha genus nga Grevillea, ngan familia nga Proteaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%B9%D8%B1%D8%A7%D8%AC%E2%80%8C%D9%86%D8%A7%D9%85%D9%87_(%D9%86%DA%AF%D8%A7%D8%B1%DA%AF%D8%B1%DB%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Miraj_by_Sultan_Muhammad.jpg","page_title":"معراج‌نامه (نگارگری)","context_page_description":"معراج‌نامه به نگارگری‌های ایرانی گفته می‌شود که معراج را به تصویر کشیده‌اند. دوره رواج معراج‌نامه از ایلخانان آغاز شد و به دوران قاجاریان ختم شد. قدیمی‌ترین معراج‌نامه موجود، در کتاب جامع‌التواریخ رشیدالدین فضل‌الله همدانی به قرن هشتم هجری یافت می‌شود. معراج‌نامه میرحیدر اهمیت زیادی در مطالعه مکتب هرات قرن نهم هجری دارد."},{"page_url":"https://tr.wikipedia.org/wiki/Acemler,_Bulgaristan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Aksakovo%2C_Bulgaria_-_panoramio_%282%29.jpg","page_title":"Acemler, Bulgaristan","context_page_description":"Acemler, Bulgaristan'ın Varna ilinde bulunan bir şehir ve belediyedir. Şehir, Franga Platosu'nda yer almaktadır. Yüzölçümü 460.54 km² olan şehrin nüfusu 2015 yılı itibarı ile 22,225'tir."},{"page_url":"https://sv.wikipedia.org/wiki/Mormonism","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/LDS_Baptism_Panama.JPG","page_title":"Mormonism","context_page_description":"Mormonism är den dominerande religiösa traditionen inom Sista dagars heliga-rörelsen inom Restorationism grundad av Joseph Smith i Västra New York mellan 1820 och 1830. Största grenen i traditionen är Jesu Kristi Kyrka av Sista Dagars Heliga som har över 15 miljoner utövare, varav en stor del bor i ursprungslandet USA. Dess anhängare kallas i folkmun mormoner. Mormonerna anser att mormonismen är en gren av kristendomen, dock ifrågasätts detta av många kristna samfund, då mormoner inte tror på en treenig Gud eller att kanoniserad skrift är begränsad till Bibeln. Mormonerna tror på Bibeln men tror på vidare uppenbarelse och har också andra heliga skrifter bl.a. Mormons bok och har därav fått smeknamnet \\"mormoner.\\"\\nMed mormonism menas Jesu Kristi Kyrka av Sista Dagars Heliga och andra, mindre grupper inom sista dagars heliga-rörelsen som alla hävdar att deras tro representerar den enda sanna mormonismen."},{"page_url":"https://fr.wikipedia.org/wiki/Mile_Svilar","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Web_Summit_2017_-_Press_Conferences_CG1_7321_%2838213808892%29_%28cropped%29.jpg","page_title":"Mile Svilar","context_page_description":"Mile Svilar, né le 27 août 1999 à Anvers, est un footballeur belge qui évolue au poste de gardien de but au Benfica Lisbonne."},{"page_url":"https://en.wikipedia.org/wiki/Siege_of_Mexico_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Manuel_Gonzalez_00.jpg","page_title":"Siege of Mexico City","context_page_description":"The Siege of Mexico City was an 1867 military engagement in the Second French intervention in Mexico between Mexican Republican forces aided by the United States and Emperor Maximilian's troops aided by the French Empire and Austria-Hungary, encompassing in the siege of the city. It was the last armed conflict of the Second Mexican Empire and the fall of the city resulted in the transition of the Empire into the Republic led by Benito Juárez."},{"page_url":"https://pl.wikipedia.org/wiki/Giacomo_Oddi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Giacomo_Oddi.jpg","page_title":"Giacomo Oddi","context_page_description":"Giacomo Oddi – włoski biskup rzymskokatolicki, kardynał."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_South_America","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Yachthouse_Residence_Club_em_dezembro_de_2018%2C_Balne%C3%A1rio_Cambori%C3%BA_SC.JPG","page_title":"List of tallest buildings in South America","context_page_description":"This list of the tallest buildings in South America ranks skyscrapers in order by height. South America has historically seen a relatively modest demand for skyscrapers. Most of the continent's high-rises are in Argentina, Brazil, Chile, Colombia, Uruguay, and Venezuela, and the tallest buildings are located in Santiago, São Paulo, Buenos Aires, Caracas, Montevideo, Rio de Janeiro, Balneário Camboríu, Valencia and Bogotá, all of which are one of the biggest financial centers of these countries.\\nBrazil, Argentina and Venezuela are the countries with the most skyscrapers. São Paulo is the South American city with most skyscrapers, and the 4th in the world in high-rise buildings.\\nThe majority of the continent's tallest buildings are residential. Office buildings have not historically been built taller than residential buildings in the region, though this scenario may well change in the next decades, as South America has been experiencing substantial economic growth."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_von_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/The_A4_bypassing_Silbury_Hill_-_geograph.org.uk_-_281962.jpg","page_title":"Geschichte von Wales","context_page_description":"Die Geschichte von Wales im Sinne der dortigen menschlichen Geschichte lässt sich zwar etwa 230.000 Jahre zurückverfolgen, doch unterbrachen die nachfolgenden Kaltzeiten mit ihren gewaltigen Gletschermassen die menschliche Besiedlung mehrfach."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Lowestoft","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Lowestoft_gare.jpg","page_title":"Gare de Lowestoft","context_page_description":"La gare de Lowestoft est une gare ferroviaire britannique du Wherry Lines, située à sur le territoire de la ville de Lowestoft dans le comté du Suffolk à l'est de Angleterre."},{"page_url":"https://de.wikipedia.org/wiki/Ronno","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Ronno_-_Mairie.jpg","page_title":"Ronno","context_page_description":"Ronno ist eine französische Gemeinde mit 631 Einwohnern im Département Rhône in der Region Auvergne-Rhône-Alpes. Sie gehört zum Arrondissement Villefranche-sur-Saône, zum Kanton Thizy-les-Bourgs und ist Mitglied im Gemeindeverband L’Ouest Rhodanien."},{"page_url":"https://fr.wikipedia.org/wiki/Mode_punk","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Cha%C3%AEnes_DSC00638.JPG","page_title":"Mode punk","context_page_description":"La mode punk est l'allure vestimentaire et l'apparence physique que se donnent au milieu des années 1970 certains groupes de musique anglais, en particulier les Sex Pistols.\\nIl s'agit d'un renversement de toutes les valeurs et de tous les codes vestimentaires issus du mouvement hippy : couleurs douces, effacement des différences sexuelles, références à la nature, vie à la campagne, motifs vernaculaires, non violence, idéalisme politique auxquels le style punk oppose tout ce qui est considéré comme laid par les babas cool : le style moderne des années 1960, les couleurs flashy, les imprimés voyants, les tissus et les matières synthétiques, le mode de vie urbain, le pessimisme, les drogues chimiques, le mépris de soi, et, pour certaines branches auto-caricaturales du mouvement, l'inculture, le vandalisme gratuit, l'idéologie scientiste et la violence.\\nCette attitude, issue d'une nouvelle génération en rupture avec l'échec patent de celle de Woodstock, choisit de s'appeler « punk ». Sa musique feint d'ignorer les harmonies pour privilégier une puissance rythmique très fruste et efficace, avec des motifs et des paroles engagés ou révoltants."},{"page_url":"https://de.wikipedia.org/wiki/Sikh-Gurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Sikh_gurus.jpg","page_title":"Sikh-Gurus","context_page_description":"Die Sikh-Gurus waren die ersten zehn Führer des Sikhismus, die einzigen, die den Titel Guru innehatten. Die zehn Gurus der Sikhs wirkten in der Zeit von 1469 bis 1708.\\nDer erste war Guru Nanak, der vor seinem Tod die Tradition begründete, die es dem Guru zu seinen Lebzeiten erlaubte, seinen Nachfolger zu benennen.\\nGobind Singh, der zehnte und letzte menschliche Guru, starb 1708 an den Folgen eines Attentats. Er hatte die Schrift Guru Granth Sahib zu seinem Nachfolger ernannt und zum ewigen Guru erhoben."},{"page_url":"https://en.wikipedia.org/wiki/Civil_parishes_in_Cheshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Marthall_-_Parish_Church_of_All_Saints.jpg","page_title":"Civil parishes in Cheshire","context_page_description":"A civil parish is a country subdivision, forming the lowest unit of local government in England. There are 333 civil parishes in the ceremonial county of Cheshire, most of the county being parished. At the 2001 census, there were 565,259 people living in 332 parishes, accounting for 57.5 per cent of the county's population."},{"page_url":"https://nl.wikipedia.org/wiki/Achyra","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Achyra_affinitalis.jpg","page_title":"Achyra","context_page_description":"Achyra is een geslacht van vlinders van de familie grasmotten, uit de onderfamilie Pyraustinae."},{"page_url":"https://de.wikipedia.org/wiki/Komorno","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Komornoer_Gutshaus.jpg","page_title":"Komorno","context_page_description":"Komorno ist ein Dorf und Sołectwo in Polen, welches zur Gemeinde Reinschdorf im Powiat Kędzierzyńsko-Kozielski, Woiwodschaft Opole in Oberschlesien gehört."},{"page_url":"https://fr.wikipedia.org/wiki/Aim%C3%A9_Picquet_du_Boisguy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Ch%C3%A2teau_du_Bois-Guy.jpg","page_title":"Aimé Picquet du Boisguy","context_page_description":"Aimé Casimir Marie Picquet du Boisguy, né le 15 mars 1776 à Fougères, et mort le 25 octobre 1839 à Paris, est un militaire français et un général chouan pendant la Révolution française.\\nEncore enfant lorsque débute la Révolution française, Aimé Picquet du Boisguy se distingue par un engagement royaliste précoce. À 15 ans il rejoint l'Association bretonne et devient aide de camp d'Armand Tuffin de La Rouërie, à 17 ans il participe à la Virée de Galerne aux côtés des Vendéens puis prend la tête des chouans du pays de Fougères et de Vitré, à 19 ans il est promu brigadier des armées du roi et général-lieutenant de l'Armée catholique et royale de Rennes et de Fougères.\\nChef actif et bon tacticien, Boisguy fait des pays de Fougères et de Vitré la zone la plus importante de la chouannerie en Ille-et-Vilaine et l'une des principales de Bretagne. Il commande directement jusqu'à 5 000 hommes, disciplinés, bien organisés, parfois vêtus d'uniformes mais entravés par un manque de cavalerie et surtout par une absence totale d'artillerie."},{"page_url":"https://de.wikipedia.org/wiki/James_Russell_Wiggins","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/JamesWiggins.jpg","page_title":"James Russell Wiggins","context_page_description":"James Russell Wiggins war ein US-amerikanischer Journalist, Herausgeber und Diplomat."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B3%B0%E5%9C%8B%E5%9C%8B%E5%AE%B6%E9%90%B5%E8%B7%AF%E5%B1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/NKF1253.JPG","page_title":"泰國國家鐵路局","context_page_description":"泰国国家铁路局是泰国国营铁路营运机构，每年服务约50万人次乘客。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D1%80%D1%8C%D0%BA%D0%BE%D0%B2_%D0%B2_%D1%84%D0%B8%D0%BB%D0%B0%D1%82%D0%B5%D0%BB%D0%B8%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/ExpressMailPostmarkKharkov.JPG","page_title":"Харьков в филателии","context_page_description":"Ха́рьков в филатели́и — совокупность филателистических материалов, посвящённых Харькову или связанных с ним."},{"page_url":"https://en.wikipedia.org/wiki/Gioiello_(galaxy_cluster)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/XDCP_J0044.0-2033_%28Gioiello_cluster%29.jpg","page_title":"Gioiello (galaxy cluster)","context_page_description":"The Gioiello Galaxy Cluster was discovered using high redshift with NASA's Chandra X-ray Observatory from a research group led by Paolo Tozzi and Joana Santos. Gioiello is the most distant massive galaxy cluster that has been found and studied today. This massive galaxy cluster weighs 400 trillion times the mass of the sun and is located 9.6 billion light years away from Earth. Gioiello, meaning Jewel in Italian, was given to this massive galaxy cluster because an image of the cluster contains many beautiful pink, purple, and red sparkling colors from the hot X-ray emitting gas and other star-forming galaxies within the cluster."},{"page_url":"https://de.wikipedia.org/wiki/Wolfsburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Laagberg_Denkmal.JPG","page_title":"Wolfsburg","context_page_description":"Wolfsburg ist eine kreisfreie Großstadt im Osten des Landes Niedersachsen. Die Stadt wurde 1938 als Sitz des Volkswagenwerks gegründet und ist mit rund 125.000 Einwohnern die fünftgrößte Stadt Niedersachsens.\\nWolfsburg zählt zu den wenigen Stadtgründungen in der ersten Hälfte des 20. Jahrhunderts in Deutschland. Bis Mai 1945 trug die Stadt den Namen Stadt des KdF-Wagens bei Fallersleben. Die Stadt war als Wohnort für die Mitarbeiter des Volkswagenwerkes konzipiert, in dem der KdF-Wagen – der spätere VW Käfer – produziert werden sollte. 1972 überschritt die Einwohnerzahl die Grenze von 100.000, wodurch Wolfsburg zur Großstadt wurde. Im Jahr 2010 war das Bruttoinlandsprodukt pro Kopf das höchste aller deutschen Städte.\\nWolfsburg bildet mit den Städten Braunschweig und Salzgitter eine Regiopolregion sowie eines der neun Oberzentren in Niedersachsen und gehört zur Metropolregion Hannover-Braunschweig-Göttingen-Wolfsburg. Die nächstgelegenen größeren Städte sind Braunschweig rund 26 Kilometer südwestlich, Magdeburg rund 64 Kilometer südöstlich und Hannover rund 74 Kilometer westlich."},{"page_url":"https://cs.wikipedia.org/wiki/Br%C3%A1niska","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/P%C5%99%C3%ADrodn%C3%AD_pam%C3%A1tka_Br%C3%A1niska%2C_okres_Prost%C4%9Bjov.jpg","page_title":"Brániska","context_page_description":"Brániska je přírodní památka ev. č. 2429, která se nachází severně od obce Plumlov v okrese Prostějov v údolí potoka Roudník. Oblast spravuje Krajský úřad Olomouckého kraje"},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%97%E0%B0%BE%E0%B0%82%E0%B0%AC%E0%B0%BF%E0%B0%AF%E0%B0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/2014_Gambia_Products_Export_Treemap.png","page_title":"గాంబియా","context_page_description":"గాంబియా అధికారిక నామం \\"రిపబ్లిక్ ఆఫ్ ద గాంబియా\\", సాధారణంగా గాంబియా అని పిలువబడుతుంది. పశ్చిమ ఆఫ్రికా లోని ఒక దేశం. ప్రధాన ఆఫ్రికాలోని ఒక చిన్న దేశం. ఈ దేశం చుట్టూ ఉత్తరాన, తూర్పున, దక్షిణాన సెనెగల్ వ్యాపించి యున్నది. దేశ పశ్చిమతీరంలో అట్లాంటిక్ మహాసముద్రం ఉంది. దీని రాజధాని బంజుల్.\\nగాంబియా దేశం గాంబియా నదికి ఇరువైపులా ఉంది. గాంబియా నది దేశం మద్యలో ప్రవహించి అట్లాంటికు మహాసముద్రంలోకి సంగమిస్తుంది. 2013 ఏప్రెలు గణాంకాల ఆధారంగా దేశజనసంఖ్య 18,57,181, వైశాల్యం 10,689 చదరపు కిలోమీటర్లు ఉంది. బంజులు గాంబియా రాజధానిగా ఉంది. సెరెకుండా, బ్రికమా అతిపెద్ద నగరాలుగా ఉన్నాయి.\\nగంబియా అనేక ఇతర పశ్చిమ ఆఫ్రికా దేశాలలాగా బానిసవాణిజ్య చారిత్రక మూలాలను కలిగి ఉంది. మొదటగా పోర్చుగీసు వారు గాంబియా నదీతీరంలో ఒక కాలనీని స్థాపించడానికి ఈ ప్రాంతం కీలక అంశంగా ఉంది. పోర్చుగీసువారు ఈ ప్రాంతానికి గాంబియా అని నామకరణం చేసారు. 1765 మే 25 న గాంబియా బ్రిటీషు ప్రభుత్వం అధికారికంగా నియంత్రణను తీసుకున్న తరువాత గాంబియా సామ్రాజ్యంలో భాగంగా మారింది. తరువాత బ్రిటిషు సెనెగాంబియా స్థావరాన్ని స్థాపించింది. 1965 లో గాంబియాకు \\" దాదా జవరా \\" నాయకత్వంలో స్వాతంత్ర్యం పొందింది. 1994 లో యహ్యా జమ్మే అధికారాన్ని స్వాధీనం చేసుకుని అధికారాన్ని హస్థగతం చేసుకుని దాదా జవరాను అధికారం నుండి తొలగించారు."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_nobelprisvinnere_i_fysiologi_eller_medisin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/John_O%27Keefe_%28neuroscientist%29_2014b.jpg","page_title":"Liste over nobelprisvinnere i fysiologi eller medisin","context_page_description":"Listen over nobelprisen i fysiologi eller medisin er en kronologisk liste over mottakere av nobelprisen i fysiologi eller medisin fra 1901 og frem til i dag. Prisen blir utdelt årlig av det svenske Karolinska Institutet til forskere og leger som arbeider eller har arbeidet med ulike felt innen fysiologi eller medisin. Prisen er en av fem priser utdelt av Nobelstiftelsen etter ønske fra testamentet til Alfred Nobel. Prisen kalles ofte bare nobelprisen i medisin, men Nobel presiserte at prisen skulle tildeles bidrag innen «fysiologi eller medisin» i sitt testamente.\\nDermed kan prisen tildeles personer innen svært varierende fagfelt. Den første prisen ble tildelt tyske Emil Adolf von Behring i 1901. Alle mottakere av prisen tildeles en medalje, et diplom og en pengesum. I 1901 mottok von Behring en pengesum på 150,782 svenske kroner, som i 2008 ville tilsvart over 7,7 millioner svenske kronger. I 2008 mottok prisvinnerne Harald zur Hausen, Françoise Barré-Sinoussi og Luc Montagnier en sum på 10,000,000 svenske kroner. Prisen blir utdelt i Stockholm på den årlige seremonien den 10. desember, den samme datoen som Nobels død."},{"page_url":"https://ca.wikipedia.org/wiki/Can_Puig_(Figar%C3%B3-Montmany)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Can_Puig_de_Vallc%C3%A0rquera.jpg","page_title":"Can Puig (Figaró-Montmany)","context_page_description":"Can Puig és un edifici del municipi de Figaró-Montmany inclòs en l'Inventari del Patrimoni Arquitectònic de Catalunya."},{"page_url":"https://hu.wikipedia.org/wiki/3751-es_busz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/NRL-909_Mercedes_Intouro_in_Kisgy%C5%91r_2.jpg","page_title":"3751-es busz","context_page_description":"A 3751-es jelzésű autóbuszvonal Miskolc és környékének egyik helyközi-elővárosi járata, amit a Volánbusz Zrt. lát el a miskolci autóbusz-állomás és Kisgyőr között, egyes járatai Bükkaranyosra és Harsányra is betérnek,\\nvagy csak idáig közlekednek."},{"page_url":"https://de.wikipedia.org/wiki/Alpenscharten","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Saussurea_gossypiphora_Himalaya.jpg","page_title":"Alpenscharten","context_page_description":"Die Alpenscharten bildet eine Pflanzengattung in der Unterfamilie der Carduoideae innerhalb der Familie der Korbblütler. Die etwa 300 Arten gedeihen vor allem in kühlen Gebieten der Nordhalbkugel."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_chefes_de_governo_da_L%C3%ADbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Abdul_Majid_Kubar.JPG","page_title":"Lista de chefes de governo da Líbia","context_page_description":"Esta é uma lista de chefes de governo da Líbia desde a independência em 1951.\\nDesde a independência, os chefes de governo da Líbia foram os primeiros-ministros, em seguida, os secretários-geral do Comitê Geral do Povo e, novamente, primeiros-ministros."},{"page_url":"https://fr.wikipedia.org/wiki/Massacre_de_Katy%C5%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Katyn.png","page_title":"Massacre de Katyń","context_page_description":"Le massacre de Katyń est l'assassinat de masse, par la police politique de l’Union soviétique, au printemps 1940 dans la forêt de Katyń, de plusieurs milliers de Polonais, essentiellement des officiers d'active et de réserve, et de divers autres membres des élites polonaises considérées comme hostiles à l’idéologie communiste.\\nL'URSS a nié sa responsabilité dans le massacre dès qu’il a été révélé par les militaires allemands ainsi que durant toute la guerre froide, et en a rendu l’Allemagne nazie responsable. Toutefois, en 1990, l'URSS a reconnu que ce massacre avait été ordonné par les responsables soviétiques.\\nPour différentes raisons, dont l’exploitation au début de l'année 1943 par la propagande allemande du massacre de Katyń découvert en 1941 lors de l’avance allemande en Russie, l’histoire a retenu ce massacre particulier comme emblématique de l’ensemble des crimes commis par l’URSS à l'encontre de la nation polonaise."},{"page_url":"https://en.wikipedia.org/wiki/Attiliosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Attiliosa_laurecorbariae_%28MNHN-IM-2018-10192%29.jpeg","page_title":"Attiliosa","context_page_description":"Attiliosa is a genus of sea snails, marine gastropod mollusks in the family Muricidae, the murex snails or rock snails."},{"page_url":"https://pt.wikipedia.org/wiki/Frank_De_Winne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Soyuz_TM-34_logo.png","page_title":"Frank De Winne","context_page_description":"Frank De Winne é um astronauta e militar da Bélgica e o segundo belga a ir ao espaço.\\nGraduou-se na escola de pilotagem da Força Aérea da Bélgica e tornou-se piloto de caças Mirage 5. A partir de 1992 operou como piloto de testes da força aérea de seu país e durante as operações da OTAN na Guerra dos Bálcãs, foi líder de esquadrão de combate.\\nCom a patente de coronel da aeronáutica, De Winne tem 2400 horas de voo em diversos tipos de caças como Mirage, F-16, Tornado e Jaguar.\\nEm outubro de 1998 ele foi selecionado para treinamento como astronauta pela Agência Espacial Europeia e completou o curso em 2000 e no ano seguinte foi designado para o Centro de Treinamento de Astronautas Yuri Gagarin, perto de Moscou.\\nEm outubro de 2002 foi ao espaço a bordo da nave Soyuz TMA-1 para um missão de dez dias na Estação Espacial Internacional e retornou a bordo da Soyuz TM-34, tornando-se o segundo belga, após Dirk Frimout, em órbita. Durante a missão, De Winne levou a cabo experiências no campo da educação e de ciências físicas."},{"page_url":"https://it.wikipedia.org/wiki/Dobr%C5%A1%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Dobr%C5%A1%C3%ADn%2C_obecn%C3%AD_%C3%BA%C5%99ad.jpg","page_title":"Dobršín","context_page_description":"Dobršín è un comune della Repubblica Ceca facente parte del distretto di Klatovy, nella regione di Plzeň."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Wallertheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Wallertheim%2C_Wasserwerk.jpg","page_title":"Liste der Kulturdenkmäler in Wallertheim","context_page_description":"In der Liste der Kulturdenkmäler in Wallertheim sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Wallertheim aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://lt.wikipedia.org/wiki/Alna_(up%C4%97)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/%C5%81yna_%28Brzeziny%29.jpg","page_title":"Alna (upė)","context_page_description":"Alna, Lava, Lyna – upė Lenkijoje, Varmijos Mozūrų vaivadijoje ir Rusijoje, Kaliningrado srityje. Kairysis Priegliaus intakas, įteka į Prieglių Znamensko mieste.\\nIlgis – 264 km, iš jų 190 km Lenkijoje ir 74 km Rusijoje. Baseino plotas – 7 126 km², iš jų 5719 km² Lenkijoje ir 1407 km² Rusijoje.\\nIntakai – Vadongas, Guberis\\nMiestai – Olštynas, Bartošycė, Pravdinskas, Znamenskas.\\nPrie upės įkurtas gamtos rezervatas."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D1%81%D0%BF%D0%BE%D1%80%D1%82_%D0%B3%D1%80%D0%BE%D0%BC%D0%B0%D0%B4%D1%8F%D0%BD%D0%B8%D0%BD%D0%B0_%D0%A7%D0%BE%D1%80%D0%BD%D0%BE%D0%B3%D0%BE%D1%80%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Montenegro_passport.jpg","page_title":"Паспорт громадянина Чорногорії","context_page_description":"Паспорт громадянина Чорногорії — документ, який уряд Чорногорії видає своїм громадянам для посвідчення особи та громадянства при міжнародних подорожах. Паспорт видає Міністерство внутрішніх справ або, якщо громадянин перебуває за кордоном, посольство. Громадяни не можуть мати одночасно декілька паспортів, окрім коли вони з різних категорій."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%8E%D0%B2%D0%B5%D1%80%D0%B2%D0%B8%D0%BB%D1%8C,_%D0%96%D1%8E%D0%BB%D1%8C_%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Cavelier_de_Cuverville%2C_Jules_Marie_Armand_de%2C_par_Gambier%2C_BNF_Gallica.jpg","page_title":"Кювервиль, Жюль де","context_page_description":"Жюль де Кювервиль — офицер французского национального флота, впоследствии Начальник штаба французского военно-морского флота. В конце жизни избран в Сенат, где между 1901 и 1912 годами он представлял Финистер."},{"page_url":"https://en.wikipedia.org/wiki/County_of_Flanders","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Locator_County_of_Flanders_%281350%29.svg","page_title":"County of Flanders","context_page_description":"The County of Flanders was a historic territory in the Low Countries.\\nFrom 862 onwards the counts of Flanders were among the original twelve peers of the Kingdom of France. For centuries their estates around the cities of Ghent, Bruges and Ypres formed one of the most affluent regions in Europe.\\nUp to 1477, the area under French suzerainty was located west of the Scheldt River and was called \\"Royal Flanders\\". Aside from this the counts of Flanders from the 11th century onward also held land east of the river as a fief of the Holy Roman Empire, an area called \\"Imperial Flanders\\". Part of the Burgundian Netherlands from 1384, the county was finally removed from French to Imperial control after the Peace of Madrid in 1526 and the Peace of the Ladies in 1529.\\nIn 1795, the remaining territory within the Austrian Netherlands was incorporated by the French First Republic and passed to the newly established United Kingdom of the Netherlands in 1815. The former County of Flanders, except for French Flanders, is the only part of the medieval French kingdom that is not part of modern-day France."},{"page_url":"https://es.wikipedia.org/wiki/M%C3%A9todo_de_McCabe-Thiele","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Q-line_slopes.png","page_title":"Método de McCabe-Thiele","context_page_description":"El método de McCabe-Thiele se considera el método más simple y quizás el más instructivo para el análisis de la destilación binaria.​​​ Utiliza el hecho de que la composición en cada placa teórica está completamente determinada por la fracción molar de uno de los dos componentes y se basa en el supuesto de un desbordamiento molar constante que requiere que:\\nLos calores molares de vaporización de los componentes de alimentación son iguales.\\nPor cada mol de líquido vaporizado, se condensa un mol de vapor.\\nLos efectos del calor como los calores de solución son despreciables.\\nEl método fue publicado por primera vez por Warren L. McCabe y Ernest Thiele en 1925.​​​"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%B8%D6%82%D6%80%D5%B4%D5%A1_(%D5%AF%D5%A1%D5%BF%D5%B8%D6%82%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A5%D5%B2%D5%A1%D5%BF%D5%A5%D5%BD%D5%A1%D5%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/British_burmese_-_Andel_Alois_at_Cat_show.JPG","page_title":"Բուրմա (կատուների ցեղատեսակ)","context_page_description":"Բուրմա, կամ բուրմանական կարճամազ կատու, կարճամազ կատուների ցեղատեսակ: Բուրմանական ցեղատեսակի կատվին հատուկ է մկանային, ամուր մարմինը, կարճ փայլուն մորթին, մեծ, դեղին, կլորավուն աչքերը: Բուրմաները քնքուշ, ուրախ են, կապված են մարդուն, հանդուրժում են այլ կատուների, ինչպես նաև շների հետ հարևանությանը:\\nԿա բուրմանական կատուների երկու հիմնական տեսակ՝ եվրոպական և ամերիկյան: Ամերիկյան տեսակի մոտ կան գունավորման ավելի շատ ձևեր, արտաքինից կատուները ունեն ավելի կլորացված դունչ, մարմնակազմության ձևն ավելի մոտ է ամերիկյան կարճամազ կատվին: Եվրոպական տեսակի բուրմայի գունավորման ձևերը, համապատասխանաբար, ավելի քիչ են, մորթին ավելի բարակ է, սիամա-արևելյան տեսակի կատուները ավելի թեթև են և օժտված են ավելի նեղ դնչով:"},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%99%B8%E5%A5%A7%E5%B2%A9%E5%B4%8E%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Mutsu-Iwasaki_Station.jpg","page_title":"陸奧岩崎站","context_page_description":"陸奧岩崎站位於青森縣西津輕郡深浦町大字岩崎字松原，是東日本旅客鐵道管轄的五能線上的鐵路車站。"},{"page_url":"https://de.wikipedia.org/wiki/Dippach_am_Main","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Wappen_Dippach_a._Main.svg","page_title":"Dippach am Main","context_page_description":"Dippach am Main ist ein Stadtteil von Eltmann im unterfränkischen Landkreis Haßberge in Bayern und hat 352 Einwohner."},{"page_url":"https://en.wikipedia.org/wiki/Cushitic_peoples","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Bedscha.jpg","page_title":"Cushitic peoples","context_page_description":"The Cushitic peoples are a grouping of people who are primarily indigenous to Northeast Africa and speak or have historically spoken Cushitic languages of the Afroasiatic language family. Cushitic languages are spoken primarily in the Horn of Africa, as well as the Nile Valley, and parts of the African Great Lakes region. Some examples of these peoples include the Cushitic speaking ethnic groups.\\nLinguistic evidence indicates that Cushitic languages were spoken in Lower Nubia, an ancient region which straddles present day Southern Egypt and Northern Sudan, before the arrival of North Eastern Sudanic languages from Upper Nubia. Many extinct populations of northern Nubia such as the Medjay and the Blemmyes spoke Cushitic languages related to the modern Beja language. Less certain are hypotheses which propose that Cushitic languages were spoken by the people of the C-Group culture in northern Nubia, or the people of the Kerma culture in southern Nubia. Historical linguistic analysis indicates that the languages spoken in the Savanna Pastoral Neolithic culture of the Rift Valley and surrounding areas, may have been languages of the South Cushitic branch."},{"page_url":"https://ca.wikipedia.org/wiki/Cobeja","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Iglesia_San_Juan_Bautista_Cobeja.JPG","page_title":"Cobeja","context_page_description":"Cobeja és un municipi de la província de Toledo, a la comunitat autònoma de Castella la Manxa. Limita amb Pantoja, Alameda de la Sagra, Villaseca de la Sagra i Villaluenga de la Sagra."},{"page_url":"https://eu.wikipedia.org/wiki/Funtzio_boolear","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Fucion_logica_1.PNG","page_title":"Funtzio boolear","context_page_description":"Matematika arloan funtzio boolearra funtzio bat da non bere domeinua 0 edo 1 balio bitarrek osatzen duten.\\nFormalki, ƒ: Bⁿ → B motako funtzioak dira, non B = {0,1} eta n zenbaki oso ez negatiboa den, funtzioaren aridadea alegia."},{"page_url":"https://ko.wikipedia.org/wiki/LG%EC%8A%A4%ED%8F%AC%EC%B8%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/LG%EC%A0%84%EC%9E%90%2C_%EB%8F%85%EC%9D%BC_%ED%94%84%EB%A1%9C%EC%B6%95%EA%B5%AC%ED%8C%80_%E2%80%98%EB%A0%88%EB%B2%84%EC%BF%A0%EC%A0%A0%E2%80%99_%EA%B3%B5%EC%8B%9D_%ED%9B%84%EC%9B%90_%281%29.jpg","page_title":"LG스포츠","context_page_description":"LG스포츠는 LG그룹의 계열사로 스포츠단을 전문적으로 운영하는 회사이다."},{"page_url":"https://it.wikipedia.org/wiki/Rotore_(aeronautica)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Antitorque_it.jpg","page_title":"Rotore (aeronautica)","context_page_description":"Un rotore, in aeronautica, è un elemento meccanico composto da più pale che, mediante rotazione, permette il pilotaggio, la propulsione e il sostentamento di un aerogiro o di un convertiplano.\\nIl rotore è costituito da un mozzo montato su di un albero meccanico in rotazione libera o posto in rotazione da motori. Al mozzo vengono applicate due o più pale.\\nDifferisce fondamentalmente da un'elica aeronautica, in quanto quest'ultima genera spinta esclusivamente lungo la direzione di avanzamento dell'aeromobile, mentre i rotori possono generare forze anche in direzioni differenti.\\nIl rotore per la sua complessità costituisce un sistema fondamentale degli aerogiri. Il sistema rotore comprende anche i sistemi di orientamento delle pale, e in alcuni casi è reso ulteriormente complesso per la presenza di sistemi di ripiegamento pale per il trasporto o immagazzinamento dell'aeromobile, sensori e sistemi di sghiacciamento delle pale.\\nI rotori caratterizzano in maniera importante gli aeromobili sui quali sono impiegati. Nel tempo ne sono stati messi a punto di diverse tipologie, in risposta a vari e complessi problemi di efficienza e stabilità."},{"page_url":"https://de.wikipedia.org/wiki/Mi%C5%A1ovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Slavkovice_%28Mi%C5%A1ovice%29_%284.%29.jpg","page_title":"Mišovice","context_page_description":"Mišovice, 1924–1960 Míšovice ist eine Gemeinde in Tschechien. Sie befindet sich drei Kilometer südwestlich von Mirovice und gehört zum Okres Písek."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B3%D9%BE%D8%A7%D8%B1_%D8%AF%D8%A7%D9%88%DB%8C%D8%AF_%D9%81%D8%B1%DB%8C%D8%AF%D8%B1%DB%8C%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Caspar_David_Friedrich_by_Christian_Gottlieb_Kuhn_1807%2C_Albertinum%2C_Dresden.jpg","page_title":"کاسپار داوید فریدریش","context_page_description":"کاسپار داوید فریدریش نقاش منظره‌پرداز آلمانی و از پیشگامان جنبش رمانتیسیسم در اوایل قرن نوزدهم بود.\\nکاسپار داوید فریدریش چاپگر و رسام و نقاش رمانتیسم آلمانی و پیشگام در منظره‌پردازی به حساب می‌آید. او بیشتر به‌خاطر منظره‌های دوره میانه فعالیت هنری‌اش مطرح است."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%81ady%C5%BCyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Ukraine._Braclavia_Palatinatus._Beauplan_1648.jpg","page_title":"Ładyżyn","context_page_description":"Ładyżyn – miasto na Ukrainie w obwodzie winnickim przy ujściu Sielnicy do Bohu.\\nMiasto historycznie położone na Podolu znane jest głównie za sprawą bitwy pod Ładyżynem z 1672 roku."},{"page_url":"https://pt.wikipedia.org/wiki/Temporada_de_furac%C3%B5es_no_Pac%C3%ADfico_de_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Patricia_2009_track.png","page_title":"Temporada de furacões no Pacífico de 2009","context_page_description":"A temporada de furacões no Pacífico de 2009 foi um evento do ciclo anual de formação de ciclones tropicais. A temporada começou oficialmente em 15 de maio de 2009 no oceano Pacífico nordeste e em 1º de Junho de 2009 no oceano Pacífico centro-norte. Para ambas as regiões, a temporada terminou em 30 de Novembro de 2009. Estas datas delimitam convencionalmente o período de cada ano quando a maioria dos ciclones tende a se formar no hemisfério norte.\\nA temporada se iniciou efetivamente com a formação da depressão tropical-E em 18 que junho. Um-E atingiu a costa noroeste do México, mas não há relatos sobre danos. Dias depois, o furacão Andres ameaçou a costa sudoeste mexicana, obrigado a remoção de centenas de pessoas de áreas de riscos. No início de agosto, o furacão Felicia ameaçou o Havaí, mas se dissipou pouco antes de atingir o arquipélago. No início de setembro, o furacão Jimena tornou-se o mais intenso furacão a atingir a península da Baixa Califórnia em toda a história, causando pelo menos três fatalidades e mais de 60 milhões de dólares em prejuízos na região."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%90%E3%83%AB%E3%83%88%E3%83%AD%E6%B0%B7%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Baltoro_glacier_from_air.jpg","page_title":"バルトロ氷河","context_page_description":"バルトロ氷河は、カラコルム山脈中央部にある氷河である。シアカンリ峰西方の雪原に発して西へ、次いで北西へ流れ、標高4720メートルのコンコルディアでゴドウィン・オースティン氷河を合わせた後、北のバルトロ・ムスターグ山脈と南のマッシャーブルム山脈の間をゆるやかな弧を描いて西へ流れる。末端は標高3530メートルの氷舌である。バルトロ氷河の全長は約69キロメートル、幅は最大3キロメートルである。シガール川水系に属するビアホ川の水源である。ビアンジェ氷河、ムスターグ氷河、エルマネンドゥ氷河など支氷河が多い。\\nインド測量局のゴドウィン・オースティンが1861年に初めてムスターグ氷河合流点まで探検し、コンウェーは1892年にコンコルディアを経てバルトロ・カンリを試登した。1902年のエッケンシュタイン、1909年のアブルッツィをはじめ、多くの探検隊の活躍の舞台となっている。"},{"page_url":"https://af.wikipedia.org/wiki/Juda%C3%AFsme","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/F%C3%AAte_juive_%C3%A0_T%C3%A9touan%2C_Alfred_Dehodencq%2C_1865.jpg","page_title":"Judaïsme","context_page_description":"Judaïsme of Jodedom is die godsdiens van die Jode met omtrent 15 miljoen volgelinge wêreldwyd in 2006. Dis een van die eerste monoteïstiese godsdienste wat opgeteken is, en een van die oudste tradisies wat nog gevolg word. Judaïsme verskaf ook die waardes en historiese agtergrond tot ander godsdienste, soos Christendom en Islam. Daarbenewens kan die term Judaïsme ook na die Jode se tradisies en leefwyse, hul filosofie en gewoonlik ook hul kulture verwys asook na die Jode as 'n groep. Jerusalem, Hebron, Safed en Tiberias vorm die vier heilige stede van Judaïsme. Chanoeka, Jom Kippoer, Pesach, Poerim, Rosj haSjana, Sabbat, Sjawoe'ot, Soekot en Tisj'a be'Aw is van die vernaamste feeste en herdenkings in die Joodse kalender."},{"page_url":"https://en.wikipedia.org/wiki/Tecumseh_Downtown_Historic_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Tecumseh_Downtown_Historic_District.JPG","page_title":"Tecumseh Downtown Historic District","context_page_description":"The Tecumseh Downtown Historic District is a historic district comprising the downtown commercial area of the city of Tecumseh in Lenawee County, Michigan. It was designated as a Michigan Historic Site on January 16, 1976 and added to the National Register of Historic Places on April 17, 1986.\\nSettled in as early as the 1820s, the Tecumseh Downtown Historic District centers on the intersection of Evans Street and Chicago Boulevard. Evans Street contains only two contributing properties from 115–125 South Evans Street, while no portions of North Evans Street north of M-50 are included in the district. The majority of the district is on M-50, consisting of 102–128 West Chicago Boulevard and 101–154 East Chicago Boulevard. There are a total of 31 contributing properties and eight non-contributing properties.\\nThe two-block-long district consists primarily of two to four-story Italianate buildings dating primarily from 1850–1900. In 1824, Tecumseh pioneer Musgrove Evans platted the village with the intent of Chicago Boulevard to be the main thoroughfare through the village. After being settled, Tecumseh was designated as the county seat of the newly established Lenawee County."},{"page_url":"https://no.wikipedia.org/wiki/Jarl","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Denmark_crown.jpg","page_title":"Jarl","context_page_description":"Jarl er en tittel som ble brukt i middelalderen på de høyeste adelsmennene i Norge. Fra 1200-tallet ble tittelen avløst av hertug, og tilsvarer dette i norsk og nordisk historie. Jarletittelen er, ifølge historikeren Alexander Bugge et «eldgammelt verdighetsnavn» som eksisterte lenge før Harald Hårfagres rikssamling, men ifølge Snorre Sturlason skal kong Harald ha gitt tittelen et nytt innhold ved at han selv utnevnte jarlene og gjorde dem til sine håndgagne menn."},{"page_url":"https://ca.wikipedia.org/wiki/Can_Peralada","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Can_Peralada_-_Llampaies_Camallera.jpg","page_title":"Can Peralada","context_page_description":"Can Peralada és una masia de Llampaies, al municipi de Saus, Camallera i Llampaies inclosa a l'Inventari del Patrimoni Arquitectònic de Catalunya. Està situada dins del petit nucli urbà de la població de Llampaies, a la banda nord del terme, al barri del Puig."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%9F%E3%83%83%E3%83%88%E3%83%BB%E3%83%88%E3%83%AA%E3%83%B4%E3%82%A7%E3%83%87%E3%82%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Amit_Trivedi%2C_Oasis_2016.jpg","page_title":"アミット・トリヴェディ","context_page_description":"アミット・トリヴェディは、インドの作曲家、音楽監督、歌手、作詞家。舞台音楽の作曲家として活動した後、2008年に『Aamir』で映画音楽の作曲家としてデビューする。2009年公開の『デーヴ・D』でナショナル・フィルム・アワード 最優秀音楽監督賞など複数の賞を受賞するなど批評家から高い評価を得ている。"},{"page_url":"https://pl.wikipedia.org/wiki/Wanand","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Vanand.JPG","page_title":"Wanand","context_page_description":"Wanand – wieś w Armenii, w prowincji Armawir. W 2011 roku liczyła 1036 mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/Spanish,_Ontario","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Spanish_ON_3.jpg","page_title":"Spanish, Ontario","context_page_description":"Spanish is a town in the Canadian province of Ontario, located on Trans-Canada Highway 17 in the Algoma District near the border of the Sudbury District. Formerly known as the Township of Shedden, the municipality adopted its current status and name in 2004, taking the name of its largest community.\\nThe Town of Spanish is situated at the mouth of the Spanish River where it empties into the North Channel of Lake Huron. This river and its ecologically rich delta have had a positive impact on the development of the community of Spanish. The river has played an important and continuous role in the local economy from the days of the fur trade, through the timbering era, and now contributes to the tourism industry."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%85%D8%B1%DB%8C%D8%AE_%DA%A9%DB%8C_%D8%A2%D8%A8_%D9%88_%DB%81%D9%88%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Hellas_basin.gif","page_title":"مریخ کی آب و ہوا","context_page_description":"مریخ کی آب و ہوا سائنس دانوں کے لیے صدیوں سے دلچسپی کا باعث اس لیے رہی ہے کیونکہ مریخ وہ واحد چٹانی سیارہ ہے جس کی سطح کو براہ راست مفصل طور پر زمین سے دوربین کی مدد سے دیکھا جا سکتا ہے۔\\nاگرچہ مریخ چھوٹا ہے جس کی کمیت زمین کا 11 فیصد جبکہ سورج سے زمین کے مقابلے 50 فیصد زیادہ فاصلہ بھی ہے، تاہم اس کی آب و ہوا کافی مشابہ ہے، جیسا کہ قطبی برفیلی ٹوپیاں، موسمیاتی تغیر اور قابل مشاہدہ موسمیاتی نمونے۔ یہ مسلسل سیارہ شناسوں اور ماہرین موسمیات کی تحقیق کا ہدف بنا رہا ہے۔ موسمی تبدیلی اور میعادی برفیلے دوروں جیسی مماثلت کی وجہ سے اگرچہ مریخ کی آب و ہوا زمین سے مماثلت رکھتی ہے تاہم کچھ بہت زیادہ اہم اختلافات بھی موجود ہیں جیسے کہ انتہائی پست حرکی جمود۔ مریخ کا کرۂ فضائی کی اونچائی لگ بھگ 11 کلومیٹر یعنی زمین سے 60 فیصد زیادہ ہے۔ آب و ہوا کی اہمیت زیادہ اس وقت ہوتی ہے جب حیات حال یا ماضی میں سیارے پر موجود رہی ہو۔ آب و ہوا میں لوگوں کی زیادہ دلچسپی ناسا سے آنے والی ان خبروں کی بنیاد پر بڑھ گئی ہے جس میں بتایا گیا ہے کہ جنوبی قطبی برفیلی ٹوپی پر بڑھتا ہوا عمل تصعید شاید مریخ پر متوازی عالمگیری حرارت کا سبب بن رہا ہے۔ اگرچہ حقیقت یہ ہے کہ مریخ کا درجہ حرارت گزشتہ چند دہائیوں میں اور گر کر ٹھنڈا ہوا ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/Joel_Fuhrman","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Joelfuhrman.jpg","page_title":"Joel Fuhrman","context_page_description":"Joel Fuhrman is an American celebrity doctor who advocates what he calls a micronutrient-rich diet.\\nA former competitive figure skater, he suffered a serious injury which removed him from competition. He says an alternative medicine therapy helped speed his recovery and led him to become a physician. His practice is based on his nutrition-based approach to obesity and chronic disease, also referred to as a nutritarian or restrictive diet, as well as promoting his products and books. He has written several books promoting his dietary approaches including the bestsellers Eat to Live, Super Immunity, The Eat to Live Cookbook, The End of Dieting and The End of Heart Disease and he sells a related line of nutrition related products."},{"page_url":"https://el.wikipedia.org/wiki/ATR_72","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/ATR72.jpg","page_title":"ATR 72","context_page_description":"Το ATR 72 είναι ένα δικινητήριο ελικοφόρο \\"τούρμπο-προπ\\" αεροσκάφος μικρών αποστάσεων, κατασκευασμένο στην Ιταλία και την Γαλλία από τον όμιλο ATR. Έχει χωρητικότητα μέχρι 72 επιβάτες σε διαμόρφωση μίας θέσης. Η Αμερικανική American Eagle Airlines, ο μεγαλύτερος χρήστης του τύπου, αποκαλεί τα μοντέλα της ως Super ATR."},{"page_url":"https://en.wikipedia.org/wiki/List_of_islands_of_California","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/San-miguel-cuyler-hike.jpg","page_title":"List of islands of California","context_page_description":"This list of islands of California is organized into sections, generally arranged from north to south. The islands within each section are listed in alphabetical order.\\nThe Geographic Names Information System lists 527 named islands in the state."},{"page_url":"https://cs.wikipedia.org/wiki/USS_Nevada_(BB-36)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Nevada_%28BB-36%29_aground_and_burning_off_Waipio_Point%2C_after_the_end_of_the_Japanese_air_raid..jpg","page_title":"USS Nevada (BB-36)","context_page_description":"USS Nevada byla první jednotka třídy Nevada. Pojmenována byla v souladu s doktrínou USA po jednom ze států USA, po Nevadě. Měla jedinou sesterskou loď s názvem Oklahoma."},{"page_url":"https://en.wikipedia.org/wiki/Mioawateria","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Mioawateria_vivens_001.jpg","page_title":"Mioawateria","context_page_description":"Mioawateria is a genus of sea snails, marine gastropod mollusks in the family Raphitomidae."},{"page_url":"https://de.wikipedia.org/wiki/Georgskirche_(Fabric)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Piata_Traian.jpg","page_title":"Georgskirche (Fabric)","context_page_description":"Die Kirche des großen Märtyrers St. Georg ist eine Kirche und ein denkmalgeschütztes historisches Gebäude an der Piața Traian im II. Bezirk Fabric der westrumänischen Stadt Timișoara. Sie ist zusammen mit der Serbisch-Orthodoxen Kathedrale an der Piața Unirii in der Inneren Stadt und der Nicolaikirche an der Piața Avram Iancu im V. Bezirk Mehala eine der drei serbisch-orthodoxen Kirchen der Stadt."},{"page_url":"https://it.wikipedia.org/wiki/Sportgemeinschaft_Dynamo_Dresden","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Bundesarchiv_Bild_183-R0515-0006%2C_Fu%C3%9Fballmannschaft_SG_Dynamo_Dresden.jpg","page_title":"Sportgemeinschaft Dynamo Dresden","context_page_description":"Il Sportgemeinschaft Dynamo Dresden e.V., noto in Italia come Dinamo Dresda, è una società calcistica tedesca della città di Dresda. Milita nella 3. Liga, la terza divisione del calcio tedesco.\\nLa squadra viene fondata il 12 aprile 1953 con il nome di Sportgemeinschaft Dynamo Dresden, denominazione che cambiò nel 1990 divenendo per l'appunto 1. FC Dynamo Dresden. È stata una delle più prestigiose e popolari squadre di calcio della Repubblica Democratica Tedesca, vincendo 8 DDR-Oberliga e 7 coppe nazionali.\\nDopo la riunificazione tedesca nel 1990, la Dinamo Dresda ha militato dal 1991 al 1995 nella Bundesliga. Nel 1995, a causa di problemi finanziari, la squadra non ha potuto iscriversi alle prime due divisioni del campionato tedesco ed è stata retrocessa nel campionato regionale.\\nNel 2004 il club è risalito in seconda divisione per poi nuovamente scendere nella Regionalliga dopo due stagioni. Dopo essersi qualificata alla Dritte Bundesliga per il campionato 2008-2009, nel 2011 fu promossa nuovamente in Zweite Bundesliga."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%A2%85%E8%8E%89%E8%8E%8E%C2%B7%E5%BD%BC%E5%BE%97%E6%9B%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Melissa_Peterman_by_Gage_Skidmore.jpg","page_title":"梅莉莎·彼得曼","context_page_description":"梅莉莎·瑪格麗特·彼得曼，又稱「梅莉莎·彼得曼」，是一位美國女演員，同時也兼具電視節目主持人，她因客串2012年《好景在望》飾演勞倫·沃斯一角而聞名，另外，她還出演電視節目《少男老爸》。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%A7%D7%95%D7%98%D7%94_%D7%94%D7%A6%D7%A4%D7%95%D7%A0%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Img_ulmus_americana_2209.jpg","page_title":"דקוטה הצפונית","context_page_description":"דקוטה הצפונית היא אחת ממדינות ארצות הברית, הנמצאת במערב התיכון של ארצות הברית על גבול קנדה, המשתרעת מצפון לה. בירתה היא ביסמרק והעיר הגדולה ביותר בה היא פארגו.\\nדקוטה הצפונית היא חלק מכיבוש \\"הספר הפראי\\" של המאה ה-19 בארצות הברית. שם המדינה נגזר משמו של שבט דקוטה שישב באותן טריטוריות, ענף משנה של שבט הסו.\\nדקוטה הצפונית היא אחת משש המדינות שהשתייכו לרצועת הספר בימי המערב הפרוע."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A2%D7%99%D7%A0%D7%95%D7%AA_%D7%A6%D7%95%D7%A7%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Eynot_zukim.jpg","page_title":"עינות צוקים","context_page_description":"שְׁמּוּרַת עֵינוֹת צוּקִים היא שמורת טבע מוכרזת לאורך החוף הצפון-מערבי של ים המלח, דרומית לקיבוץ קלי\\"ה. השמורה הוכרזה ב-22 ביוני 1988 ביחד עם שמורת קנה וסמר. כמו כן, אורכה של השמורה כ-6.5 ק\\"מ, והיא מחולקת לשלושה חלקים:\\nחלק צפוני המהווה שמורה סגורה לבני אדם.\\nחלק מרכזי הפתוח לקהל ובו מספר בריכות שכשוך ומתקני נופש.\\nחלק דרומי בו ניתן לבקר במסגרת סיור מודרך בלבד.\\nעל פי רשות הטבע והגנים, זו השמורה היבשתית הנמוכה ביותר בעולם, ובשטח השמורה נמצא נווה המדבר הנמוך ביותר בעולם."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%84%D8%AA%D9%85%D8%A7%D8%B1%DA%A9%DB%8C%D8%B3%DA%86_%D9%88%DB%8C%D8%B3%DA%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Altm%C3%A4rkische_Wische_in_SDL.png","page_title":"التمارکیسچ ویسچ","context_page_description":"التمارکیسچ ویسچ یک شهر در آلمان است که در زاکسن-آنهالت واقع شده‌است."},{"page_url":"https://nl.wikipedia.org/wiki/Regelmatig_twintigvlak","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Plato-20.png","page_title":"Regelmatig twintigvlak","context_page_description":"Een regelmatig twintigvlak of icosaëder, Oudgrieks: εἴκοσι, twintig, is een van de vijf regelmatige veelvlakken in drie dimensies. Een regelmatig twintigvlak heeft 20 gelijkzijdige driehoeken als zijvlak, die congruent zijn. Het heeft icosahedrale symmetrie.\\nEen regelmatig twintigvlak omvat een antiprisma."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AE%E0%AF%81%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AF%81%E0%AE%B3%E0%AE%BF%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AE%BE%E0%AE%A9%E0%AF%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Phoenicopteridae_face.JPG","page_title":"முக்குளிப்பான்","context_page_description":"முக்குளிப்பான் என்பது போடிசிபெடிபார்மஸ் வரிசையில் உள்ள ஒரு பறவைக் குடும்பமாகும். இந்த வரிசையுடன் தொடர்புடைய பறவை வகை இது மட்டுமே ஆகும்.\\nமுக்குளிப்பான்கள் வரிசையானது பரவலாகக் காணப்படும் நன்னீர் மூழ்கிப் பறவைகளின் வரிசையாகும். எனினும் சில வகைப் பறவைகள் குளிர்காலத்திலும் வலசை போதலின் போதும் கடலுக்குச் செல்லும். இந்த வரிசையில் போடிசிபெடிடே எனும் ஒரே ஒரு குடும்பம் மட்டுமே உள்ளது. இக்குடும்பத்தில் உள்ள 6 வகைப் பேரினங்களில் 22 உயிரினங்கள் உள்ளன."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A0%88%EC%9D%BC%ED%81%AC%EB%A3%A8%EC%A6%88_%ED%95%B4%EB%9E%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Korail_DL7382.jpg","page_title":"레일크루즈 해랑","context_page_description":"레일크루즈 해랑은 한국철도공사의 자회사인 코레일관광개발에서 운영하는 관광열차이다. 해랑은 '너랑 나랑', '해랑 달이랑'을 의미한다. 2003년 로템에서 제작한 무궁화호 후기 리미트 객차 및 식당차 및 침대차를 개조하여 새마을호 특실 등급으로 운행하고 있다."},{"page_url":"https://tr.wikipedia.org/wiki/Stony_Brook_%C3%9Cniversitesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Stonybrooklibrary.jpg","page_title":"Stony Brook Üniversitesi","context_page_description":"State University of New York at Stony Brook ya da daha yaygın bilinen adıyla Stony Brook Üniversitesi, Stony Brook, New York, ABD'de bulunan devlet araştırma üniversitesidir.\\nStony Brook, New York Eyalet Üniversitesi sisteminde bulunan dört üniversiteden biridir ve 22.000'den fazla öğrencisi vardır. SUNY'nin iki ileri araştırma merkezi bu üniversite bünyesinde çalıştırılır. Stony Brook ayrıca Birleşik Devletler Enerji Departmanı sözleşmesi ile Brookhaven National Labs'ı da işletir.\\nStony Brook Üniversitesi Kuzey Amerika'nın en önde gelen araştırma üniversitelerinden biridir ve 2001 yılında Amerikan Üniversiteler Derneği'ne katılmıştır. AAU'de sadece 62 üniversite vardır. Amerika Birleşik Devletleri'nde ise yaklaşık olarak 4.000 üniversite vardır.\\nAmerika Birleşik Devletleri'nde, Stony Brook Üniversitesi en iyi 40 halk üniversitelerinden birisidir Amerika kaynaklı \\"Best Buy\\" adıyla anılan the U.S. Fiske Guide to Colleges'e göre.\\nThe Wall Street Journal Stony Brook'u en iyi 8 vakıf üniversitesi arasında göstermiştir.\\nÜniversite aynı zamanda The Institute for Higher Education in Shanghai tarafından dünyadaki en iyi 152 üniversite arasında gösterilmiştir."},{"page_url":"https://nl.wikipedia.org/wiki/Rixt_van_Oerd","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/RixtvanhetOerd.jpg","page_title":"Rixt van Oerd","context_page_description":"Rixt van Oerd of Rixt van het Oerd is de hoofdpersonage uit een volksverhaal dat zich afspeelt op Ameland."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D8%AF%D8%B9%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Cypraea_caputserpentis.jpg","page_title":"ودعة","context_page_description":"الودعات هي مجموعة قواقع بحرية صغيرة وكبيرة، من الرخويات البحرية وطائفة البطنقدميات."},{"page_url":"https://sv.wikipedia.org/wiki/Chrysophyllum_imperiale","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Chrysophyllum_imperiale.JPG","page_title":"Chrysophyllum imperiale","context_page_description":"Chrysophyllum imperiale är en tvåhjärtbladig växtart som först beskrevs av Jean Jules Linden, Karl Heinrich Koch och Gustav Adolf Fintelmann, och fick sitt nu gällande namn av George Bentham och Joseph Dalton Hooker. Chrysophyllum imperiale ingår i släktet Chrysophyllum och familjen Sapotaceae. IUCN kategoriserar arten globalt som starkt hotad. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%AE%D1%80%D0%B0_%D0%BA%D0%B5%D0%B7%D0%B5%D2%A3%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Brachiosaurus_DB.jpg","page_title":"Юра кезеңі","context_page_description":"Юра жүйесі немесе Юра кезеңі — мезозой заманын құрайтын үш кезеңнің бірі. Триас пен бор арасында орналасқан юра кезеңі осыдан 199,6 млн жылдан 145,5 млн жылға дейін созылады. Ең кең тараған тау жыныстары саз балшық, ізбесті құмдақ және әктас болып, юра кезеңі 11 ярусқа бөлінеді.\\nКөптеген басқа омыртқасыздармен бірге брахиоподтар, қосқақпалылар және аммониттер кең тараған. Юра кезеңінде рептилиялар жер мен суда көп кездесіп, сүтқоректілер саны аз, көбінесе түңгі өмір сүрген деп есептеледі. Алғаш құстар, оның ішінде археоптерикс, кеш юра кезінде пайда болған.\\nЮра – мезозой дәуірінің триастан кейінгі, бордан бұрынғы орта кезеңі және сол кездерде жаралған тау жыныстарының қат-қабаттары. Юра жүйесі осыдан 199,6 миллион жыл бұрын басталып, 145,5 миллион жыл бұрын аяқталған, ұзақтығы шамамен 54,1 миллион жыл. Оны неміс жаратылыстанушы А.Гумбольд Швейцария мен Францияның Юра тауларында анықтап, француз геологы А.Броньяр жеке жүйеге бөліп, қазіргі атымен атаған. Юра жүйесінің жікқабаттық шкаласын алғаш француз палеонтологы А.ДОрбинь жасады, ол юра жүйесін 10 жікқабатқа бөлген."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D1%81%D1%82%D1%83%D0%B4%D0%B5%D0%BD%D1%82%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D1%8E%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/uk/2/27/%D0%9D%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%BC%D0%B5%D0%BC%D0%BE%D1%80%D0%B0%D0%BD%D0%B4%D1%83%D0%BC_%D0%9E%D0%A1%D0%A1.jpeg","page_title":"Національний студентський союз","context_page_description":"Націона́льний студе́нтський сою́з — всеукраїнська молодіжна громадська організація, котра об’єднує осіб, які навчаються у більше, ніж 120 вищих навчальних закладах України. Основна мета діяльності Організації – представництво та захист науково-освітніх, трудових, соціально-економічних та інших прав, а також інтересів осіб, які навчаються, формування високосвідомої молодіжної спільноти України."},{"page_url":"https://eo.wikipedia.org/wiki/Primatoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ring_tailed_lemurs.jpg","page_title":"Primatoj","context_page_description":"Primatoj estas ordo de mamuloj. La termino devenas el latina vorto por \\"unua rango\\". En taksonomio, primatoj inkludas prosimiulojn kaj simiulojn. Primatoj aperis el prauloj kiuj vivis en arboj de tropikaj arbaroj; multaj primataj karakteroj reprezentas adaptaĵojn al la vivo en tiu defia tri-dimensia medio. Plej primataj specioj restas almenaŭ parte arboloĝantoj.\\nKun la escepto de homoj, kiuj loĝas en ĉiu kontinento, plej primatoj loĝas en tropikaj aŭ subtropikaj regionoj de Ameriko, Afriko kaj Azio. Ili gamas laŭgrandece el Berta muslemuro, kiu pezas nur 30 g, al la Orienta gorilo de malaltaj teroj, kiu pezas ĉirkaŭ 200 kg. Baze sur fosilia pruvaro, la plej fruaj konataj veraj primatoj, reprezentataj de la genro Teilhardina, datas el antaŭ 55.8 milionoj da jaroj. Frua proksima primata parenco konata el abundaj restoj estas de fina Paleoceno Plesiadapis, de antaŭ ĉirkaŭ 55–58 milionoj da jaroj. Studoj per molekula horloĝo sugestas, ke primata branĉo povas esti eĉ pli antikva, origine en la mezo de la periodo de Kretaceo de antaŭ ĉirkaŭ 85 ma.\\nLa ordo Primatoj estis tradicie dividita en du ĉefaj grupoj: prosimiuloj kaj antropoidoj."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Angelo_State_University_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/ASUAlumni.jpg","page_title":"List of Angelo State University people","context_page_description":"This list of Angelo State University people includes notable alumni, faculty, and former students of Angelo State University."},{"page_url":"https://sv.wikipedia.org/wiki/Rostkindad_cistikola","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Red-faced_Cisticola_%28Cisticola_erythrops%29.jpg","page_title":"Rostkindad cistikola","context_page_description":"Rostkindad cistikola är en fågel i familjen cistikolor inom ordningen tättingar."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%83%D0%BE%D1%80%D1%93%D0%B8%E2%80%9C_-_%D0%92%D0%B0%D1%88%D0%B0%D1%80%D0%B5%D1%98%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%83%D0%BE%D1%80%D1%93%D0%B8%E2%80%9C_-_%D0%92%D0%B0%D1%88%D0%B0%D1%80%D0%B5%D1%98%D1%86%D0%B0_6.jpg","page_title":"Црква „Св. Ѓорѓи“ - Вашарејца","context_page_description":"Свети Ѓорѓи — главна селска црква во селото Вашарејца. Црквата е сместена на рид над селото и железничката пруга."},{"page_url":"https://es.wikipedia.org/wiki/Congreso_de_Tucum%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/El-Congreso-de-Tucum%C3%A1n-1816-Francisco-Fortuny.jpg","page_title":"Congreso de Tucumán","context_page_description":"El Congreso de Tucumán fue una asamblea soberana que al mismo tiempo se desempeñó como tribunal, poder legislativo y constituyente. Fue convocada por un acuerdo establecido en el Estatuto de 1815 y sesionó en dos lugares distintos: desde el 24 de marzo de 1816 al 16 de enero de 1817 lo hizo en la ciudad de San Miguel de Tucumán, y posteriormente en la ciudad de Buenos Aires, entre 12 de mayo de 1817 y el 11 de febrero de 1820. Los actos propiamente constituyentes del congreso fueron: el Acta de declaración de la independencia, el Manifiesto que hace a las Naciones el Congreso General Constituyente, el Reglamento Provisorio para la dirección y administración del Estado, y la Constitución de las Provincias Unidas de Sud-América."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%AA%D8%A7%D8%AA%D9%88%D9%86_(%D9%86%D8%A8%D8%B1%D8%A7%D8%B3%D9%83%D8%A7)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Stanton%2C_Nebraska_N_side_of_Ivy_St.JPG","page_title":"ستاتون (نبراسكا)","context_page_description":"ستاتون ‏ هي مدينة أمريكية تقع في ولاية نبراسكا. تبلغ مساحة هذه المدينة 4.5،ويبلغ عدد سكانها 1577 نسمة حسب إحصاء سنة 2010 م 1577.تشير إحصاءات سنة 2000م بأن الكثافة السكانية في هذه المدينة تقدر بـ نسمة/كم2"},{"page_url":"https://da.wikipedia.org/wiki/Kryptozoologi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Chupacabras.JPG","page_title":"Kryptozoologi","context_page_description":"Kryptozoologi beskæftiger sig med mytologiske eller uddøde dyr, der antages at eksistere, selv om der ikke findes beviser for deres eksistens.\\nKryptozoologiens dyr falder i tre grupper:\\nVelkendte dyr på mærkelige steder som løven på Fyn og lossen i Stenderupskovene ved Kolding.\\nOfficielt uddøde dyr som den tasmanske pungulv, der officielt uddøde i 1936. Eller den mystiske dinosaur-lignende Mokele Mbembe, der skulle leve i søen Lake Tele i Den Demokratiske Republik Congo.\\nFantasivæsener, havuhyrer, søslanger og afskyelige snemænd m.fl.\\nCand.scient. Lars Thomas er Danmarks eneste kryptozoolog; han har skrevet flere bøger om emnet.\\nZoologen Bernhard Heuvelman siges at have opfundet begrebet kryptozoologi. Kryptozoologien regnes ofte som en pseudovidenskab, da nogle kryptozoologer har en antropologisk indgangsvinkel til emnet.\\nMange dyr, der før hørte under kryptozoologien, er ved hjælp af krytozoologernes forskning identificeret som almindelige dyr eller fænomener. Fx okapien og næbdyret. Kryptozoologer taler for at man skal være mere åben overfor lokale rygter og myter om mystiske dyr, da der sagtens kan være noget om snakken."},{"page_url":"https://es.wikipedia.org/wiki/Arlington_Heights_(California)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/ArlingtonheightssignDSCN3963.JPG","page_title":"Arlington Heights (California)","context_page_description":"Arlington Heights es un área no incorporada ubicada en el condado de Los Ángeles en el estado estadounidense de California.​"},{"page_url":"https://de.wikipedia.org/wiki/Denkm%C3%A4ler_der_Volksrepublik_China_(Peking)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Chongwenmen_Church.jpg","page_title":"Denkmäler der Volksrepublik China (Peking)","context_page_description":"Die folgende Tabelle bietet eine Übersicht zu sämtlichen Denkmälern in der regierungsunmittelbaren Stadt Peking, die auf der Denkmalliste der Volksrepublik China stehen:"},{"page_url":"https://cs.wikipedia.org/wiki/TV_Nova_(spole%C4%8Dnost)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Nova_International_logo_2017.png","page_title":"TV Nova (společnost)","context_page_description":"TV Nova s. r. o., dříve CET 21 spol. s r. o. je česká mediální společnost, která vlastní vysílací licence pro všechny kanály Nova Group. Společnost se také profiluje jako producentské centrum, kdy se sfúzovala s MediaPro Pictures.\\nMajitelem společnosti je mediální konglomerát CME."},{"page_url":"https://ro.wikipedia.org/wiki/Aragua","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Escudo_Libertador_Aragua.PNG","page_title":"Aragua","context_page_description":"Statul Aragua este unul dintre cele 23 de state din care este format statul Venezuela. Statul Aragua este localizat în partea centrală și de nord a Venezuelei pe malul mării Caraibe. Capitala statului Aragua este la Maracay."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%8A%E5%85%B9%E5%AF%86%E5%B0%94%E6%B0%91%E6%97%8F%E5%BF%97%E5%8D%9A%E7%89%A9%E9%A6%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Turkish_embroidery.jpg","page_title":"伊兹密尔民族志博物馆","context_page_description":"伊兹密尔民族志博物馆是土耳其伊兹密尔的一个民族志博物馆，收藏的文物包括陶器，镀锡，刺绣，珠宝和插图手稿等，展示了当地的艺术，工艺和风俗。博物馆免费入场。\\n伊兹密尔民族志博物馆所在的建筑建于1831年，原为圣罗氏医院。该建筑高四层，用石头建造。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_castles_and_palaces_in_Sweden","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Tureholms_slott_norr_2012.jpg","page_title":"List of castles and palaces in Sweden","context_page_description":"This is a list of castles and palaces in Sweden.\\nIn the Swedish language the word slott is used for both castles, châteaus and palaces; this article lists all of them as well as fortresses."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D1%81%D1%83%D0%BC%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Ru-Sus-gazeta.jpg","page_title":"Сусуман","context_page_description":"Сусума́н — город в России, административный центр Сусуманского района и соответствующего ему городского округа Магаданской области России. Город районного значения, до 2015 года образовывал городское поселение город Сусуман. Расположен на берегу реки Берелёх.\\nВ июне 1977 года в Сусуманском районе в долине ручья Киргилях был найден мамонтёнок Дима."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%BF%CE%BD%CE%AE_%CE%91%CE%B3%CE%AF%CE%BF%CF%85_%CE%9D%CE%B9%CE%BA%CE%BF%CE%BB%CE%AC%CE%BF%CF%85_%CE%91%CE%BD%CE%B1%CF%80%CE%B1%CF%85%CF%83%CE%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Meteora_-_Agios_Nikolaos_Anapafsas_1.jpg","page_title":"Μονή Αγίου Νικολάου Αναπαυσά","context_page_description":"Η Μονή Αγίου Νικολάου Αναπαυσά είναι μοναστήρι στα Μετέωρα. Είναι ένα από τα έξι που συνεχίζουν να είναι ενεργά στα Μετέωρα, τα οποία από το 1988 συμπεριλαμβάνονται στα μνημεία παγκόσμιας κληρονομιάς της UNESCO. Η μόνη ξεχωρίζει εξαιτίας του σχεδιασμού της, ο οποίος προσαρμόστηκε στο μικρής έκτασης πλάτωμα στο οποίο έχει κτιστεί, με αλλεπάλληλα πατώματα. Στον κατώτερο όροφο της μονής βρίσκεται το παρεκκλήσι του Αγίου Αντωνίου, του 14ου αιώνα με ίχνη αγιογραφιών, και κρύπτη. Στον από πάνω όροφο βρίσκεται το καθολικό και στον τελευταίο όροφο, όπου βρίσκεται το αρχονταρίκι, το οστεοφυλάκιο και το παρεκκλήσι του Αγίου Ιωάννου του Προδρόμου.\\nΤο όνομα της μόνης πιθανότατα οφείλεται σε κάποιον ασκητή του 14ου αιώνα ο οποίος ασκήτευσε στον βράχο. Η μονή ανακατασκευάστηκε την πρώτη δεκαετία του 16ου αιώνα από τον μητροπολίτη Λαρίσης Άγιο Διονύσιο τον Ελεήμονα και τον ιερομόναχο Νικάνορα, έξαρχο Σταγών. Το καθολικό της αγιογραφήθηκε από τον Κρητικό ζωγράφο Θεοφάνη Στρελίτζα το 1527. Οι αγιογραφίες αυτές αποτελούν ένα από τα σημαντικότερα σύνολα της μεταβυζαντινής ζωγραφικής. Λόγω της μικρής διαθέσιμης επιφάνειας στους τοίχους το ναού, πολλές παραστάσεις έχουν μέγεθος φορητής εικόνας."},{"page_url":"https://en.wikipedia.org/wiki/Hurricane_How","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/How_1951_track.png","page_title":"Hurricane How","context_page_description":"Hurricane How was the only tropical cyclone to make landfall on the United States in 1951. It was the eighth storm of the season, forming on September 28 in the northwest Caribbean and, after entering the Gulf of Mexico, turned eastward and became a tropical storm. The storm brought heavy rainfall to Florida, causing flooding and $2 million in damage. Tropical Storm How later became a hurricane, passing near the Outer Banks of North Carolina where it produced strong winds and high tides. A ship called the \\"Southern Isles\\" capsized off Cape Hatteras, killing 17 out of the crew of 23. Rains and high tides occurred in southeastern New England, before the hurricane moved out to sea and became extratropical."},{"page_url":"https://it.wikipedia.org/wiki/Flogsta","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Flogsta_by_night.jpg","page_title":"Flogsta","context_page_description":"Flogsta è un quartiere nella zona occidentale della città svedese di Uppsala. Buona parte degli abitanti sono studenti dell'Università di Uppsala e della Sveriges Lantbruksuniversitet."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%9C%D7%A4%D7%90_%D7%A8%D7%95%D7%9E%D7%99%D7%90%D7%95_450","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Alfa_Romeo_455_Autotransporter_LKW_02_-_AVD_Oldtimer_Grand_Prix_2014.JPG","page_title":"אלפא רומיאו 450","context_page_description":"אלפא רומיאו 450 היא משאית אשר יוצרה על ידי יצרנית הרכב אלפא רומיאו האיטלקית בין השנים 1947–1959."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D1%98%D0%BE%D0%BD_%D0%BB%D0%B5_%D0%91%D1%80%D0%B0%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Crillon_-_%C3%A9glise_2.jpg","page_title":"Кријон ле Брав","context_page_description":"Кријон ле Брав насеље је и општина у Француској у региону Прованса-Алпи-Азурна обала, у департману Воклиз која припада префектури Карпантрас.\\nПо подацима из 2011. године у општини је живело 443 становника, а густина насељености је износила 58,06 становника/km². Општина се простире на површини од 7,63 km². Налази се на средњој надморској висини од 395 метара."},{"page_url":"https://en.wikipedia.org/wiki/J%C3%A4mtland","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Olav_den_helliges_saga_-_Torodd_Arnljott_Geline_-_H._Egedius_-_H._Egedius.jpg","page_title":"Jämtland","context_page_description":"Jämtland is a historical province in the centre of Sweden in northern Europe. It borders Härjedalen and Medelpad to the south, Ångermanland to the east, Lapland to the north and Trøndelag and Norway to the west. Jämtland covers an area of 34,009 square kilometres, 8.3% of Sweden's total area and is the second largest province in Sweden. It has a population of 115,331, the majority of whom live in Storsjöbygden, the area surrounding lake Storsjön. Östersund is Jämtland's only city and is the 24th most populous city in Sweden.\\nJämtland was originally an autonomous peasant republic, its own nation with its own law, currency and parliament. Jämtland was conquered by Norway in 1178 and stayed Norwegian for over 450 years until it was ceded to Sweden in 1645. The province has since been Swedish for roughly 370 years, though the population did not gain Swedish citizenship until 1699. The province's identity is manifested with the concept of a republic within the kingdom of Sweden, although this is only done semi-seriously.\\nHistorically, socially and politically Jämtland has been a special territory between Norway and Sweden."},{"page_url":"https://de.wikipedia.org/wiki/Fairuz_Fauzy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Fairuz_Fauzy_2008_WSBR_Silverstone.jpg","page_title":"Fairuz Fauzy","context_page_description":"Mohamed Fairuz Fauzy ist ein ehemaliger malaysischer Rennfahrer. Er wurde 2009 Vizemeister der Formel Renault 3.5. 2011 nahm er in der GP2-Serie sowie der Formel Renault 3.5 an Rennen teil und war Testfahrer beim Formel-1-Team Renault."},{"page_url":"https://lb.wikipedia.org/wiki/Opinel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Opinel-Logo--w.jpg","page_title":"Opinel","context_page_description":"Opinel ass eng franséisch Messerfabréck, déi zu Chambéry am Departement Savoie produzéiert.\\nDéi bei wäitem am meeschte bekannt Produkter sinn d'Täschemessere mat engem Grëff aus Bichenholz an enger Limecht aus Kuelestoffstol, déi an 11 Gréisste fabrizéiert ginn, déi vun No 2 bis 13 numeréiert sinn, an eng Limechtlängt tëscht 3,5 an 22 cm hunn."},{"page_url":"https://ro.wikipedia.org/wiki/Antoinette_de_M%C3%A9rode","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Antoinette_de_Merode.jpg","page_title":"Antoinette de Mérode","context_page_description":"Antoinette de Merode, Prințesă de Monaco, fiica contelui Werner de Merode și a soției acestuia, contesa Victoire de Spangen d'Uyternesse.\\nS-a căsătorit la 28 septembrie 1846 la Bruxelles cu Carol al III-lea, Prinț de Monaco. Ea a achiziționat Castelul Marchais care este proprietatea familiei Grimaldi și astăzi. Din 1856 până la moartea ei a fost Prințesă consort de Monaco. Cuplul a avut un singur copil: Albert I, Prinț de Monaco.\\nEa a fost sora lui Louise de Mérode și mătușa Mariei Vittoria dal Pozzo, care a fost timp de trei ani regină a Spaniei."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A0%E3%83%8F%E3%83%B3%E3%83%9E%E3%83%89%E3%83%BB%E3%82%A2%E3%83%AA%E3%83%BC%E3%83%BB%E3%82%B7%E3%83%A3%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/MuhammadAliShah.jpg","page_title":"ムハンマド・アリー・シャー","context_page_description":"ムハンマド・アリー・シャーは、北インド、アワド藩王国の君主。"},{"page_url":"https://it.wikipedia.org/wiki/Ry%C5%8Dta_Nagaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Ryota_Nagaki.jpg","page_title":"Ryōta Nagaki","context_page_description":"Ryōta Nagaki è un calciatore giapponese, centrocampista dei Kashima Antlers."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%AB%BB%E4%BA%95%E5%B8%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Oomiwa.jpg","page_title":"櫻井市","context_page_description":"樱井市是位于日本奈良县中部、中和地区的城市。\\n辖区西侧位于奈良盆地的东南部区域，主要市区也位于此部分的平原区域中，东部和南部则位于龙门山地内。\\n由于是奈良县各地的木材的集散地，制产业发达，是有名的“木之町”。此外在山区有生产蜜柑产地，亦有许多农家也会利用农闲时期生产制造素面，“三轮素面”也成为日本三大“手延べ素麺”之一。"},{"page_url":"https://no.wikipedia.org/wiki/H%C4%81%C5%A1im_al-At%C4%81ss%C4%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Hashim_Al_Atassi.jpg","page_title":"Hāšim al-Atāssī","context_page_description":"Hāšim Ḫālid al-Atāssī, fornavn også skrevet Hashim og Hashem, var en syrisk nasjonalistisk politiker for nasjonalblokken. Han spilte en viktig rolle i syrisk historie i det tjuende århundre, både i Det arabiske kongedømmet Syria, det franske Syria-Libanon-mandatet og i den uavhengige syriske arabiske republikk. Han tjente tre ganger som Syrias statsoverhode, fra 1936 til 1939, fra 1949 til 1951 og fra 1954 til 1955, og to ganger som statsminister, i 1920 og i 1949. Som president forsøkte han å motarbeide militærstyre, sosialisme og nasserisme. To andre medlemmer av hans familie, Luay al-Atassi og Nur ad-Din al-Atassi, kom også til å tjene som syriske presidenter."},{"page_url":"https://it.wikipedia.org/wiki/Jon_Turteltaub","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/JonTurteltaubHWOFJan2013.jpg","page_title":"Jon Turteltaub","context_page_description":"Jonathan Charles Turteltaub è un regista, produttore cinematografico e produttore televisivo statunitense."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%A5%D6%80%D5%A1%D5%AF%D6%80%D5%A1%D6%83%D5%B8%D5%B2%D5%AB_%D5%AB%D5%B6%D6%84%D5%B6%D5%A1%D5%A2%D5%B8%D6%82%D5%AD_%D5%BA%D5%A1%D5%BF%D5%BC%D5%BE%D5%A1%D5%AE%D6%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Herman_Boerhaave_-_Project_Gutenberg_eText_15690..jpg","page_title":"Կերակրափողի ինքնաբուխ պատռվածք","context_page_description":"Բուրխավեի համախտանիշ, կերակրափողի պատի բոլոր երեք շերտերի ինքնաբուխ պատռվածք\` կրծքավանդակում և/կամ վերփորային հատվածում սուր ցավով ուղեկցվող, որը ճառագայթում է դեպի մեջք։ Համախտանիշին բնորոշ են կլլման ակտի խանգարում, փսխում, դժվարացած շնչառություն, շոկի զարգացում։ Առաջին անգամ նկարագրվել է 1721 թվականին հոլանդացի բժիշկ Գերման Բուրխավեի կողմից։ Այդ համախտանիշի ցման ախտորոշումն առաջին անգամ դրել է V. Myers 1858 թվականին։ Հիվանդության Ժամանակին ախտորոշումն իրենից մեծ դժվարություն է ներկայացնում\` կլինիկական դրսևորումնեի բազմազանության, հազվադեպ հանդիպման և հաճախ այլ օրգան-համակարգերի պաթոլոգիան նմանակելու և բժիշկնեռի մեծամասնության անտեղյակության պատճառով։ Բժշկական համաշխարհային գրականության մեջ 1998 թվականին նկարագրված է կերակրափողի ինքանբուխ պատռվածքի 300-ից քիչ ավելի դեպք։ Կախված բարձր մահացության և բավականին դժվար ախտորոշման հետ, ճիշտ ախտորոշումը հաճախ հաստատվում է միայն հետմահու\` դիահերձման ժամանակ։"},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%94%D7%9E%D7%98_%D7%94%D7%A8%D7%90%D7%A9%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Sultan_I._Ahmet.jpg","page_title":"אהמט הראשון","context_page_description":"אהמט הראשון היה הסולטאן הארבעה-עשר של האימפריה העות'מאנית, ושלט בה מ-1603 ועד יום מותו."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B0%91%E9%9B%84%E9%84%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/National_Radio_Museum%2C_The_Japanese_Style_Hospitality_House%2C_west_side_%28Taiwan%29_02.jpg","page_title":"民雄鄉","context_page_description":"民雄乡位于台湾嘉义县中北部，北邻大林镇、溪口乡，西邻新港乡，西南连太保市，东邻竹崎乡、梅山乡，南接嘉义市东区、西区，紧邻嘉义市，为嘉义都会区最大的卫星城市。\\n乡内人口数7.1万，为嘉义县人口最多且唯一逾7万人的地区，其人口几乎达县治太保市的两倍，亦为全国人口第三大乡。地处嘉南平原之上，地势平缓，气候上属副热带季风气候与热带季风气候的过渡带，产业以制造业较为发达，在政府扶持设厂下，耐斯企业及旗下数间负责制造业之子公司等公司之总部将设置于民雄。\\n民雄乡文风兴盛，大专院校数为全嘉义最多，与嘉义市并列第一，知名的国立中正大学即位于此。另有国立嘉义大学民雄校区、吴凤科技大学设于本乡。嘉义县表演艺术中心亦位于本乡。"},{"page_url":"https://tg.wikipedia.org/wiki/%D0%94%D0%B7%D1%8E%D0%B4%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Tai_otoshi.jpg","page_title":"Дзюдо","context_page_description":"Дзюдо́ — санъати ҷангии жопунӣ, фалсафа ва варзиши ҷанги бе аслиҳа, ки дар охири асри XIX дар асоси ҷиу-ҷитсу устои санъати ҷангӣ Дзигоро Кано |嘉納 治五郎|Кано: Дзигоро бунёд кард ва дастурҳое офарид, ки дар онҳо чӣ гуна машқ кардан ва чӣ тавр озмоиш гузаронидан гуфта шудааст.\\nРӯзи тавлиди дзюдо аз рӯзи кушодани якум мактаби дзюдо дар Кодокан|講道館|кодо:кан|«Донишгоҳи омӯзиши Роҳ» соли 1882."},{"page_url":"https://en.wikipedia.org/wiki/Flatiron_Building_(Bellingham,_Washington)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Bellingham_Flatiron_Building.png","page_title":"Flatiron Building (Bellingham, Washington)","context_page_description":"The Hamilton Building also known as The Flatiron Building of Bellingham was the first \\"skyscraper\\" in Bellingham. Built in 1908 for Talifero Simpson Hamilton's growing Bellingham Bay Furniture Company established in 1889, the building cost $100,000 and used thirty-five thousand barrels of cement along with 200,000 pounds of steel. Due to its triangular shape and resemblance to the Fuller Building in New York, the building instantly garnered the flatiron nickname. It was Bellingham's tallest structure until 1926."},{"page_url":"https://ca.wikipedia.org/wiki/Reserva_Natural_de_Marapendi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Vista_da_Reserva_de_Marapendi.JPG","page_title":"Reserva Natural de Marapendi","context_page_description":"La Reserva Natural de Marapendi és una reserva de natura de costa d'aproximadament 665,62 hectàrees, localitzada als barris de Barra da Tijuca i Recreio de Rio de Janeiro al Brasil. Creada per la preservació d'animals i plantes natives com l'Araucària del Brasil, la restinga, els mangles o el Tucà ariel\\nLes fronteres legals de la reserva s'estenen sobre el Parc Natural Municipal de Marapendi. S'ha permès desenvolupar petites àrees amb un nombre reduït de comerciants dins de la reserva."},{"page_url":"https://lb.wikipedia.org/wiki/Mittal_Steel_Company","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/MittalSteelGalati200607.jpg","page_title":"Mittal Steel Company","context_page_description":"Mittal Steel Company N.V. war 2005 an 2006, vum Volume hir, dee weltgréisste Stolproduzent. D'Gesellschaft huet zu 88% dem Lakshmi Mittal senger Famill gehéiert. Mittal Steel hat hire Sëtz zu Rotterdam, mä gouf vu London aus vum Mittal a sengem Jong Aditya gefouert. Entstanen ass se, wéi Ispat International N.V. d'LNM Holdings N.V. opkaf huet an 2005 mat der International Steel Group Inc. fusionéiert huet.\\n2006 huet se mat der Arcelor zu der Arcelor Mittal fusionéiert.\\nMittal Steel huet zulescht 179.000 Leit beschäftegt. 2004 hat se en Ëmsaz vun 22 Milliarden US-Dollar an hat 48 Milliounen Tonne Stol produzéiert. Mittal Steel ass duerch hir Strategie, Stolfirmen, déi schlecht dru waren opzekafen an ze moderniséieren, bannent e puer Joer zum Nummer 1 eropgeklommen.\\nD'Firma hat Schmelzen a 17 Länner: China, Indonesien, Vereenegt Staaten, Mexiko, Kanada, Frankräich, Däitschland, Polen, Rumänien, Algerien, Südafrika, Tschechien, Bosnien an Herzegowina, Nordmazedonien, Trinidad an Tobago, Kasachstan an an der Ukrain.\\nDe 27. Januar 2006 huet Mittal Steel annoncéiert, 18,6 Milliarden Euro fir d'Arcelor bidden ze wëllen."},{"page_url":"https://en.wikipedia.org/wiki/Ch%C5%ABbu_region","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Nagoya_TV_Tower_from_Oasis_21_s2.JPG","page_title":"Chūbu region","context_page_description":"The Chūbu region, Central region, or Central Japan is a region in the middle of Honshū, Japan's main island. In a wide, classical definition, it encompasses nine prefectures: Aichi, Fukui, Gifu, Ishikawa, Nagano, Niigata, Shizuoka, Toyama, and Yamanashi.\\nIt is located directly between the Kantō region and the Kansai region and includes the major city of Nagoya as well as Pacific Ocean and Sea of Japan coastlines, extensive mountain resorts, and Mount Fuji.\\nThe region is the widest part of Honshū and the central part is characterized by high, rugged mountains. The Japanese Alps divide the country into the Pacific side, sunny in winter, and the Sea of Japan side, snowy in winter.\\nAlthough Mie is part of Kinki/Kansai/Western Japan in traditional geographical regional divisions, Northern Mie is part of the metropolitan area around Nagoya, and Mie is in many practical contexts considered to be part of Tōkai/Chūbu/Central Japan. Including Mie, Chūbu has a population of 23,010,276 as of 1 June 2019."},{"page_url":"https://pt.wikipedia.org/wiki/Chaleira","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Teapot_P1100116.jpg","page_title":"Chaleira","context_page_description":"Chaleira é um utensílio culinário que, teria como sua principal função, a preparação de chá, essa função torna idealizado seu nome como \\"chaleira\\". Recipiente proprio para preparação de chás\\nA chaleira tradicional é um recipiente de metal com a forma de um cilindro baixo com uma tampa no topo e um bico lateral. Este utensílio foi desenhado para aquecer água para o chá colocando-se sobre uma boca de fogão."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AD%E0%A5%81%E0%A4%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Hamirsar_Lake_Bhuj_2013-08-01_00-20.jpg","page_title":"भुज","context_page_description":"भुज भारत के गुजरात राज्य के कच्छ ज़िले में स्थित एक नगर है। यह ज़िले का मुख्यालय भी है।"},{"page_url":"https://de.wikipedia.org/wiki/Corps_Hasso-Nassovia","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Corpshaus_Hasso_Nassovia1.jpg","page_title":"Corps Hasso-Nassovia","context_page_description":"Das Corps Hasso-Nassovia Marburg ist eine pflichtschlagende und farbentragende Studentenverbindung im Kösener Senioren-Convents-Verband. Das Corps vereint Studenten und Alumni der Philipps-Universität Marburg."},{"page_url":"https://ro.wikipedia.org/wiki/Goldfrapp","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Goldfrapp_Live_2010.jpg","page_title":"Goldfrapp","context_page_description":"Goldfrapp este o formație engleză de muzică electronică înființată în anul 1999. Ea se compune din Alison Goldfrapp și Will Gregory, dintre aceștia doar Alison oferind suport vocal înregistrărilor promovate de grup, ea fiind și singura care apare pe majoritatea coperților albumelor, discurilor single și în videoclipuri. Primul album de studio al grupului, Felt Mountain, a fost lansat în toamna anului 2000, însă nu a înregistrat performanțe deosebite. Cel de-al doilea material discografic de studio, Black Cherry, a fost promovat la peste doi ani distanță, el incluzând șlagăre precum „Strict Machine” sau „Train”, primul ocupând locul 1 în Billboard Hot Dance/Club Play. Black Cherry a marcat creșterea popularității grupului, lucru dovedit de discul de platină obținut în Regatul Unit.\\nDiscul a fost urmat de un nou succes, materializat prin Supernature, lansat în vara anului 2005. Acesta s-a comercializat în aproximativ un milion de exemplare la nivel mondial și a primit o nominalizare la premiile Grammy."},{"page_url":"https://en.wikipedia.org/wiki/Benveniste","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Map_Iberian_Peninsula_1037-es.svg","page_title":"Benveniste","context_page_description":"Benveniste, is the surname, byname of an old, noble, rich, and scholarly Jewish family of Narbonne, France and northern Spain from the 11th century. The family was present in the 11th to the 15th centuries in Hachmei Provence, France, Barcelona, Aragon and Castile Spain.\\nFamily members received honorary titles from the authorities and were members of the administration of the kingdom of Aragon and Castile. They were the Baillie - the Tax Officer and Treasurer, Alfaquim - Senior Advisor to the King and Royal Physician in Barcelona and Aragon in the 12th and 13th centuries. They held the title of \\"Nasi\\", since they are considered by the Jewish tradition as descendants of King David and members of the House of David in the Jewish communities and were prominent religious and secular leaders in the 11th to the 14th centuries.\\nIn the 14th to the 15th century they held the titles of \\"Benveniste de la Cavalleria\\"—\\"of the knights\\" and Don—a noble person in Aragon and Castile. In the aftermath of the massacres of Jews which began in Spain on 6 June 1391 some such as the de Cartagena family converted to Christianity and became powerful conversos in Burgos."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_gouverneurs_de_Porto_Rico","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Prim_madrazo.jpeg","page_title":"Liste des gouverneurs de Porto Rico","context_page_description":"Cette liste des gouverneurs de Porto Rico comprend toutes les personnes qui ont occupé ce poste, que ce soit sous domination espagnole ou américaine. Le gouverneur de Porto Rico est le chef de gouvernement du Commonwealth de Porto Rico. Le poste a été créé par l'Empire espagnol au cours du XVIᵉ siècle à la suite de la colonisation de l'archipel.\\nLa première personne à occuper officiellement le poste a été le conquistador espagnol Juan Ponce de León en 1509. À l'époque, la monarchie espagnole était chargée de nommer le fonctionnaire qui remplirait cette fonction. Le premier natif portoricain à avoir exercé la fonction était Juan Ponce de León II, comme gouverneur par intérim en 1579. Au cours de cette administration, tous ceux qui ont été nommés pour occuper le poste avaient servi une autre fonction au sein du gouvernement de l'Empire ou de l'Église catholique romaine. En 1898, les États-Unis ont envahi Porto et le gouvernement espagnol leur a cédé le contrôle de l'île. Au cours des deux premières années, l'ensemble du gouvernement était nommé par le président des États-Unis."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D9%85%DB%8C%D9%86%D8%A7%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/%D9%82%D9%84%D8%B9%D9%87_%D9%87%D8%B2%D8%A7%D8%B1%D9%87_%28%D8%A8%DB%8C_%D8%A8%DB%8C_%D9%85%DB%8C%D9%86%D9%88%29_%282%29.jpg","page_title":"شهرستان میناب","context_page_description":"میناب یکی از شهرستان‌های شرقی استان هرمزگان واقع در جنوب ایران است. شهرستان میناب در سال ۱۳۳۹ تأسیس شده، کد تقسیماتی آن ۱۳۴ و مرکز این شهرستان، شهر میناب است."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B0%D1%87%D1%83%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D1%82%D0%B5%D0%BB%D0%B5%D0%B2%D0%B5%D0%B6%D0%B0_(1979)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/%D0%9C%D0%B0%D1%87%D1%82%D0%B0_%D0%BD%D0%B0_%D0%9A%D0%B0%D1%80%D0%B0%D1%87%D1%83%D0%BD-%D0%B3%D0%BE%D1%80%D0%B5.JPG","page_title":"Карачунська телевежа (1979)","context_page_description":"Карачунська телевежа — телекомунікаційна вежа заввишки 222 м, що діяла протягом 1979—2014 років на горі Карачун, поблизу Слов'янська, у Донецькій області."},{"page_url":"https://it.wikipedia.org/wiki/Flagellazione_di_Cristo_(Piero_della_Francesca)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Piero%2C_flagellazione_01.jpg","page_title":"Flagellazione di Cristo (Piero della Francesca)","context_page_description":"La Flagellazione di Cristo è un dipinto, tempera su tavola di Piero della Francesca, creato nel 1453 circa e conservato nella Galleria Nazionale delle Marche di Urbino."},{"page_url":"https://es.wikipedia.org/wiki/Ostrowiec_%C5%9Awi%C4%99tokrzyski","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Ostrowiec_Rynek_20071008_0920.jpg","page_title":"Ostrowiec Świętokrzyski","context_page_description":"Ostrowiec Świętokrzyski es una ciudad ubicada en el centro-sur de Polonia, en la región histórica de Pequeña Polonia. Es la capital del condado homónimo y desde 1999 forma parte del voivodato de Santa Cruz, del que es la segunda ciudad más poblada después de Kielce, con 71 728 habitantes en 2014.​ En 1613 obtuvo el estatuto de ciudad. Ostrowiec tiene un área de 46 km² y está dividido en 20 distritos.\\nOstrowiec Świętokrzyski está bañado por el río Kamienna. Los distritos septentrionales se encuentran en las estribaciones del bosque de Iłża, mientras que la parte meridional pertenece a la meseta de Opatów. La sierra de Santa Cruz se encuentra a algunos kilómetros al suroeste de Ostrowiec. La ciudad es uno de los centros históricos de la industria polaca, y forma parte de la Región Industrial de Vieja Polonia, la cuenca industrial más antigua del país. La principal industria en la actualidad es la metalurgia. Dos puntos de interés en Ostrowiec son la reserva arqueológica de Krzemionki y el parque de dinosaurios de Bałtów.\\nOstrowiec se encuentra en la intersección de la Carretera Nacional n.º 9 y las carreteras locales 751, 754 y 755."},{"page_url":"https://en.wikipedia.org/wiki/Keresdrakon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Keresdrakon_forelimbs.jpg","page_title":"Keresdrakon","context_page_description":"Keresdrakon is an extinct genus of tapejaromorph pterosaurs from the Cretaceous Goio-Erê Formation of Brazil. It contains a single species, Keresdrakon vilsoni."},{"page_url":"https://hu.wikipedia.org/wiki/Ganz_MUV","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/MUV_3430.jpg","page_title":"Ganz MUV","context_page_description":"A Ganz MUV az UV3-as széria 1993–94-ben modernizált, 20 példányból álló altípusa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B5%D0%BA%D0%BA%D0%B5%D1%80,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81_%D0%AD%D0%BB%D1%80%D0%BE%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/James_Elroy_Flecker_at_Cambridge.jpg","page_title":"Флеккер, Джеймс Элрой","context_page_description":"Джеймс Элрой Флеккер — английский поэт, писатель и драматург. Как поэт особо был вдохновлён Парнасской школой."},{"page_url":"https://pl.wikipedia.org/wiki/Muzeum_Pszczelarstwa_w_Str%C3%B3%C5%BCach","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Muzeum_Pszczelarstwa_im._Bogdana_Szymusika_w_Str%C3%B3%C5%BCach.jpg","page_title":"Muzeum Pszczelarstwa w Stróżach","context_page_description":"Muzeum Pszczelarstwa im. Bogdana Szymusika w Stróżach – prywatne muzeum we wsi Stróże. Placówka jest przedsięwzięciem Janusza Kasztelewicza – właściciela firmy „Bartnik Sądecki”.\\nWłaściciel muzeum zajmuje się pszczelarstwem od 1973 roku. W 1991 roku utworzył firmę „Bartnik Sądecki”, natomiast samo muzeum powstało w 2000 roku. Muzeum nadano imię pszczelarza Bogdana Szymusika którego kolekcja uli stała się podstawą utworzonej ekspozycji muzealnej uli. Muzeum ma charakter skansenu, na terenie którego znajdują się następujące obiekty:\\nwystawa „Sekrety ula” ukazująca wnętrze ula i życie pszczół oraz proces powstawania miodu,\\nwystawa „Pszczoły i ludzie” ukazująca historię pszczelarstwa i narzędzia używane przez pszczelarzy, a także zbiór publikacji pochodzących z XVII–XIX wieku,\\nplenerowa kolekcja uli, przekazana muzeum w 2000 roku przez krakowskiego pszczelarza-kolekcjonera Bogdana Szymusika. Zbiór liczy ponad 100 uli o fantazyjnych niejednokrotnie kształtach, zaś dwa z nich pochodzą z RPA. Na szczególną uwagę zasługują ule pochodzące z 1822 roku – kłodowy na pięć pszczelich rodzin i snozowy,"},{"page_url":"https://sv.wikipedia.org/wiki/Pyracantha_crenulata","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Ghangaru.jpg","page_title":"Pyracantha crenulata","context_page_description":"Pyracantha crenulata är en rosväxtart som först beskrevs av David Don, och fick sitt nu gällande namn av M. Roemer. Pyracantha crenulata ingår i släktet eldtornar, och familjen rosväxter. Utöver nominatformen finns också underarten P. c. kansuensis."},{"page_url":"https://en.wikipedia.org/wiki/National_Cheng_Kung_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Nckuaerial.jpg","page_title":"National Cheng Kung University","context_page_description":"National Cheng Kung University is a public research university located in Tainan, Taiwan. NCKU is one of the best comprehensive universities in Taiwan and a leader in promoting industry-academia cooperation. It has consistently been ranked as one of the top universities in Asia. The university is best known for engineering, computer science, medicine, and planning and design.\\nAs a top university in Taiwan, NCKU has played a vital role in creating the Taiwan Miracle by helping Taiwan to transform from an agriculture-based society to an industrialized economy during the 1960s and 1970s, and further becoming one of the Four Asian Tigers. To this day, NCKU has many successful alumni in various industries in Taiwan. According to LinkedIn data, many of its graduates work in companies including TSMC, MediaTek, UMC, Applied Materials, and more. NCKU has been taking the top spot at the Global Views Monthly Taiwan Graduate Employability Rankings for 5 consecutive years."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B1%B1%E5%8F%A3%E6%B3%B0%E6%98%8E","image_url":"https://upload.wikimedia.org/wikipedia/ja/4/40/Taimei_Yamaguchi.jpg","page_title":"山口泰明","context_page_description":"山口 泰明は、日本の政治家。自由民主党所属の衆議院議員。現在は自民党組織運動本部長。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B1%D1%80%D0%B0%D0%B3%D0%B8%D0%BC%D0%BE%D0%B2,_%D0%98%D0%B1%D1%80%D0%B0%D0%B3%D0%B8%D0%BC_%D0%9C%D0%B0%D0%B3%D0%BE%D0%BC%D0%B5%D0%B4%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Coat_of_Arms_of_Dagestan_ASSR.png","page_title":"Ибрагимов, Ибрагим Магомедович","context_page_description":"Ибраги́м Магоме́дович Ибраги́мов — советский и российский дагестанский учёный и врач, а также писатель. Доктор медицинских наук, профессор. Министр здравоохранения Республики Дагестан. Заслуженный врач РСФСР, заслуженный врач ДАССР, народный врач РД."},{"page_url":"https://sk.wikipedia.org/wiki/Bar-l%C3%A8s-Buzancy","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Map_commune_FR_insee_code_08049.png","page_title":"Bar-lès-Buzancy","context_page_description":"Bar-lès-Buzancy je francúzska obec, ktorá sa nachádza v departemente Ardennes, v regióne Champagne-Ardenne."},{"page_url":"https://es.wikipedia.org/wiki/Luis_Rodolfo_de_Brunswick-Wolfenb%C3%BCttel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Louis_Rudolph_duke_of_Brunswick-Wolfenb%C3%BCttel.jpg","page_title":"Luis Rodolfo de Brunswick-Wolfenbüttel","context_page_description":"Luis Rodolfo de Brunswick-Luneburgo fue un príncipe alemán de la antigua Casa de los Welfos y duque de Brunswick-Luneburgo desde 1731 hasta el año de su muerte en 1735. Gobernó también sobre Wolfenbüttel y Blankenburg, subdivisiones del ducado."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A1%E0%B8%A3%E0%B8%AA%E0%B8%B8%E0%B8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/MatheranPanoramaPointMonsoon.JPG","page_title":"มรสุม","context_page_description":"มรสุม เป็นการหมุนเวียนส่วนหนึ่งของลมที่พัดตามฤดูกาล คือ ลมประจำฤดู สาเหตุใหญ่ ๆ เกิดจากความแตกต่างระหว่างอุณหภูมิของพื้นดิน และพื้นน้ำในฤดูหนาวอุณหภูมิของพื้นดินเย็นกว่า อุณหภูมิของน้ำในมหาสมุทร อากาศเหนือพื้นน้ำจึงมีอุณหภูมิสูงกว่า และลอยตัวขึ้นสู่เบื้องบน อากาศเหนือทวีปซึ่งเย็นกว่าไหลไปแทนที่ ทำให้เกิดเป็นลมพัดออกจากทวีป พอถึงฤดูร้อนอุณหภูมิของดินภาคพื้นทวีปร้อนกว่าน้ำในมหาสมุทร เป็นเหตุให้เกิดลมพัดในทิศทางตรงข้าม ลมมรสุมที่มีกำลังแรงจัดที่สุดได้แก่ ลมมรสุมที่เกิดในบริเวณภาคใต้ และภาคตะวันออกเฉียงใต้ของทวีปเอเชีย\\nการเปลี่ยนแปลงฤดูกาลในชั้นบรรยากาศ และวัฎจักรของฝน เนื่องจากความไม่เท่ากันของการรับและคายความร้อนของพื้นดินและน้ำ โดยทั่วไปแล้วเป็นคำที่ใช้บรรยายช่วงของฤดูกาลเปลี่ยนแปลงที่มีฝนตก ในระดับโลกสามารถที่จะจำแนกมรสุมได้เป็น มรสุมแอฟริกันตะวันตก และ มรสุมเอเชียออสเตรเลีย คำว่า “มรสุม” ถูกใช้เป็นครั้งแรกในภาษาอังกฤษ ในอินเดียของบริเตน เพื่อสื่อถึงลมประจำฤดูกาลที่พัดจากอ่าวเบงกอล และทะเลอาหรับนำพาฝนคะนองเข้าไปสู่บริเวณอินเดียของบริเตน\\nคำว่า \\"มรสุม\\" หรือ monsoon ในภาษาอังกฤษ มาจากคำว่า موسم [mausem] ในภาษาอารบิก แปลว่า ฤดูกาล"},{"page_url":"https://de.wikipedia.org/wiki/Fast_Radio_Burst","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Frb_1.png","page_title":"Fast Radio Burst","context_page_description":"Ein Fast Radio Burst, Schneller Radioblitz oder Extragalactic Fast Radio Transient ist ein einmaliger kurzer Ausbruch im Bereich der Radiostrahlung mit einer Dauer von wenigen Millisekunden in extragalaktischen Entfernungen. Er wird auch als Blitzar, Millisecond Radio Burst, Extragalactic Radio Burst oder Cosmological Fast Radio Burst bezeichnet. Über ihren Ursprung und ihre Ursache gibt es bisher nur Hypothesen."},{"page_url":"https://pl.wikipedia.org/wiki/Hrywna","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/5_hryvnia_coin_of_Ukraine%2C_2018_%28reverse%29.jpg","page_title":"Hrywna","context_page_description":"Hrywna – oficjalna waluta Ukrainy. Kod walutowy ISO 4217: UAH, symbol: ₴ – w standardzie Unicode: U+20B4, skrót ukraiński: грн. 1 hrywna jest równa 100 kopiejkom.\\nJedna hrywna warta jest około 0,15 PLN.\\nHrywna weszła do obiegu w 1996 podczas reform ekonomicznych, zastępując karbowańca. Nazwa pochodzi od średniowiecznej miary srebra – grzywny."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Sommerspiele_2004/Leichtathletik_%E2%80%93_100_m_H%C3%BCrden_(Frauen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Perdita_Felicien_TK_cropped.jpg","page_title":"Olympische Sommerspiele 2004/Leichtathletik – 100 m Hürden (Frauen)","context_page_description":"Der 100-Meter-Hürdenlauf der Frauen bei den Olympischen Spielen 2004 in Athen wurde am 22., 23. und 24. August 2004 im Olympiastadion Athen ausgetragen. 37 Athletinnen nahmen teil.\\nOlympiasiegerin wurde die US-Amerikanerin Joanna Hayes. Sie gewann vor der Ukrainerin Olena Krassowska und der US-Amerikanerin Melissa Morrison.\\nFür Deutschland gingen Kirsten Bolm, Nadine Hentschke und Juliane Sprenger an den Start. Hentschke und Sprenger schieden in der Vorrunde aus, Bolm konnte ihr Halbfinalrennen nicht beenden. Athletinnen aus der Schweiz, Österreich und Liechtenstein nahmen nicht teil."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%AA%D8%B4%D9%8A%D9%86%D9%87%D9%8A%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Achenheim%2C_Mairie.jpg","page_title":"أتشينهيم","context_page_description":"أتشينهيم ‏ هي بلدية تقع في إقليم الراين الأسفل من منطقة ألزاس في شمال شرق فرنسا. تبلغ مساحة هذه المدينة 6.03، وترتفع عن سطح البحر 167 م، يبلغ عدد سكانها 2230 نسمة حسب إحصاء المعهد الوطني للإحصاء والدراسات الاقتصادية سنة 2009 م. وترأس Raymond Leipp البلدية خلال فترة."},{"page_url":"https://sv.wikipedia.org/wiki/Stockholms_sk%C3%A4rg%C3%A5rd","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Busterm.jpg","page_title":"Stockholms skärgård","context_page_description":"Stockholms skärgård är en arkipelag i östra Mellansverige, belägen längs större delen av Stockholms läns kust. Den räknas som Sveriges största skärgård och den näst största i Östersjön, efter Skärgårdshavet i sydvästra Finland. Området saknar formell avgränsning, men brukar anses sträcka sig från Arholma i norra delen av länet, cirka 150 kilometer utefter Upplands och Södermanlands kuster till Landsort i söder och i väst-östlig riktning från Stockholms fastland cirka 80 kilometer österut till i höjd med Svenska Högarna. Skärgården utanför Stockholm brukar delas upp i två huvuddelar, den norra delen med Vaxholm som centralort i söder och Norrtälje i norr, respektive den södra delen med Dalarö som centralort i norr och Nynäshamn i söder. Skärgården mellan Vaxholm och Dalarö och österut brukar benämnas den mellersta skärgården.\\nStockholms skärgård har mellan Björkö-Arholma och Öja-Landsort befunnits ha något över 24 000 öar, holmar och skär och täcker cirka 1 700 km² varav cirka 530 km² är land. Det finns omkring 10 000 bofasta och 50 000 fritidshus i skärgården."},{"page_url":"https://sv.wikipedia.org/wiki/Antitrichia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Antitrichia_curtipendula_%28a%2C_143506-474108%29_8913.JPG","page_title":"Antitrichia","context_page_description":"Antitrichia är ett släkte av bladmossor som beskrevs av Brid.. Antitrichia ingår i familjen Leucodontaceae.\\nKladogram enligt Catalogue of Life och Dyntaxa:"},{"page_url":"https://nl.wikipedia.org/wiki/Donald_Duck_(personage)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Donald_Duck_Star_on_the_Walk_of_Fame.JPG","page_title":"Donald Duck (personage)","context_page_description":"Donald Duck is een fictieve eend die voorkomt in veel van de strips en tekenfilms gemaakt door The Walt Disney Company. Zijn volledige naam is Donald Fauntleroy Duck.\\nDonald Duck is een antropomorfe eend met oranje-gele benen, voeten en snavel. Hij draagt meestal een matrozenpak, bestaand uit een shirt een rode strik en een blauwe pet."},{"page_url":"https://en.wikipedia.org/wiki/Benedum_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Chandelier%2C_Benedum_Center%2C_Pittsburgh%2C_2019-10-15%2C_01.jpg","page_title":"Benedum Center","context_page_description":"The Benedum Center for the Performing Arts is a theater and concert hall located at 237 7th Street in the Cultural District of Pittsburgh, Pennsylvania. Designed by the Philadelphia architectural firm Hoffman-Henon, it was built in 1928 as the Stanley Theatre. The former movie palace was renovated and reopened as the Benedum Center for the Performing Arts in 1987."},{"page_url":"https://en.wikipedia.org/wiki/Moriya,_Ibaraki","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Moriya_Ibaraki_chapter.JPG","page_title":"Moriya, Ibaraki","context_page_description":"Moriya is a city located in Ibaraki Prefecture, Japan. As of September 2015, the city had an estimated population of 64,644, and a population density of 1810 persons per km². Its total area is 35.71 square kilometres."},{"page_url":"https://en.wikipedia.org/wiki/Herbie_Hancock","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Michael_Herbie_Playboy_2008.jpg","page_title":"Herbie Hancock","context_page_description":"Herbert Jeffrey Hancock is an American pianist, keyboardist, bandleader, composer, and actor. Hancock started his career with Donald Byrd. He shortly thereafter joined the Miles Davis Quintet, where he helped to redefine the role of a jazz rhythm section and was one of the primary architects of the post-bop sound. In the 1970s, Hancock experimented with jazz fusion, funk, and electro styles.\\nHancock's best-known compositions include the jazz standards \\"Cantaloupe Island\\", \\"Watermelon Man\\", \\"Maiden Voyage\\", and \\"Chameleon\\", as well as the hit singles \\"I Thought It Was You\\" and \\"Rockit\\". His 2007 tribute album River: The Joni Letters won the 2008 Grammy Award for Album of the Year, only the second jazz album to win the award, after Getz/Gilberto in 1965.\\nSince 2012, Hancock has served as a professor at the University of California, Los Angeles, where he teaches at the UCLA Herb Alpert School of Music. He is also the chairman of the Herbie Hancock Institute of Jazz."},{"page_url":"https://nn.wikipedia.org/wiki/Vierramvarre","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Vierramvares_topp.jpg","page_title":"Vierramvarre","context_page_description":"Vierramvare, eller Rullevare, nordsamisk Vierranvárri, er eit fjell som er 1711 meter høgt, som ligg vest for Kebnekaise i Lappland i Sverige. Fjellsidene er relativt bratte og består i stor del av lause steinblokker. I aust styrtar fjellet bratt ned i Kitteldalen og i vest-sørvest ned i Singivagge. I nord sluttar det ned i Kaffedalen og i sør ned i den mindre dalen mellom Vierramvare og Tolpagorni.\\nFjellvandrarar som er på veg mot sørtoppen av Kebnekaise kan velje å gå den såkalla Västra leden, som blant anna passerer over toppen av Vierramvare. Langs med stien, i området omkring toppen, har forbipasserande vandrarar oppført store mengder røyser av nærliggande steinar i skiftande storleik og form."},{"page_url":"https://no.wikipedia.org/wiki/Cumdach","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Stowe_Missal_cumdach_%28inverted%29.png","page_title":"Cumdach","context_page_description":"Cumdach er et skrin til oppbevaring av bøker og manuskript, brukt i middelalderens Irland. Skrinene var ofte vakkert utsmykket og ornamentert. Den første kjente referansen til en cumdach i irske annaler er da Flann Sinna bekostet en til Durrow-boken. Selv om slike skrin nok først ble laget for å beskytte og oppbevare bøker, er dette et eksempel på det motsatte. Durrow-boken har nemlig skader langs kantene på grunn av at boken ikke passet til skrinet den ble plassert i.\\nAnnalene av de fire mesterne nevner også at Donnchad mac Flainn utstyrte Armagh-boken med en cumdach i 937. I 1006 ble Kellsboken stjålet, selv om selve boken kom til rette noe senere, var cumdachen med gull-og juvelutsmykking tapt.\\nInskripsjonene på forsiden av Stowe-messebokens cumdach er den eneste samtidige kilde som eksplisitt kaller Donnchad mac Briain konge av Irland."},{"page_url":"https://it.wikipedia.org/wiki/Ahidous","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/COLLECTIE_TROPENMUSEUM_Dansgroep_uit_de_Midden-Atlas_tijdens_het_Nationaal_Folkore_Festival_te_Marrakech_TMnr_20017658.jpg","page_title":"Ahidous","context_page_description":"L’ahidous è una danza tradizionale praticata dalle tribù berbere del medio e Alto Atlante, in cui uomini e donne, affiancati gomito a gomito, formano linee morbide e ondeggianti, accompagnandosi con canti al ritmo del bendir.\\nL'ahidous è noto per essere il divertimento preferito degli Amazigh del Marocco centrale, di cui costituisce il mezzo di espressione più completo e vivo. Lo si danza in ogni occasione festiva, in particolare nelle feste principali, alla fine della Festa del sacrificio e nei giorni delle nozze; inoltre, d'estate, dopo la mietitura, quasi tutte le sere nei villaggi.\\nI danzatori si dispongono in cerchio, a semicerchio, o su due file che si fronteggiano, solo uomini, solo donne o uomini e donne alternati, molto stretti, spalla a spalla, formando un unico blocco. La danza è ritmata con un tamburello e col battito delle mani. I movimenti sono collettivi; è un calpestio, un fremito che si propaga, intervallato da ampie ondulazioni, come colpi di vento sulle messi.\\nPer la disinvoltura e l'immagine d'insieme dei danzatori, l'ahidous testimonia un senso del ritmo rimarchevole."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%81%D1%82%D0%B8,_%D0%90%D0%B4%D1%80%D0%B8%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Adriana_Asti.jpg","page_title":"Асти, Адриана","context_page_description":"Адриана Асти; род. 30 апреля 1933, Милан, Италия — итальянская актриса."},{"page_url":"https://fr.wikipedia.org/wiki/V%C3%A2njule%C8%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Vanjulet_jud_Mehedinti.png","page_title":"Vânjuleț","context_page_description":"Vânjuleț est une commune roumaine du județ de Mehedinți, dans la région historique de l'Olténie et dans la région de développement du Sud-Ouest."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%A6%E0%A4%BF%E0%A4%B2%E0%A5%8D%E0%A4%B2%E0%A5%80_%E0%A4%A6%E0%A4%B0%E0%A4%B5%E0%A4%BE%E0%A4%9C%E0%A4%BE,_%E0%A4%A6%E0%A4%BF%E0%A4%B2%E0%A5%8D%E0%A4%B2%E0%A5%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Delhi_Gate_View_from_Road.JPG","page_title":"दिल्ली दरवाजा, दिल्ली","context_page_description":"दिल्ली दरवाजा दिल्ली शहर के दक्षिणी ओर का नगर रक्षक द्वार था। यह द्वार पुरानी दिल्ली क्षेत्र और नई दिल्ली क्षेत्र के बीच स्थित है। पुरानी दिल्ली क्षेत्र के नेताजी सुभाष मार्ग एवं नई दिल्ली क्षेत्र के बहादुर शाह ज़फ़र मार्ग के बीच यह दरयागंज के छोर पर स्थित है।\\nइस दरवाजे का निर्माण मुगल बादशाह शाहजहां ने १६३८ में दिल्ली के सातवे शहर तथा तत्कालीन राजधानी शहर शाहजहानाबाद की घेराबन्दी करती रक्षक दीवार के प्रवेशद्वार के रूप में करवाया था। बादशाह इस द्वार का उपयोग नमाज करने हेतु जामा मस्जिद जाने के ल्लिये किया करता था।\\nयह द्वार नगर के तत्कालीन उत्तरी द्वार कश्मीरी दरवाजे से मिलता जुलता था एवं इसे हाथी-पोल भी कहा जाता थाआ। यह लाल बलुआ पत्थर एवं अन्य पत्थरों से बड़े आकार का करवाया गया था। द्वार के निकट ही दो बड़े बड़े हाथी की मूर्तियां भी बनी थीं। इसे पहले हाथी पोल भी कहा जाता था।\\nइस दरवाजे से निकलती सड़क उत्तरी ओर मुख्य शहर से गुजरती हुई उत्तरी द्वार, कश्मीरी दरवाजे तक जाती थी, एवं दरियागंज से निकलती है। वहाम की दीवार का कुछ भाग दिल्ली जंक्शन रेलवे स्टेशन के निर्माण हेतु ध्वस्त कर दिया गया था। वर्तमान में इस इमारत को ऐतिहासिक स्मारक रूप में संरक्षित किया गया है, तथा इसका रखरखाव भारतीय पुरातात्त्विक सर्वेक्षण विभाग द्वारा किया जा रहा है।"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%AC%AC43%E5%B1%86%E6%9F%8F%E6%9E%97%E9%9B%BB%E5%BD%B1%E7%AF%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Michelle_Pfeiffer_1994.jpg","page_title":"第43屆柏林電影節","context_page_description":"第43届柏林国际电影节在柏林当地时间1993年2月11日到2月22日举行。本届柏林电影节评审团主席是中国导演张艺谋，金熊奖则由台湾导演李安及中国导演谢飞共同获得。"},{"page_url":"https://zh.wikipedia.org/zh-cn/1975%E5%B9%B4%E5%A4%AA%E5%B9%B3%E6%B4%8B%E9%A2%B1%E9%A2%A8%E5%AD%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Alice_1975_track.png","page_title":"1975年太平洋颱風季","context_page_description":"1975年太平洋台风季泛指在1975年全年内的任何时间，于赤道以北及国际换日线以西的太平洋水域，以及南中国海所产生的热带气旋。虽然有关方面并没有设下本台风季的指定期限，但大部分于西北太平洋的热带气旋通常都会于五月至十二月期间形成。\\n本条目的范围仅局限于赤道以北及国际换日线以西的太平洋及南海的水域。于赤道以北及国际换日线以东的太平洋水域产生的风暴则被称为飓风，并被列入1975年太平洋飓风季。\\n以下各热带气旋资讯以热带气旋存在期间的最强形态为准。"},{"page_url":"https://eo.wikipedia.org/wiki/Pre%C4%9Dejo_Anunciacio_(T%C3%BCrje)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/T%C3%BCrje_l%C3%A9gifot%C3%B3.jpg","page_title":"Preĝejo Anunciacio (Türje)","context_page_description":"La premonstrata preĝejo de Anunciacio kune kun monaĥejo estas religiaj konstruaĵoj, gravaj Monumento historiaj en Hungario, en vilaĝo Türje."},{"page_url":"https://it.wikipedia.org/wiki/Localit%C3%A0_italiane_Bandiera_Blu_(2014)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Torre-Mozza_Toscana.jpg","page_title":"Località italiane Bandiera Blu (2014)","context_page_description":"Elenco delle 140 località italiane insignite della Bandiera Blu dalla FEE per l'anno 2014."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_matchs_de_l%27%C3%A9quipe_du_Venezuela_de_football_par_adversaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Uruguay_1_-_Venezuela_1_-_120602-1751.jpg","page_title":"Liste des matchs de l'équipe du Venezuela de football par adversaire","context_page_description":"Cette liste présente les matchs de l'équipe du Venezuela de football par adversaire rencontré. Lorsqu'une rivalité footballistique particulière existe entre le Venezuela et un autre pays, une page spécifique est parfois proposée."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%8B%B1%E6%A0%BC%E8%98%AD%E9%81%BA%E7%94%A2%E5%A7%94%E5%93%A1%E6%9C%83%E7%AE%A1%E7%90%86%E7%94%A2%E6%A5%AD%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/The_Wall_at_Heddon-on-the-Wall_-_geograph.org.uk_-_1038492.jpg","page_title":"英格蘭遺產委員會管理產業列表","context_page_description":"英格兰遗产委员会是一个英国慈善组织，负责管理英格兰的历史名胜，当中包括超过400处英格的的历史建筑、古迹、地点等。委员会亦直接拥有其中一部分古迹的业权，亦会与其他业主商议如何管理该古迹。\\n下表为英格兰遗产委员会管理产业列表，当中包括英格兰乡村别墅、古屋、城堡、修道院、博物馆等。此表仅表示英格兰遗产委员会负责管理，部分建筑之业权可属政府、或属私人拥有。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%97%85%E6%B8%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Leicester_Rail_Station_-_geograph.org.uk_-_1266728.jpg","page_title":"旅游","context_page_description":"旅遊就是旅行遊覽活動。泛指為旅客提供休閒設施與服務的產業。是一種複雜的社會現象，涉及政治、經濟、文化、歷史、地理、法律等各個社會領域。旅遊也是一種休閒娛樂活動，具有異地性和暫時性等特徵。一般而言，旅遊具有觀光和遊歷兩個不同的層次，前者歷時短，體驗較淺；後者反之。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Chemnitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Stolperstein_Karla_J%C3%A4cker.JPG","page_title":"Liste der Stolpersteine in Chemnitz","context_page_description":"Die Liste der Stolpersteine in Chemnitz enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunstprojekts von Gunter Demnig in Chemnitz verlegt wurden. Mit ihnen soll den Opfern des Nationalsozialismus gedacht werden, die in Chemnitz lebten und wirkten."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%88%88%E7%A6%85%E5%AF%BA_(%E6%A8%AA%E6%B5%9C%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/%E6%9C%AC%E5%A0%82%E9%9A%8E%E6%AE%B5.jpg","page_title":"興禅寺 (横浜市)","context_page_description":"海門山興禅寺は、1935年に、開創された神奈川県横浜市南区清水ヶ丘225にある曹洞宗の寺院。横浜市道を挟み、当寺の北側に市営の久保山火葬場と久保山墓地がある。"},{"page_url":"https://ro.wikipedia.org/wiki/Kubla_Khan","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Kubla_Khan_titlepage.jpg","page_title":"Kubla Khan","context_page_description":"„Kubla Khan; sau, O Viziune într-un Vis: Un Fragment“ /ˌkʊblə ˈkɑːn/ e o poezie scrisă de Samuel Taylor Coleridge, scrisă în 1797 și publicată în 1816. Poezia a fost compusă într-o noapte după ce autorul a consumat opiu și a citit o lucrare care descria Xanadu, palatul de vară al domnitorului mongol și a împăratului chinez Kublai."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9E%E1%83%90%E1%83%99%E1%83%98%E1%83%A1%E1%83%A2%E1%83%90%E1%83%9C%E1%83%98%E1%83%A1_%E1%83%A5%E1%83%90%E1%83%9A%E1%83%90%E1%83%A5%E1%83%94%E1%83%91%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Jinnah_Road%2C_Quetta.JPG","page_title":"პაკისტანის ქალაქების სია","context_page_description":"სტატიაში მოცემულია პაკისტანის ქალაქების სია:"},{"page_url":"https://en.wikipedia.org/wiki/James_Prendergast_Library","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/James_Prendergast_Library_Exterior.JPG","page_title":"James Prendergast Library","context_page_description":"The James Prendergast Library is an association library located in Jamestown, New York. On the day it opened its doors to the public, December 1, 1891, The Evening Journal noted, \\"The opening of the Prendergast Library marks an important epoch in our local history. Few communities can boast so magnificent a public gift.\\"\\nThe mission of the James Prendergast Library is to provide access to information resources, staff, facilities and services that respond to the pursuit of knowledge, education, lifelong learning opportunities and cultural enrichment by the people of the City of Jamestown and Chautauqua and Cattaraugus counties.\\nIn 2014, the library contained 179,746 individual works and received 208,080 visitors.\\nThe current Executive Director is Anne Greene, who was appointed by the Board of Trustees in February 2020."},{"page_url":"https://en.wikipedia.org/wiki/Roman_Catholic_Diocese_of_Hiroshima","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/Giappone_-_Diocesi_di_Hiroshima.png","page_title":"Roman Catholic Diocese of Hiroshima","context_page_description":"The Roman Catholic Diocese of Hiroshima is a diocese located in the city of Hiroshima in the Ecclesiastical province of Osaka 大阪 in Japan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B8%D1%81%D1%8C%D0%BC%D0%BE_%D0%AF%D0%BD%D1%83%D0%BA%D0%BE%D0%B2%D0%B8%D1%87%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/%D0%9B%D0%B8%D1%81%D1%82_%D0%B0%D0%B4%D0%BC%D1%96%D0%BD%D1%96%D1%81%D1%82%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%BE%D1%97_%D0%BA%D0%B0%D0%BD%D1%86%D0%B5%D0%BB%D1%8F%D1%80%D1%96%D1%97_%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D1%81%D0%B5%D0%BA%D1%80%D0%B5%D1%82%D0%B0%D1%80%D1%8F.jpg","page_title":"Письмо Януковича","context_page_description":"«Письмо Януковича» — обращение фактически отстранённого от власти президента Украины Виктора Януковича к президенту России Владимиру Путину с предложением «провести двусторонние консультации согласно статье 7 Договора о дружбе, сотрудничестве и партнёрстве», обсудить ситуацию на Украине и возможность «использования отдельных подразделений Вооружённых Сил Российской Федерации дислоцированных в Украине» с целью «восстановления законности, мира, правопорядка, стабильности и защиты населения Украины», в частности возможность и состоянии готовности к исполнению заданий касательно «временного исполнения отдельных миротворческий функций, в том числе полицейской» и ряда других задач, датированное 1 марта 2014 года.\\nК документу прилагалось «заявление президента Украины», в котором Янукович просил главу российского государства об использовании Вооружённых сил Российской Федерации «для восстановления законности, мира, правопорядка, стабильности и защиты населения Украины»."},{"page_url":"https://en.wikipedia.org/wiki/Clavering,_Essex","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Clavering_Essex_%27Fox_%26_Hounds%27_pub.JPG","page_title":"Clavering, Essex","context_page_description":"Clavering is a village and also a parish in north-west Essex in England. The name 'Clavering' means 'place where clover grows'."},{"page_url":"https://en.wikipedia.org/wiki/Itelmens","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Itelmen_winter_dwelling.jpg","page_title":"Itelmens","context_page_description":"The Itelmens are an ethnic group native to the Kamchatka Peninsula in Russia. The Itelmen language is distantly related to Chukchi and Koryak, forming the Chukotko-Kamchatkan language family, but it is now virtually extinct, the vast majority of ethnic Itelmens being native speakers of Russian. A. P. Volodin has published a grammar of the Itelmen language.\\nNative peoples of Kamchatka, collectively referred to as Kamchadals, had a substantial hunter-gatherer and fishing society with up to fifty thousand natives inhabiting the peninsula before they were decimated by the Cossack conquest in the 18th century. So much intermarriage took place between the natives and the Cossacks that Kamchadal now refers to the majority mixed population, while the term Itelmens became reserved for persistent speakers of the Itelmen language. By 1993, there were less than 100 elderly speakers of the language left, but some 2,400 people considered themselves ethnic Itelmen in the 1989 census. By 2002, this number had risen to 3,180, and there are attempts at reviving the language. According to the 2010 census, there were 3,193 Itelmen in Russia."},{"page_url":"https://hu.wikipedia.org/wiki/Erzen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/River_Erzen_close_to_Iba.jpg","page_title":"Erzen","context_page_description":"Az Erzen Albánia nyolcadik leghosszabb folyója az ország középső részén. Hossza 109 kilométer, vízgyűjtő területe 760 négyzetkilométer, vízhozama 18 m³/s. Tiranától keletre 25 kilométerre, a Gropa-hegység nyugati oldalán, 1300 méteres tengerszint feletti magasságban ered. A Skoranai-szoroson átvágva az albán fővárost délről, a Krraba-hegység északi lábainál folyva kerüli meg, innen medre egy darabig nyugati irányban, párhuzamosan fut az északabbra folyó Ishëmmel. Shijakunál folyása megtörik és északnyugati irányúra vált, végül Durrëstől északra ömlik az Adriai-tengerbe. A római korban Ardaxanus, a bizánci időkben Harzanisz néven ismerték a folyót."},{"page_url":"https://it.wikipedia.org/wiki/Santiago_Ixcuintla","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Santiago_Ixcuintla_c%C3%ADmere.png","page_title":"Santiago Ixcuintla","context_page_description":"Santiago Ixcuintla è un comune del Messico, situato nello stato di Nayarit, il cui capoluogo è la località omonima."},{"page_url":"https://en.wikipedia.org/wiki/Santa_Elisabetta","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Santa_Elisabetta.jpg","page_title":"Santa Elisabetta","context_page_description":"Santa Elisabetta is a small town in the Province of Agrigento in the Italian region Sicily, located about 80 kilometres south of Palermo and about 13 kilometres north of Agrigento.\\nSanta Elisabetta borders the following municipalities: Aragona, Joppolo Giancaxio, Raffadali, Sant'Angelo Muxaro."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Kaiserslautern","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Glockenstra%C3%9Fe_65_Elfriede_Sommerfeld.jpg","page_title":"Liste der Stolpersteine in Kaiserslautern","context_page_description":"Die Liste der Stolpersteine in Kaiserslautern enthält alle Stolpersteine, welche von Gunter Demnig in Kaiserslautern verlegt wurden. Sie sollen an die Opfer des Nationalsozialismus erinnern, die in Kaiserslautern ihren letzten bekannten Wohnsitz hatten, bevor sie deportiert, ermordet, vertrieben oder in den Suizid getrieben wurden."},{"page_url":"https://ast.wikipedia.org/wiki/Urbino","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Urbino-palazzo_e_borgo.jpg","page_title":"Urbino","context_page_description":"Urbino ye un municipiu italianu y capital de la provincia de Pesaro ya Urbino n' Italia, llocalizada en 35 ha sobre un cuetu na rexón de Marcas. Tá allugada aproximao 110 km a l'este de Florencia.\\nLes sos cais estreches, los sos edificios costruidos un al llau d'otru y la falta de desendolcu modernu faen que Urbino paezca una cápsula de tiempu de la Edá Media. Rafael, un de los más grandes pintores del Renacimientu y un de los arquiteutos de la Basílica de San Pedro en Roma, ñació equí en 1483.\\nL'arguyu d'Urbino ye'l so gran Palaciu Ducal del sieglu XV; nel que s'atopa actualmente la Galería Nacional de les Marques, que caltién la más guapa coleición de pintures de la rexón, provenientes de munches escueles italianes de pintura.\\nL'universidá de la ciudá data de 1506.\\nLa población d'Urbino ye de 15.900 habitantes.\\nDatos: Q2759\\nMultimedia: Urbino\\nViaxes: Urbino"},{"page_url":"https://cy.wikipedia.org/wiki/Yelm,_Washington","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Community_Center_in_Yelm%2C_Washington.jpg","page_title":"Yelm, Washington","context_page_description":"Dinas yn Thurston County, yn nhalaith Washington, Unol Daleithiau America yw Yelm, Washington.\\nCeir 9 cylchfa amser yn UDA, ac mae hon yn perthyn i'r cylchfa amser a elwir yn: Cylchfa Amser y Cefnfor Tawel, UTC−08:00, UTC−07:00."},{"page_url":"https://gl.wikipedia.org/wiki/Econom%C3%ADa_de_Francia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Eiffel_trocadero_i.jpg","page_title":"Economía de Francia","context_page_description":"Francia está nunha transición entre unha economía cunha intervención estatal substancial, e unha economía de mercado moderna. Grandes áreas de terreos fértiles, a aplicación de tecnoloxía moderna e subsidios fixeron de Francia o principal produtor agrícola da Europa Occidental.\\nO país destaca na industria automobilística, aeronáutica, e con gran recoñecimento na súa industria alimenticia, ademais de sectores de tecnoloxía punta, especialmente informática.\\nÉ case autosuficiente en minería, con alta produción de petróleo e carbón mineral.\\nO Estado mantén unha considerábel influencia sobre segmentos chave do sector de infraestruturas, con cotas maioritarias en firmas ferroviarias, de electricidade, de aviación e de telecomunicacións, diminuíndo gradualmente o control sobre estes sectores dende o inicio da década de 90. O Estado continúa a vender participacións en France Télécom, en Air France, e nas industrias de seguros, bancaria e de defensa.\\nFrancia xuntouse a outros 10 países membros da UE para lanzar o euro o 1 de xaneiro de 1999, cuxas moedas e billetes substituíron por completo o franco francés no inicio de 2002."},{"page_url":"https://fr.wikipedia.org/wiki/Castle_(s%C3%A9rie_t%C3%A9l%C3%A9vis%C3%A9e)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Molly_Quinn_2012.jpg","page_title":"Castle (série télévisée)","context_page_description":"Castle est une série télévisée américaine en 173 épisodes de 42 minutes sur 8 saisons, créée par Andrew W. Marlowe, qui relate les aventures tant professionnelles que sentimentales du duo formé par l'écrivain Richard Castle et la policière Kate Beckett.\\nElle est initialement diffusée en simultané du 9 mars 2009 au 16 mai 2016 sur le réseau ABC aux États-Unis et sur le réseau CTV / CTV Two au Canada.\\nEn Belgique, la série est diffusée à partir du 26 mars 2010 sur RTL-TVI. En Suisse, à partir du 30 juin 2010 sur RTS Un. En France, entre le 5 juillet 2010 et le 6 mars 2017 sur France 2, puis rediffusée à plusieurs reprises. Au Québec, à partir du 7 janvier 2011 sur Séries+, puis rediffusée sur ICI Radio-Canada Télé."},{"page_url":"https://la.wikipedia.org/wiki/K%C3%B6ln-Lindenthal","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Lindenthal_Stadtteil_Lindenthal.PNG","page_title":"Köln-Lindenthal","context_page_description":"Köln-Lindenthal est Coloniae Agrippinae praesens regio urbana in circulo eiusdem nominis et una octaginta sex urbis regionum. Huic regioni, quae anno 1888 con Colonia Agrippina contributa est, circiter 29150 incolarum sunt."},{"page_url":"https://ca.wikipedia.org/wiki/Surin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Prasat_Sikhoraphum_-_Sikhoraphum.jpg","page_title":"Surin","context_page_description":"Surin, també coneguda com a \\"Ban Kho Prathai\\", és una ciutat de Tailàndia. Es troba al territori de l'Isaan, al marge sud de l'altiplà de Khorat, a la província de Surin i és la capital d'aquesta i del districte del mateix nom.\\nL'àrea municipal de Surin té una superfície de 915,1 km² i una població de 257.192 habitants, segons el cens del 2005. Una gran part dels habitants pertanyen a l'ètnia khmer o en tenen molta influència."},{"page_url":"https://sco.wikipedia.org/wiki/Cappielow","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Cappielow.JPG","page_title":"Cappielow","context_page_description":"Cappielow Park, commonly kent as Cappielow, is a fitbaw stadium in Greenock, Inverclyde, Scotland."},{"page_url":"https://nl.wikipedia.org/wiki/Oost-Germaanse_volkeren","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Germanic_tribes_%28750BC-1AD%29.png","page_title":"Oost-Germaanse volkeren","context_page_description":"De Germaanse volkeren waarnaar wordt verwezen als Oost-Germaans bestaan uit een golf van migranten die mogelijk tijdens de Pre-Romeinse IJzertijd zijn verhuisd van Scandinavië naar het gebied tussen de Oder en de Wisła tussen de jaren 600 v.Chr. en 300 v.Chr.. In tegenstelling tot de noordelijke en westelijke volkeren, hebben ze niet met succes hun etniciteit behouden en werden ze voornamelijk geassimileerd in de West-Germaanse stammen en de Romeinen.\\nVolgens sommige theorieën waren de Oost-Germaanse volkeren verwant aan de Noord-Germaanse volkeren, die migreerden vanuit Scandinavië naar het gebied ten oosten van de Elbe."},{"page_url":"https://vi.wikipedia.org/wiki/Ch%E1%BA%B9o_%C4%91%E1%BA%A5t_l%E1%BB%9Bn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Sistrurus_catetanus_tergeminus_by_LA_Dawson.jpg","page_title":"Chẹo đất lớn","context_page_description":"Chẹo đất lớn là một loài chim thuộc họ Cu cu. Cùng với chẹo đất nhỏ, chúng tạo thành chi chẹo đất."},{"page_url":"https://it.wikipedia.org/wiki/Roccia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Rocas-rafax.JPG","page_title":"Roccia","context_page_description":"Con il termine rocce si intendono gli aggregati naturali di minerali. Tuttavia, al contrario di quest'ultimi, le rocce non possono essere espresse o definite mediante formule in quanto non presentano una composizione chimica definita. Le rocce sono fondamentalmente eterogenee, quindi costituite da più minerali. Le rocce omogenee, invece, contengono un unico tipo di minerale. In questo particolare caso la distinzione tra roccia e minerale diventa molto sottile: in genere alla roccia manca una vera continuità.\\nLe rocce ignee si formano quando il magma si raffredda nella crosta terrestre o la lava si raffredda sulla superficie del suolo o sul fondo del mare. Le rocce metamorfiche si formano quando le rocce esistenti sono soggette a pressioni e temperature così grandi da trasformarsi, cosa che si verifica, ad esempio, quando le piastre continentali si scontrano. Le rocce sedimentarie sono formate dalla diagenesi o dalla litificazione dei sedimenti, che a loro volta sono formati dall'erosione, dal trasporto e dalla deposizione delle rocce esistenti."},{"page_url":"https://cs.wikipedia.org/wiki/Arm%C3%A9nsk%C3%BD_dram","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/20_Dram_ARM_2003.png","page_title":"Arménský dram","context_page_description":"Arménský dram je zákonné platidlo zakavkazského státu Arménie. Kromě Arménie používá tuto měnu i Náhorní Karabach, což je celosvětově nikým neuznaný de facto nezávislý stát na území sousedního Ázerbájdžánu, který odmítá používat ázerbájdžánský manat. Náhorní Karabach má silně provázané a přátelské vztahy s Arménií.\\nISO 4217 kód dramu je AMD. Jedna setina dramu se nazývá luma. Pro svoji nízkou kupní hodnotu se však v oběhu žádné lumové mince nevyskytují. Do roku 1991 byla Arménie svazovou republikou SSSR a používala měnu Sovětského svazu- rubl. Sovětský rubl byl zákonným platidlem nezávislé Arménie až do 12. listopadu 1993, kdy byl dram zaveden.\\nKurz k 10.4.2017: 1 EUR = 514,09 AMD"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%B3%A5%E8%88%87%E8%9C%9C%E8%9C%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/The_Bird_and_The_Bee_at_The_Bell_House_in_Brooklyn_20090306-6.jpg","page_title":"鳥與蜜蜂","context_page_description":"“鸟与蜜蜂”是来自美国加州洛杉矶的一个独立制作的双人音乐组合。由“鸟”－Inara George与“蜜蜂”－Greg Kurstin所组成。Kurstin是个音乐制作人，键盘手并曾经跟许多知名的歌手合作过，如：Lily Allen、Kylie Minogue，Sophie Ellis-Bextor，Beck，The Flaming Lips，Red Hot Chili Peppers等等，而他本身也是另一个乐团Geggy Tah的成员之一。Inara George和Greg Kurstin第一次见面是在Inara的首张个人专辑的制作中。他们随后决定一起合作一个融合爵士和电子乐的音乐计划。他们的首张单曲《Again and Again and Again and Again》在2006年的10月31日发行，而首张同名正式专辑也紧接着在2007年的1月23日发行。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%AA%D8%B4%E2%80%8C%D8%A8%D8%B3_%DB%B1%DB%B2_%D8%B3%D8%A7%D9%84%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Abraham_janssens_peace_and_plenty.jpg","page_title":"آتش‌بس ۱۲ ساله","context_page_description":"آتش‌بس ۱۲ ساله، نامیست که به ترک مخاصمه میان فرمانروایان هابسبورگ اسپانیا و جنوب هلند و جمهوری هلند که در تاریخ ۹ آوریل سال ۱۶۰۹ میلادی در آنتورپ به امضا رسید داده شده است."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_beschermd_erfgoed_in_de_gemeente_Differdange","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Lasauvage_88-88a_rue_Principale.jpg","page_title":"Lijst van beschermd erfgoed in de gemeente Differdange","context_page_description":"In deze lijst van beschermd erfgoed in de gemeente Differdange zijn alle geclassificeerde nationale monumenten van de Luxemburgse gemeente Differdange opgenomen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Sch%C3%B6neberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Berlin%2C_Schoeneberg%2C_Winterfeldtstrasse_33%2C_Mietshaus.jpg","page_title":"Liste der Kulturdenkmale in Berlin-Schöneberg","context_page_description":"In der Liste der Kulturdenkmale von Schöneberg sind die Kulturdenkmale des Berliner Ortsteils Schöneberg im Bezirk Tempelhof-Schöneberg aufgeführt."},{"page_url":"https://es.wikipedia.org/wiki/Anarquismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/William_Godwin_by_Henry_William_Pickersgill.jpg","page_title":"Anarquismo","context_page_description":"Anarquismo es un nombre dado a cualquier filosofía política o social que llame a la oposición y la abolición del Estado entendido como monopolio de la fuerza, y por extensión también al rechazo del gobierno político o de la autoridad social impuesta por la fuerza sobre el individuo, por considerarlos innecesarios o nocivos.​​ Históricamente, por anarquismo se ha entendido tanto a un conjunto de corrientes intelectuales, pasadas y presentes, así como a uno o varios movimientos políticos, que existieron especialmente entre finales del siglo XIX e inicios del siglo XX y que fueron críticos de la relación de los individuos con la sociedad de su época con el objetivo de promover el cambio social hacia una futura sociedad, en palabras de Pierre-Joseph Proudhon, «sin amo ni soberano».​ Sébastien Faure, filósofo anarquista francés, dijo: «cualquiera que niegue la autoridad y luche contra ella es un anarquista». Bajo una formulación tan simple, pocas doctrinas o movimientos han manifestado una variedad tan grande de interpretaciones y acciones, que no siempre fueron bien entendidos por la opinión pública."},{"page_url":"https://zh.wikipedia.org/wiki/TYPO3","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/TYPO3_Backend.png","page_title":"TYPO3","context_page_description":"TYPO3是一个以PHP编写、采用GNU通用公共许可证的自由、开源的内容管理系统。它可在众多操作系统和多种网页服务器上。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27espions","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/1990_CPA_6265.jpg","page_title":"Liste d'espions","context_page_description":"Vous trouverez ci-dessous trois listes d'espions célèbres. La première contient le nom d'espions et d'espionnes ayant réellement vécu ou en vie ; la seconde des personnes accusées injustement d'espionnage et la troisième contient le nom de personnages, soit de romans, soit de films, qui ont été espions pendant leur existence imaginaire.\\nSelon la terminologie des services de renseignement, il faudra distinguer :\\nles officiers traitants, qui sont des fonctionnaires chargés de recruter et de manipuler des agents, auxquels peuvent être associés également toutes les personnes travaillant dans un service de renseignement\\nles agents, qui fournissent à proprement parler les renseignements.\\nLes officiers de renseignement qui ont trahi seront considérés comme des agents, puisque c'est à cette dernière activité qu'ils doivent en général leur célébrité."},{"page_url":"https://nl.wikipedia.org/wiki/Haddadus_binotatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Haddadus_binotatus01b.jpg","page_title":"Haddadus binotatus","context_page_description":"Haddadus binotatus is een kikker uit de familie Craugastoridae.\\nDe soort werd voor het eerst wetenschappelijk beschreven door Johann Baptist von Spix in 1824. Oorspronkelijk werd de wetenschappelijke naam Rana binotata gebruikt. De kikker behoorde lange tijd tot andere geslachten zoals Hyla, Enydrobius, Hylodes en Eleutherodactylus.\\nHaddadus binotatus leeft in Zuid-Amerika en komt endemisch voor in Brazilië."},{"page_url":"https://nl.wikipedia.org/wiki/Artefact","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Chris-chromatic-aberration.png","page_title":"Artefact","context_page_description":"Een artefact is een kunstmatig verschijnsel. Oorspronkelijk had dit woord de betekenis van iets dat ongewenst is, en optreedt in een experimentele situatie. Tegenwoordig wordt het woord ook wel gebruikt om een willekeurige, soms slechts minimale verandering door toedoen van menselijk handelen aan te duiden, in tegenstelling tot een verschijnsel dat geheel natuurlijk tot stand is gekomen."},{"page_url":"https://es.wikipedia.org/wiki/Ejecuciones_de_Kesariani","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Alexis_Tsipras_at_the_National_Resistance_Memorial%2C_Kaisariani.jpg","page_title":"Ejecuciones de Kesariani","context_page_description":"El 1 de mayo de 1944, 200 civiles griegos, mayoritariamente militantes o simpatizantes del Partido Comunista de Grecia, fueron ejecutados por las autoridades de ocupación alemanas, como represalia por la muerte de un general alemán en una acción de la resistencia griega. El lugar de ejecución fue un campo de tiro situado en Kesariani, municipio del área metropolitana de Atenas."},{"page_url":"https://es.wikipedia.org/wiki/Templo_Expiatorio_de_la_Sagrada_Familia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/SF_-_Joan.jpg","page_title":"Templo Expiatorio de la Sagrada Familia","context_page_description":"El Templo Expiatorio de la Sagrada Familia, conocido simplemente como la Sagrada Familia, es una basílica católica de Barcelona, diseñada por el arquitecto Antoni Gaudí. Iniciada en 1882, todavía está en construcción. Es la obra maestra de Gaudí, y el máximo exponente de la arquitectura modernista catalana. Es uno de los monumentos más visitados de España, junto al Museo del Prado y la Alhambra de Granada, ​ y es la iglesia más visitada de Europa tras la basílica de San Pedro del Vaticano.​ Cuando esté finalizada será la iglesia cristiana más alta del mundo.\\nLa Sagrada Familia es un reflejo de la plenitud artística de Gaudí: trabajó en ella durante la mayor parte de su carrera profesional, pero especialmente en los últimos años de su carrera, donde llegó a la culminación de su estilo naturalista, haciendo una síntesis de todas las soluciones y estilos probados hasta aquel entonces. Gaudí logró una perfecta armonía en la interrelación entre los elementos estructurales y los ornamentales, entre plástica y estética, entre función y forma, entre contenido y continente, logrando la integración de todas las artes en un todo estructurado y lógico.​"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CE%AD%CF%81%CE%B3%CF%89%CE%BD_%CF%84%CE%BF%CF%85_%CE%A4%CE%B6%CE%B1%CE%BD%CE%BC%CF%80%CE%B1%CF%84%CF%84%CE%AF%CF%83%CF%84%CE%B1_%CE%A4%CE%B9%CE%AD%CF%80%CE%BF%CE%BB%CE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Giovanni_Battista_Tiepolo_-_Apollo_and_the_Continents_%28America%2C_left-hand_side%29_-_WGA22325.jpg","page_title":"Κατάλογος έργων του Τζανμπαττίστα Τιέπολο","context_page_description":"Το λήμμα αυτό είναι κατάλογος των έργων του ζωγράφου Τζανμπαττίστα Τιέπολο, σε χρονολογική σειρά."},{"page_url":"https://de.wikipedia.org/wiki/Hochschule_f%C3%BCr_Finanzen_Nordrhein-Westfalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Schloss_Nordkirchen_KdM02.JPG","page_title":"Hochschule für Finanzen Nordrhein-Westfalen","context_page_description":"Die Hochschule für Finanzen ist eine Fachhochschule für öffentliche Verwaltung in Nordkirchen. Das Land Nordrhein-Westfalen bildet an der Fachhochschule den Nachwuchs für den gehobenen Dienst innerhalb der Finanzverwaltung des Landes aus. Die Finanzanwärter sind während des Studiums im Schloss Nordkirchen und in benachbarten, zusätzlich errichteten Neubauten untergebracht. Das erfolgreich abgeschlossene Studium berechtigt zum Führen des akademischen Grades Diplom-Finanzwirt."},{"page_url":"https://es.wikipedia.org/wiki/Pros%C3%AD%C4%8Dka","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Pros%C3%AD%C4%8Dka_HB_vlajka.jpg","page_title":"Prosíčka","context_page_description":"Prosíčka es una localidad del distrito de Havlíčkův Brod en la región de Vysočina, República Checa, con una población estimada a principio del año 2018 de 135 habitantes.\\nSe encuentra ubicada al norte de la región, cerca de la orilla del río Sázava —un afluente derecho del río Moldava— y de las regiones de Bohemia Central y Pardubice.​"},{"page_url":"https://it.wikipedia.org/wiki/Duomo_di_Bomarzo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Bomarzo-Il_Campanile.JPG","page_title":"Duomo di Bomarzo","context_page_description":"Il duomo di Bomarzo, dedicato a Santa Maria Assunta in Cielo, è un edificio religioso sede dell'omonima parrocchia."},{"page_url":"https://en.wikipedia.org/wiki/Saint_Gayane_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Saint_Gayane_Church-roof.JPG","page_title":"Saint Gayane Church","context_page_description":"The Church of Saint Gayane is a 7th-century Armenian church in Vagharshapat, the religious center of Armenia. It is located within walking distance from the Etchmiadzin Cathedral of 301. St. Gayane was built by Catholicos Ezra I in the year 630. Its design has remained unchanged despite partial renovations of the dome and some ceilings in 1652.\\nGayane was the name of an abbess who was martyred with other nuns by Tiridates III of Armenia in the year 301, and subsequently made a saint of the Armenian Apostolic Church.\\nIn 2000, Saint Gayane Church was listed in the UNESCO World Heritage Sites along with historical churches of Vagharshapat."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%88%D9%8A%D8%AA%D8%B4%D8%AE_%D8%A8%D9%88%D9%84%D8%A7%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Prymaspolski1.jpg","page_title":"فويتشخ بولاك","context_page_description":"فويتشخ بولاك ‏ هو كاهن كاثوليكي بولندي، ولد في 19 ديسمبر 1964 في Inowrocław في بولندا."},{"page_url":"https://en.wikipedia.org/wiki/Chris_Dodd_2008_presidential_campaign","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Chris_Dodd_Labor_Day.jpg","page_title":"Chris Dodd 2008 presidential campaign","context_page_description":"The 2008 presidential campaign of Chris Dodd was launched on January 11, 2007 and ended on January 3, 2008 after a sixth-place finish in the Iowa caucuses. Dodd, the Senior Senator from Connecticut, sought the nomination of the Democratic Party for President of the United States. Centering his campaign in the states of Iowa and New Hampshire, he centred his campaign on the theme of change. Dodd's performance in the opinion polls varied, but in the financial sphere, he had secured some notable and influential endorsements who were the ones largely funding his campaign.\\nDodd tried to follow in the pattern of New Englanders who entered the race for the Democratic nomination and won, including John Kerry, Michael Dukakis, and John F. Kennedy. If elected, Dodd would have become the second Roman Catholic president and the second Connecticut-born president. He would have been the first Senator to win the presidency while in office since Kennedy was elected in 1960. After his withdrawal from the race, Dodd went on to endorse the eventual winner Barack Obama, and retired from the Senate in 2011."},{"page_url":"https://en.wikipedia.org/wiki/Protected_areas_of_the_Azores","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Reserva_Florestal_de_Recreio_do_Capelo%2C_2_concelho_da_Horta%2C_ilha_do_Faial%2C_A%C3%A7ores%2C_Portugal.JPG","page_title":"Protected areas of the Azores","context_page_description":"The Protected Areas of the Azores are the basic administrative-territorial and conservation structures in the archipelago of the Azores and the surrounding oceans. The areas integrate the entirety of the Azores within its Exclusive Economic Zone, as well as the surrounding waters, under the international agreements and conventions. The network realizes the categorization of management for protected areas adopted by the International Union for Conservation of Nature, adapting it to the specific geographical, environmental, cultural and political-administrative territory of the archipelago."},{"page_url":"https://fr.wikipedia.org/wiki/Fosse_Sainte-Marie_des_mines_d%27Aniche","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Auberchicourt_-_Cit%C3%A9s_de_la_fosse_Sainte_Marie_des_mines_d%27Aniche_%28I%29.JPG","page_title":"Fosse Sainte-Marie des mines d'Aniche","context_page_description":"La fosse Sainte-Marie de la Compagnie des mines d'Aniche est un ancien charbonnage du Bassin minier du Nord-Pas-de-Calais, situé à Auberchicourt. Son fonçage commence en 1856 ou 1857 à la suite de l'ouverture de la fosse Traisnel, alors que la fosse Archevêque est encore en cours de fonçage. Dans la partie occidentale de sa concession, la Compagnie d'Aniche entreprend également la fosse Notre-Dame. La fosse Sainte Marie commence à extraire en 1861 ou 1863. Le chevalement en bois est remplacé par un chevalement métallique en 1888.\\nUn second puits est ajouté en 1907. Il est destiné à l'aérage et à l'extraction. La fosse est détruite pendant la Première Guerre mondiale. Elle est reconstruite au début des années 1920, le puits Sainte-Marie nᵒ 1 est doté d'un chevalement en béton armé. Des cités sont bâties.\\nLa Compagnie des mines d'Aniche est nationalisée en 1946, et intègre le Groupe de Douai. Les puits sont approfondis à 508 mètres en 1951. Des habitations supplémentaires sont également construites. La fosse cesse d'extraire en 1960 après avoir produit 8 166 000 tonnes de houille, elle assure alors l'aérage pour la fosse Delloye jusqu'en 1968. Les puits sont remblayés en 1969."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%80%D1%8F%D0%BC%D0%BE%D0%BA%D1%80%D1%8B%D0%BB%D1%8B%D1%85_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Stauroderus_scalaris_male_%283787846617%29.jpg","page_title":"Список прямокрылых Украины","context_page_description":"Список прямокрылых Украины содержит перечень видов насекомых из отряда Orthoptera, зарегистрированных на территории Украины.\\nУкраина находится в географическом центре Европы, в зоне умеренно континентального климата, на её территории чётко выделяются четыре природные зоны:\\nзона широколиственных и смешанных лесов, наиболее бедная представителями отряда прямокрылых;\\nлесостепная зона, занимающая среднюю полосу страны и являющаяся переходной между лесами и степью;\\nзона степи, наиболее богатая разнообразием и количеством прямокрылых насекомых;\\nсубтропический Южный берег Крыма со средиземноморским климатом, занимающий южную часть Крымского полуострова от гор до морского побережья. Разнообразие прямокрылых здесь не так велико, как в степи, однако встречается немало средиземноморско-кавказских реликтов, среди которых есть и эндемичные виды, не встречающиеся больше нигде."},{"page_url":"https://id.wikipedia.org/wiki/Rooftop_Moonlight","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/170708_Rooftop_Moonlight.png","page_title":"Rooftop Moonlight","context_page_description":"Rooftop Moonlight adalah grup musik duo Korea Selatan yang dibentuk oleh Magic Strawberry Sound di Seoul, Korea Selatan. Mereka debut pada 22 Januari 2010 dengan album mini Okdal Radio."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D0%B1%D0%B0%D1%80%D0%B0_%D0%9C%D0%BD%D1%96%D1%88%D0%B5%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Zamekodrzykon.jpg","page_title":"Барбара Мнішек","context_page_description":"Барбара Мнішек з Каменецьких — польська шляхтичка, старостина сокальська і луківська."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%A3%E5%86%88%E4%BD%93%E8%AF%BA%E5%A0%82_(%E5%A8%81%E5%B0%BC%E6%96%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Chiesa_di_San_Canciano_organo_Venezia.jpg","page_title":"圣冈体诺堂 (威尼斯)","context_page_description":"聖岡體諾堂是義大利威尼斯 卡納雷吉歐區的一座小教堂。\\n該堂據說創建於864年，當時阿奎萊亞的市民為逃避野蠻人，逃往威尼斯潟湖。該堂屬於居住在威尼斯的格拉多宗主教管轄。該堂供奉在阿奎萊亞殉道的聖岡喜、聖岡體諾、聖岡喜納拉三兄妹。該堂在1330年重建，1351年祝聖，1550年修復，18世紀初最後由安東尼·加斯帕里改建。立面在1706年重建。鐘樓可追溯到1532年。中殿天花板在18世紀中期的重建過程中使用了喬治馬薩里的設計。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B7%D0%B0%D0%BA%D0%BE%D0%B2%D0%BE_(%D0%9A%D0%B0%D1%80%D0%B3%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B0%D1%8F_%D0%A8%D0%B0%D0%BB%D0%B3%D0%B0_-_%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%A0%D0%BE%D0%B6%D0%B4%D0%B5%D1%81%D1%82%D0%B2%D0%B0_%D0%A5%D1%80%D0%B8%D1%81%D1%82%D0%BE%D0%B2%D0%B0_1745.jpg","page_title":"Казаково (Каргопольский район)","context_page_description":"Казаково — деревня в Каргопольском районе Архангельской области. Входит в состав Павловского сельского поселения."},{"page_url":"https://en.wikipedia.org/wiki/Robert_H._McCard","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/McCard_RH_USMC.jpg","page_title":"Robert H. McCard","context_page_description":"Gunnery Sergeant Robert Howard McCard, a United States Marine, received the Medal of Honor for his actions during the Battle of Saipan in World War II."},{"page_url":"https://ce.wikipedia.org/wiki/NGC_5403","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/NGC5403_-_SDSS_DR14.jpg","page_title":"NGC 5403","context_page_description":"NGC 5403 — Дохкаллин а, седарчийн гуламийн а керла юкъара каталогехь ягарйина галактикаш."},{"page_url":"https://tr.wikipedia.org/wiki/Wikimania","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/LocationAsia.png","page_title":"Wikimania","context_page_description":"Wikimania, viki projeleri kullanıcıları için Wikimedia Vakfı tarafından düzenlenen uluslararası bir konferanstır. Viki Çılgınlığı anlamına gelen Wikimania, ilk defa 5, 6, 7 Ağustos 2005 tarihlerinde Almanya'nın Frankfurt şehrinde yapıldı. Araştırmacılar ve konuşmacıların katıldığı konferansta, Vikipedi üzerine yapılan çalışmalar ve araştırmalar, Wikimedia Vakfı tarafından yürütülen diğer projelerle ilgili çalışmalar, wiki kültürü ve teknolojisi konuları işleniyor. Özgür yazılım ve özgür içerik konuları da konferansın ele aldığı başlıklar. Programda, slayt sunumları, posterler sunumları, sohbetler bulunmaktadır."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B5%D1%80%D0%BD%D1%96-%D0%A1%D0%BE%D1%80%D0%BD%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Terny-Sorny_%28Aisne%29_mairie-%C3%A9cole.JPG","page_title":"Терні-Сорні","context_page_description":"Терні́-Сорні́ — муніципалітет у Франції, у регіоні О-де-Франс, департамент Ена. Населення — 309 осіб.\\nМуніципалітет розташований на відстані близько 100 км на північний схід від Парижа, 95 км на південний схід від Ам'єна, 23 км на південний захід від Лана."},{"page_url":"https://en.wikipedia.org/wiki/MTA_Regional_Bus_Operations","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/MTA_Bway_Barclay_St_Bus_Clock_02.jpg","page_title":"MTA Regional Bus Operations","context_page_description":"MTA Regional Bus Operations is the surface transit division of the Metropolitan Transportation Authority. It was created in 2008 to consolidate all bus operations in New York City operated by the MTA. As of February 2018, MTA Regional Bus Operations runs 234 local routes, 71 express routes, and 20 Select Bus Service routes. Its fleet of 5,725 buses is the largest municipal bus fleet in the United States and operates 24/7.\\nThe division comprises two brands: MTA Bus and MTA New York City Bus. While MTA Bus is an amalgamation of former private companies' routes, MTA New York City Bus is composed of public routes that were taken over by the city before 2005. The MTA also operates paratransit services and formerly operated Long Island Bus. As of 2018, MTA Regional Bus Operations' budgetary burden for expenditures was $773 million."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BF%AA%E8%BF%AA%E5%9F%83%C2%B7%E7%B4%A2%E9%AB%98%E6%8B%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Zokora.jpg","page_title":"迪迪埃·索高拿","context_page_description":"阿倫·迪迪埃·索高拿·迪爾加，簡稱迪迪埃·佐科拉，出生在阿必尚，是一名象牙海岸職業足球員，現已退役，並曾效力英超熱刺及西甲的塞維利亞，司職後腰。佐科拉在場上主要擔當著中路防守的角色。"},{"page_url":"https://et.wikipedia.org/wiki/AH-IV","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Strv_m37.JPG","page_title":"AH-IV","context_page_description":"AH-IV oli Tšehhoslovakkias kahe maailmasõja vahel loodud tankett, mida Teise maailmasõja ajal kasutasid Rumeenia, Rootsi ja Iraan. Rumeenia tankette kasutati Idarindel alates Barbarossa plaani käivitumisest kuni Viini pealetungini. Etioopia ostis pärast sõda 28 tanketti ja kasutas neid 1980. aastateni."},{"page_url":"https://pl.wikipedia.org/wiki/Podgorica","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Podgorica%2C_cattedrale_della_resurrezione_di_cristo%2C_esterno_02.JPG","page_title":"Podgorica","context_page_description":"Podgorica – największe miasto i stolica Czarnogóry, leżąca na wysokości 44 m n.p.m. Według danych ze spisu ludności z 2011 miasto liczyło 187 085 mieszkańców, 22% ludności republiki. Dobre położenie geograficzne między rzekami Ribnicą i Moračą uczyniło miasto atrakcyjnym miejscem do zasiedlenia. Miasto znajduje się blisko ośrodków narciarskich w Górach Dynarskich oraz wybrzeża Morza Adriatyckiego.\\nW czasach rzymskich miasto funkcjonowało pod nazwą Doclea, w średniowieczu Ribnica. W czasach komunistycznych na cześć Josipa Broza Tito nosiło natomiast nazwę Titograd."},{"page_url":"https://en.wikipedia.org/wiki/Carnegie_Public_Library_(Sumter,_South_Carolina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Carnegie_Public_Library_Sumter%2C_SC.jpg","page_title":"Carnegie Public Library (Sumter, South Carolina)","context_page_description":"Carnegie Public Library is a historic Carnegie library building located at Sumter, Sumter County, South Carolina. It was built in 1916–1917, and is a two-story, brick Beaux-Arts style building. The front facade features four arched windows with limestone surrounds and the main entryway flanked by two Ionic order columns. It was one of the 1,679 public libraries built in the United States with funding from the Carnegie Corporation. The Sumter library was constructed with $10,000 provided by the Carnegie Corporation. It housed the public library until 1968, and afterwards housed a local genealogical society.\\nIt was added to the National Register of Historic Places in 1994."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D8%B1%D8%A7%D9%8A%D8%A7%D9%85_%D9%85%D9%88%D8%B1%D8%AA%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Graeme_Murty.png","page_title":"غرايام مورتي","context_page_description":"غرايام ستيوارت مورتي ‏، من مواليد 13 نوفمبر 1974 في مدلزبرة في إنجلترا، لاعب كرة قدم اسكتلندي.\\nبدأ مسيرته الكروية مع نادي يورك سيتي الإنجليزي في عام 1993، ولعب معهم حتى عام 1998، وشارك معهم في 122 مباراة وسجل 7 أهداف، ومنذ عام 1998 وهو يلعب مع نادي ريدينغ الإنجليزي.\\nو قد بدأ باللعب مع منتخب اسكتلندا لكرة القدم في عام 2004."},{"page_url":"https://en.wikipedia.org/wiki/Warao_language","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Warao_language.png","page_title":"Warao language","context_page_description":"Warao is the native language of the Warao people. A language isolate, it is spoken by about 33,000 people primarily in northern Venezuela, Guyana and Suriname. It is notable for its unusual object–subject–verb word order. The 2015 Venezuelan film Gone with the River was spoken in Warao."},{"page_url":"https://is.wikipedia.org/wiki/Torben_Grael","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Torben_Grael.jpg","page_title":"Torben Grael","context_page_description":"Torben Schmidt Grael er brasilískur siglingamaður af dönskum ættum. Hann er sá Brasilíumaður sem hlotið hefur flest verðlaun á Ólympíuleikum, alls fimm verðlaun; tvö gull, eitt silfur og tvö brons. Hann er líka sá siglingamaður sem flest verðlaun hefur hlotið á leikunum. Hann hefur auk þess tekið þátt í fjölda heimsmeistarakeppna í siglingum, og nokkrum sinnum í Ameríkubikarnum, síðast sem leikstjórnandi Luna Rossa Challenge árið 2007. Hann var skipstjóri á Brasil1 sem lenti í 3. sæti í Volvo Ocean Race 2005-2006 og var skipstjóri á Ericsson 4 sem sigraði keppnina 2008/09."},{"page_url":"https://ru.wikipedia.org/wiki/Live_Earth","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Cities_participating_in_Live_Earth.svg","page_title":"Live Earth","context_page_description":"Live Earth — международный фестиваль поп- и рок-музыки с целью привлечь внимание к проблеме глобального потепления и роли человечества в этом явлении. Концерты фестиваля прошли 7 июля 2007 на всех шести континентах Земли:\\nАвстралия — в Сиднее\\nАзия — в Шанхае, в Токио и Киото\\nСеверная Америка — в Нью-Йорке и Вашингтоне\\nЮжная Америка — в Рио-де-Жанейро\\nАнтарктида — на исследовательской станции «Ротера»\\nАфрика — в Йоханнесбурге\\nЕвропа — в Лондоне и Гамбурге\\nОдним из основных организаторов фестиваля является бывший вице-президент США Альберт Гор. В концертах приняли участие более 150 музыкантов, а общая аудитория фестиваля составила более 2 миллиардов человек.\\nНазвание фестиваля выбрано по аналогии с проводившимися ранее фестивалями Live Aid и Live 8, хотя организатор этих фестивалей Боб Гелдоф не имеет отношения к Live Earth."},{"page_url":"https://it.wikipedia.org/wiki/Opere_tratte_dal_Cenacolo_di_Leonardo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Leonardo_da_vinci%2C_Heads_of_Judas_and_Peter.jpg","page_title":"Opere tratte dal Cenacolo di Leonardo","context_page_description":"Nell'immaginario collettivo l'Ultima Cena di Leonardo da Vinci è la rappresentazione più vicina all'episodio raccontato dai Vangeli. Opere tratte dal Cenacolo di Leonardo sono state realizzate in gran numero e abbracciano le più diverse espressioni d'arteː dalla pittura, alla scultura, al disegno, alla caricatura, all'incisione, alla performance, alla pop art, alla letteratura e datano dagli anni immediatamente successivi alla realizzazione dell'opera leonardesca, fino ai giorni nostri. Un catalogo esauriente di queste manifestazioni estetico-culturali, la cui validità artistica varia a seconda dei casi, è praticamente impossibile. Differenti sono le forme espressive - la maggior parte rispettose, alcune irrispettose - ma persiste questo tema, attraverso i secoli, e il riferimento al capolavoro di Leonardo resta sempre riconoscibile."},{"page_url":"https://en.wikipedia.org/wiki/Helijet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/C-GCHJ_%2821145858723%29.jpg","page_title":"Helijet","context_page_description":"Helijet International is a helicopter airline and charter service based in Vancouver, British Columbia, Canada. Well known for its scheduled passenger helicopter airline services, it also operates a charter division serving the film, television, aerial tour, industrial and general charter markets, as well as helicopter and jet air ambulance services. Its main base is Vancouver International Airport.\\nSightseeing harbour and city tours and scheduled services to Victoria and Nanaimo operate from the Vancouver Harbour Heliport located on the shores of Burrard Inlet, adjacent to Waterfront Station. The actual heliport is a floating structure located in the harbour waters. Helijet is also British Columbia's largest air medical service provider, operating rotary wing, fixed wing medevac aircraft including Learjet and Hawker."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D0%BE%D1%81%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Eglise_de_Crocy.JPG","page_title":"Кросі","context_page_description":"Кросі́ — муніципалітет у Франції, у регіоні Нижня Нормандія, департамент Кальвадос. Населення — 301 осіб.\\nМуніципалітет розташований на відстані близько 180 км на захід від Парижа, 45 км на південний схід від Кана."},{"page_url":"https://fr.wikipedia.org/wiki/Mod%C3%A8ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Duomo_modena.JPG","page_title":"Modène","context_page_description":"Modène est une ville italienne, chef-lieu de la province du même nom située en Émilie-Romagne. Avec ses 180 000 habitants, Modène est la 21ᵉ ville d’Italie pour ce qui est de la population.\\nModène et ses alentours sont souvent considérés comme lieux de pèlerinage de la gastronomie italienne avec de nombreuses spécialités locales reconnues au niveau international comme son vinaigre balsamique, ses tortellini, son Parmigiano Reggiano, etc. La ville est aussi un important centre de la passion automobile, puisque dans un petit périmètre autour de Modène se trouvent les entreprises Ferrari, Maserati, Lamborghini et Pagani.\\nModène comporte trois monuments classés au patrimoine mondial de l'UNESCO depuis 1997, la cathédrale de Modène, la Torre Ghirlandina et la Piazza Grande."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%89%9B%E9%A0%AD%E6%80%AA%E7%94%B2%E9%BE%8D%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Minotaurasaurus.jpg","page_title":"牛頭怪甲龍屬","context_page_description":"牛头怪甲龙属又名牛头怪龙，是甲龙科的一属，生存于白垩纪晚期，约7,000万年前。\\n牛头怪甲龙的化石是一个完整的头骨，发现于戈壁沙漠，但不确定是在中国还是蒙古。牛头怪甲龙的头骨外形类似具有骨甲的牛头。脑壳相当原始，具有甲龙科的典型特征。牛头怪甲龙是在2009年由Clifford A. Miles与Clark J. Miles命名。属名意为“牛头人蜥蜴”；种名则是Vilayanur S. Ramachandran为名，他从日本商人买下这些化石，并且交给科学家研究。\\n关于这个头颅骨的化石发现过程，目前仍有争议。某些古生物学家发现，这个化石是没有经过中国政府同意而卖到国外，过程也没有正式文件纪录。在亚利桑那州买下这个化石的V.S. Ramachandran表示，如果有人能证明这个化石是非法走私到美国，他愿意把化石交还其所属国。到目前为止，这个化石仍在洛杉矶市郊的Victor Valley博物馆。"},{"page_url":"https://nl.wikipedia.org/wiki/Scaltenigo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Cattedra_di_San_Pietro_Apostolo_%28Scaltenigo%2C_Mirano%29_05.JPG","page_title":"Scaltenigo","context_page_description":"Scaltenigo is een plaats in de Italiaanse gemeente Mirano in de provincie Venetië. Het dorp heeft ruim 3.000 inwoners."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%87%8D%E8%A6%81%E6%96%87%E5%8C%96%E8%B4%A2%E5%BB%BA%E7%AD%91%E7%89%A9%E7%B1%BB%E5%88%97%E8%A1%A8_(%E8%BF%91%E4%BB%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Kiyosu_Bridge_2015-05-30_%2818097974009%29.jpg","page_title":"重要文化财建筑物类列表 (近代)","context_page_description":null},{"page_url":"https://nl.wikipedia.org/wiki/Waag_(Alkmaar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Alkmaar%2C_de_Kapelkerk_RM7237_foto8_2014-12-26_12.03.jpg","page_title":"Waag (Alkmaar)","context_page_description":"De Waag in Alkmaar is een gebouw op het Waagplein dat in gebruik is geweest als kapel en waag. Het Hollands Kaasmuseum en de VVV zijn tegenwoordig in het gebouw gevestigd. Het gebouw heeft een toren met beroemde ruitertjes en een fraai carillon. Het gebouw is in 1969 aangewezen als rijksmonument. Op het Waagplein wordt in de zomer de kaasmarkt gehouden."},{"page_url":"https://de.wikipedia.org/wiki/Saint-Brevin-les-Pins","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/St-br%C3%A9vin_fesses-diable_02.jpg","page_title":"Saint-Brevin-les-Pins","context_page_description":"Saint-Brevin-les-Pins ist eine französische Gemeinde mit 13.802 Einwohnern im Département Loire-Atlantique in der Region Pays de la Loire. Sie liegt an der Mündung der Loire in den Atlantik. Im Gemeindegebiet liegt das südliche Widerlager der Saint-Nazaire-Brücke."},{"page_url":"https://sv.wikipedia.org/wiki/Bronsgropl%C3%B6pare","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Elaphrus_cupreus_detail3.jpg","page_title":"Bronsgroplöpare","context_page_description":"Bronsgroplöpare är en skalbaggsart som beskrevs av Caspar Erasmus Duftschmid 1812. Bronsgroplöpare ingår i släktet Elaphrus, och familjen jordlöpare. Arten är reproducerande i Sverige."},{"page_url":"https://fr.wikipedia.org/wiki/D%C3%A9buts_de_la_m%C3%A9canisation_automobile_des_arm%C3%A9es_fran%C3%A7aises","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Lyautey_reaches_Marrakesh_in_armored_car_%281912%2C_Le_Petit_Journal%29.jpg","page_title":"Débuts de la mécanisation automobile des armées françaises","context_page_description":"Les débuts de la mécanisation automobile des armées françaises voient les premières expériences de mise en service à des fins militaires de véhicules motorisés automobiles par l'armée française au tournant des XIXᵉ et XXᵉ siècles, pendant la Première Guerre mondiale et la décennie qui suivit celle-ci.\\nLes tout premiers essais d'utilisation d'un véhicule automobile par les armées françaises remontent au XVIIIᵉ siècle avec le fardier de Cugnot, mis au point pour servir de tracteur de pièces d'artillerie mais ces essais restèrent sans suite. L'armée française reprit de nouveaux essais de « locomotive routière » utilisant la locomotion à vapeur au cours des années 1860, avec quelques succès qui n'eurent cependant pas plus de suite, et l'artillerie française était encore très largement hippomobile au début de la Première Guerre mondiale.\\nLa création d'un premier organisme chargé d'évaluer les possibilités d'un usage militaire de l'automobile à moteur à combustion interne et de la constitution et de la gestion d'un premier parc automobile encore fort modeste remonte à 1896, année où une « Commission militaire des automobiles » fut ainsi chargée de ces tâches."},{"page_url":"https://fr.wikipedia.org/wiki/John_Brown_%26_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Queen_Elizabeth_Construction.jpg","page_title":"John Brown & Company","context_page_description":"John Brown and Company de la Clydebank, West Dunbartonshire, en Écosse, est une grande entreprise de construction navale britannique."},{"page_url":"https://en.wikipedia.org/wiki/Chief_Court_Mistress","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Louise_von_Plessen.jpg","page_title":"Chief Court Mistress","context_page_description":"Court Mistress or Chief Court Mistress is or was the title of the senior lady-in-waiting in the courts of Austria, Denmark, Norway, the Netherlands, Sweden, Imperial Russia, and the German princely and royal courts."},{"page_url":"https://cy.wikipedia.org/wiki/Sooronbay_Jeenbekov","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Sooronbay_Jeenbekov_at_the_Eurasian_Intergovernmental_Council_meeting%2C_7_March_2017.jpg","page_title":"Sooronbay Jeenbekov","context_page_description":"Gwleidydd Cirgistanaidd yw Sooronbay Sharipovich Jeenbekov neu Sooronbay Zheenbekov sydd yn Arlywydd Cirgistan ers 24 Tachwedd 2017. Gwasanaethodd yn swydd Prif Weinidog Cirgistan o Ebrill 2016 hyd Awst 2017."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%84%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D1%8C%D0%BA%D1%96_%D1%96%D0%B3%D1%80%D0%B8_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Stamp_of_Ukraine_s1432.jpg","page_title":"Європейські ігри 2015","context_page_description":"Європейські ігри 2015 — І Європейські ігри, що проходили з 12 по 28 червня 2015 року в місті Баку, столиці Азербайджану."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BC%8A%E6%8B%89%E6%96%AF%E8%B0%9F%E5%A5%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Ingmar_Bergman_Smultronstallet.jpg","page_title":"伊拉斯谟奖","context_page_description":"伊拉斯謨獎是一個年度獎項，由伊拉斯謨基金會頒發給對歐洲及世界其它地方的文化，社會或社會科學有著傑出貢獻的個人或組織。該獎項是歐洲最傑出的獎項之一。"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BD%D5%A1%D6%80%D5%AF%D5%B8%D5%BE%D5%AB_%D5%A1%D5%A6%D5%A3%D5%A1%D5%B5%D5%AB%D5%B6_%D5%B0%D5%A1%D5%B4%D5%A1%D5%AC%D5%BD%D5%A1%D6%80%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Etalon-big.jpg","page_title":"Խարկովի ազգային համալսարան","context_page_description":"Վ. Կարազինի անվան Խարկովի ազգային համալսարան, Ուկրաինայի հնագույն համալսարաններից։"},{"page_url":"https://vi.wikipedia.org/wiki/Coptis_trifoliolata","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Coptis_trifoliolata_3.JPG","page_title":"Coptis trifoliolata","context_page_description":"Coptis trifoliolata là một loài thực vật có hoa trong họ Mao lương. Loài này được Makino mô tả khoa học đầu tiên năm 1914."},{"page_url":"https://fr.wikipedia.org/wiki/Ordre_cistercien","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Pontigny.JPG","page_title":"Ordre cistercien","context_page_description":"L'ordre cistercien est un ordre monastique de droit pontifical.\\nC'est une branche réformée des bénédictins dont l'origine remonte à la fondation de l'abbaye de Cîteaux par Robert de Molesme en 1098.\\nL'ordre cistercien joue un rôle de premier plan dans l'histoire religieuse du XIIᵉ siècle. Par son organisation et par son autorité spirituelle, il s'impose dans tout l'Occident, jusque sur ses franges. Son influence se révèle particulièrement forte à l'est de l'Elbe où l'ordre fait progresser à la fois le christianisme, la civilisation [occidentale] et la mise en valeur des terres.\\nRestauration de la règle bénédictine inspirée par la réforme grégorienne, l'ordre cistercien promeut ascétisme, rigueur liturgique et érige, dans une certaine mesure, le travail comme une valeur cardinale, ainsi que le prouve son patrimoine technique, artistique et architectural. Outre le rôle social qu'il occupe jusqu'à la Révolution, l'ordre exerce une influence de premier plan dans les domaines intellectuel ou économique ainsi que dans le domaine des arts et de la spiritualité.\\nIl doit son considérable développement à Bernard de Clairvaux, homme d'une personnalité et d'un charisme exceptionnels."},{"page_url":"https://en.wikipedia.org/wiki/Daniel_Van_Buyten","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Belgium_national_football_team_2011-03-25_%2801%29.jpg","page_title":"Daniel Van Buyten","context_page_description":"Daniel Van Buyten is a Belgian former footballer who played as a centre back. Nicknamed \\"Big Dan\\", Van Buyten was known for his uncompromising style of play, exploiting both his physical strength and aerial ability.\\nBeginning at Charleroi as a striker, Van Buyten's career took off when he converted to a centre back, playing for a series of top flight clubs, including Marseille, Manchester City, Hamburger SV and Bayern Munich. Throughout his career, Van Buyten was also a regular starter for the Belgium national team, amassing 83 caps in an international career that spanned 13 years and which included participation at two FIFA World Cup.\\nVan Buyten became the first-ever Belgian winner of the UEFA Champions League when Bayern Munich claimed the European crown in 2013."},{"page_url":"https://de.wikipedia.org/wiki/Robert_Dorer","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Geneva_2006_638.JPG","page_title":"Robert Dorer","context_page_description":"Eugen Robert Dorer war ein Schweizer Bildhauer."},{"page_url":"https://en.wikipedia.org/wiki/Discrimination","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Lotshampa_refugees_in_Beldangi_Camp.jpg","page_title":"Discrimination","context_page_description":"Discrimination is the act of making distinctions between human beings based on the groups, classes, or other categories to which they are perceived to belong. People may discriminate on the basis of age, caste, criminal record, height, weight, physical appearance, disability, family status, gender identity, gender expression, generation, genetic characteristics, marital status, nationality, profession, color, race and ethnicity, religion, sex and sex characteristics, sexual orientation, political ideology, social class, personality, as well as other categories. Discrimination especially occurs when individuals or groups are treated \\"in a way which is worse than the way people are usually treated,\\" on the basis of their actual or perceived membership in certain groups or social categories. It involves the group's initial reaction or interaction going on to influence the individual's actual behavior towards the group's leader or the group, restricting members of one group from opportunities or privileges that are available to members of another group, leading to the exclusion of the individual or entities based on illogical or irrational decision-making."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Neustadt_an_der_Aisch","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Neustadt_an_der_Aisch%2C_Kirchplatz_6-001.jpg","page_title":"Liste der Baudenkmäler in Neustadt an der Aisch","context_page_description":"Auf dieser Seite sind die Baudenkmäler der mittelfränkischen Stadt Neustadt an der Aisch zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde. Diese Liste gibt den Fortschreibungsstand vom 12. April 2014 wieder und enthält 132 Baudenkmäler."},{"page_url":"https://fr.wikipedia.org/wiki/Arme_chimique","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/British_55th_Division_gas_casualties_10_April_1918.jpg","page_title":"Arme chimique","context_page_description":"Une arme chimique est une arme spécialisée qui utilise des substances conçues pour infliger des blessures ou pour tuer des êtres vivants du fait de leurs propriétés chimiques ou de leur toxicité.\\nSelon l'Organisation pour l'interdiction des armes chimiques, « le terme arme chimique peut également s'entendre pour tout composé chimique toxique, ou les précurseurs d'un tel composé, susceptibles de provoquer la mort, des blessures, une incapacité temporaire ou une irritation sensorielle par son action chimique. Les munitions et les équipements associés conçus pour produire et disperser ces armes chimiques, qu'ils soient chargés ou vides, sont également considérés eux-mêmes comme des armes ». Une arme chimique est dite unitaire lorsque sa substance active est stockée telle quelle avant utilisation, à la différence d'une arme binaire, dont le principe actif doit être préparé avant utilisation en faisant réagir deux ou plusieurs précurseurs plus stables généralement moins toxiques. Les plus dangereux d'entre eux sont notamment les agents innervants, comme le sarin et le VX, et les vésicants, comme la lewisite et le gaz moutarde."},{"page_url":"https://hu.wikipedia.org/wiki/Bourg-de-Bigorre","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Population_-_Municipality_code_65105.svg","page_title":"Bourg-de-Bigorre","context_page_description":"Bourg-de-Bigorre település Franciaországban, Hautes-Pyrénées megyében. Bourg-de-Bigorre Bonnemazon, Benqué, Bettes, Castillon, Esconnets, Escots, Espieilh és Sarlabous községekkel határos."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%A6%99%E6%B8%AF%E7%A7%91%E5%AD%B8%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Charles_K._Kao_Auditorium_201601.jpg","page_title":"香港科學園","context_page_description":"香港科学园位于香港新界大埔区白石角吐露港沿岸，毗邻白石角海滨长廊，邻近香港中文大学，发展占地22公顷，第一至第三期总楼面面积达330,000平方米，第二期工程于2006年竣工，第三期于2016年竣工。\\n香港科学园与数码港相似，同样采用一个类似大学校园的低密度规划，以高科技及应用科技为主题的研究基地，由香港科技园公司于2001年5月7日开始运作。\\n由于香港科学园所在地原为吐露港海域，故该处原来的大埔区与沙田区分界采用了直线划界的方式，填海工程完成后，这条直线便将科学园建筑地盘范围切割成东南和西北两部分，其中东南部属沙田区，西北部属大埔区，界线位置约为现今的科研路以东绿悠台一带。随着科学园第二、三期工程完成，香港政府已经对香港科学园的分区划界进行调整。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B5%81%E0%B4%B1_%E0%B4%A8%E0%B4%A6%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/MtskhetaMtkvariAragvi.jpg","page_title":"കുറ നദി","context_page_description":"കോക്കസസ് പർവ്വത നിരകളിലെ ഏറ്റവും പ്രധാനപ്പെട്ട യും ഉയർന്നതുമായ പർവ്വതമായ ഗ്രേറ്റർ കോക്കസസിന്റെ തെക്ക് ഭാഗത്ത് നിന്ന് ഉദ്ഭവിച്ച് കിഴക്കോട്ട് ഒഴുകുന്ന നദിയാണ് കുറ നദി - Kura River.\\nഗ്രേറ്റർ കോക്കസസിന്റെ തെക്കൻ മലഞ്ചെരിവിൽ നിന്ന് ആരംഭിച്ച് കാസ്പിയൻ കടലിന്റെ കിഴക്കൻ ഭാഗത്ത് ചേരുന്ന കുറ നദി, ലെസ്സർ കോക്കസസിന്റെ വടക്ക് ഭാഗത്തിലൂടെയും ഒഴുകുന്നുണ്ട്. ഗ്രേറ്റർ, ലെസ്സർ പർവ്വതങ്ങളുടെ ദക്ഷിണ ദിക്കിൽ നിന്നും അറാസ് എന്ന പോഷകനദിയും ഒഴുകുന്നുണ്ട്.\\nതുർക്കിയുടെ വടക്കുകിഴക്കൻ ഭാഗത്ത് നിന്ന് ആരംഭിച്ച് ജോർജിയയിലൂടെ അസർബയ്ജാൻ എന്നീ രാജ്യങ്ങളിലൂടെയാണ് കുറ നദി ഒഴുകുന്നത്. അസർബയ്ജാനിൽ വച്ച് കുറ നദി അറാസ്‌ നദിയെ പോഷകനദിയായി സ്വീകരിച്ച് കാസ്പിയൻ കടലിൽ എത്തിച്ചേരുന്നു. കുറ നദിയുടെ ആകെ നീളം 1,515 കിലോമീറ്ററാണ്."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D1%8E%D1%81%D1%82%D0%B8%D0%BD,_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/%D0%91%D0%B5%D0%BB%D1%8E%D1%81%D1%82%D0%B8%D0%BD_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87.jpg","page_title":"Белюстин, Анатолий Александрович","context_page_description":"Белюстин Анатолий Александрович — российский учёный, специалист в области физической химии и электрохимии стекла, ионометрии и потенциометрии; профессор, доктор химических наук, представитель научной школы Б. П. Никольского — М. М. Шульца в области ионометрии и потенциометрии с мембранными ионоселективными электродами, в частности со стеклянным электродом."},{"page_url":"https://it.wikipedia.org/wiki/Villa_romana_di_San_Biagio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Villa_romana_Terme_V._19_10_2018_09.jpg","page_title":"Villa romana di San Biagio","context_page_description":"La villa romana di San Biagio è una residenza extraurbana di epoca romana, aggregati d'edifici ubicati nella frazione omonima di Terme Vigliatore, comune italiano della città metropolitana di Messina.\\nLa villa riportata alla luce negli anni cinquanta, è tra gli esempi più interessanti di villa di lusso suburbana rinvenuta lungo lo sviluppo dell'attuale Strada Statale 113, verosimilmente come altri insediamenti coevi, insistente a ridosso del primitivo tracciato della Consolare Valeria sulla tratta viaria Mylae - Pactae o Pactis attraverso Týndaris."},{"page_url":"https://it.wikipedia.org/wiki/San_Francisco_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/San_Francisco_lobby_card.JPG","page_title":"San Francisco (film)","context_page_description":"San Francisco è un film del 1936 diretto da W.S. Van Dyke II. Venne presentato in concorso alla 4ª Mostra del Cinema di Venezia."},{"page_url":"https://es.wikipedia.org/wiki/Spilopelia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Laughing_Dove_%2813845819085%29.jpg","page_title":"Spilopelia","context_page_description":"Spilopelia es un reducido género de aves columbiformes perteneciente a la familia Columbidae. Sus especies se distribuyen por África y Asia, llegando hasta las islas menores de la Sonda por oriente y los Balcanes por occidente.​ Sus dos miembros son tórtolas que anteriormente se clasificaban en el género Streptopelia, pero fueron separados cuando se comprobaron sus diferencias genéticas, además de las morfológicas y de comportamiento."},{"page_url":"https://de.wikipedia.org/wiki/Evangelisches_Krankenhaus_Witten","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Witten_-_Diakonissenhaus2006.jpg","page_title":"Evangelisches Krankenhaus Witten","context_page_description":"Das Evangelische Krankenhaus Witten ist ein Krankenhaus mit 302 Betten in Witten. Das Haus hat neun Fachabteilungen und eine Beleg-Abteilung für Hals-, Nasen- und Ohrenheilkunde. Es ist Lehrkrankenhaus der Universität Witten/Herdecke."},{"page_url":"https://cs.wikipedia.org/wiki/Mal%C3%A9_Ky%C5%A1ice","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Male_Kysice_KL_CZ.png","page_title":"Malé Kyšice","context_page_description":"Malé Kyšice jsou obec ve Středočeském kraji, 3 km jihozápadně od Unhoště v okrese Kladno. Žije zde 510 obyvatel. V okolí obce se nacházejí rozsáhlé chatové osady, které jsou umístěné hlavně na nedalekém potoku Kačák, a přírodní památka Markův mlýn."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%98%D7%A8%D7%99%D7%A7_%D7%A9%D7%A0%D7%94%D7%90%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Patrick_M._Shanahan_official_portrait.jpg","page_title":"פטריק שנהאן","context_page_description":"פטריק מ. שנהאן הוא איש עסקים אמריקאי אשר כיהן כמזכיר ההגנה של ארצות הברית בפועל בשנת 2019, וכסגן מזכיר ההגנה של ארצות הברית בשנים 2017 עד 2019."},{"page_url":"https://fr.wikipedia.org/wiki/Tres_Hombres_(voilier)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/TRES_HOMBRES_%2807%29.JPG","page_title":"Tres Hombres (voilier)","context_page_description":"Le Tres Hombres est un brick-goélette néerlandais relancé en 2009 sur la base d'un démineur allemand de 1943.\\nIl est exploité par la société néerlandaise Fairtransport Shipping & Trading comme navire de transport de fret à voile et navire-école."},{"page_url":"https://en.wikipedia.org/wiki/Northwestern_crow","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Caution_Aggressive_Nesting_Crows_sign.jpg","page_title":"Northwestern crow","context_page_description":"The northwestern crow is an all-black passerine bird of the crow genus native to the northwest of North America. It is very similar to the more western forms of the widespread American crow, but it averages slightly smaller allegedly with proportionately smaller feet and a slightly more slender bill. This taxon is perhaps impossible to identify in the field, and is largely identified by range, though even that method is contested."},{"page_url":"https://eu.wikipedia.org/wiki/Buthraupis_eximia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/ButhraupisChloronotaWolf.jpg","page_title":"Buthraupis eximia","context_page_description":"Buthraupis eximia Buthraupis generoko animalia da. Hegaztien barruko Thraupidae familian sailkatua dago."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89quipe_de_Belgique_de_football","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Belgian_national_football_team_1901.jpg","page_title":"Équipe de Belgique de football","context_page_description":"L'équipe de Belgique de football est la sélection de joueurs belges représentant le pays lors des compétitions internationales de football masculin, sous l'égide de la Royal Belgian Football Association.\\nLes internationaux belges sont surnommés les « Diables Rouges », en néerlandais Rode Duivels, en référence à la couleur de leur maillot, depuis 1906, bien que ce surnom ne soit devenu officiel que plus tard. Durant le mandat de Raymond Goethals, dans les années 1970, ils sont aussi appelés les « Diables Blancs » ou encore les « Diables Noirs » au début des années 2000, après l'introduction du maillot extérieur entièrement noir.\\nLe premier match officiel de la Belgique est organisé le 1ᵉʳ mai 1904 à Bruxelles contre la France et se solde par un partage. La sélection belge remporte en 1920 la médaille d'or aux Jeux olympiques. La Belgique a depuis participé à treize phases finales de la Coupe du monde. Son meilleur résultat est la troisième place atteinte lors de la Coupe du monde 2018 en Russie. En Championnat d'Europe, son meilleur résultat est une finale en 1980, perdue contre l'Allemagne."},{"page_url":"https://zh.wikipedia.org/zh-cn/F-15%E9%B7%B9%E5%BC%8F%E6%88%B0%E9%AC%A5%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/F-15A-hatzerim-2.jpg","page_title":"F-15鷹式戰鬥機","context_page_description":"F-15鹰式战斗机或作F-15鹫式战斗机，是一款美国麦克唐纳-道格拉斯公司开发生产的全天候制空战斗机。针对获得与维持空优而设计，是美国空军现役的主力战斗机之一。F-15是自1962年展开的F-X计划发展而来。在战斗机世代上，按原先的欧美标准被归类为第三代战斗机。\\n为了替代除役的F-111执行穿透打击任务，1988年F-15发展出后续的衍生型F-15E打击鹰式战斗轰炸机，这是一款成功的全天候打击战斗机。F-15或F-15E已出口到日本、以色列、韩国、新加坡、沙特等国家。除日本外其余用户均已获得了基于F-15E开发的出口型号战斗机。美军拥有约700架F-15战斗机。"},{"page_url":"https://la.wikipedia.org/wiki/Corb%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Corb%C3%A8re-d%27en-Haut_-_Village_et_chapelle.jpg","page_title":"Corbère","context_page_description":"Corbère est commune Francicum 717 incolarum praefecturae Pyrenaei Orientalis in regione australi Occitania et Ruscinone.\\nCoustouges"},{"page_url":"https://en.wikipedia.org/wiki/2006_Ecuadorian_general_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/%C3%81lvaro_Noboa.jpg","page_title":"2006 Ecuadorian general election","context_page_description":"General elections were held in Ecuador on 15 October 2006 to elect a new President and National Congress.\\nAs no presidential candidate received a majority of the vote in the first round, a run-off was held on 26 November, which was won by Rafael Correa of the PAIS Alliance."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%B5%A8%E6%AF%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Flag_of_Turkmenistan.svg","page_title":"絨毯","context_page_description":"絨毯とは、屋内の床に敷くための織物や敷物のことである。カーペットとも呼ばれる。歴史的には、織物、草でできた敷物、テーブルや壁を覆うものにも用いられた語である。アレルギーの原因とされるダニアレルゲンを含むハウスダストの舞い上がりを抑制する効果がある。ぜん息などダニアレルギー症状を防ぐ方法は、第一に「寝具の管理」であり、次に「清潔に保つこと」である。床材の種類とダニアレルギー発症との関係性が薄いことは、兵庫県西宮市による大規模なダニアレルギー調査によって明らかとなっている。詳しくは下の項目を参照。\\n18世紀のヨーロッパで、屋内の床に一般的に使用されるようになった。手で結んで作られたパイル絨毯は、中央アジアで紀元前4000年から2000年の間に作られたとされる。製法は10世紀にムーア人によってスペインに紹介され、十字軍がトルコのカーペットをヨーロッパに持ち帰った。当時は、壁に掛けられるか、テーブルを覆うものとして用いられた。17世紀に通商航路が始まったことにより、ヨーロッパ西部では多くのペルシャ敷物が導入された。\\n国内のカーペット産地は大阪南部。日本敷物団地協同組合は大阪府堺市にあるが、現在は商業施設や住宅も多くなり、カーペット工場を置く会社は少なくなってしまった。それでも大阪南部にあるカーペットメーカーは多い。\\n堺緞通の流れをくむ住江織物はトップメーカーのひとつで、現在、家庭用カーペットではトップ。東リは「由多加織」をスタートに、リノリウムを経てカーペット事業に参入し、現在はオフィス向けを主とするタイルカーペットでトップシェアを誇る。"},{"page_url":"https://lv.wikipedia.org/wiki/Valsts_aizsarg%C4%81jamie_kult%C5%ABras_pieminek%C4%BCi_Ogres_novad%C4%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Madlienas_bazn%C4%ABca_2000-06-17.jpg","page_title":"Valsts aizsargājamie kultūras pieminekļi Ogres novadā","context_page_description":"Šajā lapā apkopoti valsts aizsargājamie kultūras pieminekļi Ogres novadā.\\nKultūras pieminekļu karte\\nŠis saraksts tiek veidots no Vikidatiem, to periodiski atjaunina bots."},{"page_url":"https://es.wikipedia.org/wiki/Mayrhof","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Mayrhof_im_Bezirk_SD.png","page_title":"Mayrhof","context_page_description":"Mayrhof es una localidad del distrito de Schärding, en el estado de Alta Austria, Austria, con una población estimada a principio del año 2018 de 322 habitantes.\\nSe encuentra ubicada al norte del estado, cerca de la frontera con Alemania y de los ríos Danubio y Eno —un afluente derecho del primero—.​"},{"page_url":"https://pl.wikipedia.org/wiki/Lista_system%C3%B3w_metra","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Moscow_Metro%2C_Kievskaya_station.jpg","page_title":"Lista systemów metra","context_page_description":"Lista systemów metra – lista zawiera funkcjonujące systemy metra. Na świecie w 2014 roku, w 55 krajach istniało 157 systemów metra. Niektórych, zwłaszcza najnowszych, nie uwzględniono na liście.\\nMetro jest jednym z elementów komunikacji miejskiej, zaliczanych do środków transportu szynowego. Pierwsza sieć metra na świecie powstała w 1863 w Londynie, jednak jej elektryfikacji dokonano dopiero w 1890 roku. Obecnie najdłuższy system metra funkcjonuje w Szanghaju, natomiast największa liczba stacji oraz linii działa w Nowym Jorku."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Cr%C3%A9pin_(Hautes-Alpes)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/St-Crepin.jpg","page_title":"Saint-Crépin (Hautes-Alpes)","context_page_description":"Saint-Crépin est une commune française située dans le département des Hautes-Alpes en région Provence-Alpes-Côte d'Azur."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%9A%E0%A4%BF%E0%A4%89%E0%A4%B0%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/%E0%A4%9A%E0%A4%BF%E0%A4%89%E0%A4%B0%E0%A5%80%E0%A4%95%E0%A5%8B_%E0%A4%AB%E0%A5%82%E0%A4%B2.jpg","page_title":"चिउरी","context_page_description":"चिउरी नेपालको पहाडी भूभागमा पाइने रुख । यसको फल खाद्यपदार्थको रूपमा प्रयोग गरिन्छ भने बिऊ पेलेर निकालिएको तेल भुटनको रूपमा प्रयोग गरिन्छ ।"},{"page_url":"https://de.wikipedia.org/wiki/Molluscum_contagiosum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Mollusca1klein.jpg","page_title":"Molluscum contagiosum","context_page_description":"Molluscum contagiosum bezeichnet eine knötchenartige Hauterscheinung, die durch eine Virusinfektion verursacht wird. Die Übertragung von Mensch zu Mensch erfolgt durch direkten Kontakt. Der Verlauf dieser häufigen Infektionskrankheit ist in den meisten Fällen gutartig und selbstlimitierend, sie bilden sich meist im Verlauf von bis zu 18 Monaten vollständig zurück. Am häufigsten betroffen sind Kinder, sexuell aktive Erwachsene und Immunsupprimierte."},{"page_url":"https://fr.wikipedia.org/wiki/Groupe_de_papier_peint","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Uniform_tiling_44-h01.png","page_title":"Groupe de papier peint","context_page_description":"Un groupe de papier peint est un groupe mathématique constitué par l'ensemble des symétries d'un motif bidimensionnel périodique. De tels motifs, engendrés par la répétition à l'infini d'une forme dans deux directions du plan, sont souvent utilisés en architecture et dans les arts décoratifs. Il existe 17 types de groupes de papier peint, qui permettent une classification mathématique de tous les motifs bidimensionnels périodiques.\\nEn termes de complexité, les groupes de papier peint se situent entre les groupes de frise, simples, et les groupes d'espace tridimensionnels."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B7%B4%E8%A5%BF%E4%BA%9E%E9%A6%AC%E9%81%9C%E5%B7%9E%E5%B8%82%E9%8E%AE%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Amazonas_Municip_Amatura.jpg","page_title":"巴西亞馬遜州市鎮列表","context_page_description":"亞馬遜州市鎮列表列出位於巴西北部的亞馬遜州當前下轄的所有市鎮。巴西地理統計局於2018年估計，該州人口4,080,611人，占巴西人口的1.96%，在巴西各州及聯邦區名列第13；面積1,559,168.117平方公里，占巴西國土的18.32%，為在巴西各州及聯邦區面積最大者。\\n亞馬遜河流域至少在一萬年前便有人居住，這些處於石器時代的居民分布於數百個部落中，其中有小部落及人數以萬計的部落。1494年，葡西雙方簽署《托德西利亞斯條約》，指出當時的亞馬遜是處於西班牙帝國的統治之下。1541年，西班牙人貢薩洛·皮薩羅在遠征安地斯山脈以東時資源短缺，而其堂表親法蘭西斯科·德·奧雷亞納便因此提出帶領60名男子和遠征船隻一同尋找物資。他沿納波河至其與亞馬遜河交會處，再至亞馬遜河河口，成為第一位探索整條河流的白人。在探險期間，他們遇見一些印地安女戰士，其便如同希臘神話的亞馬遜人般，探險家因而將河流命名為「亞馬遜河」。除西班牙外，葡、法、荷、英等國亦無所畏忌地入侵亞馬遜並開採丁香、瓜拿納、樹脂以及木材等資源。1669年，葡萄牙上尉弗朗西斯科·達·莫塔·法爾康在今日的瑪瑙斯建立聖若澤達巴拉杜里約內格羅堡。1750年，葡西雙方簽署馬德里條約，使西班牙失去對於廣大亞馬遜地區的主導權。1755年，聖若澤杜里約內格羅領地成立，以巴拉杜里約內格羅為首府，並使其成為帕拉的一部分。巴西獨立後，該地於1850年才脫離對帕拉的依賴，取得自治權。1852年，皇帝佩德羅二世宣布建立亞馬遜省。隨著以橡膠為原材料的產業興起，亞馬遜河於1866年開放予國際航行。1889年，巴西帝國被推翻，省改制為州。1890年代起，全球大量的橡膠需求吸引了從東北部到首府的移民，使其基礎設施及人口均有顯著的改變。1910年代至1920年代，因為英國人亨利·威克翰將橡膠種子走私回倫敦使其不久後於英國殖民地錫蘭及馬來亞有效率地生長，造成巴西失去對橡膠的壟斷，結束了亞馬遜橡膠熱潮。二戰期間，日本佔領馬來亞使當地橡膠產業短暫繁榮。1967年，瑪瑙斯自由區成立，促使工業移入該地。1970年代，政府決定以在叢林中鋪設道路及殖民內陸來鞏固其對亞馬遜流域的控制，使對亞馬遜雨林的破壞大行其道。\\n亞馬遜州劃分為4個中級地理區、11個直接地理區及62個市鎮。瑪瑙斯為亞馬遜州首府，是該州人口最多及人口密度最高的市鎮，人口超過200萬人。雅普拉為人口數最少及人口密度最低的市鎮。面積最大的市鎮為巴塞洛斯，其同時亦是全國面積第二大的市鎮，僅次於阿爾塔米拉；伊蘭杜巴為面積最小的市鎮。"},{"page_url":"https://de.wikipedia.org/wiki/Servette_FC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/1934-35_Karl_Rappan.jpg","page_title":"Servette FC","context_page_description":"Der Servette Football Club Genève 1890, kurz Servette FC oder einfach nur Servette, auch bekannt als Servette Genf, ist ein Fußballclub aus dem gleichnamigen Quartier Servette in der Schweizer Stadt Genf. Der 1890 gegründete Sportclub spielte anfänglich Rugby; um die Jahrhundertwende wechselte der Verein zum Assoziationsfussball. Servette gewann hinter dem Rekordmeister Grasshoppers und dem FC Basel am drittmeisten Schweizer Meisterschaften. Das Team wird aufgrund des granatroten Dress auch Grenats genannt. Der Verein spielt in der Saison 2019/20 in der erstklassigen Super League und trägt seine Heimspiele im Stade de Genève in Lancy aus."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D8%B9_%D8%A3%D9%88%D8%A7%D9%83%D8%B3_%D9%84%D9%84%D8%B3%D8%B9%D9%88%D8%AF%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Usaf.e3sentry.750pix.jpg","page_title":"بيع أواكس للسعودية","context_page_description":"كان بيع طائرات المراقبة بوينغ إي-3 سينتري \\"أواكس\\" للمملكة العربية السعودية من قبل إدارة الرئيس الأمريكي رونالد ريغان مثيرًا للجدل حيث عدت أكبر عملية بيع أسلحة أجنبية في تاريخ الولايات المتحدة، وكان المعترضون هم أعضاء مجلس الشيوخ الأمريكي البارزين، ودولة إسرائيل واللوبي الإسرائيلي.\\nشملت صفقة البيع خمس طائرات أواكس وثماني طائرات للتزود بالوقود من طراز KE-3، مع قطع غيار ودعم، تم تسليمها في الفترة ما بين يونيو 1986 وسبتمبر 1987."},{"page_url":"https://tt.wikipedia.org/wiki/NGC_2893","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/NGC_2893_SDSS.jpg","page_title":"NGC 2893","context_page_description":"NGC 2893 — Томанлыклар һәм йолдыз тупланмалары яңа гомуми каталогында теркәлгән галактика."},{"page_url":"https://it.wikipedia.org/wiki/Phillips_(Maine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Main_Street%2C_From_Union_Church_Tower%2C_Phillips%2C_ME.jpg","page_title":"Phillips (Maine)","context_page_description":"Phillips è un comune della contea di Franklin, nel Maine. Durante il censimento del 2000 vi si contava una popolazione di 990 unità."},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8Cang_Taj","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Ch%27iu_Ying_001.jpg","page_title":"Čang Taj","context_page_description":"Čang Taj byl čínský spisovatel a dějepisec přelomové doby úpadku dynastie Ming a nástupu mandžuské dynastie Čching."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_de_Minsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/The_Minsk_Thinker_-_panoramio.jpg","page_title":"Liste des monuments de Minsk","context_page_description":"Cet article présente une liste des monuments de la ville de Minsk."},{"page_url":"https://en.wikipedia.org/wiki/List_of_primary_state_highways_in_Virginia_shorter_than_one_mile","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/2017-07-12_15_48_58_View_east_along_Virginia_State_Route_404_%28Princess_Anne_Road%29_at_May_Avenue_in_Norfolk%2C_Virginia.jpg","page_title":"List of primary state highways in Virginia shorter than one mile","context_page_description":"The following is a list of primary state highways in Virginia shorter than one mile in length."},{"page_url":"https://it.wikipedia.org/wiki/Campo_di_internamento_di_Drancy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Bundesarchiv_Bild_183-B10920%2C_Frankreich%2C_Paris%2C_festgenommene_Juden_im_Lager.jpg","page_title":"Campo di internamento di Drancy","context_page_description":"Il campo di internamento e transito di Drancy, dal nome del sobborgo nord-orientale di Parigi nel quale era situato, fu stabilito nell'agosto del 1941 dalle autorità collaborazioniste francesi come campo di internamento per gli ebrei stranieri in Francia, sotto il controllo generale della Polizia di sicurezza tedesca; in seguito, dal giugno 1942 divenne il principale campo di transito per le deportazioni di ebrei dalla Francia. Dal 1 luglio del 1943 i tedeschi presero in mano direttamente la gestione del campo fino alla sua liberazione nell'agosto 1944. La quasi totalità degli ebrei deportati dalla Francia passarono per il campo di transito di Drancy, inclusi quelli raccolti nei campi di internamento di Gurs e Le Vernet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2-80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/T-80U_%289%29.jpg","page_title":"Т-80","context_page_description":"Т-80 — боевая машина, основной танк, производившийся в СССР.\\nТанк с единой газотурбинной силовой установкой. Первый в мире основной танк со встроенной противоснарядной динамической защитой. На вооружении армии СССР, затем России с 1976 года. Первые серийные образцы, разработанные СКБ-2 на базе Т-64А, выпускались на Кировском заводе в Ленинграде.\\nТанк Т-80У выпускался на заводе «Омсктрансмаш» в Омске, а танк Т-80УД с дизельным двигателем — на ХЗТМ в Харькове."},{"page_url":"https://de.wikipedia.org/wiki/Santabarbarait","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Santabarbaraite-Vivianite-176749.jpg","page_title":"Santabarbarait","context_page_description":"Santabarbarait ist ein sehr selten vorkommendes Mineral aus der Mineralklasse der „Phosphate, Arsenate und Vanadate“ mit der chemischen Zusammensetzung Fe³⁺₃[(OH)₃|(PO₄)₂]·5H₂O und ist damit chemisch gesehen ein Eisen-Phosphat mit zusätzlichen Hydroxidionen.\\nSantabarbarait ist eines der wenigen Minerale, das ähnlich wie Glas zu den amorphen Feststoffen gehört, das heißt die Atome in der Verbindung bilden keine geordneten Strukturen. Entsprechend findet er sich überwiegend in Form unregelmäßiger, derber Mineral-Aggregate und traubenförmiger Krusten, bildet aber auch Pseudomorphosen nach Vivianit.\\nDas Mineral ist durchscheinend und von orangebrauner bis hellbrauner Farbe bei gelblichbrauner Strichfarbe. Die Mineral-Oberflächen weisen einen glas- bis fettähnlichen Glanz auf."},{"page_url":"https://en.wikipedia.org/wiki/Iosia_Soliola","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Iosia_Soliola.JPG","page_title":"Iosia Soliola","context_page_description":"Iosia Soliola is a professional rugby league footballer who plays as a second-row, lock prop for the Canberra Raiders in the NRL. He played for New Zealand and Samoa at international level.\\nHe previously played as a centre for the Sydney Roosters in the National Rugby League, and St Helens in the Super League, with whom he won the 2014 Super League Grand Final. He also played for the Exiles."},{"page_url":"https://ja.wikipedia.org/wiki/Osaka_Metro%E4%B8%AD%E5%A4%AE%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Osaka_Subway_24604_at_Kujo_Station.jpg","page_title":"Osaka Metro中央線","context_page_description":"中央線は、大阪府大阪市住之江区のコスモスクエア駅から大阪府東大阪市の長田駅までを結ぶ大阪市高速電気軌道 の路線。正式名称は高速電気軌道第4号線と称し、『鉄道要覧』では4号線と記載されている。駅番号を表す際に用いられる路線記号は「C」。\\n路線愛称の由来は中央大通の地下を走ることから。ラインカラーは大阪城公園の木々をイメージした緑である。なお、近畿日本鉄道のけいはんな線の学研奈良登美ヶ丘駅までの開通・相互直通運転実施を機に、両線と併せて「ゆめはんな」の愛称が名付けられている。"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_York_County,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/NCR_over_S_Branch_Codorus_Creek%2C_East_View.jpg","page_title":"National Register of Historic Places listings in York County, Pennsylvania","context_page_description":"This is a list of the National Register of Historic Places listings in York County, Pennsylvania.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in York County, Pennsylvania, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 97 properties and districts listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted May 10, 2019."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%82%D0%B8%D1%80%D0%BE%D1%81_%D0%A1%D0%B0%D1%80%D1%98%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Martiros_Sarian_Paintings_2005_Postal_Card.jpg","page_title":"Мартирос Сарјан","context_page_description":"Мартирос Сарјан био је јерменски сликар, оснивач модерне јерменске националне школе сликарства."},{"page_url":"https://hu.wikipedia.org/wiki/%C3%89szak-Amerika_dinoszauruszainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Dromaeosaurus_Restoration.png","page_title":"Észak-Amerika dinoszauruszainak listája","context_page_description":"Az alábbi dinoszaurusz lista olyan nemeket tartalmaz, amelyek Észak-Amerika területéről kerültek elő. Észak-Amerikában sokféle dinoszaurusz nagy mennyiségű fosszíliáját fedezték fel. Ez nem feltétlenül jelenti azt, hogy többféle vagy nagyobb számú dinoszaurusz élt ezen a területen; lehet hogy egyszerűen csak kedvezőbbek voltak a feltételek a fosszilis rekord számára.\\nA triász időszakban olyan dinoszauruszok éltek a kontinensen, mint a Coelophysis, a Chindesaurus, a Gojirasaurus és a Tawa. A Tawa fosszíliáit Dél-Amerikában is megtalálták, ami fontos ősföldrajzi utalás. A kora jura kor során Észak-Amerikában olyan dinoszauruszok éltek, mint a Dilophosaurus, az Anchisaurus, az Ammosaurus, a Syntarsus, valamint a korai thyreophora, a Scutellosaurus. Ezek közül az utóbbit az összes stegosaurus és ankylosaurus ősének tartják. Észak-Amerikában a középső jura kor maradványai csak hiányosan találhatók meg, Mexikóban azonban több lelőhely is ismert. Lábnyomok, tojáshéjak, fogak és csonttöredékek prezentálják a theropodákat, a sauropodákat és az ornithopodákat, de egyikük sem elég diagnosztikus a nemek meghatározásához.\\nAzonban a késő jura kori Észak-Amerika éppen a középső jura ellentéte."},{"page_url":"https://es.wikipedia.org/wiki/Mexicali","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/MexicaliMetroNight.jpg","page_title":"Mexicali","context_page_description":"Mexicali es una ciudad mexicana, capital del estado de Baja California y cabecera del municipio homónimo. Se encuentra localizada en el extremo noroeste del Valle de Mexicali en frontera con los Estados Unidos, en las coordenadas 32° 39' 48\\" de latitud norte lo que la coloca como la ciudad más septentrional de México y de América Latina.​\\nEn Mexicali se concentran las sedes de los Poderes Ejecutivo, Legislativo y Judicial del Gobierno del estado de Baja California, así como las oficinas estatales del Gobierno Federal y del Ayuntamiento de Mexicali. Fundada el 14 de marzo de 1903, es la capital, de entidad federativa, más joven de la república mexicana.​\\nSe destaca a nivel nacional por registrar, en verano, una de las temperaturas más altas en México, ​ así como ser de las ciudades con más bajo nivel de precipitación anual​ y una de las zonas más sísmicas de todo el país.​ Su PIB per Cápita es de $ 11 658, el más alto de todo Baja California y el segundo más alto del Noroeste de México, solo debajo de Los Cabos, Baja California Sur.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AB%E3%82%A4%E3%83%BB%E3%83%89%E3%83%90%E3%83%B3%E3%83%88%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Louis_Jean-Marie_Daubenton_-_Alexander_Roslin.jpg","page_title":"ルイ・ドバントン","context_page_description":"ルイ・ジャン＝マリー・ドバントンはフランスの博物学者である。ビュフォンの『博物誌』の執筆にかかわった。"},{"page_url":"https://de.wikipedia.org/wiki/Arabischer_Schneckenklee","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Medicago_arabica-002.jpg","page_title":"Arabischer Schneckenklee","context_page_description":"Der Arabische Schneckenklee, auch Gefleckter Schneckenklee genannt, ist eine Pflanzenart aus der Gattung Schneckenklee innerhalb der Familie der Hülsenfrüchtler. Ursprünglich im Mittelmeerraum beheimatet, ist diese Art inzwischen weltweit verbreitet."},{"page_url":"https://en.wikipedia.org/wiki/List_of_archaeological_sites_on_the_National_Register_of_Historic_Places_in_Illinois","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/New_Philadelphia_townsite.jpg","page_title":"List of archaeological sites on the National Register of Historic Places in Illinois","context_page_description":"This is a list of archaeological sites on the National Register of Historic Places in Illinois.\\nHistoric sites in the United States qualify to be listed on the National Register of Historic Places by passing one or more of four different criteria; Criterion D permits the inclusion of proven and potential archaeological sites. More than eighty different sites in Illinois are listed under this criterion, including both Native American and European sites. This list includes all properties in Illinois that qualify under this criterion."},{"page_url":"https://de.wikipedia.org/wiki/Rubik%E2%80%99s_Revenge","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Rubiks_revenge_scrambled.jpg","page_title":"Rubik’s Revenge","context_page_description":"Rubik’s Revenge oder auch Rubik’s Master Cube ist ein würfelförmiges Geduldsspiel. Es handelt sich um eine etwas größere und schwierigere Variante des Rubik’s Cube, ebenfalls mit sechs Farben, aber mit vier anstatt drei Ebenen in jeder Raumrichtung. Dadurch erhöht sich die Anzahl der Segmente auf jeder der sechs Seitenflächen von neun auf 4 × 4 = 16. Dabei wirkt es, als wäre die Oberfläche in 56 Würfelchen unterteilt, die mittels 90-Grad-Drehungen um die neun Drehachsen die Position zueinander verändern. So wie beim klassischen Rubik’s Cube ist es das Ziel, den Würfel aus einer ungeordneten Stellung heraus in seinen geordneten Grundzustand zu überführen, bei dem alle Segmente einer Seitenfläche die gleiche Farbe haben. Der Rubik’s Revenge hat im Vergleich zum Rubik’s Cube die zusätzliche Herausforderung, dass kein festes Mittelstück vorhanden ist."},{"page_url":"https://id.wikipedia.org/wiki/Bros","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/The_Childrens_Museum_of_Indianapolis_-_Hair_brooch.jpg","page_title":"Bros","context_page_description":"Bros adalah benda perhiasan dekoratif yang dirancang agar dapat terpasang disematkan ke pakaian atau media lain. Pada bagian belakang bros terdapat jarum dan kait seperti peniti untuk menyematkan perhiasan ini pada kain. Selain dikenakan pada pakaian, ada beberapa jenis bros yang berfungsi sebagai ikat atau hiasan rambut."},{"page_url":"https://zh.wikipedia.org/wiki/Tanhc%E5%87%BD%E6%95%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Tanhc%27%28z%29_Im_plot.JPG","page_title":"Tanhc函数","context_page_description":"Tanhc函数定义如下\\n复域虚部\\n复域实部\\n复域绝对值\\n一阶微商\\n微商实部\\n微商虚部\\n微商绝对值\\n积分函数"},{"page_url":"https://sv.wikipedia.org/wiki/Lou%C4%8De%C5%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Lou%C4%8De%C5%88_with_Lou%C4%8De%C5%88_Castle.jpg","page_title":"Loučeň","context_page_description":"Loučeň är en köping i Tjeckien. Den ligger i länet Mellersta Böhmen, i den centrala delen av landet, 50 km nordost om huvudstaden Prag. Loučeň ligger 256 meter över havet och antalet invånare är 1 082.\\nTerrängen runt Loučeň är huvudsakligen platt. Loučeň ligger uppe på en höjd. Den högsta punkten i närheten är 277 meter över havet, 1,5 km nordost om Loučeň. Runt Loučeň är det ganska tätbefolkat, med 70 invånare per kvadratkilometer. Närmaste större samhälle är Mladá Boleslav, 16,3 km nordväst om Loučeň. Trakten runt Loučeň består till största delen av jordbruksmark.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 8 °C. Den varmaste månaden är juli, då medeltemperaturen är 20 °C, och den kallaste är januari, med -7 °C."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B4%D0%BD%D0%BE%D1%81%D1%82%D0%BE%D1%80%D0%BE%D0%BD%D0%BD%D1%8F%D1%8F_%D1%84%D1%83%D0%BD%D0%BA%D1%86%D0%B8%D1%8F_%D1%81%D0%B6%D0%B0%D1%82%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Matyas-Meyer-Oseas_hash.svg","page_title":"Односторонняя функция сжатия","context_page_description":"Односторонняя функция сжатия в криптографии — функция, которая образует значение длиной на выходе при задании двух входных значений длиной. Одностороннее преобразование означает, что легко вычислить значение хеш-функции по прообразу, но трудно создать прообраз, значение хеш-функции которого равно заданной величине.\\nОдносторонняя функция сжатия используется, например, в структуре Меркла — Дамгора внутри криптографических хеш-функций.\\nОдносторонние функции сжатия часто построены из блочных шифров. Для того, чтобы превратить любой стандартный блочный шифр в одностороннюю функцию сжатия существуют схемы Дэвиса — Мейера, Матиса — Мейера — Осеаса, Миагути — Пренеля."},{"page_url":"https://tr.wikipedia.org/wiki/Rungholt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/UdlandeRungholt.png","page_title":"Rungholt","context_page_description":"Coordinates 54°28′N 8°43′E\uFEFF / \uFEFF54.467°N 8.717°E\uFEFF / 54.467; 8.717\\nRungholt, o zamanlar Danimarka Schleswig Dükalığı olan Nordfriesland'da bir yerleşim yeriydi. Bölge bugün Almanya'dadır .Rungholt'un 15 veya 16 Ocak 1362'de bir fırtına dalgası sahili vurduğunda Kuzey Denizi dalgalarının altında kaldığı bildirilmiştir."},{"page_url":"https://en.wikipedia.org/wiki/List_of_University_of_Edinburgh_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/ProfAdamFerguson.jpg","page_title":"List of University of Edinburgh people","context_page_description":"List of University of Edinburgh people is a list of notable graduates as well as non-graduate former students, academic staff, and university officials of the University of Edinburgh in Scotland. It also includes those who may be considered alumni by extension, having studied at institutions that later merged with the University of Edinburgh. The University is associated with 19 Nobel laureates, three Turing Award laureates, an Abel Prize winner and Fields Medalist, two Pulitzer Prize winners, and three UK Prime Ministers."},{"page_url":"https://pl.wikipedia.org/wiki/Bifobia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Social_Stigma_and_Discrimination_against_Bisexuals.jpg","page_title":"Bifobia","context_page_description":"Bifobia – różne formy negatywnego nastawienia względem osób biseksualnych jako jednostek oraz jako grupy społecznej. Może ono obejmować uprzedzenie, dyskryminację, stereotypy oraz nadużycia połączone z nastawieniami i uczuciami od pogardy do wrogości. Osoby o dowolnej orientacji seksualnej mogą doświadczać bifobii lub ją powielać."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%81%A3%E6%B5%81%E8%88%AA%E5%A4%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Gulfstream.g550.cs-dkf.climb.arp.jpg","page_title":"灣流航太","context_page_description":"湾流航天公司是制造公务喷气机的飞机制造厂，于1958年成立，总生产厂为于美国格鲁吉亚州沙瓦纳市，为通用动力的子公司。"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%BE%E8%8C%82%E7%94%BA%E7%B7%8F%E5%90%88%E4%BD%93%E8%82%B2%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Matsushige_Town_Gym.jpg","page_title":"松茂町総合体育館","context_page_description":"松茂町総合体育館 は、徳島県板野郡松茂町にあるメインアリーナ、サブアリーナの他、トレーニング室、会議室を備えている体育館である。"},{"page_url":"https://en.wikipedia.org/wiki/Pozna%C5%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Poznan_10-2013_img02_Raczynski_Library.jpg","page_title":"Poznań","context_page_description":"Poznań is a city on the Warta River in west-central Poland, in the Greater Poland region. It is best known for its renaissance Old Town and Ostrów Tumski Cathedral. Today, Poznań is an important cultural and business centre and one of Poland's most populous regions with many regional customs such as Saint John's Fair, traditional Saint Martin's croissants and a local dialect.\\nPoznań is the fifth-largest and one of the oldest cities in Poland. The city's population is 538,633, while the continuous conurbation with Poznań County and several other communities is inhabited by almost 1.1 million people. The Larger Poznań Metropolitan Area is inhabited by 1.3–1.4 million people and extends to such satellite towns as Nowy Tomyśl, Gniezno and Września, making it the fourth largest metropolitan area in Poland. It is the historical capital of the Greater Poland region and is currently the administrative capital of the province called Greater Poland Voivodeship.\\nPoznań is a center of trade, sports, education, technology and tourism. It is an important academic site, with about 130,000 students and Adam Mickiewicz University, the third largest Polish university."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D1%82%D0%B5%D0%BA%D0%BE%D0%B7%D0%B0%D1%80%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7c/Montecosaro.JPG","page_title":"Монтекозаро","context_page_description":"Монтеко̀заро е градче и община в Централна Италия, провинция Мачерата, регион Марке. Разположено е на 292 m надморска височина. Населението на общината е 6963 души."},{"page_url":"https://en.wikipedia.org/wiki/Viviana_Zocco","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Viviana_Zocco.jpg","page_title":"Viviana Zocco","context_page_description":"Viviana Zocco is an Argentine businesswoman, born in Buenos Aires, Argentina, in April 1962. She is founder and CEO of Grupo VI-DA and VI-DATEC, companies dedicated to technological development applied to culture, education and entertainment, with offices in Argentina, Mexico and the United States. Some of the most well-known companies belonging to Group VI-DA are: TICMAS, BajaLibros, InterCultural Division, GrandesLibros, Leamos, the entertainment platform TKM, 2 among others. Zocco is considered one of the most successful women entrepreneurs in Latin America. In 2016 she became Chapter Leader in Argentina of the international women's organization UPWARD Women"},{"page_url":"https://en.wikipedia.org/wiki/Bradford_Industrial_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/BIM1.jpg","page_title":"Bradford Industrial Museum","context_page_description":"Bradford Industrial Museum, established 1974 in Moorside Mills, Eccleshill, Bradford, United Kingdom, specializes in relics of local industry, especially printing and textile machinery, kept in working condition for regular demonstrations to the public. There is a Horse Emporium in the old canteen block plus a shop in the mill, and entry is free of charge."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A9%E1%83%90%E1%83%A0%E1%83%9A%E1%83%96_%E1%83%91%E1%83%94%E1%83%91%E1%83%98%E1%83%AF%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/CharlesBabbage.jpg","page_title":"ჩარლზ ბებიჯი","context_page_description":"ჩარლზ ბებიჯი — ინგლისელი მეცნიერი. ბებიჯმა, რომელიც აგრეთვე გამომგონებელი, ფილოსოფოსი, მათემატიკოსი და ინჟინერი იყო, პირველმა შეიმუშავა ციფრული პროგრამირებადი კომპიუტერის კონცეფცია. ამასთან, მისი წამოწყება წარუმატებელი იყო, ვინაიდან მანქანა ტექნიკურად ძალიან რთული აღმოჩნდა.\\n1834 წელს ბებიჯმა დაიწყო მუშაობა მანქანაზე, რომელიც „ანალიტიკური მექანიზმი“ უწოდა. მოწყობილობას ჰქონდა ცენტრალური პროცესორული მოწყობილობა, მეხსიერება და პერფობარათები, რომლებზეც პროგრამები იწერებოდა. ბებიჯის მანქანა ოცნიშნა რიცხვებზე ოპერირებდა."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B4%D0%B5%D0%BA%D0%B0%D0%B1%D1%80%D0%B8%D1%81%D1%82%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/86_portraits_of_Decembrists_199.jpg","page_title":"Список декабристов","context_page_description":"Высочайшим манифестом от 1 июня 1826 года был сформирован Верховный уголовный суд для суждения и вынесения приговора над участниками военного мятежа в декабре 1825 года в Санкт-Петербурге. Суд рассмотрел донесения следственной комиссии с подробными сведениями о каждом подсудимом и сформировал из своей среды ревизионную комиссию для проверки следствия и выяснения новых обстоятельств дела.\\nРевизионная комиссия, под руководством Сперанского, проверив деятельность следствия и рассмотрев дела всех подсудимых, выработала 11 разрядов преступлений и сделала предварительное разделение подсудимых по разрядам, поставив пятерых подсудимых, по тяжести вины, вне разрядов, и не определив разряды для четверых подсудимых, не признавших своей вины.\\nВерховный уголовный суд, после обсуждения выводов ревизионной комиссии, определил меру наказания для каждого разряда и несколько изменил разделение подсудимых по разрядам. В заключение своей деятельности суд постановил приговоры о каждом подсудимом, которые и были представлены на Высочайшее утверждение."},{"page_url":"https://uz.wikipedia.org/wiki/Ribagnac","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Map_commune_FR_insee_code_24351.png","page_title":"Ribagnac","context_page_description":"Ribagnac Fransiyaning Akvitaniya mintaqasida joylashgan kommunadir. Dordogne departamenti Bergerac tumani tarkibiga kiradi."},{"page_url":"https://de.wikipedia.org/wiki/Stra%C3%9Fenbahn_Cluj-Napoca","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Cluj-Napoca%2C_PESA_81%2C_2012.06.07.jpg","page_title":"Straßenbahn Cluj-Napoca","context_page_description":"Die Straßenbahn Cluj-Napoca ist das Straßenbahnsystem in der Stadt Cluj-Napoca in Siebenbürgen, Rumänien. Sie verkehrt seit 1987 und ist die Nachfolgerin einer Dampfstraßenbahn, deren Betrieb 1902 eingestellt wurde. Auf der 11,7 Kilometer langen normalspurigen Strecke verkehren drei Linien, die von der CTP betrieben werden. Seit dem Jahr 2012 werden auch moderne Niederflurbahnen eingesetzt."},{"page_url":"https://en.wikipedia.org/wiki/Bannwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Sebalder_Reichswald_Bannwald-Denkmal_001.JPG","page_title":"Bannwald","context_page_description":"Bannwald is a German word used in parts of Germany and Austria to designate an area of protected forest. Its precise meaning has varied by location and over time."},{"page_url":"https://nn.wikipedia.org/wiki/Fylkesveg_229_i_Hedmark","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/FV229_Strandlykkja_stasjon.jpg","page_title":"Fylkesveg 229 i Hedmark","context_page_description":"Fylkesveg 229 i Hedmark går mellom Tangen og fylkesgrensa i Stange kommune. Vegen er 14,8 km lang."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%8C%E3%82%B6%E3%83%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Chiloscyllium_punctatum_distmap.png","page_title":"イヌザメ","context_page_description":"イヌザメ Chiloscyllium punctatum は、テンジクザメ目テンジクザメ科に属するサメ。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_la_Haute-Garonne_(M-Z)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Ch%C3%A2teau_Bertier_-_2016-05-21.jpg","page_title":"Liste des monuments historiques de la Haute-Garonne (M-Z)","context_page_description":"Cet article recense une partie des monuments historiques de la Haute-Garonne, en France.\\nPour des raisons de taille, la liste est découpée en deux. Cette partie regroupe les communes débutant de M à Z. Pour les autres, voir la liste des monuments historiques de la Haute-Garonne."},{"page_url":"https://en.wikipedia.org/wiki/Cabinet_Erdo%C4%9Fan_IV","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Hulusi_Akar_%28cropped%2C_2019%29.jpg","page_title":"Cabinet Erdoğan IV","context_page_description":"The Fourth Erdoğan Cabinet is the 66th government of the Republic of Turkey, which was declared on 9 July 2018. It is the first cabinet after Turkey's transition into presidential republic. It was also the first cabinet that did not require parliamentary approval to be formed."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%90%D7%99%D7%99%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Coat_of_arms_of_French_Guyana.svg","page_title":"קאיין","context_page_description":"קָאיֶין היא עיר הבירה של גיאנה הצרפתית, מחוז מעבר לים של צרפת.\\nקאיין נוסדה ב-1664, 21 שנה לאחר הכיבוש הצרפתי של האזור. העיר הייתה תחת שלטונן של הולנד, בריטניה וברזיל לפני שחזרה לשלטון צרפת. העיר שימשה כמושבת עונשין מ-1854 עד 1938.\\nשטח השיפוט של קאיין הוא כ-23.6 קמ\\"ר ובשנת 2015 התגוררו בה כ-57,614 תושבים. היא ממוקמת על חצי אי בין הנהרות Cayenne ו Mabury. מזג האוויר הוא טרופי, חם ולח לאורך כל השנה.\\nהאתרים המעניינים בקאיין הם:\\nכיכר גרנובל, שבה נמצאים בית העירייה, משרד הדואר והנציבות הצרפתית.\\nכיכר התמרים - מרכז הרובע המסחרי.\\nכיכר ויקטור שלכר - על שם האחראי להפסקת העבדות במושבה.\\nכיכר התרנגול - שוק המוצרים המרכזי.\\nהמוזיאון המרכזי - מציג שילוב של טבע, היסטוריה, ארכאולוגיה ומידע לגבי מושבות העונשין.\\nהגנים הבוטניים - מציג את מבחר הבוטניקה והצומח של האזור."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A3%BC%ED%99%8D%EC%83%89_%EC%97%B0%EA%B5%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/FristonStudyinScarlet1.jpg","page_title":"주홍색 연구","context_page_description":"《주홍색 연구》 는, 아서 코난 도일의 소설이다. 셜록 홈즈가 나오는 셜록 홈즈 시리즈의 첫 작품이다. 홈즈와 왓슨의 만남과, 그 후에 일어난 살인 사건을 그리고 있다.\\n이 책이 발간될 당시만 해도, 주홍색 연구의 소설 원고가 여러 출판사에 보내졌으나 모두 거절당했다. '비튼의 크리스마스 연감' 1887년 특집호에 발표되었으나, 역시 큰 인기를 끌지는 못했다.\\n이후 1890년, 아서 코난 도일은 주홍색 연구에 이어 네 개의 서명을 발표한다."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1946","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Mensje_van_Keulen.jpg","page_title":"Lijst van personen geboren in 1946","context_page_description":"Dit is een lijst van personen die geboren zijn in 1946.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Northern_storm_petrel","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Oceanodroma_furcata1.jpg","page_title":"Northern storm petrel","context_page_description":"Northern storm petrels are seabirds in the family Hydrobatidae, part of the order Procellariiformes. The family was once lumped with the similar austral storm petrels in the combined storm petrels, but have been split, as they were not closely related. These smallest of seabirds feed on planktonic crustaceans and small fish picked from the surface, typically while hovering. Their flight is fluttering and sometimes bat-like.\\nThe northern storm petrels are found in the Northern Hemisphere, although some species around the Equator dip into the south. They are strictly pelagic, coming to land only when breeding. In the case of most species, little is known of their behaviour and distribution at sea, where they can be hard to find and harder to identify. They are colonial nesters, displaying strong philopatry to their natal colonies and nesting sites. Most species nest in crevices or burrows, and all but one species attend the breeding colonies nocturnally. Pairs form long-term, monogamous bonds and share incubation and chick-feeding duties. Like many species of seabirds, nesting is highly protracted, with incubation taking up to 50 days and fledging another 70 days after that."},{"page_url":"https://fy.wikipedia.org/wiki/Reedriden_op_de_Olympyske_Winterspullen_1952","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Bislett_stadion1.jpg","page_title":"Reedriden op de Olympyske Winterspullen 1952","context_page_description":"De Olympyske Winterspullen 1952, ek wol de VIe Olympiade neamd, waarden yn 1952 yn Oslo, Noarwegen hâlden. Dat wie fan 14 oant en mei 25 febrewaris. It Reedriden hie plak yn it Bislett stadion"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Mozoncillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/RODELGA.JPG","page_title":"Mozoncillo","context_page_description":"Mozoncillo sī tī Se-pan-gâ Castilla kap León chū-tī siā-lí Segovia séng ê chi̍t ê municipio."},{"page_url":"https://en.wikipedia.org/wiki/Streptonigrin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Streptonigrin.png","page_title":"Streptonigrin","context_page_description":"Streptonigrin is an aminoquinone antitumor and antibacterial antibiotic produced by Streptomyces flocculus.\\nStreptonigrin was a successful target of Total synthesis in 2011."},{"page_url":"https://pt.wikipedia.org/wiki/Anghel_Iord%C4%83nescu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Anghel_Iord%C4%83nescu.jpg","page_title":"Anghel Iordănescu","context_page_description":"Anghel Iordănescu é um ex-futebolista, treinador de futebol e político romeno que atuava como atacante."},{"page_url":"https://en.wikipedia.org/wiki/Thomas%27s_shaggy_bat","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Thomas%27s_Shaggy_Bat_area.png","page_title":"Thomas's shaggy bat","context_page_description":"The Thomas's shaggy bat is a bat species from South America. It was previously included in the shaggy bat but Simmons and Handley showed that the species were distinct."},{"page_url":"https://et.wikipedia.org/wiki/Rietavase_omavalitsus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Tveru_seniunija%2C_2007-06-12.jpg","page_title":"Rietavase omavalitsus","context_page_description":"Rietavase omavalitsus on 2. järgu haldusüksus Leedus endise Telšiai maakonna aladel.\\nOmavalitsuse pindala on 586 km². 2014. aasta seisuga elas seal 8264 inimest.\\nOmavalitsus moodustati 1999. aastal. See koosneb järgmistest valdadest: Daugėdai, Medingėnai, Rietavase ja Tverai vald. Eraldi administratiivüksuse moodustab veel Rietavase linn.\\nHalduskeskus on Rietavase linn. Teine suurem asula on Tverai alev. 2011. aasta seisuga olid elanikest 98,42% leedulased, 0,36% venelased, 0,14% ukrainlased ja 1,08% oli teistest rahvustest.\\nOmavalitsuse suurimaks jõeks on Jūra."},{"page_url":"https://cy.wikipedia.org/wiki/Lisbon,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Mark_Hanna_by_WJ_Root%2C_1896_cropped.jpg","page_title":"Lisbon, Ohio","context_page_description":"Pentrefi yn Columbiana County, yn nhalaith Ohio, Unol Daleithiau America yw Lisbon, Ohio. ac fe'i sefydlwyd ym 1805."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%87%D9%86%D8%AF%D8%B3%D8%A9_%D8%A7%D9%84%D9%85%D8%B9%D9%85%D8%A7%D8%B1%D9%8A%D8%A9_%D9%84%D8%AD%D8%B6%D8%A7%D8%B1%D8%A9_%D8%A7%D9%84%D8%A5%D9%86%D9%83%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Inca_bath-tr.png","page_title":"الهندسة المعمارية لحضارة الإنكا","context_page_description":"أُسّست الهندسة المعمارية لحضارة الانكا على ثلاثة مفاهيم رئيسة وهي الحساسية و الفائدة و البساطة، كما كان \\"القليل هو الكثير \\" هو مبدأ المفهوم الاساسى للهندسة المعمارية لحضارة الانكا.\\nإن شكل شبه المنحرف المتساوى الساقين هو أكثر الاشكال البسطية المهيمنة على الهندسة المعمارية لحضارة الانكا والذي أستُخدم بشكل أنيق ورائع، فالمحاريب على الابواب والنوافذ والجدران الموجودة في شكل شبه المنحرف المتساوى الساقين تظهر في أبنية الانكا بكافة أنواعها كما يُستخدم المزيد من هذا الشكل في كل مكان لم يتأثر بالفائدة.\\nالمياه ويقصد بها المزاريب المسكوبة بخرير و زبد كانت أحيانا تُزيّن بالاحجار المشابهة للزينة المزخرفة وأحيانا وعلى الرغم من كونها غير ضرورية فانها كانت ترتبط بأحواض الاستحمام أو بعناصر لاحقة للقنوات الصخرية المعقّدة.\\nومن الوقت للاخر سيكون من الممكن أن يُطلق على صنبور أخر من الصنابير أمر غير ضرورى الا إنه كانت تُنشأ الشلالات و الزخارف لإضفاء ديكور جميل و أنيق.\\nتناول الانكا شكل الماء وهيئته كعنصر تصميم معمارى كما استمتعوا بإظهار كافة مهاراتهم على اعلى مستوى على هذا السائل المعروف بمصدر الحياة."},{"page_url":"https://en.wikipedia.org/wiki/2018_Paris_ePrix","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/H%C3%B4tel_des_Invalides%2C_North_View%2C_Paris_7e_140402_1.jpg","page_title":"2018 Paris ePrix","context_page_description":"The 2018 Paris ePrix was a Formula E electric car race held before a crowd of 48,000 spectators at the Circuit des Invalides in the Les Invalides building complex on 28 April 2018. It was the eighth race of the 2017–18 Formula E season and the third edition of the event. The 49-lap race was won by Techeetah driver Jean-Éric Vergne from pole position. Audi's Lucas di Grassi finished second and Virgin driver Sam Bird was third.\\nVergne won the pole position by recording the fastest lap in qualifying and maintained the lead for the next 23 laps as Bird had more electrical energy available. This allowed Bird to shorten Vergne's lead and unsuccessfully tried to overtake him. Through the pit stop phase to get into a second car, di Grassi took the lead for two laps after conserving electrical energy. Edoardo Mortara led the following lap before Vergne retook the position after the pit stops. Vergne was unchallenged for the final third of the race and took his third victory of the season after his teammate André Lotterer battled Bird and di Grassi."},{"page_url":"https://nl.wikipedia.org/wiki/Ezatollah_Sahabi","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Sahabi1.jpg","page_title":"Ezatollah Sahabi","context_page_description":"Ezatollah Sahabi was een Iraans activist, humanist en politicus. Zijn vader, Yadollah Sahabi, speelde een belangrijke rol tijdens de Iraanse Revolutie in 1979.\\nSahabi werd aangewezen tot lid van de Raad voor de Islamitische Revolutie op 12 februari 1979. In 1980 volgde hierop zijn verkiezing als lid van de Majlis van Iran, het wetgevende orgaan in Iran. Hij was vooral bekend als leider van de Nationalistisch-Religieuze beweging.\\nOp 1 mei 2011 geraakte Sahabi in een coma. Op 31 mei overleed hij aan de gevolgen hiervan op 81-jarige leeftijd."},{"page_url":"https://an.wikipedia.org/wiki/St_Peter%27s_College_(Auckland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/St_Peter%27s_College%2C_Auckland%3B_Bro_O%27Driscoll_Building.JPG","page_title":"St Peter's College (Auckland)","context_page_description":"A St Peter's College ye una escuela catolica d'amostranza secondaria masculina d'a ciudat neozelandesa d'Auckland. Ye a escuela catolica más gran de Nueva Zelanda. Imparte clases de 7ᵉⁿᵒ dica 13ᵉⁿᵒ grau y fue establita en 1939 por uno d'os més conoixitos bispes d'Auckland, James Michael Liston."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Buch_(Hunsr%C3%BCck)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/M%C3%B6rz_Grabkreuze.JPG","page_title":"Liste der Kulturdenkmäler in Buch (Hunsrück)","context_page_description":"In der Liste der Kulturdenkmäler in Buch sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Buch einschließlich des Ortsteils Mörz aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://de.wikipedia.org/wiki/Adler_Mannheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Mannheim-Friedrichspark.jpg","page_title":"Adler Mannheim","context_page_description":"Die Adler Mannheim sind eine deutsche Eishockeymannschaft aus Mannheim, die seit 1994 und damit als Gründungsmitglied in der Deutschen Eishockey Liga spielt. Die Profimannschaft wurde 1994 als GmbH vom 1938 gegründeten Mannheimer ERC ausgelagert, der Stammverein ist noch heute für den Amateur-, Frauen- und Nachwuchsbereich verantwortlich. Eigentümer der Spielbetriebsgesellschaft ist Daniel Hopp.\\nInsgesamt gewann der Club, der seine Heimspiele seit 2005 in der 13.600 Zuschauer fassenden SAP Arena austrägt, acht deutsche Meisterschaften, davon sieben seit Gründung der DEL. Damit sind die Adler zusammen mit den Eisbären Berlin Rekordmeister der DEL. Die Vereinsfarben der Adler Mannheim sind die Mannheimer Stadtfarben blau, weiß, rot."},{"page_url":"https://es.wikipedia.org/wiki/Juan_Roig_y_Soler","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Estaci%C3%B3_de_ferrocarril.jpg","page_title":"Juan Roig y Soler","context_page_description":"Juan Roig y Soler​ fue un pintor español, miembro de la Escuela luminista de Sitges."},{"page_url":"https://en.wikipedia.org/wiki/Yucca","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Yucca_distribution_capsular_fruited_species_I_southwest%2Cmidwest_USA%2C_Mexico_Baja_California%2C_Canada_overview_I_B.jpg","page_title":"Yucca","context_page_description":"Yucca is a genus of perennial shrubs and trees in the family Asparagaceae, subfamily Agavoideae. Its 40–50 species are notable for their rosettes of evergreen, tough, sword-shaped leaves and large terminal panicles of white or whitish flowers. They are native to the hot and dry parts of the Americas and the Caribbean.\\nEarly reports of the species were confused with the cassava. Consequently, Linnaeus mistakenly derived the generic name from the Taíno word for the latter, yuca."},{"page_url":"https://de.wikipedia.org/wiki/Rudolf_Eucken","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/G%C3%B6ttingen-Weende%2C_road_sign_Rudolf-Eucken-Weg.jpg","page_title":"Rudolf Eucken","context_page_description":"Rudolf Christoph Eucken war ein deutscher Philosoph. 1908 erhielt er den Nobelpreis für Literatur."},{"page_url":"https://it.wikipedia.org/wiki/Montmirail_(Sarthe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Ch%C3%A2teau_de_Montmirail_%28Sarthe%29.jpg","page_title":"Montmirail (Sarthe)","context_page_description":"Montmirail è un comune francese di 411 abitanti situato nel dipartimento della Sarthe nella regione dei Paesi della Loira.\\nDiede i natali al pittore Maurice Loutreuil"},{"page_url":"https://ca.wikipedia.org/wiki/R%C3%B6derland","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Saathain%2C_Brandenburg%2C_Germany_-_panoramio.jpg","page_title":"Röderland","context_page_description":"Röderland és un municipi alemany que pertany a l'estat de Brandenburg. Està creuat pels rius Schwarze Elster i Große Röder, i està format per les comunitats de Haida, Prösen, Reichenhain, Saathain, Stolzenhain, Würdenhain i Wainsdorf."},{"page_url":"https://de.wikipedia.org/wiki/Karl-Henning_Seemann","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Wiki_2013-08-15.jpg","page_title":"Karl-Henning Seemann","context_page_description":"Karl-Henning Seemann ist ein deutscher Bildhauer und Zeichner, der insbesondere durch seine Skulpturen und Brunnen im öffentlichen Raum bekannt wurde."},{"page_url":"https://en.wikipedia.org/wiki/Commander-in-Chief_of_Defence_Services","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Senior_General_Min_Aung_Hlaing_2017_%28cropped%29.jpg","page_title":"Commander-in-Chief of Defence Services","context_page_description":"The Commander-in-Chief of Defence Services is the commanding officer of the Tatmadaw, the armed forces of Myanmar."},{"page_url":"https://fr.wikipedia.org/wiki/Thames_(Nouvelle-Z%C3%A9lande)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Junction_Hotel.jpg","page_title":"Thames (Nouvelle-Zélande)","context_page_description":"Thames est une ville au sud-ouest de la péninsule Coromandel dans l'île du Nord en Nouvelle-Zélande.\\nElle est située sur la \\"Firth of Thames \\" fermée par l'embouchure de la rivière Waihou. La ville est le siège du district de Thames-Coromandel.\\nLa ville a vu le jour lors d'une ruée vers l'or et sa population a atteint le chiffre de 18 000 habitants en 1868. Aujourd'hui, elle avoisine le chiffre de 8 500 habitants."},{"page_url":"https://nl.wikipedia.org/wiki/H%C3%A9b%C3%A9court_(Eure)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Map_commune_FR_insee_code_27324.png","page_title":"Hébécourt (Eure)","context_page_description":"Hébécourt is een gemeente in het Franse departement Eure en telt 560 inwoners. De plaats maakt deel uit van het arrondissement Les Andelys."},{"page_url":"https://it.wikipedia.org/wiki/Basilica_di_Santa_Maria_(Cracovia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/St._Mary%27s_church_Krakow.JPG","page_title":"Basilica di Santa Maria (Cracovia)","context_page_description":"La chiesa di Santa Maria è un'imponente chiesa che sorge nel centro storico di Cracovia, seconda per importanza solo alla Cattedrale del Wawel. È basilica minore dal 1962."},{"page_url":"https://de.wikipedia.org/wiki/Roye_(Haute-Sa%C3%B4ne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Roye%2C_Mairie.jpg","page_title":"Roye (Haute-Saône)","context_page_description":"Roye ist eine Gemeinde im französischen Département Haute-Saône in der Region Bourgogne-Franche-Comté."},{"page_url":"https://el.wikipedia.org/wiki/%CE%92%CF%81%CE%B5%CF%84%CE%B1%CE%BD%CE%B9%CE%BA%CE%AE_%CE%91%CE%BD%CE%B1%CF%84%CE%BF%CE%BB%CE%B9%CE%BA%CE%AE_%CE%91%CF%86%CF%81%CE%B9%CE%BA%CE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Zanzibar_Katamaran-5r.jpg","page_title":"Βρετανική Ανατολική Αφρική","context_page_description":"Το Προτεκτοράτο της Ανατολικής Αφρικής, επίσης ευρύτερα γνωστό και ως η Βρετανική Ανατολική Αφρική, ήταν η περιοχή εντός των Αφρικανικών Μεγάλων Λιμνών, η οποία καταλάμβανε προχείρως την ίδια εδαφική έκταση όσο και η σημερινή Κένυα"},{"page_url":"https://war.wikipedia.org/wiki/Leionema_rotundifolium","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Leionema_rotundifolium.jpg","page_title":"Leionema rotundifolium","context_page_description":"An Leionema rotundifolium in uska species han Magnoliopsida nga syahan ginhulagway ni Stephan Ladislaus Endlicher, ngan ginhatag han pagkayana nga asya nga ngaran ni Paul G. Wilson. An Leionema rotundifolium in nahilalakip ha genus nga Leionema, ngan familia nga Rutaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://af.wikipedia.org/wiki/Hibernasie","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Hibernating_Turtles.JPG","page_title":"Hibernasie","context_page_description":"Die oorgrote meerderheid van die ongewerwelde diere, koudbloedige werweldiere, asook baie soogdiere, raak onaktief of gaan in ŉ diep slaap gedurende ongunstige seisoene. Wanneer die prikkel om te slaap koue is, praat ons van hibernasie en wanneer die prikkel droogte is, gaan die diere in ŉ estivasie.\\nOmdat ons in Suid-Afrika nie sulke strawwe winters het soos in ander dele van die wêreld nie, het ons nie diere wat werklik hiberneer nie. Baie koudbloedige diere soos slange en akkedisse raak egter onaktief in die winter en dit is die rede waarom hulle dan nie gesien word nie. Ons heg egter heelwat diere wat in ŉ droogteslaap gaan, soos landslakke, sekere vissoorte, paddas en selfs soogdiere soos die goue mol en die erdvark.\\nSkaarste aan voedsel is ŉ groter gevaar vir warmbloedige diere as koue, en die winterslaap is ŉ maniere waarop die natuur verseker dat die diere wat nie in staat is om in die winter voedsel te kry nie, oorleef. Party soogdiere – die sogenaamde ware winterslapers – ondergaan egter groot veranderinge in hul liggaamstoestand tydens die periode van winterslaap."},{"page_url":"https://it.wikipedia.org/wiki/Predella_di_Quarate","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Predella_di_quarate%2C_san_giovanni_a_patmos.jpg","page_title":"Predella di Quarate","context_page_description":"La Predella di Quarate è un dipinto a tempera e oro su tavola di Paolo Uccello, databile al 1433-1434 circa e conservato nel Museo diocesano di Santo Stefano al Ponte a Firenze."},{"page_url":"https://de.wikipedia.org/wiki/Rheinhafen_Krefeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Wendebecken_Krefeld.jpg","page_title":"Rheinhafen Krefeld","context_page_description":"Der Rheinhafen Krefeld ist ein Binnenhafen am linken Ufer des Niederrheins. Er wurde am 6. Juli 1906 eingeweiht und wird von der Hafen Krefeld GmbH & Co. KG betrieben.\\nDie Einfahrt zum Hafenbecken liegt genau unter der Krefeld-Uerdinger Brücke.\\n2019 wurden mehr als 5,5 Millionen Tonnen umgeschlagen. Damit ist er der viertgrößte öffentliche Binnenhafen in Nordrhein-Westfalen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_des_Bayerischen_Landtags_(18._Wahlperiode)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Arif_Tasdelen_5857a.jpg","page_title":"Liste der Mitglieder des Bayerischen Landtags (18. Wahlperiode)","context_page_description":"Die Liste gibt einen Überblick über die Mitglieder des Bayerischen Landtags in der 18. Wahlperiode. Diese wurden bei der Landtagswahl in Bayern 2018 am 14. Oktober 2018 gewählt."},{"page_url":"https://lv.wikipedia.org/wiki/Auces_novads","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Auces_hipodroms_2.jpg","page_title":"Auces novads","context_page_description":"Auces novads ir pašvaldība Zemgalē. Robežojas ar Saldus, Brocēnu, Dobeles un Tērvetes novadiem, kā arī Lietuvas Šauļu apriņķi. Novadā apvienoti bijušā Dobeles rajona Auces pilsēta un Vecauces, Bēnes, Īles, Lielauces, Ukru un Vītiņu pagasti."},{"page_url":"https://fr.wikipedia.org/wiki/C%C3%A9cile_Neville","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Red_crown.png","page_title":"Cécile Neville","context_page_description":"Cécile Neville fut l'épouse de Richard d'York, duc d'York. Fille de Jeanne Beaufort et de Ralph Neville elle était petite-fille de Jean de Gand, lui-même fils d'Édouard III. Elle fut la mère des rois Édouard IV et Richard III."},{"page_url":"https://it.wikipedia.org/wiki/Armoriale_delle_famiglie_italiane_(Rob-Ror)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Rodolfo_Armoriale.jpg","page_title":"Armoriale delle famiglie italiane (Rob-Ror)","context_page_description":"Questo è l'armoriale delle famiglie italiane il cui cognome inizia con le lettere che vanno da Rob a Ror."},{"page_url":"https://en.wikipedia.org/wiki/William_Lawranson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Ann_Catley_Dunkarton.jpg","page_title":"William Lawranson","context_page_description":"William Lawranson or Lawrenson was an English painter and engraver."},{"page_url":"https://de.wikipedia.org/wiki/Esteban_Daza","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/El_Parnaso.jpg","page_title":"Esteban Daza","context_page_description":"Esteban Daza war ein spanischer Vihuelist und Komponist der Renaissance."},{"page_url":"https://fr.wikipedia.org/wiki/Thevet-Saint-Julien","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Thevet-Saint-Julien_%2836%29_-_Salle_des_f%C3%AAtes.jpg","page_title":"Thevet-Saint-Julien","context_page_description":"Thevet-Saint-Julien est une commune française située dans le département de l'Indre, en région Centre-Val de Loire."},{"page_url":"https://fr.wikipedia.org/wiki/Environnement_au_Vi%C3%AAt_Nam","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Rizi%C3%A8re_dans_la_baie_d%27Halong_int%C3%A9rieure.JPG","page_title":"Environnement au Viêt Nam","context_page_description":"L'environnement au Viêt Nam est l'environnement du pays Viêt Nam, pays d'Asie."},{"page_url":"https://en.wikipedia.org/wiki/Museum_Het_Leids_Wevershuis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Wevershuisje_Leiden_-_achterhuis_en_waterput.jpg","page_title":"Museum Het Leids Wevershuis","context_page_description":"Museum Het Leids Wevershuis consists of one of the last remaining \\"weavers' homes\\" in Leiden, Netherlands. The exterior, the large antique loom and the interior, are testimony of the once flourishing textile industry around Leiden, in particular during the 16th and 17th century, when many home weavers supplied the draper's guild with high quality woolen cloth."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%A8%D7%91_%D7%93%D7%95-%D7%99%D7%93%D7%A0%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/ML_-_Bih%C3%A4nder.jpg","page_title":"חרב דו-ידנית","context_page_description":"חרב דו-ידנית או חרב ארוכה היא סוג של חרב בעלת להב וניצב ארוכים, שהונפה בשתי הידיים, והייתה בשימוש בעיקר על ידי אבירים ובני-אצולה באירופה במאה ה-14 עד המאה ה-16, בסוף ימי הביניים ובראשית תקופת הרנסאנס."},{"page_url":"https://es.wikipedia.org/wiki/Breda-SAFAT","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/12.7mmBreda-SAFAT.jpg","page_title":"Breda-SAFAT","context_page_description":"La Breda-SAFAT fue una ametralladora italiana diseñada por la empresa del mismo nombre, que produjo una gama de ametralladoras y cañones automáticos para aviones. Basada en la Browning M1919, esta ametralladora fue calibrada para municiones locales de 7,70 mm y 12,7 mm, principalmente balas trazadoras de 7,70 mm y balas trazadoras incendiarias explosivas o antiblindaje de 12,7 mm."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A7%D8%A6%D8%AD%D8%A9_%D9%81%D9%8A%D8%B1%D9%88%D8%B3_%D9%83%D9%88%D8%B1%D9%88%D9%86%D8%A7_%D9%81%D9%8A_%D9%83%D9%88%D8%B3%D8%AA%D8%A7%D8%B1%D9%8A%D9%83%D8%A7_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Bandera_de_Aserr%C3%AD.png","page_title":"جائحة فيروس كورونا في كوستاريكا 2020","context_page_description":"الأحداث الواردة في هذه المقالة هي أحداث جارية وقد تكون عرضة لتغيرات سريعة وكبيرة. فضلًا، حدِّث المحتوى ليشمل أحدث المعلومات الموثوقة المعروفة عن موضوع المقالة.\\nتوثق هذه المقالة آثار جائحة فيروس كورونا 2019-2020 في كوستاريكا، وقد لا تتضمن جميع الاستجابات والتدابير والإجراءات الرئيسية حتى الآن.\\nتأكد انتشار الجائحة إلى كوستاريكا في 6 مارس 2020 عندما أثبتت إصابة سائح أمريكي من نيويورك بالإصابة بالفيروس."},{"page_url":"https://en.wikipedia.org/wiki/Jakub_Yunis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Jakub_Yunis_Sigma-Fastav_15112018_%285%29.jpg","page_title":"Jakub Yunis","context_page_description":"Jakub Yunis is a professional Czech football forward currently playing for SK Sigma Olomouc in the Czech First League.\\nSigma Olomouc coach Václav Jílek described him as a natural defensive forward. He made his league debut in Sigma's Czech National Football League 5–1 loss at Třinec on 1 August 2015. He made his first starting 11 appearance in October 2016, scoring two goals in a 2–1 comeback win at Vítkovice.\\nIn September 2015, he scored the winning goal in Czech Republic Under-20 national team's 1–0 victory against England."},{"page_url":"https://sv.wikipedia.org/wiki/Calamaria_borneensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Calamaria_borneensis_distribution.png","page_title":"Calamaria borneensis","context_page_description":"Calamaria borneensis är en ormart som beskrevs av Bleeker 1860. Calamaria borneensis ingår i släktet Calamaria och familjen snokar. IUCN kategoriserar arten globalt som livskraftig. Inga underarter finns listade.\\nArten förekommer på norra Borneo. Honor lägger ägg."},{"page_url":"https://it.wikipedia.org/wiki/Oxylabes_madagascariensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/OxylabesMadagascariensisSmit.jpg","page_title":"Oxylabes madagascariensis","context_page_description":"Il garrulo del Madagascar o garrulo malgascio, noto anche come ossilabe golabianca è un uccello passeriforme della famiglia Bernieridae, nell'ambito dei quali rappresenta l'unica specie ascritta al genere Oxylabes Sharpe, 1870."},{"page_url":"https://fi.wikipedia.org/wiki/Paratiisikolibri","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Loddigesia_mirabilis_%2B_Aechmea_mucroniflora_-_Gould_Troch._pl._161.jpg","page_title":"Paratiisikolibri","context_page_description":"Paratiisikolibri on Perun kotoperäinen kiitäjälintu. Se on sukunsa ainoa laji. Se elää maan pohjoisosan Utcubambajoen itäpuolella Amazonasissa. Jules Bourcier kuvaili lajin holotyypin Chachapoyasista vuonna 1847."},{"page_url":"https://de.wikipedia.org/wiki/Jagdschloss_Baum","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/Schloss_baum_1.jpg","page_title":"Jagdschloss Baum","context_page_description":"Das ehemalige Jagdschloss Baum ist ein kleines Schloss in der Nähe von Bückeburg. Es liegt an der Straße nach Lahde im Schaumburger Wald und gehört noch heute dem Haus Schaumburg-Lippe."},{"page_url":"https://hu.wikipedia.org/wiki/Neuler","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Neuler_Kirche.jpg","page_title":"Neuler","context_page_description":"Neuler település Németországban, azon belül Baden-Württembergben. Lakosainak száma 3177 fő. +/-"},{"page_url":"https://de.wikipedia.org/wiki/Gro%C3%9Fe_Moschee_von_Algier","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Photo_grande_mosquee_30112016.jpg","page_title":"Große Moschee von Algier","context_page_description":"Die Große Moschee von Algier ist eine 2019 fertiggestellte Moschee in der algerischen Hauptstadt Algier. Nach den beiden islamischen Pilgerstätten Mekka und Medina ist sie die drittgrößte Moschee der Welt. Die Fertigstellung war zunächst für 2015 geplant, verschob sich aber seitdem aber immer wieder. In Algerien selbst gilt sie vielen Gläubigen als Prestigeprojekt des Präsidenten Abd al-Aziz Bouteflika, der mit dem monumentalen Projekt von den sozialen und politischen Problemen Algeriens ablenken wolle. Der Bau wurde durch China finanziell unterstützt."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%84%D8%B3%D8%B7%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/The_Middle_East_in_2010.png","page_title":"فلسطین","context_page_description":"فلسطین به‌صورت تاریخی و از دوران روم باستان به ناحیه‌ای گفته می‌شده که بین دریای مدیترانه و کرانه‌های رود اردن واقع شده‌است.\\nفلسطین در دوران‌های حتی قدیمی تر به ناحیه‌ای محدود تر در کنار مرز دریای مدیترانه اطلاق می‌شد. در معنی جغرافیایی گسترده‌تر آن فلسطین می‌تواند به منطقه‌ای اشاره کند که شامل مناطق اسرائیلی و فلسطینی، بخش‌هایی از اردن، لبنان و سوریه باشد. فلسطین همچنین می‌تواند به ناحیه‌ای که در ابتدای قرن بیستم تحت قیومیت بریتانیا پس از شکست امپراتوری عثمانی در جنگ جهانی اول درآمد باشد. فلسطین همچنین ممکن است به کشور فلسطین که توسط السلطة الوطنیة الفلسطینیة اعلام شده و توسط بیش از صد کشور به رسمیت شناخته می‌شود اطلاق شود. سایر نام‌های استفاده شده جهت اشاره به این کشور عبارتند از: سرزمین مقدس،"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Hamburg-Altona-Altstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Kirchhof_St._Pauli_%28Hamburg-Altona-Altstadt%29.2.ajb.jpg","page_title":"Liste der Kulturdenkmäler in Hamburg-Altona-Altstadt","context_page_description":"Die Liste der Kulturdenkmäler in Hamburg-Altona-Altstadt enthält die in der Denkmalliste ausgewiesenen Denkmäler auf dem Gebiet des Stadtteils Altona-Altstadt der Freien und Hansestadt Hamburg.\\nBasis ist der Datensatz Denkmalliste Hamburg auf dem Transparenzportal Hamburg. Dieser enthält alle Objekte, die rechtskräftig nach dem Hamburger Denkmalschutzgesetz vom 5. April 2013 unter Denkmalschutz stehen oder zumindest zeitweise standen. Die Denkmalliste steht auch als PDF-Dokument zur Verfügung. Alle Denkmäler in Altona-Altstadt, die schon nach dem Denkmalschutzgesetz vom 3. Dezember 1973, zuletzt geändert am 27. November 2007, unter Denkmalschutz standen, sind auch auf der Liste der Kulturdenkmäler im Hamburger Bezirk Altona zu finden."},{"page_url":"https://fr.wikipedia.org/wiki/Figure_(carte_%C3%A0_jouer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/FrenchRevolutionaryCardDeck.jpg","page_title":"Figure (carte à jouer)","context_page_description":"Une figure ou tête est une carte à jouer qui représente une personne."},{"page_url":"https://en.wikipedia.org/wiki/Conus_antoniomonteiroi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Conus_antoniomonteiroi_1.jpg","page_title":"Conus antoniomonteiroi","context_page_description":"Conus antoniomonteiroi is a species of sea snail, a marine gastropod mollusk in the family Conidae, the cone snails and their allies.\\nLike all species within the genus Conus, these snails are predatory and venomous. They are capable of \\"stinging\\" humans, therefore live ones should be handled carefully or not at all."},{"page_url":"https://fr.wikipedia.org/wiki/Patrimoine_architectural_d%27Angers","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/La_maison_d%27Adam_%28Angers%29_%2815128072336%29.jpg","page_title":"Patrimoine architectural d'Angers","context_page_description":"Angers compte 2 892 sites inscrits à l’inventaire général du patrimoine culturel et 100 monuments répertoriés à l'inventaire des monuments historiques, parmi lesquels 69 % de bâtiments civils et 21 % d’édifices religieux. Environ 41 % de ces bâtiments sont du Moyen Âge, 36 % de l'époque moderne, 18 % du XIXᵉ siècle et 3 % seulement du XXᵉ siècle. La ville est par ailleurs labellisée Ville d’Art et d’Histoire.\\n« Du chemin de ronde du château, on voit s'étaler la ville, si caractéristique avec ses cheminées de briques sur le fond bleu des toits, la ville qui mêle maintenant au matériau le plus tendre, le tuffeau, l'un des plus résistants, le schiste. »\\n— Armand Lanoux, Le voyageur de la Loire, 1965\\nDes monuments médiévaux en schiste aux maisons contemporaines coiffées elles aussi d’ardoises, en passant par de nombreuses réalisations Renaissance ayant célébré la pierre de tuffeau, l’architecture de la ville est ici bien résumée. Le centre-ville voit se concentrer la majorité des monuments médiévaux et des hôtels particuliers, érigés de la Renaissance au XIXᵉ siècle, même si le quartier de la Doutre en rive droite est très riche en constructions médiévales."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Wei%C3%9Fenfels","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Markwerbener_Stra%C3%9Fe_21_Wei%C3%9Fenfels.jpg","page_title":"Liste der Kulturdenkmale in Weißenfels","context_page_description":"In der Liste der Kulturdenkmale in Weißenfels sind alle Kulturdenkmale der Gemeinde Weißenfels und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Harlingen_(stad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Grote_Bredeplaats_18.JPG","page_title":"Lijst van rijksmonumenten in Harlingen (stad)","context_page_description":"De stad Harlingen telt 517 inschrijvingen in het rijksmonumentenregister, hieronder een compleet overzicht."},{"page_url":"https://da.wikipedia.org/wiki/Sch%C3%B6nebeck_(Elben)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Wappen_Schoenebeck.png","page_title":"Schönebeck (Elben)","context_page_description":"Schönebeck (Elben) er den største by i Salzlandkreises i den tyske delstat Sachsen-Anhalt."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%A3%E3%83%BC%E3%83%AB%E3%83%89%E3%82%AD%E3%83%83%E3%83%81%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Bundesarchiv_Bild_121-0464%2C_Lille%2C_Essensausgabe_an_Polizisten.jpg","page_title":"フィールドキッチン","context_page_description":"フィールドキッチン は、主に軍用として使用される、屋外で調理を行うための移動式調理機材 である。炊事設備の無い前線地域において兵士に温かい食事を提供する目的で19世紀に開発され、以来各国の軍で使用されている。"},{"page_url":"https://en.wikipedia.org/wiki/Washington_Highlands_(Washington,_D.C.)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Washington_Highlands_Washington_DC.jpg","page_title":"Washington Highlands (Washington, D.C.)","context_page_description":"Washington Highlands is a residential neighborhood in Southeast Washington, D.C., in the United States. It lies within Ward 8, and is one of the poorest and most crime-ridden sections of the city. Most residents live in large public and low-income apartment complexes, although there are extensive tracts of single-family detached homes in the neighborhood."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D0%B9%D1%81%D1%82%D1%87%D3%A9%D1%80%D1%87_(%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Christchurch_Priory.jpg","page_title":"Крайстчөрч (Англия)","context_page_description":"Крайстчөрч — Англиянең Дорсет графлыгында урнашкан шәһәр."},{"page_url":"https://vi.wikipedia.org/wiki/T%C6%B0%E1%BB%A3ng_%C4%90%E1%BB%A9c_B%C3%A0_H%C3%B2a_B%C3%ACnh","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Regina_Pacis_HCM2.jpg","page_title":"Tượng Đức Bà Hòa Bình","context_page_description":"Tượng Đức Bà Hòa Bình là một bức tượng tạc Đức Mẹ Maria đặt trong hoa viên trước Nhà thờ chính tòa của Tổng giáo phận Thành phố Hồ Chí Minh, nơi Công trường Công xã Paris. Chính vì hình tượng này mà ngôi nhà thờ mang tên gọi phổ biến là Nhà thờ Đức Bà."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8F%AC%EC%8A%A4%ED%8F%AC%EC%97%90%EB%86%80%ED%94%BC%EB%A3%A8%EB%B8%8C%EC%82%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/PEP-Pyr.PNG","page_title":"포스포에놀피루브산","context_page_description":"포스포에놀피루브산은 피루브산의 엔올형과 인산으로부터 유도된 인산 에스터로 줄여서 PEP라고도 한다. 포스포에놀피루브산은 생화학에서 중요한 중간생성물이다. 포스포에놀피루브산은 생물체에서 발견되는 가장 높은 고에너지 인산 결합을 가지고 있으며, 해당과정과 포도당신생합성에 관여한다. 식물에서는 다양한 방향족 화합물의 생합성과 탄소 고정에 관여하고, 세균에서는 인산기 전이효소 시스템을 위한 에너지원으로 사용된다."},{"page_url":"https://fr.wikipedia.org/wiki/Batterie_du_Rosemont","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Batterie_de_Rosemont_-_int%C3%A9rieur_batterie.jpg","page_title":"Batterie du Rosemont","context_page_description":"La batterie du Rosemont, ou improprement fort de Rosemont sur la carte IGN, est un édifice militaire du XIXᵉ siècle situé sur la colline éponyme, dans la ville française de Besançon. Il s'agit d'une batterie de six pièces érigée à la hâte durant la guerre franco-allemande de 1870 afin de soutenir les positions de Planoise et de Chaudanne. Mais cette guerre ne toucha pas la ville, et par la suite, la batterie ne fut jamais utilisée à des fins militaires même durant la seconde guerre mondiale.\\nLa batterie sera baptisée fort Verne, du nom d'un général de la Révolution né à Saint-Vit et mort sur le champ de bataille en 1796 lors de la bataille du pont d'Arcole.\\nComme de nombreux autres ouvrages de ce type elle fut démilitarisée, subissant alors les outrages du temps. Dans les années 2000, grâce au pâturage estival d'un troupeau de chèvres, les restes de l'unique bâtiment et du magasin à poudre ont été dégagés de la végétation, mais leurs visites sont désormais impossibles car leurs accès sont maintenant interdits afin de prévenir le vandalisme. Il s'agit d'une des plus petites structures fortifiées de la ville avec les lunettes de Trois-Châtels et de Tousey."},{"page_url":"https://sq.wikipedia.org/wiki/Philippe_P%C3%A9tain","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Philippe_P%C3%A9tain_%28en_civil%2C_autour_de_1930%29.jpg","page_title":"Philippe Pétain","context_page_description":"Henri Philippe Benoni Omer Joseph Pétain ose Filip Peten, ose i njohur ndryshe si Marshalli Peten, lindi në 24 prill 1856 në Pas de Calais, në Francën Veriore. Më 1887 mbaroi Shkollën e Lartë të Luftës në Paris. Shfaqi pikëpamje ushtarake novatore për ushtritë e kohës, çka bëri që karriera e tij të ngadalësohej. Gjithsesi Lufta e Parë Botërore i dha të drejtë në shumë drejtime dhe fama e Peten njohu një rritje të dukshme, duke u bërë ndër të tjera shef njësie i atij që më vonë do të ishte personazhi më i madh francez i shekullit – Sharl De Gol. Pas Luftës së Parë Botërore, Peten hyri në gradualisht në jetën politike, duke vijuar të luajë një rol të dorës së parë në ushtri. Në vitin 1931, në moshën 75 vjeçare ai u tërhoq më në fund nga ushtria dhe pranoi të marrë postin e ministrit të Edukimit dhe më pas atë të Ministrit të Luftës në 1934. Gjatë kësaj periudhe ai nisi të mbrojë hapur tezën e një politike paqësore nda Gjermanisë naziste. Deri në 1939 ai shërbeu si ambasador në Spanjë.\\nMë 1940 kryeministri Pol Rejno e ftoi sërish në kabinetin qeveritar."},{"page_url":"https://gl.wikipedia.org/wiki/Atol_Ahe","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Localizaci%C3%B3n_de_Manihi_en_las_Tuamotu.png","page_title":"Atol Ahe","context_page_description":"Ahe é un atol situado nas Tuamotu na Polinesia francesa no subgrupo de Illas do Rei Xurxo."},{"page_url":"https://it.wikipedia.org/wiki/Jack_Guerrini","image_url":"https://upload.wikimedia.org/wikipedia/it/e/ed/Brutos2.JPG","page_title":"Jack Guerrini","context_page_description":"Jack Guerrini pseudonimo di Giacomo Guerrini è stato un cantante e attore italiano.\\nConosciuto come il bello dei Brutos, il gruppo di cui è stato voce solista, in Francia ha inciso alcuni dischi con lo pseudonimo Jacques Guerrini."},{"page_url":"https://es.wikipedia.org/wiki/Tippi_Hedren","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Tippi_Hedren_in_%22The_Harrad_Experiment%22_%281973%29.png","page_title":"Tippi Hedren","context_page_description":"Nathalie \\"Tippi\\" Hedren es una actriz estadounidense, activista por los derechos de los animales y exmodelo de la industria de la moda. Ha realizado 42 películas.\\nSu éxito como modelo de estilo formal le llevó a aparecer en la portada de prestigiosas revistas como Glamour y Life. Hedren dio un giro en su carrera como modelo y decidió aceptar la oferta de Alfred Hitchcock quien buscaba una protagonista para su película Los pájaros, por la que ganó un Globo de Oro, en 1994 también tendría una participación especial en su secuela Los pájaros 2 dirigida por Rick Rosenthal. En 1964 protagonizó el drama psicológico Marnie, también de Hitchcock.\\nHedren ha aparecido en más de ochenta películas y programas de televisión, incluido la última película de Charlie Chaplin, La condesa de Hong Kong, la sátira política de Alexander Payne, Ciudadana Ruth y la comedia existencial de David O. Russell, I Heart Huckabees. Sus contribuciones al cine mundial han sido honradas con el Premio Julio Verne y una estrella en el Paseo de la fama de Hollywood, entre otros."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D8%AE%D8%B3_%D9%86%D9%82%D8%B1%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Locomotora_ferrocarril_sierra_menera.JPG","page_title":"اخس نقرس","context_page_description":"اخس نقرس ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و تروئل اوستانینده یئرلشیب. بۇ شهرین مساحتی ۹۰ کیلومتر موربّع دیر. ۱۱۵۱ متر دنیز سویه‌سیندن اۇجالیقی وار. سوْن نۆفوس تخمین‌لرینه گؤره ۵۳۱ نفر دیر."},{"page_url":"https://ca.wikipedia.org/wiki/Barbadians_al_Regne_Unit","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Allsaints8.jpg","page_title":"Barbadians al Regne Unit","context_page_description":"Els barbadians britànics són els ciutadans i residents del Regne Unit i que són plenament o parcialment originaris de l'illa del Carib, Barbados."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%85%D0%B5%D1%82-%D1%82%D1%80%D0%B8%D0%BA%D1%96%D0%B2_%D0%9B%D1%96%D0%B3%D0%B8_%D1%87%D0%B5%D0%BC%D0%BF%D1%96%D0%BE%D0%BD%D1%96%D0%B2_%D0%A3%D0%84%D0%A4%D0%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Gareth_Bale_July_2010.jpg","page_title":"Список хет-триків Ліги чемпіонів УЄФА","context_page_description":"Ліга чемпіонів УЄФА є найпрестижнішим клубним змаганням, в якому беруть участь найсильніші клуби національних футбольних чемпіонатів зони УЄФА. Сам турнір «Ліга чемпіонів» є реформованим у 1992 році Кубком Європейських чемпіонів, змагання за який розпочалися ще у 1956 році.\\nПід хет-триком у футболі розуміють три голи, забитих в одному матчі одним гравцем. Каре та пента-трик — відповідно чотири та п'ять голів. Першим гравцем, який зробив хет-трик у Лізі чемпіонів, став гравець ПСВ Ейндговен Юул Еллерман. Це сталося 16 вересня 1992 року в матчі проти Жальгіріса. Найшвидший хет-трик зробив Бафетімбі Гоміс у сезоні 2011–2012. Лідерами за кількістю хет-триків є Ліонель Мессі та Кріштіану Роналду, в котрих вісім та сім таких досягнень відповідно. Адріано, Роберто Сольдадо, Кріштіану Роналду, Ліонель Мессі та Маріо Гомес робили хет-трики у двох сезонах поспіль. Найбільша перерва між зробленими хет-триками — у Майкла Оуена. Найменша перерва — у Луїса Адріану, який зробив два хет-трики в одному сезоні, з різницею у два тижні. Окрім того, він став першим гравцем, який оформлював два хет-трики одній і тій самій команді, а також єдиним гравцем, який забив чотири голи в першому таймі."},{"page_url":"https://da.wikipedia.org/wiki/Kortrijk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Kortrijk_begijnhof.JPG","page_title":"Kortrijk","context_page_description":"Kortrijk er en by i det vestlige Belgien i Vestflandern med cirka 75.000 indbyggere. Kortrijk ligger i delstaten Flandern."},{"page_url":"https://war.wikipedia.org/wiki/Toyotomi_Hideyoshi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Toyotomi_hideyoshi.jpg","page_title":"Toyotomi Hideyoshi","context_page_description":"Hi Toyotomi Hideyoshi, usa nga Sengoku nga daimyo nga amo an naghimo nga usa han Hapon. Sinmunod hiya han iya anay nga agaron nga hi Oda Nobunaga, ngan gintapos niya an Sengoku nga panahon. Kilalado gihapon hiya nga amo an nagplano han mga pagsulong ha Korea. Kilalado hiya hin pira nga mga nahabilin ha kultura, upod han sugo nga an mga miyembro la han samurai nga klase an puyde magdara hin armas.\\nAn panahon han iya pamuno tinatawag gihapon nga Momoyama nga panahon, ngan ini nga ngaran tikang han kastilya ni Toyotomi. Nag-iha ini tikang han 1582 tubtub han iya kamatayon dida han tuig 1598, o tubtob han pagkuha hin poder ni Tokugawa Ieyasu katapos han Pakig-away ha Sekigahara han 1600."},{"page_url":"https://en.wikipedia.org/wiki/TV1_(Algerian_TV_channel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Car-r%C3%A9gie-hd-ETP.jpg","page_title":"TV1 (Algerian TV channel)","context_page_description":"TV1, formerly Algerian Television then Terrestrial Channel, is the first Algerian general public network of Établissement public de télévision formerly Établissement national de télévision, along with Canal Algérie, TV3, TV4, TV5, TV6 and TV7. It started to broadcast its programs on 24 December 1956, during the French colonial period in Algeria. It is one of the most important television channels in Algeria, and produces entertainment and variety programs in addition to several Algerian series and films. Its main headquarters are in Algiers."},{"page_url":"https://de.wikipedia.org/wiki/Wasserschloss_Bieringen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/20121231_Bieringen_ehemaliges_Wasserschloss.jpg","page_title":"Wasserschloss Bieringen","context_page_description":"Das Wasserschloss Bieringen ist ein ehemaliger Schlossbau im Schöntaler Ortsteil Bieringen im Hohenlohekreis. Es wurde im 18. Jahrhundert anstelle einer mittelalterlichen Wasserburg errichtet. Heute ist das Gebäude Pfarrhaus der katholischen Kirche St. Kilian."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%B0%E7%81%A3%E5%9C%B0%E7%90%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Taiwan-Yushan_Range.jpg","page_title":"台灣地理","context_page_description":"本條目敘述臺灣的地理概況，包括臺灣本島，澎湖群島、釣魚臺列嶼等附屬群島，以及龜山島、綠島、蘭嶼、小琉球等周邊個別島嶼。"},{"page_url":"https://af.wikipedia.org/wiki/Klokhorlosie","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Garden_sundial_MN_2007.JPG","page_title":"Klokhorlosie","context_page_description":"'n Klok is 'n instrument wat gebruik word om tyd te meet, die tyd korrek te hou en dan die tyd aan te dui. Die klok is een van die oudste menslike uitvindings, en voldoen aan die behoefte om die intervalle van korter tyd as die natuurlike eenhede te meet: die dag, die maanmaand en die jaar. Toestelle wat op verskillende fisiese prosesse werk, is oor die eeue heen gebruik.\\nSommige voorgangers van die moderne horlosie kan beskou word as 'klokhorlosies' wat gebaseer is op beweging in die natuur: 'n sonwyser dui die tyd aan deur die posisie van 'n skaduwee op 'n plat oppervlak te vertoon. Daar is 'n verskeidenheid tydmeters, 'n bekende voorbeeld is die uurglas. Waterklokke, tesame met die sonwyser, is moontlik die oudste meetinstrumente. Groot vooruitgang is gemaak met die uitvind van die randontkoming, wat die eerste meganiese horlosies omstreeks 1300 in Europa moontlik gemaak het, wat tyd gehou het met ossillerende tydhouers soos balanswiele.\\nDie tydhou-element in alle moderne horlosies is 'n harmoniese ossillator, 'n fisiese voorwerp wat op 'n spesifieke frekwensie vibreer of ossilleer."},{"page_url":"https://sw.wikipedia.org/wiki/Ghuba_ya_Omani","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/LocationGulf_of_Oman.png","page_title":"Ghuba ya Omani","context_page_description":"Ghuba ya Omani ni mkono wa kaskazini-magharibi wa Bahari Hindi unaofikia hadi mlango wa Hormuz unapoendelea katika Ghuba ya Uajemi.\\nUrefu wake ni 560 km. Upande wa magharibi maji yana kina cha m 50 na upande wa mashariki kina cha mita 200.\\nGhuba ya Uajemi ni muhimu sana kiuchumi, kisiasa na kijeshi kwa sababu ni mlango wa kuingia na kutoka Ghuba ya Uajemi penye asili ya sehmu kubwa ya mafuta ya petroli duniani.\\nGhuba imepakana na Uajemi, Falme za Kiarabu na Omani."},{"page_url":"https://it.wikipedia.org/wiki/Madam_Secretary","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Aspettando_Clint_Keith_Carradine_fcm.jpg","page_title":"Madam Secretary","context_page_description":"Madam Secretary è una serie televisiva statunitense trasmessa dal 21 settembre 2014 all'8 dicembre 2019 sul network CBS per sei stagioni.\\nIn Italia la serie va in onda in prima visione assoluta su Rai 2 dal 5 settembre 2016."},{"page_url":"https://cs.wikipedia.org/wiki/Race_Imboden","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Race_Imboden_CIP_2015_teams_t134422.jpg","page_title":"Race Imboden","context_page_description":"Race Alick Reid Imboden je americký sportovní šermíř. Je členem United Fencing Academy v Los Angeles a jeho trenérem je Stefano Cerioni.\\nNa mistrovství světa juniorů v šermu vyhrál v letech 2011 a 2012 soutěž družstev. Na mistrovství světa v šermu získal s americkým družstvem zlatou medaili v roce 2019 a stříbrné v letech 2013, 2017 a 2018. Na Olympijských hrách 2016 skončil s družstvem na třetím místě. Na Panamerických hrách v roce 2019 vyhrál soutěž družstev a byl třetí mezi jednotlivci.\\nPři slavnostním vyhlášení vítězů na Panamerických hrách v Limě poklekl při americké hymně na jedno koleno. Svoje gesto vysvětlil jako protest proti „rasismu, držení zbraní, krutému zacházení s imigranty a prezidentovi, který rozsévá nenávist.“ Olympijský výbor Spojených států amerických mu za zakázanou politickou demonstraci udělil dvanáctiměsíční podmínečný trest.\\nJe studentem St. John's University. Vedle sportu se věnuje také modelingu. Jeho zálibou je hip hop a vystupuje jako DJ."},{"page_url":"https://de.wikipedia.org/wiki/Megalithanlagen_von_Kilmashogue","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Kilmashogue_Megalithic_Site_3.JPG","page_title":"Megalithanlagen von Kilmashogue","context_page_description":"Die Megalithanlagen von Kilmashogue liegen unweit der R116 im gleichnamigen Townland Kilmashogue am Kilmashogue Mountain im Dubliner Vorort Rathfarnham im County Dún Laoghaire-Rathdown in Irland. Eine Steinkiste und zwei Menhire stehen in der Nähe."},{"page_url":"https://ms.wikipedia.org/wiki/Bruno_Zuculini","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Palestino_-_River_Plate_20190424_01.jpg","page_title":"Bruno Zuculini","context_page_description":"Bruno Zuculini ialah pemain bola sepak profesional Argentina yang bermain sebagai pemain tengah untuk kelab Championship, Middlesbrough secara pinjaman dari Manchester City."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D9%85%D9%8A%D8%AA%D8%B3%D9%88%D9%86%D9%8A%D8%A7%D9%86_%D8%A7%D9%8A%D9%86%D8%B3%D8%AA%D9%8A%D8%AA%D9%88%D8%AA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Smithsonian_logo_color.svg","page_title":"سميتسونيان اينستيتوتو","context_page_description":"سمیتسونیان اینستیتوتو — امریکانین میلّی موزه‌سی، دونیانین ایسه ان بؤیوک موزه‌سی و تدقیقات مرکزلریندن بیری اینستیتوت هر ایل یای آیلاری پایتاخت واشینقتوندا دونیا اؤلکه‌لری‌نین مدنی عنعنه‌لری‌نین تانیدیلماسی مقصدیله سمیتسونیان فولکلور فئستیوالی کئچیریر.\\nبو انستیتوت ۱۸۴۶ ایلینین ۱۰ آگوست آییندا قورولوب."},{"page_url":"https://eu.wikipedia.org/wiki/Izarren_nukleosintesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Nucleosynthesis_in_a_star.gif","page_title":"Izarren nukleosintesi","context_page_description":"Izarren nukleosintesia izarrek beraien eboluzio-prozesuan izaten dituzten erreakzio nuklearren multzoa da, grabitazio-kolapsoaren aurrekoak. Elementuen beste sintesi prozesuei buruz gehiago jakin nahi izanez gero, ikus ezazu nukleogenesi orrialdea.\\nProzesu hauek XX. mendearen hasieran hasi ziren ulertzen, Eguzkiak hain denbora luzez argia eta beroa igortzeko erreakzio nuklearrak behar zituela argi geratu zenean. Izarrek ekoizten duten energiaren %90a fusio-erreakzioei esker da, hain zuzen, hidrogenoa helio bihurtzeko gauzatzen dituzten erreakzio horiei esker. Ekoizpenaren %6a helioa karbonoan fusionatzean datza eta gainerako konbustio faseek oso ekarpen baxua egiten diote izarrak bere bizitzan zehar gauzatzen duen energia ekoizpenari."},{"page_url":"https://es.wikipedia.org/wiki/Sclerocarya","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Amarula_tree.JPG","page_title":"Sclerocarya","context_page_description":"Sclerocarya es un género de plantas con siete especies, perteneciente a la familia Anacardiaceae.​"},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_fornl%C3%A4mningar_i_G%C3%B6teborgs_kommun_(G%C3%B6teborg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Kalleb%C3%A4cks_kolerakyrkog%C3%A5rd.jpg","page_title":"Lista över fornlämningar i Göteborgs kommun (Göteborg)","context_page_description":"Lista över fornlämningar i Göteborgs kommun (Göteborg) är en förteckning av ett urval av de fornlämningar som finns i Göteborg i Göteborgs kommun."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D1%8B%D0%B5_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D1%8B_%D0%93%D1%80%D1%83%D0%B7%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/GE-2000-10lari-Statehood-Bi-a.png","page_title":"Памятные монеты Грузии","context_page_description":"Памятные и юбилейные монеты выпускаются Национальным банком Грузии из драгоценных и недрагоценных металлов. Первая монета, посвящённая 50-летию победы во Второй мировой войне была выпущена в 1995 году.\\nВ связи с отсутствием в стране собственного монетного двора, все монеты чеканятся за рубежом: на монетных дворах Австрии, Великобритании, Испании, Литвы, Нидерландов, Польши, Финляндии, Франции и Японии."},{"page_url":"https://fr.wikipedia.org/wiki/Eupener_Bier","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Eupen-Paveestrasse_12_%281%29.jpg","page_title":"Eupener Bier","context_page_description":"L'Eupener Bier appelée couramment Eupener est une bière belge brassée par la brasserie Haacht située à Boortmeerbeek en Province du Brabant flamand."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%82%D0%B5%D1%81%D1%82%D1%8B_%D0%B2_%D0%9F%D1%80%D0%B0%D0%B3%D0%B5_(2019)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Letn%C3%A1_2019_4.jpg","page_title":"Протесты в Праге (2019)","context_page_description":"Протесты в Праге — протесты, обращённые к представителям государственной власти в Чехии, состоявшиеся 23 июня 2019 года, в столице государства городе Праге."},{"page_url":"https://sh.wikipedia.org/wiki/Palau_de_la_M%C3%BAsica_Catalana","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Palau_de_la_M%C3%BAsica_-_Escenari.JPG","page_title":"Palau de la Música Catalana","context_page_description":"Palača katalonske glazbe u ulici Carrer de Sant Francesc de Paula u Barceloni dizajnirao je art nouveau arhitekt Lluís Domènech i Montaner i izgrađen je od 1905. do 1908. godine. Zajedno s Hospital de Sant Pau upisan je 1997. godine na UNESCO-v popis mjesta svjetske baštine u Europi kao jedinstven primjer modernističke arhitekture od čelika i stakla prepun svjetla i dekoracija vodećih dizajnera svog vremena."},{"page_url":"https://nl.wikipedia.org/wiki/Catbalogan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Ph_locator_samar_catbalogan.png","page_title":"Catbalogan","context_page_description":"Catbalogan is een stad in de Filipijnse provincie Samar op het gelijknamig eiland Samar. Bij de laatste census in 2007 had de stad ruim 92 duizend inwoners."},{"page_url":"https://ca.wikipedia.org/wiki/Lo_Pert%C3%BAs","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Map_commune_FR_insee_code_43150.png","page_title":"Lo Pertús","context_page_description":"Lo Pertús és un municipi francès, situat al departament de l'Alt Loira i a la regió d'Alvèrnia-Roine-Alps. L'any 2007 tenia 416 habitants."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D1%82%D0%B0%D0%BB%D0%B0%D0%BD%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Etalante_vue_du_cirque_de_la_coquille.jpg","page_title":"Еталант","context_page_description":"Еталант насеље је и општина у источном делу централне Француске у региону Бургоња, у департману Златна обала која припада префектури Монбар.\\nПо подацима из 2011. године у општини је живело 124 становника, а густина насељености је износила 3,17 становника/km². Општина се простире на површини од 39,15 km². Налази се на средњој надморској висини од 442 метара."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%BC%E3%83%86%E3%82%A3%E3%83%B3%E3%83%BB%E3%83%88%E3%83%A0%E3%83%81%E3%82%A7%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Martin_Tomczyk_%28crop%29.jpg","page_title":"マーティン・トムチェク","context_page_description":"マーティン・トムチェク は、ドイツのレーシングドライバーである。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Popiel%C3%B3w_(Opolskie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Ko%C5%9Bci%C3%B3%C5%82_cmentarny_pw._Matki_Boskiej_i_%C5%9Bw._Andrzeja_w_Popielowie_Gmina_Popiel%C3%B3w._bertzag_%285%29.JPG","page_title":"Popielów (Opolskie)","context_page_description":"Popielów sī Pho-lân Opolskie séng Opolski kūn ê chi̍t ê chng-thâu."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%83%D0%B4%D0%BE%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Crystal_cruet_set.jpg","page_title":"Судок","context_page_description":"Судо́к — столовий прибор, що складається з посудин для приправ, встановлених на спільній підставці. Судки виготовляються зі скла, дерева, металу, кераміки й комбінації цих матеріалів.\\nСудки можуть складатися з трьох, чотирьох чи більше предметів."},{"page_url":"https://es.wikipedia.org/wiki/Provincia_de_Caman%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/CAMANA.jpg","page_title":"Provincia de Camaná","context_page_description":"La Provincia de Camaná es una provincia peruana de las ocho que conforman el Departamento de Arequipa, bajo la administración del Gobierno regional de Arequipa, al sur de Perú. Limita al norte con las provincias de Condesuyos, Castilla y Caylloma, al este con la provincia de Arequipa y la provincia de Islay, al sur con el océano Pacífico y al oeste con la provincia de Caravelí."},{"page_url":"https://hu.wikipedia.org/wiki/Saint-Cirgues-la-Loutre","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/%C3%89glise_de_Saint-Cirgues-la-Loutre%2C_fa%C3%A7ade.jpg","page_title":"Saint-Cirgues-la-Loutre","context_page_description":"Saint-Cirgues-la-Loutre település Franciaországban, Corrèze megyében. Saint-Cirgues-la-Loutre Cros-de-Montvert, Rouffiac, Saint-Geniez-ô-Merle, Saint-Julien-aux-Bois és Saint-Privat községekkel határos."},{"page_url":"https://qu.wikipedia.org/wiki/Aqupiya_distritu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Iglesia-La-Compania---Cuzco.jpg","page_title":"Aqupiya distritu","context_page_description":"Aqupiya distritu icha Aquphiya distritu nisqaqa Aqupiya llaqtap distritunmi, Piruw mama llaqtapi, Aqumayu pruwinsyapi, Qusqu suyupi. Aqupiya distritupiqa Hawa Qucham kan."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%81%AF%E5%90%88%E8%88%AA%E7%A9%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/United_Airlines_B767-300ER_business_class.jpg","page_title":"聯合航空","context_page_description":"联合航空是美国一家大型航空公司，简称联航，在中国大陆则被简称为美联航，以便与中国联合航空作区别。总部位于美国伊利诺伊州芝加哥威利斯大厦，邻近其主要枢纽机场芝加哥奥黑尔国际机场。按照机队规模和航线总数计算，联合航空为世界第三大航空公司，机队规模仅次于美国航空及达美航空；若以总乘客飞行里程计算，亦是世界第三大航空公司，居于美国航空及达美航空之后。联合航空亦是星空联盟的创始成员之一。\\n联合航空曾于2002年12月9日向美国政府申请美国破产法第十一章破产保护，并于2006年2月1日脱离破产保护，这是历史上最大以及历时最长的航空公司破产保护案件。2011年11月30日，联合航空与美国大陆航空实现合并协议，双方的合并程序逐步进行，两家公司先后在均有业务的机场进行航站柜台、登机位等地勤服务的搬迁整合和标志更换。同时，联合航空“红地毯贵宾室”与大陆航空贵宾室“Presidents Club”合并成为联合航空贵宾室“United Club”。2012年初，大陆航空的飞行常客奖励计划“翼通天下”并入联合航空“前程万里”计划。2012年3月3日，原联合航空停止运营，而大陆航空则正式以联合航空的名义更换公司名称，大陆航空品牌也在同日起正式消失。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A5%94%E7%BF%85%E8%97%A4%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Sphenodesme_involucrata.jpg","page_title":"楔翅藤属","context_page_description":"楔翅藤属是六苞藤科下的一个属，为藤状灌木植物。该属共有约14种，分布于亚洲热带地区。"},{"page_url":"https://zh.wikipedia.org/zh-hk/%E7%9F%B3%E9%A0%AD%E5%AE%AE%E6%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Dhar_Al_Hajjar_terrace.jpg","page_title":"石頭宮殿","context_page_description":"石頭宮殿是靠近葉門首都沙那十公里外一帶，立基在巨岩上的建築。\\n此建築由18世紀學者阿里·本·薩利赫·阿馬里所打造，到了20世紀它被選來改建為葉門穆塔瓦基利亞王國創建者葉海亞·穆罕默德·哈米德丁的避暑住所，現今則成為可供遊客免費參觀的博物館場所。\\n建物內除具備可禦敵和對外射擊的攻守場所外，也擁有私人使用的水源。"},{"page_url":"https://ca.wikipedia.org/wiki/Montanissell","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Entorn_de_l%27esgl%C3%A9sia_Parroquial_de_Sant_Joan_de_Montanissell.JPG","page_title":"Montanissell","context_page_description":"Montanissell és un nucli de població del municipi de Coll de Nargó, a l'Alt Urgell. El 2005 tenia 28 habitants i és en un lloc elevat a 1.134 metres d'altitud al peu de la serra de Sant Joan. Sota mateix de la cinglera es troba l'església de Sant Joan. La «vila de Montangocello» és citada el 988 per una permuta entre el bisbe d'Urgell i el Comte Borrell II."},{"page_url":"https://es.wikipedia.org/wiki/Geograf%C3%ADa_de_Europa","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Europe_topography_map.png","page_title":"Geografía de Europa","context_page_description":"Europa es el segundo continente más pequeño del mundo, solo por detrás de ´Oceanía. Tiene una superficie de 10 530 751 km², ​ lo que representa el 7 % de las tierras emergidas. A finales de 2016 está compuesto por cincuenta países, incluyendo Rusia y Turquía, aunque la mayor parte de sus territorios sea asiática. Su distancia máxima de norte a sur es de 4300 km y de este a oeste de 5600 km. Se sitúa en el hemisferio norte. Está unido a Asia, configurando una enorme península dentro de lo que se denomina Eurasia, y debe sus características de individualidad, además de a elementos físicos, a rasgos de orden histórico y humano.\\nLimita con el mar por tres de los cuatro puntos cardinales. A grandes rasgos, con el océano Ártico al norte, el océano Atlántico al oeste y el mar Mediterráneo al sur, lo que evidencia una importantísima influencia oceánica dada su amplia fachada formada por casi 38 000 km de costas y que, además, lo llega a caracterizar como uno de sus rasgos físicos más importantes, determinando el clima en la mayor parte del continente."},{"page_url":"https://de.wikipedia.org/wiki/Minoische_Religion","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/AMI_-_Vogelkanne_Vorpalastzeit.jpg","page_title":"Minoische Religion","context_page_description":"Die Religion der minoischen Kultur des bronzezeitlichen Kreta ist weitestgehend nur aus archäologischen Funden bekannt."},{"page_url":"https://en.wikipedia.org/wiki/Gourdou-Leseurre_GL.2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Gourdou_Leseurre_GL.22_2006-06-15.jpg","page_title":"Gourdou-Leseurre GL.2","context_page_description":"The Gourdou-Leseurre GL.2 was a French fighter aircraft which made its maiden flight in 1918."},{"page_url":"https://eu.wikipedia.org/wiki/Portale_(harresiak)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Vitoria_-_Muralla_04.jpg","page_title":"Portale (harresiak)","context_page_description":"Portale edo ataria, kontestu urbanoan, hiri harresitu bateko ate nagusi eta sarrera bat da.\\nEuskal Herriko harresietako eta herri-ateetako kasuan, Portle terminoa toponimian ere agertzen da, hala nola Elgetako bidetik Eibarrera ematen zuena eta Bermeko San Joan portalea edo Doniene atea."},{"page_url":"https://vi.wikipedia.org/wiki/Microschismus_serricornis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Fig.15-Microschismus_fortis.JPG","page_title":"Microschismus serricornis","context_page_description":"Microschismus fortis là một loài bướm đêm thuộc họ Alucitidae. Loài này có ở Nam Phi."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B0%D1%80%D0%B5%D0%BD%D0%B0_(%D0%A2%D1%80%D0%B5%D0%BD%D1%82%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Varena2.jpg","page_title":"Варена (Тренто)","context_page_description":"Варена је насеље у Италији у округу Тренто, региону Трентино-Јужни Тирол.\\nПрема процени из 2011. у насељу је живело 799 становника. Насеље се налази на надморској висини од 1208 м."},{"page_url":"https://ast.wikipedia.org/wiki/Atletismu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/2005_World_Championships_in_Athletics2.jpg","page_title":"Atletismu","context_page_description":"El atletismu ye consideráu'l deporte cola forma entamada más antigua. Abarca numberoses disciplines arrexuntaes en carreres, saltos, llanzamientos, pruebes combinaes y marcha.\\nL'atletismu procede del griegu atletes, que vien definise como “aquella persona que compite nuna prueba determinada por un premiu”, ensin escaecer tampoco que dicha pallabra griega, del vocablu aethos ye sinónimu de “esfuerciu”.\\nYe l'arte de superar el rendimientu de los adversarios en velocidá o en resistencia llamáu tamién fondu, en distancia o en grandes altores.\\nEl númberu de pruebes, y les mentalidaes, yá seyan individuales o en grupos, varió col tiempu.\\nL'atletismu ye unu de los pocos deportes practicaos universalmente, yá seya ente aficionaos o en competiciones de tolos niveles. La simplicidá y los pocos medios necesarios pa la so práutica espliquen esti ésitu.\\nLa primer referencia histórica del atletismu remontar al añu 776 A.C. en Grecia, con una llista de los atletes ganadores d'una competencia.\\nDientro del atletismu atopamos diverses modalidaes de pruebes. Asina, tán les carreres a cuerpu, los saltos de llonxitú o altor, los llanzamientos, la marcha atlética, y les pruebes combinaes."},{"page_url":"https://hu.wikipedia.org/wiki/Leveg%C5%91szennyez%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Air_pollution_by_industrial_chimneys.jpg","page_title":"Levegőszennyezés","context_page_description":"A levegőszennyezés a környezetszennyezés egyik típusa."},{"page_url":"https://fr.wikipedia.org/wiki/Maison_du_Chapitre_(Saint-Julien-du-Sault)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Maison_du_chapitre_Saint-Julien_-du-Sault.jpg","page_title":"Maison du Chapitre (Saint-Julien-du-Sault)","context_page_description":"La maison du Chapitre est une maison située à Saint-Julien-du-Sault, en France."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%87%D8%A7%D9%85%D9%BE%D8%B3%D8%AA%DB%8C%D8%AF%D8%8C_%D9%85%D8%B1%DB%8C%D9%84%D9%86%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/2016-08-20_12_31_05_View_north_along_Maryland_State_Route_30_Business_%28Main_Street%29_at_Maryland_State_Route_833_%28Black_Rock_Road%29_in_Hampstead%2C_Carroll_County%2C_Maryland.jpg","page_title":"هامپستید، مریلند","context_page_description":"هامپستید آمریکانین مریلند ایالتینده یئرلشن بیر شهر. ۲۰۱۸-جی وئریلن معلوماتا اهالیسینین سایی ۶۳۸۷ نفر ایدی."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%87%AA%E7%94%B1%E6%B0%91%E4%B8%BB%E9%BB%A8%E7%B8%BD%E8%A3%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Yoshiro_Mori_cropped_2_Yoshiro_Mori_20000405.jpg","page_title":"自由民主黨總裁","context_page_description":"自由民主党总裁是日本自由民主党的党首。由自由民主党的国会议员和党员、党友通过选举产生。\\n“总裁”的职位名称，继承自立宪政友会和立宪民政党。"},{"page_url":"https://lmo.wikipedia.org/wiki/Serie_A_2007-2008","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Coppacampioni.png","page_title":"Serie A 2007-2008","context_page_description":"La Serie A 2007-2008 a l'è staita qella del 106 edizion de la massima serie del campionad italian de folber.\\nEl campionad l'è stait vinjud da l'Inter."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%81ysomice_(przystanek_kolejowy)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/%C5%81ysomice_stop.jpg","page_title":"Łysomice (przystanek kolejowy)","context_page_description":"Łysomice – przystanek kolejowy, a dawniej stacja w Łysomicach na linii kolejowej nr 207, w województwie kujawsko-pomorskim.\\nW roku 2017 przystanek obsługiwał 50–99 pasażerów na dobę."},{"page_url":"https://no.wikipedia.org/wiki/Haukipudas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Haukipudas_Church_2006_04_30.JPG","page_title":"Haukipudas","context_page_description":"Haukipudas er en tidligere kommune i landskapet Norra Österbotten i Finland. Kommunen hadde cirka 17 700 innbyggere og et areal på 466,22 km². Haukipudas var en finskspråklig kommune som grenset til kommunene Karlö, Ijo, Kiminge, Uleåborg og Yli-Ii.\\nKommunene Haukipudas, Kiminge, Oulunsalo og Yli-Ii ble 1. januar 2013 slått sammen med Uleåborg."},{"page_url":"https://es.wikipedia.org/wiki/Reacci%C3%B3n_de_Grignard","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Grignard-Reaction_Mechanism.png","page_title":"Reacción de Grignard","context_page_description":"La reacción de Grignard es una reacción química organometálica en la que haluros de alquilo, vinilo o aril - magnesio se agregan a un grupo carbonilo en un aldehído o cetona.​​ Esta reacción es importante para la formación de enlaces carbono-carbono.​​ La reacción de un haluro orgánico con magnesio no es una reacción de Grignard, pero proporciona un reactivo de Grignard.​\\nLas reacciones y los reactivos de Grignard fueron descubiertos y reciben el nombre del químico francés François Auguste Victor Grignard, quien lo publicó en 1900 y recibió el Premio Nobel de Química de 1912 por este trabajo.​"},{"page_url":"https://de.wikipedia.org/wiki/Peugeot_Typ_4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Peugeot_Type_4.jpg","page_title":"Peugeot Typ 4","context_page_description":"Der Peugeot Typ 4 ist ein frühes Automodell des französischen Automobilherstellers Peugeot, von dem 1892 im Werk Valentigney ein einziges Exemplar produziert wurde.\\nDas Fahrzeug besaß einen Zweizylinder-Viertaktmotor nach Lizenz Daimler, der im Heck angeordnet war und über Ketten die Hinterräder antrieb. Der Motor leistete aus 1018 cm³ Hubraum 3,3 bis 4 PS.\\nBei einem Radstand von 163 cm und einer Spurbreite von 121 cm vorne bzw. 123 cm hinten betrug die Fahrzeuglänge 262 cm, die Fahrzeugbreite 140 cm und die Fahrzeughöhe 202 cm. Die Karosserieform Vis-à-vis bot Platz für vier Personen.\\nDas Fahrzeug ist erhalten geblieben und ist im Musée de l'Aventure Peugeot in Sochaux, Frankreich zu besichtigen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%BC%E3%82%B9%E3%83%88%E3%83%8F%E3%83%BC%E3%83%88%E3%83%95%E3%82%A9%E3%83%BC%E3%83%89_(%E3%82%B3%E3%83%8D%E3%83%81%E3%82%AB%E3%83%83%E3%83%88%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/E_Hartford_CT_lg.PNG","page_title":"イーストハートフォード (コネチカット州)","context_page_description":"イーストハートフォードは、アメリカ合衆国コネチカット州ハートフォード郡南東部に位置する町である。州都ハートフォード市の一部だったが、1783年に町として分離、法人化された。2010年の国勢調査では人口51,252 人であり、州内の町では第7位、市を合わせても第19位である。"},{"page_url":"https://de.wikipedia.org/wiki/Pferdesolarium","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Kunststoffsolarium.jpg","page_title":"Pferdesolarium","context_page_description":"Ein Pferdesolarium ist ein technisches Gerät zur Bestrahlung eines Pferdes mit infrarotem und ultraviolettem Licht. Einige Geräte verfügen über Umluft-Systeme, Föne oder Leuchtmittel zur Lichttherapie."},{"page_url":"https://sv.wikipedia.org/wiki/San_Massimo","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Panorama_Campitello.jpg","page_title":"San Massimo","context_page_description":"San Massimo är en ort och kommun i provinsen Campobasso i regionen Molise i Italien. Kommunen hade 834 invånare."},{"page_url":"https://es.wikipedia.org/wiki/Michael_Berry","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Michael_Berry%2C_Yerevan_-_Ashtarak%2C_Armenia%2C_FOP-2014%2C_03.09.2014.jpg","page_title":"Michael Berry","context_page_description":"Michael Victor Berry, FRS FRSE, es un físico y matemático británico de la Universidad de Brístol.\\nFue elegido fellow de la Royal Society de Londres en 1982 y honrado caballero en 1996. Desde el 2006 ha sido editor del periódico de la Sociedad, Proceedings of the Royal Society.\\nEs famoso entre otras cosas por la fase de Berry, un fenómeno observado, por ejemplo, en mecánica cuántica y óptica."},{"page_url":"https://en.wikipedia.org/wiki/Bagh-Chal","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Bagchallines.jpg","page_title":"Bagh-Chal","context_page_description":"Bagh-Chal is a strategic, two-player board game that originated in Nepal. The game is asymmetric in that one player controls four tigers and the other player controls up to twenty goats. The tigers 'hunt' the goats while the goats attempt to block the tigers' movements. This game is also seen in southern India with a different board, but the rules are the same. This game is popular in rural areas of the country."},{"page_url":"https://en.wikipedia.org/wiki/HMS_Argus_(I49)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Aircraft_in_hangar_of_HMS_Argus_%28I49%29_c1942.jpg","page_title":"HMS Argus (I49)","context_page_description":"HMS Argus was a British aircraft carrier that served in the Royal Navy from 1918 to 1944. She was converted from an ocean liner that was under construction when the First World War began and became the first example of the standard pattern of aircraft carrier, with a full-length flight deck that allowed wheeled aircraft to take off and land. After commissioning, the ship was involved for several years in the development of the optimum design for other aircraft carriers. Argus also evaluated various types of arresting gear, general procedures needed to operate a number of aircraft in concert and fleet tactics. The ship was too top-heavy as originally built and had to be modified to improve her stability in the mid-1920s. She spent one brief deployment on the China Station in the late 1920s before being placed in reserve for budgetary reasons.\\nArgus was recommissioned and partially modernised shortly before the Second World War and served as a training ship for deck-landing practice until June 1940. The following month she made the first of her many ferry trips to the Western Mediterranean to fly off fighters to Malta; she was largely occupied in this task for the next two years."},{"page_url":"https://fr.wikipedia.org/wiki/Sites_m%C3%A9galithiques_de_l%27Aveyron","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Dolmen_Combemousseuse_%282%29.jpg","page_title":"Sites mégalithiques de l'Aveyron","context_page_description":"Le département de l'Aveyron est le premier département français par le nombre de sites mégalithiques recensés. Les dolmens se caractérisent par une forte concentration géographique et une très grande homogénéité architecturale. A contrario, les menhirs au sens strict y sont rares mais de nombreuses statues-menhirs y ont été découvertes. Cet ensemble mégalithique comporte plusieurs influences architecturales plus ou moins prononcées. Sa période d'édification correspond au Chalcolithique et au Bronze ancien."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BB%D5%BD%D5%AC%D5%A1%D5%B4%D5%AB%D5%BD%D5%BF%D5%A1%D5%AF%D5%A1%D5%B6_%D5%A1%D5%B0%D5%A1%D5%A2%D5%A5%D5%AF%D5%B9%D5%A1%D5%AF%D5%A1%D5%B6_%D5%B0%D5%A1%D6%80%D5%B1%D5%A1%D5%AF%D5%B8%D6%82%D5%B4%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Gulshan-e-Iqbal_Park%2C_Lahore.jpg","page_title":"Իսլամիստական ահաբեկչական հարձակումների ցանկ","context_page_description":"Սույն հոդվածում ներկայացված են բոլոր այն իսլամիստական ահաբեկչական հարձակումները, որոնք սկսած 1979 թվականից լայնորեն լուսաբանվել են զանգվածային լրատվամիջոցների շրջանում։\\nՈղջ աշխարհում ծայրահեղ իսլամիստների կողմից կրոնական-քաղաքական այս կամ այն դրդապատճառներով իրագործվել են բազմաքանակ ահաբեկչական հարձակումներ։ Սովորաբար ահաբեկիչների մարտավարության մեջ են մտնում հրկիզումները, տրանսպորտային միջոցների պայթեցումները, ռումբի պայթեցման սպառնալիքները, մահապարտ ահաբեկիչների հարձակումները, ռմբակոծությունները, զանգվածային հրաձգությունները, դանակահարությունները, օդահենությունները, առևանգումները և գլխատումները։"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_K%C3%BCchengew%C3%BCrze","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Echter_Kerbel_April_2012.JPG","page_title":"Liste der Küchengewürze","context_page_description":"Die Liste der Küchengewürze enthält gebräuchliche Gewürze und Kräuter mit kurzen Verwendungshinweisen und Verweisen zu weiterführenden Artikeln.\\nUnter Gewürzen werden allgemein Teile von Pflanzen verstanden. Andere Lebensmittel, die als Gewürze bezeichnet werden, stehen unter Würzstoffe."},{"page_url":"https://it.wikipedia.org/wiki/Isola_d%27Elba","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Isola_d%27Elba_-_Mare_di_Pomonte.jpg","page_title":"Isola d'Elba","context_page_description":"L'isola d'Elba è un'isola situata tra il canale di Piombino a est, a circa 10 chilometri dalla costa, il mar Tirreno a sud e il canale di Corsica a ovest.\\nÈ la più grande delle isole dell'arcipelago toscano, e la terza più grande d'Italia. L'Elba, assieme alle altre isole dell'arcipelago fa parte del parco nazionale dell'Arcipelago Toscano.\\nAmministrativamente è suddivisa in 7 comuni, facenti parte della provincia di Livorno."},{"page_url":"https://en.wikipedia.org/wiki/Valaam","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/The_Skete_of_All_Saints.jpg","page_title":"Valaam","context_page_description":"Valaam is an archipelago in the northern portion of Lake Ladoga, lying within the Republic of Karelia, Russian Federation. The total area of its more than 50 islands is 36 km². The largest island is also called Valaam. Other known islands are: Skitsky, Lembos, Sviatoy, Bayonny, Moskovsky, Predtechensky, Nikonovsky, Divny, Emelyanov, Oboronny, Goly, Savvaty's, Zosima's, Skalisty, Lukovy, Ovsiany, Rzhanoi, Nikolsky.\\nIt is best known as the site of the 14th century Valaam Monastery on Valaam Island and for its natural environment. In the 12th century, the islands were a part of the Novgorod Republic. In the 17th century, they were captured by Sweden during the Time of Troubles, but Russia reconquered them less than a century later. When the Grand Duchy of Finland was set up in the early 19th century as an autonomous part of the Russian Empire, Alexander I of Russia made Valaam a part of Finland. In 1917, Valaam became a part of newly independent Finland, but it was annexed by the USSR after the Winter War and Continuation War.\\nThe name of the island is from the Finno-Ugric word valamo, which means the high, mountain, ground."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%8A%E6%96%AF%E5%85%B0%E6%95%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Roof_hafez_tomb.jpg","page_title":"伊斯兰教","context_page_description":"伊斯蘭教又稱回教、清真教、天方教，是以《可蘭經》和聖訓為教導的一神教宗教，也是世界三大宗教之一。《可蘭經》被伊斯蘭信徒視為造物主阿拉命天使給其使者逐字逐句的啟示，而聖訓為造物主所差遣的最後一位先知穆罕默德的言行錄。伊斯蘭這一名稱來自《可蘭經》，源自閃語字根S-L-M，意為「追隨」；實際上穆斯林的名字也來自這個字根，意為「追隨者」、「和平與善的實踐者」。\\n穆斯林信仰獨一且無與倫比的阿拉，並認為人生的唯一目的是追隨阿拉；伊斯蘭教認為阿拉在人類歷史長河派遣了眾多先知給全人類，歷代各個民族都有先知，包括易卜拉欣、穆薩、爾撒等，先知穆罕默德是最後一位，《可蘭經》載有他所得的訊息。伊斯蘭教的基本功修包括五功，是為「念、禮、齋、課、朝」，五功是穆斯林需要奉行的五個義務。伊斯蘭教還擁有自己的一套宗教法律，該法律實際觸及生活及社會的每一個層面，由飲食、金融到戰事以及福利等各方面。\\n在先知穆罕默德逝世後，伊斯蘭帝國持續擴張，佔據著大片的地區，促使哈里發國的誕生，傳教活動亦刺激更多人改信伊斯蘭教。早期哈里發的宗教政策、穆斯林的經濟及商貿開拓及後來鄂圖曼帝國的擴張都使伊斯蘭教從麥加向大西洋及太平洋的方向擴散，形成穆斯林世界。\\n多數的穆斯林屬於遜尼派及什葉派兩大伊斯蘭教派，另外兩派中均有人同時信仰伊斯蘭神秘主義。伊斯蘭教是中東、中亞、東南亞主要部分及非洲的大部分的主流宗教。在法國、德國、中國西北部、俄羅斯西南部及加勒比地區都可找到龐大的穆斯林社群。穆斯林最多的國家是印度尼西亞，這裡居住著全球穆斯林總數的15%。南亞、中東及撒哈拉以南非洲的穆斯林分別佔全球總數的25%、20%及15%。皈依伊斯蘭教的穆斯林幾乎可在世界的每個角落都可找到。截至2010年，全球約有16億穆斯林，佔23.4%人口。在信徒人數上，伊斯蘭教是世界第二大宗教，被認為是世上增長得最快的宗教。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Mareil-en-France","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Mareil-en-France_-_Facade_de_l_eglise.jpg","page_title":"Liste der Monuments historiques in Mareil-en-France","context_page_description":"Die Liste der Monuments historiques in Mareil-en-France führt die Monuments historiques in der französischen Gemeinde Mareil-en-France auf."},{"page_url":"https://ru.wikipedia.org/wiki/Citro%C3%ABn_C6_(1928)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Citro%C3%ABn_C6-six.jpg","page_title":"Citroën C6 (1928)","context_page_description":"Citroën C6 — легковой автомобиль, впервые представленный на Парижском автосалоне в октябре 1928 года и затем выпускавшийся серийно фирмой Citroën в 1929—32 гг. Первый шестицилиндровый автомобиль этой фирмы. Всего было выпущено 61 280 экземпляров."},{"page_url":"https://ca.wikipedia.org/wiki/Slot","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Scalextric1.jpg","page_title":"Slot","context_page_description":"L'slot, autopistes en miniatura o fórmula de saló, és una joguina d'automòbils a escala, equipats amb motors elèctrics que corren per unes pistes equipades amb ranures especialment dissenyades per a aquesta funció, de les quals s'alimenten elèctricament els cotxes; és d'aquestes ranures de les quals ve el nom del terme anglès \\"slot\\".\\nAmb el mateix nom, també es coneix l'esport competitiu consistent a fer curses de velocitat amb aquestes joguines.\\nEls materials imprescindibles són una pista, un cotxe, un transformador o una font d'alimentació i un comandament controlador. La diversió i dificultat de l'slot consisteix que el cotxe circuli tan de pressa com pugui sense que surti del carril, ja sigui en velocitat, ral·li, raid, etcètera. És possible facilitar la tasca incloent-hi petits però potents imants que atreuen el xassís a la pista.\\nEncara que per als entesos en el tema es diu slot, per a la majoria de la gent dit terme resulta estrany, i es prefereix usar la marca registrada Scalextric com a nom genèric, encara que han proliferat àmpliament altres fabricants en les dues últimes dècades."},{"page_url":"https://ca.wikipedia.org/wiki/Dones_del_Vietnam","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/IndoChina1886.jpg","page_title":"Dones del Vietnam","context_page_description":"Les dones del Vietnam són dones nascudes, que viuen o provenen del Vietnam. El paper de la dona al Vietnam ha estat sotmès a molts canvis al llarg de la història del Vietnam. Han assumit diferents papers en la societat, inclosos els de guerreres, infermeres, mares i esposes. Hi ha hagut molts avenços en els drets de les dones al Vietnam, com ara l'augment de la representació de les dones al govern, així com la creació de la Unió de Dones del Vietnam el 1930.\\nDurant el segle xix, el Vietnam va estar dominat pel domini francès. Algunes dones es van casar temporalment amb homes europeus durant aquest període; ambdues parts van veure que la unió era mútuament beneficiosa. Al començament del segle xx, els sentiments nacionalistes es van alçar a Vietnam, que van acabar amb el final del domini francès el 1954 i amb la divisió del Vietnam en dos països, separats pel paral·lel disset.\\nEl paper de les dones en la guerra i fora de casa va continuar augmentant al llarg del segle xx, especialment durant la Guerra d'Indoxina."},{"page_url":"https://de.wikipedia.org/wiki/Antoni_Rovira_i_Trias","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Museu_Martorell_3.JPG","page_title":"Antoni Rovira i Trias","context_page_description":"Antoni Rovira i Trias war ein katalanischer Architekt und Städteplaner des Historismus. Er zählt zu den wichtigsten Wegbereitern des Modernisme in Barcelona."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_ponts_de_Russie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Surgut_Bridge.jpg","page_title":"Liste de ponts de Russie","context_page_description":"Cette liste de ponts du Russie a pour vocation de présenter une liste de ponts remarquables de Russie, tant par leurs caractéristiques dimensionnelles, que par leur intérêt architectural ou historique.\\nLa catégorie lien donne la classification de l'ouvrage parmi ceux présentés et propose un lien vers la fiche technique du pont sur le site Structurae, base de données et galerie internationale d'ouvrages d'art. La liste peut être triée selon les différentes entrées du tableau pour voir ainsi les ponts en arc ou les ouvrages les plus récents par exemple.\\nLes colonnes portée et longueur, exprimées en mètres indiquent respectivement la distance entre les pylônes de la travée principale et la longueur totale de l'ouvrage, viaducs d'accès compris."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AC%E0%B5%8D%E0%B4%B2%E0%B5%82_%E0%B4%AB%E0%B5%8D%E0%B4%B3%E0%B4%B5%E0%B5%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Khankandi-6.jpg","page_title":"ബ്ലൂ ഫ്ളവർ","context_page_description":"റൊമാന്റിസം മൂവ്മെന്റിന്റെ പ്രചോദനത്തിന് കേന്ദ്ര പ്രതീകമായിരുന്നു ബ്ലൂ ഫ്ളവർ. ഇന്ന് പാശ്ചാത്യകലയിൽ നിലനിൽക്കുന്ന ഒരു മുദ്രാവാക്യമാണ് ഇത്. അനന്തമായതും എത്തിച്ചേരാനാകാത്തതുമായ ആഗ്രഹവും, സ്നേഹവും പോലുള്ള മെറ്റഫിസിക്കൽ പരിശ്രമത്തിനു വേണ്ടി ഇത് നിലകൊള്ളുന്നു. കൂടാതെയിത് പ്രത്യാശയുടെയും മനോഹാരിതയുടെയും പ്രതീകമാണ്."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%BE%D0%B2%D0%B5%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D1%83%D1%89%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/NP_center.jpg","page_title":"Беловежская пуща","context_page_description":"Белове́жская пу́ща — наиболее крупный остаток реликтового первобытного равнинного леса, который, согласно представлениям, сложившимся в современной науке, в доисторические времена произрастал на территории Европы. Постепенно он был вырублен, но в относительно нетронутом состоянии в виде крупного массива сохранился только в Беловежском регионе на территории современных Белоруссии и Польши. Беловежскую пущу относят к экорегиону под названием «сарматский смешанный лес».\\nЧерез Беловежскую пущу проходит государственная граница между Польшей и Белоруссией. Рядом с Пущей находится водораздел Балтийского и Чёрного морей.\\nДля сохранения уникальной природы в Беловежской пуще выделены четыре функциональные зоны с различным режимом охраны: заповедная зона, зона регулируемого пользования, рекреационная и хозяйственная зоны. Кроме того, вокруг Пущи создана охранная зона.\\nВ рамках программы ЮНЕСКО «Человек и биосфера» в 1976 году в польской части Пущи создан биосферный заповедник «Беловежа», а в 1993 году в белорусской части Пущи — биосферный заповедник «Беловежская пуща» с площадью 216,2 тыс. га, имеющий зону ядра, буферную и переходную зоны."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CE%B8%CE%B5%CE%B4%CF%81%CE%B9%CE%BA%CF%8C%CF%82_%CF%84%CE%B7%CF%82_%CE%A0%CE%B1%CE%BD%CE%B1%CE%B3%CE%AF%CE%B1%CF%82_(%CE%93%CE%B9%CE%B2%CF%81%CE%B1%CE%BB%CF%84%CE%AC%CF%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Cathedral_of_St._Mary_the_Crowned_west.jpg","page_title":"Καθεδρικός της Παναγίας (Γιβραλτάρ)","context_page_description":"Ο Καθεδρικός της Παναγίας, στο Γιβραλτάρ, είναι η έδρα της Καθολικής Επισκοπής του Γιβραλτάρ."},{"page_url":"https://pt.wikipedia.org/wiki/Economia_da_Hisp%C3%A2nia","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/F%C3%A1brica_romana_de_Salga_05.jpg","page_title":"Economia da Hispânia","context_page_description":"A economia da Hispânia experimentou uma forte evolução durante e depois da conquista do território peninsular por parte de Roma, de tal forma que, de um terreno prometedor embora ignoto, tornou-se uma das mais valiosas aquisições da República e o Império, bem como um esteio básico da economia que sustentava o auge de Roma."},{"page_url":"https://de.wikipedia.org/wiki/Tag_der_Briefmarke_(DDR)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Stamps_of_Germany_%28DDR%29_1964%2C_MiNr_1057.jpg","page_title":"Tag der Briefmarke (DDR)","context_page_description":"Der Tag der Briefmarke, ab 1967 Tag der Philatelisten, war neben dem Veranstaltungstag selbst auch der Name einer Briefmarkenserie der Deutschen Post der DDR. Schon die vierte ausgegebene Briefmarke der DDR nach ihrer Gründung am 7. Oktober 1949 wurde dem „Tag der Briefmarke“ gewidmet.\\nAuch in vielen Jahren, in denen es keine direkte Ausgabe „Tag der Briefmarke“ oder „Tag der Philatelisten“ gab, wurden philatelistische Motive ausgegeben. In diesen Ausgaben wurden nationale und internationale Briefmarkenausstellungen gewürdigt."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%9D%D0%B0%D1%80%C4%83%D1%81,_4","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/HugoChavez1823.jpeg","page_title":"Нарăс, 4","context_page_description":"1703 — 47 ронинран хĕрĕх улттăшĕ Эдора сэппуку тунă\\n1722 — «Рангсен тапăлне» ĕçе кĕртнĕ\\n1789 — пĕрремĕш АПШ президенчĕ пулма пĕр сасăллă Джордж Вашингтона суйланă\\n1859 — Константин Тишендорф Таса Кĕтерин мăнастăрĕнче Синай кодексе тупнă\\n1860 — испан çарĕсем Мароккори Тетуана оккупациленĕ\\n1861 — Америка Конфедераци Штачесем йĕркеленнĕ\\n1945 — Ливади керменĕнче Ялта конференцийĕ уçăлнă\\n1992 — Уго Чавес Венесуэлăра патшалăх пăтăрмахĕ тума пикеннĕ"},{"page_url":"https://en.wikipedia.org/wiki/Yehuda_Pen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Iehuda_Pen_Breakfast_SelfPortrait_1932.jpg","page_title":"Yehuda Pen","context_page_description":"Yehuda Pen, also known as Yuri Pen, was a Lithuanian Jewish painter and art teacher. He was a major figure of the Jewish Renaissance in Russian and Belarusian art at the beginning of 20th century. Pen's most famous student in Vitebsk was the great Jewish painter Marc Chagall."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B1%D8%AA%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Cartes3.JPG","page_title":"کارتس","context_page_description":"کارتس ایسپانیادا بیر یاشاییش منطقه‌سی‌دیر و کانتابریا اوستانینده یئرلشیب. ۴۰ متر دنیز سویه‌سیندن اۇجالیقی وار. بۇ شهرین مساحتی ۱۹٫۰۲ کیلومتر موربّع دیر. سوْن نۆفوس تخمین‌لرینه گؤره ۵٫۱۱۸ نفر دیر."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D6%80%D5%B8%D6%82%D5%B7%D5%A1%D5%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Runebergintorttu.jpg","page_title":"Հրուշակ","context_page_description":"Հրուշակ փոքր չափսի և քաղցր յուղահունց խմորից պատրաստված հրուշակեղեն՝ հիմնականում կրեմային միջուկով։"},{"page_url":"https://en.wikipedia.org/wiki/Assassination_of_John_F._Kennedy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/DealeyPlazaAerial.jpg","page_title":"Assassination of John F. Kennedy","context_page_description":"John F. Kennedy, the 35th President of the United States, was assassinated on Friday, November 22, 1963, at 12:30 p.m. Central Standard Time in Dallas, Texas, while riding in a presidential motorcade through Dealey Plaza. Kennedy was riding with his wife Jacqueline, Texas Governor John Connally, and Connally's wife Nellie when he was fatally shot by former U.S. Marine Lee Harvey Oswald firing in ambush from a nearby building. Governor Connally was seriously wounded in the attack. The motorcade rushed to Parkland Memorial Hospital where Kennedy was pronounced dead about 30 minutes after the shooting; Connally recovered.\\nOswald was arrested by the Dallas Police Department 70 minutes after the initial shooting. Oswald was charged under Texas state law with the murder of Kennedy, as well as that of Dallas policeman J. D. Tippit, who had been fatally shot a short time after the assassination. At 11:21 a.m. November 24, 1963, as live television cameras were covering his transfer from the city jail to the county jail, Oswald was fatally shot in the basement of Dallas Police Headquarters by Dallas nightclub operator Jack Ruby."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%A4%A9%E9%9A%9B%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Skyline_with_tugboat_-_Vancouver%2C_Canada_-_DSC09337.JPG","page_title":"天際線","context_page_description":"天际线是由城市中的高楼大厦与天空构成的整体结构，或者由许多摩天大厦所构成的局部景观。天际线被作为城市整体结构的人为天际，扮演着每座城市予人的独特印象，现今世上还没有两条天际线是一模一样的。在城市中，天际线展开一个广阔的天际景观，因此大城市都被叫作“城市风光影画片”。在许多大城市，摩天大厦在其天际线上都扮演着一个重要角色。\\n现时有众多评定全球出色天际线的组织或者网站，多以各城市的摩天大厦高度作为评定准则，亦有以审美学或者以建筑物高度与构成的天际线宽广度作为评定准则。其中全球最佳天际线网站的评选就是以此来评定城市天际线的得分，而世界上拥有最长的天际线的城市是有“东方之珠”美誉的香港。而天际线计法是相等于扣除最低值的90米或295呎后，所有建筑物高度的总和。而独立塔则以他们一半的高度来计算。\\n2012年，美国知名旅行网站Cheapflights.com选举出香港为“十大天际线”的城市之首。网站形容，在世界各大城市中，香港高楼林立，犹如“垂直城市”，发展迅速令城市景观日新月异。无论从太平山顶俯瞰，或者是从维多利亚港仰望，香港的城市全景都美丽得令人感叹。除了香港，其他上榜的城市包括了上海、纽约及巴黎等。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%81%D0%B5%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Psel_%28Velyka_BAhachka%29.jpg","page_title":"Псел","context_page_description":"Псел — річка, що протікає в Росії та Україні, — в межах Сумської області і Полтавської області. Ліва притока Дніпра.\\nПеретинає Придніпровську низовину."},{"page_url":"https://vi.wikipedia.org/wiki/World_Football_Challenge_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Yankee_Stadium_Football.jpg","page_title":"World Football Challenge 2012","context_page_description":"Giải bóng đá World Football Challenge 2012 là mùa giải thứ ba của giải World Football Challenge, một giải bóng đá giao hữu mùa hè được tổ chức tại Hoa Kỳ và Canada trong tháng 7 và tháng 8 năm 2012. Giải đấu khởi tranh vào ngày 18 tháng 7 năm 2012. Trận đấu khai mạc là giữa hai đội Seattle Sounders FC của giải Giải đấu Mỹ Giải Nhà Nghề Mỹ MLS và Chelsea của Giải bóng đá Ngoại hạng Anh khi đó Chelsea thắng 4-2. Real Madrid là đội giành danh hiệu mùa giải trước đã bất bại mùa giải này."},{"page_url":"https://es.wikipedia.org/wiki/Popay%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Popayan-Mapa_Rural.svg","page_title":"Popayán","context_page_description":"Popayán, ​ oficialmente Asunción de Popayán, es un municipio colombiano, capital del departamento del Cauca. Se encuentra localizado en el valle de Pubenza, entre la Cordillera Occidental y Central al suroccidente del país. Su extensión territorial es de 512 km², su altitud media es de 1760 m sobre el nivel del mar, su precipitación media anual de 1941 mm, su temperatura promedio de 14/19 °C y distancia aproximada de 600 km a Bogotá, capital de Colombia.\\nEs una de las ciudades más antiguas y mejor conservadas de América, lo que se ve reflejado en su arquitectura y tradiciones religiosas, reconocida por su arquitectura colonial y el cuidado de las fachadas. Popayán tiene uno de los centros históricos coloniales más grandes del país y América, con un total aproximado de 236 manzanas de sector histórico.\\nEn el 2005, la UNESCO designó a Popayán como Ciudad UNESCO de la Gastronomía​ por su variedad y significado para el patrimonio intangible de los colombianos. La cocina caucana fue seleccionada por mantener sus métodos tradicionales de preparación a través de la tradición oral.​​"},{"page_url":"https://de.wikipedia.org/wiki/Sparren_(Heraldik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/DEU_Verbandsgemeinde_Saarburg_COA.png","page_title":"Sparren (Heraldik)","context_page_description":"Unter einem Sparren versteht der Heraldiker das Heroldsbild in der Wappenkunde, welches zwei rechts und links der gedachten Wappenmittellinie schräg abfallende, an der Spitze miteinander verbundene Balken darstellt.\\nVerschiedene Bezeichnungen sind in alten heraldischen Büchern zu finden: Schleife, Sparrenstreif, Dachsparren oder nur Streif. Die Begrenzungslinien zum Schildhaupt werden mit Giebel bezeichnet. Unheraldisch sind Spießbalken oder Spitzbalken als Namen für den Sparren."},{"page_url":"https://et.wikipedia.org/wiki/Vaskvitriol","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/CuSO4.5H2O.jpg","page_title":"Vaskvitriol","context_page_description":"Vaskvitriol ehk vasksulfaat-5-vesi ehk vasksulfaat pentahüdraat, mille keemiline valem on CuSO₄·5H₂O, on vask(II)sulfaadi vesilahusest kristalliseeruv sinine keemiline ühend.\\nSeda kasutatakse näiteks taimekahjurite tõrjeks.\\nVaskvitriol esineb mineraal kalkantiidina.\\nVase vees lahustuvad ühendid on mürgised, ärritavad ja keskkonnale ohtlikud."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%BB%D0%B0%D1%81%D1%82%D0%B8%D0%BC%D0%B8%D1%80_%D0%82%D1%83%D0%B7%D0%B0_%D0%A1%D1%82%D0%BE%D1%98%D0%B8%D1%99%D0%BA%D0%BE%D0%B2%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/sr/7/78/Stevan_Kragujevic%2C_M._Tatic%2C_Acim_i_Djuza_Stojiljkovic.jpg","page_title":"Властимир Ђуза Стојиљковић","context_page_description":"Властимир „Ђуза” Стојиљковић био је српски глумац."},{"page_url":"https://en.wikipedia.org/wiki/Western_and_Atlantic_Railroad","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/CSXT_6045.jpg","page_title":"Western and Atlantic Railroad","context_page_description":"The Western & Atlantic Railroad of the State of Georgia is a government-owned railroad and is currently leased by CSX, which CSX operates in the Southeastern United States from Atlanta, Georgia, to Chattanooga, Tennessee.\\nIt was founded on December 21, 1836. The city of Atlanta was founded as the terminus of the W&A, with the terminus marked with the Atlanta Zero Mile Post. The line is still owned by the State of Georgia from Atlanta to CT Tower in Chattanooga; it is leased by CSX Transportation.\\nThe W&A Subdivision is a railroad line leased by CSX Transportation in the U.S. states of Tennessee and Georgia. The line runs from Chattanooga to Marietta, Georgia for a total of 119.1 miles. At its north end, it continues south from the Chattanooga Subdivision of the Nashville Division and at its south end it continues south as the Atlanta Terminal Subdivision.\\nThis line, originally built to 5 ft gauge, is famous because of the Andrews Raid, which took place on the W&A during the American Civil War on the morning of April 12, 1862."},{"page_url":"https://oc.wikipedia.org/wiki/Esperidas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Orbis_vetus_in_utr%C3%A2que_continente_juxt%C3%A0_mentem_Sansonianam_distinctus%2C_nec_non_observationibus_astronomicis_-_Norman_B._Leventhal_Map_Center_at_the_BPL.jpg","page_title":"Esperidas","context_page_description":"Dins la mitologia grèga, las Esperidas son las ninfas del Ponent, filhas d'Atlas e d'Esperis. Son tradicionalament tres. Domoran dins un vergièr fabulós, lo jardin de las Esperidas, situat al tèrme occidental del mond."},{"page_url":"https://es.wikipedia.org/wiki/La_Torre_(banda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Int-2804.jpg","page_title":"La Torre (banda)","context_page_description":"La Torre fue una banda argentina de hard rock y heavy metal de los años 1980, cuya vocalista fue Patricia Sosa. Esta banda se convirtió en una de las más populares del hard rock de su país de los ochentas, se disolvió a fines de la década, dando paso a la carrera solista de Sosa."},{"page_url":"https://fr.wikipedia.org/wiki/Texas_Instruments","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Texas_instruments_gate3_dallas_tx_usa_2009-08-07.jpg","page_title":"Texas Instruments","context_page_description":"Texas Instruments est une entreprise d'électronique américaine renommée dans le domaine des composants électroniques passifs et des semi-conducteurs fondée en 1941. Son siège est à Dallas, Texas. TI compte plus de 30 000 employés et un catalogue de plus de 80 000 produits, notamment des microcontrôleurs, processeurs, capteurs, connectivité sans fil et calculatrices scientifiques."},{"page_url":"https://de.wikipedia.org/wiki/Davie_Selke","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Hertha_BSC_vs._West_Ham_United_20190731_%28098%29.jpg","page_title":"Davie Selke","context_page_description":"Davie Selke ist ein deutscher Fußballspieler äthiopischer und tschechischer Abstammung. Er steht seit Ende Januar 2020 als Leihspieler von Hertha BSC bei Werder Bremen unter Vertrag."},{"page_url":"https://en.wikipedia.org/wiki/2011_southern_Israel_cross-border_attacks","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Terror_Strikes_Israeli_Civilians_in_Southern_Israel_%288%29.jpg","page_title":"2011 southern Israel cross-border attacks","context_page_description":"On August 18, 2011, a series of cross-border attacks with parallel attacks and mutual cover was carried out in southern Israel on Highway 12 near the Egyptian border by a squad of presumably 12 militants in four groups. The attacks occurred after Israel's interior security service Shin Bet had warned of an attack by militants in the region and Israeli troops had been stationed in the area. The militants first opened fire at an Egged No. 392 bus as it was traveling on Highway 12 in the Negev near Eilat. Several minutes later, a bomb was detonated next to an Israeli army patrol along Israel's border with Egypt. In a third attack, an anti-tank missile hit a private vehicle, killing four civilians. Eight Israelis – six civilians, one Yamam special unit police sniper and one Golani Brigade soldier—were killed in the multiple-stage attack. The Israel Defense Forces reported eight attackers killed, and Egyptian security forces reported killing another two.\\nFive Egyptian soldiers were also killed."},{"page_url":"https://fr.wikipedia.org/wiki/Hockey_Club_Arosa","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Logo_EHC_Arosa.JPG","page_title":"Hockey Club Arosa","context_page_description":"Le HC Arosa est un club de hockey sur glace du village de Arosa dans le canton des Grisons en Suisse. Fondé en 1924, il a remporté neuf titres de champion de Suisse, dont sept de suite au début des années 1950. Il est le troisième club le plus titré de Suisse, derrière le HC Davos et le CP Berne.\\nSon président est Ludwig Waidacher."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8F%90%E6%91%A9%E5%A4%AA%C2%B7%E5%8D%A1%E6%96%AF%E6%B3%B0%E5%B0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Timothy_Castagne_01.jpg","page_title":"提摩太·卡斯泰尼","context_page_description":"蒂莫西·卡斯塔涅是一名比利時的職業足球員，司職右後衛，他現在效力於義大利足球甲級聯賽球隊亞特蘭大足球俱樂部。\\n卡斯塔涅從少加盟比利時足球甲級聯賽球隊亨克青年軍，並在2014年9月14日首次為一線隊上場對戰布魯日。"},{"page_url":"https://en.wikipedia.org/wiki/Odontotermes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Bulletin_du_Mus%C3%A9um_d%27histoire_naturelle_%281914%29_%2820439769575%29.jpg","page_title":"Odontotermes","context_page_description":"Odontotermes, commonly known as the fungus-growing termites, is a termite genus belonging to family Termitidae, which is native to the Old World. They are most destructive in wooden homes, and are agricultural pests in the tropics and subtropics of Africa and Asia."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%A0e%C5%99%C3%ADk_karpatsk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Syringa-josikaea-flowering.JPG","page_title":"Šeřík karpatský","context_page_description":"Šeřík karpatský je rostlina z čeledi olivovníkovité. Vzrůstem dosahuje velikosti keře vysokého až jeden a půl metru.\\nŠeřík karpatský kvete v měsíci červnu. Jeho květy jsou růžové. Stavbou jsou pak trubkovité, čtyřcípé. Vyznačují se také svojí charakteristickou vůní.\\nVysazován je díky své nenáročnosti a mrazuvzdornosti. Daří se mu však lépe na slunečných místech."},{"page_url":"https://ca.wikipedia.org/wiki/El_Comellaret","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Abella_de_la_Conca._El_Comellaret.svg","page_title":"El Comellaret","context_page_description":"El Comellaret, en alguns mapes escrit Comelleret, és un indret del terme municipal d'Abella de la Conca, a la comarca del Pallars Jussà.\\nEs tracta d'uns antics camps de conreu situats en un petit comellar, actualment abandonats i en part convertits en bosc, situats a força alçada, als peus de la cinglera meridional de la Serra de Carreu. És a llevant de la Borda del Paulí, en el lloc on acaba actualment el Camí de les Bordes."},{"page_url":"https://gl.wikipedia.org/wiki/Arciprestado_de_Monelos","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Parroquia_de_Santa_Tareixa_de_Xes%C3%BAs.jpg","page_title":"Arciprestado de Monelos","context_page_description":"O Arciprestado de Monelos foi un arciprestados da arquidiocese de Santiago de Compostela. Pertencía á vigairía da Coruña e abranguía 12 parroquias do concello da Coruña. Recibe o nome polo barrio homónimo da cidade."},{"page_url":"https://de.wikipedia.org/wiki/Frankfurt_(Oder)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Gedenkstein_Synagoge.JPG","page_title":"Frankfurt (Oder)","context_page_description":"Frankfurt (Oder), genannt auch Frankfurt an der Oder, ist eine am Westufer der Oder gelegene kreisfreie Stadt im östlichen Brandenburg. Die polnische Nachbarstadt Słubice entstand 1945 aus dem Frankfurter Stadtteil Dammvorstadt. Seit 1999 führt Frankfurt die Zusatzbezeichnung „Kleiststadt“ nach ihrem berühmtesten Sohn Heinrich von Kleist. Mit der Neugründung der Europa-Universität Viadrina 1991 ist Frankfurt (Oder) wieder eine Universitätsstadt.\\nFrühere Formen des Ortsnamens Frankfurt waren „Vrankenforde“, „Frankenforde“, „Francfurd“ bzw. „Franckfurde“ und „Franckfurt an der Oder“. Angenommen wird dabei eine Namensübertragung von Frankfurt am Main."},{"page_url":"https://nl.wikipedia.org/wiki/Emmanuel_van_Speybrouck","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Portret_van_Emmanuel_van_Speybrouck-Coutteau%2C_circa_1771%2C_Groeningemuseum%2C_0040195000_%28cropped%29.jpg","page_title":"Emmanuel van Speybrouck","context_page_description":"Emmanuel van Speybrouck was architect, meester-timmerman en aannemer van bouwwerken in Brugge."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%A8%D7%95%D7%9C%D7%98%D7%94_%D7%A9%D7%98%D7%99%D7%99%D7%A0%D7%91%D7%A8%D7%92%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Steinberger_Sarolta.jpg","page_title":"שרולטה שטיינברגר","context_page_description":"שרולטה שטיינברגר הייתה רופאת נשים הונגרית-יהודיה, הרופאה הראשונה שסיימה את לימודיה והוסמכה באוניברסיטת בודפשט."},{"page_url":"https://pl.wikipedia.org/wiki/Puits","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Puits02.JPG","page_title":"Puits","context_page_description":"Puits – miejscowość i gmina we Francji, w regionie Burgundia-Franche-Comté, w departamencie Côte-d’Or.\\nWedług danych na rok 1990 gminę zamieszkiwało 138 osób, a gęstość zaludnienia wynosiła 7 osób/km²."},{"page_url":"https://sv.wikipedia.org/wiki/Malouy","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Map_commune_FR_insee_code_27381.png","page_title":"Malouy","context_page_description":"Malouy är en kommun i departementet Eure i regionen Normandie i norra Frankrike. Kommunen ligger i kantonen Bernay-Ouest som tillhör arrondissementet Bernay. År 2009 hade Malouy 130 invånare."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%A5%D1%8F%D1%82%D0%B0%D0%B4_%D0%B4%D0%B0%D1%85%D1%8C_%D0%A5%D1%8D%D0%BD_%D0%BD%D1%8C_%D0%A5%D1%8D%D0%BD_%D0%B1%D1%8D%3F","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Guo_Weimin.jpg","page_title":"Хятад дахь Хэн нь Хэн бэ?","context_page_description":"Хятад дахь Хэн нь Хэн бэ? — Японы Засгийн газраас эрхлэн хэвлүүлэн гаргаж байсан намтрын лавлах. Энэхүү ном нь Хятадын Гоминдаан, Коммунист нам болон Вань Зинвейн тоглоомын засгийн газрын 325 улс төр, цэргийн болон урлаг, шинжлэх ухааны зүтгэлтэн хүний намтруудын эмхтгэл ном. Номыг 1941 оны 2 сард хэвлэсэн бөгөөд өнөөдөр тухайн үеийн төлөөллийг судлах үнэт эх сурвалж болдог."},{"page_url":"https://pl.wikipedia.org/wiki/Czapla_maskowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Ardea_humbloti.jpg","page_title":"Czapla maskowa","context_page_description":"Czapla maskowa – gatunek ptaka z rodziny czaplowatych. Występuje na północnym i zachodnim wybrzeżu Madagaskaru oraz w rejonie jeziora Alaotra. Zamieszkuje także Komory i Majottę.\\nJest to gatunek zagrożony, jego populację o tendencji spadkowej szacuje się na nie więcej niż 1500 osobników. Największym zagrożeniem dla czapli maskowej jest łowiectwo oraz niszczenie siedlisk – wycinka drzew, na których gniazduje oraz zanikanie mokradeł."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A6%BF%E0%A6%A4%E0%A6%BE%E0%A6%B0%E0%A6%BE_%E0%A6%AC%E0%A7%87%E0%A6%97%E0%A6%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Bir_Protic_Sitara_Begum_-_2.jpg","page_title":"সিতারা বেগম","context_page_description":"ডা. ক্যাপ্টেন সিতারা রহমান একজন নারী মুক্তিযোদ্ধা। ১৯৭১ সালের বাংলাদেশের স্বাধীনতা যুদ্ধে বিশেষ অবদানের জন্য তিনি বীর প্রতীক উপাধিতে ভূষিত হন।"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%A1%E7%88%BE%E5%8D%A1%E8%AB%BE%E6%AD%A5%E6%A7%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Moschetto_91_-_38.jpg","page_title":"卡爾卡諾步槍","context_page_description":"卡爾卡諾是一系列義大利常用的栓動式槍機操作式軍用步槍和卡賓槍，最初於1891年推出時，發射的是6.5×52公釐曼利徹-卡爾卡諾口徑無緣式步槍子彈。\\n這把步槍是由首席技師薩爾瓦多·卡爾卡諾在都靈軍兵工廠於1890年研發，並且稱為M91。它先後取代了以往的10.35×47公釐RVetterli-維塔利步槍和卡賓槍以，在1892年到1945年之間生產。在第一次世界大戰期間的大多數義大利部隊和第二次世界大戰中的義大利以及德國軍隊之中一些部隊裡，採用了M91的步槍和卡賓槍各兩種的型號。在過程中，步槍也被芬蘭於冬季戰爭中使用，以後又在敘利亞、利比亞、突尼西亞和阿爾及利亞這些國家戰後的各種衝突中被正規和非正規部隊使用。\\n卡爾卡諾義式步槍是由義大利為日本帝國陸軍在第二次世界大戰之前生產的步槍。1937年中日開戰以後，為了鞏固當時逐漸成型的軸心國關係以及為了補充戰爭損失的軍火、但有坂將其生產的所有步槍都按要求向帝國陸軍供給以下，帝國海軍向義大利訂購了一批步槍。原先日本要求這批卡爾卡諾步槍必須是完全以三八式步槍的規格製造，但是被義大利以數量不足以開闢生產線的原因拒絕；義大利以降低成本及製造時間的誘因讓日本答應了這批步槍使用卡爾卡諾步槍的槍機並搭配三八式步槍的設計，但保留了有坂／毛瑟式5發內置式彈倉。這批步槍發射6.5×50公釐有坂口徑步槍子彈，並於1938至1939年間運回日本本國，由日本將這批步槍稱為義式步槍以後，主要是給帝國海軍使用。義大利兵工廠為日本生產大約60,000把義式步槍。"},{"page_url":"https://fr.wikipedia.org/wiki/Soucy_(Aisne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Soucy_%28Aisne%29_vue_sur_le_bas_du_village.JPG","page_title":"Soucy (Aisne)","context_page_description":"Soucy est une commune française située dans le département de l'Aisne, en région Hauts-de-France."},{"page_url":"https://en.wikipedia.org/wiki/Juan_Valdivia","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Juan_Valdivia_en_concierto.jpg","page_title":"Juan Valdivia","context_page_description":"Juan Valdivia Navarro, is a Spanish musician and songwriter. He became famous internationally for being the lead guitarist of Héroes del Silencio. He is known by his fans as \\"El Maestro\\" and has a school named after him in Ratanpur, India."},{"page_url":"https://en.wikipedia.org/wiki/Military_history_of_the_Mi%EA%9E%8Ckmaq_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Mi%27kmaqVeteranLegacyProjectNovaScotiaMuseum.jpg","page_title":"Military history of the Miꞌkmaq people","context_page_description":"Miꞌkmaq militias were made up of Miꞌkmaq warriors who worked independently as well as in coordination with the Wabanaki Confederacy, French and Acadian forces throughout the colonial period to defend their homeland Miꞌkmaꞌki against the English. The Miꞌkmaq militias deployed effective resistance for over 75 years before the Halifax Treaties were signed. In the nineteenth century, the Miꞌkmaq \\"boasted\\" that, in their contest with the British, the Miꞌkmaq \\"killed more men than they lost\\". In 1753, Charles Morris stated that the Miꞌkmaq have the advantage of \\"no settlement or place of abode, but wandering from place to place in unknown and, therefore, inaccessible woods, is so great that it has hitherto rendered all attempts to surprise them ineffectual\\". Leadership on both sides of the conflict employed standard colonial warfare, which included scalping non-combatants. After some engagements against the British during the American Revolution, the militias were dormant throughout the nineteenth century, while the Miꞌkmaq people used diplomatic efforts to have the local authorities honour the treaties."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89quipe_du_pays_de_Galles_de_rugby_%C3%A0_XV","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Prince_of_Wales%27s_feathers_Badge.svg","page_title":"Équipe du pays de Galles de rugby à XV","context_page_description":"L'équipe du pays de Galles de rugby à XV est l'équipe nationale qui représente le pays de Galles dans les compétitions internationales majeures de rugby à XV, la Coupe du monde de rugby à XV et le Tournoi des Six Nations.\\nElle est considérée comme l’une des meilleures sélections nationales au monde en raison de son palmarès et, au 5 octobre 2015, cinquième au classement des équipes nationales de rugby à XV. En particulier, plusieurs joueurs gallois des années 1970, les Barry John, Gareth Edwards, JPR Williams, Phil Bennett, John Taylor et Gerald Davies, sont reconnus parmi les plus grands joueurs de l'histoire du rugby à XV. Les années 1980 et 1990 ont entamé le crédit des Gallois. Cependant, l'année 2005 voit le retour en grâce d'un jeu gallois dynamique et offensif.\\nLa Welsh Rugby Union a la charge de gérer l'équipe du pays de Galles de rugby à XV, qui dispute ses matches à domicile au Millennium Stadium de Cardiff. Le rugby à XV est un sport populaire qui fait partie de la culture nationale du pays de Galles."},{"page_url":"https://az.wikipedia.org/wiki/M270_MLRS","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/MLRS_05.jpg","page_title":"M270 MLRS","context_page_description":"M270 MLRS — ilk dəfə ABŞ tərəfindən istehsal olunan çox lüləli raketatan sistemi. Birdən çox raketi saxlayan bu silah orduda topçulara dəstək olmaq üçün istifadə olunur. Peyklə idarə olunan raketlərlə saatda 90 km sürətlə gedərkən 187 km-ə nöqtə atışı edə bilir. Ləqəbi \\"Çöl pələngi\\"dir.\\n227 mm-lik \\"M270\\" reaktiv yaylım atəş sistemi.\\nİstehsalçı: ABŞ\\nLülə diametri: 227 mm\\nLülə sayı: 12 ədəd\\nMəhvetmə radiusu: 25.000 m²\\nSalvo Atış müddəti: 60 saniyə\\nAtəş məsafəsi: 120 km"},{"page_url":"https://be.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B9_%D0%94%D0%B6%D0%BE%D0%BD%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Roy_Jones_Jr._gives_an_autograph.jpg","page_title":"Рой Джонс","context_page_description":"Рой Левеста Джонс малодшы — амерыканскі баксёр-прафесіянал. Сярэбраны прызёр Алімпійскіх гульняў 1988 года. Чэмпіён свету ў сярэдняй, другой сярэдняй, паўцяжкай і цяжкай вагавых катэгорыях. Амерыканская асацыяцыя журналістаў, якая піша пра бокс, назвала Джонса «баксёрам дзесяцігоддзя» у 90-х гадах."},{"page_url":"https://en.wikipedia.org/wiki/Ricardo_G%C3%B3mez_Roji","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Universidad_Pontificia_%28Comillas%29.jpg","page_title":"Ricardo Gómez Roji","context_page_description":"Ricardo Gómez Roji was a Spanish Roman-Catholic priest, scholar, publisher and politician. For 26 years he served as a lecturing canon by the Burgos cathedral, known locally for his oratory skills; he also taught theology at the Pontifical University of Salamanca, animated local Catholic agrarian trade unions, and edited and managed few Catholic periodicals and bulletins. His political career climaxed in 1931-1933; elected to the Congress of Deputies as a candidate of a broad local monarchist-Integrist-conservative alliance, he served one term within the Agrarian parliamentary minority. Afterwards he approached Carlism and advanced its cause as a propagandist."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E8%81%96%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Metropolitan_Cathedral_of_Athens02.JPG","page_title":"大聖堂","context_page_description":"大聖堂は、キリスト教の宗教建築の種別のひとつ。語義には教派によって差がある。日本のカトリック教会では「カテドラル」との片仮名表記も頻繁に用いられるが、日本の他教派ではこれはあまり用いられない。"},{"page_url":"https://fr.wikipedia.org/wiki/C%C3%A9or","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Le_C%C3%A9or.jpg","page_title":"Céor","context_page_description":"Le Céor est une rivière du sud de la France, affluent du Viaur et sous-affluent de la Garonne par l'Aveyron et le Tarn."},{"page_url":"https://hu.wikipedia.org/wiki/Werfenweng","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Werfenweng_im_Bezirk_JO.png","page_title":"Werfenweng","context_page_description":"Werfenweng osztrák község Salzburg tartomány Sankt Johann im Pongau-i járásában. 2018 januárjában 1012 lakosa volt."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%B9%BF%E9%87%8E%E5%9C%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Luye_Waterway05.jpg","page_title":"鹿野圳","context_page_description":"鹿野圳為臺灣臺東縣鹿野鄉境內的一座灌溉水圳系統，其最早興建於西元1953年耗時約4年於1957年完工通水，目前由臺東農田水利會鹿野工作站進行管理與維護。"},{"page_url":"https://ro.wikipedia.org/wiki/Call_centru_bazat_pe_protocoale_IP","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Orange_call_centrum.jpg","page_title":"Call centru bazat pe protocoale IP","context_page_description":"Call centru sau Customer-Care-Center reprezintă un birou centralizat, creat ca destinație pentru recepționarea și efectuarea a unui volum mare de cereri prin telefon. Call centru este gestionat de catre companie pentru a oferi asistență și informatii referitor la produsele și serviciile sale la solicitarea clienților.\\nUn call center își ia activitatea prin intermediul unui spațiu de lucru deschis extins pentru agenții call center, cu stații de lucru care să includă un calculator pentru fiecare agent, un set de telefon, setul cu cască conectat la un comutator de telecomunicații, și una sau mai multe stații de supraveghere. Acesta poate fi operat independent sau în rețea cu centrele suplimentare, de multe ori legat la un computer din rețeaua corporativă, inclusiv mainframe-uri, microcalculatoare si rețeaua locală. Din ce în ce, caile de voce și de date în centru sunt legate printr-un set de noi tehnologii care integreaza telefonia si calculatoarele."},{"page_url":"https://gl.wikipedia.org/wiki/William_Godwin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/William_Godwin_by_Henry_William_Pickersgill.jpg","page_title":"William Godwin","context_page_description":"William Godwin, nado o 3 de marzo de 1756 e finado o 7 de abril de 1836, fillo dun pastor disidente, foi un escritor político e polígrafo británico, considerado como un dos máis importantes precursores das escolas anarquista e utilitarista. Foi tamén célebre polas mulleres da súa vida. Casado con Mary Wollstonecraft, escritora feminista, en 1797, tiveran unha filla, Mary Wollstonecraft Godwin, máis coñecida como Mary Shelley, que escribiu Frankenstein ou o moderno Prometeo, e foi esposa do poeta Percy Shelley.\\nGodwin volveuse recoñecido decontado co libro The Inquiry concerning Political Justice, and its influence on General Virtue and Happiness, citado con frecuencia abreviadamente como Political Justice, obra en dous volumes, que acadou varias edicións ata mediados do XIX, en pleno fervor revolucionario. Malthus escribe o seu Ensaio sobre o principio da poboación como resposta a Godwin. O autor efectúa unha corrosiva crítica da sociedade, baseada en tres principios:\\nO ser humano depende totalmente da organización social, mal elaborada, que o corrompe. Ninguén é responsábel total dos seus actos, en consecuencia.\\nDebe respectarse a liberdade."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E9%87%8C%E7%94%B3%E9%98%BF%E7%88%BE%E5%8D%91%E6%96%AF%E5%B1%B1%E8%84%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Cima_Brenta_Alta_-_Dolomiti_di_Brenta.jpg","page_title":"南里申阿爾卑斯山脈","context_page_description":"南里申阿尔卑斯山脉是意大利的山脉，是南莱姆斯通阿尔卑斯山脉的一部分，横跨特伦蒂诺-上阿迪杰和伦巴底，最高点海拔高度3,905米。"},{"page_url":"https://en.wikipedia.org/wiki/Greg_Brooks_(American_football)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Greg_Brooks_Bengals.jpg","page_title":"Greg Brooks (American football)","context_page_description":"Greg Brooks is a former American football cornerback with the Cincinnati Bengals in the National Football League. He played high school football at Archbishop Shaw High School in Marrero, Louisiana."},{"page_url":"https://en.wikipedia.org/wiki/Open_mic","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Open_Mic_No_Name_Bar_Sausalito_CA_July_2008.jpg","page_title":"Open mic","context_page_description":"An open mic is a live show at a coffeehouse, nightclub, comedy club, strip club, institution or pub at which audience members who are amateur or professional may perform on stage, often for the first time, or to promote an upcoming performance. Typically, as the name suggests, the performer is provided with a microphone which is plugged into a PA system, to make the individual's performance loud enough for the audience to hear. Often the performers sign up in advance for a time slot with the host or master of ceremonies, typically an experienced performer or the venue manager or owner. The master of ceremonies may screen potential candidates for suitability for the venue and give individuals a time to perform in the show. These events are focused on performance arts like poetry and spoken word, music, and comedy. Less commonly, small groups, such as a small rock band duo/trio or a comedy duo may appear. Group performances are uncommon, because of the space and the logistics of loading in and soundchecking such a group. In strip club terms, amateur night is a contest for everyday women and men who compete for a cash prize by taking their clothes off just like everyday strippers."},{"page_url":"https://az.wikipedia.org/wiki/D%C3%BCnya_%C3%B6lk%C9%99l%C9%99rinin_pul_vahidl%C9%99ri","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/100_Armenian_dram_-_1998_%28obverse%29.png","page_title":"Dünya ölkələrinin pul vahidləri","context_page_description":null},{"page_url":"https://id.wikipedia.org/wiki/Proton_Persona","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Proton_Persona_%28rear%29%2C_Serdang.jpg","page_title":"Proton Persona","context_page_description":"Proton Persona adalah mobil sedan kompak produksi perusahaan mobil Malaysia, Proton. Persona aslinya didesain menurut model Proton Gen-2. Nama Persona dipilih untuk menggantikan Proton Wira. Sebelumnya, model Persona didesain berdasarkan model Proton Wira yang diekspor ke Inggris. Desain eksterior Persona mengambil inspirasi dari wau bulan dengan gagang keris."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%B1%CE%BA%CE%AF%CE%B1_%CE%B2%CE%BB%CE%AC%CF%83%CF%84%CE%B7%CF%83%CE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/I_colori_di_Pantalica.jpg","page_title":"Μακία βλάστηση","context_page_description":"Η Μακία είναι τύπος θαμνώδους βλάστησης, η οποία αποτελείται από αείφυλλα σκληρόφυλλα φυτά και από μικρά δένδρα. Ο όρος maquis προήλθε από τις παραθαλάσσιες περιοχές της Γαλλίας ή από την Κορσική και χρησιμοποιείται διεθνώς."},{"page_url":"https://ru.wikipedia.org/wiki/A_Night_at_the_Opera_Tour","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/ANATOTOUR.jpg","page_title":"A Night at the Opera Tour","context_page_description":"A Night At The Opera Tour — концертный тур британской рок-группы Queen, устроенный в поддержку их альбома A Night at the Opera. В его рамках группа посетила Европу, США, Японию и Австралию. Запись рождественского концерта в Hammersmith Odeon вышла 20 октября 2015 года в концертном альбоме «A Night at the Odeon — Hammersmith 1975»"},{"page_url":"https://nl.wikipedia.org/wiki/Blue_Rocks_Ronse-Kluisbergen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Flag_of_Ronse.png","page_title":"Blue Rocks Ronse-Kluisbergen","context_page_description":"Blue Rocks Ronse-Kluisbergen is een Belgische basketbalclub aangesloten bij Basketbal Vlaanderen onder stamnummer 552. Blue Rocks ontstond in 2012 na een fusie tussen KBT Ronse SK en BBC Kluisbergen.\\nDe herenploeg treedt aan in 1ste landelijke afdeling. De dames spelen in 1ste provinciale. Verder heeft Blue Rocks jeugdploegen in diverse jeugdcategoriën; zowel voor jongens als meisjes. In het seizoen 2016-2017 telt Blue Rocks 3 senior- en 10 jeugdploegen.\\nDe thuiswedstrijden gaan door in sporthal Kluisbos te Kluisbergen.\\nDe trainingen voor de meeste jeugdploegen worden ook afgewerkt in sporthal 't Rosco in Ronse.\\nEén van de hoogtepunten in de nog jonge geschiedenis van Blue Rocks was de overwinning van de heren-A in de beker van Vlaanderen tegen 2de Nationaler Soba Antwerpen met 101-98 op 10 november 2014.\\nIn het seizoen 2014-2015 wonnen zowel de U14 meisjes als de heren-A de beker van Oost-Vlaanderen.\\nDe dames-B werden in het seizoen 2015-2016 kampioen in 1ste provinciale, nadat zij een jaar eerder te titel behaalden in 2de provinciale. Doordat de dames-A al in 2de landelijke spelen, blijven de dames-B ondanks die titel in 1ste Provinciale."},{"page_url":"https://en.wikipedia.org/wiki/SoftBank_Group","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Vodafone_Mobile_SHOP_ikebukuro_japan.jpg","page_title":"SoftBank Group","context_page_description":"SoftBank Group Corp. is a Japanese multinational conglomerate holding company headquartered in Tokyo. SoftBank owns stakes in many technology, energy, and financial companies. It also runs Vision Fund, the world's largest technology-focused venture capital fund, with over $100 billion in capital.\\nThe company is known for its leadership by founder Masayoshi Son. It operates in broadband, fixed-line telecommunications, e-commerce, internet, technology services, finance, media and marketing, semiconductor design, and other areas.\\nSoftBank was ranked in the Forbes Global 2000 list as the 36th largest public company in the world, and the second largest publicly traded company in Japan after Toyota.\\nThe logo of SoftBank is based on the flag of the Kaientai, a naval trading company that was founded in 1865, near the end of the Tokugawa shogunate, by Sakamoto Ryōma.\\nAlthough SoftBank does not affiliate itself to any traditional keiretsu, it has close ties with Mizuho Financial Group, its main lender."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%BE%D1%81%D0%B8%D0%BB%D0%B5%D0%B3%D1%80%D0%B0%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Bosilegrad-school-1.jpg","page_title":"Босилеград","context_page_description":"Босилеград или Босиљград је седиште општине Босилеград у Пчињском округу. Према попису из 2011. било је 2624 становника."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Inambari","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/R%C3%ADo_Inambari%2C_lugar_donde_se_proyecta_construir_una_represa_hidroel%C3%A9ctrica.JPG","page_title":"Río Inambari","context_page_description":"El río Inambari es un río amazónico peruano, afluente del río Madre de Dios, que discurre por los departamentos de Puno, Cusco y Madre de Dios."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1965","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Denis_Irwin_%282017-07-29_img06%29.jpg","page_title":"Lijst van personen geboren in 1965","context_page_description":"Dit is een lijst van personen die geboren zijn in 1965.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://pl.wikipedia.org/wiki/Hohentauern","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Hohentauern_vom_Berg_aus_gesehen.JPG","page_title":"Hohentauern","context_page_description":"Hohentauern – gmina w Austrii, w kraju związkowym Styria, w powiecie Murtal. Według Austriackiego Urzędu Statystycznego liczyła 433 mieszkańców."},{"page_url":"https://gl.wikipedia.org/wiki/Reserva_da_biosfera_Vidzeme_norte","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Engelu_ala.jpg","page_title":"Reserva da biosfera Vidzeme norte","context_page_description":"A reserva da biosfera Vidzeme norte é a única reserva da biosfera de Letonia. Cubre un área de 60 quilómetros sobre o Golfo de Riga e o interior da rexión de Vidzeme, veciña a Estonia."},{"page_url":"https://de.wikipedia.org/wiki/Emil_Thomas_(Schauspieler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Slevogt_Thomas_02.jpg","page_title":"Emil Thomas (Schauspieler)","context_page_description":"Emil Thomas war ein deutscher Schauspieler und Theaterdirektor."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%8A%D8%B3%D9%88%D9%86_%D8%AC%D8%B1%D8%A7%D9%86%D8%AC%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Jayson_Granger_15_-_Saski_Baskonia_20171215.jpg","page_title":"جيسون جرانجر","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجيسون جرانجر لاعب كرة سله من ايطاليا و اوروجواى."},{"page_url":"https://de.wikipedia.org/wiki/Steinbr%C3%BCcke_1,_2_(Quedlinburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Steinbr%C3%BCcke1_2_qlb.JPG","page_title":"Steinbrücke 1, 2 (Quedlinburg)","context_page_description":"Das Haus Steinbrücke 1, 2 ist ein denkmalgeschütztes Gebäude in der Stadt Quedlinburg in Sachsen-Anhalt."},{"page_url":"https://en.wikipedia.org/wiki/Longages","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Mairie_de_Longages.JPG","page_title":"Longages","context_page_description":"Longages is a commune in the Haute-Garonne department in southwestern France."},{"page_url":"https://pl.wikipedia.org/wiki/Gernikako_Arbola","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Bizkaikoarmarri.svg","page_title":"Gernikako Arbola","context_page_description":"Drzewo z Gerniki – dąb symbolizujący wolności biskajskie i szerzej – baskijskie, stojący w mieście Gernika."},{"page_url":"https://hu.wikipedia.org/wiki/Eichen_(Westerwald)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Eichen_%28Westerwald%29_001.jpg","page_title":"Eichen (Westerwald)","context_page_description":"Eichen település Németországban, Rajna-vidék-Pfalz tartományban. Lakosainak száma 551 fő. +/-"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%B8%D5%B6%D5%B2%D5%B8%D5%AC-%D5%A9%D5%A1%D5%A9%D5%A1%D6%80%D5%B6%D5%A5%D6%80%D5%AB_%D5%BF%D5%AB%D6%80%D5%A1%D5%BA%D5%A5%D5%BF%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6%D5%A8_%D5%80%D5%A1%D5%B5%D5%A1%D5%BD%D5%BF%D5%A1%D5%B6%D5%B8%D6%82%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Hetoum_and_Zabel.jpeg","page_title":"Մոնղոլ-թաթարների տիրապետությունը Հայաստանում","context_page_description":"Մոնղոլ-թաթարների տիրապետությունը Հայաստանում հաստատվել է 13-րդ դարի ընթացքում։ Այն հայոց պատմության մեջ կենտրոնասիական ցեղերի երկրորդ հարձակումն էր՝ սելջուկ-թյուրքերից հետո ։\\nՄոնղոլների տիրապետությունը Հայաստանում վերջնականապես անկում է ապրել 14-րդ դարում, երբ Հայկական լեռնաշխարհը դարձել է թուրքմենական 2 ցեղախմբերի՝ Կարակոյունլուների, ապա՝ Ակկոյունլուների տերության մասը։"},{"page_url":"https://en.wikipedia.org/wiki/Adelaide-Blanche_of_Anjou","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Bescher-Rois_et_reines_de_France_en_estampes-Blanche_d%27Aquitaine_%28cropped%29.jpg","page_title":"Adelaide-Blanche of Anjou","context_page_description":"Adelaide-Blanche of Anjou was the countess consort by marriage of Gévaudan and Forez, of Toulouse, of Provence, and of Burgundy; and queen consort of Aquitaine. She was the regent of Gevaudan during the minority of her sons in the 960s, and the regent of Provence during the minority of her stepson from 994 until 999."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%96%D0%B0%D0%BC%D0%B0%D0%BB_%D0%9C%D1%8E%D1%80%D1%80%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Jamal-Murray-2.jpg","page_title":"Жамал Мюррей","context_page_description":"Жамал Мюррей Америкийн Үндэсний Сагсан бөмбөгийн Холбоо-ны Денвер Наггетс багт харьяалагддаг мэргэжлийн сагсан бөмбөгчин. 2016 оны NBA-гийн драфтын 1-р тойргийн 7-р сонголтоор сонгогдсон. 2015 онд Nike брэндийн жил бүр зохиодог Nike Hoop Summit тэмцээний үнэ цэнтэй тоглогчоор шалгарсан. Тэрээр нэг жил Кентаккийн Их Сургуульд суралцаж, коллежийн сагсан бөмбөгийн тэмцээнд оролцож байв."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B6%D0%B5%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Obsolete_Russian_units_of_length_-_ru.svg","page_title":"Сажень","context_page_description":"Са́жень, или саже́нь — старорусская единица измерения расстояния.\\nВ XVII веке основной мерой была казённая сажень, равная 2,16 метра и содержащая три аршина по 16 вершков. Во времена Петра І русские меры длины были уравнены с английскими. Один аршин принял значение 28 английских дюймов, а сажень — 7 английских футов, то есть 213,36 см. 11 октября 1835 года, согласно указанию Николая I «О системе российских мер и весов», длина сажени была подтверждена: 1 сажень была приравнена к длине 7 английских футов, то есть к тем же 213,36 см. С введением в 1924 году в Союзе ССР метрической системы мер вышла из употребления."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D8%A7%D9%88%D9%86%D8%AA_%D8%A7%D9%84%DB%8C%D9%88%D8%AA%D8%8C_%DA%A9%D9%86%D8%AA%D8%A7%DA%A9%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/KYMap-doton-MountOlivet.PNG","page_title":"ماونت الیوت، کنتاکی","context_page_description":"ماونت الیوت، کنتاکی آمریکانین کنتاکی ایالتیندا یئر آلان بیر شهردیر و ۱ کیلومتر موربّع ساحه‌سی وار. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا ۲۹۹ نفر و اها‌لی سیخلیغی ۲۹۰٫۳ اینسان کیلومتر موربّع دیر. ماونت الیوت دنیز سئوییه‌سیندن ۲۸۵ متر اۇجالیقیدا یئرلشیر. کنتاکی ایالتی، آت یاریشی، داش کؤمور و اوتومومبیل تولیدی کیمی تانینیر. غنی توْرپاغا گؤره چوْخلو یئرلری چمن‌لی‌دیر. ایقتیصادیسی اکینچی‌لییه وابسته‌دیر. ائو آتی، اینک، تۆتون، سۆت، دوموز و سویا تیجارت‌ده بؤیوک نقش اوْیناییر. داش کؤمور، دمیر و نفت چیخاریلیر."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Giovanni_Evangelista_(Rovegno)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Rovegno-IMG_0543.JPG","page_title":"Chiesa di San Giovanni Evangelista (Rovegno)","context_page_description":"La chiesa di San Giovanni Evangelista è un luogo di culto cattolico situato nel comune di Rovegno, in via alla Chiesa, nella città metropolitana di Genova. La chiesa è sede della parrocchia omonima del vicariato di Bobbio, Alta Val Trebbia, Aveto e Oltre Penice della diocesi di Piacenza-Bobbio.\\nDalla parrocchia di Rovegno dipendono diversi edifici religiosi quali le chiese di San Vincenzo nella frazione di Garbarino e di San Matteo nella frazione di Isola, quest'ultima fondata nel corso della seconda metà del XVII secolo con campanile risalente al 1894, e gli oratori di Spescia e Valle rispettivamente intitolati al Santissimo nome di Maria e a San Rocco."},{"page_url":"https://gl.wikipedia.org/wiki/Cordilleira_Verkhoiansk","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Werchojansk-Gebirge.jpg","page_title":"Cordilleira Verkhoiansk","context_page_description":"A cordilleira Verkhoiansk, é unha cadea monstañosa de máis de 1200 km de lonxitude situada no norte de Rusia, a ambos os lados do círculo polar ártico e no centro da Siberia Oriental.\\nAdministrativamente, pertence á república de Sakha da Federación de Rusia."},{"page_url":"https://ca.wikipedia.org/wiki/Castillo_de_Bayuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Castillo_de_Bayuela.png","page_title":"Castillo de Bayuela","context_page_description":"Castillo de Bayuela és un municipi de la província de Toledo, a la comunitat autònoma de Castella la Manxa. Limita amb El Real de San Vicente, Garciotum, Cardiel de los Montes, Lucillos, Cazalegas, San Román de los Montes i Hinojosa de San Vicente."},{"page_url":"https://hr.wikipedia.org/wiki/Maja_Gojkovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Maja_Gojkovi%C4%87.jpg","page_title":"Maja Gojković","context_page_description":"Maja Gojković je srpska pravnica i političarka, bivša gradonačelnica Novog Sada i aktualna predsjednica Narodne Skupštine Republike Srbije."},{"page_url":"https://tr.wikipedia.org/wiki/R%C3%B6szke","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Katolikus_templom.jpg","page_title":"Röszke","context_page_description":"Röszke Güney Macaristan'ın Güney Alföld bölgesinde, Csongrád ilinde bir köydür. En yakın kasaba Szeged 15 kilometredir mesafededir.\\nEfsanevi Macar haydut Sándor Rózsa, 1813 yılında burada doğdu."},{"page_url":"https://de.wikipedia.org/wiki/DDR-Justiz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Bundesarchiv_Bild_183-A1227-0007-001%2C_Berlin%2C_Prozess_gegen_Fluchthelfer%2C_Toeplitz.jpg","page_title":"DDR-Justiz","context_page_description":"Die DDR-Justiz war die Justiz der Deutschen Demokratischen Republik und wurde im Geiste der marxistisch-leninistischen Rechtstheorie weniger als Kontrollorgan staatlichen und privaten Handelns, sondern vielmehr als Vollstreckungsorgan des Willens der herrschenden Sozialistischen Einheitspartei Deutschlands gesehen. Das Idealbild des DDR-Rechtes war im Gegensatz zu dem im westlichen Recht deutlich hervortretenden marktwirtschaftlichen Wettbewerbsmodell eher das geregelte und friedliche Zusammenleben aller Bürger. Im Bereich der unpolitischen Streitentscheidungen entwickelte die DDR-Justiz dabei eine erhebliche Funktionstüchtigkeit und durch die große Bereitschaft der Richter, sich auch mit Einzelfällen zu befassen, sogar eine gewisse Bürgernähe in der Entscheidungsfindung. In politisch wichtigen Prozessen wurde allerdings weitgehend ein strikter Gehorsam gegenüber den Vorgaben der Partei geübt. Rechte von Oppositionellen wurden nicht nur in Strafverfahren erheblich beschnitten.\\nBei besonders wichtigen Strafverfahren griff die SED dahingehend in die Rechtsprechung ein, dass die Staatsanwaltschaft ihre Urteilsanträge zur Genehmigung vorzulegen hatte."},{"page_url":"https://en.wikipedia.org/wiki/List_of_defunct_airlines_of_Armenia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Vnukovo_IMG_4858_%285777411400%29.jpg","page_title":"List of defunct airlines of Armenia","context_page_description":"This is a list of defunct airlines of Armenia."},{"page_url":"https://en.wikipedia.org/wiki/Gaston_M%C3%A9ry","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Mery%2C_Gaston.jpg","page_title":"Gaston Méry","context_page_description":"Gaston Méry was a French author, translator and journalist. He was violently antisemitic and was also hostile to the people of the south of France, whom he saw as racially impure and inferior Latin peoples compared to the Celts of the north. He founded a journal L'écho du merveilleux which was largely devoted to proving the reality of a series of visions of the Virgin Mary, Joan of Arc and Jesus reported by Marie Martel in Calvados. From 1900 until his death he was a member of the Paris municipal council."},{"page_url":"https://lv.wikipedia.org/wiki/Sarka%C5%86u_pagasts","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Sarka%C5%86i_Parish_%28LocMap%29.png","page_title":"Sarkaņu pagasts","context_page_description":"Sarkaņu pagasts ir viena no Madonas novada administratīvajām teritorijām tā vidienē. Robežojas ar sava novada Madonas pilsētu un Dzelzavas, Aronas un Praulienas pagastiem, Lubānas novada Indrānu pagastu un Cesvaines novada Cesvaines pagastu."},{"page_url":"https://en.wikipedia.org/wiki/France_in_the_Seven_Years%27_War","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Lally_at_Pondicherry_by_Paul_Philipotteaux.jpg","page_title":"France in the Seven Years' War","context_page_description":"France was one of the leading participants in the Seven Years' War which lasted between 1756 and 1763. France entered the war with the hope of achieving a lasting victory against Prussia, Britain and their German allies and with the hope of expanding its colonial possessions.\\nWhile the first few years of war proved successful for the French, in 1759 the situation reversed and they suffered defeats on several continents. In an effort to reverse their losses, France finished an alliance with their neighbor, Spain, in 1761. In spite of this the French continued to suffer defeats throughout 1762 eventually forcing them to sue for peace. The 1763 Treaty of Paris confirmed the loss of French possessions in North America and Asia to the British. France also finished the war with very heavy debts, which they struggled to repay for the remainder of the 18th century."},{"page_url":"https://nn.wikipedia.org/wiki/Balthazar_Schnitler","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Balthazar_Schnitler_%281787_-_1851%29_%282837341242%29.jpg","page_title":"Balthazar Schnitler","context_page_description":"Balthazar Schnitler var ein norsk jurist og stortingsmann, fødd på Hitra.\\nSchnitler var son til ein prest. Sjølv vart han cand.jur. i 1808 og arbeidde frå 1812 i morbrorens handelshus i Trondheim. Han var styremedlem i Noregs Bank frå 1833 til han døydde.\\nSchnitler var ordførar i Trondheim frå mai 1838 og ut same år, deretter 1840-1841. Han var viseordførar i 1842.\\nHan representerte Trondheim på Stortinget i frå 1827 til 1835 og 1839-44. I 1827 var han sekretær i komiteen om skog- og bergvesen, og medlem av bankkomiteen samt komiteen om slottsbygninga og kjøpstadskatten. På det overordentlege storting 1828 var han sekretær i komiteen om ansvarslova, medan han på 1830-stortinget var sekretær decisjonskomiteen og medlem av bankkomiteen. I 1833 var han sekretær i komiteen om slottsbygninga og medlem av valkomiteen og av protokollkomiteen. Han bad seg fri frå valet i 1836, men vart vald på ny i 1839 då han på Tinget atter var med i valkomiteen samt han var sekretær i bankkomiteen. På stortinget 1842 var han som i 1833 medlem av valkomiteen og protokollkomiteen. Han vart vald til stortingsmann også i 1845, men bad seg fri og det vart halde eit nytt val."},{"page_url":"https://de.wikipedia.org/wiki/Schornstein_(Alliance_Gaswork)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Schlot_Alliance_Gasworks.JPG","page_title":"Schornstein (Alliance Gaswork)","context_page_description":"Der Schornstein (Alliance Gaswork) ist ein Baudenkmal der Dubliner Docklands."},{"page_url":"https://vi.wikipedia.org/wiki/Meconopsis_aculeata","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Meconopsis_aculeata_04.jpg","page_title":"Meconopsis aculeata","context_page_description":"Meconopsis aculeata là một loài thực vật có hoa trong họ Anh túc. Loài này được Royle mô tả khoa học đầu tiên năm 1834."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9F%B3%E5%B7%9E%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Lwg_roegbit.svg","page_title":"柳州市","context_page_description":"柳州市，簡稱柳，是中華人民共和國廣西壯族自治區下轄的地級市，位於廣西中北部，地形為「三江四合，抱城如壺」，亦稱「壺城」。全市總面積1.86萬平方公里，其中市區面積3,554平方公里，建成區面積281.92平方公里，2018年末常住人口404.17萬，其中市區常住人口227.30萬。常住人口中少數民族人口比例超過五成，達56.4%，其中壯族占少數民族人口的64.1%，各族通行普通話的同時講西南官話。自公元前111年，漢武帝滅南越國建立潭中縣城以來，柳州已經有超過2100年建城史，是國務院批准的歷史文化名城和國家甲級旅遊城市。\\n溫家寶曾經為柳州題詞「山青水秀地乾淨」。柳州人口在中國城市排名第55位，相當於歐盟的紐倫堡及美國的坦帕。"},{"page_url":"https://es.wikipedia.org/wiki/Flaugeac","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Flaugeac_%C3%A9glise_%285%29.JPG","page_title":"Flaugeac","context_page_description":"Flaugeac es una población y comuna francesa, situada en la región de Aquitania, departamento de Dordoña, en el distrito de Bergerac y cantón de Sigoulès."},{"page_url":"https://es.wikipedia.org/wiki/Styrax_argenteus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Styrax_argenteus_3.jpg","page_title":"Styrax argenteus","context_page_description":"Styrax argenteus es una especie que pertenece a la familia Styracaceae, algunos de sus nombres comunes son: capulín, chicamay, chilacuate, estoraque, hoja de jabón, changungo, chilacuate, uraznillo, jaboncillo, kuat’anu, mamuyo y tepamu."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%91%E5%8D%AB%E4%B8%9C%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/201603_Jinweidong_Station1.JPG","page_title":"金卫东站","context_page_description":"金山卫东站又名金卫东站，位于中国上海市金山区沪杭公路石化汽车站西侧，为金山铁路上的一个车站，于1975年9月11日建成启用，该站曾有数对往来上海市区长宁火车站客运列车，后改为停靠上海南站，为石化地区市民往来上海市区的主要交通工具，后因公路交通逐渐完善，周边高速公路网逐渐发达，客流转向公共交通出行，该站客运功能逐渐萎缩。\\n2002年时，该站尚有往来上海南站的专1、专4、专5、专8、专9、专2、专7、专10次共四对列车运行，2002年9月28日起，列车停止运营。\\n2002年10月21日，原上海南站到发的4对市郊列车转到属临时性质的梅陇站办理客运\\n至2003年6月18日，4对来往于梅陇站和金卫东站的市郊列车仅剩2对。"},{"page_url":"https://en.wikipedia.org/wiki/Agriculture_in_Iran","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Paddy_field_Amol_IRI_1.jpg","page_title":"Agriculture in Iran","context_page_description":"Roughly one-third of Iran's total surface area is suited for farmland, but because of poor soil and lack of adequate water distribution in many areas, most of it is not under cultivation.\\nOnly 12% of the total land area is under cultivation but less than one-third of the cultivated area is irrigated; the rest is devoted to dryland farming. Some 92 percent of agricultural products depend on water. The western and northwestern portions of the country have the most fertile soils. Iran's food security index stands at around 96 percent.\\n3% of the total land area is used for grazing and small fodder production. Most of the grazing is done on mostly semi-dry rangeland in mountain areas and on areas surrounding the large deserts of Central Iran.\\nThe non-agricultural surface represents 53% of the total area of Iran, as follows:\\nAbb. 39% of the country is covered by deserts, salt flats and bare-rock mountains, not suited for agricultural purposes.\\nAn additional 7% of Iran's total surface is covered by woodlands.\\nAnd 7% is covered by cities, towns, villages, industrial areas and roads."},{"page_url":"https://nl.wikipedia.org/wiki/Enos_thara","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/EnosTharaAsTheclaTharaHewitson1867.JPG","page_title":"Enos thara","context_page_description":"Enos thara is een vlinder uit de familie van de Lycaenidae. De wetenschappelijke naam van de soort werd als Thecla thara in 1867 gepubliceerd door William Chapman Hewitson."},{"page_url":"https://pt.wikipedia.org/wiki/Bermeo","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Bermeo_Torre_de_Ercilla.jpg","page_title":"Bermeo","context_page_description":"Bermeo é um município da Espanha na província da Biscaia, comunidade autónoma do País Basco, com 34,12 km² de área. Em 2012 tinha 48017 habitantes. A vila, fundada em 1236, foi capital da Biscaia de 1476 até 1602.\\nTrata-se de uma vila marcada pela tradição marítima, já que a sua economia baseia-se em grande parte na pesca e conservas de peixe. O município possui variados atrativos turísticos, como a ermida de San Juan de Gaztelugatxe, a torre Ercilla, o portal de San Juan, o seu acolhedor porto, entre outros."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89poque_moderne_de_l%27Alg%C3%A9rie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Carte_de_l%E2%80%99Alg%C3%A9rie.jpg","page_title":"Époque moderne de l'Algérie","context_page_description":"Cet article relate les faits saillants de l'histoire de l'époque moderne de l'Algérie.\\nL'époque moderne de l'Algérie couvre :\\nla période ottomane ;\\nla colonisation française ;\\nla République algérienne."},{"page_url":"https://es.wikipedia.org/wiki/Ellinwood_(Kansas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Ellinwood_P5310457.JPG","page_title":"Ellinwood (Kansas)","context_page_description":"Ellinwood es una ciudad ubicada en el de condado de Barton en el estado estadounidense de Kansas. En el año 2010 tenía una población de 2131 habitantes y una densidad poblacional de 761,07 personas por km².​"},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_Horjul","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Horjul_Slovenia.JPG","page_title":"Comuna Horjul","context_page_description":"Horjul este o comună din Slovenia, cu o populație de 2.678 de locuitori."},{"page_url":"https://sv.wikipedia.org/wiki/Charles_Vyner_Brooke","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Charlesvynerbrooke.jpg","page_title":"Charles Vyner Brooke","context_page_description":"Charles Vyner Brooke, född 26 september 1874 i Greenwich, England, död 9 maj 1963 i London, var den tredje och siste vita rajan av Kungariket Sarawak på Borneo. Efter att fadern Charles Brooke dog utropades Charles till raja i maj 1917 och regerade tillsammans med brodern Bertram. Tio år senare, år 1927, adlades Vyner och förärades Sankt Mikaels och Sankt Georgsorden. Vyner Brooke kunde modernisera Sarawak, mycket tack vare landets förbättrade ekonomi genom landets gummi- och oljeindustri. Under andra världskriget invaderade Japan Sarawak i december 1941, vilket följdes av att Vyner Brooke efter krigsslutet återtog sin roll som raja i april 1946 innan han överlämnade Sarawak till Storbritannien senare under 1946. Efter sin död 1963 begravdes Vyner i St Leonard's Church i Sheepstor i sydvästra England, där även hans bror och de två tidigare rajorna av Sarawak ligger begravda."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%D8%AA%D9%86_%D8%A8%D9%88%D8%A8%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Martin_Buber_1963.jpg","page_title":"مارتن بوبر","context_page_description":"مارتن بوبر 8 فبراير 1878 في فيينا - 13 يونيو 1965 في القدس. كان فيلسوف نمساوي، اشتهر بـ «فلسفة الحوار»، وهي صورة من صور الوجودية، تدور حول التفريق بين علاقة «أنا وأنت» وعلاقة «أنا والشيء». وُلد في فيينا، في أسرة ملتزمة باليهودية، لكنه خرج عن العرف اليهودي ليتابع الدراسات الفلسفية العلمانية. في 1902 صار محررًا في صحيفة «دي ڤِلت» الأسبوعية، التي هي أساس الحركة الصِّهْيَوْنية، لكنه انسحب لاحقًا من العمل الصهيوني التنظيمي. في 1923 كتب مقالته الشهيرة عن الوجود «أنا وأنت»، وفي 1925 بدأ ترجمة التوراة إلى اللغة الألمانية.\\nرُشح لجائزة نوبل في الأدب عن الأعمال التي كتبها 10 مرات، ولجائزة نوبل في السلام 7 مرات."},{"page_url":"https://ast.wikipedia.org/wiki/Catal%C3%A1n_oriental","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Catal%C3%A1n_dialectos.png","page_title":"Catalán oriental","context_page_description":"El catalán oriental o bloque oriental del catalán ye'l conxuntu de dialeutos del catalán falaos en Cataluña, na Catalunya Nord, nes Islles Baleares y en L'Alguer.\\nLa carauterística más notable d'estos dialeutos, a diferencia de los del catalán occidental col que se contrapon, ye la neutralización de l'a, i, e átona a [ə] y d'haber sustitución de la o átona por [u].\\nEsti artículu ye un entamu. Pues ayudar a la Wikipedia n'asturianu ampliándolu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Gaming","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Zugangsstollen_50A_bei_A-3291_Kienberg.jpg","page_title":"Liste der denkmalgeschützten Objekte in Gaming","context_page_description":"Die Liste der denkmalgeschützten Objekte in Gaming enthält die 65 denkmalgeschützten, unbeweglichen Objekte der niederösterreichischen Marktgemeinde Gaming im Bezirk Scheibbs."},{"page_url":"https://fr.wikipedia.org/wiki/Biodiversit%C3%A9_de_la_Nouvelle-Cal%C3%A9donie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Epinephelus_merra_JNC1499.JPG","page_title":"Biodiversité de la Nouvelle-Calédonie","context_page_description":"La biodiversité de la Nouvelle-Calédonie, un large groupe d'îles du Pacifique, est considérée comme la plus importante de la planète. L'île possède un niveau élevé d'endémisme, avec notamment beaucoup de plantes, d'insectes, d'oiseaux et de reptiles uniques. L'île n'a pas de mammifère à part des chauves-souris, et aucun amphibien. La biodiversité néocalédonienne est menacée par des espèces introduites, l'exploitation forestière, les incendies et le développement urbain et les gisements miniers. La Nouvelle-Calédonie a perdu de nombreuses espèces depuis que l'homme a posé le pied sur l'île, mais aucune ne s'est éteinte depuis le XVIᵉ siècle."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%A0likov%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Veli%C5%A1_hrobka_%C5%A0lik%C5%AF_2019.jpg","page_title":"Šlikové","context_page_description":"Šlikové jsou český šlechtický rod významný především v 15. a 16. století. Původně měšťanská rodina z Chebu vynikla v osobě kancléře Kašpara Šlika a získala značný majetek. Později rod ovládal značnou část severozápadních Čech a jako první z Českého království obdržel říšský hraběcí titul. Moc rodu ještě vzrostla počátkem 16. století s objevem ložisek stříbra v Krušných horách a získáním práva ražby vlastní mince. Přijetím luteránské víry a vlivem přesahujícím hranice Českého království se několikrát dostali do konfliktu s Habsburky, o značnou část majetku přišli po porážce stavovského povstání v roce 1547. Většina členů rodu se zapojila i do dalšího stavovského povstání v letech 1618–1620, poté došlo k likvidaci majetkového zázemí v západních Čechách a nejslavnější příslušník rodu Jáchym Ondřej Šlik byl popraven. Do služeb Habsburků tehdy vstoupil jediný člen rodu, pozdější polní maršál Jindřich Šlik, který založil novou doménu ve východních Čechách. Poměrně velký majetek si jeho potomci udrželi až do 20. století, znovu se uplatnili i ve státních službách. Dnes rodině náleží již jen část bývalého rozsáhlého majetku na Jičínsku."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D9%82%D8%B1%D9%87%E2%80%8C%D8%AA%D8%A7%D9%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Karatal_District_Kazakhstan.png","page_title":"شهرستان قره‌تال","context_page_description":"شهرستان قره‌تال یک سکونتگاه مسکونی در قزاقستان است که در استان آلماتی واقع شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Hartfrid_Neunzert","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Herkomer_bildband.jpg","page_title":"Hartfrid Neunzert","context_page_description":"Hartfrid Neunzert ist ein deutscher Kunsthistoriker."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Hoyerswerda","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/HYBrunnenMarkt.JPG","page_title":"Liste der Kulturdenkmale in Hoyerswerda","context_page_description":"In der Liste der Kulturdenkmale in Hoyerswerda sind die Kulturdenkmale der sächsischen Stadt Hoyerswerda verzeichnet, die bis August 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Bautzen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Moabit","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Stolperstein_Thomasiusstr_5_%28Moabi%29_Eva_Manasse.jpg","page_title":"Liste der Stolpersteine in Berlin-Moabit","context_page_description":"Die Liste der Stolpersteine in Berlin-Moabit enthält die Stolpersteine im Berliner Ortsteil Moabit im Bezirk Mitte, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Tabelle erfasst insgesamt 406 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E6%B3%A2%E7%BD%9715%E5%8F%B7%E8%BF%94%E5%9B%9E%E5%9C%B0%E7%90%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Apollo_15_Earthrise.jpg","page_title":"阿波罗15号返回地球","context_page_description":"1971年8月2日，阿波羅15號「獵鷹號」登月艙從月表升空，完成了與「奮進號」指令/服務艙會合對接，在轉移完月岩樣本和其他設備後，獵鷹號被拋棄，然後它將點燃火箭引擎並撞向月球表面。\\n阿波羅15號在月軌上再停留了一天，繼續沃爾登的觀測。在釋放一顆衛星之後，他們啟動服務艙引擎，開始進入返回軌道。第二天，沃爾登出艙，從科學儀器模塊托架上取回了相機中的膠捲盒。\\n在太空的第十二天較為平靜，任務控制中心舉辦了一場記者會，太空人們回答了新聞媒體提出的一些問題；第十三天和最後一天主要準備再入地球軌道，降落過程中，三具降落傘中有一具未打開，另外二具幫助他們平安落地。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_naval_ship_classes_in_service","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/RFNMarshalShaposhnikov.jpg","page_title":"List of naval ship classes in service","context_page_description":"The list of naval ship classes in service includes all combatant surface classes in service currently with navies or armed forces and auxiliaries in the world. Ships are grouped by type, and listed alphabetically within.\\nList of submarine classes in service\\nList of auxiliary ship classes in service"},{"page_url":"https://be.wikipedia.org/wiki/%D0%9B%D1%83%D1%86%D1%8B%D0%B9_III_(%D0%9F%D0%B0%D0%BF%D0%B0_%D0%A0%D1%8B%D0%BC%D1%81%D0%BA%D1%96)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Pope_Lucius_III.png","page_title":"Луцый III (Папа Рымскі)","context_page_description":"Люцый III — Папа Рымскі з 1 верасня 1181 года па 25 лістапада 1185 года.\\nУраджэнец незалежнай рэспублікі Лукі, цыстрэрцыянец. Прызначаны кардыналам Папам Інакенціем II, уплывовым кардыналам у часы Папы Аляксандра III. Пасля абрання Папам жыў у Рыме з лістапада 1181 па сакавік 1182 года, аднак сваркі паміж мяшчанамі прымусілі яго правесці амаль увесь свой ​​пантыфікат у іншых гарадах, як то Велетры, Ананьі і Верона.\\nМеў спрэчкі з імператарам Свяшчэннай Рымскай імперыі Фрыдрыхам I Барбаросам аб правілах атрымання ў спадчыну зямель графства Тасканскага. У лістападзе 1184 года правёў сінод у Вероне, дзе былі асуджаны ерэтыкі ад катараў, патарэнаў, вальдэнсаў і арнальдыстаў, якіх падвергнулі анафеме, што дало пачатак дзейнасці інквізіцыі.\\nУ 1185 годзе пачаў падрыхтоўку да Трэцяга крыжовага паходу ў адказ на заклікі Балдуіна IV Іерусалімскага."},{"page_url":"https://vi.wikipedia.org/wiki/Dryopteris_wallichiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Starr_020808-0016_Dryopteris_wallichiana.jpg","page_title":"Dryopteris wallichiana","context_page_description":"Dryopteris wallichiana là một loài thực vật có mạch trong họ Dryopteridaceae. Loài này được Alston & Bonner miêu tả khoa học đầu tiên năm 1956."},{"page_url":"https://de.wikipedia.org/wiki/Dhyangro","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Dhyangro.jpg","page_title":"Dhyangro","context_page_description":"Dhyangro ist eine zweifellige Stieltrommel mit einem langen Handgriff, die von Schamanen der tibetischen Kulturregion im Himalaya für Rituale geschlagen wird. Die bei verschiedenen Ethnien im Osten Nepals verbreitete dhyangro wird wegen ihrer Verwendung für therapeutische Zwecke und bei Wahrsagungen zu den Schamanentrommeln gezählt. Bei den üblicherweise nachts stattfindenden Sitzungen schlagen die Schamanen die Trommel, sprechen Mantras und versetzen sich in einen Zustand der Besessenheit von bestimmten Geistern, um eine Diagnose zu stellen und um ihre Patienten mit Hilfe eines Besens von den als Krankheitsverursacher erkannten Geistern zu befreien."},{"page_url":"https://es.wikipedia.org/wiki/Pietro_Sorri","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Pietro_Sorri_San_Juan_Evangelista_Descalzas_Reales.jpg","page_title":"Pietro Sorri","context_page_description":"Pietro Sorri fue un pintor italiano activo durante la última época del manierismo."},{"page_url":"https://sk.wikipedia.org/wiki/Val-de-Reuil_(obec)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Map_commune_FR_insee_code_27701.png","page_title":"Val-de-Reuil (obec)","context_page_description":"Val-de-Reuil je francúzska obec, ktorá sa nachádza v departemente Eure, v regióne Horná Normandia."},{"page_url":"https://en.wikipedia.org/wiki/RT%C3%89_Sports_Person_of_the_Year","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Roy_keane_2014.jpg","page_title":"RTÉ Sports Person of the Year","context_page_description":"The RTÉ Sports Person of the Year Award is the titular award of the RTÉ Sports Awards ceremony, which takes place each December. The winner is the Irish sportsperson judged to have achieved the most that year. The winner was originally chosen by a special panel of RTÉ journalists and editorial staff, but was selected by a public vote from a pre-determined shortlist in 2016. The first Irish sports award ceremony took place in 1985, and was closely modelled on the BBC Sports Personality of the Year Award.\\nThree people have won the award multiple times: athlete Sonia O'Sullivan won the award five times, including a record three successive awards, and golfers Pádraig Harrington, with three wins, and Rory McIlroy, who won it twice. The oldest recipient of the award is Christy O'Connor Jnr, who won in 1989 aged 41. Rory McIlroy, who first won in 2011, aged 22, is the youngest winner. Ten sporting disciplines have been represented; golf has the highest representation, with eight recipients.\\nEamonn Darcy, Ronan Rafferty and Des Smyth, who won the Alfred Dunhill Cup in 1988, are the only non-individual winners of the award."},{"page_url":"https://pl.wikipedia.org/wiki/Zakon_Rycerski_Grobu_Bo%C5%BCego_w_Jerozolimie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Knights_and_Ladies_of_the_Holy_Sephulcre_1.jpg","page_title":"Zakon Rycerski Grobu Bożego w Jerozolimie","context_page_description":"Zakon Rycerski Grobu Bożego w Jerozolimie, bożogrobcy, Zakon Kanoników Regularnych Stróżów Świętego Grobu Jerozolimskiego, w Polsce znany także jako Zakon Kanoników Regularnych Stróżów Grobu Chrystusowego – zakon wywodzący się z założonej w 1099 r. przez Gotfryda z Bouillon kapituły. Początkowo zakon stanowiło 20 kanoników sprawujących służbę duszpasterską i 50 rycerzy krzyżowych wywodzących się z najlepszych domów rycerskich. Podlegali oni zwierzchnikowi kościoła łacińskiego w Ziemi Świętej czyli biskupowi Jerozolimy. W czasach stacjonowania w Palestynie do ich podstawowych obowiązków należało oprowadzanie pątników, obrona Grobu Chrystusa oraz uczestniczenie w wyprawach przeciw niewiernym. Kapituła składała się z duchownych i rycerzy, jednak szybko dominującą rolę zaczęli odgrywać kapłani. Regułę św. Augustyna nadał im patriarcha Arnulf z Rohez. W 1122 r. zatwierdził ją papież Kalikst II."},{"page_url":"https://es.wikipedia.org/wiki/Copa_Mundial_Femenina_de_F%C3%BAtbol_Sub-20","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/FIFA_U-20_Womens-World-Cup.jpg","page_title":"Copa Mundial Femenina de Fútbol Sub-20","context_page_description":"La Copa Mundial Femenina de Fútbol Sub-20 es un torneo internacional de selecciones nacionales de fútbol femenino compuestas por jugadoras menores de 20 años. El torneo es organizado cada dos años por la FIFA y surgió en 2002 como derivado de la Copa Mundial Femenina de Fútbol.\\nOriginalmente, el torneo tenía un límite de 19 años de edad, siendo aumentado en 2006 a los actuales veinte. A la fecha, se han jugado nueve torneos, siendo campeonas las selecciones de Alemania, Estados Unidos, Corea del Norte y Japón."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%AE%CF%80%CE%BF%CF%82_%CF%84%CE%BF%CF%85_%CE%9B%CE%BF%CF%85%CE%BE%CE%B5%CE%BC%CE%B2%CE%BF%CF%8D%CF%81%CE%B3%CE%BF%CF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Une_all%C3%A9e_au_jardin_du_Luxembourg.jpg","page_title":"Κήπος του Λουξεμβούργου","context_page_description":"Ο Κήπος του Λουξεμβούργου είναι δημόσιος κήπος που βρίσκεται στο 6ο διαμέρισμα του Παρισιού. Δημιουργήθηκε το 1612 από τη Μαρία των Μεδίκων, χήρα του βασιλιά Ερρίκου Δ' της Γαλλίας, για τη νέα κατοικία της, το παλάτι του Λουξεμβούργου. Ο κήπος σήμερα ανήκει στη Γαλλική Γερουσία, η οποία συνεδριάζει στο παλάτι. Ο κήπος καλύπτει 23 εκτάρια και περιλαμβάνει χώρους περιπάτου με δέντρα, παρτέρια, γλυπτά και σιντριβάνια. Είναι αγαπημένος τόπος συνάντησης για τους Παριζιάνους και προσελκύει επισκέπτες από όλο τον κόσμο."},{"page_url":"https://es.wikipedia.org/wiki/Plantae_Asiaticae_Rariores","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Kaempferia_elegans_Wallich_vol1_27.jpg","page_title":"Plantae Asiaticae Rariores","context_page_description":"Plantae Asiaticae Rariores, ​ es un libro con ilustraciones y descripciones botánicas que fue escrito por el cirujano, botánico y pteridólogo danés, Nathaniel Wallich. Fue publicado en Londres en 3 volúmenes en los años 1829-1832.\\nEsta obra fue publicada en Londres, París y Estrasburgo entre 1829 y 1832, y consistió en 3 volúmenes encuadernados de las 12 piezas originales de tamaño folio con 294 placas coloreadas a mano y litografiados por Maxim Gauci. Wallich entró en excedencia en 1828 para supervisar la impresión y la coloración a mano de las ilustraciones de Inglaterra. Los más importantes de los artistas de la acuarela que ejecutaron las pinturas originales fueron dos artistas indios, Vishnupersaud, responsables de 114 platos y Gorachand de 87. Vishnupersaud fue un artista indio frecuentemente empleado por los naturalistas que trabajan en la India, como John Forbes Royle y Francis Buchanan-Hamilton. La habilidad de Vishnupersaud era legendaria y Wilfrid Blunt incluyó una de sus acuarelas en su libro The Art of Botanical Illustration. Las placas restantes se realizaron por Charles M. Curtis, William Griffith, y varios otros."},{"page_url":"https://en.wikipedia.org/wiki/Anomalous_photovoltaic_effect","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/ExampleOfBulkPhotovoltaicEffect.svg","page_title":"Anomalous photovoltaic effect","context_page_description":"The anomalous photovoltaic effect, also called the bulk photovoltaic effect in certain cases, is a type of a photovoltaic effect which occurs in certain semiconductors and insulators. The \\"anomalous\\" refers to those cases where the photovoltage is larger than the band gap of the corresponding semiconductor. In some cases, the voltage may reach thousands of volts.\\nAlthough the voltage is unusually high, the short-circuit current is unusually low. Overall, materials that exhibit the anomalous photovoltaic effect have very low power generation efficiencies, and are never used in practical power-generation systems.\\nThere are several situations in which APE can arise.\\nFirst, in polycrystalline materials, each microscopic grain can act as a photovoltaic. Then the grains add in series, so that the overall open-circuit voltage across the sample is large, potentially much larger than the bandgap.\\nSecond, in a similar manner, certain ferroelectric materials can develop stripes consisting of parallel ferroelectric domains, where each domain acts like a photovoltaic and each domain wall acts like a contact connecting the adjacent photovoltaics."},{"page_url":"https://nl.wikipedia.org/wiki/Thalia_Theater_(Hamburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Hamburg_Thalia-Thetaer_2010.jpg","page_title":"Thalia Theater (Hamburg)","context_page_description":"Het Thalia Theater is een schouwburg in de Duitse stad Hamburg en tevens de naam van een toonaangevend theatergezelschap, dat aan dit gebouw verbonden is. Het theater ligt in de Hamburgse Altstadt nabij de Binnenalster. Het gebouw in de stijl van het neoclassicisme dateert uit 1912 en is een beschermd monument. Het Thalia Theater is met circa 1000 zitplaatsen een van de grotere podia voor toneel in Duitsland."},{"page_url":"https://fr.wikipedia.org/wiki/Relations_entre_la_Cor%C3%A9e_du_Nord_et_le_Japon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Japan_North_Korea_Locator.png","page_title":"Relations entre la Corée du Nord et le Japon","context_page_description":"Cet article traite des relations entre la Corée du Nord et le Japon après la partition de la péninsule en 1953."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%84%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_%D0%A1%D0%B0%D0%B2%D0%BE%D0%B9%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Christine_Henriette_of_Hesse-Rotenburg.jpg","page_title":"Єлизавета Савойська","context_page_description":"Єлизавета Савойська-Кариньяно, повне ім'я Марія Франческа Єлизавета Шарлотта Джузеппіна Савойська-Кариньяно, італ. Maria Francesca Elisabetta Carlotta Giuseppina di Savoia-Carignano; 13 квітня 1800 — 25 грудня 1856 — принцеса Савойська-Кариньяно, донька принца Карла Еммануїла Савойського-Кариньяно та саксонської принцеси Марії Крістіни, дружина ерцгерцога Австрійського Райнера Йосипа, матір королеви Сардинії Марії Аделаїди."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A6%CE%AE%CE%BC%CE%B7_(%CE%BC%CF%85%CE%B8%CE%BF%CE%BB%CE%BF%CE%B3%CE%AF%CE%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Dresden_Fama_%282005%29.jpg","page_title":"Φήμη (μυθολογία)","context_page_description":"Στην ελληνική μυθολογία, αλλά και κατά τους ιστορικούς χρόνους, η Φήμη ήταν η προσωποποίηση της μετάδοσης του λόγου, των παραδόσεων, των εξιστορήσεων κ.λπ.. Τη θεωρούσαν δευτερεύουσα θεά της αναγγελίας των νικών, κυρίως των αθλητικών αγώνων. Για το λόγο αυτό οι αρχαίοι ποιητές την αποκαλούσαν «πτερόεσσα», «πολύλαλο», «τέκνο χρυσής ελπίδας», κ.λπ.. Η ονομασία αυτή προέρχεται από την έννοια της λέξεως φήμη που απαντάται και στην Οδύσσεια, δηλαδή με την έννοια του λόγου που προαναγγέλλει κάτι το καλό, το αγαθό, και όχι κάτι το άσχημο.\\nΒωμός της θεάς Φήμης υπήρχε στην Αρχαία Αγορά της Αθήνας, κοντά στο βωμό της Αιδούς. Επίσης λατρευόταν και στην Κέρκυρα, όπως διαπιστώνεται από επιγραφή νομισμάτων που έφεραν τη λέξη Φάμα."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D1%80%D0%B0%D0%B3%D0%B8%D1%87,_%D0%93%D0%BE%D1%80%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/EuroBasket_2017_Finland_vs_Slovenia_37.jpg","page_title":"Драгич, Горан","context_page_description":"Горан Драгич — словенский профессиональный баскетболист. Играет как на позиции разыгрывающего защитника, так и на позиции атакующего защитника. Выступает за клуб Национальной баскетбольной ассоциации «Майами Хит»."},{"page_url":"https://he.wikipedia.org/wiki/IKCO_Arisun","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/IKCO_Arisan_2015310.jpg","page_title":"IKCO Arisun","context_page_description":"IKCO Arisun הוא טנדר קטן מסוג \\"Coupé utility\\", מתוצרת יצרנית הרכב ה-איראנית IKCO חברת בת של Iran Khodro אשר מיוצר משנת 2015 ועד היום.\\nדגם ה-\\"IKCO Arisun\\" מבוסס על דגם הטנדר פיג'ו 405 מתוצרת יצרנית הרכב הצרפתית פיג'ו. מיוצר ברישיון.\\nבשנת 2015 יוצאו לעיראק במשלוח הראשון כ-5,000 יחידות של הדגם."},{"page_url":"https://en.wikipedia.org/wiki/Artists_of_the_Tudor_court","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Elizabeth_I_Zuccaro.jpg","page_title":"Artists of the Tudor court","context_page_description":"The artists of the Tudor court are the painters and limners engaged by the monarchs of England's Tudor dynasty and their courtiers between 1485 and 1603, from the reign of Henry VII to the death of Elizabeth I.\\nTypically managing a group of assistants and apprentices in a workshop or studio, many of these artists produced works across several disciplines, including portrait miniatures, large-scale panel portraits on wood, illuminated manuscripts, heraldric emblems, and elaborate decorative schemes for masques, tournaments, and other events."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B1%B1%E4%B8%8B%E8%89%B6%E5%AD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Yamashita_Tsuyako.JPG","page_title":"山下艶子","context_page_description":"山下 艶子は元フィギュアスケート選手で現在はコーチ。大阪市出身。大手前高等女学校、関西学院大学卒。155cm。長女は元フィギュアスケート選手で1968年グルノーブルオリンピック、1972年札幌オリンピック女子シングル日本代表の山下一美。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D1%87%D0%BB%D0%B5%D0%B6%D0%BD%D1%8B%D0%B5_%D0%B4%D0%BE%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Bundesarchiv_Bild_102-10839%2C_Berlin%2C_Schlafsaal_im_Obdachlosen-Asyl.jpg","page_title":"Ночлежные дома","context_page_description":"Ночлежные дома — заведения, предоставляющие ночлег бездомным, а в ряде случаев также помощь пропитанием, деньгами или одеждой."},{"page_url":"https://cs.wikipedia.org/wiki/Pa%C5%99%C3%AD%C5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/1689_-_Les_%C3%A9chevins_%28Amiens%29.jpg","page_title":"Paříž","context_page_description":"Paříž, hlavní a zároveň největší město Francie, je správním centrem regionu Île-de-France, zahrnujícího Paříž a její předměstí, přičemž sama tvoří jeden z departementů. Představuje přirozené centrum Pařížské aglomerace a díky 552,7 miliardám € HDP hospodářsky nejaktivnější oblast ve Francii. V Paříži sídlí vedení téměř poloviny všech francouzských společností stejně jako kanceláře hlavních mezinárodních firem a ředitelství mnoha mezinárodních organizací, jako jsou UNESCO, OECD nebo ICC. Paříž je proto významným světovým kulturním, obchodním i politickým centrem. Počet obyvatel v roce 2015 činil 2 229 621, v celé aglomeraci pak 12 142 802. Město se stalo nositelem Řádu čestné legie, Válečného kříže 1914–1918 a Řádu osvobození."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Altstadt_I_(M%C3%BClheim_an_der_Ruhr)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Wilhelmplatz_2_%28M%C3%BClheim%29.jpg","page_title":"Liste der Baudenkmäler in Altstadt I (Mülheim an der Ruhr)","context_page_description":"Die Liste der Baudenkmäler in Altstadt I (Mülheim an der Ruhr) enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Mülheim an der Ruhr-Altstadt I, Stadtbezirk Rechtsruhr-Süd, in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Mülheim an der Ruhr eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://nl.wikipedia.org/wiki/Val_Avery","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Val_Avery_in_Bonanza_%28Breed_of_Violence%29.jpg","page_title":"Val Avery","context_page_description":"Val Avery, geboren als Sebouh Der Abrahamian was een Amerikaans karakteracteur in talloze speelfilms en televisieshows.\\nAanvankelijk speelde hij toneel bij de Armeense jeugdfederatie. Zijn opvallende uiterlijk en zijn ruwe, maar kwetsbare persoonlijkheid werden aangewend door de makers van de televisiereeks Columbo met acteur Peter Falk en regisseur John Cassavetes.\\nAvery speelde de rol van inbreker die samenspande met Columbo om een andere misdadiger te vatten, een adjunct-politiecommissaris, in A Friend in Deed, in een regie van een medewerker van Cassevetes, Ben Gazzara. Hij deed ook mee in de andere Columbo-films, Dead Weight, The Most Crucial Game en Identity Crisis. Avery was verder te zien in Cassavetes' Too Late Blues, Faces, Minnie and Moskowitz, The Killing of a Chinese Bookie en Gloria.\\nAvery was te zien in alle soorten films, van The Long, Hot Summer, The Magnificent Seven, Requiem for a Heavyweight, Hombre The Wanderers en Donnie Brasco tot televisieshows als Gunsmoke, The Twilight Zone, The Munsters en Law & Order."},{"page_url":"https://en.wikipedia.org/wiki/Sport_stacking","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Speed-Stacking-Cups.jpg","page_title":"Sport stacking","context_page_description":"Sport stacking, also known as cup stacking or speed stacking, is an individual and team sport that involves stacking 9 or 12 specially designed cups in pre-determined sequences as fast as possible. The cups are specially designed to allow for speedier times. Participants of sport stacking stack cups in specific sequences, by aligning the inside left lateral adjunct of each cup with that of the next. Sequences are usually pyramids of 3, 6, or 10 cups. Players compete against the clock or another player.\\nThe governing body setting the rule is the World Sport Stacking Association."},{"page_url":"https://no.wikipedia.org/wiki/Uzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/UZI_Submachine_Gun_%287414624230%29.jpg","page_title":"Uzi","context_page_description":"Uzi er en israelsk serie maskinpistoler. Det første våpenet i serien ble utviklet av Uziel Gal sent på 1940-tallet. Uzier har blitt produsert av Israel Weapon Industries, FN Herstal og andre.\\nVåpenet ble utviklet like etter den arabisk-israelske krigen i 1948. Designet var basert på den tsjekkiske CZ Model 25. Den israelske hæren testet Uzi og den ble approbert foran andre, mer konvensjonelle våpen. Gal ville ikke at våpenet skulle kalles opp etter ham, men dette ble ikke tatt hensyn til.\\nDen første modellen kom i 1951, og ble brukt i kamp for første gang i 1956. Våpenet ble en kommersiell suksess, og et antall forbedringer ble raskt introdusert.\\nUzi ble først og fremst brukt til selvforsvar av styrker som ikke var direkte i frontlinjen, samt offiserer, artillerister og pansertropper. Mer kompakte varianter ble brukt av isrealske spesialstyrker inntil nylig, men i desember 2003 erklærte det israelske forsvaret at de kom til å fase ut våpenet, men at produksjonen kom til å fortsette for kommersielle formål.\\nOver 90 land har brukt våpenet i politi- eller militærstyrker."},{"page_url":"https://cs.wikipedia.org/wiki/Husova_(Prachatice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Husova_%28005%29.jpg","page_title":"Husova (Prachatice)","context_page_description":"Husova je název ulice v Prachaticích situované v Městské památkové rezervaci na silniční parcele 1511/15. Název nese po Janu Husovi, který podle tradice navštěvoval v této ulici školu v čp. 71. Podle toho je tato budova označována jako Husův dům.\\nZačátek ulice tvoří křižovatka s ulicí Křišťanovou a končí na rozhraní současných ulic Zahradní a Družstevní v prostoru někdejšího prachatického parkánu. Na Husovu ulici se kolmo napojují ulice Věžní a Dlouhá"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_%C3%A1san","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Mr-yoga-inverted-tortoise.jpg","page_title":"Seznam ásan","context_page_description":"Ásana je obecný pojem pro držení těla při cvičení jógy, odvozený od sanskrtského slova pro \\"sedadlo/sezení\\". Zatímco mnohé z nejstarších ásan jsou posedy a postoje pro meditace, většina ásan se týká postavení pro rovnováhu, postavení paží, břicha pro lehy. Jednotnost v pojmenování pozic je omezená, protože existuje mnoho konkurenčních škol jógy. Různí autoři nebo školy jógy mohou mít různé názvy pro stejné ásany."},{"page_url":"https://nl.wikipedia.org/wiki/Museum_Het_Leids_Wevershuis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Dishcloths_woven_in_museum_Het_Leids_Wevershuis_2.jpg","page_title":"Museum Het Leids Wevershuis","context_page_description":"Het Leids Wevershuis is een van de laatste wevershuisjes in de Zuid-Hollandse stad Leiden in originele staat en geconsolideerd als museum. Het huis zelf, het grote antieke weefgetouw, waarop nog dagelijks geweven wordt, en het eenvoudige interieur van een arbeiderswoning vormen de kern van de expositie."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%87%D8%A9_%D9%81%D8%A7%D8%B3_%D9%85%D9%83%D9%86%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Meknes.jpg","page_title":"جهة فاس مكناس","context_page_description":"جهة فاس مكناس هي إحدى الجهات الإدارية في التقسيم الجهوي الجديد للمملكة المغربية منذ 2015.\\nتجمع الجهة بين مدينتين لهما تاريخ سياسي وثقافي عريق في الجهة نفسها، ويتعلق الأمر بالعاصمة العلمية للمغرب فاس والعاصمة الإسماعيلية مكناس، اللتان أصبحتا تحت لواء جهة فاس مكناس، وتتكون من عمالتي فاس ومكناس وسبعة أقاليم هي بولمان، والحاجب، وإفران، وصفرو، وتاونات وتازة، ومولاي يعقوب"},{"page_url":"https://en.wikipedia.org/wiki/Foreign_policy_of_the_Bill_Clinton_administration","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Bill_Clinton%2C_Yitzhak_Rabin%2C_Yasser_Arafat_at_the_White_House_1993-09-13.jpg","page_title":"Foreign policy of the Bill Clinton administration","context_page_description":"The foreign policy of the Bill Clinton administration was the foreign policy of the United States during the two term Presidency of Bill Clinton, 1993 to 2001. Clinton's main foreign policy advisors were Secretaries of State Warren M. Christopher followed by Madeleine Albright in his second term. The Cold War had ended and the Soviet Union had disintegrated under his predecessor President George H. W. Bush, whom Clinton criticized for being too preoccupied with foreign affairs. The United States was the only remaining superpower, with a military strength far overshadowing the rest of the world. Absent the Cold War, Clinton's main priority was always domestic affairs, especially the domestic economy. Foreign-policy took a backseat, except to promote American trade, and during unexpected emergencies. His emergencies had to do with humanitarian crises which raised the issue of American or NATO or United Nations interventions to protect civilians, or armed humanitarian intervention, as the result of civil war, state collapse, or oppressive governments.\\nPresident George H. W."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0%D1%81-%D0%A0%D0%BE%D1%81%D0%B0%D1%81-%D0%B4%D0%B5-%D0%9C%D0%B0%D0%B4%D1%80%D0%B8%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Ayuntamiento_las_rozas.JPG","page_title":"Лас-Росас-де-Мадрид","context_page_description":"Лас-Росас-де-Мадрид — муніципалітет в Іспанії, у складі автономної спільноти Мадрид. Населення — 88 065 осіб.\\nМуніципалітет розташований на відстані близько 16 км на північний захід від Мадрида.\\nНа території муніципалітету розташовані такі населені пункти:\\nЛа-Чопера: 675 осіб\\nЛас-Росас-де-Мадрид: 42020 осіб\\nЛос-Каррілес: 3 особи\\nЛа-Сервера: 7 осіб\\nЛас-Сеудас: 32 особи\\nЛа-Дееса: 286 осіб\\nЕль-Гарсо: 3 особи\\nЛа-Пуентесілья-і-Лос-Махуелос: 11 осіб\\nЛас-Матас-Пінар-Монте-Росас: 45028 осіб"},{"page_url":"https://en.wikipedia.org/wiki/List_of_courthouses_in_Nebraska","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Richardson_County%2C_Nebraska_courthouse_from_NE.JPG","page_title":"List of courthouses in Nebraska","context_page_description":"This is a partial list of courthouses in Nebraska, besides Federal ones, which are listed here.\\nThe state of Nebraska has 93 counties. The Nebraska State Historical Society conducted a 1990 study of county courthouses in the state.\\nCourthouses marked with a †dagger are listed on the National Register of Historic Places."},{"page_url":"https://tl.wikipedia.org/wiki/Marilyn_Monroe","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Marilyn_Monroe_in_1952_TFA.jpg","page_title":"Marilyn Monroe","context_page_description":"Si Marilyn Monroe, ipinanganak bilang Norma Jeane Mortenson, ngunit bininyagan bilang Norma Jeane Baker, ay isang Amerikanang aktres, mang-aawit, at modelo. Gumanap siya sa mahigit sa 29 mga pelikula at naging bida sa loob ng 15 ng mga ito. Nagwagi siya ng maraming mga parangal na kinabibilangan ng tatlong Ginintuang Globo. Noong dekada ng 1950, naging simbolo siya ng seks sa kanluraning mundo. Kilala rin siya dahil sa kanyang tatlong bigong pagkakakasal kina, ayon sa pagkakasunudsunod, James Dougherty na isang pulis, kay Joe DiMaggio na isang manlalaro ng beysbol, at kay Arthur Miller na isang mandudula o manunulat ng dula. Noong 1999, inihanay siya ng instituto ng pelikula sa Amerika bilang pang-anim na dakilang bituin sa pelikula sa lahat ng panahon."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%A5%BF%E6%8B%89%E9%9B%85%E8%AA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Gospel_of_St._Matthew_in_Formosan.jpg","page_title":"西拉雅語","context_page_description":"西拉雅语是台湾平埔原住民族西拉雅族人所使用的语言，原本被语言学家及联合国教科文组织列为死语，但在台湾台南县西拉雅原委会的努力下逐渐复苏和使用。同时，将通过民间团体致函联合国教科文组织，希望该组织列为“死语”的西拉雅语能修正为复育中的语言。为台湾原住民语言之一种，属于南岛语系的次语群，亦归类为台湾南岛语第6群。昔日分布于台南一带的平原，以及花莲县玉里镇、富里乡，台东县关山镇、池上乡等地。台湾部分地名源自该语，如麻豆。\\n经由新港文书及《福尔摩沙语辞汇集》等荷兰人著作，西拉雅语被部分保留下来。"},{"page_url":"https://ru.wikipedia.org/wiki/Camponotus_nearcticus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Camponotus_nearcticus_casent0102697_dorsal_1.jpg","page_title":"Camponotus nearcticus","context_page_description":"Camponotus nearcticus — вид средних по размеру муравьёв из рода Camponotus."},{"page_url":"https://sv.wikipedia.org/wiki/Brunnadern","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Karte_Gemeinde_Brunnadern_2007.png","page_title":"Brunnadern","context_page_description":"Brunnadern är en ort i kommunen Neckertal i kantonen Sankt Gallen, Schweiz.\\nBrunnadern var tidigare en egen kommun, men den 1 januari 2009 bildades den nya kommunen Neckertal genom en sammanslagning av kommunerna Brunnadern, Mogelsberg och St. Peterzell."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%A1%D5%AF%D5%B8%D5%A2_%D4%B3%D5%A1%D5%A6%D5%A1%D5%A6%D5%B5%D5%A1%D5%B6_%D6%83%D5%A1%D5%B7%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Agop_Kazazyan_Pa%C5%9Fa.jpg","page_title":"Հակոբ Գազազյան փաշա","context_page_description":"Հակոբ Գազազյան փաշա, Օսմանյան բարձրաստիճան հայ պաշտոնյա, ով զբաղեցրել է ֆինանսների նախարարի և գլխավոր գանձապետի պաշտոնները Սուլթան Աբդուլ Համիդ II-ի պաշտոնավարման ընթացքում։"},{"page_url":"https://es.wikipedia.org/wiki/Guerra_civil_finesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/FinnishCivilWarMapEnd.svg","page_title":"Guerra civil finesa","context_page_description":"La guerra civil finesa o guerra civil finlandesa fue parte del caos social y nacionalista ocasionado en Europa en las postrimerías de la Primera Guerra Mundial. De un lado se encontraban las fuerzas socialdemócratas, dirigidas por la delegación popular de Finlandia, comúnmente conocidos como «rojos». Del otro lado se encontraban las fuerzas del senado, controladas desde el otoño anterior por los conservadores —quienes pretendían mantener el statu quo; es decir, conservar la independencia y la monarquía constitucional sin parlamentarismo—, popularmente conocidos como «blancos». Los rojos recibieron la ayuda de la Rusia bolchevique, mientras que los blancos fueron apoyados militarmente por el Segundo Imperio alemán.\\nLos finlandeses tienen muchos nombres para este conflicto: vapaussota, kansalaissota o sisällissota, luokkasota, punakapina, torpparikapina, veljessota e incluso vallankumous. Los historiadores actuales señalan que todos estos nombres diferentes son igual de válidos, aunque difieren en sus cargas propagandísticas."},{"page_url":"https://ca.wikipedia.org/wiki/Arcab%C3%BAs","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Hakenbuechse.png","page_title":"Arcabús","context_page_description":"L'arcabús és una arma de foc per a infanteria emprada del segle xv al XVII. És el predecessor del mosquet, el fusell i altres armes de foc llargues. Als Països Catalans primer s'emprà l'espingarda o escopeta.\\nEl primer ús documentat del terme arcabús es remunta a 1364, quan el senyor de Milà Bernabò Visconti va reclutar 70 archibuxoli, encara que potser, en aquest cas, el terme arcabús s'usa aquí com a sinònim de escopeta, ja que l'arcabús es va desenvolupar més endavant.\\nHabitualment un arcabús estava format per un canó de ferro d'ànima llisa d'aproximadament un metre de longitud, muntat sobre una fusta acanalada anomenada cep o caixa, l'extrem de la qual, per on es recolzava a l'espatlla, es deia culata. Es carregava per la boca del canó, el qual tenia a la part posterior un orifici, per on es provocava la ignició de la pólvora. El mecanisme per a disparar s'anomenava pany. Al principi aquest consistia en pany de metxa, muntat al cap d'una tija en forma de essa, el serpentí, que es davallava mitjançant una cordeta o amb una molla o ressort activat per un gallet o clau."},{"page_url":"https://de.wikipedia.org/wiki/Coma-Superhaufen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Virgo-Comahaufen-Wolf.png","page_title":"Coma-Superhaufen","context_page_description":"Der Coma-Superhaufen ist eine riesige Struktur von vielen tausend Galaxien, die sich in Richtung der Sternbilder Coma und Löwe befindet.\\nDer Großteil des Coma-Superhaufens besteht aus den zwei Galaxienhaufen Abell 1656 und Abell 1367. Sie werden in der Astronomie aber meist als Coma- bzw. Leo-Galaxienhaufen bezeichnet und stehen etwa 310 und 290 Millionen Lichtjahre von uns entfernt. Die beiden \\"Cluster\\" von Coma und Leo sind durch eine \\"Brücke\\" von Galaxien miteinander verbunden, möglicherweise existiert auch eine \\"Brücke\\" in unsere Richtung.\\nDer am Himmel benachbarte, fünfmal nähere Virgo-Galaxienhaufen im Sternbild Virgo ist ebenfalls Bestandteil eines Superhaufens, zu dem auch unsere Milchstraße und ihre \\"Lokale Gruppe\\" gehört. Viele Galaxienforscher deuten diese zwei Großstrukturen als zusammenhängend, weil sie durch eine lange Galaxienbrücke in Form eines Filaments miteinander in Verbindung stehen dürften, und sprechen vom Coma-Virgo-Superhaufen."},{"page_url":"https://la.wikipedia.org/wiki/Aluta","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Olt_river.jpg","page_title":"Aluta","context_page_description":"Aluta est flumen 615 km, quod influit in Danubium a sinistra parte. Comitatus Alutensis ab eo nomen deducit.\\nAluta in Carpatibus orientalibus oritur, Transsilvaniam percurrit et per per saltus Rubrae Turris nuncupatos in Valachiam permanat, ubi apud Islaz proxime Nicopolim Danubium subit."},{"page_url":"https://es.wikipedia.org/wiki/Pit_stop","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Ims2.jpg","page_title":"Pit stop","context_page_description":"Pit stop es la denominación en lengua inglesa de lo que en español tradicionalmente se ha conocido como parada en boxes, término utilizado en las carreras de motor para aludir a la parada que hace un vehículo durante la competición para repostar, cambiar los neumáticos, hacer reparaciones o ajustes mecánicos o cambiar el conductor. La calle de boxes ​ es la pista asfaltada que conecta el circuito con el pit stop, y que normalmente transcurre en paralelo a la recta final e inicial del circuito.\\nEn el pit stop pueden estar trabajando un número variable de entre 5 y 20 mecánicos, dependiendo del tipo de carrera, mientras que el conductor permanece esperando dentro del vehículo.\\nLas paradas en el pit stop permiten a los coches llevar menos combustible y utilizar neumáticos de menor duración, lo que a su vez les permite mejorar el rendimiento en carrera."},{"page_url":"https://en.wikipedia.org/wiki/Paracale","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Paracale_Port.jpg","page_title":"Paracale","context_page_description":"Paracale, officially the Municipality of Paracale, is a 3rd class municipality in the province of Camarines Norte, Philippines. According to the 2015 census, it has a population of 59,149 people."},{"page_url":"https://vi.wikipedia.org/wiki/Vivarium","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Terrarium2.jpg","page_title":"Vivarium","context_page_description":"Vivarium xuất phát từ trong tiếng Latin mang nghĩa chỗ sống, nó còn được gọi là hộp sinh thái hoặc lớn hơn là phòng sinh thái, là khu vực thường khép kín, nuôi nhốt và chăm sóc để quan sát hoặc nghiên cứu động thực vật. Vivarium thường mô phỏng trên qui mô nhỏ một phần hệ sinh thái của một loài đặc biệt với những tác động điều chỉnh được các nhân tố sinh thái. Lồng kính của vivarium thường có 1 nắp có thể tháo rời như dạng cửa để tiếp xúc trực tiếp được vào bên trong khi cần thiết. Ngoài mục đích dành cho nghiên cứu thì vivarium còn dùng cho mục đích tranh trí làm cảnh."},{"page_url":"https://de.wikipedia.org/wiki/Panathinaiko-Stadion","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Panathenaic_Stadium_-_panoramio_%281%29.jpg","page_title":"Panathinaiko-Stadion","context_page_description":"Das Panathinaiko-Stadion in Athen ist das Olympiastadion der ersten Olympischen Spiele der Neuzeit im Jahre 1896. Es wurde als Rekonstruktion auf den Fundamenten des antiken Stadions gebaut und befindet sich am Rande des Athener Stadtzentrums."},{"page_url":"https://ru.wikipedia.org/wiki/MacBook_Air","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Steve_Jobs_with_MacBook_Air.jpg","page_title":"MacBook Air","context_page_description":"MacBook Air — ноутбук серии MacBook с 13,3-дюймовым экраном, выпускающийся компанией Apple с 2008 года по настоящее время, а также его вариация с 11.6\\" экраном с 2010 года по 2016 год."},{"page_url":"https://es.wikipedia.org/wiki/USA_Pro_Cycling_Challenge_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Tejay_Van_Garderen_UPCC_2013.jpg","page_title":"USA Pro Cycling Challenge 2013","context_page_description":"La 3.ª edición del USA Pro Cycling Challenge, se disputó desde el 19 hasta el 25 de agosto de 2013.\\nLa carrera perteneció al UCI America Tour 2012-2013 en la categoría 2.HC. Empezó en un circuito entre Aspen/Snowmass y finalizó en las calles de Denver, capital del estado de Colorado.​\\nEl ganador de la clasificación general fue el estadounidense Tejay Van Garderen del equipo BMC Racing, quién además ganó una etapa. Fue escoltado en el podio por su compañero Mathias Frank y por Tom Danielson del equipo Garmin Sharp.\\nEn las clasificaciones secundarias Peter Sagan se llevó la de por puntos, en gran medida gracias a las 4 etapas que ganó. En las restantes triunfaron Matt Cooke, Lachlan Morton y el BMC Racing."},{"page_url":"https://pl.wikipedia.org/wiki/Osterstra%C3%9Fe","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/U-Bahnhof_Osterstra%C3%9Fe_6.jpg","page_title":"Osterstraße","context_page_description":"Osterstraße – stacja metra hamburskiego na linii U2. Stacja została otwarta 23 maja 1914."},{"page_url":"https://ar.wikipedia.org/wiki/PRB3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/PBB_GE_PRB3_206998_x_at_fs.png","page_title":"PRB3","context_page_description":"PRB3‏ هوَ بروتين يُشَفر بواسطة جين PRB3 في الإنسان."},{"page_url":"https://es.wikipedia.org/wiki/Borja_G%C3%B3mez_P%C3%A9rez","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Borja_G%C3%B3mez_P%C3%A9rez.jpg","page_title":"Borja Gómez Pérez","context_page_description":"Borja Gómez Pérez, es un futbolista español que se desempeña en la posición de defensa y actualmente está sin equipo. Sus anteriores equipos han sido el Real Murcia, elReal Oviedo, el Rayo Vallecano, AD Alcorcón y de las categorías inferiores del Real Madrid entre otros clubes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BC%D0%BE%D1%81%D1%82_(%D0%A0%D0%B8%D0%B3%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Riga_akmens_tilts_stone_bridge.jpg","page_title":"Каменный мост (Рига)","context_page_description":"Каменный мост — автодорожный мост через Даугаву в Риге, Латвия. Соединяет центр Риги с Пардаугавой."},{"page_url":"https://lb.wikipedia.org/wiki/Coldplay","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Coldplay-3.jpg","page_title":"Coldplay","context_page_description":"Coldplay ass eng englesch Britpop/Pop-Rock-Grupp, déi aus dem Chris Martin, Jonny Buckland, Will Champion a Guy Berryman besteet.\\nColdplay gehéiert zanter der Mëtt vun den 2000er Joren zu deene Rockgruppe mam gréisste Succès op der Welt."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D9%86%D8%AA_%D8%A7%D9%86%D8%AF%D8%B1%D9%88%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Huntingdon_Hall_-_geograph.org.uk_-_209385.jpg","page_title":"سنت اندروز","context_page_description":"سنت اندروز بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 16800 نفر دیر. بۇ شهر ایسکاتلند اؤلکه‌سینده یئرلشیب."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AA%E0%B5%81%E0%B4%95%E0%B4%B5%E0%B4%B2%E0%B4%BF%E0%B4%AF%E0%B5%81%E0%B4%9F%E0%B5%86_%E0%B4%86%E0%B4%B0%E0%B5%8B%E0%B4%97%E0%B5%8D%E0%B4%AF_%E0%B4%AB%E0%B4%B2%E0%B4%99%E0%B5%8D%E0%B4%99%E0%B5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Share-of-cancer-deaths-attributed-to-tobacco.png","page_title":"പുകവലിയുടെ ആരോഗ്യ ഫലങ്ങൾ","context_page_description":"പുകയില ഉപയോഗം മനുഷ്യന്റെ ആരോഗ്യത്തെ പൂർണ്ണമായും പ്രതികൂലമായി ബാധിക്കുന്നു. പുകയിലയുടെ ആരോഗ്യപരമായ പ്രത്യാഘാതങ്ങളെക്കുറിച്ചുള്ള ആശങ്കയ്ക്ക് ഒരു നീണ്ട ചരിത്രമുണ്ട്. ഗവേഷണങ്ങൾ പ്രധാനമായും നടക്കുന്നത് സിഗരറ്റ് ഉപയോഗത്തെക്കുറിച്ചാണ്\\nപുകയിലയുടെ പുകയിൽ, കാൻസറിന് കാരണമാകുന്ന, 70 ൽപ്പരം രാസവസ്തുക്കൾ അടങ്ങിയിരിക്കുന്നു. പുകയിലയിൽ അടങ്ങിയിട്ടുള്ള നിക്കോട്ടിൻ വളരെ ആസക്തിയുള്ള സൈക്കോ ആക്റ്റീവ് മരുന്നാണ്. പുകവലിക്കുമ്പോൾ, നിക്കോട്ടിൻ ശാരീരികവും മാനസികവുമായ ആശ്രിതത്വത്തിന് കാരണമാകുന്നു. അവികസിത രാജ്യങ്ങളിൽ വിൽക്കുന്ന സിഗരറ്റിന് ഉയർന്ന ടാർ ഉള്ളടക്കം ഉണ്ട്, അവ ഫിൽട്ടർ ചെയ്യാനുള്ള സാധ്യത കുറവാണ്, ഈ പ്രദേശങ്ങളിൽ പുകയില - പുകവലി സംബന്ധമായ അസുഖങ്ങൾ വരാനുള്ള സാധ്യത വർദ്ധിക്കുന്നു.\\nആഗോളതലത്തിൽ തടയാൻ കഴിയുന്ന ഏറ്റവും വലിയ മരണകാരണം പുകയില ഉപയോഗമാണ്. പുകയില ഉപയോഗിക്കുന്നവരിൽ പകുതിയോളം പേരും പുകയില ഉപയോഗത്തിന്റെ സങ്കീർണതകളാൽ മരിക്കുന്നു. ലോകാരോഗ്യ സംഘടന കണക്കാക്കുന്നത് ഓരോ വർഷവും പുകയില 6 ദശലക്ഷം മരണങ്ങൾക്ക് കാരണമാകുന്നു എന്നാണ്. ഇതിൽ 600,000 എണ്ണം പുകവലിക്കാത്തവരിൽ നിഷ്ക്രിയ പുകവലി മൂലമാണ് സംഭവിക്കുന്നത്. ഇരുപതാം നൂറ്റാണ്ടിൽ പുകയില 100 ദശലക്ഷം മരണങ്ങൾക്ക് കാരണമായതായി കണക്കാക്കപ്പെടുന്നു."},{"page_url":"https://fr.wikipedia.org/wiki/Minist%C3%A8re_de_la_Culture_de_la_R%C3%A9publique_tch%C3%A8que","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Ji%C5%99%C3%AD_Besser.jpg","page_title":"Ministère de la Culture de la République tchèque","context_page_description":"Le ministère de la Culture de la République tchèque est le département ministériel tchèque chargé de l'organe central de l'administration publique dans le domaine de la culture de la République tchèque.\\nIl est dirigé depuis le 27 août 2019 par le social-démocrate Lubomír Zaorálek."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9B%BC%E6%89%98%E7%93%A6%E4%B8%BB%E6%95%99%E5%BA%A7%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Il_Duomo_di_Mantova_2.JPG","page_title":"曼托瓦主教座堂","context_page_description":"曼托瓦聖伯多祿宗徒主教座堂是天主教曼托瓦教區的主教座堂，位於義大利北部倫巴第大區城市曼托瓦，供奉聖伯多祿。"},{"page_url":"https://en.wikipedia.org/wiki/Villa_Pojana","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Villa_Pojana_photo_by_Marcok_2009-08-08_n07.jpg","page_title":"Villa Pojana","context_page_description":"Villa Pojana or Poiana, is a patrician villa in Pojana Maggiore, a town of the Province of Vicenza in the Veneto region of Italy. It was designed by the Italian Renaissance architect Andrea Palladio. It is conserved as part of the UNESCO World Heritage Site \\"City of Vicenza and the Palladian Villas of the Veneto\\"."},{"page_url":"https://es.wikipedia.org/wiki/Neferkara_Jendu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Abydos_Koenigsliste_40-47.jpg","page_title":"Neferkara Jendu","context_page_description":"Neferkara Jendu, o Neferkara IV fue un faraón de la Dinastía VII, durante el primer periodo intermedio de Egipto.\\nEl Viejo Orden se derrumba al final de la Dinastía VI y los nomarcas del Alto Egipto establecen la hegemonía sobre sus territorios. Este gobernante podría pertenecer también a un consejo temporal de mandatarios, constituido en un periodo de dificultades políticas o económicas. La situación en Menfis debía ser caótica pues Manetón comentó, según Julio Africano, que la dinastía se compuso de \\"70 reyes de Menfis, reinando 70 días\\".\\nSu nombre, Neferkara Jendu, se encuentra en:\\nLa Lista Real de Abidos\\nEn un sello cilíndrico"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%81%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/20090905_Suzhou_Lion_Grove_Garden_4502.jpg","page_title":"Китайський сад","context_page_description":"Кита́йський сад — це стиль ландшафтного саду, що розвивався на теренах Китаю протягом трьох тисяч років. Він включає як величезні сади китайських імператорів та членів їхніх родин, створені для насолоди та справляння враження, так і більш приватні сади вчених, поетів, колишніх урядовців, військових та купців, створені для розмірковування та втечі від зовнішнього світу. Сади створюють ідеалізовані міні-ландшафти, спрямовані на висловлення гармонії, яка має існувати між людиною та природою.\\nТиповий китайський сад оточений стінами та включає один чи більше ставків, кам'яні брили, дерева та квіти, а також низку залів та павільйонів у саду, поєднаних вигнутою стежкою та зиґзаґоподібними галереями. Рухаючись від будівлі до будівлі, відвідувачі можуть побачити серію дбайливо облаштованих пейзажів, що розгортаються перед ними, як пейзажний сувій."},{"page_url":"https://pl.wikipedia.org/wiki/Wydzia%C5%82_Fizyki_Uniwersytetu_Warszawskiego","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Wojciech_Rubinowicz_tablica_ul_Hoza_74.jpg","page_title":"Wydział Fizyki Uniwersytetu Warszawskiego","context_page_description":"Wydział Fizyki Uniwersytetu Warszawskiego – wydział Uniwersytetu Warszawskiego prowadzący badania naukowe i kształcący w dziedzinach:\\nfizyka,\\nastronomia,\\nzastosowania fizyki w biologii i medycynie,\\ninżynieria nanostruktur,\\nenergetyka i chemia jądrowa,\\ngeofizyka w geologii.\\nOd 1997 r. Wydział Fizyki jest animatorem Warszawskiego Festiwalu Nauki.\\nOd 2013 Wydział ma status Historycznego Miejsca Europejskiego Towarzystwa Fizycznego – tytuł ten nadawany jest miejscom szczególnie ważnym dla rozwoju europejskiej fizyki."},{"page_url":"https://en.wikipedia.org/wiki/Pillgwenlly","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Courtybella_Terrace%2C_Pillgwenlly_-_geograph.org.uk_-_1770522.jpg","page_title":"Pillgwenlly","context_page_description":"Pillgwenlly, usually known as Pill, is an electoral district and coterminous community parish in the city of Newport, South Wales. The area is governed by the Newport City Council."},{"page_url":"https://fi.wikipedia.org/wiki/Nazi_Boni","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/2015.03-427-032app_monument%28for_politician_and_writer_Nazi_BONI%29%2Creading_D%C3%A9dougou%2CBF_thu05mar2015-1032h.jpg","page_title":"Nazi Boni","context_page_description":"Nazi Boni oli burkinalainen poliitikko ja kirjailija.\\nBoni kävi alakoulun Ouagadougoussa ja opiskeli William Pontyn normaalikoulussa Senegalissa. Hän työskenteli opettajana Ouagadougoussa ja Norsunluurannikolla.\\nToisen maailmansodan jälkeen Boni siirtyi politiikkaan. Hänet valittiin Ranskan Ylä-Voltan yleisneuvostoon ja Bobo-Dioulasson kaupunginvaltuustoon vuonna 1947 sekä Ylä-Voltan edustajaksi Ranskan kansalliskokoukseen vuosina 1948, 1951 ja 1956. Vuonna 1957 hänestä tuli Ylä-Voltan aluekokouksen puheenjohtaja.\\nBoni oli kansallisuudeltaan bwamu ja edusti politiikassa Ylä-Voltan länsiosan väestöä. Hän kuului siirtomaavallan tukemaan Union voltaïque -puolueeseen sekä perusti vuonna 1955 Mouvement populaire de l’évolution africaine ja vuonna 1959 Mouvement du regroupement voltaïque -puolueet. Boni vastusti Ylä-Voltan politiikkaa hallinnutta Rassemblement démocratique africain -puoluetta ja kannatti Malin liittovaltiota Ranskan Länsi-Afrikan hajottua.\\nBoni kärsi tappion vuoden 1959 vaaleissa ja joutui pakenemaan ulkomaille Maurice Yaméogon noustua valtaan. Hän asui Bamakossa, Pariisissa ja Dakarissa ja palasi Ylä-Voltaan vuoden 1966 vallankaappauksen jälkeen."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%93%D0%BE%D0%B1%D0%B0_(%D0%BC%D1%8D%D1%82%D1%8D%D0%B0%D1%80%D1%8B%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Hoba_Meteorite.jpg","page_title":"Гоба (мэтэарыт)","context_page_description":"Гоба — найбуйнейшы сярод знойдзеных мэтэарытаў. Гэты жалезісты мэтэарыт масай 60 тон і аб’ёмам 9 м³ быў знойдзены ў Намібіі ў 1920. Мэтэарыт упаў прыкладна 80 тыс. гадоў таму."}]`),T={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},L={class:"search-container"},F={class:"card-container"},G={key:0,class:"empty-state"},I=["disabled"],R={key:0},H={key:1};f